INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(1, 2, 'Christy Eller', 'https://www.google.com/maps/contrib/101565948296538701409/reviews', 'en', 'https://lh4.googleusercontent.com/-x5CcdRVqtgk/AAAAAAAAAAI/AAAAAAAAAN4/6bl-Ph88YrE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 years ago', 'The Healing Center Medical Clinic has helped thousands of good Alaskans provide their own natural pain relief. They do not judge. They are here to provide healthy choices for Alaskans.', 1382658518),
(2, 2, 'Ariane Ridgway', 'https://www.google.com/maps/contrib/109009707874163658134/reviews', 'en', 'https://lh4.googleusercontent.com/-gQHGh1r-pe0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2uYEU2gYtNELZHzBBmJaG5XBqHUA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a year ago', 'Love them', 1487361563),
(3, 2, 'Bill Fikes', 'https://www.google.com/maps/contrib/115501717110340179248/reviews', 'en', 'https://lh6.googleusercontent.com/-zai66VyEzeE/AAAAAAAAAAI/AAAAAAAADBY/h2twiMdz0YY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '4 years ago', 'I have never had a more terrible experience with a company in my life!', 1381235313),
(4, 3, 'Erika Douglass', 'https://www.google.com/maps/contrib/104819454907428050416/reviews', 'en', 'https://lh6.googleusercontent.com/-bYh-EHaIZHs/AAAAAAAAAAI/AAAAAAAALo4/s-2xjogYcv4/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'Great set up, and bright open shop.  Budtender was friendly and helpful. Prices were a little higher than we see in MatSu, but still reasonable.', 1527665560),
(5, 3, 'John J.O', 'https://www.google.com/maps/contrib/104620556192314234992/reviews', 'en', 'https://lh4.googleusercontent.com/-J08L8q7arjU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1WYLUai5cdPBRq58S_x9edKkaKxA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'I love it here! Chelsea and Lisa are very nice and it makes the experience that much better!\n\nThank you! ', 1499379799),
(6, 3, 'Michelle brooks', 'https://www.google.com/maps/contrib/114328558499605956924/reviews', 'en', 'https://lh5.googleusercontent.com/-OROUY33RVlc/AAAAAAAAAAI/AAAAAAAAKK8/UKYQZVE2k3o/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I love the ppl good prices and great products', 1487788618),
(7, 3, 'Tom Cody', 'https://www.google.com/maps/contrib/102070919782187931593/reviews', 'en', 'https://lh5.googleusercontent.com/-juylLZ-N1lY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2YytkvMSkYPgMwsrQB0r4ZnSZNhA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a year ago', 'Nice people, professional, decent selection.', 1479430149),
(8, 3, 'Steven Sanders', 'https://www.google.com/maps/contrib/113497706937725768306/reviews', 'en', 'https://lh5.googleusercontent.com/-K131RmaHHSM/AAAAAAAAAAI/AAAAAAAAC70/SUGXg1_FhkY/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a month ago', '', 1523237077),
(9, 4, 'TheDrumscum', 'https://www.google.com/maps/contrib/105684239342042392300/reviews', 'en', 'https://lh4.googleusercontent.com/-qIf3K1YoIsk/AAAAAAAAAAI/AAAAAAAAABE/Xr_BHZsSFSQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Best cannabis retailer in the state of Alaska. Knowledgeable bud tenders, expertly rolled doobies and the biggest selection you\'ll find anywhere in the 49th state!', 1526193838),
(10, 4, 'Dave Nunley', 'https://www.google.com/maps/contrib/100802441316896798462/reviews', 'en', 'https://lh6.googleusercontent.com/-munfkHmyOXc/AAAAAAAAAAI/AAAAAAAAAO8/G1vDaizTa0c/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Excellent selection, knowledgeable, friendly staff, great location and good prices. They stock Peace Frog Botanicals products, which are all top shelf.', 1518816325),
(11, 4, 'Teresa Jump', 'https://www.google.com/maps/contrib/100155481893180331213/reviews', 'en', 'https://lh3.googleusercontent.com/-aei45NhL7cI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2JLhLVUWMUxJichoMsFNGcLnJa7A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I had an excellent experience the first time I visited, helpful informative and professional staff made my first time in a dispensary not as daunting and uncomfortable as I thought it would be! I\'ve been back several times since and would recommend their services to anyone!', 1518496771),
(12, 4, 'Tracy Smock Rector', 'https://www.google.com/maps/contrib/105903167796407129137/reviews', 'en', 'https://lh3.googleusercontent.com/-cFpjrhL0thg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq16BUS5SRvk5smk6kQdcdf8zyrYDg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'Always friendly & helpful employees. Good selection of product.', 1517165206),
(13, 4, 'Josh Mease', 'https://www.google.com/maps/contrib/115972926111746150795/reviews', 'en', 'https://lh6.googleusercontent.com/-C6Bgx7qd8CQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3iauhIVfGyfF_dX7934OPtWDssgA/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 4, '6 months ago', 'This place has some very nice knowledgeable funny staff, usually a pretty diverse selection of flower and the pricing isn\'t bad for the area.', 1511859073),
(14, 5, 'Alexis Sisneros', 'https://www.google.com/maps/contrib/107339393151798959294/reviews', 'en', 'https://lh4.googleusercontent.com/-IRuJjJ39PKc/AAAAAAAAAAI/AAAAAAAAAIM/SYrlz6wD9Ac/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Called to ask if they would stay open an extra five minutes. The man asked his boss and said 10:05, latest he could do. My husband drove from Eagle River, got there right at 10 and of course they did not stay open the extra five minutes as promised. We would not have wasted the gas but were told we would be good. We spend A LOT of money on this type of product and these guys just lost our business before we ever even spent a dime there. Now we know what kind of people run this place!', 1523167892),
(15, 5, 'Josh Harshman', 'https://www.google.com/maps/contrib/105843513021322394471/reviews', 'en', 'https://lh5.googleusercontent.com/-xKm6yh5tlM8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1iTdoRcjdGaAzCnvMs8xUorr4iOA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This place is so inviting. Such a great selection of staff. So friendly. I would highly definitely recommend this place. So clean as well and professional. Thank you for the great experience.', 1520120604),
(16, 5, 'nastygutterqueen666', 'https://www.google.com/maps/contrib/109576681767781586358/reviews', 'en', 'https://lh5.googleusercontent.com/-hvt8Q8NwtFo/AAAAAAAAAAI/AAAAAAAAaY0/mWHwUTYTSU0/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 weeks ago', 'Nice place, friendly ppl. Staff was very helpful. I will be coming back.', 1526031947),
(17, 5, 'Dexter Bordeaux', 'https://www.google.com/maps/contrib/101558032504927715565/reviews', 'en', 'https://lh4.googleusercontent.com/-bsmuyT1nqck/AAAAAAAAAAI/AAAAAAAAABQ/cHv5e3bKyzs/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Horrible customer service there every time we have gone there.  Not only did I have a bad experience but my friends did also.  So glad there is better options like the fuzzy buds or green light.  Don’t choose this place.', 1519952852),
(18, 5, 'Derek Hert', 'https://www.google.com/maps/contrib/115336331490673474667/reviews', 'en', 'https://lh4.googleusercontent.com/-6phzJhZflfs/AAAAAAAAAAI/AAAAAAAAAHA/wy6yRlWk458/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Great place to shop without feeling like you\'re in a dirty and dark place. Great staff with useful knowledge! Sue and her new staff really know customer service!', 1517027786),
(19, 6, 'Kizzy Brown', 'https://www.google.com/maps/contrib/113936024078412901656/reviews', 'en', 'https://lh3.googleusercontent.com/-L229wpZYA1k/AAAAAAAAAAI/AAAAAAAAMGg/NjLq-YVOkkY/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'They are great. Very knowledgable about the products.  Good prices and have like a rewards program too.  Can\'t at enough about.', 1524638854),
(20, 6, 'Natchez Dunlap', 'https://www.google.com/maps/contrib/105627109301190198112/reviews', 'en', 'https://lh4.googleusercontent.com/-N9bWXwNMBX0/AAAAAAAAAAI/AAAAAAAAAJ4/AvDaCv466Q4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The Best place in Town hands down! Great Staff/ Great Marijuana', 1526856345),
(21, 6, 'Scott Leard', 'https://www.google.com/maps/contrib/100646928253149053109/reviews', 'en', 'https://lh3.googleusercontent.com/-nyLkhXacqZc/AAAAAAAAAAI/AAAAAAAAADE/9XoDomb5esw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'This is a nice store.   The prices are good.  I picked up some really nice crumble.  I will be sure to visit again.', 1518511275),
(22, 6, 'Martyr Scorpio', 'https://www.google.com/maps/contrib/108563624903181436679/reviews', 'en', 'https://lh6.googleusercontent.com/-B9QDUKs6Hag/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1hRGFVoZi9kmkDM26TJvRkTFunTQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'Wow! Definitely not coming here anymore! That new girl Ariel is bad for business, used to be a loyal customer cause the store is close to my house, BUT I WILL DRIVE CLEAR ACROSS TOWN FOR NOW ON!! One monkey may not stop the show, but it will hinder the cash flow!', 1517267302),
(23, 6, 'Rachel Coelho', 'https://www.google.com/maps/contrib/110502664912187557497/reviews', 'en', 'https://lh5.googleusercontent.com/-KdMjmuZaRUM/AAAAAAAAAAI/AAAAAAAAKkA/CLhW_BV5t6E/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'Worst costumer service I have ever experienced. An employee named Ariel had an attitude when I simply asked a question about how she got into the Cannibis industry. She was beyond rude and had a piss poor attitude. I will not ever be going to this dispensary after such horrible customer service. Its a shame they would hire someone who obviously has no experience with how to treat your costumers.', 1517034681),
(24, 7, 'Colby Wright', 'https://www.google.com/maps/contrib/117709729631903496191/reviews', 'en', 'https://lh6.googleusercontent.com/-uzsBeC0tqKY/AAAAAAAAAAI/AAAAAAAAAHQ/-oomEbYmhzA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Depends on what you\'re looking for in a shop, but the staff here are incredibly friendly, knowledgeable, and helpful. The strands are usually high quality though, like most shops in Anchorage, the taxes are screwing with any chance at good prices. Definitely worth a visit if you need your green.', 1522434796),
(25, 7, 'Trunk', 'https://www.google.com/maps/contrib/114261252767927448312/reviews', 'en', 'https://lh4.googleusercontent.com/-_9y3wbW33oo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0JeTt5zRVAR0kNxsW1kOWrR7tA5A/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'in the last week', 'Selection was decent and they have great times for being open. Staff seemed about average compared to other stores. But, their pre rolls are generally garbage. So far 1/5 hasn\'t run on me and putting them out multiple times to re-light them is getting really annoying. Not sure if it\'s the bud or the papers being used but they also seem way to tight. I shouldn\'t have to do anything to the product in preparation to smoke it. That\'s why I bought pre rolled. One other shop seems to have the same issue but another one I frequent doesn\'t have these issues. Better quality control would be nice, hopefully they get better cause I wouldn\'t mind trying them a couple more times.', 1527549735),
(26, 7, 'Jarel Trott', 'https://www.google.com/maps/contrib/118236873308208229241/reviews', 'en', 'https://lh5.googleusercontent.com/-wSmBVeb-pZs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2xqSmxfxliXzgpiocfMgU2P8dtyw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '3 months ago', 'Great staff, I went in with a discrepancy one time and they handled it to my satisfaction, even when I didn\'t think it would go well. There was another instance of them going out of their way, and I appreciate that also. The prices, and inventory, could be a little more competitive in all honesty.', 1519859642),
(27, 7, 'Casey Cleary', 'https://www.google.com/maps/contrib/101505348358448995276/reviews', 'en', 'https://lh4.googleusercontent.com/-Mf6_K_P7LpY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq063uOQaafyaTRCdo-RBydNt512Xg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Wonderful products and Friendliest staff in town!! Great place to visit!! Staff is very knowledgeable and successful in making their customers feel appreciated every time they visit!!', 1522017704),
(28, 7, 'Garrett Rodgers', 'https://www.google.com/maps/contrib/102927660725148662592/reviews', 'en', 'https://lh4.googleusercontent.com/-8s8XuDWHgYQ/AAAAAAAAAAI/AAAAAAAAAGY/8JLGGBBmLFg/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '3 months ago', 'By far the most professional and pleasant head shop you will find in Anchorage. Only issues I have had is they have a rewards program and they don\'t always keep track of your rewards. Definitely the nicest pot sellers in town.', 1518534452),
(29, 9, 'Chris and Becky', 'https://www.google.com/maps/contrib/117962963302583251523/reviews', 'en', 'https://lh4.googleusercontent.com/-DG91aMT5pew/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1yf6zcK1wPTTksv7T47XqCLpMcqw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Great prices! Great selection! Everyone is very helpful and knowledgeable about their product. Everyone has a great attitude. I\'ve tried every place in town and this place is the most consistent for variety and quality. Everything is very reasonably priced, I don\'t bother going anywhere else now.', 1520561300),
(30, 9, 'Sandra Pittman', 'https://www.google.com/maps/contrib/103775626043833379295/reviews', 'en', 'https://lh6.googleusercontent.com/-pFw5-HOxy2M/AAAAAAAAAAI/AAAAAAAAACg/VK7tuI7bCso/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'My go to weed shop. They are always running some good deals on their selection.  I\'ve only gotten flower here and never have been disappointed. I do, however, research what they have in stock on their website before heading down to the shop so I know what I want ;)', 1525075531),
(31, 9, 'nastygutterqueen666', 'https://www.google.com/maps/contrib/109576681767781586358/reviews', 'en', 'https://lh5.googleusercontent.com/-hvt8Q8NwtFo/AAAAAAAAAAI/AAAAAAAAaY0/mWHwUTYTSU0/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 weeks ago', '1st place in town to get vape pens. But now that every one else has them, I just go wherever now.', 1526033015),
(32, 9, 'Rock Reed', 'https://www.google.com/maps/contrib/116810159935878340188/reviews', 'en', 'https://lh4.googleusercontent.com/-lsOyLAHVvr0/AAAAAAAAAAI/AAAAAAAAAKI/0GPTLn6YUSY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 weeks ago', 'Loved this place since it opened, now I\'m even happier with the price drop!', 1525993126),
(33, 9, 'Tawanna Williams', 'https://www.google.com/maps/contrib/113192245686878139999/reviews', 'en', 'https://lh5.googleusercontent.com/-0MlJWQDiiyY/AAAAAAAAAAI/AAAAAAAAY9g/MCeheBigv9k/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'For Alaska this is a good shop with great prices. Other stores in Anchorage are expensive. They have great deals on eighths all the time.', 1521323216),
(34, 10, 'Paul Sturgeon', 'https://www.google.com/maps/contrib/115191387554544184968/reviews', 'en', 'https://lh3.googleusercontent.com/-2ElSsEs2oOg/AAAAAAAAAAI/AAAAAAAAWJA/49hcS8AxpCw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Great Store.  Wide selection.  No Deli Style.  Pre Rolls are.  Friendly staff.  GREAT SELECTION OF CONCENTRATES!', 1523230628),
(35, 10, 'John Perkins', 'https://www.google.com/maps/contrib/107184225858465872503/reviews', 'en', 'https://lh5.googleusercontent.com/-9ihBS5Rpjoo/AAAAAAAAAAI/AAAAAAAAAGI/EJCsHO9VZw8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The. Best place I have found yet. Best selection and prices. Thanx', 1524595622),
(36, 10, 'Kym Wasilla', 'https://www.google.com/maps/contrib/111153664375844848294/reviews', 'en', 'https://lh5.googleusercontent.com/-Vm2BKLb1l6A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Z9vYK1CN8RpbEpQFckgggKsU0-w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Extremely nice guys. Very helpful & informative, but not pushy. Great space & layout. Plenty of room to look around, Great Deals, & Lots of Product choices!', 1512113845),
(37, 10, 'Ashana Flippo', 'https://www.google.com/maps/contrib/100707411676280938483/reviews', 'en', 'https://lh6.googleusercontent.com/-e8xhoMOor4Q/AAAAAAAAAAI/AAAAAAAAAHs/0D0g7wmMMcc/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '5 months ago', 'Friendly and knowledgeable staff, good selection of products. Nice atmosphere. Awesome customer service was my favorite part', 1512607642),
(38, 10, 'Rita Puri', 'https://www.google.com/maps/contrib/109462364605063178424/reviews', 'en', 'https://lh3.googleusercontent.com/-4_w-NkH7Afc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2r1Do9vnnsqUD3fwvK5boCrf-L8w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Best place in the valley,previously I said that about another shop who is number 2!Denali actually had a sale on cartridges something other shops need to do#!!', 1515722273),
(39, 11, 'Charles Montano', 'https://www.google.com/maps/contrib/107852576962671399948/reviews', 'en', 'https://lh6.googleusercontent.com/-lmhIz0CZhcU/AAAAAAAAAAI/AAAAAAAAB9E/X11o7MuaaBU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'In and out kinda place, which is lovable. Never too busy because they\'re good at moving traffic. Always have good bud and they\'re business model makes sense. Finally got a reward system do that\'s cool also. Leading the way for the other dispensaries in the area, by far. Thanks for your service.', 1525409012),
(40, 11, 'josh stewart', 'https://www.google.com/maps/contrib/110808224248293733277/reviews', 'en', 'https://lh3.googleusercontent.com/-pjwDQ5aym50/AAAAAAAAAAI/AAAAAAAAHaI/j79aobVRjf8/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, '3 months ago', 'Love it due to it being the only shop in town providing clones in starter cubes, not soil.  Decent price for their products. The strains are top notch. The in house products are awesome. My advice, find a dispensary you trust and enjoy... spend your money there, if they do not continue to improve quality and value... shop elsewhere. I doubt this will be an issue at arctic herbery', 1518052890),
(41, 11, 'J Edsall', 'https://www.google.com/maps/contrib/114445024908772492500/reviews', 'en', 'https://lh3.googleusercontent.com/-DitBx3bk4Ck/AAAAAAAAAAI/AAAAAAAAAyo/R4ynAMayf3k/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 weeks ago', 'Small with edibles. Glass accessories. Popular Cali strains. No Alaska strains  Blueberry Northrn lights. But good quality average prices.', 1526268967),
(42, 11, 'Adam Davis', 'https://www.google.com/maps/contrib/112112006107850674547/reviews', 'en', 'https://lh4.googleusercontent.com/-HPL-ysc6eBo/AAAAAAAAAAI/AAAAAAAABqA/1LnbawK9TnI/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 months ago', 'The staff are great. Knowledgeable and informative. Being the first one to open in Alaska they have been able to fine tune their selection. Parking in the front is small but around back a fenced parking lot.', 1517869927),
(43, 11, 'Wicked Angel 907', 'https://www.google.com/maps/contrib/103680244173909301122/reviews', 'en', 'https://lh3.googleusercontent.com/-S_39pCT9aeo/AAAAAAAAAAI/AAAAAAAAFDE/qBkSncaG5dk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'The front desk staff was very helpful and informative.\n\nThe vibe was chill, yet very professional.\n\nThey have quite a selection when it comes to Marijuana and the tools to consume it.\n\nBest dispensary in Anchorage!', 1501814732),
(44, 12, 'Robin Beyer', 'https://www.google.com/maps/contrib/109365322615670015146/reviews', 'en', 'https://lh6.googleusercontent.com/-amsZDWnfj4w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2On9CaJ61lIYgBAFOy2fC0JwU2vg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Austin and Sireana are sweet hearts ,Its a pleasure to come here, and they have the best quality flower in town people!!!#4evercustomer', 1525895276),
(45, 12, 'Jared Jensen', 'https://www.google.com/maps/contrib/101542479539414681926/reviews', 'en', 'https://lh5.googleusercontent.com/-bwOFFU53Tok/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1fq_nQRlY6Yn4pF-LPTo2ZxYVB8w/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'There prices were great and the staff was super friendly and very knowledgeable.  They had a wide selection of just about everything!', 1524516799),
(46, 12, 'Len Trimmer', 'https://www.google.com/maps/contrib/105888818944617331903/reviews', 'en', 'https://lh4.googleusercontent.com/-8xos7L1YnRg/AAAAAAAAAAI/AAAAAAAAAF8/EBFTtWvg5JE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, '2 weeks ago', 'Good product', 1526188353),
(47, 12, 'Tommy Brown II', 'https://www.google.com/maps/contrib/110264826820658141748/reviews', 'no', 'https://lh6.googleusercontent.com/-rYgqb_5NKmc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2N2DO96ubdMyhX6kplilvoXiuD9A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The best dro', 1526628481),
(48, 12, 'Brenda Flores', 'https://www.google.com/maps/contrib/108242952086957771609/reviews', 'en', 'https://lh3.googleusercontent.com/-GRWk2rSk-O4/AAAAAAAAAAI/AAAAAAAAfzg/MSa4PPx-fgY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', '', 1527542876),
(49, 13, 'Manuel Colon', 'https://www.google.com/maps/contrib/101085462890129252341/reviews', 'en', 'https://lh5.googleusercontent.com/-wrOOqqJmml4/AAAAAAAAAAI/AAAAAAAAAMI/r3vi7ks3n8k/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'Friendly & knowledgeable staff (of which I am now a member) great product selection. We have a new variety of THC edibles as well as CBD (gummies, vape oils, tinctures, topicals) etc.', 1527014394),
(50, 13, 'Thomas Bolash', 'https://www.google.com/maps/contrib/106547566527916396284/reviews', 'en', 'https://lh4.googleusercontent.com/-JFsIsD7PY64/AAAAAAAAAAI/AAAAAAAAAHE/d9Q30TK0SGM/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', '$20 grams, $10 pre-rolls, pipes, concentrates, edibles... EVEN MUNCHIES!!! I. Love. This. Place!!! The staff knows it all and are always happy to see returning customers. Plus, it\'s 3 blocks from my house.', 1521241623),
(51, 13, 'Evan Harrington', 'https://www.google.com/maps/contrib/100862960671969560004/reviews', 'en', 'https://lh6.googleusercontent.com/-ym2SEJATyv8/AAAAAAAAAAI/AAAAAAAADWo/x_No0ZfWyks/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '4 months ago', 'Nothing like waking up and seeing god gave you another day', 1515308543),
(52, 13, 'Mary Jane', 'https://www.google.com/maps/contrib/110243617599623655340/reviews', 'en', 'https://lh3.googleusercontent.com/-2hNWfbQi4ks/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq18DImB6C6z8OnyopK-_5cLKLzo_A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '10 months ago', 'Service was good but when I got home, product didn\'t weigh what was posted on package. Went back to exchange package for another one with the right weight but they didn\'t exchange. This was very disappointing. If they say it\'s $20 for a gram then you should get a gram. I will not go back and I will tell my friends not to go back. So disappointed they wouldnt correct the problem. ', 1501194531),
(53, 13, 'Elyzabeth Gimarc', 'https://www.google.com/maps/contrib/113467763548314564898/reviews', 'en', 'https://lh6.googleusercontent.com/-8xPULIgZPhk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1tzOLh_kx9oMVUEchCjEgq1Wv99A/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '10 months ago', 'The service was by far amazing, the staff was nice and the product was mmm. I will always come back!! They hooked it up with gummy bears lol', 1501035693),
(54, 14, 'Andoru Andason', 'https://www.google.com/maps/contrib/101340053333461570748/reviews', 'en', 'https://lh6.googleusercontent.com/-2hZne0k9Fus/AAAAAAAAAAI/AAAAAAAAIb0/wmx89YTUINo/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'This place always has decent prices. The staff is always friendly, the overall selection is great! I love the $8 pre-rolls... I miss the superglue #2 though!', 1525060541),
(55, 14, 'Courtney Moses', 'https://www.google.com/maps/contrib/100285083136147282292/reviews', 'en', 'https://lh5.googleusercontent.com/-7fgOPMVFznk/AAAAAAAAAAI/AAAAAAAAKXg/j1wHeg5xATM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Excellent customer service. I\'m new to this and so I know I am a more needy customer than your average person, but the staff was incredibly friendly and more than happy to help me pick strains based off of my needs. I have to drive past 4+ other dispensaries on the 35minute drive there, but it\'s worth it by far.', 1524847813),
(56, 14, 'Danielle Teaver', 'https://www.google.com/maps/contrib/117273185126721007590/reviews', 'en', 'https://lh6.googleusercontent.com/-q96f8NuVCJU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Cn_r2vwvu5_I1J9FOoSs93ChTww/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Best establishment in town. My go-to. Great prices and a huge selection of products.', 1522985943),
(57, 14, 'Larry Randolph', 'https://www.google.com/maps/contrib/103387144235928158002/reviews', 'en', 'https://lh5.googleusercontent.com/-Zupj1hhdLKk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0QqJht5--97kwafXG9C6o4clVmmw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'It is all ways good to go down see what going on and what they have to smoke thanks guys', 1522445204),
(58, 14, 'Jw Harris', 'https://www.google.com/maps/contrib/111623648695389074690/reviews', 'en', 'https://lh6.googleusercontent.com/-LSSR1Mzjruk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1hdB2v9Sh0txeUgoXxH8XIzgT71Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Best shop in town!!! Super friendly staff very knowledgeable about the products and can help you out if your new to things.', 1519503954),
(59, 15, 'Aubrey Craig', 'https://www.google.com/maps/contrib/100097343282561796104/reviews', 'en', 'https://lh4.googleusercontent.com/-d6xhK46CeEk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq15lkm-amAY5paimq3YyxoK56rpxA/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a week ago', 'Very nice place, very professional and nice staff. Cheap bud as well(I mean that in a very good way) and it gets the job done. 7 dollar half gram pre-rolls, not a bad deal at all. Props guys! Killin it!', 1526928324),
(60, 15, 'Andrew Scott', 'https://www.google.com/maps/contrib/112581441924627178908/reviews', 'en', 'https://lh5.googleusercontent.com/-jztwLt95sAE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3_ZmSrE8mkj2RYgSgoA1yr3zRmFQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, 'a month ago', 'Nope. They have changed their format, and now the cheapest thing you can buy is .5 for $7. The point system has also changed, leaving my check-in balance lacking by 8 visits. I went to use my points, and now there\'s a restriction on the amount you need to spend. Not cool, used to be cool...', 1524808442),
(61, 15, 'KEN TOUGH', 'https://www.google.com/maps/contrib/106704803484968942856/reviews', 'en', 'https://lh6.googleusercontent.com/-rivqrBFOgHk/AAAAAAAAAAI/AAAAAAAAABA/37qsHvO8VXQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Love this store they are the best in town. Great staff and great product and an amazing environment.', 1527663190),
(62, 15, 'Izetta Chambers', 'https://www.google.com/maps/contrib/101819123682229980383/reviews', 'en', 'https://lh3.googleusercontent.com/-qLYyZI2PHQ8/AAAAAAAAAAI/AAAAAAAAb6s/HJKzypkCo14/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a week ago', 'I am very impressed with the quality and professionalism here.  These guys know their product, and know how to sell it.', 1526773417),
(63, 15, 'Andoru Andason', 'https://www.google.com/maps/contrib/101340053333461570748/reviews', 'en', 'https://lh6.googleusercontent.com/-2hZne0k9Fus/AAAAAAAAAAI/AAAAAAAAIb0/wmx89YTUINo/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Love this store, great staff, and deals. They always have a decent selection, one of my go to places!', 1525060349),
(64, 16, 'Andrea Ritt', 'https://www.google.com/maps/contrib/111499107082619991063/reviews', 'en', 'https://lh3.googleusercontent.com/-hOe7BQz6IZA/AAAAAAAAAAI/AAAAAAAAAEY/ZBSWYPvdWFU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I love the customer service skills they all have!!! By far the best green you can get in town. Plus I live minutes away. I give them 10 stars', 1523077130),
(65, 16, 'karen Stewart', 'https://www.google.com/maps/contrib/100675172160065634344/reviews', 'en', 'https://lh4.googleusercontent.com/-Eu10oIvgnbI/AAAAAAAAAAI/AAAAAAAAA2U/7JbJuw89vt4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'This place is the best dispensary in Anchorage hands down only place with street prices. Excellent customer service. And they give you free gifts with purchase and free candy ', 1522541266),
(66, 16, 'KushTopia, Alaska', 'https://www.google.com/maps/contrib/103583649220279618265/reviews', 'en', 'https://lh5.googleusercontent.com/-h6KaPDm9Ie0/AAAAAAAAAAI/AAAAAAAAmkc/cUXQlrol_Qs/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a month ago', '2017: We Enjoy AlaskaBuds. Enjoyable Staff, Great Environmernt and a Great Selection. Update 2018: Always expanding their selection. Great experience even a year later, they have a great store in a tough part of town. They are responsible business owners bringing jobs and development to this area. Also they have a beautiful store. I look forward to trying their inhouse cannabis.', 1524827508),
(67, 16, 'Thomas Nolcini', 'https://www.google.com/maps/contrib/105332135855316845946/reviews', 'en', 'https://lh4.googleusercontent.com/-PDDITZYMlOg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0M_ZtHWHjTdlLLr3dmwfEpeZkmog/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Absolutely wonderful customer service. Not only are  the prices Competitive but they  are very clearly labeled and easy to read. Also hey are very generous with their merchandise!', 1518662142),
(68, 16, 'Matt Bronson', 'https://www.google.com/maps/contrib/118275800691418837376/reviews', 'en', 'https://lh5.googleusercontent.com/-KP4b7Wno8Sk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1yvT0wohd-PptMUbOSwsJqvm82Tg/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '3 weeks ago', 'I was helped by a knowledgeable, professional, and very curtious staff every time. I will be going back, very soon.', 1525563125),
(69, 17, 'Stephanie Ransom', 'https://www.google.com/maps/contrib/114384502631109511261/reviews', 'en', 'https://lh6.googleusercontent.com/-9xu36QToRww/AAAAAAAAAAI/AAAAAAAAADI/qaqhIH0uWHo/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'They are super friendly and as a text club member i love seeing the new stock and deals they do each weekend.', 1526141795),
(70, 17, 'Caitlyn Azimi', 'https://www.google.com/maps/contrib/115191743000436810357/reviews', 'en', 'https://lh6.googleusercontent.com/-p1H5_IgWu6w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1RHuAIl_TdC_g8LYPO8gr8Do7JTA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'It\'s a bit cramped inside but they only let a few people in at a time so it\'s not too bad. I love all the budtenders there!', 1527653257),
(71, 17, 'Melody Mcdaniel', 'https://www.google.com/maps/contrib/107161094831840957128/reviews', 'en', 'https://lh4.googleusercontent.com/-F0Y_xO-ZYws/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Se250vmRPF4Nqwcw-ZW4DjhUVlQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'They have awesome products along with daily specials I highly recommend checking it out', 1526964443),
(72, 17, 'Garrett C', 'https://www.google.com/maps/contrib/113458904087109506667/reviews', 'en', 'https://lh5.googleusercontent.com/-Bj5ZTCNS7s0/AAAAAAAAAAI/AAAAAAAAARE/viBb6p9zBgA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Iv worked in this industry for years down in Washington. This store is the best one around. They keep the place simple, clean, and have a laid back vibe. Alaska being new to the cannabis industry, brings curious people into the world of marijuana. So feeling comfortable and confident is important when walking into any dispensary. Products excellent. Great bud tenders. They \"DO\" have an ATM. This one was great! I recommend everyone to this shop.', 1507602768),
(73, 17, 'Amanda Heck', 'https://www.google.com/maps/contrib/112358089090937200924/reviews', 'en', 'https://lh6.googleusercontent.com/-T6W_at2j00c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1mkX6R05-RXHgd4gJpcjtB76d1YQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Friendly staff and good prices! I definitely want to see them again next time we are in FBX.', 1521481034),
(74, 18, 'Trista Moore', 'https://www.google.com/maps/contrib/109388882569389453216/reviews', 'en', 'https://lh4.googleusercontent.com/-hqsPYnA4PB4/AAAAAAAAAAI/AAAAAAAAAAs/Np4CEWfok3A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Very friendly. Love how I can get reward points for being a awesome  customer...', 1518305604),
(75, 18, 'Daniel Burgess', 'https://www.google.com/maps/contrib/108213849725364533361/reviews', 'en', 'https://lh3.googleusercontent.com/-fu2bVwaVmy8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1LlaE6LRRbIE2pij5Hbc1A2mD4WQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, '2 months ago', 'Nice place , good selection , reasonable prices!', 1521596039),
(76, 18, 'Maria Butler', 'https://www.google.com/maps/contrib/116122886325370459138/reviews', 'en', 'https://lh6.googleusercontent.com/-ITqK1BxQGJI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq19W1qNDg5hvKUazABeKn9v4VzZAg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 3, '9 months ago', 'Small isolated town so prices were higher. Loved the rice crispy edibles', 1503192155),
(77, 18, 'Leah Wolter', 'https://www.google.com/maps/contrib/107672762467036761145/reviews', 'en', 'https://lh3.googleusercontent.com/-SgpkHbskf4Y/AAAAAAAAAAI/AAAAAAAAERc/K35Um02IcdI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Great service, very knowledgeable and friendly. The shop itself is well situated in Girdwood\'s downtown.', 1494468166),
(78, 18, 'Chris Grō', 'https://www.google.com/maps/contrib/103576785178668081085/reviews', 'en', 'https://lh4.googleusercontent.com/-onKLGIhB-gk/AAAAAAAAAAI/AAAAAAAAkkY/Vur21_DOO-Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '8 months ago', 'Nice guys with a good supply', 1506856854),
(79, 19, 'Cassie Bungert', 'https://www.google.com/maps/contrib/116543648065777621580/reviews', 'en', 'https://lh5.googleusercontent.com/-cd9bA0jLDrE/AAAAAAAAAAI/AAAAAAAAADM/SMwTdZv-3_Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Wonderful shop with awesome staff. Loved all the extra products they have available! We will definitely come back if we make it up to Denali again.', 1513548751),
(80, 19, 'Dan Simpson', 'https://www.google.com/maps/contrib/103906513004885871257/reviews', 'en', 'https://lh5.googleusercontent.com/-mQmJcdyfquY/AAAAAAAAAAI/AAAAAAAASm0/TJ0z0gz8DYs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'These are great folks. Very helpful and knowledgeable. Their products are EXCELLENT. Store is also full of great accessories and clothing. Denali/Healy is fortunate to have this establishment. Thanks!!!', 1501945340),
(81, 19, 'MrJC Smith', 'https://www.google.com/maps/contrib/113290688101033999311/reviews', 'en', 'https://lh4.googleusercontent.com/-YISRehAb81I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3OvAprDk_KmXDpgi1e4q0KGnXN4w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Great customer service...i was not satisfied with some flower I bought...i immediately took it back.  The clerk thanked me for coming back and switch out some flower she expected I would like instead... offered a free sticker and I was on my way.  The lo down...the pre rolls are extremely overpriced in my opinion  they should have pre rolled the shaky flowers I received the first time instead of selling it full price.', 1502594853),
(82, 19, 'andy mcfadden', 'https://www.google.com/maps/contrib/112882174885866350538/reviews', 'en', 'https://lh5.googleusercontent.com/-QbWOHGNKYCY/AAAAAAAAAAI/AAAAAAAABDk/YKm_Orz4l8E/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'It was fun to even be in such a shop. Guys are nice, follow the law to the letter, and glad to have visitors. ', 1497143374),
(83, 19, 'Carolyn Hand', 'https://www.google.com/maps/contrib/115772002645141159736/reviews', 'en', 'https://lh6.googleusercontent.com/-rrdGxUTyzwo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1X4tbYHty34vSOC0qcqVt9a5YPQA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '8 months ago', 'Knowledgeable and patient, it was great to see everything this store had to offer in edibles and drinks.', 1506696295),
(84, 20, 'The Alaskan RC GUY', 'https://www.google.com/maps/contrib/101605048392524114189/reviews', 'en', 'https://lh4.googleusercontent.com/-AU6yiIMfC9I/AAAAAAAAAAI/AAAAAAAAAMM/GIEoGcQrxaU/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '6 months ago', 'QUALITY IS 7 ☆☆☆☆☆☆☆ in my book\n\nRecreational Marijuana dispensary owned by one of the coolest businessmen in Anchorage. \n●It\'s pretty cozy and one of the more secluded locations in this industry. ●located in a side street between Fireweed and Northern Lights blvd. \n●It\'s kind of like going to visit someone in jail though at point of entry. You walk into a glassed in chamber with a hole in the window to talk through. \n●Overall the people are great and all are handsome or pretty\n\nDON\'T EVEN THINK ABOUT BREAKING INTO THIS PLACE. \n\nGREASE Monkey AND GUMMY BEARZ TOP OUT BETWEEN: \n29% to 32% THC\n\nPLEASE mark as helpful if a review helps you. just click the \"like/thumbs-up\" button.\nThank you for your time.', 1511759590),
(85, 20, 'Josh Mease', 'https://www.google.com/maps/contrib/115972926111746150795/reviews', 'en', 'https://lh6.googleusercontent.com/-C6Bgx7qd8CQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3iauhIVfGyfF_dX7934OPtWDssgA/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '4 months ago', 'Great staff, better product. The early bird special is worth getting up early for.', 1516606147),
(86, 20, 'Wolfy2821', 'https://www.google.com/maps/contrib/115747925813772437465/reviews', 'en', 'https://lh4.googleusercontent.com/-z2B3Pyll5t8/AAAAAAAAAAI/AAAAAAAAACg/oWCpjLK3egI/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '5 months ago', 'I ask for 3 sense star pre rolls. She gives me one making me go through another 5 dollar charge because of a cashless atm okay fine maybe I should hav noticed. She offers me a ten Dillon discount to which she doesn’t apply to either transaction. Okay fine I can use it next time. I get home to find the wrong strain I requested for both my Prerolls and e pen refill. How? Is the cashiers incompetence punishment for me arriving near close? I expect the customer service aspect of this industry to be on par with the quality of the product in which they are selling. If you don’t know what I said ask me. If you’re unsure what strand I want ASK ME. DO NOT give me a random strand because you didn’t hear me. Simply to many mistakes in an industry with too much competition to return.', 1512619210),
(87, 20, 'D O', 'https://www.google.com/maps/contrib/102158427417615140573/reviews', 'en', 'https://lh5.googleusercontent.com/-TyOiziVuBGo/AAAAAAAAAAI/AAAAAAAE1Oo/D_sEZ507pkk/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '4 months ago', 'they keep accurate menus, best prices, great product, they grow,make it, sell it', 1515539747),
(88, 20, 'The Joker', 'https://www.google.com/maps/contrib/115812146703657198575/reviews', 'en', 'https://lh4.googleusercontent.com/-h-sEddgdVpc/AAAAAAAAAAI/AAAAAAAAABw/Fp2i0fJJyOo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'This is the best shop in town. Highest THC counts while remaining the cheapest. Friendly staff and great product.', 1507226105),
(89, 21, 'Darren Kullander', 'https://www.google.com/maps/contrib/109228877043320278610/reviews', 'en', 'https://lh4.googleusercontent.com/-nTn210_xVyQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq08bcZMDSfQGk3LafI8ygf_hQgRow/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '7 months ago', 'Great concentrates. Cartridges are way overpriced and are too inconvenient to refill. If you’re halfway through and burn out the coil, good luck retrieving the remnants. Syringes are at the upper end of pricing but are great for dab lovers. Good flowers in my experience as well. Nowhere near the potency available in Washington and Oregon. Beautiful flowers but not as much of a punch as others of the same strain. Also I’ve been lucky enough to show up at slow times but they definitely need to streamline their purchasing process. Perhaps offer a consulting procedure for people who don’t have a clue what they’re doing. And and an express line for those who want to get in and get out.', 1508093591),
(90, 21, 'Josef K', 'https://www.google.com/maps/contrib/111133667373435619628/reviews', 'en', 'https://lh5.googleusercontent.com/-C2JUCyR2dto/AAAAAAAAAAI/AAAAAAAAACg/RGKAeq83c6c/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '4 months ago', 'Have improved greatly since opening.  Would like to see more of their own Juneau grown in there but I understand the limitations.', 1516829764),
(91, 21, 'Mike Chicago', 'https://www.google.com/maps/contrib/117442438585636889568/reviews', 'en', 'https://lh5.googleusercontent.com/-e4U3vasWHsM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3n3tZXNZOJdrPGAgcpXepbkqfzjA/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 4, '9 months ago', 'We only had 15 minutes before we were due for an excursion from a cruise ship. \nWe were told there wasn\'t enough time to get from the dock to Rainforest and back. Upon arrival, I bought a couple of prerolls and some edibles, and Babycakes got an employee to call a cab. Made the purchase, and had time to smoke 1/2 a joint before the cab got to us. Made it 2 minutes late!\nAnyway.... nice people here. Good products, decent prices.', 1503724865),
(92, 21, 'Chance Trahan', 'https://www.google.com/maps/contrib/114325113655694250623/reviews', 'en', 'https://lh4.googleusercontent.com/-4jSzJSX3TOc/AAAAAAAAAAI/AAAAAAAAKkI/shl9Osl6UYk/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, '5 months ago', 'After the way I was treated by the guy who runs this place, and by the manager, and by one of the staff members, I will never ever buy weed here ever again', 1513394573),
(93, 21, 'G.M.R Robison', 'https://www.google.com/maps/contrib/115843244814877958338/reviews', 'en', 'https://lh4.googleusercontent.com/-zQU-ZeOoSyU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2nSQ2wWiymmfhkH0aoBvgBx5OgvQ/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg', 4, '10 months ago', 'Great staff, a few other things were okay. Didn\'t have a lot of selection- running out of stock and it was only halfway through the day. But it\'s still a young industry', 1501035680),
(94, 22, 'John Malloy', 'https://www.google.com/maps/contrib/104351373349558311575/reviews', 'en', 'https://lh4.googleusercontent.com/-RpKmht-RnLU/AAAAAAAAAAI/AAAAAAAACbY/pW41oD4oeeo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'My weed shop! Well managed, clean, friendly, helpful! This shop is the premier place to get your products within the area. They are experienced in business and hospitality. They take care to give each customer personal attention. Having been to all dispensaries in the area, these folks are the best to get you up to speed on how it all works  ...', 1511642126),
(95, 22, 'Santana Harris', 'https://www.google.com/maps/contrib/115776733483404240733/reviews', 'en', 'https://lh5.googleusercontent.com/-9vt2DBFPDD0/AAAAAAAAAAI/AAAAAAAAAC0/DuH4y3978QM/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'A bit higher price but worth it! I used to stop by just about every other day to check out their deals but now I am in their \"Ohana\" family and the deals are sent directly to me. Prices have going down and their staff are some of the friendliest in town. Stop by Pakalolo and tell them Aloha :-)', 1519854058),
(96, 22, 'April', 'https://www.google.com/maps/contrib/117300159990235629025/reviews', 'en', 'https://lh4.googleusercontent.com/-wkbd5iCRzBY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3iEud8Uy-9zZmH5aZ-IlOPagiKEw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great service, digital iPad menu makes it easy to shop the supply.', 1524256288),
(97, 22, 'Sarah Dubowski', 'https://www.google.com/maps/contrib/115854841300690969557/reviews', 'en', 'https://lh3.googleusercontent.com/-qR3YhqPdO2M/AAAAAAAAAAI/AAAAAAAAKL8/7cAkwYdjTAU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Hands down the best weed shop in Fairbanks! I\'m very impressed with the strains and all of the new products that seem to added to the shelves daily.  I recently purchased a joint wrapped in palm leaves and a \"make your own edible kit!\" Very cool!  Also love that they add a new \"flavor\" almost every week on \'Strain drop Saturday.\'  They constantly are adding new and creative ways to enjoy cannabis.  Their love for what they do really shows. ---A must visit if you are in Fairbanks---', 1492633267),
(98, 22, 'Manda Panda', 'https://www.google.com/maps/contrib/105319263376137321878/reviews', 'en', 'https://lh4.googleusercontent.com/-QI_SZoJNAys/AAAAAAAAAAI/AAAAAAAAAAs/vaF7B2jwotM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'It\'s a bright, pleasant store, and the bud tender who helped me, David, was friendly  and polite. The gentleman at the door was kind and had a good sense of humor :) The shop actually reminds me of my favorite dispensary down in Denver. They have  glass and papers, cones and hemp wicks, and more. I haven\'t been smoking long, but from what I know these guys have just about everything a customer needs. I hope to see larger quantities available as the company grows, but overall Pakalolo is a great shop!', 1498184518),
(99, 23, 'Rebecca Newcomb', 'https://www.google.com/maps/contrib/113117727890113009605/reviews', 'en', 'https://lh6.googleusercontent.com/-EjfLc6i-oZg/AAAAAAAAAAI/AAAAAAAAAHo/CdgrjyXeqI8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Red Run Cannabis Company is a one stop shop for all your recreational and medicinal needs. Their flowers are well dried and trimmed. You definitely get your money\'s worth. Their THC % ranges from a little bit for beginners to large amounts for us OG\'s. You can purchase edibles, grams, eighths and up, pre-rolls, and much more. You can even get a pre-loaded pipe! The staff are knowledgeable and friendly. The store is set up to find everything quickly. The menu is always up to date. Red Run Cannabis Company has a great rewards program. Just order online. Their site is very easy to navigate. Pay at the store and get points for big savings. If you haven\'t already, you should stop in. You will be glad you did.', 1517270045),
(100, 23, 'Hunter maddox', 'https://www.google.com/maps/contrib/108821724097127418674/reviews', 'en', 'https://lh6.googleusercontent.com/-NXVvyIUCxf4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0gNaKdqModMLZO371-TvvwEoRPpw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Shop was very clean and tastefully put together, staff was informative and friendly. My preferred stop on the peninsula', 1520230202),
(101, 23, 'karrie doyal', 'https://www.google.com/maps/contrib/115541727005263140003/reviews', 'en', 'https://lh5.googleusercontent.com/-4-J4_uhVlbs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0GchGu-VCFVeQULkB6AaPj3umN-w/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'Mostly nice ppls however the lady with shoulder length hair and glasses she is tall and thin . She is very rude every time', 1522179407),
(102, 23, 'Mike Baxted', 'https://www.google.com/maps/contrib/106529750998484564507/reviews', 'en', 'https://lh5.googleusercontent.com/-AO5ZHqHOGYU/AAAAAAAAAAI/AAAAAAAABLo/vofY7wX6H-s/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Cuz it\'s kewl', 1523570887),
(103, 23, 'Bernie Bates', 'https://www.google.com/maps/contrib/114142657612726517895/reviews', 'en', 'https://lh4.googleusercontent.com/-d9AiT6GLH3g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0OOpGtp0zTWkcA5rE8dquJaXscFg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, '5 months ago', 'Sorry about bad review but....\nPurchased a total of 10 prerolls.\nAll smelled like alfalfa.\nAll were wet. \nSet them out on a bookshelf to cure.\nAfter 4 days in alaska 2 were still too wet to even force to burn. \nIt was almost like someone\'s first ever attempt at growing/curing. Terrible. \nDo not waste your $$$$$\nWait for them to figure out how to grow and cure first.', 1512864937),
(104, 24, 'Michael Rosser', 'https://www.google.com/maps/contrib/108655145141687686732/reviews', 'en', 'https://lh5.googleusercontent.com/-23yVSTDZS9U/AAAAAAAAAAI/AAAAAAAAAPk/vWrvOaPcCUc/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '4 months ago', 'Interior is nice; large walking/shopping area, wooden flooring, good choice of wall paint colors. Plenty of product here, which is well displayed. It felt like walking into a fancy wine brewery.', 1516052244),
(105, 24, 'Gabe Cabrera', 'https://www.google.com/maps/contrib/111108917512742234830/reviews', 'en', 'https://lh6.googleusercontent.com/-U8g-T8bS3VI/AAAAAAAAAAI/AAAAAAAAAL0/tf4h-OUc1Kg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Great place to get what you are looking for. Vast selection at a decent price', 1519336087),
(106, 24, 'Michael Hiller', 'https://www.google.com/maps/contrib/105319306669719630711/reviews', 'en', 'https://lh6.googleusercontent.com/-5RU9b5UY8_I/AAAAAAAAAAI/AAAAAAAAAAA/UUL4YN0R6UU/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '7 months ago', 'Knowledgeable, high quality all around. They grow all their own stuff and if you are lucky they habe suoer healthy clones with great genetics occasionally.', 1508211716),
(107, 24, 'ESB BERG', 'https://www.google.com/maps/contrib/108830817312932754520/reviews', 'en', 'https://lh6.googleusercontent.com/-p5hOb3M-66Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq18WRSdd3Uhigq5_N2TrKk7smPhuA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '10 months ago', 'They had some good weed a little pricey nice lady\'s there , helpful and I called when I couldn\'t find the store the lady came outside and stayed on the phone until I showed up.', 1500661180);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(108, 24, 'Vivian N', 'https://www.google.com/maps/contrib/110009351367522514831/reviews', 'en', 'https://lh4.googleusercontent.com/-lu6PRlPja5Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1NfyinpgQaSoXbUBrOC0-8uCAdpg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '10 months ago', 'I used to come here, until the owner came into my own work and stole $300 worth of services from me without paying after he had already flashed his huge wad of cash and bragged about being a millionaire. How can someone treat others in such a small community that badly? It\'s absolutely unacceptable. I\'m sure he would\'ve gotten over $300 worth of sales from me over time, but guess I\'ll be going to High Bush Buds from now on.', 1501531442),
(109, 25, 'Chris Jerome', 'https://www.google.com/maps/contrib/116254781442651013223/reviews', 'en', 'https://lh6.googleusercontent.com/-E_c2UKZt94k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1OEcBBKYntLM85-6xyL5h0XDcZNQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Best shop in town. Always have great products. Love the peeps that work here. They are always so friendly and give great advice on what strains help with different ailments.', 1519962662),
(110, 25, 'Darth FB', 'https://www.google.com/maps/contrib/118421844693600523034/reviews', 'en', 'https://lh6.googleusercontent.com/-DJYM3PpAQxY/AAAAAAAAAAI/AAAAAAAAAI0/n1YFdu-K_ck/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Great place. They have awesome products and a good selection. The staff is courteous and friendly and always a pleasure to deal with.', 1519784170),
(111, 25, 'Paul Sturgeon', 'https://www.google.com/maps/contrib/115191387554544184968/reviews', 'en', 'https://lh3.googleusercontent.com/-2ElSsEs2oOg/AAAAAAAAAAI/AAAAAAAAWJA/49hcS8AxpCw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'This Place Rocks!  Great Pre Rolls.  Loyalty Program.  $12g $40 1/8 daily specials.  This is my favorite store.', 1519965529),
(112, 25, 'Sins of Zyn', 'https://www.google.com/maps/contrib/107832650763762947425/reviews', 'en', 'https://lh5.googleusercontent.com/-pIWmH0w6Ipw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1dUUe_gOJkVjTdlSXP_0hj7GHFEw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'They advertise on Weedmaps and in-store THC% that are not accurate. They admitted knowing they did this on Weedmaps reply to someone who called them out for it. I told them with proof the same thing happened to me and they didn\'t care or even apologize. They have the lowest grade product in all the valley. Waste of time and money go to any of the other shops.', 1523284950),
(113, 25, 'Harley Wheelock', 'https://www.google.com/maps/contrib/101759452180742668601/reviews', 'en', 'https://lh6.googleusercontent.com/-XkhkaPF6oQM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq19KJ6mlkntQHSdH6_Ttjz5LneySw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Love this place. One of my favorite. Got my new hoodie tonight love it.', 1521267223),
(114, 26, 'Carolyn Seale', 'https://www.google.com/maps/contrib/104417257134641359817/reviews', 'en', 'https://lh6.googleusercontent.com/-D6Cma72o8jM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq09alDGpbA5Z0SYtppCVrK3lf5gWA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Awesome place. Fun and friendly staff. Answered all my questions and helped me select the product just right for my pain problems. Great prices good first time patient promotion daily special and top shelf products makes this place the place to shop for all your medical needs. Thanks!', 1523169952),
(115, 26, 'Nicholas Johnson', 'https://www.google.com/maps/contrib/101173764267491625026/reviews', 'en', 'https://lh3.googleusercontent.com/-EQMFJDOsSkU/AAAAAAAAAAI/AAAAAAAAATU/g3mzzBOo5y0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'One of the most professional dispensaries I’ve ever been to. The staff take the experience of buying marijuana to another level. They take all the sketchy drug vibe out of it and just provide knowledge and assistance. \n\nI will definitely be back to this spot. ', 1522893745),
(116, 26, 'mike lots', 'https://www.google.com/maps/contrib/101334705023452583371/reviews', 'en', 'https://lh5.googleusercontent.com/-lICqJz-zWdg/AAAAAAAAAAI/AAAAAAAANGU/jXcZZFKeOV4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '4 months ago', 'Good spot, larger inside then the other harvests, and slightly different brands on some concentrates and other products. Nice staff. Google maps might tell you a weird way to get there so just look for it on the corner. If going for a snap sale might want to call before hand as they were out of the one I wanted but hadn\'t changed menu.', 1517233524),
(117, 26, 'Tonya Mead', 'https://www.google.com/maps/contrib/103022187612855217661/reviews', 'en', 'https://lh4.googleusercontent.com/-4M1wxImcIPk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3oasw9EVrXYt3smf2AOTM-YWYHUw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Don\'t buy oil there! Bought a new battery and oil. Didn\'t even work at all. Went straight back and they did give me a full refund as they should. The two girls helping me were talking about how they have had other people bring the same thing back because it didn\'t work. Well if you know your product doesn\'t work AT ALLand you continue to sell it I have a problem with that!!!!!The security door man asked me did they fix the problem and technically the answer would be yes they refunded my money however I\'m out all of my time driving up there twice', 1524064822),
(118, 26, 'MJ40', 'https://www.google.com/maps/contrib/101786728092192672158/reviews', 'en', 'https://lh3.googleusercontent.com/-PH_Y1VoDLIM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2LIXVsoiIkW-xLEhhCKLGZ2oHXFw/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a month ago', 'Good spot with fresh flower.  First time patient and I received a free eighth with purchase of an eighth.', 1524693485),
(119, 27, 'Edward Cleveland', 'https://www.google.com/maps/contrib/104825249299729618831/reviews', 'en', 'https://lh5.googleusercontent.com/-oe2ROXrnDYw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1LmK_Bu-gPpto3yiHKCuQL_9khkg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Love this med shop as they help me get what works so no pain and i have not got stems or seeds unlike MOHAVE GREEN SELLING SEEDS AND STEMS. AND THE STAF HERE ROCKS GOOD PEOPLE ALL ARE FAMILY TO ME KEEP UP THE GOOD WORK FAMILY', 1526176125),
(120, 27, 'Katherine McKown', 'https://www.google.com/maps/contrib/108289405431579562574/reviews', 'en', 'https://lh4.googleusercontent.com/-McFqDlKYkA8/AAAAAAAAAAI/AAAAAAAAAJM/lyqlgW0TrMM/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '3 months ago', 'Products are of decent quality. Staff is usually nice although I had a couple times where I received an attitude from a budtender in maybe her late 20’s. I wished they had more deals and sales. I love that the flower is organic and no pesticides used. I did not like their edibles at all, it did nothing for me and was extremely expensive for a candy bar. I feel that some of the staff has better recommendations for you if you’re there to get “f’d up” as they would talk about how high it would get me rather than the relief it would offer my medical conditions. It came off as a little unprofessional to me. The manager is a pretty nice guy, though. Overall I recommend you test this place if you never were here. For me, I pick the other dispensary for it’s huge selection and sense of safety.', 1519889500),
(121, 27, 'Jill Heurung', 'https://www.google.com/maps/contrib/114845845991277624395/reviews', 'en', 'https://lh4.googleusercontent.com/-FS-JdgEq7Ko/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq24XicsxuBmxhLHd9KmQ8VTZAgtSg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Friendly knowledgeable staff, in a comfortable family-friendly setting. They treat their patients with kindness and respect and I never feel hurried or rushed. Highly recomended!', 1519090846),
(122, 27, 'Scotty Hoffman', 'https://www.google.com/maps/contrib/116863741560975637109/reviews', 'en', 'https://lh4.googleusercontent.com/-WR8FfEbtROA/AAAAAAAAAAI/AAAAAAAAB74/-1Y2vZ3m0Pw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Great place and good people. Awesome buds', 1526833852),
(123, 27, 'Jay Montalbano', 'https://www.google.com/maps/contrib/105792277327288412394/reviews', 'en', 'https://lh4.googleusercontent.com/-Cuc9llbTXUY/AAAAAAAAAAI/AAAAAAAAASQ/t3MGA8zSZNI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Best place for the best service . prices and fresh products', 1524419122),
(124, 28, 'Jenny S.', 'https://www.google.com/maps/contrib/105021618535886873178/reviews', 'en', 'https://lh4.googleusercontent.com/-c2hoN5Y1QO8/AAAAAAAAAAI/AAAAAAAAerM/vcW_248Sj8Y/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 weeks ago', 'I recently got my card and went to Harvest because they support my friends organization for children with epilepsy. Not only is their website phenomenal, the dispensary is clean, inviting and their staff is phenomenal! Customer service is important to me and Harvest definitely has their service game stepped up a notch.  I like that they offer informative seminars too.  Harvest has my continued business!', 1526241241),
(125, 28, 'michael tubbs', 'https://www.google.com/maps/contrib/117211964741850513423/reviews', 'en', 'https://lh4.googleusercontent.com/-8Syg4rG0zcA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3A468UCcWSjKQSyIIWjSkimusCFw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I will never go anywhere else for flower unless I have to. \nKiah, and Robin are both excellent people with an answer to every question you\'ll have. Bud is always great. Very clean and positive atmosphere. 5 stars!', 1524508085),
(126, 28, 'MARICELA BERG', 'https://www.google.com/maps/contrib/102753413867631262442/reviews', 'en', 'https://lh6.googleusercontent.com/-NZ7rl2xnggE/AAAAAAAAAAI/AAAAAAAAAPE/A_qrtJg8wZY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The people are so nice ! They definitely help me out with everything that I need.  I ask them what they recommend and they give me the BEST advice.  I’ve never met such friendly , down to earth people at a dispensary. The quality of the medicine is also Amazing !! I kid you not , swing by harvest and tell them Maricela sent ya :)))', 1523073415),
(127, 28, 'Grace Corrales', 'https://www.google.com/maps/contrib/114718406260706026035/reviews', 'en', 'https://lh4.googleusercontent.com/-bzzfjfBjPzg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2RwVqmSItzfOfh3IJVBKR8amjdBQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'First time at any dispensary ever and they made sure my first experience was awesome. Everyone was very friendly and helpful and full of information for me. The location is incredibly convenient for me but even if it wasn’t I would come back because they made my first experience the best!', 1521484419),
(128, 28, 'Ani Whalen', 'https://www.google.com/maps/contrib/103405804293562824111/reviews', 'en', 'https://lh4.googleusercontent.com/-busHbKDZmfs/AAAAAAAAAAI/AAAAAAAABCc/gtiai32Y47k/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a month ago', 'Best one nearby on baseline. They genuinely care and seem very smart, loving on a whole from everyone I bumped into. A very easy place to get along with. My fav.', 1522633978),
(129, 29, 'Anthony Soden', 'https://www.google.com/maps/contrib/116708889288665668285/reviews', 'en', 'https://lh4.googleusercontent.com/-yAv3ApDlZ2s/AAAAAAAAAAI/AAAAAAAAD04/E9Kw44ZiByo/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'My first time going to this place was when they had just opened up their new facility the new facility is by far one of the coolest I\'ve ever seen it\'s super clean and it feels very comfortable just being there. The person that helped me was extremely helpful as it was my first time at their place are there specials were awesome helping me get started! I would for sure recommend this place to anybody.', 1524674360),
(130, 29, 'Alexander Alexis and Alexia', 'https://www.google.com/maps/contrib/101807181953482713508/reviews', 'en', 'https://lh5.googleusercontent.com/-d79H3DiODMM/AAAAAAAAAAI/AAAAAAAALQA/EWGW8NjJ3y4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, 'a month ago', 'This was my very first dispensary EVER!!! Moderate prices. Good products. Very wide selection of flowers available for everyone. if u are medicated and have a $50 come here u will be very satisfied.', 1524468381),
(131, 29, 'Chad Anderson', 'https://www.google.com/maps/contrib/107926659201047157240/reviews', 'en', 'https://lh6.googleusercontent.com/-BqzZaKegmDM/AAAAAAAAAAI/AAAAAAAAEVw/Tctv0AfDZ28/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 4, '2 months ago', 'Nice entrance, very vibrant, clean and full of Green. It has the feel of relaxation as you enter , but if its chilly or has a brisk breeze bring a jacket or something to cover up with while you wait. Overall the atmosphere is nice and relaxing which I love.', 1521402528),
(132, 29, 'Jacob Teragouchi', 'https://www.google.com/maps/contrib/103134174164687280395/reviews', 'en', 'https://lh3.googleusercontent.com/-eUNPaKljEhs/AAAAAAAAAAI/AAAAAAAAAGw/-me2sIiyuJI/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 weeks ago', 'Quick clean and good deals. Staff is always friendly. They recently moved locations and it\'s probably the nicest dispensary in the area now.', 1525319398),
(133, 29, 'ChoirBoi01', 'https://www.google.com/maps/contrib/111960318664231360376/reviews', 'en', 'https://lh5.googleusercontent.com/-cpuD4hlsiPs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2oBUXXjjArVbCJ6cYXW-rmE4vZFg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Very incredible place they have very good top shelf good cartridges good deals and I would recommend it to anybody God Bless America for  medical marijuana', 1525882638),
(134, 30, 'Ruth Mundy', 'https://www.google.com/maps/contrib/115982956984582019309/reviews', 'en', 'https://lh3.googleusercontent.com/-7yeQmAZzHRk/AAAAAAAAAAI/AAAAAAAABl4/jkQCqrpfgKs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Being nervous on my first visit, the employees made me feel comfortable and were very patient with answering all of my questions plus offering much needed advice. \'Q\' is my go to guy, he is  helpful and kind even though I am an older patient. Everyone there is absolutely friendly, kind and helpful. The two gals at the front desk are most helpful and friendly. Love them all and each visit is pleasant. \'Q\' is  a superstar in my opinion.', 1520045527),
(135, 30, 'Angela Smith', 'https://www.google.com/maps/contrib/107560855132108924235/reviews', 'en', 'https://lh5.googleusercontent.com/-SIuXDiW7YyA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1dnwkbIGi0-N7QTDuOGXTYwJdeJw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Love this place and the staff! Close to my house and great meds too! They take good care of the patients and have the best deals! I should have left this review a long time ago. Great Great Great!', 1525546424),
(136, 30, 'Maria Acquafredda', 'https://www.google.com/maps/contrib/115782086886970429197/reviews', 'en', 'https://lh3.googleusercontent.com/-yEQIV2ZSE78/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1OT8Sa-q3_1oCf4xQUjh6VrKD5Kw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I highly recommend this dispensary. They have high quality products and friendly, knowledgeable staff. Prices are great too!', 1527195508),
(137, 30, 'Sabrina Trevino', 'https://www.google.com/maps/contrib/106777636076602589773/reviews', 'en', 'https://lh6.googleusercontent.com/-lFLqx16bfvs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0CzN3a2LBNbLxdDNA-Aqxw5IVgWQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Great location, have plenty of options. Never disappoint. Hospitality is spot on. I would recommend to all card holders to try this spot. Great flower and meds', 1527629573),
(138, 30, 'Peggy Drake', 'https://www.google.com/maps/contrib/117046705256096568511/reviews', 'en', 'https://lh5.googleusercontent.com/-WtFYWwL6YkQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2dAhL4IvYm-oKor43E5gUTtNXmKw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 weeks ago', 'Awesome place to go after you get your medical marijuana card. The staff is very helpful, very informative & understanding to \"newbies\" like me. Lol! Prices are pretty decent too.', 1525220285),
(139, 31, 'Todd Phipps', 'https://www.google.com/maps/contrib/113535584967163556570/reviews', 'en', 'https://lh6.googleusercontent.com/-gm0JbWVlPUc/AAAAAAAAAAI/AAAAAAAAAWU/Cc2jnqR9CTo/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'I don\'t come here to often and that\'s just because of the price. If I could afford it, this would be the only dispensary I would go to. There flower is so amazing, it looks like something right out of high times. There concentrates and cartridges are also pretty awesome. Everything from this place goes above and beyond, just wish it were less expensive.', 1526535410),
(140, 31, 'Jane Sheffield', 'https://www.google.com/maps/contrib/108684247217690213710/reviews', 'en', 'https://lh4.googleusercontent.com/-W2l1uJ56Phk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2-XPLNjtEGHkVmoDAGtbPrLQ659A/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 2, 'a month ago', 'Edit: The service here has gone way down hill.  Their new receptionist is so rude, she treats helping patients like an inconvenience.  Their new security guard isn\'t much better, I was a few minutes early and instead of letting me park, he stared at me in the driveway. \n\nBest prices in town and the express pickup is super convenient. Everyone working here is super friendly and they have great specials.', 1523721867),
(141, 31, 'JJJ', 'https://www.google.com/maps/contrib/103548326061788408335/reviews', 'en', 'https://lh6.googleusercontent.com/-4Om6Ioxw0VU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2p-yVlUpX1u57mBlT3OTfdBrbJDA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This place has the best flower in town!!!  As such, it\'s a bit more pricey than the others but its definitely worth it. Any negative reviews seem to be very nit picky.  Customer service has always been great .', 1524964180),
(142, 31, 'SUSAN MARTIN', 'https://www.google.com/maps/contrib/110268345766424109278/reviews', 'en', 'https://lh5.googleusercontent.com/-dYmLSmDgTMw/AAAAAAAAAAI/AAAAAAAAAMA/GgMNW-sKShk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '2 weeks ago', 'For The Price Of The Different Tiers..Is Great..But For The Price I Want To See % Numbers THC...Otherwise It\'s A Shot In The Dark For Me..', 1526406596),
(143, 31, 'Bryan Kephart', 'https://www.google.com/maps/contrib/112059773638469475508/reviews', 'en', 'https://lh4.googleusercontent.com/-mQb3ghSBjcg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3urNVb7fLja4NhtN4fKOrE7jskKQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'Clean. Easy to locate. Great products. A little pricey', 1526843830),
(144, 32, 'Bianca Talavera', 'https://www.google.com/maps/contrib/110990228349633030249/reviews', 'en', 'https://lh6.googleusercontent.com/-_k4xqNPI398/AAAAAAAAAAI/AAAAAAAAAAA/cXvSc9DrOwM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This has been one of my #1 go to dispensary for years! I even moved about 45 min away to the east valley and I still come in about twice a week, some times more. The staff is amazing, which creates the best atmosphere. They get good product and they are very helpful with selection. And their concentrate prices are the best!', 1522418419),
(145, 32, 'Much Sunshine', 'https://www.google.com/maps/contrib/101188476797367228309/reviews', 'en', 'https://lh4.googleusercontent.com/-tdcmRKDB98U/AAAAAAAAAAI/AAAAAAAAAHE/IOtnIFlAiG4/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 2, '3 weeks ago', 'I have really bad insomnia, and I\'ve had my card for a little over a year. I\'ve been to several valley dispensaries, and I really looked forward to checking out this place.\nUpon arrival, I was relatively impressed. The shop was busy, which is usually a good sign.\nOnce my turn, I found the staff knowledgeable, helpful and very friendly. So far so good!\nThey didn\'t have traditional edibles (strike one), but steered me towards some 50 mg capsules. I was intrigued!\nAfter trying their products however, I was severely underwhelmed. I found the flower among the lowest quality I\'ve had from any Arizona dispensary. Worse than that tho, the capsules were a total bust! I\'ve taken 3 tonight (150mg total) and I feel absolutely nothing. That many mg of edibles and I\'d be sleeping. What\'s mind boggling is these cost me almost double what edibles normally cost (comparing cost per mg).\nBottom line: other than the friendly staff, I cannot recommend this place. There are just too many vastly superior options in the valley. Oh well, live and learn!', 1525343394),
(146, 32, 'Todd Phipps', 'https://www.google.com/maps/contrib/113535584967163556570/reviews', 'en', 'https://lh6.googleusercontent.com/-gm0JbWVlPUc/AAAAAAAAAAI/AAAAAAAAAWU/Cc2jnqR9CTo/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'I\'ve had my card for 3 years now and had never been to Arizona Organix, it\'s always been out of the way for me. I was kind of in the area, so I went for a bogo deal they were doing on disposable vapes. Unfortunately when I got there they were sold out. I didn\'t want to drive all that way for nothing, so I grabbed some flower and some wax. Both were phenomenal. The flower was so good and the wax was by far the best I\'ve ever seen in my life. They\'re out of the way for me, but I will definitely be returning soon!', 1526588665),
(147, 32, 'Anthony Espinosa', 'https://www.google.com/maps/contrib/102614083093644457529/reviews', 'en', 'https://lh6.googleusercontent.com/-NnAY-v3xGSo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0v0sJGXpqmYMUpWzg1CigLhFApTA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Arizona Organix by far is the best dispensary for shatter in Arizona! They have great customer service and really helpful with suggestions! I love the shatter and the sap caps are always good! I definitely will be a returning customer.', 1521405574),
(148, 32, 'Amber Hedrick', 'https://www.google.com/maps/contrib/111886137673436590339/reviews', 'en', 'https://lh4.googleusercontent.com/-3Cu_l0g4uZI/AAAAAAAAAAI/AAAAAAAAMSc/fTcRwIlwLyA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'If you\'re a concentrate person and don\'t want to blow the bank...definitely check out this dispensary! Prices are fair & staff is very helpful. ', 1521661503),
(149, 33, 'Ella Lizarraras', 'https://www.google.com/maps/contrib/116524784587382597523/reviews', 'en', 'https://lh3.googleusercontent.com/-EkdmGZux4ak/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq33x7nkygDhc0Wb2_vRDWTFPQNS5A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'LOVE LOVE LOVE everything about this place!!! Myself being a newer patient and card holder, for almost a year,  I had so many questions... I have been to well over 20 different dispensaries and NEVER had that many questions answered. Well I can say first hand that ALL of the staff at Encanto helped me out by explaining the whole process from start to finish, and found me EXACTLY what I needed. I drive over an hour just to get there, and I continue to due so because of such a wonderful experience my first visit was..and every visit after that!! They really do have the BEST prices for all their products. I suffer from chronic pain from an old injury, and their pain balm is something out of this world!! They also have the newer carts that I love, with the BEST oil I\'ve ever had. Glad I found this little gem : )', 1524175493),
(150, 33, 'Jaye Leffler', 'https://www.google.com/maps/contrib/101849281726304216550/reviews', 'en', 'https://lh4.googleusercontent.com/-eG-T3r08WSs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq08IqsCitNEyIN0quiPYuOfEPikjQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I love this place. Very welcoming when you first walk in. The staff is friendly,  honest and very knowledgeable about their products. Great products are quality at a very reasonable price.', 1527272006),
(151, 33, 'Adam Reed', 'https://www.google.com/maps/contrib/116913869717882796350/reviews', 'en', 'https://lh4.googleusercontent.com/-K35lkAaALyA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1r5kj1CxfnIc9hOcsM0lJ4YHv6Ig/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This is a great dispensary. The location is conveniently located of the freeway. It has late hours so youcan get here on your schedule. The prices are good and the sales and specials even better. Stop by and give them a try.', 1524623452),
(152, 33, 'Marissa Kalena', 'https://www.google.com/maps/contrib/110971317397559078274/reviews', 'en', 'https://lh5.googleusercontent.com/-rLoLS8LSopc/AAAAAAAAAAI/AAAAAAAAOz0/j-hzrnCVlZ8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Yesterday was my first time visiting Encanto. I\'m very new when it comes to dispensaries, so Michelle was beyond helpful along with every single person working there was very welcoming. The prices are amazing and they really took care of me. They\'re OG Clear cartridges are AMAZING. I mentioned to Kurt that I wasn\'t interested in smoking pens because they tend to burn my throat, so he set me up with an OG cartridge and pen and I\'m completely hooked. Thanks guys!!', 1521836230),
(153, 33, 'Deborah Blue', 'https://www.google.com/maps/contrib/108969061828827981439/reviews', 'en', 'https://lh5.googleusercontent.com/-KC2sCIEymHs/AAAAAAAAAAI/AAAAAAAAAF0/KsyHAJ1uUho/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'My husband,(who has a terminal form of Cancer), has been a patient at E.G.C. for over a year. \nWhen I can, I go with him just for the great tea that is provided in the waiting area!!  :)\nOf course with growing pains there has been a great turnover in staff, my husband states that though he misses some of the old faces, everyone has always been knowledgeable, professional and caring. \nHe states that special recognition or  \"Kudos\" should go the the management team of Doug and Joe, whom regardless of how busy they may be, always stop to take the time to say \"Hi\" and see how my husband is doing. This while doing an excellent, ( and sometimes in an chaotic environment), job while running E.G.C.\nHe very rarely, if ever, uses any other dispensary because he states that everyone at E.G.C. whom he has met thus far, including the security guard, has made him feel like family!!\nOh, he also states that they have the best medicine in the valley!!', 1527170972),
(154, 34, 'D. Failner', 'https://www.google.com/maps/contrib/107453056295292550641/reviews', 'en', 'https://lh5.googleusercontent.com/-ZIfLcZQ4-u4/AAAAAAAAAAI/AAAAAAAACAg/T2qCV32xfMA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Great experience from start to finish, I love you guys. Thank you for making my life so much easier, and doing so much cheaper than the competitors', 1522479349),
(155, 34, 'Heston Hamilton', 'https://www.google.com/maps/contrib/110587420416968266134/reviews', 'en', 'https://lh5.googleusercontent.com/-CCqIY4soZN0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3nCfvgOZu689ucIyTlKlwPDTdASg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Informative and professional.', 1527021421),
(156, 34, 'filmex Lawson', 'https://www.google.com/maps/contrib/114777138968426818733/reviews', 'en', 'https://lh4.googleusercontent.com/-70Jp3d3-T8g/AAAAAAAAAAI/AAAAAAAAAEM/BUN3DtB_f9g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'Went for my appointment and actually got in ahead of scheduled time--when was the last time that happened for a medical appointment??\n\nThe whole staff was friendly and professional. Dr. Burns put me at ease and couldn\'t have made the whole experience any better. She was thorough, patient and most informative. I asked a lot of questions and she patiently answered every one clearly and thoughtfully.\n\nI\'m so used to getting the bum\'s rush at medical appointments, as if you are keeping the doctor from getting to the next patient. Dr. Burns left me feeling like I was the only patient of the day, which was a great feeling.\n\nThey got my info to the State of AZ that same day, and the first thing the next AM I rec\'d an e-mail from the government that I had been approved. After hearing tales that it could take up to three weeks to receive my card, I was greatly pleased that it actually came exactly 7 days after my office visit.\n\nI couldn\'t recommend this practice any more enthusiastically.', 1441464974),
(157, 34, 'Marvel Butler', 'https://www.google.com/maps/contrib/106955176210410567127/reviews', 'en', 'https://lh3.googleusercontent.com/-hdOy1rL8ZWk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0FFgEQTDPdbgWAn5JP6bThzFv1nQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a year ago', 'The staff is very courteous and friendly and understanding. ', 1468703934),
(158, 34, 'Brya Rodriguez', 'https://www.google.com/maps/contrib/113451824683272411961/reviews', 'en', 'https://lh4.googleusercontent.com/-BoRYycsOzkE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1dZx_m7I-MlkGtMQDnpzmcSScxMA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', '', 1473444259),
(159, 35, 'Next Generation', 'https://www.google.com/maps/contrib/105666997604494775063/reviews', 'en', 'https://lh4.googleusercontent.com/-tbnU-028nMg/AAAAAAAAAAI/AAAAAAAAAFs/TpJkEYT5OB0/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'The worst experience of my entire life. You will not receive your card until months and months after you go in. The staff is very unprofessional and have very little knowledge of what they are doing. I went in February of 2017 and I still haven\'t gotten my card because they didn\'t put in my apartment # when filling out the application from the state.', 1492801292),
(160, 35, 'Chandra Sill', 'https://www.google.com/maps/contrib/111990452326777849731/reviews', 'en', 'https://lh5.googleusercontent.com/-yhFgGd1cFms/AAAAAAAAAAI/AAAAAAAACs8/KdAkPggmi_c/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 3, 'a year ago', 'what are your hours?', 1485664934),
(161, 35, 'Sergno Hernandez', 'https://www.google.com/maps/contrib/117249372772499738392/reviews', 'en', 'https://lh3.googleusercontent.com/-P7OlNGegCyQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3qtVg7qiqJqwmSjdUQoT5ZzL7_qQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, '9 months ago', '', 1501967646),
(162, 36, 'SUSAN MARTIN', 'https://www.google.com/maps/contrib/110268345766424109278/reviews', 'en', 'https://lh5.googleusercontent.com/-dYmLSmDgTMw/AAAAAAAAAAI/AAAAAAAAAMA/GgMNW-sKShk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', '3rd Visit To A Different Dispensary..New Card Holder..First Time Patient Visit..Happy Friendly Staff..Although They Didn\'t Have Exactly What I Was Looking To Buy..My Budtenter Found Me Something To Try..1/8 Of Double Dream $33.00 And A Space Stick $11.00 1g..I Liked Both..Just Like She Said I Would..I Waited To Write This Review Until After My Visit To The Next Dispensary On My List..This Dispensary Has Legit Products..Keeping You In Mind For My Birthday..I Wish They Could Let  Me Know When The Product I Wanted To Try Comes In..$15.00 Off First Visit..Nice..See You Soon..', 1526398528),
(163, 36, 'Ricky Lee', 'https://www.google.com/maps/contrib/111054499566737782127/reviews', 'en', 'https://lh4.googleusercontent.com/-Pp9FakDk1Oc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2OqAuLGjgC0L_DJJWzhA7HgCK8kQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Another terrible experience.  Its been 2 years since I\'ve visited the manager didn\'t seem to care about keeping me as a customer nor did he try to offer empathy about the situation.  This has to be the worst dispensary in town. I was extremely disappointed with the service', 1523641407),
(164, 36, 'Jessie Galas', 'https://www.google.com/maps/contrib/106416465678154616628/reviews', 'en', 'https://lh5.googleusercontent.com/-3xGFnB77g5Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0C0zW_8hg_ghAZFG-bPNon9OwTBg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Staff is always friendly and welcoming, great bud selection, and always have new promotios!! An easy 5 stars for this place', 1526754396),
(165, 36, 'J G', 'https://www.google.com/maps/contrib/109293217678910760789/reviews', 'en', 'https://lh4.googleusercontent.com/-Q7N-aeS07PE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2_h9Nw6bIHH3kbCY0lwrgKu46gbw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'I love coming to this place they have good service and even better medicines. Thanks guys!!', 1526086445),
(166, 36, 'Last Boyscout', 'https://www.google.com/maps/contrib/117427097291484755456/reviews', 'en', 'https://lh4.googleusercontent.com/-vI30EtLeY9g/AAAAAAAAAAI/AAAAAAAAAE4/dtS7pUIhirQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'New Cardholder\n2 minutes ago\nFirst time was great. Very friendly. Great hours. Great deals during the week. Also gives you way to earn cash back on all of your purchases. Veterans friendly!', 1518323544),
(167, 37, 'Mr. Sanchez', 'https://www.google.com/maps/contrib/108771390940180127266/reviews', 'en', 'https://lh3.googleusercontent.com/-U4fH7mInZXI/AAAAAAAAAAI/AAAAAAAAF0U/ZtCBILI4ZOc/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 2, '6 months ago', 'The person performing the role of Patient Service Representative was the worst I have ever worked with. I currently work in a medical practice and I had questions and concerns about the process and that I had called and scheduled a 12:30pm appt prior toy arrival.  She replied, \"he has nothing to Do with what really goes on in the offices he\'s at a desk taking calls, your appointment is 1:30\". She was very uncomfortable to speak to as her attitude was terrible and she lacked the customer service I Paid for in order to become a Patient. I have never felt more uncomfortable in a professional setting.  Nate the MA was very Knowledgeable and courteous. The Provider Dr.Fitzgerald was prompt and attentive. She was very professional, I loved her bedside manner. She has a true passion for medicine even though she was restricted from giving me more educational information due to a pricing difference.  I will probably not be returning due to being charged for a service and being treated like I was. \nPs over the phone I was informed my card would probably arrive in 7 to 10 days, when.I informed the PSR she promptly stated no its 10 to 15. Thats wrong. \nOnly reason I did not turn around and leave was due to the fact i went through a horrendous time obtaining my medical records\n I\'d strongly recommend Dr. Erin Fitzgerald but, my dissatisfaction began at the front desk, and ended at the front desk.  It was definitely a difficult process to be seen and to deal with poor customer service is a shame. \n\nThank You Dr. E.F.', 1510994765),
(168, 37, 'Todd Elliott', 'https://www.google.com/maps/contrib/102907820625517846952/reviews', 'en', 'https://lh5.googleusercontent.com/-KmH9GJRquTg/AAAAAAAAAAI/AAAAAAAAABg/EzBbMrdiIMY/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '4 months ago', 'I enjoyed my first experience here with product and staff. And am about to make my second visit', 1514936779),
(169, 37, 'Henny Jones', 'https://www.google.com/maps/contrib/106296221892118390756/reviews', 'en', 'https://lh4.googleusercontent.com/-nvhIkEVfN1Y/AAAAAAAAAAI/AAAAAAAADkE/Qy3mER3ucwM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Great, the doctor was awesome when I went to get my card renewed, while on Medical Marijuana I haven\'t needed to go to a regular doctor and hardly use any medications so I didn\'t have any medical records. The doctor was fast, and knowledgeable.\n\nMy card is expires next week and I\'m planning on coming in this week to see him again!', 1492012963),
(170, 37, 'Chris McCabe', 'https://www.google.com/maps/contrib/102992460813445498578/reviews', 'en', 'https://lh6.googleusercontent.com/-wfrEM5dA85M/AAAAAAAAAAI/AAAAAAAAj2E/Qtq3FWbdk4c/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '11 months ago', 'Very fast and knowledgeable staff. I was able to get qualified within an hour!', 1498760724),
(171, 37, 'Stephan Shere', 'https://www.google.com/maps/contrib/100175888970384750297/reviews', 'en', 'https://lh5.googleusercontent.com/-s-StQQs7azM/AAAAAAAAAAI/AAAAAAAAA5Q/oohLEJVEWW4/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, '9 months ago', 'Website has information about services that do not exist. Office staff are rude and unempthetic.', 1502746223),
(172, 38, 'Beverly Halter', 'https://www.google.com/maps/contrib/101975496531319758872/reviews', 'en', 'https://lh6.googleusercontent.com/-HTpB_zlIo8Y/AAAAAAAAAAI/AAAAAAAAACI/skRIx_d1mAE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Best dispensary experience I’ve had in 3 years! They grow their own which makes for higher quality product yet still affordable with great variety. Everyone is friendly and professional and the products are displayed beautifully. I want to live there ', 1526666408),
(173, 38, 'Natalie Allen', 'https://www.google.com/maps/contrib/106718608411674381563/reviews', 'en', 'https://lh6.googleusercontent.com/-1SzV2j09lQU/AAAAAAAAAAI/AAAAAAAAivU/X2habDgCP70/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Just went here for the 1st time . They have excellent staff who are extremely knowledgeable in all aspects of the medicinal effects. They also have an amazing selection of very high quality items.  They also have a great 1st time patient special. I will for sure be returning.', 1526656428),
(174, 38, 'Alexandra Salazar', 'https://www.google.com/maps/contrib/113847686512724097698/reviews', 'en', 'https://lh4.googleusercontent.com/-YVsHGd_V7L4/AAAAAAAAAAI/AAAAAAAABLQ/oak3h-hbxZc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'This was my first time in the shop and it was amazing! They were super nice and friendly. The guy who helped me was so nice and knowledgable. It was very quick also. My meds were great and were of super quality! Can\'t wait to come back! :)', 1526425658),
(175, 38, 'Danielle Kiley', 'https://www.google.com/maps/contrib/105588786666073552881/reviews', 'en', 'https://lh4.googleusercontent.com/-GutMSWuTqf0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1cGA8njJRrHXPNz_KxeqdXDuPupA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Their new patient special is trash, buy 2 grams get 2 grams? I’m amusing they don’t move through product because the bud I bought was harvested at the beginning of February 2018 and I bought it towards the middle of May. It had the worst taste and was so dry it basically  turns to powder when ground it up. The effects seem to leave after 20 minutes and that’s being generous with the amount of time. 10/10 wouldn’t recommend.', 1526576136),
(176, 38, 'Crystal Deleon', 'https://www.google.com/maps/contrib/106738106939354735513/reviews', 'en', 'https://lh4.googleusercontent.com/-J5_77r4abkw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2EpCfuGRNVElOM99FCiR3_-f0x8w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Natural selections is amazing! The staff is VERY helpful and knows a lot about the products. I purchased items for my dog (edible treats) and I feel more at ease that the bud-tender knew what he was talking about!', 1523837442),
(177, 39, 'ranchycowgirl88', 'https://www.google.com/maps/contrib/101130266880027571935/reviews', 'en', 'https://lh3.googleusercontent.com/-cyQwkguEfak/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq13mheVRMmfoWD6HxnLBFvMluACnw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Let me start off by saying this was a first experience for me and from the initial phone call, I was highly impressed with the professionalism and understanding. They were able to get me in same day to see Dr Seder. When scheduling the appointment, the friendly staff explained the process, cost, and answered all my questions.\n    Arriving at the office was also pleasant. It is discreet, and does not look as if you are walking into anything other than a medical practice, which is truly what it is. I then had the pleasure of meeting Dr Seder, who has excellent bedside manner, explained what strains would be best for my needs, and educated me on anything I had questions about. I cannot say enough good things about this experience. If you are looking for a real Dr, in a real office setting to discuss your health, then please visit Dr Seder and the rest of the wonderful staff.', 1522290289),
(178, 39, 'Doug Williams', 'https://www.google.com/maps/contrib/105248336353005166952/reviews', 'en', 'https://lh5.googleusercontent.com/-WZjw4bOdQQ0/AAAAAAAAAAI/AAAAAAAAAI8/SDVEAP70fbQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Great overall experience. Wasn’t really sure what to expect, but the entire staff makes you feel at ease. Appt was quick and I was in and out in about 45 mins. I would recommend this place to anyone!', 1514420323),
(179, 39, 'Guy Jacob', 'https://www.google.com/maps/contrib/103010546929136391760/reviews', 'en', 'https://lh6.googleusercontent.com/-TgOvj4i3r-0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0WSwF1DtZlYAAlfouwYbuUjjUpEg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Wonderful place fast..dr new alot and was well educated..look forward to ur help with renewals', 1517211454),
(180, 39, 'Omar Anderson', 'https://www.google.com/maps/contrib/108590406368575688898/reviews', 'en', 'https://lh6.googleusercontent.com/-6vAE7BJfqLI/AAAAAAAAAAI/AAAAAAAAAJg/hmYyQejAJnE/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'Nice people and great location... really in tune with the patient\'s needs.', 1515272616),
(181, 39, 'Jason K', 'https://www.google.com/maps/contrib/117743601063571538442/reviews', 'en', 'https://lh5.googleusercontent.com/-hYWDbaYKfc4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1sikq8inhiHsv8KSrZXxwRPQveGw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', '', 1521068622),
(182, 40, 'Grant Randolph', 'https://www.google.com/maps/contrib/103312737136045538433/reviews', 'en', 'https://lh4.googleusercontent.com/-tqpKws678ug/AAAAAAAAAAI/AAAAAAAAAi0/g3ck6laIH60/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'One of the best places to come get everything you need and want they have great staff great location and some of the tastiest bud you ever will buy check them out', 1526513485),
(183, 40, 'stitch414', 'https://www.google.com/maps/contrib/105962239075855568235/reviews', 'en', 'https://lh6.googleusercontent.com/-d3tby9G1sTM/AAAAAAAAAAI/AAAAAAAAAEo/0TdFrAD4Yig/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, 'in the last week', 'Nice place, good prices, great deals + points reward system! Decent product, better than most dispensaries around here', 1527649237),
(184, 40, 'Eric Hosford', 'https://www.google.com/maps/contrib/114065966712749479697/reviews', 'en', 'https://lh4.googleusercontent.com/-88JLeHUv2WY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2RrTmVuG_higBAu1oE5pFkozvevA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Brought them some good business and new clients. They couldn\'t even help me out with something so minor it would have costed them $10 (their fault too). So a $10 issue costed them hundreds if not thousands of dollars in future revenue, but to them that\'s just another drop in the bucket.', 1523403659),
(185, 40, 'Travis Reagan', 'https://www.google.com/maps/contrib/100714705403912989034/reviews', 'en', 'https://lh5.googleusercontent.com/-v-yGRyabqow/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1V9dtML_CA2KoiKV1V2UjS-PbfzQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Met Taylor today. She did a great job and was knowledgeable about all the products and strains. No bud tender before offered the genetics of the hybrids like she did! Thanks again to the gh for the great deals and quality smoke!', 1521865787),
(186, 40, 'jason nino', 'https://www.google.com/maps/contrib/109896563063147760656/reviews', 'en', 'https://lh5.googleusercontent.com/-U8vM46jufG0/AAAAAAAAAAI/AAAAAAAAH4Q/kbM-5zGRYIk/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'LISA IS AN AMAZING PERSON... GOTTA LOVE HER... SHE HELPED ME OUT AND WHEN THINGS COULDN\'T WORK... SHE TOOKHER TIME AND HELPED ME UNDERSTAND WHAT WAS GOING ON.... THX LISA, YOU WERE AWESOME...', 1524261856),
(187, 41, 'Psycho Bunny', 'https://www.google.com/maps/contrib/113383482520239979644/reviews', 'en', 'https://lh4.googleusercontent.com/-OpzrxEXr8l4/AAAAAAAAAAI/AAAAAAAAOQk/aY2En_iCs9U/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 3, '2 months ago', 'Decent place, The staff are very nice here. But all but ONE has seemed to not know much about tinctures, I feel all workers should be educated on every product, or at least designate someone to areas that they know about. I also had an experience with a product recently that was sold to me  the manager told me that I could either get an exchange or a refund I feel when a product has been messed up like that they should automatically refund you but that is just my personal opinion for good business. They do give discounts all days of the week you can go in and look at the specials again the staff are very friendly and personable with you which I enjoy very much because I believe it should be that way, I really hope that they can improve on some of the things i mentioned, with any business there is always room for improvement.', 1522110972),
(188, 41, 'Steven Hagar', 'https://www.google.com/maps/contrib/105204246868277779251/reviews', 'en', 'https://lh6.googleusercontent.com/-H9UmXHCzbOc/AAAAAAAAAAI/AAAAAAAAQfc/PIV4S8_U7MY/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, 'a week ago', 'First time visitor. Location easily accessed. Pricing was the best I\'ve seen (this is the third store I\'ve been in). The sales group were attentive and knowledgeable. I\'ll update this when I\'ve got a better feel for the quality of goods.', 1526756728),
(189, 41, 'Dan Salinas', 'https://www.google.com/maps/contrib/116502817141570844996/reviews', 'en', 'https://lh6.googleusercontent.com/-uyWENk1SGP8/AAAAAAAAAAI/AAAAAAAAKMA/9eb_8c1Fp1U/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'This place is absolutely awesome. Great customer courtesy. Very welcoming. And they have a vast selection of product. And the prices are so low. You really need to check thus place out.', 1525986525),
(190, 41, 'Rage Ape', 'https://www.google.com/maps/contrib/101510518561266562529/reviews', 'en', 'https://lh6.googleusercontent.com/-ldOHdgkjVMc/AAAAAAAAAAI/AAAAAAAAAjE/Vkm9f9UOLbc/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a month ago', 'This is by far the most caring dispensary I have been too. Always happy to see you and great selections of products. Need more parking. That is all.', 1524975579),
(191, 41, 'Patricia Wilson', 'https://www.google.com/maps/contrib/100147632460387406262/reviews', 'en', 'https://lh5.googleusercontent.com/-01IvyNlubgQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0HWRoQ9b2Yi1VTYk2xg3tefpX24w/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '3 months ago', 'In need of naturopathic alternatives for medications for various medically diagnosed conditions, I sought help at All Greens Dispensary. The staff helped educate me on their product choices through seminars, events, specials and websites. They are fabulous with people, taking ample time to help guide each transaction. Grateful to have medical choices available to me that don\'t carry the chemical side effects of pharmaceuticals!', 1517466294),
(192, 42, 'Josh B.', 'https://www.google.com/maps/contrib/117690783180897056698/reviews', 'en', 'https://lh4.googleusercontent.com/-EK_xWvSwdoY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2ZjtSaajVl_6vmkQBjdOS_SK-UUQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Usually go to White Mountain for concentrate as that\'s all I smoke.  They have been having bad issues with stock, and they haven\'t been able to consistently keep inventory, so I was FORCED to look elsewhere.  ANS is AMAZING.  Their concentrates are great, and well-blasted, and they blast their own product with no herbicide or pesticides.  Great well ran shop.  Definitely going to have to replace White Mountain as my go-to, and favorite dispensary!', 1525543302),
(193, 42, 'Mona Bell', 'https://www.google.com/maps/contrib/116840139267578342021/reviews', 'en', 'https://lh5.googleusercontent.com/-GiJF9zjU55k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3HU2gvtp8Z_qExwnOZIP6kJe1bDg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Excellent selection. Knowledgeable bud tenders. Very welcoming staff. The house cartridges burn well but tend to get dark towards the end, but for $35 for 800mg, it’s still a great deal. Good first time patient deals too!', 1524073412),
(194, 42, 'Tim Herrick', 'https://www.google.com/maps/contrib/113735492988449105625/reviews', 'en', 'https://lh3.googleusercontent.com/-PeSaI_P4yv0/AAAAAAAAAAI/AAAAAAAACIU/uKyLqNJD-hA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 weeks ago', 'Awesome customer service.  Jess was very welcoming and informative to start, Coozy my bud tender was truly a sweetheart! He was helpful in choosing what would be best for my medical needs. He loved his job and was very uplifting!!! The atmosphere was very soothing. I’ll be back!! Thanks so much.', 1525228812),
(195, 42, 'Melissa Medina', 'https://www.google.com/maps/contrib/100511508227164650597/reviews', 'en', 'https://lh5.googleusercontent.com/-Od-6EWkfmNc/AAAAAAAAAAI/AAAAAAAAAB0/DZnpBSY9n9k/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I totally recommend this dispensary. They have a very friendly & educated staff, products are great & prices are not bad. They make you feel really welcomed & comfortable. If you don\'t have much experience with cannabis or not sure what to get...they listen to your needs & give you good recommendations. I will definitely be returning to this dispensary!!!', 1521872874);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(196, 42, 'David Butler', 'https://www.google.com/maps/contrib/111540173052932862783/reviews', 'en', 'https://lh3.googleusercontent.com/-bzUjGd1nT08/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3mduoOIc7LSVCgwPxCH13uR776lA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'From the moment I walked in the door until the time I left, the staff were professional and super nice. The young lady who helped me out I believe is named Karen. She was very helpful as I had no clue how to start. I recently received my medical card and she walked me right through the short peofile process. Lastly, AZ Natural Selections has very high quality flower at very reasonable prices.', 1524803460),
(197, 43, 'Jessica Thomas', 'https://www.google.com/maps/contrib/102650783453604412383/reviews', 'en', 'https://lh3.googleusercontent.com/-ESl7jYP4ORA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0wpjLxJG9Vtl6XDeuIYTyWo-Tb4g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I love coming here!!! Quality products and excellent customer service. The waiting room is clean and has plenty of seating. I recommend you check it out! Special shout our to Isaiha T for the awesome service tonight', 1527651090),
(198, 43, 'Megan Bennett', 'https://www.google.com/maps/contrib/101123942039396362937/reviews', 'en', 'https://lh3.googleusercontent.com/-qlOZEuI0WKY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1tldonc5m_8-H2Z0RXkvlBYD2HZA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'The Sky staff really makes this dispensary a comfortable place to get my meds. The prices and quality are great, and... best of all they TEST their flower. I need to shop for my medications at a place I can trust.. and Sky Dispensary Mesa is the place!', 1526319268),
(199, 43, 'Shane Zimmerman', 'https://www.google.com/maps/contrib/106709349516788298679/reviews', 'en', 'https://lh3.googleusercontent.com/-mggmlItx6ys/AAAAAAAAAAI/AAAAAAAAGvk/DpvQWGU_COE/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'Great FRESH buds, in their nitrogen sealed cans.\nExcellent quality! \nEdibles and vapes are high quality as well. \nLittle pricey, but the service makes it worth while.', 1525753629),
(200, 43, 'T T', 'https://www.google.com/maps/contrib/115396471123826073554/reviews', 'en', 'https://lh3.googleusercontent.com/-vGN8JlrgStw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3mTpVUrTAuTDBU0SdXL5Vf0wuDoQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Thanks sunflower meds for always having Dank flowers!! Staff is always friendly and always willing to help! I would definitely recommend sunflower for its flower.!!!!! Always worth the stop guys!', 1527277740),
(201, 43, 'mark Byrd Byrd', 'https://www.google.com/maps/contrib/106101424580254899656/reviews', 'en', 'https://lh5.googleusercontent.com/-daWD0YqdjyI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3UihWA1F3oCl1y_mIyBH8AidYaRw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'I asked alot of questions. Staff was very patient and knowledgable. Great product also!! Highly recommend!  2/16/2018. Been here many more times and it seems to always get better both service and product..  04/01/2018  I visit at least 8 times monthly . Service and product always beyond compare. Highly recommend!!!!!', 1522610293),
(202, 44, 'SunDevilThor', 'https://www.google.com/maps/contrib/102341384140730372890/reviews', 'en', 'https://lh5.googleusercontent.com/-1-nnVt9-p50/AAAAAAAAAAI/AAAAAAAAHuU/6k8XqINvF2w/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 years ago', 'If there were an option to pick zero stars, I would. I have never been given service so bad that I felt the need to write a review. The manager does not take calls from customers. The doctor is never on site and is not even an M.D. Every appointment that I have made has been canceled on. I have been here five times for one certification and never received service. I asked for a refund and the manager refused. I am walking away with wastes time and money. This establishment steals money from you. Avoid at all costs. ', 1391824638),
(203, 44, 'rick annis', 'https://www.google.com/maps/contrib/101726993221446345752/reviews', 'en', 'https://lh5.googleusercontent.com/-KMCp4VpG7H0/AAAAAAAAAAI/AAAAAAAAAC8/T7m5VUtGI_M/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '6 months ago', 'Scammed out of $100...', 1510111651),
(204, 44, 'Amanda Phipps', 'https://www.google.com/maps/contrib/110175182367736928290/reviews', 'en', 'https://lh4.googleusercontent.com/-0y-ujnXtxL0/AAAAAAAAAAI/AAAAAAAAAP8/h2TmTMRROV8/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 years ago', 'Do not go here. It is a huge waste of your time and money. The people there do not hardly ever answer the phone. I was told five separate days that I would be called back the next morning to schedule me an appointment, and they never called me back. The doctor was unable to draw simple conclusions from my medical file. The doctor was out for most of the week and no one in the office even knew it. I doubt they have the competence to actually issue the refund I requested.', 1392937110),
(205, 44, 'Jorge Espinoza', 'https://www.google.com/maps/contrib/116922133272810599188/reviews', 'en', 'https://lh4.googleusercontent.com/-C75Kkh4pOe0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1-gbtnmF_fEL57WQPl0wZ2maD3IA/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '5 months ago', '', 1512493431),
(206, 45, 'Cris Freneaux', 'https://www.google.com/maps/contrib/104519005662888477632/reviews', 'en', 'https://lh5.googleusercontent.com/-naXCKH6RzI0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1paTuxPiYO6E7aMEAmGWJKM88nMA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Superb flowers and friendly and knowledgeable staff. Great selection on all products and they have almost everything you can imagine. You’re missing out if you don’t go to The Downtown Dispensary!', 1524785160),
(207, 45, 'Cindy Benner', 'https://www.google.com/maps/contrib/108149553300283197872/reviews', 'en', 'https://lh3.googleusercontent.com/-cm0BydDK0ec/AAAAAAAAAAI/AAAAAAAADtQ/9FiJ5qyXstY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'All the staff at Downtown Dispensary are very knowledgeable on their products and help you get the best product for what you are looking for.  I always know I can trust what they are telling me.  Wait times are very short.  I don\'t think I\'ve ever waited more than eight minutes or so, tops.   Great selection too.  I would highly recommend this dispensary for all your marijuana needs :-)', 1521477956),
(208, 45, 'Sethaniel Bellah', 'https://www.google.com/maps/contrib/108415792674973561045/reviews', 'en', 'https://lh4.googleusercontent.com/-ZKB95WjgmB0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3ERQc6t65zBGMBnwE1OGUcDGmn1w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I love this place! Definitely the best shop in town, friendly staff and high quality products make the downtown Dispensary my go to location for my medication. If I could give more than 5 stars I totally would!', 1521835051),
(209, 45, 'Loren Trujillo', 'https://www.google.com/maps/contrib/105257716149487769377/reviews', 'en', 'https://lh4.googleusercontent.com/-qxFDrAyoxdQ/AAAAAAAAAAI/AAAAAAAAAhY/XvB3Gfp7H1Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Knowledgeable, super friendly patient care consultants. Clean, welcoming surroundings. Quick service. Always top shelf product, even on the lower priced end of the spectrum. Highly recommended.', 1521507239),
(210, 45, 'Steven Garcia', 'https://www.google.com/maps/contrib/116154935881333542601/reviews', 'en', 'https://lh5.googleusercontent.com/-4c2HxN9BL8A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq25CsLWEbNsORlfevMOIwcwtFOjRg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'It\'s my first time in today great experience so far and the lobby was spotless. 5 stars! Such an amazing place', 1521859888),
(211, 46, 'lee kirby', 'https://www.google.com/maps/contrib/117779591295077648626/reviews', 'en', 'https://lh5.googleusercontent.com/-OSEjSmC5sMk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2mEqyPlqPHHRyns0i8NJxxRkz9NQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Great store, great people, big variety of great products. From the front door everyone is friendly and relaxed. They have a lot of ongoing deals for different shoppers. The best part, you can use your FTP deal at both locations. This is rare in my experience. A lot of reasons for return visits.', 1527613487),
(212, 46, 'Kelley Daniels', 'https://www.google.com/maps/contrib/113499518930504634898/reviews', 'en', 'https://lh4.googleusercontent.com/-cfnM-PzFWMk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3c8PIuZ69EpgShUWi7cAFQe7k20Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'This is the first dispensary I hit up in phoenix and I live right down the street from it! They provide an amazing selection and are super organized and knowledgeable. They even give out free rigs to new patients! Like what?!?! So excited to be apart of an amazing dispensary!!', 1526011316),
(213, 46, 'Misti Taylor', 'https://www.google.com/maps/contrib/101596330106141298153/reviews', 'en', 'https://lh5.googleusercontent.com/-tJARoKrR9TY/AAAAAAAAAAI/AAAAAAAANgA/U5simKmOfOM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This place is awesome. Every time I go I leave happy and I haven’t even opened the bag yet. The staff is great, very knowledgeable but also just really cool people. I’m always excited when I go to see what’s new and get updates. I tell everyone to go here.', 1523740950),
(214, 46, 'cr D', 'https://www.google.com/maps/contrib/101971014561124721890/reviews', 'en', 'https://lh3.googleusercontent.com/-Dt7Rjkpzh9o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq367HF0eVJJKxOJJul5Y6rvJcGcNQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Great 1st timer deals. Awesome free pipe. Cool friendly staff. Good vibes. Fun atmosphere. Fantastic selections. Definitely check them out. Smile.', 1524892722),
(215, 46, 'stacey ward', 'https://www.google.com/maps/contrib/110578914601553720686/reviews', 'en', 'https://lh3.googleusercontent.com/-5ptlPtrR_aw/AAAAAAAAAAI/AAAAAAAAAG8/1yXhhWOr7Gw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Most helpful informational people I have ever met. Definitely know what they are doing and they just know what you are looking for! They let me know the deals of the day and gave me a quick background of their establishment', 1525918885),
(216, 47, 'Carlo McCoy', 'https://www.google.com/maps/contrib/116787170073269126172/reviews', 'en', 'https://lh3.googleusercontent.com/-mLHxzvIMy2E/AAAAAAAAAAI/AAAAAAAAPYg/SinEgzOOuG4/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg', 3, '3 weeks ago', 'Located Not Too Far From A Banging Competitor; Circumstances Of These Two Progenitor Stars Might Clash Pretty Soon...Who Is The Best, You Decided.  However, Nova Appears To Shine A \"Wee Bit\" Brighter.  Adjacent To Many Munchie Spots.  Free G For Newbies!  Rustic Tile, Clean And Efficient.', 1525464778),
(217, 47, 'Mac l', 'https://www.google.com/maps/contrib/111611027050091791120/reviews', 'en', 'https://lh6.googleusercontent.com/-rYo2tZeF3Ls/AAAAAAAAAAI/AAAAAAAAACY/_e46mZwgGi4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '3 months ago', 'Finally, I no longer feel like they\'re trying to purposely give me bad customer service. As we all know from my last review I wasn\'t happy with Nova. This is that same review but I wanted to change it.\nI noticed almost all of the staff has changed which has been a good thing for me.\nThe past 2 days I came in went right back, they had what I wanted, and they got my order right. I was in & out in 5-10 minutes each time. Roger made me feel welcome like someone you haven\'t seen in awhile & that initial excitement in their voice \"Oh hey MacKenzie! How are ya? Did you have to take a long bus trip today?\" It was nice.\nThen when an error popped up with my card the guy went in the backroom and shut the door to talk to someone at first I thought maybe they were about to refuse me service from my prior problems. But the guy came out as well as the lady he talked to just to tell me it isn\'t me it\'s the program they use they\'re just going to re-enter all my info in.\nThanks!', 1519074335),
(218, 47, 'Chris Gemmell', 'https://www.google.com/maps/contrib/100988636408573641650/reviews', 'en', 'https://lh3.googleusercontent.com/-uJmpayhcygY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Bf9ybIeTBgBWLSChkNv-gIAaT3A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Been coming here for a while now and always impressed! Great friendly super customer service! The product is always the best and the prices are great! And you guys really look out for Veterans! All in all I love this place .  However I did come in today and the waiting room was kinda full and there was one particular person being so obnoxious that it actually ignited my anxiety and the person actually yelled to the other person he was with. \"Hay man you better get me some good weed\" I know you guys can\'t directly control people especially what they say but it just bothers me to see how hard people have worked to provide marajuana legal for medical reasons that so many people need and yet people like that threaten to ruin it for the ones who need it. Not to mention the frustration of the money and effort people put in to going about things the legal way', 1517003117),
(219, 47, 'physkie green', 'https://www.google.com/maps/contrib/107247325815116658346/reviews', 'en', 'https://lh6.googleusercontent.com/-C31GMTKjrr8/AAAAAAAAAAI/AAAAAAAACSQ/-ljNvvLL_Yk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great place to shop best CBD FLOWER.\nGOOD EDI', 1522017419),
(220, 47, 'Matthew Dorre', 'https://www.google.com/maps/contrib/104498555861155044022/reviews', 'en', 'https://lh3.googleusercontent.com/-4ccJ4jJo9_c/AAAAAAAAAAI/AAAAAAAAAO4/wg9bApnPTpI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'The person I talked to here was very experienced. The word \"knowledgeable\" gets thrown around a lot so I\'ll emphasize it here. They knew what they were talking about, obviously had a lot of experience, and they were very informative and friendly.', 1515519290),
(221, 48, 'Noah M', 'https://www.google.com/maps/contrib/114307429146472028871/reviews', 'en', 'https://lh4.googleusercontent.com/-r2JI3JR4-Ag/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0--_0QBJ96ID6u-eCtspoyGPVKLA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Best dispensary in Phoenix hands down. Always get their concentrate deals amazing price. Staff are really chill also. Will be coming back for life!', 1523154780),
(222, 48, 'Danny Bradley', 'https://www.google.com/maps/contrib/116402742651189436242/reviews', 'en', 'https://lh3.googleusercontent.com/-Yw5ssb9RQsU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2LUUsXB4z9clAY1t17_H1AWkS4yQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Customer service is top notch. Picked up some flower today that is amazing. Also got a vapen cartridge and edibles. products are great highly recommend this place.', 1525928207),
(223, 48, 'J G', 'https://www.google.com/maps/contrib/109293217678910760789/reviews', 'en', 'https://lh4.googleusercontent.com/-Q7N-aeS07PE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2_h9Nw6bIHH3kbCY0lwrgKu46gbw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'I got referred here by a friend let\'s see what happens...I called and so far so good  one now I\'ll post an update when I leave', 1526412400),
(224, 48, 'Arturo Delgado', 'https://www.google.com/maps/contrib/118109413584311917397/reviews', 'en', 'https://lh3.googleusercontent.com/-go-HlqJiLJg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3sKqE7SvQBc7aB7hVm64ieo_bq8Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'in the last week', 'Honestly disappointed. Don\'t get me wrong customer service was great budtender was super cool but the product not so great I\'m satisfied with the shatter I got but the flower and cake batter was not too good both had a real earthy moist taste I opened my container of concentrate today and their was a puddle of liquid in it and the flower wasblueberry looked amazing smells good too like blueberries but once again the real earthy moist taste the concentrate and flower were 2 different strains yet almost smell identical in a way I want too concerned on the flower till I smoked it Idk good vibes in there but I honestlyhave no desire to go back unless its for the shatter vapen has great shatter', 1527468092),
(225, 48, 'Bailey hall', 'https://www.google.com/maps/contrib/100411279046735316634/reviews', 'en', 'https://lh6.googleusercontent.com/-O89iSpvY1BU/AAAAAAAAAAI/AAAAAAAAANA/_77cnKZLco0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'This place is amazing. The staff are excellent with their knowledge on the products. I am always happy to return.  Really can’t praise them enough!', 1517679145),
(226, 49, 'Madison Fitzgerald', 'https://www.google.com/maps/contrib/110300837051338158777/reviews', 'en', 'https://lh4.googleusercontent.com/-xS0UBW0m1o4/AAAAAAAAAAI/AAAAAAAAD40/AVBaHs6stDQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Hands down my favorite herb shop. Their edibles are high quality and tasty, and the staff always makes me feel right at home. On holidays, they have amazing give aways/deals. I wish every shop was like this. Only downside: it\'s a little small. I believe they are also one of the only places in Arizona that make their own edibles, but I could be wrong about that so be sure to ask!', 1524348465),
(227, 49, 'Susan Bennett', 'https://www.google.com/maps/contrib/105820278676159085819/reviews', 'en', 'https://lh3.googleusercontent.com/-h1rRNlwiJP0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0JWIalI-KRlBSpCN_GGcBuszsIIg/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 weeks ago', 'Great dispensary.  Great prices.  Products are good.', 1526482107),
(228, 49, 'Jared Price', 'https://www.google.com/maps/contrib/109042856498144785511/reviews', 'en', 'https://lh6.googleusercontent.com/-zvV8ND5S-1c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0TTfrsyUkB_Shketlcr355U5cDPA/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '3 weeks ago', 'Very friendly staff, however the quality of the flower is low! Good prices on shatter, however they have been out for weeks! Just being honest.', 1525673262),
(229, 49, 'Sherri Phillips', 'https://www.google.com/maps/contrib/107183005838340746974/reviews', 'en', 'https://lh4.googleusercontent.com/-e70Z5jpuT5o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1baZ9uJmp_bLnvQxtzHHb2I1GZJw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Love this place.  Everyone is so nice an helpful!!', 1526247376),
(230, 49, 'billyjack gasman', 'https://www.google.com/maps/contrib/105768293058804431708/reviews', 'en', 'https://lh5.googleusercontent.com/-hPr9NIRMK9I/AAAAAAAAAAI/AAAAAAAAACI/MSGYdrmVBpQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Great products wonderful staff best shop around', 1519341468),
(231, 50, 'J L', 'https://www.google.com/maps/contrib/100700565879689524397/reviews', 'en', 'https://lh6.googleusercontent.com/-2wU_0OFPru4/AAAAAAAAAAI/AAAAAAAAAKQ/3tPJqiu9cpQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, 'in the last week', 'Laura, the woman at the front desk is very nice & helpful, one of the only employees who’s consistently kind & respectful. Unfortunately the products they offer SUCK and are over priced. They don’t do any special deals or discounts and regularly out of products. Save your self the time and money and go to another dispensary. The staff are amazing. If only the mmj was just as good........', 1527527521),
(232, 50, 'Kathy B', 'https://www.google.com/maps/contrib/108069025458919885536/reviews', 'en', 'https://lh4.googleusercontent.com/-mPQqrJPEiSw/AAAAAAAAAAI/AAAAAAAAACM/7O4o2c7CPlI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I think they are doing a great job and I love their convenient hours. This is not a big city and not a huge customer base to be served. The store is clean, employees are knowledgeable and give great customer service.', 1524261959),
(233, 50, 'Kandee Leaver', 'https://www.google.com/maps/contrib/107934513341223587268/reviews', 'en', 'https://lh6.googleusercontent.com/-He2IBu7jgvY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0l-o_DBitX0kHArOwS0knT8aLLdQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'I only go if I\'m completely out and feel desperate due to pains..IF I can\'t get anywhere else at the time. This is due to misinformation given on strains (more often than not), inaccurate weights of product being purchased (it\'s not weighed in front of you) and the expense being too costly. I quite literally save up to drive 2 hours to go to a real medicinal dispensary to avoid mismedication which happens regularly here. This place seems like a street dealer went legal and doesn\'t deal with negative feed back well at all professionally. I prefer to spend my money else where, where I can receive proper care for my medications. I\'m very disappointed in their services every visit I\'ve been. I rarely go but every other month and won\'t buy more than a gram to hold me over til I get to a real dispensary.', 1517700472),
(234, 50, 'YaBoi Rob', 'https://www.google.com/maps/contrib/103714763884624411467/reviews', 'en', 'https://lh5.googleusercontent.com/-CjtXG_T_hkM/AAAAAAAAAAI/AAAAAAAAAA4/R5-SVaDVR6U/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Overrated and over priced. For my money I\'d much rather make the drive to the one in Bisbee, or Green Halo.', 1526836566),
(235, 50, 'Daphne McLean', 'https://www.google.com/maps/contrib/114203166808702869076/reviews', 'en', 'https://lh6.googleusercontent.com/-GzQmVW2O5-c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0M6zMhQNmRYqFKpdRNr2Lg2Zgchg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Great staff, great herb choices and the staff was very helpful. Will definitely be back.', 1519604963),
(236, 51, 'Mimi Pritchett-Louiso', 'https://www.google.com/maps/contrib/111332067872811932394/reviews', 'en', 'https://lh6.googleusercontent.com/-mxgj282I1f0/AAAAAAAAAAI/AAAAAAAAEN8/NKwHzP0A4Aw/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '2 weeks ago', 'The best edibles. Period. They usually have 30+ strains always available and super cool associates.  \nWhataburger is across the street  bonus!!', 1526159351),
(237, 51, 'Mr. Sanchez', 'https://www.google.com/maps/contrib/108771390940180127266/reviews', 'en', 'https://lh3.googleusercontent.com/-U4fH7mInZXI/AAAAAAAAAAI/AAAAAAAAF0U/ZtCBILI4ZOc/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '5 months ago', 'YiLo is my now Go-To dispensary. From my first visit to a dispensary to my current repeat visits I have been met with nothin but courtesy and professionalism.  These great people know what they\'re doing and  knowledge base is always growing.  There are a few new faces but they have been very friendly! I personally love the young woman who assisted me today! She was very, (how can I say this) AWESOMELY PERSONABLE and she has brought me back time and time again, although its hard to choose who you checkout with at busy hours. But It is well worth the trip.', 1513451429),
(238, 51, 'carlos padillakalman', 'https://www.google.com/maps/contrib/107522175957113851808/reviews', 'en', 'https://lh6.googleusercontent.com/-xx5jgZJY-PY/AAAAAAAAAAI/AAAAAAAADZA/aIkMnLnvYa0/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a month ago', 'This is my favorite dispensary. Friendly smiles. Informative staff. Good products, great deals.', 1524325246),
(239, 51, 'Jayna Christiansen', 'https://www.google.com/maps/contrib/106491232231282365440/reviews', 'en', 'https://lh6.googleusercontent.com/-cx4whlmayzQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Ka3CzD9tblmiEwq425ZVJnwefKA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Always have what my dad is needing and he says he gets what he pays for he never complains about customer service they r always smart n helpful', 1523664546),
(240, 51, 'Holly Gashi', 'https://www.google.com/maps/contrib/109878095298323684663/reviews', 'en', 'https://lh5.googleusercontent.com/-X-voXMwVBEE/AAAAAAAAAAI/AAAAAAAAAXY/LtxvluC_PoA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Pretty disappointed with this place.  I went in about 2 weeks ago for some CBD products. Purchased a bag of the gummies and a vape cartridge and my total was $47. Went back in tonight. Asked for the exact same products I got at my first visit and the total was $67. Really? The price jump was on the vape cartridge,  which got me through about a week at two puffs a day.  Definitely go somewhere else if you are looking for CBD products.', 1523421324),
(241, 52, 'Celina Mendoza', 'https://www.google.com/maps/contrib/116503205751560424105/reviews', 'en', 'https://lh3.googleusercontent.com/-mOq4sVMgFx4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0IADnMxckQR57r66m105C4IoJQ0A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Great budtenders. On our 1st visit, we got a free pre-roll, I picked a higher CBD strain (upon recommendation because I have major nerve pain down my whole body),\ncalled Day dreamer,  (not sunshine daydream), and wow. Instant pain relief and and instant gravity pull to lie down, which is exactly what I\'m looking for after mentally and physically tough days of work. I\'ve had my card for about 2 months, and, after 2 years of hard-core  nerve pain, CBD strains like this, have suddenly changed my life.', 1519709412),
(242, 52, 'Michael Lagos', 'https://www.google.com/maps/contrib/115166568806205326972/reviews', 'en', 'https://lh5.googleusercontent.com/-G0_H4ZtUpjE/AAAAAAAAAAI/AAAAAAAABFo/X-tE1nuQIN0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Friendly staff and a professional enviroment. I definitely would reccomend', 1522054794),
(243, 52, 'Cherilyn Murphy', 'https://www.google.com/maps/contrib/109935256522067530784/reviews', 'en', 'https://lh6.googleusercontent.com/-USjdNMW1Wek/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1rYLmvjfdrEzrtC5gqB6KrRHihrw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Love you guys! Good choices, good atmosphere', 1526333199),
(244, 52, 'Kelly Boggs', 'https://www.google.com/maps/contrib/106975553637050116789/reviews', 'en', 'https://lh3.googleusercontent.com/-Fs03syVgWRM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq17VnEBPAetgU6JrBMmJTtBoY32kg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'Great place for my meds.', 1527653741),
(245, 52, 'Mimi Garza', 'https://www.google.com/maps/contrib/100046145515251454483/reviews', 'en', 'https://lh4.googleusercontent.com/-AL53_qOhIrg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3tka0wKdtn78ITbSSOaGjDmw-nxg/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '4 months ago', 'Started out a great dispensary, but soon enough, the good staff were gone, and they became greedy. Opposite of the others in town, so I\'m glad there\'s more options. WE MISS CARLOS!', 1515598529),
(246, 53, 'Trish Stedman', 'https://www.google.com/maps/contrib/108321832413470889949/reviews', 'en', 'https://lh6.googleusercontent.com/-u-KVm8fVkR8/AAAAAAAAAAI/AAAAAAAAfzc/47wmyM9OaTY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'The staff here is knowledgable and very polite. Selection is great and prices are some of the best in the valley. I\'d recommend finding the special for the type of product you want (use Leafly app) and go in on that day.', 1524096721),
(247, 53, 'Thomas Thomas', 'https://www.google.com/maps/contrib/115407942468059850430/reviews', 'en', 'https://lh5.googleusercontent.com/-zECtklGxUp8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq29aaXT1gts929tU1VgENwpmKEPQg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a week ago', 'I don\'t understand why this place was so uncrowded with such good bud!!! I\'ve been to places that are just packed thinking oh boy I\'m gonna get lucky here but nope. How bout this place tho with THC content around 30 when other places are selling low 20\'s AND if you\'re tired of getting the dried up b.s. they\'re trying to sell everywhere else check this place out.  They recommend Kosher Kush that\'s what I\'m smoking now and I\'d say they\'re right, this kush is kosher with me!!', 1526859255),
(248, 53, 'Audrianna Chavez', 'https://www.google.com/maps/contrib/102351789789323271236/reviews', 'en', 'https://lh3.googleusercontent.com/-SEAyekkoRWw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2aK4DT8kugthQ5wd7iAEFAfZVeAA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Awsome place great flower an there staff is fantastic.(:', 1526918999),
(249, 53, 'Toby Topel', 'https://www.google.com/maps/contrib/108144678490871795296/reviews', 'en', 'https://lh4.googleusercontent.com/-TzKcVM3xBiQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq11cpcNNv4sGX5T4JTpMLvNN3NoLg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '4 months ago', 'Nice place. Got some great Friday specials. I kinda like the fact that they weight it out in front of you.  \nPretty good quality as well.\n\nJeff Sessions should try this stuff, he\'d change his mind.', 1516017281),
(250, 53, 'AZ85080', 'https://www.google.com/maps/contrib/114989605517821974235/reviews', 'en', 'https://lh5.googleusercontent.com/-4En14jL0klA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq087-OZQy61MG-JcsfmVX5rGMbqew/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Unlike other places, ANR weighs out the product in front of u the actual weight is right on. Other places are pre-packed and the weights are off.. This is the best place in town!!', 1520464094),
(251, 54, 'PoloBoyzENT1', 'https://www.google.com/maps/contrib/106248327302064009762/reviews', 'en', 'https://lh5.googleusercontent.com/-PvGmij689uo/AAAAAAAAAAI/AAAAAAAAACM/5E5NJmeeUoM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Staff Always kind and super good vibes ,thanks for always being helpful and always giving me great recommendations.. Also AZ Nature\'s has so many different strain variations with multiple Earl Cup wins and  always providing clean medicine . Very clean concentrates for for all you wax heads out in the Valley.  If you haven\'t checked them out yet you better not sleep on this dispensary', 1527097868),
(252, 54, 'OG Guala', 'https://www.google.com/maps/contrib/104602714475994278329/reviews', 'en', 'https://lh4.googleusercontent.com/-qZ8ro8j6-8U/AAAAAAAAAAI/AAAAAAAABZ4/9cp02MAf-fY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Special Shout Out To Neko She is Always kind and super good vibes. She is amazing. thanks for always being helpful and always giving me great recommendations.. Also AZ Nature\'s has so many different strain variations as well as Phoenix Cannabis Co Home Base with multiple Earl Cup wins and  always providing clean medicine ever since day one. Very clean concentrates for for all you wax heads out in the Valley.  If you haven\'t checked them out yet you better not sleep on this dispensary definitely check out Phoenix Cannabis Co flower...', 1525478438),
(253, 54, 'Sheri Dearing', 'https://www.google.com/maps/contrib/104033032549599396820/reviews', 'en', 'https://lh3.googleusercontent.com/-3ruunau9Mfk/AAAAAAAAAAI/AAAAAAAAFt8/ea8EKk_HKgY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I must say that this was the largest dispensary I\'ve been to. They have the quickest and best service. I love the prices the most! I recommend all card holders to stop by for a visit.', 1527628595),
(254, 54, 'Crystal N', 'https://www.google.com/maps/contrib/115586445070157970581/reviews', 'en', 'https://lh3.googleusercontent.com/-zCiBNmOdioc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq02wj2iK15pSeuthNRu5RaU7WE7PQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'This place has a very relaxing atmosphere. Love coming here for the low prices. They have great meds and the staff if very knowledgeable and friendly . I will definitely keep coming back.', 1526437442),
(255, 54, 'Gus Soto', 'https://www.google.com/maps/contrib/106939574053475128212/reviews', 'en', 'https://lh6.googleusercontent.com/-yx0eYirMA_s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3lBwRh_1dmqJY2gQksWJrPHPY5zA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'This place is awesome and has great deals. The meds are reasonably priced and fire! Will always come to this location because it’s close to home and the people are very knowledgeable !', 1526340648),
(256, 55, 'danielle hernandez', 'https://www.google.com/maps/contrib/103013197803762918524/reviews', 'en', 'https://lh6.googleusercontent.com/-sQAtIep5Wpo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0vFn0FQKY7zNWrrfXVZIYRcmdaBA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'The third time I came to Swell I was help by Lilly. She was super patient while I struggled to make my decision on what edibles I wanted. She suggested a lemon cake which I tried and love! I was super happy with the price I paid for my 4 items.', 1527279542),
(257, 55, 'David Stone', 'https://www.google.com/maps/contrib/114816662357553752714/reviews', 'en', 'https://lh3.googleusercontent.com/-JmX8FESQkIY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3bTS7UVeZMjFCDordFoPuxUn3coA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Deceptive first time patient deal. Never been to any swell location and they will not honor boo 2 grams. Says anything in store and I was told only swell concentrates. They were out. I left and called the manager. She said I was right and they would honor it. Thing is they do it on purpose so how many people get screwed? Avoid at all costs and go to an honest dispensary that does not lie to its customers faces.', 1524328960),
(258, 55, 'Cole Walters', 'https://www.google.com/maps/contrib/102615539547250240263/reviews', 'en', 'https://lh5.googleusercontent.com/-XJD7xJ9ZM5s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1zoJJLD9fR6HGwBlNpgCcf7kIDKA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Swell has great products for great prices. They have great customer service too. I go here all the time and recommend them to everyone.', 1526846109),
(259, 55, 'Ayinda Williams', 'https://www.google.com/maps/contrib/113271132969418108828/reviews', 'en', 'https://lh4.googleusercontent.com/-myfFvwE1GtQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3eokFWqvZ4pMWrzkcusOUKqwHQpw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The staff are always looking out for me helping me stay in my budget while getting the best medication possible in my price range. And I love the convenience of the location.', 1527015547),
(260, 55, 'Tanner Wright', 'https://www.google.com/maps/contrib/111394971286586809230/reviews', 'en', 'https://lh4.googleusercontent.com/-C1O39ZH4VzE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3H26ISVkJKPpp0qgYTkAJwnTeJlQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great prices, and amazing bud. Can\'t beat this place, I have a few others that have fire flower but swell is the most consistent and their growers have found the secret to producing some quality flavor and concentrations.\n\nHad to come back for more love, great shop, great people and great products. 4/4/2018.', 1522867996),
(261, 56, 'TOC', 'https://www.google.com/maps/contrib/112963949905391288709/reviews', 'en', 'https://lh3.googleusercontent.com/-JC54KBuo5D8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3WkW3gOCz_Nd2qaLFGJ5MYwGPYMw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'I was dealing with cronic back pain and wanted a natural remedy.  I researched natural remedies and discovered cannabis is a natural pain reliever that does not hurt the body like oral medication can.  I contacted Cannabis Certification  Centers and they discussed the effects of medical marijuana and pain.  Randy was very helpful and knowledgeable and I was set up with an appointment and it all flowed so we\'ll.  The staff at the center were reassuring and made me feel comfortable with my decision.  I would highly recommend the Cannabis Certification Centers for certification of medical marijuana.  Dr. Dehenicke assured me this would be an effective treatment.   Ron and James reviewed my paperwork and answered all my questions.  Complete, thorough and professional thanks everyone for helping me through this I appreciate your assistance.', 1525548813),
(262, 56, 'Carson Marie', 'https://www.google.com/maps/contrib/118218149398353947131/reviews', 'en', 'https://lh4.googleusercontent.com/-J6f-IMrKsx8/AAAAAAAAAAI/AAAAAAAAAJY/3QIp5RIkbPA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'They walked me through the whole process. They have at least two doctors available to help with the process. They fill out and submit all the paperwork for you. They even helped explain the process of choosing a strain to try for my conditions. Highly recommend.', 1523995237),
(263, 56, 'Shannon Page', 'https://www.google.com/maps/contrib/101397575953602789537/reviews', 'en', 'https://lh3.googleusercontent.com/-NDPPJeFCmJw/AAAAAAAAAAI/AAAAAAAAERQ/NXTNifPGu8Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Wonderful staff! So friendly. Amazing team. There every step of the way with the process. Always asking if I had questions during every part of the process.', 1526430276),
(264, 56, 'Marla Blakslee', 'https://www.google.com/maps/contrib/103429776372173768412/reviews', 'en', 'https://lh5.googleusercontent.com/-WapfId9PotA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Wg46yLpYVSf_QbmRlaGYH5rhgMg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'This was the best renewal process I have ever been through! Very calm, relaxed but very professional. Very friendly staff and the Dr was through and helpful!', 1526153931),
(265, 56, 'Heather Gomes', 'https://www.google.com/maps/contrib/107845976531651204698/reviews', 'en', 'https://lh3.googleusercontent.com/-W77zg4Ry-2g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq26vZkmXf8NUz3j1F-apPGstERgeA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'They are friendly and sympathetic to veterans. They are extremely helpful and their office is clean and cozy. I will definitely return to renew my card and recommend this to fellow veterans.', 1525554683),
(266, 57, 'Bianca Peraza', 'https://www.google.com/maps/contrib/102710042559005675053/reviews', 'en', 'https://lh6.googleusercontent.com/-TIcr7XNekKo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0dUSfV6WaMUu4ah8B9KE-nExSpHw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'This place was most helpful. I spent $225 there, then they sent me to their own chiropractor which was another $50. So all in all I spent $275 for my card. Not bad mind you I had no medical records. But I went in 4/20/18 which was a Friday but I was missing a paper from home but they let me text a picture of my document but it was already after hours. So Monday my application was sent when they recieved my text completing my application. Got my email saying I was approved on 4/24/18 on a Tuesday. And  received my card on 4/30/18. Great service. Thank you.', 1525294172),
(267, 57, 'Sammi Fox', 'https://www.google.com/maps/contrib/112514207702351679757/reviews', 'en', 'https://lh6.googleusercontent.com/-v9stMxajo78/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0okuZwtZfcdt2Nu-EfN8rrWGubzg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'United MMC is very friendly and helpful. Office is clean and they run on time. Staff and doctors are very knowledgeable. Glad this is my choice for help with my medicinal needs.', 1525789712),
(268, 57, 'Rasheed Whitsett', 'https://www.google.com/maps/contrib/101940409904327580414/reviews', 'en', 'https://lh3.googleusercontent.com/-1iIFD8caXBg/AAAAAAAAAAI/AAAAAAAAABI/wAFXoMe5tTo/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'Please read all reviews  before you try to use this place my girlfriend has a history of seizures and they still can get her medical records. I don\'t think they even look for them.\nWhen I told them I had found a differnt doctor. one that actually looks for your medical records they refused to give me my money back. This place had a line of people trying to get a refund DO NOT WASTE YOUR MONEY SCAM.', 1517613514),
(269, 57, 'jennifer gleason', 'https://www.google.com/maps/contrib/112784252267664096758/reviews', 'en', 'https://lh4.googleusercontent.com/-q2_xQCSwM7Q/AAAAAAAAAAI/AAAAAAAAADQ/pv_RCmIYJsQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Absolutely LOVE the people in United MMC. The way they run business is fabulous and always have you in mind. It\'s definitely a little travel to see these guys, but it\'s definitely so worth it. :)\nTHANK YOU UNITED MMC. ', 1507749247),
(270, 57, 'Dre LaRoche', 'https://www.google.com/maps/contrib/106768526956194104382/reviews', 'en', 'https://lh5.googleusercontent.com/-pDsGicvFpCk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1XnyOhIu_fynSr0c9PuwFj_k1g4Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Every time I go here it\'s always super fast and easy and they answer any questions I have without making me feel like a burden! I love how friendly and welcoming the staff is!', 1509484552),
(271, 58, 'SidheTendencies', 'https://www.google.com/maps/contrib/114367387173438756181/reviews', 'en', 'https://lh4.googleusercontent.com/-BkUlRrmRMaM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3pflvOjuE_UzIrkzoc59ffEKpgGw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'As a dispensary rep, I came by this location to drop off some first time fliers and educational material. The receptionist was short, kept interrupting me, and said the doctor would just throw it in the trash. I actually deliver fliers to their other locations, which they all happily accept. I would recommend a different location', 1522193873),
(272, 58, 'Alex Walker', 'https://www.google.com/maps/contrib/101917344654919314328/reviews', 'en', 'https://lh5.googleusercontent.com/-tzEswcCaWeQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1STaDEox4KwDIwN3qb8ZMkqmK6ug/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'I went here a few weeks ago, I am not one to write reviews. But I agree with Trevor. This is not a good place. I do not recommend them.  I ended up going elsewhere too.', 1519951095),
(273, 58, 'D Joyce', 'https://www.google.com/maps/contrib/107040759450635885485/reviews', 'en', 'https://lh3.googleusercontent.com/-aL5rodQDB0w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0LZKP73VVbSRVTo_djQf5QoTz1ow/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Your lack of professionalism and not being discreet let alone ability to know some reviewers change names when posting is reason this NOT A CUSTOMER / PATIENT with knowledge of HIPAA will NEVER come see you. Learn to be more customer concentric even if suspect a bogus poster.\nGood luck staying... reputable, trust worthy and most of all compassionate. DON\'T ASK ME TO REMOVE I\'M AMERICAN FREEDOM OF EXPRESSION IS MY RIGHT !\nExample patient Hashley Dabz that\'s not a real name yet you praised her giving you good review. The more I read the more I want Re edit or charge you consultation fees on how to address negative or positive feedback. MJ Sanchez ...yet you called them Lisa...lack of discretion or you had someone bogus review? I\'m done I may not even visit any office ran by this ownership what is wrong with you?!', 1524709151),
(274, 58, 'Trevor Gain', 'https://www.google.com/maps/contrib/101140163303484040769/reviews', 'en', 'https://lh6.googleusercontent.com/-qMZiMOarJ7Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1h4RBeG8J6I_nAQAG8hTq9eFJbZQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'This place is bad.. very bad. I do not recommend them. The doctor was having me to all these bends and moves while she kept telling me she didn\'t know what she was doing. Then she would look in a book and continue telling how to stretch my legs and back. She repeated herself over and over saying she was \"new at this.\" The doctor then told me before she could submit my application, to go have x-rays done. She sent me to another place. I paid 50 dollars there. Then she called the next day, and told me to go to another place for more x-rays, and it would be 100.00 then she could submit my application..... DON\'T GO HERE. They never submitted my application, so I was out the money.  I ended up going to MMJ in Scottsdale  a day later. I recommend MMJ located on Thomas road. They were great, speedy and got my card.', 1519950903),
(275, 58, 'Larie Walls', 'https://www.google.com/maps/contrib/105735372700282082447/reviews', 'en', 'https://lh3.googleusercontent.com/-9XwSPBSBTLg/AAAAAAAAAAI/AAAAAAAABOA/GaY7uWAmdTc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'This is my 3rd year so I was in for re-certification.  I couldn\'t be happier to find a location that is much closer to mine and one that offers other services that may benefit my overall health.  I would highly recommend a visit to this office for anyone interested in a more natural type of heath care.', 1486587137),
(276, 59, 'Tyler Would', 'https://www.google.com/maps/contrib/105562120991869939976/reviews', 'en', 'https://lh5.googleusercontent.com/-NblwNCQimVQ/AAAAAAAAAAI/AAAAAAAAAug/fg4ecbd5Y80/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '3 weeks ago', 'Receptionist here is so rude! I think her name is Vanessa. She really needs to work on her customer service! I felt like walking out several times because of her attitude but only reason I stayed is because Kara was nice.  They also take soo long!', 1525728094),
(277, 59, 'Bob Jaegers', 'https://www.google.com/maps/contrib/104878422561565409925/reviews', 'en', 'https://lh3.googleusercontent.com/-MP6eOQWAb0g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq39_8jh7fCkGDxX1Wq6g161FPrKxw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Recently went for the first time to this office. Took my medical records with me which made approval easy as I avoided much of the doctor interview.', 1520916546),
(278, 59, 'Mac l', 'https://www.google.com/maps/contrib/111611027050091791120/reviews', 'en', 'https://lh6.googleusercontent.com/-rYo2tZeF3Ls/AAAAAAAAAAI/AAAAAAAAACY/_e46mZwgGi4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '6 months ago', 'I was able to get my card for $175 out the door. I got lucky since secretary told me when I called the day before what info I had would suffice as medical recorde so I got discounted the $50. Also ask about returning patient special at harvest, take a picture of the poster in the lobby because Harvest did honor it they just didn\'t act like they knew what I was talking about. I got the buy a half gram concentrate get a half gram free.', 1510889321),
(279, 59, 'james canez', 'https://www.google.com/maps/contrib/112904873162374609747/reviews', 'en', 'https://lh5.googleusercontent.com/-mL8oOtVf4ms/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0vFwFbbxIf6pb966_-LkPXM7aU3Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'Make sure Dr. Kathryn Cameron is not working the day you go in. She was the most disrespectful doctor i have ever been too. She was rude and didn\'t even want to listen to how I use marijuana and just wanted me to tell her the 4 things to get out of the office and told me to quit talking and made rude comments as i left. I was in disbelief. This was the 3rd time i have been at this office and the 1st two were great. But don\'t expect me to go back.Probably why 4-5 stars are from over a year ago.', 1516313570),
(280, 59, 'Dan Martinez', 'https://www.google.com/maps/contrib/105808002503376450272/reviews', 'en', 'https://lh3.googleusercontent.com/-OhD1ki9Ktfo/AAAAAAAAAAI/AAAAAAAADgc/JdU1Q8W1tcI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'They were wonderful,  quick and thorough. I\'ll definitely be using them next year', 1507990419),
(281, 60, 'Arturo Delgado', 'https://www.google.com/maps/contrib/109661591137996974819/reviews', 'en', 'https://lh6.googleusercontent.com/-yPvgv0O0IuY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1nGpQ-AIY7UXSsSO1S1YPLmXm8qQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'Dr reeferalz was the cheapest n easiest choice hands down got some free gifts and referred to a place to go to before my card comes in. Will be coming back for my renewal price match is awesome paid 240 6 days ago. Does anyone know the delivery service I could use before my card comes tho ? Lol', 1525214039),
(282, 60, 'Parker Smith', 'https://www.google.com/maps/contrib/116370576277708666531/reviews', 'en', 'https://lh3.googleusercontent.com/-3xIbhzdWtUk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Rqmlm5Yl2DToqRFDV-DgtjmEHrg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Friendly staff. Clean Facility. Made an appointment and took maybe half an hour. definitely coming back for my renewal', 1524598839),
(283, 60, 'christina stathopoulos', 'https://www.google.com/maps/contrib/108678905635223532065/reviews', 'en', 'https://lh4.googleusercontent.com/-f8KeQw66Pdc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1O9AZro4YYd0R1izMdKesyrjSzzQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'There the best. Super friendly helpful staff and the place is way chill. Always playing some funny stoner movie and nice comfy chairs while you wait.', 1520473667),
(284, 60, 'jeremy tamayo', 'https://www.google.com/maps/contrib/115067411143203579918/reviews', 'en', 'https://lh3.googleusercontent.com/-vANwWyJLIT4/AAAAAAAAAAI/AAAAAAAAAsw/eHWouk_NwE8/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'Set an appointment. Do it in the morning you\'ll be in and out. The ladies up front are always helpful and very nice and I\'ve had I\'ll come here a few times I\'ve had a few different doctors look at me and they\'re they\'re pretty nice and they seem pretty professional I recommend this place to a lot of people but once again set an appointment or you will be waiting for a while', 1522258653),
(285, 60, 'Trevor Berrington', 'https://www.google.com/maps/contrib/103984896043792800408/reviews', 'en', 'https://lh5.googleusercontent.com/-OIbCOH97k34/AAAAAAAAAAI/AAAAAAABefM/nxV-jGfXXm4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'Friendly staff and speedy service thanks for everything guys I would recommend them to anyone', 1522544091);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(286, 61, 'Jon Garcia', 'https://www.google.com/maps/contrib/111893336550738337640/reviews', 'en', 'https://lh6.googleusercontent.com/-B_pXd_u0A1U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3nB_DZ5ddWOaCU5n9zwPi2E8vKfw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Seems like a place I should go and try and get my card from I know I have all the pains and problems for it only thing is I don\'t have of my records I hope that will not be a problem and stop them for letting me get it or having to go through all kinda extra stuff... Will go and give this a try and pray and hope for the best!!! If I get my card I will definitely do a follow-up review letting everyone know if not haveing your records will cost you more time and so on!!!! I\'ll be praying for the best for my self so I can be free and not have to worry about nothing anymore !!!', 1519528851),
(287, 61, 'Send Satellite', 'https://www.google.com/maps/contrib/100759955242729717955/reviews', 'en', 'https://lh3.googleusercontent.com/-4JrwxT4415I/AAAAAAAAAAI/AAAAAAAAOR4/Pb2rjbn87tU/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '6 months ago', 'very nice establishment, easy to work with. i am excited to live without pain. thank you!', 1511995937),
(288, 61, 'Justin M', 'https://www.google.com/maps/contrib/107587097589625764225/reviews', 'en', 'https://lh3.googleusercontent.com/-fBW97UOnvEg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1UDn0ALFNom9WK_nbmeCF-w1G2WQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Super helpful place. I can\'t recommend it more.', 1507781305),
(289, 61, 'Diane Shook', 'https://www.google.com/maps/contrib/109460723198961392840/reviews', 'en', 'https://lh3.googleusercontent.com/-gcmLCFyBSEU/AAAAAAAAAAI/AAAAAAAAIkQ/zl0EqOXoZX4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Simple and fast; very easy instructions/paperwork; entire process including followup emails from the State was exactly as they stated it would be.', 1493745585),
(290, 61, 'Justin Paup', 'https://www.google.com/maps/contrib/107876796326261860210/reviews', 'en', 'https://lh3.googleusercontent.com/-H3GGhHiEGyc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0kwpLd3xIBWyDHyapuZ7g9CIOkTQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'Quick n easy', 1522330382),
(291, 62, 'Holly McCord', 'https://www.google.com/maps/contrib/112644164163132193989/reviews', 'en', 'https://lh4.googleusercontent.com/-F9iJaMERUJY/AAAAAAAAAAI/AAAAAAAAJ28/NYEOlXxD7wQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'Kind and caring individuals who respected privacy. They got me an appointment promptly and were very helpful!', 1506108436),
(292, 62, 'Theresa Perry', 'https://www.google.com/maps/contrib/111362693977904593409/reviews', 'en', 'https://lh6.googleusercontent.com/-LyYNIawl85s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0SIGcRtUb7kXT5g06AANuf4j2QNg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Good experience. Everything went well.', 1520300157),
(293, 62, 'Jonathan Lenninger', 'https://www.google.com/maps/contrib/116268474227192465445/reviews', 'en', 'https://lh3.googleusercontent.com/-cJLUD--kHEM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2vyjzob4cg1BAgOlMyRsyWov-srQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'Horrible place. Showed up to the chiropractic center for my appointment. They notified me that the doctor was out sick and that I\'d have to reschedule. Understandable, except they could have called me to reschedule his known appointments and save me the 3 hours of drive time. Thanks a lot. Customer service gals were clueless, very u professional, and didn\'t even have a list of his appointments. I would not recommend this place to anyone. Lay off the pot!', 1489176645),
(294, 62, 'stan an sam chaffin', 'https://www.google.com/maps/contrib/117513490572880941653/reviews', 'en', 'https://lh4.googleusercontent.com/-b8km2FtsYrI/AAAAAAAAAAI/AAAAAAAAAG4/q_SSkEqGBMw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '11 months ago', 'Very disappointed.. I took my father (age 77)to get his card renewed .. the doctor was very ill with a bad virus.. instead of canceling he saw us an gave us both the virus.. my dad has been down ill for a week an a half an I have been down for a week.. I feel it was very unprofessional of the doctor.. you go there to feel better not to get sick...we will not be back', 1496802505),
(295, 62, 'Alicia Kearney', 'https://www.google.com/maps/contrib/111903082765088035805/reviews', 'en', 'https://lh5.googleusercontent.com/-ayGO-suUazU/AAAAAAAAAAI/AAAAAAAAAB0/-V23yNXC75w/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '9 months ago', 'My husband got his card renewed here last year without a problem but this year we went down there and signed permission to get his medical records and so far have not gotten any call back that they have received or not received those. It\'s been weeks, so I left a msg on their answering machine, never got a call back. I guess today I will go down there and see what in heck is going on. My husband\'s card is expired now, I was trying to get all this done before that happened.', 1504025693),
(296, 63, 'Cynthia Bishop', 'https://www.google.com/maps/contrib/115722353710060712466/reviews', 'en', 'https://lh5.googleusercontent.com/-6ir8OUL_VWQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1uCivuO18h2-Hf9Q-gMaB0Y8X03w/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Their ad in Tucson Weekly states: “lowest price in the valley guaranteed!” But when I called them, they were actually the most expensive — and they would not price match, unlike 2 other places I called. They won’t get my business.', 1526517857),
(297, 63, 'Victor Mikulin', 'https://www.google.com/maps/contrib/118188895867528284839/reviews', 'en', 'https://lh4.googleusercontent.com/-jNJ0vhgYbdI/AAAAAAAAAAI/AAAAAAAAARE/JQucDptL6MY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I cannot say anything but AMAZING! As a veteran all I did was bring them my conditions list and I had an appointment the next day. The process was nerve racking at first but when I realized the staff and even the doctor we\'re calm and assurant, I knew I went to the right place. Definitely going by Dr. Reeferalz for my renewal!', 1520361745),
(298, 63, 'Zachary Anderson', 'https://www.google.com/maps/contrib/117998753769312047009/reviews', 'en', 'https://lh5.googleusercontent.com/-usZUfPCnwTY/AAAAAAAAAAI/AAAAAAAACb0/5qmmayCmw2I/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 3, '2 months ago', 'Even with an appointment you can wait a while so make sure you can be there all day, otherwise fine', 1520722997),
(299, 63, 'Chris F', 'https://www.google.com/maps/contrib/116570975073385516175/reviews', 'en', 'https://lh4.googleusercontent.com/-Qf0MQBtEz7U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2U60Uv-6CQNvGjeFwbOsshY7RyLw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '12 months ago', 'From start to finish my experience was perfect, wouldn\'t change a thing and the wait... It is worth it as these people wonderful. \n\nThe reception was pleasant, paperwork will take you 10 minutes or so but well explained. Comfortable chairs, the tv had a good movie on and there are complementary drinks and snacks. Yea, I was pretty comfortable and I have hesitated to do this for a long time.\n\nThe doctor was icing on the cake, true professional, and one of those people you can just talk to. This is much more than a place to get evaluated for a card. The product information and how to use the product without the THC portion of MM was all news to me and so helpful for my situation. He explained usage and application suggestions such as topical creams. Very informative for me and I have used this solution for my pain for years but knew very little about all the advances and options. I was approved and have an excellent plan. With over 40 major surgeries in my life this real to me and I was very impressed.\n\nDon\'t hesitate to make an appointment these folks deserve your business.', 1496460344),
(300, 63, 'Lord Memerson', 'https://www.google.com/maps/contrib/109674098572791672571/reviews', 'en', 'https://lh4.googleusercontent.com/-P_Er2yx2viA/AAAAAAAAAAI/AAAAAAAADtY/gnczsFHyguw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '6 months ago', 'Highly recommended! Very comfortable lobby and calming atmosphere. The staff and Doctor were amazing!', 1510929905),
(301, 64, 'thegof09', 'https://www.google.com/maps/contrib/109392000673802964224/reviews', 'en', 'https://lh3.googleusercontent.com/-DDv70Kbmsn8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1fBNX7rgsCpsD_F6FN7Qvh3ERfBQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'I called this office because I had a few reasonable questions about getting a medical marijuana card. I have trouble sleeping, chronic pain in my shoulders and diagnosed anxiety. The woman on the phone was rude and seemed irritated that she had to be speaking to me. I ended up just hanging up. I thought this whole medical marijuana thing was supposed to be inviting for people who have tried traditional medicine, but it’s clearly not. I’ll just find somewhere else to go.', 1524941072),
(302, 64, 'Rum Ham', 'https://www.google.com/maps/contrib/111472741010899220498/reviews', 'en', 'https://lh5.googleusercontent.com/-hQ_t0jmyy5A/AAAAAAAAAAI/AAAAAAAAANY/cQdPhG_cACI/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 months ago', 'Short wait time, helpful staff, great examiner, was in and out within an hour and a half. They had T.V.s playing and free snacks so the tine went by quickly. Slightly pricey at 325 but well worth the cost.', 1517393368),
(303, 64, 'Nicholas Johnson', 'https://www.google.com/maps/contrib/101173764267491625026/reviews', 'en', 'https://lh3.googleusercontent.com/-EQMFJDOsSkU/AAAAAAAAAAI/AAAAAAAAATU/g3mzzBOo5y0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, '2 months ago', 'Waited an hour and was never seen. They told me a walk-in would only take 30-45 minutes. I also witnessed two people walk-in and convince the front desk to see them sooner. \n\nTotally upset, I asked the receptionist how long until I could be seen and she said “there are still a few customers in front of you and it’ll be at least 30-45 more minutes”. I left having wasted an hour of my life that I will not get back completely let down. \n\nSave your time. Go anywhere else.', 1521749577),
(304, 64, 'Alex Blain', 'https://www.google.com/maps/contrib/110266279989712832252/reviews', 'en', 'https://lh3.googleusercontent.com/-GdiADe70I14/AAAAAAAAAAI/AAAAAAAAB4I/9sMduCktjcQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Had an appointment. Was in and out within 45 minutes. \n\nNo issues.', 1521066704),
(305, 64, 'Kandace Totman', 'https://www.google.com/maps/contrib/117724295864556525601/reviews', 'en', 'https://lh5.googleusercontent.com/-Wkk-3PlnN0Y/AAAAAAAAAAI/AAAAAAAAAis/0LgOQ1aKpLM/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '5 months ago', 'Business hours stated that they open at 9AM. My appointment was scheduled at 9:30AM. \nWaited until 9:45AM and they still were not open, and declined my calls when I tried to get ahold of them. Drove an hour out here for nothing, what a waste of gas.\n\nEdit: Y’all reedemed yourselves. I appreciate the quick service once I came back.', 1512485196),
(306, 65, 'Michelle Laba', 'https://www.google.com/maps/contrib/112611289744549264467/reviews', 'en', 'https://lh4.googleusercontent.com/-T0k16KTxg7o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1F72dk7D94qEVMyDcJyu2JeOmXgA/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 weeks ago', 'I will write a full review shortly when I get my card but I also agree with John about the pricing not being transparent on the site and thought the cost of the office visit was high to just come in fill out two forms and Answr some questions.', 1526099409),
(307, 65, 'Defango', 'https://www.google.com/maps/contrib/113724260984311019752/reviews', 'en', 'https://lh6.googleusercontent.com/-tZX6f_2WiBc/AAAAAAAAAAI/AAAAAAABKzI/8NKUmDls5dU/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '9 months ago', 'They had some really nice offices and I didn\'t even have to wait at all. It was a pleasant experience and I liked how we where able to get things done quickly without much fuzz. Everyone was really nice and professional about the whole thing and I was happy to get my card renewed.', 1502744165),
(308, 65, 'John Thomas', 'https://www.google.com/maps/contrib/106191316638118204583/reviews', 'en', 'https://lh4.googleusercontent.com/-MCRNlwoqxpU/AAAAAAAAAAI/AAAAAAAATow/q6rpr0AzXdw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, 'a year ago', 'Quick and friendly! Got my card in 3 days! Would have been 5 stars if cost was more transparent and price matched as advertised on your site. Little to pricey. ', 1466546759),
(309, 66, 'Sydnee York', 'https://www.google.com/maps/contrib/103113133029278340415/reviews', 'en', 'https://lh5.googleusercontent.com/-y99MjnzLyN4/AAAAAAAAAAI/AAAAAAAAD74/w8AmZySJobI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I had an amazing experience with the doctor here. She was quick and did a wonderful examination. I also got to do acupuncture with her and see her work in action! Definitely would recommend her and I will be back for her again!!', 1523050969),
(310, 66, 'Jill Kassel', 'https://www.google.com/maps/contrib/107872346883241681065/reviews', 'en', 'https://lh4.googleusercontent.com/-GODnfNOPolw/AAAAAAAAAAI/AAAAAAAAAAA/Cgtd_o6_wlw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'The location of the office was convenient. The office environment was calm and private, which made me more comfortable to see a doctor for my card here. The doctor was friendly and knowledgeable and answered all questions I had. I certainly recommend this practice!', 1521237885),
(311, 66, 'Sarah Williams', 'https://www.google.com/maps/contrib/108258350107264340005/reviews', 'en', 'https://lh6.googleusercontent.com/-gXc7fZYSPYU/AAAAAAAAAAI/AAAAAAAAAB0/C1NKwj66ids/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'This office definitely deserves five stars. I have been to one other previous office to obtain my medical card, and even comparing the two, this office in specific is my new preference and highly recommended to any individual seeking to obtain their medical card. The service is very kind and efficient, the atmosphere is clean and inviting, and the overall care provided is very satisfying.', 1517356444),
(312, 66, 'Mark Stacey', 'https://www.google.com/maps/contrib/104898006014487551564/reviews', 'en', 'https://lh5.googleusercontent.com/-IUPHlzriW8M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0VRzvs2dDUnU8tBHyoqX1n9QeqgA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Great experience! Location is perfect with a very private lobby. The clinic specializes in different pain management options and not just medical marijuana certification. Extremely friendly and knowledgeable in all facets of naturopath treatments. Highly recommended!!', 1516752429),
(313, 66, 'Buster Bennett', 'https://www.google.com/maps/contrib/114208124472115864773/reviews', 'en', 'https://lh6.googleusercontent.com/-dfawdCI2jYY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq15senymRYlx8xZrlb7mDdjktewRQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Fantastic! Very private and beautiful office. Quiet setting and informative experience. Could not have asked for a kinder physician and I felt that I was in the best hands. Thank you.', 1518648001),
(314, 68, 'Psycho Bunny', 'https://www.google.com/maps/contrib/113383482520239979644/reviews', 'en', 'https://lh4.googleusercontent.com/-OpzrxEXr8l4/AAAAAAAAAAI/AAAAAAAAOQk/aY2En_iCs9U/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '2 months ago', 'I had a very pleasant experience at this Clinic. I brought my paperwork from my doctor\'s office so things moved a little bit quicker. My doctor here was Jennifer Hawks, she was 100% professional she was very personal with me she answered all of my questions she help me understand things better, and things to better my health, which I was pleasantly surprised by. The entire thing only took an hour I paid with cash so I only paid $275 but if you pay with a card I believe it\'s $285. You get your card in the mail about 5 to 10 business days. It\'s simple it\'s easy and they make your experience very pleasant and easy for you to understand. They also have a cool coupon deal that if you refer 4 people you get a fee waived of $125 on your next year licence.', 1520123670),
(315, 68, 'Thomas Thomas', 'https://www.google.com/maps/contrib/115407942468059850430/reviews', 'en', 'https://lh5.googleusercontent.com/-zECtklGxUp8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq29aaXT1gts929tU1VgENwpmKEPQg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '4 months ago', 'Just walked in and got it all over with in less than an hour it cost $330 with a credit card they take care of everything right there and your legal to smoke or possess  when you walk out the door you just have to wait for your card to buy it. Staff were all great even the doctors! I got my card for knee pain.', 1516660754),
(316, 68, 'John Holling', 'https://www.google.com/maps/contrib/106534590021393670756/reviews', 'en', 'https://lh5.googleusercontent.com/-xEcx1IhBLeI/AAAAAAAAAAI/AAAAAAAAULI/FEGbNG5d5wM/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 weeks ago', 'Always pleasant, professional, and efficient. Best place to get your mmj certification.', 1525545934),
(317, 68, 'Brad', 'https://www.google.com/maps/contrib/107432565803942220308/reviews', 'en', 'https://lh6.googleusercontent.com/-mmXFOi0enGo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ReKD_53fE7rYWmy4NzJouxLfjPg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '5 months ago', 'Called multiple times over the course of several days after my medical records faxed over but kept getting told I would get a callback...  I NEVER RECEIVED A CALL BACK!   Green Star got me in next day on the first phone call.  I\'d recommend them over this place any day!!!', 1514400511),
(318, 68, 'Lynz Marie', 'https://www.google.com/maps/contrib/110744234101059285557/reviews', 'en', 'https://lh5.googleusercontent.com/-WOMYv2jqvTo/AAAAAAAAAAI/AAAAAAAAV_s/k8Jkz6ZLCIU/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Excellent Experience!! So satisfied ', 1521355102),
(319, 69, 'Des Tsosie', 'https://www.google.com/maps/contrib/102648992306616138043/reviews', 'en', 'https://lh4.googleusercontent.com/-PZK8Nqx9whE/AAAAAAAAAAI/AAAAAAAADy4/qgyo4ajMzjU/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', '0 stars, the lady rushed me in & out of this place.... 3 weeks later I\'m waiting for my card, I go to call & find out she put the wrong address on it. Next time I know to go elsewhere, where ppl actually pay attention\nAfter this review was made I received a call from the facility making it seem like I\'m wrong for rating them with 1 star. At the end of the day, no one came at you with foul language, admit my address was entered incorrectly and move on. I am able to review the company and my experience with you. I hung up because I\'m guessing, You, would not let me speak. Now I\'m being reviewed on my own review. Lol. The situation was corrected when I called twice before this reply was made. Thank you.', 1522273417),
(320, 69, 'ashley hanawalt', 'https://www.google.com/maps/contrib/115512473126740559768/reviews', 'en', 'https://lh5.googleusercontent.com/-qTl7GUJfwI0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2xPkNZhRs-Ub9r45-idBQpAEVMlw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Wonderful experience  with Dr. Riabikina. The atmosphere is VERY inviting. The receptionists are always very helpful and informative. The Dr. Is very professional and easy to talk to. Super friendly too. Gives alternatives  rather then pushing meds like regular medical drs that just push pills. Recommend to other military veterans  who want other treatment then what they give you at the VA which is mainly just pills.', 1522956776),
(321, 69, 'Marissa Mendoza', 'https://www.google.com/maps/contrib/117356576812115075591/reviews', 'en', 'https://lh4.googleusercontent.com/-Fk5ca4PW2R0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0hEY3gyFO_DFB-1qDHSOw0EcGAfw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I\'m a day late, but I just wanted to stop by and give the Clinic and the Service five stars!! The team was very helpful and I was in and out of there within a hour.  I recommend going here to anyone who\'s looking into getting their med card.', 1518198098),
(322, 69, 'cnore richmond', 'https://www.google.com/maps/contrib/112124983215869442022/reviews', 'en', 'https://lh5.googleusercontent.com/-JmaJU5rY5Yk/AAAAAAAAAAI/AAAAAAAABSA/cvG-zLEXd1w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I had a great experience with them. Very friendly and professional. Was a quick turn around as well. Would recommend them to anyone looking for a medical card review', 1515526626),
(323, 69, 'deanna defeo', 'https://www.google.com/maps/contrib/117692152363672781091/reviews', 'en', 'https://lh6.googleusercontent.com/-GtOmGDFy_OM/AAAAAAAAAAI/AAAAAAAAAEw/hIcoxOtjaMU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'This place is great I\'ve been here twice now and both times have been wonderful.', 1517267800),
(324, 70, 'Sarah Hall', 'https://www.google.com/maps/contrib/114413924859552720918/reviews', 'en', 'https://lh5.googleusercontent.com/-rFW_npstS0A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Zrn0zzIBa8PlZTGhnOHEazI4JRg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Great couple /team, they were very kind and more importantly the most affordable place to go to in the valley. I highly recommend them just like my sister did. It\'s been a year since I wrote this and I have decided to update it. This still remains the most affordable place to get or renew your card I just went and took my sister to get her renewal and as always had a great experience with the kind professional helpful and happy couple. They really care about their patients. You would be wasting your time and going to another office', 1517107614),
(325, 70, 'Susie SweetZ', 'https://www.google.com/maps/contrib/114033185141014413421/reviews', 'en', 'https://lh5.googleusercontent.com/-ltDmT6Shb4Q/AAAAAAAAAAI/AAAAAAAAAOY/KvRYjRcTwYE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Second time patient with this great family! Their informortive and fast! I love that they have helping hands and their new office is beautiful! Looking forward to renewing with them yearly! Thank you for good service! \n\nSuzette', 1522790208),
(326, 70, 'A', 'https://www.google.com/maps/contrib/115080017704299166566/reviews', 'en', 'https://lh6.googleusercontent.com/-oQXfaJ20yhA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0PCH_WYgRgLqNZZqzJ43LMxug1ag/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'This is my 3rd time renewing my card and my first experience at this facility. I was nervous to change locations, this place has put me at ease. Very laid back. Decided to come to this facility based on all the positive ratings. This place is the lowest price I have found. Very friendly and courteous. The doctors really are concerned for your well being. Will be back next year! ', 1513465588),
(327, 70, 'david wallace', 'https://www.google.com/maps/contrib/109527018032182831959/reviews', 'en', 'https://lh4.googleusercontent.com/-nhlLCkhFLvw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq18Io3Yen2kWZN05CyOWpRKhSer7Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Had Great experience both Dr\'s are caring and very knowledgeable. Even had couple my friends certifie there plan on renewing next month....', 1526554121),
(328, 70, 'Calbha Vaughn', 'https://www.google.com/maps/contrib/100102746813093017101/reviews', 'en', 'https://lh3.googleusercontent.com/-4zVh0e-3PoQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1l52OTLcZUvN7FIug_ayuLErLGdw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'in the last week', 'Cheapest place I\'ve found for medical cards. Super friendly staff. will keep coming back.', 1527624461),
(329, 71, 'Drew Rodriguez', 'https://www.google.com/maps/contrib/104744174433969741416/reviews', 'en', 'https://lh5.googleusercontent.com/-QFeTGJ1hqoU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0zaIdTTdcnjt8_cjQ48TBXRAJ-Dw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Everyone is here is awesome, from the front desk to the doctor. I felt very welcome, i been coming here for the past 2 years and i will continue too. They offer helpful advice along with awsome customer care. i’d recommend anyone to this establishment, they go above and beyond.', 1527288767),
(330, 71, 'Lauren Payne', 'https://www.google.com/maps/contrib/109133495453572397107/reviews', 'en', 'https://lh5.googleusercontent.com/-Cvj2TqJXLp8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1JE7svq3WHWRj7Wd3fmJBLPzjn9A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'There are much better places to go. Looking at the reviews I see others have had similar experiences. I came here last year and it was ok. They called me to schedule my renewal and told me $255. I agreed and scheduled out about a month to today. Tuesday they called to confirm, I confirmed appt and price, again $255. We confirmed yesterday for again $255. Today when I go in it is now $315, I explain what has been confirmed and they refused to match the price they quoted to me multiple times. I declined and left with a new times and have scheduled elsewhere for a flat $250 including seeing the Dr, the $150 state fee, the office visit and them uploading. Look elsewhere, they nickel and dime you here and the customer service isn’t good.', 1524944577),
(331, 71, 'Jason Litow', 'https://www.google.com/maps/contrib/106642975050763561433/reviews', 'en', 'https://lh4.googleusercontent.com/-LY6SdRKP59s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Rq1zmOj-Klh4QHF4poSy3u3hjSw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Best MMJ Patient clinic in state. Staff and Dr. are great. They make the process very easy.', 1526678296),
(332, 71, 'Chenise Quiroz', 'https://www.google.com/maps/contrib/103576861204391390583/reviews', 'en', 'https://lh6.googleusercontent.com/-_WqLmPhH2Io/AAAAAAAAAAI/AAAAAAAAU7A/RbBmHtPivx0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'My experience at this office was wonderful! From the moment I walked in I was happily greeted and felt very comfortable. I was taken back to see the doctor immediately and on time.  The doctor was very thorough with me. She took her time to explain everything and made me feel very well taken care of. The doctor gave me new information that was specific to my needs.  I left the office feeling very happy with the whole experience! I will continue to go here and recommend everyone to schedule an appointment here.', 1507215729),
(333, 71, 'Laura Plourde', 'https://www.google.com/maps/contrib/112660902905564120675/reviews', 'en', 'https://lh6.googleusercontent.com/-szxBx4HHzqY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2YhUh8TppnK27IzusqtjAEGaCYKg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'CPEC is great! Staff is friendly and efficient. They offer various discounts and can often get you in same day. :)', 1507069703),
(334, 72, 'Erin French', 'https://www.google.com/maps/contrib/115439354799287270508/reviews', 'en', 'https://lh5.googleusercontent.com/-Mg7vwHtUG2U/AAAAAAAAAAI/AAAAAAAAAFk/ZcwB_hRQlSk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Dr. Mabry is down-to-earth and takes the time to answer all of your questions. And he saved us over $100 on medical mari cert for my husband ‘s Parkinson’s. We tell everyone that needs their cert to see Dr Mabry. He’s the best.', 1521648386),
(335, 72, 'Chris Ruesink', 'https://www.google.com/maps/contrib/103998495383334678195/reviews', 'en', 'https://lh4.googleusercontent.com/-F8RjympPz-A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Sz-jaK_XYOZ05vfkITkElXKaxDg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This dr is one of a kind.  Not only courteous but actually listens.  You can be honest with him without him judging. A+!', 1523058394),
(336, 72, 'Chris Miles', 'https://www.google.com/maps/contrib/116509840476036247161/reviews', 'en', 'https://lh6.googleusercontent.com/-sKhm94HnKDQ/AAAAAAAAAAI/AAAAAAAAALQ/ZCNFbX3NswU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Best dr I’ve had in awhile.  He listens and really talks things over with you.  I would recommend to anyone.  Finally a dr with an open mind!', 1523058277),
(337, 72, 'Elsa Martinez', 'https://www.google.com/maps/contrib/107275663333361077422/reviews', 'en', 'https://lh3.googleusercontent.com/-QPaOL_uuRIE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3rS5PP3O-1r2TbYmRCuxG8zmoEvw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'i love how thorough the doctor was! me and my sister decided to go back phentermine to kick start our weight loss goal and the other clinics we went to before were always so quick to get you in and out the door without explaining everything and trying to get to know you and get a good idea of your weight loss goals and how to best get to that goal! they also have this scale that is amazing because it doesn\'t just take your weight but it tells you actual percentage of fat and muscle mass and it gives you a better sense of exactly what you need to do to get in shape! i highly recommend this clinic to anyone that wants to start a weight loss journey and one with detailed instructions and personal data to help you reach your goals the doctor listened and helped better explain what all me and my sister need to do to get into better shape! never have had this great of an experience with a weight loss clinic ever hands down the best and the price was cheaper than any other place ins NWA!', 1499100066),
(338, 73, 'Heather Harris', 'https://www.google.com/maps/contrib/104129886690780176510/reviews', 'en', 'https://lh4.googleusercontent.com/-_uaKUjqxmmQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq10vUQAbQFpyy4xWUdFgiHaYw595w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'They are extremely helpful and friendly . The appointment is fast but they answer every question you might have.  Thank you guys so much!', 1521429202),
