(343, 74, 'J Mcsorley', 'https://www.google.com/maps/contrib/105597760836632524531/reviews', 'en', 'https://lh5.googleusercontent.com/-YRVHZv4tIUg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3gRQZ_wDgeVWVNFr9m4qxyHmKWZQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'The best doctor he really cares.  I am so happy I found him', 1519323269),
(344, 74, 'James Mcsorley', 'https://www.google.com/maps/contrib/103639753977752195235/reviews', 'en', 'https://lh6.googleusercontent.com/-mTOe7H_Swwc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1VuFmpnmzMt1FqJl8EyMOxsUds2A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'If you want a doctor to leave you when you are in the middle of treatment, and run up your insurance. Then this quack is your doctor.', 1526632520),
(345, 74, 'I Am She', 'https://www.google.com/maps/contrib/105283801692105254219/reviews', 'en', 'https://lh4.googleusercontent.com/--agx4-We4uE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq31oTAhMn9FpezVI2z2Va6gJUxjwg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '7 months ago', 'My best friend was referred to this dr. She just had a horrible experience and I can\'t even believe that they are treating people this way. My friend has been in so much pain for the last year, and she has seen multiple drs to try to get to the bottom of it. So she gets to dr hearns office, they call her back, got her vital signs etc. Dr Hearne came in and spoke with her about her visit. My friend told him that another doctor she sees referred her to him. Before she could even get to her symptoms, Dr Hearn steps out and tells her that he would look up her information. About five minutes later, he returned and asked how old she was. She told him 32 and he stepped out again. A few minutes after that, his wife comes in and tell my friend, \" Your records show that you are receiving pain medicine from four different doctors so Dr Hearn will not be seeing you. Please leave\". My friend wasn\'t even there for prescriptions. She simply wanted to get to the root of some serious symptoms she has been having. She felt so humiliated and offended. She said they treated her like a crack head or dope fiend. The wife stood there, waited for her to gather her belongings, and escorted her out! Shame on Dr.Hearn and his wife for treating people like this. True enough, there is a serious prescription drug epidemic, but for them to treat her like that is beyond unprofessional and tacky. SHAME SHAME SHAME!!!!!', 1507659470),
(346, 74, 'Marita Upton', 'https://www.google.com/maps/contrib/104014104717757584560/reviews', 'en', 'https://lh4.googleusercontent.com/-QbueaKBk-uI/AAAAAAAAAAI/AAAAAAAABmE/8blBed3mZo0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'He was wonderful and kind . Marita Upton , retired RN', 1515518806),
(347, 74, 'Marquita Gantt', 'https://www.google.com/maps/contrib/112189246762170406613/reviews', 'en', 'https://lh3.googleusercontent.com/-NhiA6Pxm86Q/AAAAAAAAAAI/AAAAAAAAC-w/DX1_fgj3s1U/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'The receptionist are very rude and need a class on office/customer service etiquette.  I support black businesses but I wouldn\'t recommend this ghetto location to anyone.  Doctor is great but, that is if you can make it to see him before the rudeness drives you away...', 1470679094),
(348, 75, 'Carl Coonfield', 'https://www.google.com/maps/contrib/100622768364747173679/reviews', 'en', 'https://lh3.googleusercontent.com/-dasf2j_Bl1w/AAAAAAAAAAI/AAAAAAAAADg/tQPMbelTNiE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 3, '3 months ago', 'Dr. Tammy is personable, however, it is near impossible to get someone on the phone or to have them return your call', 1519224548),
