(353, 76, 'Janim Mazing', 'https://www.google.com/maps/contrib/100819799350871845097/reviews', 'en', 'https://lh3.googleusercontent.com/-iQWNToaopAM/AAAAAAAAAAI/AAAAAAAACUo/btVsNTEppyY/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 years ago', '', 1447693581),
(354, 77, 'Brandon Lewis', 'https://www.google.com/maps/contrib/108535526570430974824/reviews', 'en', 'https://lh5.googleusercontent.com/-9EEY0C7HWsc/AAAAAAAAAAI/AAAAAAAAAqM/DQddGdPS5Cc/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 2, 'a month ago', 'Small selection of flower and high prices. Looked like a good selection of oils and edibles but not what I was shopping for. The lady who helped me was nice enough but not really as helpful as the other shops in the SD area.', 1523035924),
(355, 77, 'Angelita Morgan', 'https://www.google.com/maps/contrib/100635145937127379055/reviews', 'en', 'https://lh3.googleusercontent.com/-FpsX5DrUZGU/AAAAAAAAAAI/AAAAAAAAxTc/mhHRVFZ5S1Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'The employees are super nice, prices weren’t bad at all. Kyle was awesome and gave me some freebies and a cool lighter! Thanks a lot guys.', 1525158291),
(356, 77, 'Rachel Iverson', 'https://www.google.com/maps/contrib/113870364201437856156/reviews', 'en', 'https://lh6.googleusercontent.com/-jTafZBxozFQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq311WPzdEnsEEzhQUC_iBiX0U-rOA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'We are from out of state and we honestly had the up most postive experience. They were so amazing, nice. Every time i come back i will be going to them.', 1523504548),
(357, 77, 'Henry Zarcomie', 'https://www.google.com/maps/contrib/113812115098059599042/reviews', 'en', 'https://lh4.googleusercontent.com/--fmXXTcUUJY/AAAAAAAAAAI/AAAAAAAAAAc/VfbWtiGjfVY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'I write reviews because it’s a requirement to care, believe and trust what others may say on a review so when providing info, I’m honest as can be!!!\n\nThis place knows their Bud!!', 1514276198),
(358, 77, 'Tyler Poirier', 'https://www.google.com/maps/contrib/106469318360114472650/reviews', 'en', 'https://lh4.googleusercontent.com/-jctsqFnVSXI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2YXYj7o5VM19rHyBEeHTsqLbLhDw/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '7 months ago', 'So I’m from Massachusetts on my honeymoon here I figured I’d be able to grab something from this store\nSo the lady I spoke with was super nice and helpful and the menu looks amazing but the name of this place is a bit of a misnomer “recreational” marijuana dispensaries won’t be legal in CA till Jan. 1 2018\nJust a heads up to people like me.\nLike I said though \nDefinitely seems like the spot to go', 1508875750),
(359, 78, 'Erika West', 'https://www.google.com/maps/contrib/105182170939580129256/reviews', 'en', 'https://lh3.googleusercontent.com/-eneyjwvy_eg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2rDt1fce6nwT3LwrVVXvg0xyO5Rw/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '3 weeks ago', 'The staff there was friendly enough (which is like the bare minimum expectation in my opinion) but the selection was very limited. They had about 10 options for bud and were out of some. And only their own brand of cartridge, no edibles or topicals if I recall correctly. The bud itself was fine. The store itself is really sterile and creepy. Nearly empty, bright white lights and walls and glass, no music or much attempt at atmosphere. And it had a kinda \"bro\" vibe which turns me off from returning unless I have to. Quite off-putting. Check out other places in the city.', 1525568542),
(360, 78, 'Dan Braunstein', 'https://www.google.com/maps/contrib/103301092491036245920/reviews', 'en', 'https://lh5.googleusercontent.com/-HUGnWT8_QS0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2ubfq7_imG9xSEsoWdNkg_ql1c9Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Brian is the manager and is an awesome guy and very knowledgeable about Cannabis. He will help you diagnose what strain or product is right for you. They are very professional in there and the prices are reasonable. The major drawback is lack of parking.', 1518214542),
(361, 78, 'Tracey Ashenfelter', 'https://www.google.com/maps/contrib/104269645031778583031/reviews', 'en', 'https://lh5.googleusercontent.com/-e6nZnccKQJk/AAAAAAAAAAI/AAAAAAAASAU/EAjXJkyXCWE/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'They took time to help me understand the various products offered and find solutions that worked for my mother as she recovered from stress fractures in her lower back.', 1525556028),
(362, 78, 'Catie Steinmetz', 'https://www.google.com/maps/contrib/111684519824456768844/reviews', 'en', 'https://lh4.googleusercontent.com/-dDYwcnTX5U0/AAAAAAAAAAI/AAAAAAAAGuU/xGXcotFzonQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'The Budtender is super sweet awesome guy who has great recommendations. The bud is good quality and not outrageously priced given the quality. I smoke sativa dominate strains, they always have several choices and have even help me chose strains that I may not have selected on my own. I pretty much only get my needed bud here.  As one of the few despensories in FiDi it\'s a blessing that the staff and selection is awesome', 1515190318),
(363, 78, 'Ana Tepepa', 'https://www.google.com/maps/contrib/118258690907622736993/reviews', 'en', 'https://lh4.googleusercontent.com/-eZzfXWwKiPs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1SZEwyF0gBbf_NTBTCgH5FFUjuPA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'Don\'t expect a human when calling must leave a message I left a message saying my pen Carthage crack ! This is the second time and the first time Brya\'s conclusion was that I broke it is possible i didn\'t see what happen in my special dime bag (weed company to keep your stuff safe and secure, ) these new pens they have - let\'s just say I can see why they guarantee there product.  Maybe because they are still testing ? The oil is an amazing product just wonder if there going cheap on , the first time I was here I had to replace the pen. Just saying I don\'t like coming back and me asking to see what\'s wrong and replacing it but at this point coming back twice (going back tomorrow 3rd time)why even keep trying ???? I would like my money back and you can keep you 100 dollar pen they guarantee ... please and thank you I can post a video and a picture if you like ? ', 1484888657),
(364, 79, 'Maria Isabel Rubio', 'https://www.google.com/maps/contrib/110460606373900631018/reviews', 'en', 'https://lh6.googleusercontent.com/-BinZWQu6UBg/AAAAAAAAAAI/AAAAAAAAJ2M/YiJmC9IGeRQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'If you\'re looking for a spot that\'ll treat you right every single time, this is your place. Thanks Alternative Medical Center!! You gotta loyal patient in me.', 1525276127),
(365, 79, 'Andii Bloom', 'https://www.google.com/maps/contrib/109776437362634864210/reviews', 'en', 'https://lh5.googleusercontent.com/-ikJPVm4Nrxc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3xjWOADQoFQ9r1syc6dlbwloj_9w/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Today was my first trip to AMC. It was by far the best experience I\'ve had at a dispensary in Sacramento. There is plenty of space in the waiting area and the showroom is gorgeous. Our budtenders were chill and hooked us up with multiple deals that I would never have got anywhere else. AMC will definitely have me as a regular. Thanks so much this morning everyone.', 1524425586),
(366, 79, 'Izaiah Torrez', 'https://www.google.com/maps/contrib/102739569329088429286/reviews', 'en', 'https://lh4.googleusercontent.com/-cwYaTfxBQUk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3jw1gq3C8vHBr7BtuNO3QyevXeAg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Always super nice and super chill never had a bad experience and only had to wait over 10 min one time usually takes 10 to 12 minutes in and out', 1524424734),
(367, 79, 'Q DawG', 'https://www.google.com/maps/contrib/109172504896287542263/reviews', 'en', 'https://lh5.googleusercontent.com/-fdPkQpP1ZZw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2u72NWaU01WJY92-FDZo2WSQplaQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, 'a month ago', 'They don\'t take out of state id or federal.  I was told my TX id  (which I got the year before)  had to have a good star. There is NO SUCH THING!  I was also told my FEDERAL id did not match the standard they have in their book.  Go around the corner to the other dispensary,  way more accommodating and pleasant. Btw I\'ve been to dispensarys in Richmond and Sac. Without any problems.  I\'ve bought alcohol and ciggerates with the exact same id.', 1522768559),
(368, 79, 'Fee Holliday', 'https://www.google.com/maps/contrib/102143299358664522273/reviews', 'en', 'https://lh5.googleusercontent.com/-WYsBYAxFZnQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2joMtY9VT1JB52QmIXr-khfFSxng/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'I just called to ask for a specific product and the receptionists was a complete B!t(#. I asked who I was speaking to she didn’t feel the need to offer her name was rude as hell. This place SUCKS , there are so many better places to go in the area AVOID this place unless u like unpleasant experiences', 1521313300),
(369, 80, 'Justin Cameron', 'https://www.google.com/maps/contrib/113766996777309001776/reviews', 'en', 'https://lh3.googleusercontent.com/-X5W9PT9EpOI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0fbzCztLgBvC0KbGjuiV3WvGPuGQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'Amazing staff and quality products. Their staff in the nursery are very helpful and caring. They were able to help me narrow in on a wonderful strain from Equilibrium, Black Lemon Glue... and they are not disappointing. I\'d highly recommend anyone and everyone interested in the cannabis movement to visit Harborside.', 1527047483),
(370, 80, 'Suellen Adams', 'https://www.google.com/maps/contrib/102790027513222981538/reviews', 'en', 'https://lh5.googleusercontent.com/-1sDw3LpsC98/AAAAAAAAAAI/AAAAAAAAAA8/rhC2JZOPdZE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'My adult daughter recommended Harborside as I’ve recently been diagnosed with Osteoarthritis. I had been looking online for alternatives to Pharmaceuticals to help the pain from inflammation. Our “consultant” Nick was VERY friendly and knowledgeable and was able to direct me to a product that should help my symptoms. The cashier was also very friendly and I loved getting a “wisdom” discount! Can’t wait to try my products and go back for more!', 1526418425),
(371, 80, 'C. C.', 'https://www.google.com/maps/contrib/102287726178851563992/reviews', 'en', 'https://lh6.googleusercontent.com/-Kria3kAliuw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3-9i0vYlKWPAGOFsVDhvVSPUvgrA/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'a month ago', 'Bad value products.  Significantly higher quality$25 1/8ths can be had at many other locations.  Additionally, they do not let you smell the product, a ridiculous policy that no other dispensary follows.  I\'ll gladly take my biz elsewhere.  They also charged me for an exit bag when I brought my own.  \n\nThe no smelling policy is purely greed based as the opened display product has to be disposed of and not sold per state regs.  As I said other dispensaries let you properly inspect the buds.  My $25 bag smelled like trimmings, bad taste and harsh.', 1524696624),
(372, 80, 'Stephanie Gray', 'https://www.google.com/maps/contrib/104782483860179345915/reviews', 'en', 'https://lh3.googleusercontent.com/-TZva4ODF5PM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3UG0rnYAJ91-ZeCqZ0XUFuBP1XPw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I went in my first day off the plane from New York. The staff was knowledgeable , attentive, and kind. They were more than willing to answer any question I had in concerns to not just buying their products but in the community as well. Then I went again on April 20th and the staff remembered me. She asked me how my stay was and thanked me for coming back.', 1524332789),
(373, 80, 'Julie Hayes', 'https://www.google.com/maps/contrib/109472794528207004248/reviews', 'en', 'https://lh3.googleusercontent.com/-N566BcQvSTA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq198hFYfaQYfWtebSAu2FOLISYRAg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Friendly and knowledgeable staff. Top notch operation. Everyone can and does help with everything making the customer service seamless. I am impressed.', 1524972769),
(374, 81, 'Justin Leonard', 'https://www.google.com/maps/contrib/109589976234712680194/reviews', 'en', 'https://lh5.googleusercontent.com/-357Bjr8r-88/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1SuHuxEflk6kSYPa0JAOwrpTq1YA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '11 months ago', 'Customer service was bad and the lady on the phone that I talked to didn\'t know what she was talking about and was not properly informed on the medical marijuana law.', 1497299946),
(375, 81, 'Rob Martin', 'https://www.google.com/maps/contrib/114371266668738932526/reviews', 'en', 'https://lh6.googleusercontent.com/-IgNXWZr5SdQ/AAAAAAAAAAI/AAAAAAAAADE/g5HhKLKTgb4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'quick and easy process to get your REQ.', 1485462223),
(376, 81, 'Jay Finstad', 'https://www.google.com/maps/contrib/116088241633710586296/reviews', 'en', 'https://lh6.googleusercontent.com/-vNLiWfHyvX0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3MLMg-1BnIo636thO9xSHZP1g2kg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I want to move out there from Wisconsin , any suggestions???', 1486617928),
(377, 82, 'Rozaura Faulkner', 'https://www.google.com/maps/contrib/107599189734217537091/reviews', 'en', 'https://lh3.googleusercontent.com/-tS8xhjrBmb0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2S4yXrzNm7C1ueuoI1x5AHmdOmmQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Best education you can get!.', 1525701994);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(378, 82, 'Aaron Varga', 'https://www.google.com/maps/contrib/111187672275953896198/reviews', 'en', 'https://lh3.googleusercontent.com/-A3k_6ikyQY8/AAAAAAAAAAI/AAAAAAAATaU/fPxzhFHMcI0/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '10 months ago', 'Amazing experiences, always. These guys really take car of you. Every question I ask is answered with great detail and it is always extremely appreciated and more importantly, tremendously helpful. Thank you for caring!', 1499452688),
(379, 82, 'Richard Polidore', 'https://www.google.com/maps/contrib/105307992387772947212/reviews', 'en', 'https://lh3.googleusercontent.com/-JtvBEvq_HpA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1L4q1tCSxVrejKih6FTux9LCjPpA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Great staff and excellent customer service. They are very knowledgeable about everything in stock  and will help you find the medicine that works best for you. I love coming to this place. There is usually no waiting. You are in and out. Keep up the good work.', 1487384745),
(380, 82, 'Living The Dream', 'https://www.google.com/maps/contrib/111631611761201354236/reviews', 'en', 'https://lh4.googleusercontent.com/-4KgE36CDlxE/AAAAAAAAAAI/AAAAAAAAVMw/OjLbZfal3mk/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg', 1, 'a year ago', 'This was MY experience.  I found MCC online.  I read a lot of information.  I was even more interested.  I wanted to register for the cultivating class, but was unable to complete the payment portion of the sign up.  They prompt you for your cc information, but it is unclear to me, if they will accept debit payment to reserve a seet in class, for Sunday, April 23rd, 2017.  The processing of the debit transaction I attempted, never completed.  I had several questions concering the class/school and payment information.  I called more than once.  I even left more than 1 message.  I called yesterday morning, and again this morning.  I still have not had a return call or response.  I honestly wouldn\'t even consider giving this website a \"1 Star\" rating, simply for the complete lack of customer service.  After all, the class is $130. The ONLY reason I even rated it, was to give this terribly low scoring review.', 1492541945),
(381, 82, 'Branden Thomas', 'https://www.google.com/maps/contrib/113998113223944041630/reviews', 'en', 'https://lh6.googleusercontent.com/-VZA20yJuh9w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq35xMMfeNNEEHJdb9a7-8qmllNw7A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Amazing and informative staff! My top choice.', 1490216070),
(382, 83, 'Husam Haopsh', 'https://www.google.com/maps/contrib/109408682517017773260/reviews', 'en', 'https://lh3.googleusercontent.com/-BlCLwFHe2oU/AAAAAAAAAAI/AAAAAAAAAKA/vA1iutbc2TE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Awesome place, staff, and management\nI got my delta9 battery and the Brass knuckles cartridges from here, both work great. \nThey also give you a free joint or a gummy bear edible (your choice) when you buy above a certain amount. 5 stars!', 1527658384),
(383, 83, 'Andrew Bishop', 'https://www.google.com/maps/contrib/107908469468972030033/reviews', 'en', 'https://lh5.googleusercontent.com/-wVpi-8hys2I/AAAAAAAAAAI/AAAAAAAAABg/IEWbhoigRHY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'My favorite place. Good prices. Great staff. Amazing election. Always having the latest and greatest goodies too.', 1524971914),
(384, 83, 'smoky water', 'https://www.google.com/maps/contrib/104256220140218447128/reviews', 'en', 'https://lh4.googleusercontent.com/-vbjnh1cX4oM/AAAAAAAAAAI/AAAAAAAADWk/JM5giIQQyqA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'We loved this place, I believe the person who helped us was named Saff, everything she recommended was spot on,and we regret not buying more,the selection was great and so was the quality,  we were from out of town going to Disney and found this little gem a short drive away , go here for a great experience, and check for specials', 1526415852),
(385, 83, 'Remi Page', 'https://www.google.com/maps/contrib/112068560210480559450/reviews', 'en', 'https://lh4.googleusercontent.com/-qklotkKzxR8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1y-sKi3NddTU4MALn9-NiHZWJiAg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'ive been coming to this dispansary for a while they used to be resoaneible  16 dallers for an eath and 2 grames for 16  but lately I\'ve dont know whats been going on but the more i come here the more expensive  it keeps getting i am come on now are gas is allready expensive  why does are medication havto  be too. if you want bomb and cheaper weed go somewhere else such as san pedro or  wilmington. worth the extra distance for an all arouns better product  this place has. this spot is now a joke. just because this place is close does not mean its better.', 1527527002),
(386, 83, 'Jordan Stevens', 'https://www.google.com/maps/contrib/113776428964509154681/reviews', 'en', 'https://lh4.googleusercontent.com/-SrPUtenua5U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq28j0iLar7TpczXc8TW_fncPiRMIg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Excellent place, excellent bud tenders. Had a pretty damn good first timer deal too. Will definitely return if I\'m in the area', 1520109185),
(387, 84, 'paul tucker', 'https://www.google.com/maps/contrib/110244089600735768847/reviews', 'en', 'https://lh4.googleusercontent.com/-DBAKHeOFmXc/AAAAAAAAAAI/AAAAAAAAAEI/rC1jdOxf1js/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Casey was super knowledgeable and friendly! In a super young industry filled with people that expect you to have all the knowledge in the world.... Casey did a good job helping me through the process. I felt comfortable and welcome! A++ service', 1524952367),
(388, 84, 'Am M', 'https://www.google.com/maps/contrib/116278574860150581972/reviews', 'en', 'https://lh4.googleusercontent.com/-SxKe4ySHaYI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2MXvlUhIafdBOBu9zx4z4qdiPJAw/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'in the last week', 'This place is an unnecessarily over the top experience, I’m just trying to buy some weed, not go to a fancy hair salon. It’s always really busy and you have to wait half an hour in overly bright lighting to buy anything and also they make you fill out all this paperwork and scan your ID and take all this information for no reason. You’re way better off going to Ketama down the street if you’re just trying to buy quick joint and go.', 1527409381),
(389, 84, 'Pam Kent', 'https://www.google.com/maps/contrib/116971369114086261519/reviews', 'en', 'https://lh6.googleusercontent.com/-KTJ6-h4pyVQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq17fSpDVmibLapH7GpZQS3h8gF1lQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Like walking into an upscale jewelry store. Staff is very organized, knowledgeable, and pleasant.  Jennifer was extremely patient listening to all my ailments and many questions. Will definitely being going back!', 1524166788),
(390, 84, 'Faisal Ali', 'https://www.google.com/maps/contrib/107663025982593795841/reviews', 'en', 'https://lh5.googleusercontent.com/-ZxkJctsKxZI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1yGiVp8JDN9EC_CEwRjyiDzr3LmQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'While generally a nice looking store with friendly staff the issue is the actual product. Visiting from Seattle I thought this store really knew their stuff but when I got to using some pre-rolls I bought and realized that these people don’t know how to pack, good luck trying to light up again after sesh. Keep your fancy store - just give me product that works reliably.', 1526965955),
(391, 84, 'Sam Cotton', 'https://www.google.com/maps/contrib/101401498804931601756/reviews', 'en', 'https://lh6.googleusercontent.com/-OBBBhmD3iU4/AAAAAAAAAAI/AAAAAAAAAA8/BeVZ31EjIWg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'Staff is very friendly and more professional than at other dispensaries I\'ve visited.  Top-shelf bud.  Large menu of diverse items including weed pills, wax cartridges, flower, prerolls, chocolate, etc.  Location is also super convenient for walking over to Dolores Park.  \n\nOnly downsides are that their line gets very long (30+ min wait), especially around 5-6 PM, and their \"airtight\" bags aren\'t made very well and break easily.  If you are taking flower on the metro, you are way better off bringing your own jar to store it in, just to be courteous and not reek.', 1519507652),
(392, 85, 'Eric -', 'https://www.google.com/maps/contrib/104132505651749096535/reviews', 'en', 'https://lh6.googleusercontent.com/-EDcfnnDj170/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3YVkIBD1vMVC8qhZn5O8LdAOthVw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Make sure to smoke before you go, because if it\'s busy there\'s a very good chance you\'ll be watching people who arrived after you get served first. They have 2 lines for adult use but no system to ensure people are served in the order they get in line. Last week 5-6 people that arrived after me were served while I\'m sitting in the other line. When it got to me the girl decided it was time to switch and I got skipped again. W.T.F.\nPoor customer experience.\nIf they fix this they\'re a 4/5 star.', 1524369299),
(393, 85, 'Trevor Cost', 'https://www.google.com/maps/contrib/113494794231404930807/reviews', 'en', 'https://lh6.googleusercontent.com/-pTeH9raEqBE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1TkZNkNC6qs2iAAkzqWbLas4lINA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'staff was great, very helpful. Better to be medical customer so your checkout is expedited, dont have to wait in line like recreational customers. Good edible prices, and cartridges. I didn\'t get any flower.', 1524177379),
(394, 85, 'John Anderson', 'https://www.google.com/maps/contrib/101397511096556278026/reviews', 'en', 'https://lh4.googleusercontent.com/-_3gi7PfR7C0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq07dkIaBSP7SOriPxbkIpM12yxlOA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Friendly people and quality products but an anxiety inducing atmosphere. The ticket system is crazy.\n\nAdditionally, taxes are for some reason way higher here than other dispensaries in the area. \n\nLots of mislabeled product and although friendly and smiley, not very knowledgeable staff. \n\nWith so many dispensaries in the area, there’s really no reason to be overcharged for sub par service.', 1525043492),
(395, 85, 'Art Hampton', 'https://www.google.com/maps/contrib/100768202706754757677/reviews', 'en', 'https://lh3.googleusercontent.com/-M9mB2we-nC8/AAAAAAAAAAI/AAAAAAAAAAA/pUh-epA0n7c/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a month ago', 'Great selection and the staff is knowledgeable and friendly. Prices are steep but that\'s mainly because of the onerous taxes. Parking can be a problem, and they have plans to expand. If you know what you want, a delivery service is better.', 1524314733),
(396, 85, 'Sanity Two', 'https://www.google.com/maps/contrib/114156390045546639998/reviews', 'en', 'https://lh5.googleusercontent.com/-bfwK56X-1RM/AAAAAAAAAAI/AAAAAAAAABM/PlaWh_79ENI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Some of the kindest and most knowledgeable budtenders I\'ve ever had the pleasure to patronize. I never feel hurried, always welcome to ask questions and get recommendations. Great service. Great people. Great place.', 1521776972),
(397, 86, 'Cody Zaiontz', 'https://www.google.com/maps/contrib/105896281433830376801/reviews', 'en', 'https://lh3.googleusercontent.com/-Rt-2dUHP6x8/AAAAAAAAAAI/AAAAAAAAAEs/wFLjq1S4zQg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'This place is awesome! I visited a few different dispensaries while in CA and this was the cleanest facility with the largest selection. The budtenders were also very friendly and patient with me (I got there 15mins to closing).', 1527127715),
(398, 86, 'DeAuna Simmons', 'https://www.google.com/maps/contrib/104136829908461392276/reviews', 'en', 'https://lh5.googleusercontent.com/-17dZ3QL-gkU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2d4ywvLkxwbByDX0DOw_OVdoYKUQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'We got to visit cc101 the other day, it was all good until I asked if they excepted a military ID, I have used it in the past for my discount. I was told by the budtender I couldn\'t use it because Im a spouse of a veteran,, My husband and I were married 36 years, I and our 2 kids were a military family, until he passed in 2013.  I understand about the whole veteran thing. I support our Vets,,, but I was given this MILITARY ID FOR A REASON. MY Husband would be very. Very upset if this would have happened when he was here.. Needless to say.. I\'ll never go back to cc101.ill keep going where they treat military family with respect. Spouse.. Kids.. We\'re all in it together.. Bye', 1524512656),
(399, 86, 'Robert Lee', 'https://www.google.com/maps/contrib/101152543615721661364/reviews', 'en', 'https://lh5.googleusercontent.com/--DA8PSZQnSI/AAAAAAAAAAI/AAAAAAAAABU/XoeLQjO7X5Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Nice place to get what ever I feel like having at the time. It\'s the people and the veterans discount that keeps me coming back.', 1525926849),
(400, 86, 'RedHead Avenger', 'https://www.google.com/maps/contrib/113090620513231123889/reviews', 'en', 'https://lh6.googleusercontent.com/-LARbw0cOS8E/AAAAAAAAAAI/AAAAAAAAMH4/1dWb_XE45GY/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a week ago', 'Not much to choose from, but the people are really nice and welcoming.', 1526604190),
(401, 86, 'Andrew Galindo', 'https://www.google.com/maps/contrib/107081690884847685786/reviews', 'en', 'https://lh4.googleusercontent.com/-fxaDC-2kwpo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3_yQSvRHBH_wotB6zgyx7EQ4NHsA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'Always easy to get what you need. Very friendly!!', 1527038486),
(402, 87, 'Dustin', 'https://www.google.com/maps/contrib/106023782620060868919/reviews', 'en', 'https://lh4.googleusercontent.com/-JLD8T4xpqsw/AAAAAAAAAAI/AAAAAAAAAjc/NBZioP7lv18/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 2, 'a month ago', 'Was treated nicely, but as a first time visitor, I was recommended a much greater quantity than I needed. I got charged cash advance fees from my credit card company because of the way their machine is set up. A simple edible purchase became $30+ when all was said and done.', 1523396866),
(403, 87, 'wbibbs7', 'https://www.google.com/maps/contrib/112570270903252846652/reviews', 'en', 'https://lh4.googleusercontent.com/-ifA0bz413Ls/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2box7LelxfpW1cQRCNcosRXSqo9A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'I use to love coming here but since they switched to both rec and medical all the medical specials are gone. And 240 is the lowest for an ounce other than shake?  Shame,  lost a member for over 2 years. WONT BE BACK.', 1517017032),
(404, 87, 'Karen Brown', 'https://www.google.com/maps/contrib/101980862968723633945/reviews', 'en', 'https://lh6.googleusercontent.com/-X9x3bvInsJE/AAAAAAAAAAI/AAAAAAAAABM/TXyxQTLpEEY/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'I purchased a Flow Kana eighth and the flower was stale. The flower smelled like hay, was brittle, brown, and had giant stems.  Maybe this was an organic product that was on the shelf for too long or exposed to heat but I won\'t be buying this brand again. DOS should have done a quality inspection and removed those inferior quality flowers from the menu.', 1524168915),
(405, 87, 'Jed Shuster', 'https://www.google.com/maps/contrib/112798754544410827297/reviews', 'en', 'https://lh6.googleusercontent.com/-w8b6bDXZBSE/AAAAAAAAAAI/AAAAAAAAAYg/WhiRnm8u17I/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg', 1, '4 months ago', 'What a waste of time, gas, and expectations...I called to ensure they had my item too, told they did. They didn\'t. At least we supported Chevron and wasted some gas...oh, and waited 45 minutes.\n\nThey made ZERO effort to make it right. Just excuses. I wish you luck if you stop in...godspeed. Buahahaha!!', 1515632087),
(406, 87, 'Joshua Walker', 'https://www.google.com/maps/contrib/115669463982203382909/reviews', 'en', 'https://lh5.googleusercontent.com/-jCS4QHvM0jw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3rNjHPgsxP3NOnXV1PH4PiQgndYg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'The front desk personal are rude and inconciterit.my I\'D has no experation date on it but they scan it and say it was expired.I have no problems any where else it was just the so called security hard busting my chops.', 1522693511),
