(412, 89, 'Justin Chase', 'https://www.google.com/maps/contrib/101909813568011568083/reviews', 'en', 'https://lh4.googleusercontent.com/-3iXYY3cI7j0/AAAAAAAAAAI/AAAAAAAAAIk/tOvlQ4nB-6U/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Came from out of town and this was the second dispensary we went to. This was by far the best of the two. We even tried another one and yet and still this was by far the best one. Great prices,  incredible products and superior customer service. If you want the total package look no further its right here. Thank you to the staff for providing my wife and I with such a phenomenal experience.', 1524971860),
(413, 89, 'Abiy Yacob', 'https://www.google.com/maps/contrib/103454638003196311246/reviews', 'en', 'https://lh5.googleusercontent.com/-ljNKx8Gu-ek/AAAAAAAAAAI/AAAAAAAAAAA/3aKv3u5TY_E/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Great location, very close to venice beach and the airport. Knowledgable and friendly staff. Free parking in the back.', 1526776711),
(414, 89, 'Plumeria Dee', 'https://www.google.com/maps/contrib/113843942526312451113/reviews', 'en', 'https://lh6.googleusercontent.com/-qQyXUqUGNpQ/AAAAAAAAAAI/AAAAAAAACW8/_hZcsAILJbg/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '2 months ago', 'Great place for adults who don\'t want a dippy or grubbyor uncomfortable pot head place to buy medical or recreational marijuana.\n\nWell trained staff, professional services.  In one phrase: A dignified experience.', 1521408410),
(415, 89, 'LizzNTony GPad', 'https://www.google.com/maps/contrib/115730596041841659224/reviews', 'en', 'https://lh5.googleusercontent.com/-cNWcgjZBF5I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2nqTD00Q1002xEPfbRUZavS5k9EQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '6 months ago', 'Called to get some info (being from out of state and In Alot Of Pain Worst Time For No Meds). So who ever answered was short and very rude to me giving little to almost no info then couldn\'t even say bye just click. Caregivers they are not. I thought people we relaxed and layed back in Cali...', 1510526206),
(416, 89, 'jen wenger', 'https://www.google.com/maps/contrib/100523162196816415043/reviews', 'en', 'https://lh3.googleusercontent.com/-VOsssohhTwI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1HESauQnrHWrRczmld6NMPpfZXpQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'This is the best herb shop I\'ve ever been to! Best customer service, selection, and prices! The whole staff is incredibly nice, educated, and helpful. They always know exactly what I like, give me perfect recommendations, and are exceptionally friendly each and every time I stop by, which is a lot :P \nThey really know how to brighten up my day. ', 1492739037),
(417, 90, 'Crystal Stanfield', 'https://www.google.com/maps/contrib/115410097006020787880/reviews', 'en', 'https://lh3.googleusercontent.com/-npJFDY4SPRQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ImREFOr5LghZu32E9USmObmy_3g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'Came in and got a wax roll and it was amazing ', 1504800371),
