(420, 90, 'JustHavingFun', 'https://www.google.com/maps/contrib/100273325028557345571/reviews', 'en', 'https://lh6.googleusercontent.com/-JR4EXVWylWI/AAAAAAAAAAI/AAAAAAAAC2Q/5HojFnZ27dk/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, '2 years ago', 'Small a selection but the just relocated to a new shop on 10th. Great customer service & really helpful employees', 1435169013),
(421, 90, 'Lucas Mullens', 'https://www.google.com/maps/contrib/106526110698896993540/reviews', 'en', 'https://lh5.googleusercontent.com/-IsuUnWNH7So/AAAAAAAAAAI/AAAAAAAAS_o/t3Cf8CrCJE8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', '', 1519064200),
(422, 91, 'Taylor Bartlett', 'https://www.google.com/maps/contrib/107130844644817863385/reviews', 'en', 'https://lh5.googleusercontent.com/-L77oz5xs3Vg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2T6sui_ApEE2fSQ2ZAHEFBiFwr5A/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'in the last week', 'I can’t stress enough how inefficient this place is. They are not adapting to their consumer and community needs. You wait outside for at least 30 minutes then inside for 30 minutes. Just took 2 and a half hours total time; meanwhile, I was standing the whole time. I would not have waited that long if I was properly informed. This is the only collective in the area at the moment. The issues of simply conducting business are incredibly easy to spot out. Soon, a young owner will pay attention to the needs of the consumers and create a much more efficient collective. There are more people leaving than purchasing. It’s the little things that keep a business’ success. How do you eat an elephant? One bite at a time. Good luck!', 1527447485),
(423, 91, 'James Martinez', 'https://www.google.com/maps/contrib/115741740426330623720/reviews', 'en', 'https://lh3.googleusercontent.com/-Sbt49IUwkLE/AAAAAAAAAAI/AAAAAAAAAAA/YaWbonRk_E8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'My experience was great! The herbs were top of the line and consequently are not cheap but you pay for what you get.  Staff was helpful and the place is in beautiful Monterey.  I\'ll gladly drive 150 miles again to buy great herbs and have lunch on cannery row.', 1522961745),
(424, 91, 'Sue Cooper Myers', 'https://www.google.com/maps/contrib/109134536752604255284/reviews', 'en', 'https://lh5.googleusercontent.com/-rYsrfZqm9-U/AAAAAAAAAAI/AAAAAAAAGOc/NKqaQM1c4Ns/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'We would like to thank Tree for her compassion & understanding. She was extremely helpful in a small problem we had. All is good & will spend my $ there', 1523644972),
(425, 91, 'Joshua Dougan', 'https://www.google.com/maps/contrib/110674238099292213456/reviews', 'en', 'https://lh5.googleusercontent.com/-heaIRUIiP0g/AAAAAAAAAAI/AAAAAAAACF4/KN_i08PU2PQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '3 months ago', 'Been here twice, buds were average across the board, prices were ridiculously high even when considering the new tax. The wait was ridiculous first we wait outside then we wait inside. They often like to tell people it\'s a family environment where you will be treated as such but that\'s not the case at all. They are just an average shop who has the only legal storefront in the area at the moment. Nothing special. Also on weedmaps if you read their reviews they have quite a lot of suspicious reviews attached to their business (as in same accounts reviewing 5 stars multiple times a day - 56 questionable reviews since Jan 1) and they SEEM TO flag all their one star reviews to try and get them removed. Fraudulent behavior if you ask me. This dispensary is a shop at your own risk kinda deal. \n\n**Security also seems to be a big problem for them. I didn\'t have any issues with security regardless of all the people who have been harassed by their security people tho**', 1518030022),
(426, 91, 'Monterey Bay', 'https://www.google.com/maps/contrib/114552160117210231412/reviews', 'en', 'https://lh4.googleusercontent.com/-GAuAoYANPL8/AAAAAAAAAAI/AAAAAAAABRU/_5qBnV2cROQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Gotta say that I loved this place. I have clients who drop \"goodies\" in my office door on a regular basis and my dad perfected seedless bud long before these newbies. I don\'t come for flowers, as it is literally dropped my mail slot most every week (yes, I kinda know who you are and thanks) but what I need is a place who is knowledgeable in the oil cartages and these guys has been GREAT! In the bud world my experience is king. I have more wax that an 8 years old \'s ear; I needed advise on oil cartages  as they really do the trick for my back pain (surgeries and Vicodin galore) but the oils kick ass on the pills.   These nice folks have shown me the way to pain reduction and have been right on 100%. If your just a stoner looking for a buzz leave these pros alone. If you are looking for professional reduction then really tell these guys what is going on and follow their I advise to a painfree day without all the newbie BS.', 1527054719),
(427, 92, 'Joseph Michael', 'https://www.google.com/maps/contrib/107660726969900775452/reviews', 'en', 'https://lh6.googleusercontent.com/-dJ0ep1jv6-8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq18lHRLcOd2Q2k9MUT1iyrfF2uyeQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Really great to find a local dispensary after just moving to the South Bay LA from Chicago. Great staff, and a pretty good website too. I appreciate the friendly staff, and a great range of options. Looking forward to my new spot!', 1524873182),
(428, 92, 'Nadine', 'https://www.google.com/maps/contrib/114911651678768071482/reviews', 'en', 'https://lh6.googleusercontent.com/-8WyloCQMF5c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0PoV8r5dJvrxBGn5tGRw7Y1Lz8kg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'I love the Long beach location! Everyone here is always so knowledgeable and pleasant. I enjoy coming here. There is NO other place of rather go to.', 1525733513),
(429, 92, 'Adam Hodges', 'https://www.google.com/maps/contrib/109920924363258542161/reviews', 'en', 'https://lh4.googleusercontent.com/-vt2g-Ut79is/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3wOov4PoWuPyEBAb-V1Yfh40qCfQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This place is top notch. Service is fantastic and the tenders know what they are talking about. They always guide me to the best bang for my buck. Great selection, serve recreational, and right off the freeway, what else could you ask for? \n\nPro-tip: check the website for daily deals, They are great!', 1520013831),
(430, 92, 'Joseph Michael', 'https://www.google.com/maps/contrib/108891292262591169063/reviews', 'en', 'https://lh6.googleusercontent.com/-klRDpyGSv0c/AAAAAAAAAAI/AAAAAAAAAXQ/YyiJhTj89Lg/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '4 weeks ago', 'Tried this place for the first time last Friday and had a pretty good first impression. Unfortunately, when i opened my bag when i got home i see that i wasn\'t given the Top Shelf 1/8th i paid for and was given a gram of something else i didn\'t even order. \n\nWhen paying 35% tax on something you never even received is very annoying. I spent almost $150.00 an walked out with 1 Gram of wax and 2 happy hour grams. Not sure if i want to give this spot another chance.', 1525214870),
(431, 92, 'Greg Lane', 'https://www.google.com/maps/contrib/104707160512963989666/reviews', 'en', 'https://lh4.googleusercontent.com/-8i2zMk4YSyk/AAAAAAAAAAI/AAAAAAAAABA/PaUiPZDRF8I/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'First timer. Was a great experience. The young lady that helped me was very knowledgeable. Had great Monday specials.', 1524511618),
(432, 93, 'Pete', 'https://www.google.com/maps/contrib/105641943605933576070/reviews', 'en', 'https://lh6.googleusercontent.com/-12yyQISWAKw/AAAAAAAAAAI/AAAAAAAAAIA/UX6siEKzdZs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Dealt with Becca. She was so cool & a true professional. The place was super clean and offered a wide variety. A very well organized operation. Highly recommend', 1520570715),
(433, 93, 'Mary Helen Knowlton', 'https://www.google.com/maps/contrib/113155176849427216766/reviews', 'en', 'https://lh6.googleusercontent.com/-q745BpXEx7U/AAAAAAAAAAI/AAAAAAAAiBU/AEP1cpx_fdw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Such a friendly staff!! Great prices and a great product. Will definitely be back for more. (:', 1520285709),
