(436, 93, 'terpcity bear', 'https://www.google.com/maps/contrib/115427575636417272727/reviews', 'en', 'https://lh4.googleusercontent.com/-doloQ7KCPW8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Eiwu5jjY-B44Om09sqFVSCP9m2Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'The cannabis was outrageously priced for the quality $50 8th\'s that are honestly $25-$30 quality at best. Sorry no thank you', 1518517186),
(437, 94, 'Chris Holt', 'https://www.google.com/maps/contrib/104221361629875816958/reviews', 'en', 'https://lh3.googleusercontent.com/-F048XX3g68w/AAAAAAAAAAI/AAAAAAAAABw/WKL9ZKqHcWs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Lindsay was wonderful and as was the woman at the front desk. Wonderful selection. Perks because it was our first time. Great buds at great prices. Come to this shop!', 1526395039),
(438, 94, 'Ej Lionhart', 'https://www.google.com/maps/contrib/105689040857405573535/reviews', 'en', 'https://lh6.googleusercontent.com/-4iZhIYcSWtk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq23QeayM2dksubOhfqsN4sfgiCHaw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'I have been a regular here for YEARS and i must say,  The quality of service has really gone down hill here. For instance, i usually do call ahead but the last 5 times i have tried there have been major problems. Each time it has taken 45 minutes to an hour and a half just to place my order! On 2 occasions they forgot to put my weed in the bag resluting in me having to take a trip back to get my missing product. The other 3 occasions i  waited  for my order to be confirmed for an hour only to be told that they were out of what i wanted. It has been a good run but its time to find another dispensary to patron.', 1526425343),
(439, 94, 'Steven Cork', 'https://www.google.com/maps/contrib/108360890414529414855/reviews', 'en', 'https://lh6.googleusercontent.com/-qVUMe7zzick/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0pIzpMD7wd5YfV2c6_UD-OH5MkDQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great business! The staff made me feel at ease and at home. Gabi, the bud tender, was extremely knowledgeable and truly kind and helped me find everything I was looking for during my visit . I definitely will be recommending this business to friends.', 1521612395),
(440, 94, 'sue gallagher', 'https://www.google.com/maps/contrib/100417472855377736520/reviews', 'en', 'https://lh4.googleusercontent.com/-izC2P8JJxHw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2vjqv3qhz698vH2qkY4NAr1tguOw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I Love this place \nStaff are knowledgeable and fun\nBest service and prices', 1519079863),
(441, 94, 'Jill V', 'https://www.google.com/maps/contrib/111036632318866345636/reviews', 'en', 'https://lh3.googleusercontent.com/-4Gg8AdpT4Eo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1vBvyTMj4p-UkURlXuHITqP7MSZw/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '9 months ago', 'The employees are friendly and helpful. Even if they don\'t know your name they greet you as if they did. I like spending my money here. ', 1503258758),
(442, 95, 'Jake Jones', 'https://www.google.com/maps/contrib/105723630329184440791/reviews', 'en', 'https://lh6.googleusercontent.com/--WtZNBE6oTw/AAAAAAAAAAI/AAAAAAAAHok/AuQfOupEUws/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 2, 'in the last week', 'Hard to find. Scummy neighborhood. There is a hole process to go through before you can buy.... Washington is so much better than California.', 1527303814),
(443, 95, 'Kerry Wimer', 'https://www.google.com/maps/contrib/104958470173162808439/reviews', 'en', 'https://lh4.googleusercontent.com/-vVNCGyanEIM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2UC6zU0P7Vnjowp3lT-QLKMclYCQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'in the last week', 'I\'m just out here visiting and stopped in.They where nice and helpful.', 1527382365),
(444, 95, 'Cynthia Bankhead', 'https://www.google.com/maps/contrib/113184693216824318305/reviews', 'en', 'https://lh5.googleusercontent.com/-z-WJJOaDq2M/AAAAAAAAAAI/AAAAAAAAADQ/G8zdlDgfdiM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Love this place! I am a new patient and they have something for everyone! This is the first place I went that had mild Marijuana besides all the others, now I can enjoy and relax finally. The staff was beyond patient and knowledgeable and knew exactly what I was looking for. I had been told by 2 other places or this will be good for you and HELL NO I was high as a kite and felt sick, So I want to say Thank YOU!', 1502642718),
(445, 95, 'Marissa Taylor', 'https://www.google.com/maps/contrib/115895254895058294905/reviews', 'en', 'https://lh5.googleusercontent.com/-y-nW3ba1d-c/AAAAAAAAAAI/AAAAAAAAGsI/PM-v2F_3Vn4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '4 months ago', 'It was clean. Had a lot of fresh herbs.', 1516628206),
(446, 95, 'Allan V', 'https://www.google.com/maps/contrib/112844669241739092775/reviews', 'en', 'https://lh3.googleusercontent.com/-iRay5DsBdmc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2O9I8wX2ywNyd6jhMc47xKM4TaIA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Out of business', 1524151381),
(447, 96, 'jose carlos Delvillar', 'https://www.google.com/maps/contrib/108353535487143421685/reviews', 'en', 'https://lh5.googleusercontent.com/-SqbplBShp1Y/AAAAAAAAAAI/AAAAAAAAAB4/4VaDXUnBqfI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'OUTSTANDING CUSTOMER SERVICE!!!!!!\nFirst time ever going into a despensary and the staff was knowledgeable and did not hesitate to answer any and all questions I had. \nAnd directed to me exactly to what I wanted. \nWill be doing all my shopping there.', 1523663318),
(448, 96, 'Joey Paul', 'https://www.google.com/maps/contrib/107316709037630103668/reviews', 'en', 'https://lh6.googleusercontent.com/-E7S3_YdwuVk/AAAAAAAAAAI/AAAAAAAAAKw/JWdFABLGHbs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'This is my favorite delivery company, never before have I encountered a dispensary so dedicated to supplying their patients with the highest quality medicine. A Green Alternative is like nothing else I\'ve smoked from a club or a delivery service and you begin to realize that most of the weed you get from for-profit clubs has non-organic contaminants.  \n\nFriendly people, great products, fair prices, quick delivery. It\'s everything you could ask for in a dispensary!', 1509841496),
(449, 96, 'Mark Woods', 'https://www.google.com/maps/contrib/109015280099400991524/reviews', 'en', 'https://lh4.googleusercontent.com/-7V20IMVoyoU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1pqVLMyA-bOFumLu4j9J28INgUuA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Favorite dispensary in San Diego. Friendly and knowledgeable staff, great selection, clean store, they accept debit and credit. Look no further!', 1523652906),
(450, 96, 'Marck Louis', 'https://www.google.com/maps/contrib/110572165553530727178/reviews', 'en', 'https://lh3.googleusercontent.com/-0WH8KTF6gTM/AAAAAAAAAAI/AAAAAAAAALk/ZrBtnOpsew4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Great selection of products, super friendly, excellent recommendations, and very timely delivery. Couldn\'t ask for much more than that!\n\n- They have a consistently high quality menu/product options/variety\n-  Personal friendly service, and a superb quality product\n- Help you with safe access to all your medical cannabis needs\n- Confidential Online Medical Marijuana Evaluations\n- Good prices \n- Excellent delivery service\n\nA Green Alternative was the first place I ever ordered from and they are still hands down the best one! If you want to support local with kind people who know their stuff then go to A Green Alternative!', 1509843506),
(451, 96, 'Michael Molina', 'https://www.google.com/maps/contrib/115364583278794609665/reviews', 'en', 'https://lh6.googleusercontent.com/-3uzGRLpJpRc/AAAAAAAAAAI/AAAAAAAAABk/PSYjBzGRs_Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'great pricing hands down...been all over SD and these guys have the best deals around... GREAT PRODUCT CHOICES AS WELL!', 1513049002),
(452, 97, 'Patrick Smith', 'https://www.google.com/maps/contrib/102433133075828502368/reviews', 'en', 'https://lh3.googleusercontent.com/-6QwtXEth7wA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1YWZgSydO10v2b5NfWOvd33oP0vQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a month ago', 'Came here on my vacation and had a great experience. Prices were a little high but that’s fine, it’s the experience. I bought a cartridge for $40 for a half gram. A full(closed) aluminum can got knocked over and hit the cartridge and the whole thing shattered. I spent $120 in the store that day also(April 6th) and was not given the $20 off if you spend more than $100 that I was told about. Overall I feel like if I’m paying that much money for something, it shouldn’t break so easily. Especially when the bud tender went on and on about how great jetty’s packaging is and I would have no issues traveling with it. I still have my receipt if you’d like to refund me my $20 I should’ve been discounted.', 1523236446),
(453, 97, 'Judy H', 'https://www.google.com/maps/contrib/103405944623106183589/reviews', 'en', 'https://lh4.googleusercontent.com/-f5LtGUOzSqw/AAAAAAAAAAI/AAAAAAAAIvc/OA5FRPYT-Ps/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'I\'ve been shopping at Torrey Holistics for several years.  It\'s a well-stocked dispensary with a huge variety of different options for cannabis consumption.  The staff makes you feel comfortable there immediately, listening to any questions you have and making educated recommendations.  Now that cannabis has been legalized and prescriptions aren\'t needed, they are much busier, but they have staffed up and remain very customer service oriented.  My dispensary of choice.', 1523120278),
(454, 97, 'scweeeker1', 'https://www.google.com/maps/contrib/109221176523530728123/reviews', 'en', 'https://lh6.googleusercontent.com/-44VzaQbPbNw/AAAAAAAAAAI/AAAAAAAAABY/oWHooFsqTnA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Visiting from out of state, we were tended to by Andrew and Someone he was training (dude with super glistening beard) great experience, friendly knowledgeable tenders. Yeah you had to wait but we didn’t mind at all.  Security to boot...definitely recommend', 1526597445),
(455, 97, 'Kirsten Running', 'https://www.google.com/maps/contrib/116263461471861414137/reviews', 'en', 'https://lh5.googleusercontent.com/-oCOUQRBzxog/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1K3X_xYQlFPtgJ7NIIhGzzT-e-jw/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '4 months ago', 'A great store with the nicest staff ever! I went on day two of legalization, so there was a long line (I imagine that will ease up with time), but they had snacks and sodas for folks waiting.  The store is very nice, clean, and has a very relaxed feel. Everyone there was ridiculously friendly and helpful. Despite being so busy they had everything in stock. They had a very wide variety of options at good prices.  I look forward to going again!', 1515010495),
(456, 97, 'William K', 'https://www.google.com/maps/contrib/101991013619607146931/reviews', 'en', 'https://lh6.googleusercontent.com/-5xLF7VlqGzg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2iAhSnm22yj0aFRptUkMKKkoOlVw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Come here to pay top dollar for last years light dep. Not one strain was real quality. This club is an embarrassment. Better rec bud in Las Vegas and even finer bud home in Arizona med shops! \nAlso why throw two small buds in a huge sample jar for people to smell? It all smelled the same. Bud tender even told me that after she expressed frustration, when I nearly had her pull every jar up for me to inspect. You even had on the TV in the waiting room, keep jars filled 75% to store the best. Listen to your own advice and have something presentable to show your patients.\n Rule of thumb if it doesn\'t look good, don\'t even smell it. Shame on me for not listening to my own rule. Stomped the blue zkittles into the dirt at the sunset cliffs the night I bought it.', 1523560552),
(457, 98, 'alvin shaw', 'https://www.google.com/maps/contrib/102607149835845714702/reviews', 'en', 'https://lh5.googleusercontent.com/-uK7Vty8zoeU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2UFbvUmlZzWYOfGObBb8gSD_J1pw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Recently visited this store and was very pleasantly surprised at not only the affordable prices but the high quality flowers. The staff is super helpful and will happily explain all of their deals and promotions. They even offer VIP cards for frequent customers... something that is very beneficial. Would highly recommend.       - N. R.', 1526938135),
(458, 98, 'The Dude', 'https://www.google.com/maps/contrib/113006765457839020525/reviews', 'en', 'https://lh6.googleusercontent.com/-el1b_4YJm9A/AAAAAAAAAAI/AAAAAAAAABc/loAddcw4Z3c/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '2 weeks ago', 'For prices and service this is the spot in L.A. to save you need to go with the larger sizes, 10 gram or Oz\' s. The parking area is clean and had security when we were there,  the store was very nice, great security inside too, once in the bud room had a short wait but got awesome service once my turn.  They have a great selection and some good deals. I also really like how all of the products come repacked in glass jars.', 1526259922),
(459, 98, 'Music Veins', 'https://www.google.com/maps/contrib/114218438147712067108/reviews', 'en', 'https://lh6.googleusercontent.com/--_L95yLFg88/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Tf4DzO-aEvH6x7jo1fgE6W_VnQQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'No lie... This is the best place to get your product. The bud tenders are as helpful as they can be and the store itself is pretty well organized. They have a bit of edibles, my favorite so far is the toffee. They definitely work... I\'m from out of town. But I will definitely be back next chance I get.', 1525095316),
(460, 98, 'Michelle Mohr', 'https://www.google.com/maps/contrib/105099922305273042069/reviews', 'en', 'https://lh5.googleusercontent.com/-XL23AUfzQsI/AAAAAAAAAAI/AAAAAAAABT8/qmk1wcj6E3M/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 2, '2 weeks ago', 'Out of state gets a 25% \"state tax\" \n\nThis place charges $3 for debit cards.\n\nNeighborhood is questionable don\'t go alone or at night. \n\nYicks. I\'ve never been to a bar where all of the bar tenders are drunk, so Its really hard to believe that the owner thinks its a good idea to have a dozen stoned employees helping customers. 1. WHY ARE THERE A DOZEN PEOPLE WORKING HERE? Is the security guard no able to check IDs too?  You really need a separate person for that? 2. Everyone has \"I\'m high\" attention span. \n\nThe girl that was trying to help me couldn\'t be less helpful. Several times she just turned to speak to the guy next to her as I was mid-sentence speaking to her.  She seemed taken back that I wanted to give her a specific reason I wanted to make a purchase. Even less interested in helping me find something to buy. Is she a cashier? ...no there is yet another employee to exchange money. This is a sales person- or maybe better labeled as a order filler. I ended up just buying something random since I wasn\'t going to be getting any info to help.', 1526210229),
(461, 98, 'Carlos Anthony', 'https://www.google.com/maps/contrib/108958319582863849657/reviews', 'en', 'https://lh4.googleusercontent.com/-DN-nimI-OKw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1M7Tu-WCSwJtGLPY9MsDw4xgVMwg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The crew at wonderland is pretty awesome. The services is so quick. You’re in and out within 5 mins of checking in. The customer service would alone be a reason to come back but the bud is the cherry on top. Best bud selection in town and already prepacked for you to get in and get out. Great system, great shop, great people.', 1522984767),
(462, 99, 'Paul Willis', 'https://www.google.com/maps/contrib/110861316318265953874/reviews', 'en', 'https://lh6.googleusercontent.com/-KLfUEaJWJG0/AAAAAAAAAAI/AAAAAAAAA18/_Cj8sVhB01Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, 'a week ago', 'I was one of many who got into the Grass Roots store excitement shortly after they opened and was a loyal customer for years. Things were up and down but because they were selling pot we gave them more credit than they were due. The management seems to believe that we, the customers were there solely for their benefit. GR continued along those lines systematically. They had become full blown capitalists. Money, apparently, was and is more to their point. It has been a long time since I\'ve gotten a truly good deal there. The last two \"budtenders\" only wanted to sell me something. To quote our fabulous leader:     \" What cha gonna do?\" For one, I\'m taking my long time business elsewhere, like Barbary Coast. At least I don\'t \"feel\" ripped off there. They may be just as capitalistic as anyone else, but they didn\'t jive me. Maybe I\'ll go to Urban Pharmacy again. They were very helpful and friendly even though they were completely out of what I was looking for. I\'ll go back to them too. Honest and friendly, that\'s what I like.', 1526923346),
(463, 99, 'Ryan Kane', 'https://www.google.com/maps/contrib/112627092971777700222/reviews', 'en', 'https://lh3.googleusercontent.com/-NAeOs3tmrng/AAAAAAAAAAI/AAAAAAAACTA/nQeWTzhNu4k/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Went here on vacation for a couple days in SF, was lost trying to find the place, but the cool door guy bust out on the sidewalk and knew exactly what we were looking for. Felt welcome and liked the products and prices. Would definitely be my spot to go if i ever went back.', 1522897383),
(464, 99, 'Makiyah Kiyoi', 'https://www.google.com/maps/contrib/106398533536757586374/reviews', 'en', 'https://lh5.googleusercontent.com/-u-DtvKcO7aY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2xU6Ul5FGZBK_quCQAROfJL08h1Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'On my top 5 dispensaries list. They have a wide array of quality products from flower to topicals. The atmosphere feels pretty balanced. and as a bonus they are one of the very few dispesaries to still air tight seal their bags which in today\'s age is above the standard.', 1526141146),
(465, 99, 'Fran Garcia', 'https://www.google.com/maps/contrib/116592853919683175286/reviews', 'en', 'https://lh4.googleusercontent.com/-jIUX-cncF7g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3fEOawJDZzfJfyJ8ZDZsaoctABeA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'First time here and most professional place spot ive been to, love this spot and the employees will definitely be returning. Thank u grass roots!', 1525197640);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(466, 99, 'david berry', 'https://www.google.com/maps/contrib/110999362649948121623/reviews', 'en', 'https://lh4.googleusercontent.com/-hNOZLrsZf7I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3ITpDwSnpl9ZY5aNfAmgM2eqyX6Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'This place is like a crazy night club,line down the block, letting in one at a time through a velvet rope by an armed guard. Located in a shady neighborhood. Stay away unless you really need some pot. And FYI they don’t sell seeds', 1522451205),
(467, 100, 'Bruno Arredondo', 'https://www.google.com/maps/contrib/117606001208773521488/reviews', 'en', 'https://lh6.googleusercontent.com/-RFEYzrRMuQ4/AAAAAAAAAAI/AAAAAAAAB_Y/mMpIPTuUfEo/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'They are price gouging. I left there and went to sacred spirit at 10500 South Inglewood Avenue Inglewood CA 90304. I got the exact same marijuana for $40 less and the people are greatI tried to call and find out if they had a certain type. They told me there were not a lot of talk about their product over the phone. After calling for other places and had no problem with them explaining or giving me information on their products. I am from Atlanta Georgia and it is illegal to purchase marijuana. I can get the same exact stuff for half the price. I\'m going to other dispensary says in LA and paid half the price. These people are price gouging and taken advantage', 1526070398),
(468, 100, 'Julius Thomas', 'https://www.google.com/maps/contrib/111940165407511343033/reviews', 'en', 'https://lh5.googleusercontent.com/-6WCwADCX6o0/AAAAAAAAAAI/AAAAAAAAAIg/GAcTxQ9n-lI/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 weeks ago', 'Do not buy flowers or concentrates here. VERY expensive compared to other dispensaries in the area. Somewhat understandable due to the fact it\'s a mile from LAX. If you just want to uber out and grab some souvenirs - they do have a nice, fairly-priced variety of edibles ($20/100mg). Quality of the rest is good, but you can find the same stuff for less a couple miles away.', 1525924259),
(469, 100, 'Cam Walton', 'https://www.google.com/maps/contrib/105701768954597558902/reviews', 'en', 'https://lh6.googleusercontent.com/-jFGghUcZqMM/AAAAAAAAAAI/AAAAAAAATdc/NnGlNnMGEYA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'This place is small inside but great. I had a great experience even down to the super friendly security guard at the entrance. That guy is AWESOME and I wish he was one of the budtenders. Not that the actual staff wasn\'t nice but he was the highlight of both my visits. They have a solid selection of quality items I can expect to see at larger dispensaries and have knowledgeable staff.', 1524130274),
(470, 100, 'Jessica Jeanes', 'https://www.google.com/maps/contrib/114494673557199887131/reviews', 'en', 'https://lh6.googleusercontent.com/-BjPMqVFgy60/AAAAAAAAAAI/AAAAAAAAFss/JT0DZnBCnbI/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a month ago', 'I love this place. The staff is nice and helpful. The security staff are all nice and polite and still do their job. And the bud is pretty good if a bit on the pricy side. Altogether a pretty cool place.', 1524703547),
(471, 100, 'Ashley Taylor', 'https://www.google.com/maps/contrib/103336891757456164829/reviews', 'en', 'https://lh6.googleusercontent.com/-wWVCZhI3GSY/AAAAAAAAAAI/AAAAAAAAANM/9L5femTe0kk/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 3, 'a month ago', 'Weed was decent. But they need to stop using pocket scales and get legitimate ones. Especially considering taxes on an eighth come out to 20+ the cost of weed. And the line situation needs fixed. Put a line of tape on the ground that says line starts here because they can\'t really pay well enough attention to who cuts in line.', 1523038844),
(472, 101, 'RAYNA RODRIGUEZ', 'https://www.google.com/maps/contrib/102646729765523477163/reviews', 'en', 'https://lh5.googleusercontent.com/-PWuWmK_IRDU/AAAAAAAAAAI/AAAAAAAAUIA/3WwcdchtmBg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 weeks ago', 'First time here. I brought my husband and we bought a couple different bottles of cbd spray. We loved it. We will be back. Prices were great. Great professional staff.', 1525495011),
(473, 101, 'Edna Chicken', 'https://www.google.com/maps/contrib/107243159005638818916/reviews', 'en', 'https://lh4.googleusercontent.com/-Ag3gvQfqna4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1llJxFfgkoeqj2z53DYYXX1rNnPQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a week ago', 'Friendly and knowledgeable staff. Serious and professional - not a frat house atmosphere. Prices ok, variety of items amazing. All pre-weighed and packaged. \n\nMy only reason for 4 stars instead of 5: I would like to see all the available flowers displayed instead of the current model of peeking inside small wrapped packages. I like large clear jars for easy viewing. Also the waiting room and subsequent shouting for next is clumsy and awkward, but forgiven because they have dog treats for your puppers.', 1526653721),
(474, 101, 'Jose Ruiz', 'https://www.google.com/maps/contrib/113592505641057869249/reviews', 'en', 'https://lh4.googleusercontent.com/-YkOS0IIG86Y/AAAAAAAAAAI/AAAAAAAAF4A/L2UClXuqZmU/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Such amazing customer service i felt really good how they treated me so nicely id say this is the best dispo ive gone to great selections and not only that theyre really knowledgeable and i worked at a big one so i know somewhat of good standards', 1524794077),
(475, 101, 'Billie Jean Young', 'https://www.google.com/maps/contrib/111191015369277789580/reviews', 'en', 'https://lh4.googleusercontent.com/-F4Ivg1Qgp7s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1M1CYtS5HZCcZYdziZTcPid8rKDw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'I feel ripped off. After telling them I only like to smoke indica they sold me a sativa plant the next day I brought it back and was told that won\'t take it back so I\'m screwed out of 24 dollers. I will never go back neither will any of my friends or family, their weed is also say over priced as well.', 1523672694),
(476, 101, 'Douglas Vincent', 'https://www.google.com/maps/contrib/112436270108352741533/reviews', 'en', 'https://lh3.googleusercontent.com/-6zqUp75Cbxw/AAAAAAAAAAI/AAAAAAAADKU/Nm6HkSlfFZ8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Great business very nice attitude lots of information it was really great dealing with these folks it\'s a wonderful business', 1527038375),
(477, 102, 'Shelly Auble', 'https://www.google.com/maps/contrib/104073189150241902436/reviews', 'en', 'https://lh5.googleusercontent.com/-vqAqGjZXACI/AAAAAAAAAAI/AAAAAAAAAig/W2pa7R8UU-E/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Aubree was great. Lots of variety here. Good prices. $20 grams of crumbles!\n\n2nd review: All friendly staff here!! No body tries to BS me here. This is my go to store now. I\'ve visited over 10 stores and this one has best quality/service/variety/prices combo I have encountered. Always a pleasure. Sometimes a little wait but that is going to happen almost anywhere now and then. Worth it here! I drive 4o min because it\'s the best.', 1520403425),
(478, 102, 'Richard Warg', 'https://www.google.com/maps/contrib/108887889494416366955/reviews', 'en', 'https://lh6.googleusercontent.com/-9DFqB3dhWJE/AAAAAAAAAAI/AAAAAAAAPzY/uMeZz13ATi8/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 weeks ago', 'Very helpful staff. As a 78 year old novice I was gratified by their patience and courtesy. Nice product too.', 1525487791),
(479, 102, 'Derek Levasseur', 'https://www.google.com/maps/contrib/110528074332288070248/reviews', 'en', 'https://lh5.googleusercontent.com/-dSWMOhBqujE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3NfhndHgeghWliO5OtxQcpt_DfUw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Real nice staff great product even there lower shelf tree is good. Prices are fair. The only thing that is kinda an inconvenience is the wait, cause it\'s such a great place everyone goes there.  I will be in this am', 1522165575),
(480, 102, 'C\' Southern Hospitality', 'https://www.google.com/maps/contrib/118103954544558482403/reviews', 'en', 'https://lh3.googleusercontent.com/-T_Un0XuRVA4/AAAAAAAAAAI/AAAAAAAAANs/8Tnr-pKnu0A/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a month ago', 'I.D & bag? If ya already have one to save yourselves a $1 Something bag isn\'t over $1.50. They accept cards to pay at this location & have atm machine. Fast service, great staff, cool prices, with great selections. Check em out corner of C street & 13th. Great deals n specials on Friday 20th, Happy Hour Deals look em up', 1523949285),
(481, 102, 'Kevin Bradford', 'https://www.google.com/maps/contrib/109019188579873944183/reviews', 'en', 'https://lh3.googleusercontent.com/-jk-G2-EDWGI/AAAAAAAAAAI/AAAAAAAAADg/bHV0H1HpMg4/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '3 weeks ago', 'Excellent service from security and staff. Fare pricing with great flowers and oils.', 1525620531),
(482, 103, 'Sarah Beebe', 'https://www.google.com/maps/contrib/108819117949636499929/reviews', 'en', 'https://lh4.googleusercontent.com/--OF6prTfmI0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0iqIr1n8pBniZ5U88hGbojEdv1jQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Very friendly and knowledgeable personal shoppers. Lovely selection. Worth visiting!\n\nEdit: I should add, Sam was awesome. She knows the business well. Also, the humorous Latino security guard was a true plus...', 1523934721),
(483, 103, 'Mike Fuller', 'https://www.google.com/maps/contrib/100262508315052614249/reviews', 'en', 'https://lh4.googleusercontent.com/-8fUPhopi24Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2ylUjoqz_A273Higfdwte9s5d0IQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Worst managers and bud tendors \nMy girl can’t speak English. \nGave her a note that said best quality. \n\nThey sold her some shake!\nWe went back in there and they haggled us for an hour and offered no compensation. \n\nSo unsatisfied. On 420. Hour in the sun in line. Hour haggling for service. And told that we are taking up their time they won’t offer any compensation and because we took up their time we are black balled. \n\nThey could of just discounted us for some top quality for selling us a whack bag of shake. \n\nBlack balled for being an unhappy customer. \nBlack balled for being ripped off. \n\nCame for quality, wanted to pay for the best and got the worst. \n\nWorst service worst management. \nFirst and last time ever going to this dump. \n\nEspecially if your Spanish speaking avoid these crooks. They don’t care.', 1524274318),
(484, 103, 'Mike Murray', 'https://www.google.com/maps/contrib/105424206176189451271/reviews', 'en', 'https://lh3.googleusercontent.com/-zzNqdOgHXx4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2ZaSPPRtAmlKk-065jqBZ1foYGcQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Best place in town. Staff was very friendly and the prices were very competitive. Good security and a nice waiting room. Very well organized with friendly and knowledgeable salespeople. I will keep coming back here.', 1524008784),
(485, 103, 'nojohnnyno', 'https://www.google.com/maps/contrib/102715004994472170435/reviews', 'en', 'https://lh4.googleusercontent.com/-CGe-z9lDATU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1-9yzfqTqdI0_ezFH3JDTGbX5fBw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'Lost $80 dollars to a defective vape pen that they refused to return because it’s been over a month. I just opened it two days ago and it is not useable. They didn’t care.  I am a patient, they told me to contact the manufacturer.  It’s sad that they treated me like a number instead of a patient.  I lost $80 to them, they have lost my business and the business of everyone I tell. BTW. There are\nMuch cheaper collectives in San Diego\nThat really\nCare\nAbout their patients like Pacific Greens. May I suggest checking them out!!', 1527187197),
(486, 103, 'Michael Castro', 'https://www.google.com/maps/contrib/103770485979414543033/reviews', 'en', 'https://lh3.googleusercontent.com/-LHGavPApVMo/AAAAAAAAAAI/AAAAAAAAALQ/7J4FWVUno-8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great service, this was my first time there. I went on a Sunday night and it was so busy the line was outside! It took about 40 minutes to get in but once in the sales associate was awesome. It\'s so nice to get that personalized service.  Once I was in I was out in 10 minutes.', 1521057830),
(487, 104, 'Alias McCoy', 'https://www.google.com/maps/contrib/112101882921388906513/reviews', 'en', 'https://lh5.googleusercontent.com/-WPq5C6jhTfU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3WYfDrumrZQRN-PaFS1v2P2-bOtA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 2, 'in the last week', 'Why are over a dozen people forced to wait in line for half an hour on Friday morning for one of the two available cashiers?  I noticed five personnel doing other things while customers were waiting.\n\nThis seems to be a product of the same mentality that presents tip jars.  As an incredibly lucrative cannabis dispensary, you can afford both enough workers to meet customer demand expediently, and to pay those workers a living wage.', 1527271797),
(488, 104, 'Karen Schuppert', 'https://www.google.com/maps/contrib/109890443049625259273/reviews', 'en', 'https://lh3.googleusercontent.com/-Fih-ut4nrWk/AAAAAAAAAAI/AAAAAAAAAEM/W7Fwkbdu_MU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The BEST most extensive collection of products I’ve ever seen. Bud tenders have all been great, too.', 1524199272),
(489, 104, 'John Bailey', 'https://www.google.com/maps/contrib/118053019335461804627/reviews', 'en', 'https://lh4.googleusercontent.com/-dWUK6uvKHqc/AAAAAAAAAAI/AAAAAAAAEnU/qRwXljmID14/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Been going here about 3 mos, always excellent selection of flower, people are friendly and knowledgeable. I recommend checking them out.', 1524054136),
(490, 104, 'Alli Cassidy', 'https://www.google.com/maps/contrib/106719249204427694934/reviews', 'en', 'https://lh4.googleusercontent.com/-ITttz1Ft588/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2dPyDTfyJNyf7JdOQd2wlv8evu2Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '2 months ago', 'One of the men working the counter was so rude and snappy  to me i stopped looking for more product to buy And left.  I have only been back 2x since. That was out of desperation.  I was going at least 2-3x a week for dabbin product and not the cheap stuff,  before it was considered to be recreational. How are you rude at the medical marijuana store dude? ', 1521002890),
(491, 104, 'Steve Long', 'https://www.google.com/maps/contrib/100226143821330449877/reviews', 'en', 'https://lh6.googleusercontent.com/-rWs17ABmLKM/AAAAAAAAAAI/AAAAAAAAAE8/3_IUELX4McU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Great Place! Quick! Super Kind Staff!! Never Have Felt Rushed! Patient, Knowledgeable, and Always Helpful! Great Security Staff. They are Professional, Helpful, and Friendly! I\'ve Always Felt Safe Here! Almost Any Product Available! Very Well Laid Out, Nice Display of Products, Clean, and Well Stocked. Thank You To All The Great People That Work Here!  My Back, Anxiety and Depression have been So Much Easier to Deal With!. The Staff, Owners, and Awesome Bud Tender\'s (Truly) are Knowledgeable and Always Go the Extra Mile To Help. They Are All Very Very Laid Back, and Friendly, and I Will Always Recomend This Great Place.', 1516588531),
(492, 105, 'Andrew Le', 'https://www.google.com/maps/contrib/107580802341314153814/reviews', 'en', 'https://lh4.googleusercontent.com/-ulYvU23FQSo/AAAAAAAAAAI/AAAAAAAAUGw/5G5jNUvWCzQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Very classy with a lounge where you can try it out in the dispensary. Good atmosphere and great service. They are very professional in their execution for a lounge dispensary. Highly recommend you bring good friends there to have an experience.', 1525975670),
(493, 105, 'Lainey', 'https://www.google.com/maps/contrib/109453740073376309416/reviews', 'en', 'https://lh6.googleusercontent.com/-sv3C-WULZC0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0YwpwtRcOb306fnCmmmCkkQEEC9w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I visited CA for a week from Connecticut, and wanted to check out this dispensary. It was my first time visiting one, and the guy who helped me out was so incredibly friendly and sweet (forgot his name, sorry)! I bought a pen and a pre-roll. I returned a couple days later, for some oils and the female was also friendly. Great menu, very friendly staff, clean modern place. If I\'m ever back in the area, you bet I\'ll be back at this place!', 1523727573),
(494, 105, 'The Dude', 'https://www.google.com/maps/contrib/113006765457839020525/reviews', 'en', 'https://lh6.googleusercontent.com/-el1b_4YJm9A/AAAAAAAAAAI/AAAAAAAAABc/loAddcw4Z3c/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '2 months ago', 'Love this place!!!!\nBeen to dispensaries all over the state and Vegas too,  but this is the best place I\'ve seen anywhere.  Great selection and service, prices can be high but they\'ve got specials for those looking for a deal.  The smoking lounge is so cool. Can be busy so call ahead to reserve a table.', 1519939314),
(495, 105, 'Matthew Lawson', 'https://www.google.com/maps/contrib/100317436767238749951/reviews', 'en', 'https://lh4.googleusercontent.com/-DyMvtZlwIuE/AAAAAAAAAAI/AAAAAAAAD6g/kfkSyf1pFh0/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'in the last week', 'Fantastic Amsterdam-style cannabis lounge next door to the dispensary. Great experience and a cool atmosphere. Will definitely be back!', 1527395324),
(496, 105, 'Boss Lady Tarot', 'https://www.google.com/maps/contrib/103528879647295394993/reviews', 'en', 'https://lh5.googleusercontent.com/-vnMiemz8FIs/AAAAAAAAAAI/AAAAAAAAAmM/3JkJOsjKwHs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'One of the first places I stopped during my recent trip to SF. Scored 10 cookies for $25.00 with 10mg each. Wohoo! Definitely the highlight of my trip. Friendly staff. Unpretentious setting.', 1525475053),
(497, 106, 'Rae burke', 'https://www.google.com/maps/contrib/107543937805646114207/reviews', 'en', 'https://lh6.googleusercontent.com/-fhS1FRGb4yo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3hdxD8yZeUt0nKSfHhXnRd78ddCw/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a month ago', 'This was a very unique experience because I\'d never ever gotten a bag, receipt, or a tax for my bud before I came to this place. The asthetics were really nice for a place so far south. I\'m used to products and shelves, not real decor in this neck of the woods.The buds i got were prepackaged, which sucked, although I loved the packaging itself. They also gave me a ugly metallic looking bag that they told me I had to bring back every time. I lost the bag, otherwise I would have returned by now.', 1523721459),
(498, 106, 'Dale Chambers', 'https://www.google.com/maps/contrib/107113827407397258152/reviews', 'en', 'https://lh6.googleusercontent.com/-VJc9_ma96m0/AAAAAAAAAAI/AAAAAAAAAJI/xwYZIv2jVyE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'I have been to several of these legal dispensaries and this is the nicest one I have been to. Very polite staff. Nice appearance. Easy to understand menu. Good selection of accessories.  And for me it\'s an ideal location.', 1522089410),
(499, 106, 'Amanda Bailey', 'https://www.google.com/maps/contrib/116773349568363864791/reviews', 'en', 'https://lh5.googleusercontent.com/-VWFIr1PVm0s/AAAAAAAAAAI/AAAAAAAAVac/lUo0ufDALjg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, '4 weeks ago', 'Great place to take newbies, very nice inside. Parking isn\'t the best during peak times. A little more expensive than my normal place, but you can see why once you\'re there.', 1525200864),
(500, 106, 'Alisha Felipe', 'https://www.google.com/maps/contrib/100423616738140583951/reviews', 'en', 'https://lh5.googleusercontent.com/-uOVcsEPvFoI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq28dvBYzpfg2u9xJwBK7jUe5YOWvA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'dont buy!!!!! bought this from southwest this weekend.. the next day my battery is dead .... they dont want to give me no money back and tell me to contact stick e vape...by my self and there selling stick e vape with a dead battery ..... waste of money 38.50 plus taxess and a full pin left... will never come back again.... selling broken items... lol and if its your first time there you get a cup ... and a key chain... wow ...  i had my medical card since 2004 and have never ever saw this or this happen to me ...... rip off', 1527026903),
(501, 106, 'Donovan Keme', 'https://www.google.com/maps/contrib/111041709903479734959/reviews', 'en', 'https://lh4.googleusercontent.com/-IZCgWdMpENY/AAAAAAAAAAI/AAAAAAAAUc0/8_1fIG16WhU/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 months ago', 'Best dispensary experience in San Diego County by far. Phenomenal environment and awesome people and overall vibe. Worth the drive, but delivery from Left Coast Collective ( division of Southwest ) sets the bar for quality of products and speed of service.', 1518308861),
(502, 107, 'Trudi Solis', 'https://www.google.com/maps/contrib/108669120157310029374/reviews', 'en', 'https://lh4.googleusercontent.com/-oLezSKLPllc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ZgepuxcROZtcY-04ZozWYd73MqA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'Cloud 9 is a great place to go for your needs! The budtenders are courteous, helpful and knowable. I drive across town to go there because they carry the cartridges that I prefer andat a great price.', 1525546971),
(503, 107, 'Smokeuh Jay', 'https://www.google.com/maps/contrib/116079451995243861241/reviews', 'en', 'https://lh6.googleusercontent.com/-58Qo53xXbFE/AAAAAAAAAAI/AAAAAAAAAI8/Jjdg2aD9UkM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Walked in and asked for some cartridges asked for the strongest one dude recommended paper planes and i am gooooooooooooone defenitley recommended! Great  place! Thank you!', 1527046178),
(504, 107, 'Clar Rohde', 'https://www.google.com/maps/contrib/103038377863574214480/reviews', 'en', 'https://lh5.googleusercontent.com/-8WYQNtmTI48/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0rQAGVRX9pjJa83beQ0evzA6dpcQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'love the staff. always helpful.  been going there for years. good flower and products. thanks you guys and gals.', 1515044109),
(505, 107, 'Stephanie Baca', 'https://www.google.com/maps/contrib/114129565713266927949/reviews', 'en', 'https://lh3.googleusercontent.com/-L2gxmPlEFQg/AAAAAAAAAAI/AAAAAAAAAF8/C1HgwK-SbSY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This is a great place to go!! Staff is really friendly here!! I won\'t go anywhere else!!', 1521864723),
(506, 107, 'River Rothacker', 'https://www.google.com/maps/contrib/102252521240014611609/reviews', 'en', 'https://lh3.googleusercontent.com/-2pqmu8Vipbw/AAAAAAAAAAI/AAAAAAAAAlg/h_qAPOUfwp0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Amazing staff that really helped me find the best product for my anxiety! I will definitely be coming back.', 1519937133),
(507, 108, 'Grant Mueller', 'https://www.google.com/maps/contrib/112877386127148450826/reviews', 'en', 'https://lh3.googleusercontent.com/-RmAwAxkZY3g/AAAAAAAAAAI/AAAAAAAAAU4/G2mQ13wVc-s/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'prices are great, especially compared to nearby orange county dispensaries. the owner is really awesome and she answered all of our questions (we had someone new to legal dispensaries with us). \n\ntheir house brand is top flight, which is run by the owner\'s husband, and is very reasonably priced and of good quality. $28 for a half gram of 92% thc vape oil kicks ass imo.\n\nglad to see the recreational marijuana industry bringing some life back to dhs and this once-abandoned shopping center in particular.', 1525383977),
(508, 108, 'Sue Swafford', 'https://www.google.com/maps/contrib/115766718104246062286/reviews', 'en', 'https://lh4.googleusercontent.com/-KB8MKa0IQtU/AAAAAAAAAAI/AAAAAAAABF4/M5C_bazecwU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Just like the other reviewers said...Shane was really nice and guided me through the process.  They have a nice selection and run a nice family business.  I was only interested in one thing, but will peruse their other selections at a later date.  Several things sounded interesting.  Within minutes, my arthritic hands felt better.', 1508990511),
(509, 108, 'Jacinda Bjork', 'https://www.google.com/maps/contrib/113413504823454778659/reviews', 'en', 'https://lh4.googleusercontent.com/-7155SiTrlBQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2hcgnPcgKhOCDl25jgb8eb2Y0DzA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'What an awesome place....staff was super friendly and KNOWLEDGABLE!!!! Prices were fantastic and they go that extra bit...super kudos to Alex for helping with all of my questions!!!!', 1516647704),
(510, 108, 'Margaret Burton', 'https://www.google.com/maps/contrib/107278762827063817330/reviews', 'en', 'https://lh6.googleusercontent.com/-qGRJjTQEis4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1uf3WUK1nCXa2wN8uDXdTqvkZDjw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'The Green Pearl Organics store has been so nice to work with.  Nicole and Shane are really wonderful.  They are easy to talk with and very helpful.   I get K9 edibles for my dogs and they have made such a difference  .  I give the Green Pearl Organics a 5 star +  .. I will do business with them for a long time.', 1501450015),
(511, 108, 'NoNo Zand', 'https://www.google.com/maps/contrib/110534037733221481478/reviews', 'en', 'https://lh3.googleusercontent.com/-J8HirOmR0SM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2LL62vixNoapaP2bN3naTOQo5yZQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'I was referred by my friend Ivan. They have lab tested products. Very good place ', 1512351636),
(512, 109, 'Kelly Kasch', 'https://www.google.com/maps/contrib/118363199667157322731/reviews', 'en', 'https://lh3.googleusercontent.com/-xOCPpqLCelY/AAAAAAAAAAI/AAAAAAAAGRI/vSUJdla_DBo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'The ladies were super nice & helpful. Pointed me to some local bud I\'m excited to try! Very cool, low-key shop. *Tried the product... smoothest I\'ve ever had. Thank you!!', 1521566821),
(513, 109, 'Laura Muzzy', 'https://www.google.com/maps/contrib/101013421856858875068/reviews', 'en', 'https://lh4.googleusercontent.com/-ix1gcREe5lM/AAAAAAAAAAI/AAAAAAAAAIA/bHASrS7aSDE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I don\'t make it out to the coast much, but remember exceptional service and good prices when I visited this joint a year or two ago.  I\'m sure they\'ve still got it ;) would recommend and hope to visit again!', 1523894172),
(514, 109, 'Kurt Kugel', 'https://www.google.com/maps/contrib/107125551879894299789/reviews', 'en', 'https://lh4.googleusercontent.com/-SwlpEJoH56E/AAAAAAAAAAI/AAAAAAAAAGA/q0aerkAjC60/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Not sure where these negative reviews are coming from. Upon my first visit here the staff were exceedingly friendly and knowledgeable, treated me like an old friend. For a relatively small shop their selection is superb and prices are lower than other local options.', 1514681003),
(515, 109, 'Daniel Zeitler', 'https://www.google.com/maps/contrib/111930489081306484741/reviews', 'en', 'https://lh3.googleusercontent.com/-oip7HPZSIG8/AAAAAAAAAAI/AAAAAAAAFOQ/3sATa1RemjY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Amazing staff. Great selection. Good prices. Couldn\'t ask for more', 1513639003),
(516, 109, 'David Munger', 'https://www.google.com/maps/contrib/109514721469831679734/reviews', 'en', 'https://lh3.googleusercontent.com/-zMmr11xkro4/AAAAAAAAAAI/AAAAAAAAADE/IoLkfqsIsa0/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'I will drive 100 miles out of my way to come here over my local shop. Great people, Great products, Great prices!', 1524243035),
(517, 110, 'Bob Fletcher', 'https://www.google.com/maps/contrib/100420326735591705219/reviews', 'en', 'https://lh5.googleusercontent.com/-x0UhdPKzbjc/AAAAAAAAAAI/AAAAAAAAABI/zmvrtT-hjBE/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a month ago', 'Been here three times. The first two times went smoothly and was very satisfied. The third time however after getting home and opening up the container it was obviously short of 3.5g. After seeing some other reviews on here the owners might want to keep an eye on how their employees are conducting their business as this doesn\'t seem to be an isolated incident. I\'ll be back because I don\'t believe one bad experience should lose my business and I do enjoy their stains, just frustrating spending 40+ dollars and not getting the full product.', 1523129160),
(518, 110, 'Yusuf Jimenez', 'https://www.google.com/maps/contrib/110666239056549427923/reviews', 'en', 'https://lh6.googleusercontent.com/-ukdWvuMPFUk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0rKRVx9PyWsMhVBJbRCoauhtOWyw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'Crappy selection, stems, ridiculously priced, fat, lazy, rude security, Manager/owner is a punk, for banned me for talking to another customer about what had just happened to me. The manager just stood there ear hustling my conversation and didn\'t even have the nerve to come up to me. I had to walk up to him and asked him \"Is there a problem?\" When told the problem he immediately started to be rude to me, and 86\'d  me. That\'s funny when I found 2 better clubs, better pricing, better product, and show Respect. Let this place go down, stop buying from them so some one else will come in.', 1526239904),
(519, 110, 'John Smith', 'https://www.google.com/maps/contrib/111114149326736125261/reviews', 'en', 'https://lh3.googleusercontent.com/-fyX-x3s3sWA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1NOtJGHTmvw9fjjpVrf1Qjqvg42Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Bottom line if you end up having a return issue like we had...management is not equipped with logic or the ability to care if they sold you something that does not work the way the manufacturer intended.  So beware shopping here...i know after my experience with management i will no longer be going to them plus CC101 is right around the corner they have more parking spaces, better prices, better strains and if they sell you something that\'s broke they actually remedy you with a replacement instead of insulting you with excuses.', 1521310749),
(520, 110, 'Taleah Davis', 'https://www.google.com/maps/contrib/112720867236167858871/reviews', 'en', 'https://lh5.googleusercontent.com/-2ZZE37gljnU/AAAAAAAAAAI/AAAAAAAACn8/4hrdNWUbyPY/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Husband baught something and it almsot killed me. They have no return policy so it\'s my fault for being allergic. I come in and spend well over 100 dollars a month and they can\'t make a 20 dollar return one time since the store opened.', 1523664730),
(521, 110, 'Zachary Bliss', 'https://www.google.com/maps/contrib/116289779255315077656/reviews', 'en', 'https://lh6.googleusercontent.com/-7_5HmPOjRVM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1qJlgGOo5PR1p6Nfzhi2JMgbcc-Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great experience! Shout out to Richard for great customer service!!', 1524443013),
(522, 111, 'Joe Carrow', 'https://www.google.com/maps/contrib/109917479351028189342/reviews', 'en', 'https://lh5.googleusercontent.com/-vVwxlY9Rtfc/AAAAAAAAAAI/AAAAAAAAACk/XNoUNb4zrd4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I Recommend This Website.', 1520411607),
(523, 111, 'Chuck Audio', 'https://www.google.com/maps/contrib/115474151287854683624/reviews', 'en', 'https://lh3.googleusercontent.com/-sOXrHPqeO5Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3WmbXciveRIOj17B3K59H4c0rbpQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', '', 1506660493),
(524, 111, 'Larissa Hunter', 'https://www.google.com/maps/contrib/105098919152138668100/reviews', 'en', 'https://lh5.googleusercontent.com/-pmPIqkbIvrQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0sgaToiUYplM7T3-jxoiLNzJ0keg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', '', 1451672097),
(525, 112, 'Jasmin Mieles', 'https://www.google.com/maps/contrib/104761324722821840724/reviews', 'en', 'https://lh4.googleusercontent.com/-NGyHOd-Ow8w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0QgaTMWs8GUfMV7gmP5U5EuZ-dPQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I love that they have several new locations central to all that I do and live. This facility is super helpful, honest and very welcoming. I was in a car accident some years ago and I am very thankful that the process of obtaining my renewal card is simple and painless. Clean facility, abundant parking available, super affordable, and all around chill experience - usually going to the doctor sucks but this is not the case here This clinic has been my go to for a few years now. Justin even remembered me and was quite helpful. I also love how central it is to both work and home. Both the doctor and the front desk are extremely helpful and I didn\'t have to wait long at all. The doctor also recommended some exercises I could do for my knee and to meditate as well! Where does one ever get that!? I always recommend this clinic to people I know. They even have an option to renew online. Pretty cool', 1517965496),
(526, 112, 'Dom Ri', 'https://www.google.com/maps/contrib/108934904308312512450/reviews', 'en', 'https://lh3.googleusercontent.com/-1K_piIv0Gi8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1fgVW5eM5OiKYkaTKdqh_sOXOgOQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I had a great experience. I was able to walk in and immediately I was assisted with my renewal. It was a very nice and clean facility. The Doctor had an amazing personality and was very helpful. I will definitely return in the future and greatly recommend this facility.', 1523562263),
(527, 112, 'joa tomato', 'https://www.google.com/maps/contrib/102694607066679611928/reviews', 'en', 'https://lh3.googleusercontent.com/-26uf0ruZ-0Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1h7AZ8kDQibbVHA-0Eq1UudAP9qQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Gabriel was amazing!!! The atmosphere was friendly and he was super nice. The best experience I\'ve had so far renewing my rec and I was super surprised by their rates, 10/10. Please go here if you already haven\'t.', 1517455545),
(528, 112, 'Steven Grossmann', 'https://www.google.com/maps/contrib/109670875307791780462/reviews', 'en', 'https://lh5.googleusercontent.com/-IPdSPTPLwWY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2yow4GIu0XEvXCExlT_zKaSBSt2Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Excellent clinic with a very informative, helpful Doctor. Gabial wa polite and understanding in the waiting room. Great place.', 1517375471),
(529, 112, 'Darío Cassano', 'https://www.google.com/maps/contrib/100179946160329176612/reviews', 'en', 'https://lh3.googleusercontent.com/-2DdEabCbA7E/AAAAAAAAAAI/AAAAAAAAAIA/JLFzCyfap5Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Fantastic facility!! Very friendly and professional. They truly make the whole experience easy and wonderful! Wish there were more business like them!! Strongly recommend it!!', 1513031298),
(530, 113, 'Jasmin Mieles', 'https://www.google.com/maps/contrib/104761324722821840724/reviews', 'en', 'https://lh4.googleusercontent.com/-NGyHOd-Ow8w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0QgaTMWs8GUfMV7gmP5U5EuZ-dPQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I love that they have several new locations central to all that I do and live. This facility is super helpful, honest and very welcoming. I was in a car accident some years ago and I am very thankful that the process of obtaining my renewal card is simple and painless. Clean facility, abundant parking available, super affordable, and all around chill experience - usually going to the doctor sucks but this is not the case here This clinic has been my go to for a few years now. Justin even remembered me and was quite helpful. I also love how central it is to both work and home. Both the doctor and the front desk are extremely helpful and I didn\'t have to wait long at all. The doctor also recommended some exercises I could do for my knee and to meditate as well! Where does one ever get that!? I always recommend this clinic to people I know. They even have an option to renew online. Pretty cool.. how lucky to live in the state of California and to have this “luxury” to better ourselves. I am forever grateful.', 1517965602),
(531, 113, 'Mark The Shark Hurd', 'https://www.google.com/maps/contrib/103648298939497512037/reviews', 'en', 'https://lh5.googleusercontent.com/-y5pf3wj2v2I/AAAAAAAAAAI/AAAAAAAABmk/GKloqwcWpfU/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'I\'ve been going to this doctor for several years now is been the best and easiest way to get a medical marijuana card fast inexpensive dr. Darcy does an amazing job and he\'s got clinics all over California.\n They give you discounts for good reviews on Google maps & also on weed maps/ $5 off next visit. You\'re an existing patient you get a discount also.\n️️ they are the best.\nThank you Doctor Darcy&staff. ️', 1520109868),
(532, 113, 'Dom Ri', 'https://www.google.com/maps/contrib/108934904308312512450/reviews', 'en', 'https://lh3.googleusercontent.com/-1K_piIv0Gi8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1fgVW5eM5OiKYkaTKdqh_sOXOgOQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I had a great experience. I was able to walk in and immediately I was assisted with my renewal. It was a very nice and clean facility. The Doctor had an amazing personality and was very helpful. I will definitely return in the future and greatly recommend this facility.', 1523562280),
(533, 113, 'Darío Cassano', 'https://www.google.com/maps/contrib/100179946160329176612/reviews', 'en', 'https://lh3.googleusercontent.com/-2DdEabCbA7E/AAAAAAAAAAI/AAAAAAAAAIA/JLFzCyfap5Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Fantastic facility!! Very friendly and professional. They truly make the whole experience easy and wonderful! Wish there were more business like them!! Strongly recommend it!!', 1513031265),
(534, 113, 'Dylan Sklare', 'https://www.google.com/maps/contrib/117091171197002550434/reviews', 'en', 'https://lh4.googleusercontent.com/-huyxLRieF2g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3FvKUiR443gRI7fx6r41ZnvdUwiA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'These guys are great! Whether it\'s a visit to the doctors office, or questions by phone. They\'re extremely helpful and friendly. Definitely recommend!', 1513887010),
(535, 114, 'Cori Jenkins', 'https://www.google.com/maps/contrib/107082117119786748626/reviews', 'en', 'https://lh6.googleusercontent.com/-ZXSam2EoBC8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1wRQJ8bUUq7lymXQYf1kJcP2IIQA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'This place was amazing. I was a first time patient and wasn\'t nervous at all. The receptionist was very sweet and I formative. I would recc omens this place to anyone. Also inexpensive as well.', 1476135666),
(536, 114, 'Kathleen Shannon', 'https://www.google.com/maps/contrib/114634370273387610150/reviews', 'en', 'https://lh5.googleusercontent.com/-C9emf3SlMto/AAAAAAAAAAI/AAAAAAAACZI/iPHI8CBXS1c/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Dr. Darcy is a gifted and caring doctor. I have been a client for 4 years. The Long Beach location at Signal Hill is beautiful and clean and the staff is professional. You receive a medical exam. Best location for clients from Orange County. ', 1469646118),
(537, 114, 'Alejandro Dowling', 'https://www.google.com/maps/contrib/114800926011258631459/reviews', 'en', 'https://lh3.googleusercontent.com/-khhqy-uzdYI/AAAAAAAAAAI/AAAAAAAAADw/iqSi_HLfXrQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Great service. The staff is very friendly and made the process easy and quick. Highly recommended!', 1482187977),
(538, 114, 'Faith Rios', 'https://www.google.com/maps/contrib/115241690324455434019/reviews', 'en', 'https://lh6.googleusercontent.com/-ZXFA6PwFbOI/AAAAAAAAAAI/AAAAAAAAD2c/rar9yWTGjAc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Great costumer service. Most defendant getting it renewed here... great medical doctor ', 1478212277),
(539, 114, 'Gabriel Triviz', 'https://www.google.com/maps/contrib/107658365821237562131/reviews', 'en', 'https://lh4.googleusercontent.com/-Do5f-ewam70/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Dvm4qz7ywhi1k38JEoPnOMDRr6w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'Medical marijuana card doctors in Los Angeles California not a medical marijuana dispensary are usually untrustworthy. You don\'t have to worry about this medical marijuana doctor. The staff is friendly and my medical card worked at all dispensaries in Los Angeles and Hollywood. for any medical marijuana evaluation that is reliable go nowhere else. they moved to a new location at 7033 w sunset blvd temporarily', 1438717197),
(540, 115, 'Grant Willis', 'https://www.google.com/maps/contrib/105085964196592368702/reviews', 'en', 'https://lh4.googleusercontent.com/-vjrBSfH8rTI/AAAAAAAAAAI/AAAAAAAAAHs/d0jrn_mhjO4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'Its a place to get the medical card, so you can buy from a dispensery. Its not guaranteed you will get it as you have to be examined and actually have a reason for it. But the office was not bad or difficult to find. The staff were kind and quick to assist as best they could. I recently took my girlfriend and helped her get her card because of anxiety and depression. Which has been helping her a lot. I still recommend therapy or a regular psychologists. But this helps in her case when those options are not readily available. \n\nAlso to anyone suffering anxiety or depression. There are many people who want to help you and are willing to help you. Do NOT be afraid to seek help, there is no shame in trying to seek treatment for yourself. 40 million Americans suffer from some form of depression. That is 40 million out of 300 million people. You are not alone nor do you need to suffer silently. Getting a card can help, but remember treating the root cause will help you in the long term. That will take some work, but again there are many people who care about you and will help you, you just seek the help and you will find it.\n\nBefore you think it, YES you are worth it. NO, your not a burden, NOR should you ever feel guilty for seeking help!\nDepression and anxiety can be as debilitating as any physical disease. Remember this, what is physical can affect your mental health, and the mental can affect your physical health. Being healthy means, being healthy physically AND mentally. You can achieve balance in both, and there are many ways to do it. This place offers one way. But it\'s certainly not the only way nor should you ONLY use this method. Though if medical weed helps you, call this place. If getting a card could help in throwing off depression or anxiety, then this is a great place to start.', 1524934850),
(541, 115, 'Melvin Cruz', 'https://www.google.com/maps/contrib/116593187588485583034/reviews', 'en', 'https://lh5.googleusercontent.com/-TL6WXPjXago/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1VjK5Qnf8-bk5oGbuPwioCG67wDQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Came here yesterday to get my rec. Dr Gamble was very professional and detailed about strains and using the cannabis. I recommend this place. I will sure comeback for my renewal. ', 1487864490),
(542, 115, 'Summer Page', 'https://www.google.com/maps/contrib/117623984199753113117/reviews', 'en', 'https://lh6.googleusercontent.com/-fGOWqEoV0Eg/AAAAAAAAAAI/AAAAAAAAAC0/Dw-rGjRr7D0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I came here to get my renewal! It was easy and fast. I was out 10 mins. 40 bucks for renewal is not that bad! I will recommend them to friends and relatives!', 1487353172),
(543, 115, 'Eduardo Ceniceros', 'https://www.google.com/maps/contrib/117788748387191493452/reviews', 'en', 'https://lh6.googleusercontent.com/-3JRO8ESj7nM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1IlNnHM-76BVaklVYzcnfqrkjLuw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Not as bad as people say. just know they have different prices for recs depending if you want 3 months 6 or a year. Paid 75 for the year. Rec is official used it shortly after at a new dispensary. They were nice and i got what i wanted. Got in and out in about 15 to 20 min.', 1471214336),
(544, 115, 'james smith', 'https://www.google.com/maps/contrib/106148197360339856301/reviews', 'en', 'https://lh3.googleusercontent.com/-mBtYbqN4VpM/AAAAAAAAAAI/AAAAAAAAAB8/YBhwTuU37fE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Best price evaluation and doctor in Orange County. Come and get your recommendation. Save time and quick process. I was in and out 15 mins.', 1487353427),
(545, 116, 'Jasmin Mieles', 'https://www.google.com/maps/contrib/104761324722821840724/reviews', 'en', 'https://lh4.googleusercontent.com/-NGyHOd-Ow8w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0QgaTMWs8GUfMV7gmP5U5EuZ-dPQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I LOVE HOLLYWOOD EASY CLINIC! \nI started out in the other location some years ago and have been a patient here for as long as I can remember. I highly recommend renewing or becoming a patient here for a number of reasons. Friendly and knowledgeable staff as soon as you walk through the door. I could have made an appointment but forgot- decided to walk in and I was administered right away. Dr Darcy is thorough and asks my history and recommend along with my usage, to meditate and continue my morning exercises. I’m so grateful to live in the state of California and to be able to not be a statistic and live a pretty normal life despite my ailments and this is a part of that. \nConvenient, friendly staff, fair pricing, and competent doctor!', 1517964501),
(546, 116, 'Darío Cassano', 'https://www.google.com/maps/contrib/100179946160329176612/reviews', 'en', 'https://lh3.googleusercontent.com/-2DdEabCbA7E/AAAAAAAAAAI/AAAAAAAAAIA/JLFzCyfap5Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Fantastic facility!! Very friendly and professional. They truly make the whole experience easy and wonderful! Wish there were more business like them!! Strongly recommend it!!', 1513031330),
(547, 116, 'Dylan Sklare', 'https://www.google.com/maps/contrib/117091171197002550434/reviews', 'en', 'https://lh4.googleusercontent.com/-huyxLRieF2g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3FvKUiR443gRI7fx6r41ZnvdUwiA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'One of the best doctors in the SF area. Very convenient, friendly and professional. Definitely recommend.', 1513887695),
(548, 116, 'Jay Max', 'https://www.google.com/maps/contrib/109258832642439566626/reviews', 'en', 'https://lh3.googleusercontent.com/-NUYu9f2blwc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0PBAoHkWVjNO62Z1K70MXCrlplZQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'This place is amazing! Open on weekends, fast service, friendly staff, and even a low price! Can’t beat it anywhere I highly recommend these guys.', 1506817175),
(549, 116, 'Jasmin Mieles', 'https://www.google.com/maps/contrib/106462460311319327417/reviews', 'en', 'https://lh6.googleusercontent.com/-q_NGLvUL4R4/AAAAAAAAAAI/AAAAAAAAB-o/fNCn1DBzKkU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I love that they have several locations central to all that I do and live. These guys are super helpful, honest and very welcoming. I was in a car accident years ago and am very thankful that the process of obtaining my renewal card is simple and painless. Clean facility, abundant parking available, super affordable, and all around chill experience - usually going to the doctor sucks but this is not the case here This clinic has been my go to for a few years now. Joel even remembered me and was quite helpful. I also love how central it is to both work and home. Both the doctor and the front desk are extremely helpful and I didn\'t have to wait long at all. The doctor also recommended some exercises I could do for my knee.. I always  recommend this clinic to people I know. And they also have an online option for renewal as well!! ', 1486686908),
(550, 117, 'David Berry', 'https://www.google.com/maps/contrib/118103578484758149143/reviews', 'en', 'https://lh5.googleusercontent.com/-DacoYrUzdqc/AAAAAAAAAAI/AAAAAAAADvc/nsMjhKIc86Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'A real jerk on the phone. Don\'t waste your time', 1519432254),
(551, 117, 'Jeff Conkling', 'https://www.google.com/maps/contrib/101253017800607094232/reviews', 'en', 'https://lh4.googleusercontent.com/-8nFHTpX0UYY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3elgSLeHtMTUPXOrQj411hwb1YKQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', '', 1525409595),
(552, 117, 'parviz borhanpouri', 'https://www.google.com/maps/contrib/101690991640472092644/reviews', 'en', 'https://lh6.googleusercontent.com/-bmTeFSSv4aQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1jvKScnC41ZOZwUW0QUPTvA5AAzg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', '', 1472274150),
(553, 118, 'Martha Pace', 'https://www.google.com/maps/contrib/112725031008194885199/reviews', 'en', 'https://lh3.googleusercontent.com/-kDswaA2pKUo/AAAAAAAAAAI/AAAAAAAAAp0/7u_nMWcb33g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Extremely friendly front desk staff member greeted me when I came in. He made the entire process easy and comfortable for this newbie. From start to finish, my appointment would’ve taken maybe 15 min tops (had I not been so meticulous on my paperwork!). Overall an amazing experience with all the legal information I needed after.', 1514061522);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(554, 118, 'Jessica Manriquez', 'https://www.google.com/maps/contrib/116172021621683782963/reviews', 'en', 'https://lh3.googleusercontent.com/-UdBQ17C4s4g/AAAAAAAAAAI/AAAAAAAABYo/pJoV_4AzCRg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'I come back here every year, they call me about a month before I\'m about to expire which is super helpful. Best place, super friendly. I\'m a loyal user and I will return year after year. Plus it\'s a fast in and out.', 1513458437),
(555, 118, 'Ashley Craft', 'https://www.google.com/maps/contrib/113155122221028214521/reviews', 'en', 'https://lh6.googleusercontent.com/-DxGqyKNHHRc/AAAAAAAAAAI/AAAAAAAAAMc/hFM6UEsTqE0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Clear facility! Great customer service.  I was in and out quickly.  The doctor and staff are all friendly and knowledgeable.  Highly recommend this location.', 1517620895),
(556, 118, 'Nikki Gainey', 'https://www.google.com/maps/contrib/100869535913001732794/reviews', 'en', 'https://lh3.googleusercontent.com/-NsUCRElKxDM/AAAAAAAAAAI/AAAAAAAAAGk/eNUlwugKE8s/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Very willing to adapt to my schedule for appointments.  Great music playing in the waiting room.  Super informed and helpful front desk attendant.  Quick and efficient visit with a kind doctor.', 1517101387),
(557, 118, 'Rebekah Danks', 'https://www.google.com/maps/contrib/106825073465844514757/reviews', 'en', 'https://lh3.googleusercontent.com/-xrht5pVHD4I/AAAAAAAAAAI/AAAAAAAAADs/WVmtTtJ3pdo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Definitely very professional and courteous. Short wait and friendly staff. Doctors and very informative give additional advice to help alleviate symptoms a patient may have. The gentleman at the desk is very helpful about informing a patent of necessary laws. Thank you!', 1515267866),
(558, 119, 'David Gonzalez', 'https://www.google.com/maps/contrib/107073868135957263520/reviews', 'en', 'https://lh6.googleusercontent.com/-j8leHz2JAcM/AAAAAAAAAAI/AAAAAAAAAEc/hN3-hkeZA0w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Staff is absolutely amazing. They aren\'t here to add $10 to this & an extra $25 to that. Prices are very reasonable, becoming a new patient or just simply renewing is super easy and you feel very comfortable. Definitely didn\'t get paid to add this review, I will for sure be back. Thank you ladies at the front (very knowledgeable) and thank you Doctor.', 1491943528),
(559, 119, 'telleybaby young', 'https://www.google.com/maps/contrib/109688557696832127550/reviews', 'en', 'https://lh5.googleusercontent.com/-P3h03BJciJ8/AAAAAAAAAAI/AAAAAAAAAI8/GK3Mh0EfSvI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Ive been comein here for a wow now and i like the service and the weed really helps me alot it takes the stress and pain away', 1510274828),
(560, 119, 'Edd Lee', 'https://www.google.com/maps/contrib/113604258344052803886/reviews', 'en', 'https://lh3.googleusercontent.com/-TySv1KB_hFg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1S6QvGduN7vBbWOlwFf6O5e60xSw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I’ve been going to this place for the past three years and they are really good fast very good customer service', 1510274516),
(561, 119, 'Morgan Leigh', 'https://www.google.com/maps/contrib/106719056397208779327/reviews', 'en', 'https://lh5.googleusercontent.com/-li3lvyXBdOI/AAAAAAAAAAI/AAAAAAAAByQ/ay7sZvtRQBY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'Excellent customer service.  Will revisit again, had a great experience.', 1504891113),
(562, 119, 'Anapanasati ॐ', 'https://www.google.com/maps/contrib/104987415908644159892/reviews', 'en', 'https://lh4.googleusercontent.com/-qENEPN4Ht-I/AAAAAAAAAAI/AAAAAAAAAoE/26lNn4KXgDA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 2, 'a year ago', 'Pretty sketchy setup. Receptionist never took off her sunglasses. Video doctor was in sweats. Pricing based on a 6 or 12 month card... Really? Never had a doctor charge me based on what prescriptions they were going to write.', 1495119863),
(563, 120, 'L F', 'https://www.google.com/maps/contrib/101642237491619737363/reviews', 'en', 'https://lh5.googleusercontent.com/-W4cBSMYpjmI/AAAAAAAAAAI/AAAAAAAAcVw/sglDUC4c_m0/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '5 months ago', 'I think the guy who cited  this place as a compassionate, professional and clean facility was talking about another facility. The three times I\'ve been here in 3 years, I\'ve witnessed none of that. They take your money and make you wait an absurdly long time. And they get all agro when you mention the ridiculous wait. But they have a corner on the market in the west valley, so that\'s the only reason to go here.', 1512511015),
(564, 120, 'Sean Earl', 'https://www.google.com/maps/contrib/115910932198415885016/reviews', 'en', 'https://lh5.googleusercontent.com/--MF6rbyLAhk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0TccYLiiVFJ_Au6eCpIqioaeMoug/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Been going here for years. I recommend them to all my friends.', 1518800506),
(565, 120, 'Mark Borbas', 'https://www.google.com/maps/contrib/105671143394795762783/reviews', 'en', 'https://lh4.googleusercontent.com/-iVcJSftSP4g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1jT8aSm1lo-acABvDBT0q8XRW1MQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Never had a problem here. Been coming to THC for the last several years and they have always been quick, kind, and courteous.', 1518384633),
(566, 120, 'Ron Meyers', 'https://www.google.com/maps/contrib/104565356036704728171/reviews', 'en', 'https://lh6.googleusercontent.com/-zrI7qmoxhfU/AAAAAAAAAAI/AAAAAAAAAEc/MB0sB9YzQ0A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'Check in guy was rude. It\'s $70 for new patients which I wasn\'t going to pay. I walked out. ', 1492633603),
(567, 120, 'Randy Sherry', 'https://www.google.com/maps/contrib/100148227228811122818/reviews', 'en', 'https://lh3.googleusercontent.com/--CHcLfT9NTQ/AAAAAAAAAAI/AAAAAAAAA-M/lrkv1KJOD6Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 years ago', 'A place of compassion and professionalism is what comes to mind when I look back on the past 2 times ive come in. A clean building, comfortable and with modern equipment and I would absolutely recommend Total Herbal.    ', 1421797821),
(568, 121, 'Michelle Cuevas', 'https://www.google.com/maps/contrib/115572894954330063308/reviews', 'en', 'https://lh6.googleusercontent.com/-v50s7Feh9oM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0g-oF1ZFyLiYMVD37HBYz8OzkJJA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I recently came back to renew my medical recommendation and found out that they have changed their name to EZ Care Clinic. The customer services here is very professional and they accomodated any questions regarding the new changes. I was expecting my visit to be busy and rushed but that was not the case at all! This new clinic definitely stepped up their game!', 1519260457),
(569, 121, 'Hunter Vaughan', 'https://www.google.com/maps/contrib/113522906995460192897/reviews', 'en', 'https://lh4.googleusercontent.com/-xFBKCdNZVFI/AAAAAAAAAAI/AAAAAAAAAJs/DQfwpBabqdY/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'get your medical recomendation online these guys charge 80 to 100 dollars more than anyone else.', 1527206174),
(570, 121, 'Ashmi Singh', 'https://www.google.com/maps/contrib/108974715824573147055/reviews', 'en', 'https://lh5.googleusercontent.com/-8cvKGuajSZU/AAAAAAAAAAI/AAAAAAAABCA/_KpiEvo7oGY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'This was my third time coming through and it went by real fast when I met with the doctor. It was my first time meeting with a woman doctor in medicinal marijuana and it was an amazing experience! Gonna bring my girlfriend back to renew hers, hope we get the same doctor!', 1506369881),
(571, 121, 'Paul Dolmage-Heath', 'https://www.google.com/maps/contrib/118102575128772042783/reviews', 'en', 'https://lh5.googleusercontent.com/--cY3O5xA6us/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2_9Y7KLXcuoQkXifMDTr4i9Ra6Mg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'MMJ Doctor has been my first and only choice whenever I choose to renew my card. I received my first one here and haven\'t looked back since. It has a good system. It\'s quick if you make an appointment and the people are professional and courteous.', 1500264578),
(572, 121, 'Joker420 top', 'https://www.google.com/maps/contrib/103327320204033587647/reviews', 'en', 'https://lh3.googleusercontent.com/-PFvcru5STuY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2_QmR5SshmMSJ39QLmohkxtIBs1A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Great place to get your card. Came here from 2 hours away because it is that great. Happy people and very fast service.', 1503614725),
