(582, 124, 'Buddy Davis', 'https://www.google.com/maps/contrib/115656604463014118515/reviews', 'en', 'https://lh6.googleusercontent.com/-tkQ4mh1lEPc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3qle6z7tJEsUDyZ7Jx8ydTfESdNw/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 3, '4 months ago', 'This location is a bit run-down,  parking can be a challenge, and the day I went the I\'d machine was not working. Plus it\'s a cash-only business, and the ATM on site has a high fee. The desk staff are polite, but the wen discounts posted usually do not prove useful and the renewal rate is higher than other locations. The resident physician changes frequently, some are nice and some are borderline rude.', 1515650754),
(583, 124, 'Jazzlynn Cristian', 'https://www.google.com/maps/contrib/108994177279041291515/reviews', 'en', 'https://lh4.googleusercontent.com/-4E-_oD9nLz0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1y8HVvGB6EJRBd2shmnITWQfpe6A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '9 months ago', 'Worst place ever came here for renewal of my card because of advertisment of $39 for renewal and $49 for new patient.After paitently waiting and being talked to rudely by the women staff i was charged $59. I asked them why wasnt i charged the $39 they told me i needed the printed coupon ignoring the fact that they charged the first two people ahead of me the $39 without coupon!! Waste of time and money to even come hear to deal with thier rude ass', 1503008445),
(584, 125, 'heather labrecque', 'https://www.google.com/maps/contrib/113965991223858083472/reviews', 'en', 'https://lh6.googleusercontent.com/-caGPmHnkCtk/AAAAAAAAAAI/AAAAAAAAA2E/SCXrdXwi3ow/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'The doctors really care. I feel like a patient and am treated like one. Fabulous staff and great at reminding you ahead of time that it\'s time to renew. Highly recommend this doctors office!', 1491498326),
