(593, 127, 'Home Remedy KC', 'https://www.google.com/maps/contrib/101822310949332145686/reviews', 'en', 'https://lh5.googleusercontent.com/-kBe_SgzSqJc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3pgbCU6iURc67OPJEiuoxu-NPSVw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'These people do not communicate well; i was feeling sick and visited the clinic in very bad condition. After reaching i faced the worst behavior. First of all, I had to wait for 2 hours for my checkup because the Doctor was not there in the clinic. When i got my Turn, i was shocked to see that doctor was very rude. He don\'t care that someone is in bad condition. He was talking in loud sound which makes me more uncomfortable. Horrible experience.', 1490209156),
(594, 127, 'David H.', 'https://www.google.com/maps/contrib/115459981279731720827/reviews', 'en', 'https://lh3.googleusercontent.com/-FWGhq9r1K-I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0FBPyin3KTECZwi-D9aferLCEngg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'Reviewing for Dr. and staff. I am appalled by the customer service provided by this office. No calls returned ever. Was lied to in regards to covered services, which turned out not to be covered. Spoke to someone over the phone. I didn\'t know his name.I don\'t think that waiver works that way. I cannot believe such dishonesty!', 1486130895),
