(598, 128, 'Kay M', 'https://www.google.com/maps/contrib/103954128453163106553/reviews', 'en', 'https://lh3.googleusercontent.com/-LJLBjXBKFbg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1zfHIcT1TFxyShBTy7Ea9_jCpCmw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '9 months ago', 'Even with my medical recommendation i was unable to enter because I had my passport not an id.', 1504048867),
(599, 129, 'Dale Fisher', 'https://www.google.com/maps/contrib/104211699093120453548/reviews', 'en', 'https://lh4.googleusercontent.com/-FA0WjWcxiMQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0-FFcZ7IkS6wuR-EN1bnfOO9QUcA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I always enjoy going in there and I am proud to be a member. Every member of the staff has been great. They are really knowledgeable and don\'t mind sharing their knowledge. They have enlightened me on the different methods to enjoy marijuana. The selection is amazing on a daily basis and highly affordable.', 1523833260),
(600, 129, 'Spruce Hoose', 'https://www.google.com/maps/contrib/104104768032797640032/reviews', 'en', 'https://lh6.googleusercontent.com/-OmBME6PCfeU/AAAAAAAAAAI/AAAAAAAAAAs/28KLFY2-dHg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Ive been coming here for over a year now and it keeps getting better. They always have something dank and the prices are pretty ridiculous if you\'re a member.\nMax, one of the employees has been a true help. His knowledge of the product has helped steer me in the right direction many a time. Im truly grateful for this store and its employees.', 1526588730),
(601, 129, 'Decoda Grant', 'https://www.google.com/maps/contrib/117936789729334574880/reviews', 'en', 'https://lh6.googleusercontent.com/-VWSc51ruDtE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1p-ku1AGb2ApK6dLZoEKycB_GI6A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'From the bud tenders to the bud itself, everything in here is perfect. Highly recommend checking them out if you don’t want to waste any time/money.', 1519415557),
(602, 129, 'Alex Castro', 'https://www.google.com/maps/contrib/113557344632105932935/reviews', 'en', 'https://lh5.googleusercontent.com/-n59ygqXG17k/AAAAAAAAAAI/AAAAAAAAAC4/JyP1KI-mXvM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Incredible product, rewards system and staff. This store has got the cream of the crop when it comes to budtenders. They\'re ALL friendly, knowledgeable and professional. They make you feel comfortable and treat you like family all while making sure you get exactly what you need. I recommend Livwell to everyone.', 1514313053),
(603, 129, 'Flores Design', 'https://www.google.com/maps/contrib/110152557055795314285/reviews', 'en', 'https://lh6.googleusercontent.com/-uSSN-RwgzLw/AAAAAAAAAAI/AAAAAAAAs4w/cGrmmh5JM6U/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 4, '7 months ago', 'Not a bad place to get some fire meds! The zips here are super cheap and the bud isn\'t. I walked out of there fully satisfied for what I purchased and my wallet wasn\'t to upset either! The staff is pretty chill but there IS NO Military Discount so that sucks.', 1508953769),
(604, 130, 'Miranda Sanchez', 'https://www.google.com/maps/contrib/112862416797752578484/reviews', 'en', 'https://lh6.googleusercontent.com/-cbfgJZ-9Pp4/AAAAAAAAAAI/AAAAAAAASC4/DedHblAzAtw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Good deal\'s. This place has been around a while so no waiting on flower. Very professional! Open till 7pm. Go see the bud tenders! They are friendly they know the product\'s well. I always get a answer. Not \"umm.. i think so\"  I make a lot of lotions with this flower and it\'s been very good to me. Go see \nMarcus\n Dillon \nAndrew \nMegan \nAlex\nAmy\nAngela', 1525012283),
(605, 130, 'Tony Ackerman', 'https://www.google.com/maps/contrib/113787548481294516841/reviews', 'en', 'https://lh4.googleusercontent.com/-K0TYt1V_B4k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0yMTd4eXJ5d32ksiWoM_Ay_3fUkQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Website said it was recreational and medical. Got there only to find out it was medical. Waste of a drive unless you have a med card.\n\nUpdate: \nSorry I never noticed I received a response. I clearly remember going in thinking it was a recreational location based of the website then being told it was for med cards only. I then got back in my car and looked at the website again where it clearly said recreational and medical. At that moment I left my review. I don\'t know what updates to the website have been made since.', 1521575664),
(606, 130, 'Chris Cox', 'https://www.google.com/maps/contrib/114954471127710274656/reviews', 'en', 'https://lh6.googleusercontent.com/-2TWA6voVbzo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2K0ndy3LgLJBmOjLYAnIq8xrngFw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'I love your A team Amy and the rest of the A team are great I\'ll be a long time customer just because of them. Thank you Amy and team.', 1525053565),
(607, 130, 'Chris Norris', 'https://www.google.com/maps/contrib/118021433823962506343/reviews', 'en', 'https://lh5.googleusercontent.com/-t0PzkD4h8ec/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0dyDmi4R3boqfbLGrxL1WvWK946A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Everyone  has been very help in finding what I need for my ptsd .the prices are very good', 1526912969),
