(609, 131, 'Ashley Hutton', 'https://www.google.com/maps/contrib/100823206027091864703/reviews', 'en', 'https://lh4.googleusercontent.com/-74l-gFlZLM4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1DhPB-wVAv1LI66k5gkPfmfGcDVA/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'a week ago', 'My husband went in tonight for a couple grams of wax. One is fine, nothing to say other than it is good and consistent for us. The other we got for the first time (Mahatma Jane Doe), it is old, smells old, looks old, feels old when broken down and tastes horrid, not to mention the after smoke smell is like burning a year old J... this is the first wax we got like that but have been weary because of bad bud in the past. Not sure we\'ll continue going even though it\'s close.', 1526530644),
(610, 131, 'Duck duck Goose', 'https://www.google.com/maps/contrib/107915388453623879966/reviews', 'en', 'https://lh6.googleusercontent.com/-8wm3GAdAHYQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0OR6SqefyPbduNcUB-f8JAoQAwUA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'I got one of their pre-weigh Oz’s, and it was loaded with seeds. I mean like 50+ seeds. Rappers delight was the strain. They are highly overpriced and seem to have a huge staff change every few months. I’ve found keif colas about half the price that livwell charges and other places seem to have better products for considerably less money.  It stinks because I would love to go there because they are right by my house. The staff is pretty helpful and nice even though the product and prices could be better.', 1520169525),
(611, 131, 'Bill Tassey', 'https://www.google.com/maps/contrib/116730838377700897581/reviews', 'en', 'https://lh5.googleusercontent.com/-tnUtU3Lwo_8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0KaK3ZILts97pCBWQSq-z4q-J4Dw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Right away I need to say that ALL the bud-tenders here are top notch and treat everyone like family!  Tonight, Amy, Liz and Marquell were very helpful and gave me great guidance on cartridges.  Thanks guys!!', 1509499563),
(612, 131, 'T Pierce', 'https://www.google.com/maps/contrib/100852749010699285385/reviews', 'en', 'https://lh5.googleusercontent.com/-Jll7AWS__oA/AAAAAAAAAAI/AAAAAAAAG18/l-xN77lJmnM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '7 months ago', 'Good customer service. Great product. Knowledgeable and informative. They care and strive to help you find relief and the correct medicine for your personal needs.', 1508192140),
(613, 131, 'pam peltier', 'https://www.google.com/maps/contrib/106138981389596084966/reviews', 'en', 'https://lh6.googleusercontent.com/-E8JKJ-gxhcI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1i6LmTfuHEjdJIvEv64dH_M1-BEg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'This is Michael Ellison. I am reviewing the store on Nort Nevada. A professional atmosphere. Amy Mcgurdy is a extremely knowledgeable budtender. Amy has always asked how my M.S. and Rheumatoid Arthritis is doing that day. She will give a rundown on any specials and new products. Amy always has my best interest in mind. She has exceptional knowledge of how the medicine works for the body. I fully trust Amy with my health. I rate her at the highest level. Thanks to Amy, my medical marijuana questions are always answered.', 1512771518),
(614, 132, 'Julie Garner', 'https://www.google.com/maps/contrib/107988615497734189227/reviews', 'en', 'https://lh6.googleusercontent.com/-nca-v75rOZY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3lEF1QofJccj8qxur7Ul5xA32iiw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Strawberry Fields in Colorado Springs is a great facility. The bud tenders are very knowledgeable and helpful. You can\'t beat their prices, and product quality.', 1522332799),
(615, 132, 'Lukis Postier', 'https://www.google.com/maps/contrib/107781356986218796164/reviews', 'en', 'https://lh3.googleusercontent.com/-DLHWbxy6Vbw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq12dylmUvIuqmqpLE71jvyPdbu3ng/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'Went in today and was very upset when they refused to give me my usual monthly deal. I have been a member there for almost a year. I come in once a month and get the same thing for my resigning of MY plants (my monthly membership). Today they refused me my usual deal. When I asked for the Assistant Manager he was too busy for the CUSTOMER! Instead i was informed that they don\'t do that anymore.....First off I have been a member there for a year and I\'m not worth their time. Second, I\'ve been getting the same deal for a year its why I\'m a member there and now its not worth my business or my plants! OUTRAGED I have no choice but to look elsewhere for a new medical dispensary.  Because no business that treats their loyal customers and operates like this should continue to receive mine or anyone else\'s services.', 1518473359),
(616, 132, 'Larry Green', 'https://www.google.com/maps/contrib/111893688691516802255/reviews', 'en', 'https://lh6.googleusercontent.com/-ls_4OJ19xxc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq39cmLD2GcaTCN-cj--mcgzoE-pCA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Excited for the 420 dispensary deals from Strawberry Fields Cannabis. Great product and the best Colorado Springs Dispensary out there!', 1524151536),
(617, 132, 'Shawn Dixon', 'https://www.google.com/maps/contrib/104782782252691421620/reviews', 'en', 'https://lh3.googleusercontent.com/-vjTTnqqrgoE/AAAAAAAAAAI/AAAAAAAAAps/VS106hP4aqU/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 2, '2 months ago', 'Very friendly staff. I\'ve only been in once, to purchase clones. The had some great strain choices, but the clones themselves were in bad shape. All the clones on the shelves were beat (yellow leaves, deep red leaf-stems and stalks) with nutrient lock.\n\nThe budtender brought out a new tray of newly delivered clones. These new clones looked significantly better but still had deep red leaf-stems and stalks. Half of them showed some signs of heat stress as well. I left with a half dozen of the best I could find in the bunch.\n\nThe leaves on the clones I purchased yellowed right away. Within a couple hour of leaving the dispensary, they  started to look like the clones on the shelves. These clones had a few sparse fan leaves. The roots were barely breaking through the rockwool, and the rockwool itself looked like dark chocolate. The clones were it starter pots and the run-off water looked like thick black coffee.\n\nI transplanted the clones, flushed them using clean/filtered water with a 6.5 ph, and started them some magnesium sulfate. Luckily, I was able to turn them around -- it only took a month. They are now beautiful.\n\nI won\'t be back to this dispensary. My initial experience has turned me off. I wouldn\'t purchase clones again from them. I don\'t think I would buy flower/concentrates from them either.', 1521045970),
(618, 132, 'Lillian Wright', 'https://www.google.com/maps/contrib/116552232201350532253/reviews', 'en', 'https://lh6.googleusercontent.com/-dCPX7eUB8xM/AAAAAAAAAAI/AAAAAAAAAAs/RL7z8YQ8Exc/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '6 months ago', 'Love this dispensary! SO nice to me when they found out that this was the first dispensary I\'d ever been to! They always hook it up and the employees are just so nice. ', 1510858687),
(619, 133, 'Karen Brooks', 'https://www.google.com/maps/contrib/100115532501320619691/reviews', 'en', 'https://lh3.googleusercontent.com/-tUw3QenZimE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2kIz62ZNDR7GCBmmE1cNNOe4ht0A/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Nicest staff ever. Everyone I\'ve dealt with is just great, which is the main reason I come here. Actual conversations, however brief. I generally don\'t buy from people I don\'t like. Do you? Decent prices. Bud needs to be higher quality but that\'s not what I buy there. Avoid the Ebbu distillate cartridges and pens. Get a pen at Vape Source with a charger for less than $5 and they not only work but don\'t commit suicide while being charged. Golden Barn has the most consistent quality cartridges that they carry here,  but their pens have suicidal tendencies as well if you use their charger. Fun people at Grow Life . Nice, welcome atmosphere. Good prices on edibles. Molasses ginger 100mg cookies are the bomb.', 1522356160),
(620, 133, 'Leslie Hammel', 'https://www.google.com/maps/contrib/106555032575768403446/reviews', 'en', 'https://lh4.googleusercontent.com/-MzPjh2vGn3k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Hd4Xz5FnCDmQwIQTNQJhGC-cM7A/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '9 months ago', 'Awesome staff that is so incredibly helpful.  I love coming here and checking out the variety of concentrates. :)', 1502216888),
(621, 133, 'juli adams', 'https://www.google.com/maps/contrib/118244243908027510164/reviews', 'en', 'https://lh4.googleusercontent.com/-YQ0oudhZg-U/AAAAAAAAAAI/AAAAAAAAAFc/lfGDWn0NGeo/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '9 months ago', 'They have great variety, but higher than average prices. Some things are double what you pay other places...', 1503355428),
(622, 133, 'Josh', 'https://www.google.com/maps/contrib/115143293122634075358/reviews', 'en', 'https://lh4.googleusercontent.com/-nhh2MJSN20E/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Sv65Wm4vGFsFJHulyJYVU4yevhQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '10 months ago', 'These guy\'s have that sticky icky. Ghost of Leroy creeped up on me. Some of the best in town!', 1501381621),
(623, 133, 'Brandon Goreman', 'https://www.google.com/maps/contrib/102300726759797270017/reviews', 'en', 'https://lh3.googleusercontent.com/-cg5-8Fsc8q8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0DpUGtUo53Ul46z2uwLVhyCNC-Lg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Some of the best I\'ve laid my eyes on. The smell, taste, looks are amazing. I love the low light vibe very cool. The people are super nice too. Charles kush is great! Concentrates are top notch. ', 1471240892),
(624, 134, 'Natalia Ornelas', 'https://www.google.com/maps/contrib/109929578440468870690/reviews', 'en', 'https://lh4.googleusercontent.com/-oQnMGbaOUcs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2OT0dInTqj-1iMROSRa1qjjGaIpQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Super affordable prices and its in a nice little hidden spot. Customer service is on point which is a major factor for me because if you are being rude then i wont be back. The atmosphere is very welcoming. Will for sure tell people about this place#', 1526239976),
(625, 134, 'Ariana Muniz', 'https://www.google.com/maps/contrib/105291335814253632321/reviews', 'en', 'https://lh4.googleusercontent.com/-8HWxVt9nbTs/AAAAAAAAAAI/AAAAAAAAE4U/wJxfKHP6pgs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Jesse was amazing! He helped us figure out the deals going on and was able to hook us up with some great bud! Definitely going to be heading back for the customer service and great prices!!', 1524769277),
(626, 134, 'Shaun Walton', 'https://www.google.com/maps/contrib/113200767124543820647/reviews', 'en', 'https://lh5.googleusercontent.com/-51i2FTugBSI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3dU1ib3IpfjWDhTs1PPKDU4VS3Xg/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 weeks ago', 'Great friendly atmosphere, with reasonable prices and quality product. I\'ve been a few times and each budtender has been very helpful and cool as hell.  If you never been before you should definitely check it out', 1525915800),
(627, 134, 'Jay', 'https://www.google.com/maps/contrib/107386413977283801307/reviews', 'en', 'https://lh5.googleusercontent.com/-0a9xQ6Iim-4/AAAAAAAAAAI/AAAAAAAADiQ/tE_LAipBQnM/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a month ago', 'Amazing! I have been waiting for a coffee shop and glad I voted for the proposition that enabled a place like The Coffee Joint next to this place to exist! Yeah! They have CBD products too, including edibles, lotions, salves, etc. They have both REC and MED sides filled with great deals and huge selection. If you are a medical patient and cannot grow your own plants and you need a caregiver, then I recommend this place as a viable option. They have flower, concentrates, edibles, patches, lotions, and more. You can get something different each visit- the huge amount of different things you can choose from is incredible! And they got incredibles bars too. Check it out, whether you are REC, MED, or visiting from put of town. A+', 1524423701),
(628, 134, 'Ryan G', 'https://www.google.com/maps/contrib/103846512595625117182/reviews', 'en', 'https://lh3.googleusercontent.com/-kRpJ_ETkKQQ/AAAAAAAAAAI/AAAAAAAAAt8/vxcRBkr9yaI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'GreaT help n even better prices!!! This place don\'t play! Excellent customer service!! U want the Best? This is THE BEST!', 1523729964),
(629, 135, 'Karen Brooks', 'https://www.google.com/maps/contrib/100115532501320619691/reviews', 'en', 'https://lh3.googleusercontent.com/-tUw3QenZimE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2kIz62ZNDR7GCBmmE1cNNOe4ht0A/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, 'in the last week', 'Says clones are guaranteed. Took them a picture of two dead clones I bought, and brought the pictures into the store, just as They requested. They said they will not refund me and cannot replace because they are out of clones. Guarantee is only for replacement and only for clones. You cannot get credit on any other item. PLUS, no real decision can be made about anything without the manager\'s approval. But, the manager does not work at the store. Manager was supposed to call me back. They don\'t  do that either. WORST DISPENSARY EVER. They have my money, and I got NOTHING. What\'s worse, they REALLY don\'t care.', 1527283657),
(630, 135, 'David Weber', 'https://www.google.com/maps/contrib/107706646362876577992/reviews', 'en', 'https://lh4.googleusercontent.com/-06eAVR8p-ds/AAAAAAAAAAI/AAAAAAAADXY/X6Ij8P0dV3Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Very friendly environment. Love the location. Good prices and knowledgeable bud tenders. They don’t try to push or sell you anything they just listen and give great advice. Will definitely be coming back.', 1520019967),
(631, 135, 'Noah Guillory', 'https://www.google.com/maps/contrib/108243479575089353105/reviews', 'en', 'https://lh4.googleusercontent.com/-UdgjdcJR2NU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2mgRXeMbXndPScbWaaaWPvnJ3yjw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '2 months ago', 'Great selection of bud as well as a large section for concentrates. They\'re clones grow very well and are easy to transplant into Rockwell cubes. If they\'re not adapting to your set up take a picture and they will get you some more. Although, it\'s only happened once with some Golden Goat clones. I\'ve had complete cycles of there Huckleberry, Blue lemon Thai and Titan OG. I\'m excited to finish this next cycle and try out some more strains from them! (Obviously take precautions before transferring a couple clones into your entire Garden; treat with some green cleaner for a week or throughout the cycle.)', 1520304964),
(632, 135, 'Pikes Shadow', 'https://www.google.com/maps/contrib/110139105178182400186/reviews', 'en', 'https://lh6.googleusercontent.com/-DZ2LERgrAJg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0iGwCSxyZDoL5xwEw_srP8RxCNjw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'A good selection of concentrates, quality flower, and even some hash! Darcy is super nice and helpful. Those cones, apparently derived from jarred bud miasma, are worth the coin. If you patron this shoppe, you shall become medicated. This is from a medical pt with chronic pain.. thanks!', 1523906183),
(633, 135, 'Mark Centric', 'https://www.google.com/maps/contrib/114147258700078469650/reviews', 'en', 'https://lh5.googleusercontent.com/-xtfDzq3pikM/AAAAAAAAAAI/AAAAAAAAAC0/qsH9hyybULY/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'a month ago', 'The new budtender is awesome and knowledgeable, but he is gone now. The flower tends to have seeds in it.  The deals have gotten worse and prices have gone up, but product is still so so.', 1524335875),
(634, 136, 'Jolene Niccole', 'https://www.google.com/maps/contrib/106023717763379914370/reviews', 'en', 'https://lh5.googleusercontent.com/-pZKS5wlzB3I/AAAAAAAAAAI/AAAAAAAAABw/EQO9dc3135A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Don’t let sour puss down there fool you. Check this place out for yourself. \nGood weed co is hands down best in Colorado Springs.\nAwesome flower, concentrates that NEVER disappoints.\nThe staff is friendly af, super knowledgeable probably the best staff a dispensary could have.\nConstantly having awesome deals. \nI won’t sign my plants over to anyone else.', 1519489766),
(635, 136, 'Bailey Roberts', 'https://www.google.com/maps/contrib/118166154057587110426/reviews', 'en', 'https://lh6.googleusercontent.com/-VnKOT9Zr66I/AAAAAAAAAAI/AAAAAAAAt2s/P3i2qSFn6so/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'I get medicine here exclusively. Amazing staff and stellar products! Thankful I was referred here. Staff is very kind and knowledgeable. Their website is also very informative.', 1522610121),
(636, 136, 'dr slaughter', 'https://www.google.com/maps/contrib/114636309497291984121/reviews', 'en', 'https://lh3.googleusercontent.com/-96dbCyzQITA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1j4welCV-6IyumItaacX7at8n03A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'All the flower from this place wouldn’t even stay lit or burn correctly. Solid black ashes on all the strains I got from here. Even after sitting out the package for a week they still didn’t smoke good. For being called good weed this places flower is far from it. Smelled good but smoked horribly.', 1518550653),
(637, 136, 'Matt Driscoll', 'https://www.google.com/maps/contrib/101731794236555165745/reviews', 'en', 'https://lh6.googleusercontent.com/-M0sHep02k-A/AAAAAAAAAAI/AAAAAAAAD3c/Iq5UJlwjayk/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '8 months ago', 'Very friendly and knowledgeable staff. Best buds in the Springs and probably the state. Discreet location, just says \"good\" on the wall. Cool waiting room with some unique features you should stop in to see! \n\nAll organic, no till and glass cured. Great pricing for members and still better than most dispensary for nonmembers. If you bring your own exit bag and jar or other reusable container, they usually hook it up really nice. \n\nFavorite stop for flower and edibles in the Springs. Would definitely recommend anyone to stop in and try it at least once. Great strain flavors always on deck.', 1505092903),
(638, 136, 'Ares Inamorta', 'https://www.google.com/maps/contrib/109779798150614840191/reviews', 'en', 'https://lh4.googleusercontent.com/-mQ8DBRuegv8/AAAAAAAAAAI/AAAAAAAABTw/ieLFRowemjw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'Amazing bud worth the price. Idk what is up with that other review but I’ve never had anything but amazing quality medicine from them. Keep doing good ', 1519696476),
(639, 137, 'Richard Phillips', 'https://www.google.com/maps/contrib/115298119059769472027/reviews', 'en', 'https://lh3.googleusercontent.com/-uTf0YXVGmcQ/AAAAAAAAAAI/AAAAAAAAXco/WWcwaPNkh1M/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'This store true to its name. They are a very kind group of folks there. And when you enjoy their flower, you will feel no pain. Best experience I\'ve had in Colorado. Get a med card and become a member. You won\'t regret it. It is truly a great vibe at Kind Pain Managnent.', 1524845203),
(640, 137, 'Papa Callixtus IV', 'https://www.google.com/maps/contrib/109917790467300567040/reviews', 'en', 'https://lh5.googleusercontent.com/-aa4vn2UUhtg/AAAAAAAAAAI/AAAAAAAADVk/eyw_VZpCRZ0/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'I can\'t get enough great weed Amazing  staff   this is the real deal here .if you have a med  card come here screw the big giants of weed . This weed is grown with love and the  patients  receive the best', 1522883097),
(641, 137, 'Jessica Kelly-Walker', 'https://www.google.com/maps/contrib/109700986227625906858/reviews', 'en', 'https://lh3.googleusercontent.com/-UIoOdwLx4yY/AAAAAAAAAAI/AAAAAAAAAKo/Fz1bhcwE2-I/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'I always have the best medical shopping experience when I come here! They offer the best products in the area for medical. There are daily deals too, so I can get the best deal on my favorite stuff! The crew there are so knowledgeable and nice! If you are looking for an awesome medical shop in Lakewood, Kind Pain is where its at.', 1504567987),
(642, 137, 'Simone avery', 'https://www.google.com/maps/contrib/116698853319543274603/reviews', 'en', 'https://lh6.googleusercontent.com/-nxc-8sYk9NQ/AAAAAAAAAAI/AAAAAAAAJfs/VdgrYP2cH70/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'The staff is super friendly every time I come in and I love the variety, there’s a new strain every time I come in!', 1518383908),
(643, 137, 'Maddison Monroe', 'https://www.google.com/maps/contrib/112185006851836858834/reviews', 'en', 'https://lh5.googleusercontent.com/-zG0RzEeFwMY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0VK50FhwHSZRk8RXwgSmZLnUdN-g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Super friendly staff and great selection! Definitely check it out if you are a medical patient!!', 1512089913),
(644, 138, 'Alex Sanchez', 'https://www.google.com/maps/contrib/113568794475607936343/reviews', 'en', 'https://lh6.googleusercontent.com/-uRseEzCvrRo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0goSZbOIqcNloT2xPnsgSmj2U-pA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Always good quality bud. Some of the best concentrates and lotions on the market. The caviar is pretty solid as well.', 1524083681),
(645, 138, 'Roseanne Maye', 'https://www.google.com/maps/contrib/100744893423662064623/reviews', 'en', 'https://lh3.googleusercontent.com/-NNuK41zZjqM/AAAAAAAAAAI/AAAAAAAAAOU/uH2uHR4p3o0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Best weed in the city! Can\'t go wrong with any of their strains. Blackberry cream, blackberry kush & golden goat are my favorite & there are many, many more strains to choose from. On top of all this, they have a wheel of fortune to spin to get a free pre-roll, $5 off, $10 off & other deals. Don\'t waste time at most places, just come here & be happy!', 1519063928),
(646, 138, 'Rick Smyser', 'https://www.google.com/maps/contrib/102354905860790168834/reviews', 'en', 'https://lh4.googleusercontent.com/-QMoMcg7P9vc/AAAAAAAAAAI/AAAAAAAAAGk/Admm4jwj4Uk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Ok, so I feel horrible.. I mistook y\'all for altitude.. A million billion apologies.. my brain isn\'t the best. So sorry to your buisness I revoke my previous review and will be visiting your shop, if y\'all aren\'t to sore at me that is =x (super sorry again) >', 1523822787),
(647, 138, 'Daniel Martin', 'https://www.google.com/maps/contrib/114202518261731955224/reviews', 'en', 'https://lh4.googleusercontent.com/-55BSrle9h0Q/AAAAAAAAAAI/AAAAAAAAAD8/q_lXjq2NNO4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I have never been in but heard good things.  Rick S is trolling dispensaries online. He leaves fake reviews and lies on here. His real name is Rick DeBacco he is a badged employee who leaves bad reviews when he doesn’t get free stuff. I would suggest banning him from your store and asking google to remove his review.', 1523808301),
(648, 138, 'Ruckus Boyz', 'https://www.google.com/maps/contrib/106772230834969952931/reviews', 'en', 'https://lh5.googleusercontent.com/-oRbABt1R6Dk/AAAAAAAAAAI/AAAAAAAABUs/YoTHsazV0n8/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '3 months ago', 'Great place for Edibles decent prices very compatible... I will be returning on their next deal may even sign my membership up for a month', 1517346009);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(649, 139, 'Brandon Wills', 'https://www.google.com/maps/contrib/103856300021982582676/reviews', 'en', 'https://lh3.googleusercontent.com/-BUZoq7VTyR4/AAAAAAAAAAI/AAAAAAAAAAs/YyBU9osKhbc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'They have great quality products here and friendly service. The staff is knowledgeable and prices are reasonable. Their edibles are pretty good. I would definitely recommend this shop.', 1526585345),
(650, 139, 'Courtney Mathewson', 'https://www.google.com/maps/contrib/113350832769368425935/reviews', 'en', 'https://lh6.googleusercontent.com/-8pgA_nI8kBE/AAAAAAAAAAI/AAAAAAAAAyQ/Eq9V6wKrYJE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'wish I remembered my budtender’s name! she was so inviting and helpful. so far the product is definitely up to par too. cozy little shop and lots of variety on edibles', 1527309551),
(651, 139, 'Jordan Black', 'https://www.google.com/maps/contrib/108596342083434481069/reviews', 'en', 'https://lh5.googleusercontent.com/-875oeVRa_xE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0QmLi_A609Cqp7NBMzbuzCwWiKMA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'A truly top notch place in a sea of mediocrity. If you want to shop like the locals there\'s no better place. Very friendly and knowledgeable staff. If you truly want to treat yourself get some live resin. Don\'t be afraid to spend the loot on concentrates! $20 out the door 1/8ths are never a bad thing either if you\'re looking for great quality at an amazing price!', 1520506342),
(652, 139, 'Pearl Sandwich', 'https://www.google.com/maps/contrib/101432383788019139567/reviews', 'en', 'https://lh6.googleusercontent.com/-rb3R9h1wrC4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0jgy4gMD90bsfXEhY3Q2uGDFnyYQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'A really calm atmosphere and Megan was incredibly informative. I needed a few suggestions to help with chronic pain due to endometriosis and she gave me a pile of options. It was better than talking to my doctor about the pain. Great staff and prices.', 1527265079),
(653, 139, 'George Galanakis', 'https://www.google.com/maps/contrib/109442094764297349425/reviews', 'en', 'https://lh3.googleusercontent.com/-fZERUHizOvw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0hlm3PF0I1Y_mLXRCE52fUKAwA4w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'The staff here is amazing. I was was in Colorado for the first time and decided to stop in really quick to check out the local product no pun intended lol. That was one of the best decisions I could have made . Not only was their product top quality but the service was too. I have never been in a dispensary and they made me feel right at home. The concentrate was very smooth and so were oils. They explained to me the uses of the various products they offered which were wide in selection. I can not forget to mention the edibles, it was was hard to refrain from eating them just to eat them cause they tasted spectacular. I would recommend this establishment to any one in the country let alone Colorado.I will be a repeat customer. Thank you Local Product!', 1519494025),
(654, 140, 'Jay', 'https://www.google.com/maps/contrib/107386413977283801307/reviews', 'en', 'https://lh5.googleusercontent.com/-0a9xQ6Iim-4/AAAAAAAAAAI/AAAAAAAADiQ/tE_LAipBQnM/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '2 months ago', 'This was the first dispensary that I visited after moving to Denver and they were a great introduction to legalized cannabis. I started off on recreational before getting my medical card and shopping on the med side, and both sides have great product at competitive pricing. Not the cheapest, but the pricing is fair and their flower is better quality than the cheaper bud down the road. I highly recommend them for your first visit and even regular visits after.', 1520356170),
(655, 140, 'Jessica Charnley', 'https://www.google.com/maps/contrib/118127669003897897112/reviews', 'en', 'https://lh3.googleusercontent.com/-I0HwALcyjjY/AAAAAAAAAAI/AAAAAAAAAds/NIpkp43o8p8/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 months ago', 'I just bought their weed yesterday and I don\'t buy their way in often, since I prefer another places weed better.  The weed was pineapple OG and I woke up the next morning with an extremely sore throat and I could taste some sort of chemical or something wrong that just wasn\'t natural with the weed while smoking it. So in total I paid $25 to get a really bad sore throat and I barely got high .  I am giving this three stars because I love all of the workers there, this place is in my neighborhood and I really enjoy their edibles and concentrates and customer service because again they are great people. But I have worked in a grow before and I can tell that this weed is not clean and I don\'t think that is morally right to sell to your customers ,  hopefully my next experience will be better  .  Again out of all of the places in downtown this place is not overpriced but I can see why because this weed is something really bad I can\'t even taste the flavor it just taste  burnt . Disappointing but because of their great location and I can\'t say I won\'t be back for edibles  and their great deals. No bad energy with this, at all just trying to inform people so they don\'t get sick', 1522339163),
(656, 140, 'Jon Inglee', 'https://www.google.com/maps/contrib/117949369220115784549/reviews', 'en', 'https://lh5.googleusercontent.com/-Hr2yAxyFKdY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1y8jyJW6ulm9959lhLAhaVx24hgA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'Called ahead and was told there would be the weed they had on sale told them I would be 30 minutes till I can get there, had to drive all the way into town and try to maneuver parking and traffic only to get in there and they tell me that they\'ve been out for a while. Used to come here a lot this will probably be my last time going in would not recommend', 1525299427),
(657, 140, 'boogie howell', 'https://www.google.com/maps/contrib/108959112018214550401/reviews', 'en', 'https://lh4.googleusercontent.com/-ImiJOvN5VOs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Ccviw7rBKPjo5tCcX3CUgLOkkTw/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '5 months ago', 'Bought a gram of concentrate. It was only a half gram when I got it on my scales. The quality wasn\'t as good as the price they ask. Also. Beware when you visit. Loads of homeless around and the police obviously could care less people sell meth all behind this location. All in all. I would rather spend elsewhere. Staff was cordial though.', 1513354980),
(658, 140, 'Byron Tialios', 'https://www.google.com/maps/contrib/104461915071601091515/reviews', 'en', 'https://lh6.googleusercontent.com/-zHUv7-H6JV0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3b11QCgBAFZcdrwYa0XM4CODMCYQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'This place is awesome! Every time I go there are always great deals and the prices are some of the best I’ve seen since I’ve been living in Denver. The staff is extremely helpful too and they don’t mind taking their time to make sure you get what you want.', 1508683828),
(659, 141, 'Jay Thompson', 'https://www.google.com/maps/contrib/110630804997563437261/reviews', 'en', 'https://lh3.googleusercontent.com/-7kwwHp3z9_g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3L_O17jTd-wJ_WDbN6d3lFA5jq7Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Great peaceful vibe. Manager spent 20 minutes with me explaining all the products offered. Being new to cannabis this was a huge help. Recommend for all the first timers out there. Setup a private consultation and they will spend as much time as you need.', 1527086658),
(660, 141, 'Fonda Cash', 'https://www.google.com/maps/contrib/102243782320676173839/reviews', 'en', 'https://lh4.googleusercontent.com/-5FTRHNpmj0w/AAAAAAAAAAI/AAAAAAAAADs/SZWl2xqRbF8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I have had many compliments from people I have referred to Tweed Leaf lately. \n\nI was told that Teo and the staff give the best patient  care in the industry. The flower is top notch and the prices are more than fair. \n\nWishing Tweed Leaf much success and I recommend them to anyone in need of a great dispensary. Just don’t buy the stuff I like please ', 1521992699),
(661, 141, 'Don Rotino', 'https://www.google.com/maps/contrib/106226183448306119639/reviews', 'en', 'https://lh6.googleusercontent.com/-7LEjGN6rPKQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2V_y5LvNR5admcqgyzeuS1Lu8lKg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'All I have to say is the energy and feeling of entering TweedLeaf makes me feel at home. Part of the family. Superb flower, cured and dried.', 1527256441),
(662, 141, 'Dean Frank', 'https://www.google.com/maps/contrib/114355027430954341038/reviews', 'en', 'https://lh4.googleusercontent.com/-53k9l1kEO2I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq09ymCMtT1uiV7YiUiF7xqeqoUczA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'First time in yesterday. Got a Golden Barn Titan OG cartridge, loved the flavor and feeling. Put me out for the night. Also picked up some of their Blackberry Flower.', 1527348482),
(663, 141, 'Curtis Smith', 'https://www.google.com/maps/contrib/111939688684333440865/reviews', 'en', 'https://lh3.googleusercontent.com/-eQGhYftFcYM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1nKfk03rh5NHRZPA960zMitYy88A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Way cool. Great product and nice place. Love the peaceful happy feeling.', 1527291175),
(664, 142, 'casey Kratzer', 'https://www.google.com/maps/contrib/117243083324455546732/reviews', 'en', 'https://lh5.googleusercontent.com/-9iFS43BsOHE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2si4hKNGkxdGO33iejHYVLiAQkFA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'Will not give this place anymore money. One, they make the med patients wait and check in at the rec check in line when there\'s a med check in window but never anyone there. Two, being forced to the rec side you think they might give me a med deal since I\'m in their system as a med patient nope.Three, the med side closes an hr earlier than rec which happens to be the only time I can go(the last two being the reason I dropped them as my main caregiver). I\'m signed up to give them more plants in return more revenue, you\'d think the least they could do for someone signed up as a patient is give them a med member discount on the rec side but oh well I\'ll get my medicine elsewhere for med prices. And last but not least, their product has really gone down lately you can find much better flower other places.', 1527186458),
(665, 142, 'Daniel Nichols', 'https://www.google.com/maps/contrib/100684427934544523885/reviews', 'en', 'https://lh6.googleusercontent.com/-xE5fxxBhWPk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Y51cey_frhRyHPqDO6FZi-jWzsw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, 'in the last week', 'This is the absolute worst dispensary in existence. All of the weed is from the same strain they just call it different names. They are the laughing stock of the dispensary world and have absolutely NO good weed. Do not go here ever. I know it seems cheaper but for wat ur getting it is not cheaper, u have to smoke twice as much to get anything out of it. Go to nature\'s if u must use a dispensary. All dispensary\'s are garbage but this one is the worst of the worst. Anyone who thinks the weed from here is good is an idiot who has never had real weed. Smoking crab grass or oregano will get u higher than the BS fake ass weed they sell at this dumpster store.', 1527576417),
(666, 142, 'Greg Horlick', 'https://www.google.com/maps/contrib/107384943830891083883/reviews', 'en', 'https://lh3.googleusercontent.com/-jdSpmAoJyiM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2ms0U5ieSH307RmzDdnTfl9esoQg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I visited LivWell for the first time 2 weeks ago. My bud tender that day was Jonathan, he was super knowledgeable about all the products I inquired about. He also took plenty of time explaining what products would be good for me. His social skills were top notch and explained everything in detail I asked about. I would suggest visiting with Jonathan on your next visit to LivWell, he will definitely steer you in the right direction!!!  As for the store itself, it’s the only dispensary I will visit in the future !!', 1516995566),
(667, 142, 'Kelsey Rogers', 'https://www.google.com/maps/contrib/105659195597415590277/reviews', 'en', 'https://lh5.googleusercontent.com/-2Ncnsu-0hAQ/AAAAAAAAAAI/AAAAAAAAAHc/MNrXloa2-28/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'This is my all time favorite dispensary in the area! The selections and products are the best and and the staff is so nice! Especially, Jessica she is absolutely amazing! She gave me so many options to choose from and was so kind, definitely made my day!', 1522963544),
(668, 143, 'Cory O', 'https://www.google.com/maps/contrib/105192213216002792283/reviews', 'en', 'https://lh4.googleusercontent.com/-lTo_zCnG-Bc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2nbF0SFBOqfAqXCmJV_5isFW6chQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'This place has an extremely nice and helpful staff! They make great recommendations!  They have great bud at a great price! Can\'t beat their 25 dollar 1/4\'s !  It is all top shelf quality in my opinion. I would never get my bud anywhere else.', 1510876681),
(669, 143, 'Chase Goodin', 'https://www.google.com/maps/contrib/107755232828426414945/reviews', 'en', 'https://lh6.googleusercontent.com/-ObCIu0pSj3c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1UyxQYntbOCRxN9HwMBwFi6SD9ng/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Awesome place!! Staff and Buds are both really great, awesome prices.', 1522894230),
(670, 143, 'Caleb Santiago', 'https://www.google.com/maps/contrib/111472627755525374053/reviews', 'en', 'https://lh6.googleusercontent.com/-6EgTSPH5ZqE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq280fc0ir3yEQN89LimBTs0IvmNYw/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'Awesome place! Just a passing customer but their bud is great, especially for 25$ a 1/4. They even give u a free preroll if u bring their jar back!', 1519946704),
(671, 143, 'gary adams', 'https://www.google.com/maps/contrib/101574532046423812695/reviews', 'en', 'https://lh4.googleusercontent.com/-nutb7MGgmmI/AAAAAAAAAAI/AAAAAAAADHE/IEZGPxS1RFw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I\'m not sure but I\'m pretty sure there is NO better place and the people are TOP SHELF!!!', 1527552324),
(672, 143, 'Curtis Smith', 'https://www.google.com/maps/contrib/111939688684333440865/reviews', 'en', 'https://lh3.googleusercontent.com/-eQGhYftFcYM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1nKfk03rh5NHRZPA960zMitYy88A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Popcorn City and terrible service. Would not go back. Buds were very small. Budtender that attended didn\'t have much product knowledge. Got home and took out my scope and I saw that trichome heads were not fully developed on the flower.', 1522819211),
(673, 144, 'Nate Crosman', 'https://www.google.com/maps/contrib/106648983332074811568/reviews', 'en', 'https://lh4.googleusercontent.com/-hCy0O_KfXZs/AAAAAAAAAAI/AAAAAAAAAUg/NcI5IMEtwhE/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'First off no handicapped entrance, so I had to send my wife in.\nHer experience was far from great. The store it self felt like a doctors office and was not even close to the normal friendly atmosphere at most shops. The budtender never introduced himself, and had very little knowledge of the product in the store. She then presented our coupon for the deal on live resin and not surprisingly he was completely baffled. Once he finally figured that out, she ask what strains they had, and he completely ignored her. \nLast, he told her that KIDS love the medicated pop rocks. I don\'t know if he meant Kid, Kids or if he was using slang. But that is a very inappropriate thing to say in a Cannabis retail facility. This company should be greatful I haven\'t reported them. \nWE WILL NOT BE SHOPPING HERE AGAIN.', 1525811450),
(674, 144, 'Alex Champlin', 'https://www.google.com/maps/contrib/113199713188739530582/reviews', 'en', 'https://lh6.googleusercontent.com/-yijJShZVHvg/AAAAAAAAAAI/AAAAAAAAAHU/9Fdgkon6nvE/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'THIS SHOP IS RUN BY SCUMBAG HUMAN BRINGS WITH NO CONSIDERATION. PLEASE DO NOT GIVE THEM YOUR BUSINESS', 1525460950),
(675, 144, 'John Sciortino', 'https://www.google.com/maps/contrib/102037163467371929632/reviews', 'en', 'https://lh3.googleusercontent.com/-vYTjGhwPrdc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3qkHSWZvxzDPRqNxSdBqlqt4E0tw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great service! Private, professional, and compassionate. Very comfortable place to purchase medical marijuana.', 1520183079),
(676, 144, 'Shaun A', 'https://www.google.com/maps/contrib/108106330607322999168/reviews', 'en', 'https://lh4.googleusercontent.com/-F2mM3YSVu3Q/AAAAAAAAAAI/AAAAAAAAANE/N-GgPYg30S0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, 'a month ago', 'Pretty cool place. Great marijuana, jus wish it was a bit cheaper tho.', 1522878507),
(677, 144, 'Dr. Dabenstien', 'https://www.google.com/maps/contrib/111372571816371685311/reviews', 'en', 'https://lh4.googleusercontent.com/-97VSh2UtPnY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2VNGyYNdHnpwGbQXOjRJmnkRe2YA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 weeks ago', 'Literally what\'s wrong with the Industry! Poor customer service, poor quality,  and recently failed an ID sting. Go any where else.', 1525119482),
(678, 145, 'Logan VanDenBerg', 'https://www.google.com/maps/contrib/105117487070324447468/reviews', 'en', 'https://lh6.googleusercontent.com/-CpBmL4U6xys/AAAAAAAAAAI/AAAAAAAAAGU/9OHIDx0ci-Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I go to the Aurora location. The staff is awesome, always super friendly and always willing to take the time to go through their selection of products! Daily specials are awesome and their products are top notch.', 1526755483),
(679, 145, 'Travis Graham', 'https://www.google.com/maps/contrib/110047444187156759019/reviews', 'en', 'https://lh6.googleusercontent.com/-p2NCt5hUEps/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1kHUPUzOELkA35bpOncb9L7SWoxA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Awsome dispensary staff is very friendly very informative and extremely helpful. I was very impressed with the selection of products they had available. I look forward to going back', 1526849380),
(680, 145, 'aplang', 'https://www.google.com/maps/contrib/111859163976283521935/reviews', 'en', 'https://lh4.googleusercontent.com/-IG-eJsJA13I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3n42-acQF9gYusrFuNWDz6NEzJQg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 2, '2 months ago', 'This review is for the sativa 5 joint pack. We were on cannabis tour this past weekend, one of the places we stopped was here at Medicine Man. The staff was very friendly and helpful. Being that we were only in CO for the weekend, this bus was our only opportunity to smoke, and we didn\'t bring any pipes with us to use/bring back (airport) we figured joints were our best option. They are also easy to share as that is atmosphere on the bus. Anyway, back on the bus, we light one up, seems to be burning fine. Exhale, and.... nothing? My husband and I tried 3 times each, plenty off smoke coming off the cherry but none getting to our lungs. Thinking maybe we are just idiots who don\'t know how to smoke a joint as we usually use glass pieces, we pass it down for other people to try. No one got a hit out of it. Thinking maybe we just got a dud, we lit up a second one with the same results. We then tried tearing off the filter, same result. We finally just gave up and threw it in a cup of water. We ended up leaving the rest of the pack in our hotel room for the maid to find. Hopefully they were able to make better use out of them than we were. \n\nAt the next shop we stopped at we warily bought more joints. To our delight these worked wonderfully and we were able to contribute to the rest of the group!', 1521471826),
(681, 145, 'Kent Taylor', 'https://www.google.com/maps/contrib/104405373666868212766/reviews', 'en', 'https://lh5.googleusercontent.com/-nEfa1C7rHkU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Orll1Af5y0vXFvE4ohmaWkqCE2A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Very good experience the staff answered our questions very professional Timara R Great job we will be back to see you.', 1527482156),
(682, 145, 'Ana Paz', 'https://www.google.com/maps/contrib/108583349063965240777/reviews', 'en', 'https://lh3.googleusercontent.com/-o2AUu0qeE2Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3h5I0_PCkd5BAgmne31ElMYr_bng/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Seeing these reviews, really making me want to take a trip. I suffer from Lupus nephritis (which come with joint pains), high blood pressure, and anxiety. I was looking at your website I wanted to know what are the requirements for getting a medical card? Is there someone that can contact me from your company to talk? I want to learn more. And I also live in Texas so if I can visit you guys it’s definitely going to be in the works!', 1523680030),
(683, 146, 'Leia Foster', 'https://www.google.com/maps/contrib/112246150687113169434/reviews', 'en', 'https://lh6.googleusercontent.com/-aZw6PaU6AYQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2-qaP36BG23RJMim3XojEsjypSdA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'My new favorite dispensary! I am always excited to walk into Headmaster and see which of my favorite bud tenders are working. The staff are all fun, knowledgeable and can hold a great conversation! I feel like family when I\'m at Headmaster. Their flower is flavorful, colorful, and the effect of each strain is unique. Flower, concentrates, and other products are priced reasonably, especially for the quality! I recommend Headmasters to my friends and to all marijuana enthusiasts!', 1525047155),
(684, 146, 'Julian Wiley', 'https://www.google.com/maps/contrib/100524973691085738391/reviews', 'en', 'https://lh3.googleusercontent.com/-fQCJ9ZZaQlY/AAAAAAAAAAI/AAAAAAAAABw/mFugsIhx_rA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Out of all of the dispensaries I\'ve been to in Colorado Springs, it is safe to say that Headmaster is the place to go! They have consistent, high-qualify product and all of the bud tenders are helpful, knowledgable, and make you feel like family every visit! Some great folks up at Headmaster!!', 1527390546),
(685, 146, 'Caitlin Eckerle', 'https://www.google.com/maps/contrib/113513417319621387765/reviews', 'en', 'https://lh4.googleusercontent.com/-I0kru1PRaVE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3dhBDGtIL4b4B2_lRv_mm1LE_BDg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Staff is always friendly & willing to take time with me. The ENTIRE staff is amazing! Great prices & great quality!! Highly reccomend!', 1524104837),
(686, 146, 'Henry Thomas', 'https://www.google.com/maps/contrib/108132967070327556813/reviews', 'en', 'https://lh6.googleusercontent.com/-4dufXYotJqQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3dnYbfAPMBbr8dIL5v4fk9RjtBvQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '7 months ago', 'Budtenders are super friendly and knowledgeable. Also warm and welcoming. Prices are excellent as is quality on flower and concentrates. Frequent customers are treated well', 1508872388),
(687, 146, 'Bobby Fortner', 'https://www.google.com/maps/contrib/106058129396347725230/reviews', 'en', 'https://lh5.googleusercontent.com/-8g6wPWvW9NM/AAAAAAAAAAI/AAAAAAAAAyo/_2UTjvtEBkk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '5 months ago', 'I just love this place! Kirk and Christina absolutely ROCK! Can\'t go wrong at Headmaster!', 1513800233),
(688, 147, 'Mary Wiseman', 'https://www.google.com/maps/contrib/117524540121279456605/reviews', 'en', 'https://lh3.googleusercontent.com/-PQwTQCvuzWY/AAAAAAAAAAI/AAAAAAAAAB4/iQxO3yXQehA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'This is a nice place to do business. The prices are good, the employees know their stuff and they are very friendly. The location is easily accessible, easy to park, easy to find on Broadway ( half a block south of Quincy on the east side). I\'ve never been disappointed.', 1527359664),
(689, 147, 'D Wood', 'https://www.google.com/maps/contrib/109605780993973452208/reviews', 'en', 'https://lh3.googleusercontent.com/-DNAl746XL4U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2UNTJV2vq2UmyvqQw3ByK21YZA9g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'My favorite place to get happy! They are always chill, friendly and knowledgeable! The prices are great the products are better and the location rocks! This is the closest dispensary to highlands ranch and also is the best place to stop in for fabulous service and sales! 5 stars for sure! Thanks for keeping me stocked on the best shatter and flower in the city! ', 1521648133),
(690, 147, 'Patrick Slater', 'https://www.google.com/maps/contrib/102215789554894087389/reviews', 'en', 'https://lh3.googleusercontent.com/-zhjSuIm-wxg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1CSP-48pXQzHTWw1Qz15XDb8QpQQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Quality budtenders, quality product and the daily discounts and deals are always the bang for your buck. This is the best place I\'ve found for rec. I\'ve been going back faithfully and loyally since I walked in the first day 10 months ago. The quality is always on point, the staff are very friendly and knowledgeable, and the prices for the product you purchase is the cheapest I\'ve found for the quality they yield. Loyal to Nature\'s Kiss!', 1520437900),
(691, 147, 'Jenni Hamaker', 'https://www.google.com/maps/contrib/106061662561575464733/reviews', 'en', 'https://lh3.googleusercontent.com/-cEqI1XVjKFw/AAAAAAAAAAI/AAAAAAAABlY/UYLSPSg6g3c/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I so appreciated the time that was taken and the infectious passion of their product. As a middle aged mom and very minimal recreational use customer, I’ve had some dispensary experiences that made me feel like I was annoying, uninformed and overall uncool. Although I may be at least one out of three of those things, I felt like I belonged at Nature’s Kiss. I may not be a frequent customer but will be a loyal customer for life!', 1527428852),
(692, 147, 'Jennifer Bozung', 'https://www.google.com/maps/contrib/105219157535801766938/reviews', 'en', 'https://lh6.googleusercontent.com/-iXNQUfSKdgM/AAAAAAAAAAI/AAAAAAAAAGM/Ei95OXyTchw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Ed is THE MAN!  Actually all emloyees here are very friendly, knowledgeable and friendly. Highly recommend this shop over others!', 1526402749),
(693, 148, 'sheri griffin', 'https://www.google.com/maps/contrib/118376668206416779550/reviews', 'en', 'https://lh3.googleusercontent.com/-OyyfTN8s35I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3wJA3wXOoMVgfOXXx47033fIwekw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Livwell has incredible customer service. Their attention to their patients and customers is top notch. I\'ve always been pointed to exactly what I need because the budtenders are educated and experienced. Livwell sets the bar high.', 1527271383),
(694, 148, 'halomaster913', 'https://www.google.com/maps/contrib/115672919000083301731/reviews', 'en', 'https://lh6.googleusercontent.com/-6o1c3HyWOrw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0rH7T3bDmQkQEmcfAxLOJm9-vqdw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Everyone here is so helpful and knowledgeable. Every product I have purchased I have been very happy with. Best place in town.', 1522774322),
(695, 148, 'Austin Stewart', 'https://www.google.com/maps/contrib/107700020305844620662/reviews', 'en', 'https://lh6.googleusercontent.com/-jUmALGTVTnw/AAAAAAAAAAI/AAAAAAAABGw/pfmQ0uW_aY8/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 months ago', 'Shop is super clean, well stocked and has a lot of options. I came in on a mission to find a 3:1 CBD cartidge. The girl at the front desk was super friendly. I was immediately greeted by Coach when I went back  and he helped me out and answered the questions I had. He was super personable, and knowledgeable.', 1517718354),
(696, 148, 'trevor chimenti', 'https://www.google.com/maps/contrib/111835069280782025810/reviews', 'en', 'https://lh3.googleusercontent.com/-kB-jyW7XXyA/AAAAAAAAAAI/AAAAAAAACKE/8V2IEqypqQQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very clean and organized. Great selection and badass staff!', 1522990768),
(697, 148, 'Ray Garcia', 'https://www.google.com/maps/contrib/115223345531523528290/reviews', 'en', 'https://lh6.googleusercontent.com/-wLGVQ7RHEQ8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0IQuVOUoYAsSCmUv0MaqDNLoi-1A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great i walked out very satisfied thanks & i livwell be back', 1524879164),
(698, 149, 'Kiba Ferrari', 'https://www.google.com/maps/contrib/107171404567846815054/reviews', 'en', 'https://lh3.googleusercontent.com/-zYz7Rf_xOl4/AAAAAAAAAAI/AAAAAAAAAGE/YPBBUgs0ork/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'I just wanted to give you guys a heads up that we had an absolutely awesome experience with a gentlemen named Earl; he was extremely knowledgeable and very pleasant to work with. If you guys have any sort of \"merit\" system, I would suggest finding some way of \"sticking a feather in his cap.\" (I emailed almost exactly this to his manager, with very positive results) This is a company that seems to take care of its customers and its employees with great care, respect, and pleasantness. Their selection is excellent, their knowledge is top shelf, their physical layout is fantastic, and their demeanor is perfect. 5-star rating all-around!', 1526252172),
(699, 149, 'Blair Medina', 'https://www.google.com/maps/contrib/115617105197741525455/reviews', 'en', 'https://lh6.googleusercontent.com/-JK7EKnceltE/AAAAAAAAAAI/AAAAAAAAAC8/GHMfTQ6ebCM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'We live off an intersection with the Green Dragon close by, but after our first stop in here we haven’t been to the Green Dragon since. They have a really nice layout with a massive selection of not only flower, concentrate, and any other cannabis product you can think of, but they’ve got nice merchandise and a room of clones/seeds/pollen also. They’ve got it all. Really nice scale of prices too if you’re trying to save money or get the best of the best. Our cashier was Joseph B and you can really tell he puts effort, knowledge, and dedication into his work. Good job dude!', 1523138094),
(700, 149, 'samcampos03', 'https://www.google.com/maps/contrib/106621195420800703576/reviews', 'en', 'https://lh3.googleusercontent.com/--kh4I3Nhlt8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1zE3bxlPVS5oH8ithwQlx00hx5SA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Love LOVE this place!!!! I brought in a couple friends from Texas and they were very impressed! The setup, layout and condition of the building was superb. It\'s second only to the customer service provided by Mr. Joe Almeida. He was extremely patient and informative with all of our needs. I will remain a loyal customer.', 1523686673),
(701, 149, 'Viddle Rage', 'https://www.google.com/maps/contrib/117291997940748712100/reviews', 'en', 'https://lh4.googleusercontent.com/--lFu_L7g1nE/AAAAAAAAAAI/AAAAAAAAD9I/sbbVTFh-V2Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Best place to shop, the staff is very help full and know the products very well! I would highly recommend for you to check this out if you have not been here yet', 1527542537),
(702, 149, 'Quintin Larrabee', 'https://www.google.com/maps/contrib/108921605550968336137/reviews', 'en', 'https://lh4.googleusercontent.com/-tGxNuYN_Ky0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0sjh7-s1v0Ehqd7rEjqPa-Bn52Tg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Worst service and prices in town! True Story. I have HIV and I just wanted to enjoy my first experience in a dispensary. The bud tender was so rude and short because I touched the package. Saying customers can’t touch the products. Which may be true, except it’s not. I will never come back again!', 1524850741),
(703, 150, 'Zachary O\'Connor', 'https://www.google.com/maps/contrib/103156428792122410525/reviews', 'en', 'https://lh3.googleusercontent.com/-kdAl83ZxfoQ/AAAAAAAAAAI/AAAAAAAAABs/ecWOtv2mUp8/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'So I’ve been coming to this store for about 6 months now, member and everything. Pretty loyal customer despite the overpriced and usually poor quality product. But today I was turned away at the door for having a small crack on the side of my license. I understand that you have to follow regulations or what not but at the least keep it consistent. Hell, the card that I’ve been using since I’ve moved to Aurora even scanned in correctly. Just couldn’t do it apparently and the manager offered me no explanation as to why I was being turned away. Just that “she doesn’t make the rules” so suffice it to say, I’ll be taking my business elsewhere and if you don’t want stale and overpriced product from a store with no customer loyalty, I’d suggest you do the same.', 1526339361),
(704, 150, 'Jasmine Timko', 'https://www.google.com/maps/contrib/118182449373153529228/reviews', 'en', 'https://lh4.googleusercontent.com/-NlBKZzFIyAQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2vGvIVOTW9F5GE4tJ1vgtAdmdVng/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Not as nice and inviting as other places in the area. Received the wrong product and was not able to exchange once we realized it when we got to the car. When we went back in we were given only an explanation about the product. We were told we could not exchange for what we had originally wanted and had asked for. Check your stuff prior! Prices are also higher than other places around. The layout is not as straightforward and easy to navigate. Would not recomend.', 1523837391),
(705, 150, 'Mike Felps', 'https://www.google.com/maps/contrib/112649512407669233114/reviews', 'en', 'https://lh6.googleusercontent.com/-WBbdOuGTSeE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2CEfBEuS7yE61T7JfvDDojc32S1A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'This place is awesome. Definitely best dispensary experience I\'ve had. Colby was extremely experienced and helped us with our purchasing experience very much.', 1525745367),
(706, 150, 'Christian Smith', 'https://www.google.com/maps/contrib/104397800052270790289/reviews', 'en', 'https://lh4.googleusercontent.com/-JEoNvpz8odU/AAAAAAAAAAI/AAAAAAAAALw/UQr6DGPgCF0/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Well where do I start with the racist rent a cop security guard they have who told me to leave my bag in the front. When I went to the back of the store another women had a purse bigger then mine standing at the register. I guess he thought this black lil gay boy needed to steal. I wasn\'t putting my 500 + dollar bag on the ground. I have been to many dispensarys in the area with this bag and never once was asked to leave it at the front. The environment in this place felt off as well. On top of this all when I confronted the security guard he said I didn\'t see her walk in with it...... Brooooo you had one job. Check IDs and bags. You didn\'t notice she had a bag??? Bro what are they paying you for??? Your good looks can only go so far sis. So if you are black don\'t go in with a bag. Better yet just don\'t even go. It\'s not worth it.', 1524969110),
(707, 150, 'Angela Harrison', 'https://www.google.com/maps/contrib/113194661833207436958/reviews', 'en', 'https://lh5.googleusercontent.com/-eEh_xFHkGVo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1hM2m8U___JE-IJCWzVdGkmFnVqA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Friendly and helpful staff.  Very informative.  Relaxed atmosphere.', 1526346318),
(708, 151, 'DAVID THOMAS', 'https://www.google.com/maps/contrib/103907166712865042128/reviews', 'en', 'https://lh6.googleusercontent.com/-fqa646Fxf-I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq01W-8p_oN1ouaVFjH6KJqZ5Z0uag/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Love this place and the people! Never had a bad experience or anything. Isiah and Ivan are super nice and awesome! They all take the time to explain differences in product and how it effects you. They definitely do a top notch job. Amanda, Camden (or Kaymon?) All great people. Wish I could remember all the names to give props but everyone is great. Come here and don\'t go anywhere else!', 1523753143),
(709, 151, 'Jessica', 'https://www.google.com/maps/contrib/108311117638883653017/reviews', 'en', 'https://lh6.googleusercontent.com/-fAHc-V3jtmk/AAAAAAAAAAI/AAAAAAAAE2g/NuIFOTrl-pI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Open and bright floor plan, welcoming and friendly staff who are willing to answer any question you have. Recreational and they offer discount for medical card owners. Each strain of bud has a small tablet next to it that details the positive and negative effects and other stats. They have a variety of edibles, they have lotion, they have patches, tinctures, pipes, wax, pretty much everything. Cash only, but they have an atm inside. Little to no waiting.  Unlike other shops that make you wait in a room first, and buzz you in..not here, it\'s in and out pretty quick.', 1520209466),
(710, 151, 'Misty May-Dutton', 'https://www.google.com/maps/contrib/111499621648090113998/reviews', 'en', 'https://lh6.googleusercontent.com/-MDRTYRPxiKo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0UWX6vOoiFBooFLsKYQZP8-Grw3g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I went in visiting from out of state and had no problems since I do have a valid ID and I was mainly looking at edibles and vape products but they have a great selection and great customer service. It felt so futuristic inside. Beautiful layout of amazing products in little jars with tablets next to them for information ️', 1521390407),
(711, 151, 'Travis Barbian', 'https://www.google.com/maps/contrib/117463315954534869870/reviews', 'en', 'https://lh4.googleusercontent.com/-BonMCRhMOgQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ry0440JEmcByinPORMH5Q3b1K2w/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Incredibly friendly staff, very knowledgeable as well. Spacious store front that used to be a bank, WiFi included a bank vault inside. I found that oddly funny. Absolutely would visit again.', 1520029382),
(712, 151, 'Ilka Johnson', 'https://www.google.com/maps/contrib/110539136163609723390/reviews', 'en', 'https://lh5.googleusercontent.com/-HAzq6MMFRI0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2rMpeGC1Qx8jTYTkp5bHR-QaDYjw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I enjoy coming to this Dispensary, I come here at least twice a week and the staff is very friendly and the product is real nice', 1526650805),
(713, 152, 'Whitni Ray', 'https://www.google.com/maps/contrib/108071420935432752771/reviews', 'en', 'https://lh5.googleusercontent.com/-mdvYF68KUow/AAAAAAAAAAI/AAAAAAAAAAc/1kOoj_-CtEQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'The Green Solution was the first recreational dispensary we had been to and so far the best! I wish I remembered the name of the guy who helped us but he was so helpful. He was very knowledgeable and a great salesman without being pushy. He knew exactly how to describe each product and it\'s effects. The whole atmosphere was super professional and friendly. \nFor sure recommend for first timers!', 1527625095),
(714, 152, 'Sarah Morales', 'https://www.google.com/maps/contrib/102109704585746720000/reviews', 'en', 'https://lh4.googleusercontent.com/-KuOFFp4yRaE/AAAAAAAAAAI/AAAAAAAAACI/brDbWQyaLOw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'Very very satisfied with my purchase.  The staff member I spoke with was very knowledgeable about every question I had. He recommended items that best fit my personality and how I feel when I get high (so I don\'t get \"too high\")  I am very interested in returning!', 1525761871),
(715, 152, 'Stephanie Barnett', 'https://www.google.com/maps/contrib/108267835514705460874/reviews', 'en', 'https://lh3.googleusercontent.com/-uS-jPGcm9sI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3kwa41Hpj4pVn8Y9YRP994Ai3Fvg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Nice selection, great prices, super friendly staff, very clean and organized. Was allowed to take pics and a window room to see the bud being grown. Very cool.', 1525036672),
(716, 152, 'Jenni Herrick', 'https://www.google.com/maps/contrib/109392930494292165437/reviews', 'en', 'https://lh4.googleusercontent.com/-2YaC39R7zP8/AAAAAAAAAAI/AAAAAAAAABc/modIWFU-tA8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Wonderful customer service. Very knowledgeable. Spend a lot of time answering all my questions. Awesome prices. Great over all experience. I enjoy their nectarbee chapstick.', 1524705753),
(717, 152, 'Lawrence Rangel', 'https://www.google.com/maps/contrib/115781957414788347075/reviews', 'en', 'https://lh5.googleusercontent.com/-WwAMxNHet7Q/AAAAAAAAAAI/AAAAAAAABOc/uPGvlcXBIcc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Awesome layout and helpful Budtenders. Kristi D helped me out and was super knowledgeable about the products I liked. When I am in Aurora, I will always stop here', 1523107423),
(718, 153, 'Lazaro Tamargo', 'https://www.google.com/maps/contrib/117560133724941629438/reviews', 'en', 'https://lh6.googleusercontent.com/-KjO4AhGMZw0/AAAAAAAAAAI/AAAAAAAAAD4/jzwgW3uD2GA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'My favorite place to grab some yummy brownies. The staff is great at helping one out. Offered me a great discount because I told them it was my birthday. The staff asked me how old i was, I responded w 45yrs old. She said prove it and I would get a 45% discount. I was floored and so happy. She even threw in some birthday cake chocolates for me to enjoy. Thanks SO much!!! You guys are great. Will be stopping by next time where in Denver.', 1521665799),
(719, 153, 'Ron Fousek', 'https://www.google.com/maps/contrib/118322623280881656755/reviews', 'en', 'https://lh6.googleusercontent.com/-dF5CMrTFeII/AAAAAAAAAAI/AAAAAAAAUvY/-AYf10FTyx8/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a week ago', 'I felt like I was walking into an art gallery, whoever designed this place has a very good eye. Will selection here was good the customer service was excellent and the operating hours are great. If you are close to here you should stop in and give it a try.', 1526748512),
(720, 153, 'Dale Gross', 'https://www.google.com/maps/contrib/108180310244662805973/reviews', 'en', 'https://lh6.googleusercontent.com/-2UaM0b39UrM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2GXhQqp4ZpkKx0erO4nMrnICMVGA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'I bought one gram of their \"Gold shelf\" flower (\"Honolulu Strange\"), supposedly testing at 19-27% THC. I did not get high. It was a few tiny buds that crumbled easily. No expansion in the lungs, which is how I knew I would not be getting high. Pure garbage. Avoid this place.', 1525970256),
(721, 153, 'warren ballard', 'https://www.google.com/maps/contrib/104759241557466735183/reviews', 'en', 'https://lh4.googleusercontent.com/-e5CivPm3rCA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1pddx1DHxZbaeTHtzSpUR09PfE5w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Awesome place. Very professional, very knowledgeable, good selection, and good prices. My only complaint whatsoever was they didnt have any gummy bears.', 1526515972),
(722, 153, 'Jasmine Timko', 'https://www.google.com/maps/contrib/118182449373153529228/reviews', 'en', 'https://lh4.googleusercontent.com/-NlBKZzFIyAQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2vGvIVOTW9F5GE4tJ1vgtAdmdVng/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Not as nice and inviting as other places in the area. Received the wrong product and was not able to exchange once we realized it when we got to the car. When we went back in we were given only an explanation about the product. We were told we could not exchange for what we had originally wanted and had asked for. Check your stuff prior! Prices are also higher than other places around. The layout is not as straightforward and easy to navigate. Would not recomend.', 1523837480),
(723, 154, 'Clarissa Foster', 'https://www.google.com/maps/contrib/106105341553124138812/reviews', 'en', 'https://lh6.googleusercontent.com/-NNMLLhApAvo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0_OwsraYpw7jX7Qn6URL1VY9KNOA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I came in to the store this morning and was treated with a smile Zach in the front was so kind in explaining how to down load the app for my loyalty card. Zeb was very helpful with all the questions I had and showing me the new pens and Rob and Desmond also put in the input on ho they liked the new pens. They we so kind they had Cody the manager give me a discount! ', 1527265340),
(724, 154, 'lori milbier', 'https://www.google.com/maps/contrib/114695278443904346122/reviews', 'en', 'https://lh3.googleusercontent.com/-_kHhWcX-TAY/AAAAAAAAAAI/AAAAAAAAAOE/_oX1Ga-E22s/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '4 weeks ago', 'I love this chain of dispensaries but I’m not a fan of this one at all. The staff have no sense of urgency whatsoever and seem more interested in talking to their friends than they do in helping customers. Every transaction here takes such a long time and there always seems to be issues with every little thing. I wish I still lived near the Glendale location, that one is a million times better and has efficient and attentive staff.', 1525217321),
(725, 154, 'Myranda Kessler', 'https://www.google.com/maps/contrib/116196498638595958172/reviews', 'en', 'https://lh4.googleusercontent.com/-lNIZCI9kl5M/AAAAAAAAAAI/AAAAAAAADc0/MrB8fpm-Lvk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I\'ve been coming into this store location for about a year now, and I had the best service I\'ve ever had yesterday from \"Josh G\" (according to my receipt). Not only was the employee knowledgeable about The Green Solution\'s products and brand, but he provided excellent customer service. Additionally, there are often wait times at this convenient location, the front counter attendant gave a heads up about the wait before I went in and was also quite friendly. The improvements to this location are noticeable! Keep it up.', 1524248911),
(726, 154, 'Hannah Johnson', 'https://www.google.com/maps/contrib/106146505603921964917/reviews', 'en', 'https://lh4.googleusercontent.com/-1iU2_igRvbk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2kHblVAx7VAtq6RjlMNdcnBvbbDg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'This dispensary has a very friendly and knowledgeable staff. Variety of products are offered at price points suited for all budgets. I would recommend this store for regular smokers and first-timers alike.', 1527367420),
(727, 154, 'Shawn Polhemus', 'https://www.google.com/maps/contrib/104309141935708994223/reviews', 'en', 'https://lh4.googleusercontent.com/-6e2tFk3eVH0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3JxNKFqNHCDufzBES7I2DYH1VOOA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Great dispensary. Love the Parker and Peoria location staff. They are friendly knowledgeable and patient. They aren\'t pushy like other places and help find what you\'re looking for', 1526264303),
(728, 155, 'Meghan Kraft', 'https://www.google.com/maps/contrib/113813489703055698554/reviews', 'en', 'https://lh5.googleusercontent.com/-3H9K0Pns9T0/AAAAAAAAAAI/AAAAAAAAABw/gtytwCT_FWk/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 weeks ago', 'Had a specific host that was the assistant manager I think, amazing guy.  He knew his stuff and was extra helpful.  Definitely could tell we knew our stuff and that he knew his as well.  So helpful, couldn\'t get over how sweet the guy was and just how pleasant he made the experience.  Will definitely go back!', 1525587215),
(729, 155, 'Keyra Jenkins', 'https://www.google.com/maps/contrib/112334236924146781911/reviews', 'en', 'https://lh4.googleusercontent.com/-WFwSLtGtWRI/AAAAAAAAAAI/AAAAAAAAGsc/WO6lsf_Gz_s/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'I\'m glad I waited towards the end of my trip to do this review because this dispensary blew all the other ones out of the water. From the organized, well displayed products, to the best selection in town. Not to mention their unbeatable customer service! Raul & DJ were amazing! They were super friendly and extremely informative. I wish I had customer service like that every place I went. Thumbs up to you guys! Keep up the good,  positive vibes! We will definitely be back soon!', 1514440719),
(730, 155, 'Racquel Alba', 'https://www.google.com/maps/contrib/109470836757368852217/reviews', 'en', 'https://lh6.googleusercontent.com/--BRF6B0xiy0/AAAAAAAAAAI/AAAAAAAAAgc/7IOCRRw5PmU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Go here all the time awesome, fair and decent prices, especially on vaporizers and accessories! Staff is great and friendly. Don\'t shop anywhere else anymore. I love you can shop online pick up and go.', 1524187723);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(731, 155, 'Ken Keener', 'https://www.google.com/maps/contrib/109727075731368933956/reviews', 'en', 'https://lh6.googleusercontent.com/-HNIr4t-pOMA/AAAAAAAAAAI/AAAAAAAAABY/8vtijTf0-UE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I\'ve been a patron of this location since 2014. Sure there are tons of dispensaries, but how many remember your name and actually get to know you a bit?! Y\'all do!!! The product is consistent, the staff is knowledgeable and friendly, and I like the vibe I get when I walk in the door! I can\'t remember everyone\'s name but I definitely know your faces. You\'re less than ten minutes away from me and also one of the best dispensaries I\'ve visited, a win win situation! Thanks y\'all and I\'ll see everyone soon!', 1523364365),
(732, 155, 'Chuck Taylor', 'https://www.google.com/maps/contrib/102984299766894544141/reviews', 'en', 'https://lh3.googleusercontent.com/-QI7J5BvM6EQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq25vcscLZoAZY4XnsVdh_r8t1OMyA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Joseph S was our associate today, and he absolutely took care of us! We came in from out of town and he was super helpful and professional through the entire process. We will definitely be back, as we\'re impressed overall. Thanks!', 1524088225),
(733, 156, 'Katara Hayes', 'https://www.google.com/maps/contrib/113962190081985841976/reviews', 'en', 'https://lh4.googleusercontent.com/-BKvhe_SctrQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq308Atj1Ww5pwjXq2KsWRmAFH9gRw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Always have a great experience. Great products and prices. Renee is an awesome manager and will make sure you\'re taken care of. Awesome!', 1526425754),
(734, 156, 'jeff steele', 'https://www.google.com/maps/contrib/113857172510400227697/reviews', 'en', 'https://lh5.googleusercontent.com/-zplAhLNuekc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Mg0EHY18s9IhzyaHF0_c13DIMvg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Always good prices and selections! Great staff btw and great products! Keep coming back for the dank buds and concentrates!!! Andrew is', 1527041779),
(735, 156, 'Julian Jones', 'https://www.google.com/maps/contrib/118309532501827264713/reviews', 'en', 'https://lh4.googleusercontent.com/-VfKv8te1XM0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2xns9Au4T6fw-YU2vpRDHbA3pQKA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'There good friends. I hope one day we can hook up and hear some of my ideals. maybe even work here. Keep up the good work.', 1525875615),
(736, 156, 'Sasha Arbabha', 'https://www.google.com/maps/contrib/100402366871745140303/reviews', 'en', 'https://lh5.googleusercontent.com/-_r9BJDfWBtU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1mzouJZ33D3B7JZMxAEO6ujZv_Nw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'All the staff is amazing, prices and products can\'t be better! Susan is the friendliest bud-tender, I am always so happy when I get to chat with her a minute. I am always excited to come into this store because of the people and the great flower! I wanted to also give a “shout out” to Kristi, she is also a great asset to the team. Not to mention charismatic kori, he always has a smile and lighthearted conversation. All on all a very great place to come!', 1515782543),
(737, 156, 'Sedric Miller', 'https://www.google.com/maps/contrib/108498323854225507916/reviews', 'en', 'https://lh4.googleusercontent.com/-ZrH9J27pzG0/AAAAAAAAAAI/AAAAAAAACLA/c_YMbiojbyk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I enjoy going to this store. It’s close to home, and they have a diverse selection of cannabis products for competitive prices. On top of that you can order online and skip the wait! I always recommend to people just getting into the culture. Special shoutout to the bud tender  John for being knowledgeable and swift!', 1518912664),
(738, 157, 'revnak guzel', 'https://www.google.com/maps/contrib/112547356767511183907/reviews', 'en', 'https://lh3.googleusercontent.com/-Z_48VWyeNeY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1zwGR4jXb8xR5nwD1W1NXiDI6zPg/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '3 weeks ago', 'Beau and Henry are the best! They are friendly and knowledgeable. I love green dragon and come here all the time. The joints are getting smaller though!', 1525822102),
(739, 157, 'Amanda Nieves', 'https://www.google.com/maps/contrib/109758685706983448136/reviews', 'en', 'https://lh4.googleusercontent.com/-1oNrwIl5Epk/AAAAAAAAAAI/AAAAAAAAAAs/1pn2_uz8AMQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'First time visiting Aspen and had to stop by GD since I\'ve previously been to their Byers location in Denver. This place was AWESOME! Incredibly clean and the budtenders were incredibly helpful.', 1523986151),
(740, 157, 'Jacob Raab', 'https://www.google.com/maps/contrib/105334760737058942138/reviews', 'en', 'https://lh6.googleusercontent.com/-oXsl_lYojc8/AAAAAAAAAAI/AAAAAAAAr6g/aYa32YzUnHU/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, '2 months ago', 'Wouldn\'t accept a legally acceptable identification, so this specific Green Dragon establishment gets the lowest possible review. Good for you if that\'s your company policy, but see if I ever come back in the future (spoiler alert: I won\'t).', 1522468316),
(741, 157, 'Brian Heermans', 'https://www.google.com/maps/contrib/107842379317679529868/reviews', 'en', 'https://lh6.googleusercontent.com/-Ih6mTvHMyDA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq34v21x0fdia-SpLCCrDysKy-k1Fg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great experience in the staff and great selection in the store. Prices are reasonable, and the quality is top notch! If you are ever in Aspen, drop by Green Dragon to see for yourself!', 1521845991),
(742, 157, 'Casey Jensen', 'https://www.google.com/maps/contrib/104014205001734784407/reviews', 'en', 'https://lh3.googleusercontent.com/-gxXqYzKGoxI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2BlbNCpoTQK1l8sw8lzFPwyDApXQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'So I get that the staff here must get a lot of repetitive and what must appear to be stupid questions from out of towners, who don’t know the law or even how to partake with some of the new technology.\nWhat’s not appreciated is the rudeness, impatience and intolerance they answer with. I have noticed that there are a lot reviews here that mention this behavior I wonder if it’s always the same guy or something this place breeds. There are a lot of shops up there with plenty of nice people we’ll be going there from now on.', 1520914682),
(743, 158, 'Kashena Ragland', 'https://www.google.com/maps/contrib/107878925649012052528/reviews', 'en', 'https://lh4.googleusercontent.com/-iYRONt5HC1c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq219hh7NIaAbi6ujjIpZSbSvP7R4Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a week ago', 'This will be my first time shopping here, read some reviews and caught my interest. Great staff, good product and price always draws me in.. so I know this will be worth the trip', 1527023957),
(744, 158, 'Brian Gregg', 'https://www.google.com/maps/contrib/101666746463972193133/reviews', 'en', 'https://lh4.googleusercontent.com/-4s-T6eOV688/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3FC-pjrnoEGg-3tLSFaFtCS_Q1_Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'These guys prey on tourist and charge twice as much as other dispensaries.  I questioned the budtender and he got weird about the pricing and I foolishly went along with it.  Don’t make the same mistake I did, take your money and run to a reputable dispensary.', 1524359926),
(745, 158, 'Jason Murray', 'https://www.google.com/maps/contrib/114087484744666012330/reviews', 'en', 'https://lh6.googleusercontent.com/-enB13Fu49uE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0J9UXaN8z9iNMaD2VsqbZjps6_Sw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Same as other den-Rec. Unflushed buds. They taste gross. I have an ounce of pure kush I can’t even finish because it’s not flushed', 1526571377),
(746, 158, 'Fritz Mars', 'https://www.google.com/maps/contrib/100445595057010133010/reviews', 'en', 'https://lh5.googleusercontent.com/-TBl7tK38jjs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0U0FABYxiINY-UMRquHNcEFvwxVQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '4 months ago', 'Living in a state that has yet to really even acknowledge marijuana\'s existence, visiting this dispensary was really exhilarating. The stigma surrounding weed has gone on long enough, has it not? The folks who talked to me were very knowledgeable about the products they sell, as well as the positive impact legalized recreational use marijuana has had on Colorado\'s economy, for the individual and the government. When this state becomes ready for tax revenue unlike anything it\'s ever seen and show the country that we here too would like to live in the 21st century like much of the rest of the country, I will happily partake in the celebration.', 1515203138),
(747, 158, 'Jack Ogden', 'https://www.google.com/maps/contrib/114044729057387805239/reviews', 'en', 'https://lh4.googleusercontent.com/-Qh3mVUCcU_g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq27xM35Ik1-1K4R7KGI10bx9CN1yw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'I think this is the most decent and down to earth dispensery,and that\'s important to me. God bless them for that!', 1525574337),
(748, 159, 'Devin Galaspie', 'https://www.google.com/maps/contrib/100890908006358582708/reviews', 'en', 'https://lh5.googleusercontent.com/-IbM4ldTHV7k/AAAAAAAAAAI/AAAAAAAABfM/RDAEQvuuaXI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '3 weeks ago', 'First time in and the front desk guy was great and friendly, very welcoming. Then we walked in and I didn’t catch her name but the woman working today helped us. She had a bit of an attitude like she didn’t want to be there or help us. Any question I asked her about the O.Pen vaporizers and the cartridge compatibility she didn’t know and didn’t find out which is what anyone working in retail/cs knows to do. If you don’t know, you find out. Then we asked if they had any of the “kaviar” or “space rocks” and she almost seemed offended we asked haha we are in town visiting and this is a rec and med facility so if I want to try a “specialty” bud that I can’t get at home don’t judge.. the prices for the cartridges were very expensive compared to other retailers. It was almost double the price for a plastic .5g cartridge and I got the same cartridge and amount in a metal cartridge (both o.pen branded) elsewhere which is what made me leave. Thought other reviews said prices were great, maybe on just flower and wax? They also don’t sell any attachments for the o.pen but advertise it heavily', 1525573793),
(749, 159, 'SMART Bodywork', 'https://www.google.com/maps/contrib/118274586707172733019/reviews', 'en', 'https://lh6.googleusercontent.com/-VAEeIIDYSeY/AAAAAAAAAAI/AAAAAAAAAgk/mfoZSQgsD0E/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Mark is not just a bud tender, but THE bud tender. Took time to speak, inform, educate and teach me on all of my professional options in the vape pen world. Really glad I decided to go into this location tonight and I’m definitely gonna Be a regular here! Thank you again Mark! \n\nFYI, cash is king but using a card is an option, that does come with a $2.50 fee. Either way you’ll get excellent service. Everyone was smiling and welcoming and the facility is very clean and easy to maneuver through.', 1517372209),
(750, 159, 'Mitsie Babby', 'https://www.google.com/maps/contrib/103025175970795460433/reviews', 'en', 'https://lh6.googleusercontent.com/-0_OopiqByGY/AAAAAAAAAAI/AAAAAAAAAAk/b4glNApZxBM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Wow what an amazing staff. I have to give them kudos for not only providing good customer service, but great community service. I had an unfortunate incident with a road rager. Green Dragon was the closest place I could go for help. The staff (Counter Girl (sorry I didn\'t get your name) Mark and Dee) was able to provide a safe and comforting place till I was able to leave. Thank you for everything!!!!', 1518643423),
(751, 159, 'Jon Crooks', 'https://www.google.com/maps/contrib/103309974500486581456/reviews', 'en', 'https://lh6.googleusercontent.com/-T0Gz54inuHQ/AAAAAAAAAAI/AAAAAAAABtU/17UKNTJvhc4/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '4 months ago', 'Great bud. What makes this place stand out are the staff. All the staff I have met are wonderful but I have to point out the exceptional job Mark and Wolf do. They have taught me so much. Very knowledgeable and friendly!!!I never feel rushed and always satisfied and always leave in a good mood.', 1516565810),
(752, 159, 'Cherish Longaberger', 'https://www.google.com/maps/contrib/105147123981304379039/reviews', 'en', 'https://lh4.googleusercontent.com/-_Iv3QxtoCI0/AAAAAAAAAAI/AAAAAAAAB7U/wCbCLLdV2eU/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'This is by far once of the Nicest dispensaries around. Everything is so beautifully displayed with clear pricing, it is well lit enough to be able to see all the products and the people who were working were great. I would recommend this place for sure!', 1521838775),
(753, 160, 'Patty Knapp', 'https://www.google.com/maps/contrib/117460526540866445700/reviews', 'en', 'https://lh6.googleusercontent.com/-IcLxcT9aPas/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Z6iV118jcknUde0BV1aIW21a7yw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Diego Pellicer on Federal & Alameda is the nicest marijuana retail store I have been in!  The staff is professional and very knowledgeable.  This is not your typical store.  If you are looking for a high-end marijuana store, look no further.  This store should be the flagship for all other stores in the industry.  This industry is here to stay; if you ever had a doubt about the professionalism of the industry, visit the store.   The owner and his team are committed to excellence.', 1525910214),
(754, 160, 'Dairy State Vegan', 'https://www.google.com/maps/contrib/107013653894970487056/reviews', 'en', 'https://lh3.googleusercontent.com/-m8fYB2J4QQE/AAAAAAAAAAI/AAAAAAAAAHY/TclBA_XJP5g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This dispensary is BEAUTIFUL.  It has an upscale and classy vibe with extremely reasonable prices and unbeatable sales.  Their selection is huge and it\'s all of high quality medicine. Byron Gladys is great: doesn\'t rush me at all, gives me privacy while still being there to answer any questions.  He is very knowledgeable as well as Veronica - she was honest, caring, and so helpful and knowledgeable! We ALWAYS stop here when we\'re in town!', 1523380955),
(755, 160, 'Bethany Sikes', 'https://www.google.com/maps/contrib/118392980290146034997/reviews', 'en', 'https://lh3.googleusercontent.com/-uXPQ7wKLDDo/AAAAAAAAAAI/AAAAAAAAAF0/NYmoyHJa1C4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '3 weeks ago', 'Nice place with some solid good deals. Some staff is more friendly than others, some seem to take questions about the products personally. I like how the prices include tax so the bill doesn\'t jump 20 bucks at the counter! This is where I take out of town guests for a classy experience.', 1525708173),
(756, 160, 'Amanda McGarry', 'https://www.google.com/maps/contrib/103978227424748669145/reviews', 'en', 'https://lh4.googleusercontent.com/-cqghNiBrKXQ/AAAAAAAAAAI/AAAAAAAABDU/9LHu12oVYss/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Came into Diego Pellicer for the first time the other day and will be coming back! Jessica who helped me was very knowledgeable and made great recommendations and introduced new products I hadn’t seen before! Overall the shop felt really comfortable, has a great aesthetic and most importantly a great selection of products at fair prices. Friendly service, serving buds with a smile! Thanks!', 1526316546),
(757, 160, 'Daniel Garza', 'https://www.google.com/maps/contrib/102444725118798742259/reviews', 'en', 'https://lh4.googleusercontent.com/-KHYC4oFWorY/AAAAAAAAAAI/AAAAAAAAABo/DHpyGaMvLes/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'Stopped in recently on 4/20 to pick up some of their incredible specials advertised in Westword.  The product was really good, some of the best I’ve ever tried in Denver.  The selection was good and the customer service was some of the best I have experienced at any dispensary.  This is by far the best location in town for fair prices, great selection and superior customer service.', 1525192817),
(758, 161, 'Casey Van Gundy', 'https://www.google.com/maps/contrib/108399033728940661803/reviews', 'en', 'https://lh4.googleusercontent.com/-DnSdzI7iEqI/AAAAAAAAAAI/AAAAAAAAAxA/wEDgl_WYl9U/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '3 months ago', 'Great option for local dispensary.  Good flower, but much better concentrate selection. Not only their own, but they carry of ton of every brand.  Very nice variety.   Member program does give you some cash back after a while.  Ben is the $hit at this location!   Smart, energetic, and very knowledgeable about anything in the store. He will always treat you well.', 1518674712),
(759, 161, 'Kathleen Wilbur', 'https://www.google.com/maps/contrib/114207761927013394971/reviews', 'en', 'https://lh4.googleusercontent.com/-3UwmWONUI6Y/AAAAAAAAAAI/AAAAAAAA1Fk/9zQLsGZ2JEs/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 4, '2 months ago', 'Great place. Staff are tremendously helpful.  Great supplies with a lot of different options.  Nice clean space in a decent area.', 1521408725),
(760, 161, 'JV123', 'https://www.google.com/maps/contrib/113723418699759821159/reviews', 'en', 'https://lh4.googleusercontent.com/-1CkMtPurd50/AAAAAAAAAAI/AAAAAAAAA4U/Eo6MRxROj_Y/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 2, '2 months ago', 'The quality of the cannabis is that of cheap wine. The prices are also ridiculous, $9 for a single joint, get outta here! I would recommend avoiding this place like your mother-in-law and going to another dispensary. This place is so bad even the bud tender told me they go elsewhere .', 1521327597),
(761, 161, 'Amanda Crawford', 'https://www.google.com/maps/contrib/110911546295699473778/reviews', 'en', 'https://lh6.googleusercontent.com/-WTiZDo-AMUE/AAAAAAAAAAI/AAAAAAAASnQ/pF8ofDk3ArM/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'Excellent staff! Excellent prices. Most the time you can find what you\'re looking for, but if not, they are happy to point you in the right direction to one of their other locations and will even call in advance (if they aren\'t busy) for you to be sure you get what you want!', 1520143757),
(762, 161, 'Jessica Brandt', 'https://www.google.com/maps/contrib/118075777886298109269/reviews', 'en', 'https://lh4.googleusercontent.com/-9YQElesRVVw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Xvucc40PhzK-zMo-WYe4oViSjGw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Best staff!! Always friendly and helpful!! Prices are great!! Run amazing specials and always do their best to get you in and out of the door with what you need. Never a bad conversation always a pleasant experience. ️', 1512146051),
(763, 162, 'Christie Radko', 'https://www.google.com/maps/contrib/116417997717908679393/reviews', 'en', 'https://lh6.googleusercontent.com/-ExAgj1hpj1Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2lYPjYzTtlABNuKVPnngcUuWmvSg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Had the best time visiting your Trinidad location. By far best quality of the 3! Don\'t waste your money or time with the other two! Best staff, quality n deals. Can\'t wait to come back n see u guys!!!', 1523636156),
(764, 162, 'Gavin Day', 'https://www.google.com/maps/contrib/112472664152225756184/reviews', 'en', 'https://lh6.googleusercontent.com/-XWZrY6VxWO8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq29Xh3xLpXha1xGyjm2aKV9jZffrg/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'I went up to LivWell Trinidad and found great bud at amazing prices. I also found great customer service. We ended up having an issue where my bank account was charged twice but LivWell sent me home happy and worked with me to get the issue resolved! 8/10 definitely going back!', 1520565703),
(765, 162, 'Travis Soumis', 'https://www.google.com/maps/contrib/110855138085447381353/reviews', 'en', 'https://lh5.googleusercontent.com/-izn_a2CetD8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0HWvtVZMaFaoXS4y4HFedZQYkdOA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'First time visitor.  Staff was incredibly friendly.  We were looking for a specific product.  They didn\'t have the brand we were looking for but we found something similar.  Left very happy with our purchase.', 1523040559),
(766, 162, 'ramon karakani', 'https://www.google.com/maps/contrib/115881724405958514120/reviews', 'en', 'https://lh5.googleusercontent.com/-uNaBeQOJRv0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2y6qJoKDl7mAgC9ufLVS_050vQbQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Awesome dispensary great staff really good quality items. Will deff go back and highly recommend!!', 1526518406),
(767, 162, 'Mark Jackson', 'https://www.google.com/maps/contrib/102844194530947557737/reviews', 'en', 'https://lh4.googleusercontent.com/-48qnw8dHV2g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0lj1HI-WGy6gnYFaFEP0Uf8Y0CQg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Brittney was one of the best budtenders my friends and I have had!!! And I have been to my fair share of dispensaries! She was patient and kind and super knowledgeable..... you can really tell the difference when someone genuinely cares! Thank you', 1519657791),
(768, 163, 'Karasan Lord', 'https://www.google.com/maps/contrib/105432563470274874757/reviews', 'en', 'https://lh5.googleusercontent.com/-2SL9K60D00w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0CZ7R5T-Th-Zrn8Irm_R6BhETVrw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'My favorite place ever!!! They are great, experienced, and are super nice!!! Best products and very organized. Best customer service and a wonderful experience!!! They have wonderful hours & are open until 11:45pm  also you can call in an order go pick it up too for better convenience  Check it out people... You are goonna love it like I do ', 1524610545),
(769, 163, 'renee moreno', 'https://www.google.com/maps/contrib/116339165477883099727/reviews', 'en', 'https://lh5.googleusercontent.com/-okTaJmzmI-Y/AAAAAAAAAAI/AAAAAAAAAI8/oaxEgmTlWbA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'The Green Solution Edgewater dispensary is in a great location for anyone in the Denver Metro area. They stay open until 11:45 pm every night and when I am in need of flower in the morning I can come as early as 8, which is very convenient for me. The staff is awesome, the General Manager Jeremy is always helpful and makes sure customers walk out satisfied. The budtenders have a wealth of knowledge and listen to your needs to find products suited for you. I don\'t get the great customer service or individualized attention at any other dispensary that I get from The Green Solution. Make sure this is your first stop and you won\'t need to make another trip.', 1527434529),
(770, 163, 'Chynna Lucas', 'https://www.google.com/maps/contrib/103446908471389921805/reviews', 'en', 'https://lh3.googleusercontent.com/-wBbhT2-jZgY/AAAAAAAAAAI/AAAAAAAAACE/uB7odJXrNxQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I had a great experience. I\'ve been to many dispensaries trying to find one I can go to consistently. I\'ll definitely be back to this one! The staff was very helpful and knowledgeable. Prices aren\'t outrageous and the wait time was minimal.', 1527632582),
(771, 163, 'J.G. Schirf', 'https://www.google.com/maps/contrib/112192031654746512324/reviews', 'en', 'https://lh6.googleusercontent.com/-4gqS_kkGhB0/AAAAAAAAAAI/AAAAAAAAAEY/KNQouvjrfyc/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'in the last week', 'My main issue was just how overpriced their products were, but I didn’t have a very positive experience here as well. \n\nI waited probably 10 minutes at the front of the line while there were very few customers in the store. Not usually an issue, but I was just watching half of the staff talking to one another behind the counter and these guys were asked twice by another employee to help me in line and they just shrugged. Finally, when one of these fellows did come over, they were not very helpful, nor informative, and not particularly friendly. When I would ask questions about the flowers or cartridges I was responded with one word answers, eye rolls,  and directed to the most expensive option of product. ($14 grams? Seriously?)\n\nThere are much cheaper and friendlier stores around Denver I would recommend over the green solution.', 1527552927),
(772, 163, 'Arin Stinnett', 'https://www.google.com/maps/contrib/107230824924616043804/reviews', 'en', 'https://lh3.googleusercontent.com/-Io9rC1H_53E/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq23wqdwDCRABwN7JK46OUEyBYoYqw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'Out of all the dispensary\'s we travel to in Colorado this is definitely our favorite in Denver. Staff was very informative and super sweet.  We will always come back when we are in town.', 1526863502),
(773, 164, 'King', 'https://www.google.com/maps/contrib/109058395874875459160/reviews', 'en', 'https://lh6.googleusercontent.com/-dmJcBimjNaA/AAAAAAAAAAI/AAAAAAAAARc/tbXyRnCDAr8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Been going here a couple years now. Dr. Pryor is always very helpful and informative. Everyone here is very friendly and I’m looking forward to going here for years to come\nfor my renewals!', 1525071220),
(774, 164, 'Christopher Corn', 'https://www.google.com/maps/contrib/113760280120586664156/reviews', 'en', 'https://lh6.googleusercontent.com/-3hWtX5U4GnM/AAAAAAAAAAI/AAAAAAAAAZM/NVfXVnLE03I/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '5 months ago', 'Dr. Pryor was great and I had a great conversation with him about dogs. His staff was helpful. Although they did seem a little unsure of things when it came to timelines and details. 100 bucks is pricey. But the overall experience wasn\'t too shabby.', 1512655926),
(775, 164, 'Donny Reid', 'https://www.google.com/maps/contrib/115431841925922405228/reviews', 'en', 'https://lh6.googleusercontent.com/-LJkiZUKrN4U/AAAAAAAAAAI/AAAAAAAAA8w/MoilvPPX9bo/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 3, '5 months ago', 'Cancelled my appointment (it was the first place I called in trying to get my med card), but their earliest availability was nearly a week out. Tried a walk-in place instead and had by card the next morning. Also, in trying to cancel the appointment, I called before they opened and left a voicemail requesting to cancel, left my number and requested they call to confirm it was cancelled. Didn\'t hear back for a day, so I called. It took multiple calls of endless ringing, hanging up and trying again before they answered to quickly say \"Doc Morrison please hold\" and throwing me on hold for 5 mins. At least ask, can I please put you on hold? I would\'ve said yes. Overall felt my experience (which was only over the phone, never actually went in) was rude and back-burner-status.', 1512674072),
(776, 164, 'B-Boy Bungus', 'https://www.google.com/maps/contrib/104144926461316947577/reviews', 'en', 'https://lh5.googleusercontent.com/-s6rgcK-U5rA/AAAAAAAAAAI/AAAAAAAAABk/tkZD47_MEM8/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Would\'ve been my third visit, but won\'t be back due to a combination of bad attitude and ignorance on the part of the scheduling/front desk staff.', 1522781049),
(777, 164, 'Smokey Reyes', 'https://www.google.com/maps/contrib/110526274631769108498/reviews', 'en', 'https://lh6.googleusercontent.com/-Q6RpNrpb6Jc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1o15mAmutLdTGz5nWodJukYT0QRg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'return customer, years in a row. Dr. cool af', 1521782203),
(778, 165, 'Ashley Cowan', 'https://www.google.com/maps/contrib/112012510926125136636/reviews', 'en', 'https://lh3.googleusercontent.com/-pdWfMfzAnyE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1TaZQzjOex8z4orJNEo4klkmeHzQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great experience! \nthe girls up front were so sweet, and personable! \nthe doctor, gave me great advice and helped me understand the whole process. \ncan’t say enough good things about them, i will definitely be returning, for my follow up visit/card renewal!\nthanks medical alternatives! \n& to the girls at the front desk, enjoy your little get a-way coming up! :-)', 1522521010),
(779, 165, 'Chris Tx', 'https://www.google.com/maps/contrib/116206506634088795377/reviews', 'en', 'https://lh3.googleusercontent.com/-t8e0RWPoTkw/AAAAAAAAAAI/AAAAAAAAAAo/K107RXNTNl8/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 weeks ago', '5 star clinic, I had a great experience. (Springs location) the two ladies in the front office were very nice and helpful. This was my first time to apply for medical marijuana, I\'m new to Colorado. They take walk-ins and appointments. @ 20 min to do your paperwork and make an account with the state. The doctor was perfesional about what he was doing in my opinion. He gave me information about products, ask questions about my medical condition, etc. He was definitely not there to just hand out free marijuana recommendations. I am over 30 so I wasn\'t required to bring medical records, but I did anyway and it made the visit alot smoother also. And lastly the lady you see at checkout was also very nice and helpful about the whole process. Spent about 30-35 min here. Great first experience, and I don\'t see myself going anywhere else.they also have discount coupons online located with the search results for the clinic. I only payed $80 for my visit, and $16 for the online state app. They have a free notary at the clinic, check this place out', 1526208240),
(780, 165, 'Sam Garcia', 'https://www.google.com/maps/contrib/110805270043155820822/reviews', 'en', 'https://lh5.googleusercontent.com/-crpv41ozT-Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2xnyjrkjwXYPM8oQBzLN4JWXQyHA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Had to get a renewal, the staff was great,the doctor himself however, was not. Didn\'t evaluate me, looked over my paperwork and denied me for not having medical records. Explained to him that I had recently moved from Denver and was unable to access my records. I\'ve had my card for years with no issues.  Even after I got another medical record that did work he still didn\'t evaluate me,  just looked over the paperwork. Didn\'t ask my pain level didn\'t even bother asking what happened and why I was getting a card. but if I would of have said I had cramps with no medical record I would of been approved like nothing. He clearly doesn\'t care. I don\'t appreciate jumping through hoops to prove I need medical treatment.', 1523040192),
(781, 165, 'Abraham Castillo', 'https://www.google.com/maps/contrib/105744909813690224159/reviews', 'en', 'https://lh6.googleusercontent.com/-NvxzhmwCMgs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0dNNM2H11hsXgvA-isCdOmiMgeYg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Got my card a year ago here from DR. Reimer and the experience was great and easy. Reception was very friendly both visits. \n\nWent now and got denied my renewal by a different doctor since I had no paperwork despite not needing it prior. Still got charged half the price for the visit just to fill out paperwork and get told no.  \n\nUnless you want to spend $45-50 to then be told you cannot get a card I would try another clinic.', 1526533813),
(782, 165, 'William Smith', 'https://www.google.com/maps/contrib/107727794072315027529/reviews', 'en', 'https://lh5.googleusercontent.com/-uDbBhJUr1YM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3GgQjxUGLRqPsP_JL4pJZS4De5Zw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This office was and is everything I expected and more. Pete was my first point of contact and he guided me through everything I needed to know for my application, and documents that I needed for my appointment with the Doctor. This is a very, very busy office, but I was treated with dignity and respect as in any other medical facility. I highly recommend a visit or at least a phone call if you are hesitant about filling out an application. Everybody is extremely knowledgeable about this highly volatile subject that is helping hundreds and thousands of people worldwide. I can only hope that the people that make the decisions for the betterment of this country will open their eyes, hearts and minds and at least allow proper testing of this incredible, NATURAL, God-given plant so they can see for themselves what an incredible gift we have. Relaxed and comfortable atmosphere.', 1519947324),
(783, 166, 'Debbie Conca', 'https://www.google.com/maps/contrib/103421337446345151741/reviews', 'en', 'https://lh5.googleusercontent.com/-1amsEJtipWk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Rdvjr06d6smKIRQea9myq1kNrUw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'This place has it together and was so helpful. I couldn’t get registered and I came in and within 10 minutes I was registered. They saved me so much Frustration. I highly recommend this place to get your card. They are very professional and friendly not to mention very helpful. This is the only Doctors office I will ever go to get my card. Thanks MMD Medical Doctors your #1 in my Book.', 1525823030),
(784, 166, 'Joseph Smith', 'https://www.google.com/maps/contrib/115640146354215501549/reviews', 'en', 'https://lh5.googleusercontent.com/-J3AAOKTKIG4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1DIYn33EEAb-JkmgZrCQmJa8g_ww/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Great place to get your card. Had to wait a while, but it was on a Saturday morning, so it was really busy. They\'re efficient and fast. The staff isn\'t rude, the guy is just kind of a smart a&&, which breaks up the monotony. Glad I did it, I saved the money I spent on the doctor and state fee in one trip to a medical dispensary for my edibles. Got 4 months worth for what  it used to cost me for a months worth. Do it!', 1524101138),
(785, 166, 'Andrew Tijerina', 'https://www.google.com/maps/contrib/117564047434039473997/reviews', 'en', 'https://lh4.googleusercontent.com/-tEv71o5FBYk/AAAAAAAAAAI/AAAAAAAAAPI/kFP2dSDyjtM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I went in as a walk in and was out before my hour and a half parking meter was up. Dr. Hong was professional and friendly. The staff was helpful and extremely friendly. I would recommend anyone to Dr. Hong. I\'ll be back here to renew next year for sure./ so now it’s next year and it was just a painless as the first. Dr. Hong for pres!', 1523659029),
(786, 167, 'xxnonnak', 'https://www.google.com/maps/contrib/101510817600098980389/reviews', 'en', 'https://lh3.googleusercontent.com/-kV3G0DKosVQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0W1LTtK3eI-QjypUeDrtX13zHk8A/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 2, 'a month ago', 'Not the worst dispensary but I definitely won\'t shop at a Green Solution again. Waited over half an hour on a Sunday evening for a $70 fourth of standard shelf. I usually go to The Herbal Center but was in the area and figured I\'d try something new. Bud is just as good as anywhere else but not worth the extra wait like others have mentioned and the higher price .', 1524502043),
(787, 167, 'Scott Summers', 'https://www.google.com/maps/contrib/108578479854031500387/reviews', 'en', 'https://lh3.googleusercontent.com/-UYNXxF7l1QQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2tNxow4pYyaSMwfVz2r9zaKrWjxA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'They have great prices and a great staff. Every time I come through Denver I stop there. They have very affordable flower and now they have affordable prerolls. Their wax is a little pricey, but their rewards program helps offset the costs.', 1523508880),
(788, 167, 'Eugene Hopkins', 'https://www.google.com/maps/contrib/103345176369209536537/reviews', 'en', 'https://lh3.googleusercontent.com/-Mj9bfdnipmc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3F_BH08pQBuH1HAOrbwHrW8lVfPQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Love the store, so beautiful, definitely not what I was expecting walking into my first dispensary!  Staff was super friendly, and management handled themselves extremely professionally.  Going to recommend to everyone back home in IL, heard they have a few stores out there already!', 1524954870),
(789, 167, 'Mike Young', 'https://www.google.com/maps/contrib/115165916992405684142/reviews', 'en', 'https://lh5.googleusercontent.com/-UrJh-rFHmFE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1A1GEwbiTXP9jXP7koabFFRhmzRw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great first impression for my very first dispensary. Very modern and welcoming. Even grandma felt comfortable!', 1524787061),
(790, 167, 'Katara Hayes', 'https://www.google.com/maps/contrib/113962190081985841976/reviews', 'en', 'https://lh4.googleusercontent.com/-BKvhe_SctrQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq308Atj1Ww5pwjXq2KsWRmAFH9gRw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The havana store and northglenn are my favorite. They always have the best products and management is awesome at both places! Love tgs', 1526607016),
(791, 168, 'Lori LeMay', 'https://www.google.com/maps/contrib/100715523642167412744/reviews', 'en', 'https://lh4.googleusercontent.com/-s6dpmiSOwoM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0blYF2AmF4olrL15lYywEZJh00jg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'On vacation. Stopped in, very friendly and knowledgeable. I don\'t know if I would be in this area again but if I was I definitely come back.', 1524423480),
(792, 168, 'Sean mauer gopro', 'https://www.google.com/maps/contrib/106773325072928905786/reviews', 'en', 'https://lh3.googleusercontent.com/-o-JiW1sscKk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq16nTVxBWMHdF2aPxRtxDObc5KACw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very helpful each time I\'ve had a question or two. The customer service is top rate. And have put them selves as my go to store. Thank you Green Dragon.', 1523992651),
(793, 168, 'Kierra Durham', 'https://www.google.com/maps/contrib/105519745738066813204/reviews', 'en', 'https://lh5.googleusercontent.com/-3RRMPf3XKbQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1QfGZLcD4iquLpNsKr30fikfSoqw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'First off our Budtender Henry, I believe was his name, was super awesome and friendly. Took his time with us and showed us the everything from the edibles to the flowers to the concentrates. Even suggested some great places to eat afterwards. The selection was decent, had some strains we\'d never heard of. Great place to stop and easily accessible to truckers . Thanks Henry. Hopefully we can find those silicone bongs online.  we appreciate you guys', 1518043725),
(794, 168, 'Ken Bry', 'https://www.google.com/maps/contrib/110570888029815208208/reviews', 'en', 'https://lh5.googleusercontent.com/-18inYm6DJlM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0RLRahdmKlsE63CBiAQJMC4D5VwQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I got some great strains and an awesome hoodie. Thanks to Chrissy and Eric for being so kind and welcoming!!', 1522067833),
(795, 168, 'Dean Moriarty', 'https://www.google.com/maps/contrib/100147915298630593801/reviews', 'en', 'https://lh3.googleusercontent.com/-lvhLcga0sAk/AAAAAAAAAAI/AAAAAAAAAH0/XxR1TJcXpOo/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '5 months ago', 'Best dispensary I visited the entire time I was in Colorado. Couple of relaxed but very knowledgeable and helpful guys tending bud. Very chill place compared to the other bud stores we visited.  Would most highly(see what I did there) recommend this place for all ur bud needs.', 1514606254),
(796, 169, 'Hannah Harvel', 'https://www.google.com/maps/contrib/117358399639742688892/reviews', 'en', 'https://lh4.googleusercontent.com/-rJRx2S2nnDs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1cBEiIx8nyV70VCUneP7MV42R0GQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great Service, wonderful prices, and best of all? Orgasmic products. The friendly staff will blow your mind, and the relaxed atmosphere will have you leaving relaxed and looking forward to getting home (: Thank you to the young lady that made my first trip a very positively memorable one!', 1523750650),
(797, 169, 'brian locket', 'https://www.google.com/maps/contrib/103066193987678848969/reviews', 'en', 'https://lh5.googleusercontent.com/-ck2nV-Kqhqo/AAAAAAAAAAI/AAAAAAAAADo/11e_m1cRipk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Very busy but that\'s because it\'s a great place to go. Everyone was helpful and nice. Thanks for getting me in and out so quickly. Parking in the back is best if you have a smaller car. It\'s very cozy ', 1523136225),
(798, 169, 'NewGoldStandard', 'https://www.google.com/maps/contrib/110867646909447500077/reviews', 'en', 'https://lh5.googleusercontent.com/-s3dmtXFb1uA/AAAAAAAAAAI/AAAAAAAAAC0/uz2m6JCgiBQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '2 months ago', 'it\'s a pretty good store... their prices are reasonable, but try to catch one of their specials to really get a good deal. that can make a BIG difference!\nenjoy! also, they have parking in the back that isn\'t obvious as well on the street (around the corner). just be sure to drive down about a half-block, as immediately around the corner is no-parking.', 1521169061),
(799, 169, 'Bryan Hausman', 'https://www.google.com/maps/contrib/109591101238637836549/reviews', 'en', 'https://lh6.googleusercontent.com/-9_PHTBkcqEQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3fJfVON7HNETHBD-GXlIQCAqD-Bw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'I worked for this company for nearly a year in the packaging department. I witnessed activities and conditions in the warehouses that I can only describe as disgusting. I can personally recall dozens of instances when mildew was found in the product and we were told to \"just package it anyway\". The product sold here is covered in filth and chemicals, and I would recommend it only to my enemies.', 1527087825),
(800, 169, 'Nathan Norcutt', 'https://www.google.com/maps/contrib/102313280381513815140/reviews', 'en', 'https://lh5.googleusercontent.com/-MXsiXqRNhWw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1XXnUhP1x3JTkzF2-wjirvWDOhQg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I like this company, i have thought that before about alot of other dispensaries, but i think i may have finally found the one! Fingers crossed! They have a great med side with prices and quality products to match, at least on bulk. But why wouldn\'t you buy in bulk?', 1523547069),
(801, 170, 'Donny Reid', 'https://www.google.com/maps/contrib/115431841925922405228/reviews', 'en', 'https://lh6.googleusercontent.com/-LJkiZUKrN4U/AAAAAAAAAAI/AAAAAAAAA8w/MoilvPPX9bo/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, '5 months ago', 'Quick, painless. Walked in, filled out some forms (brought medical history, applying because of migraines), and had everything I needed and was out the door in ~30 mins. Had my card in hand (printed at home) the next morning. The place is a tad hole-in-the-wall, barred up windows out front. But, all employees were well informed, proficient, and the Dr. was sincere, polite and very friendly. Would recommend if you don\'t mind a $20-40 up charge on the service (non walk in, appointment places are a tad cheaper, but not as quick).', 1512674298),
(802, 170, 'David Gallup', 'https://www.google.com/maps/contrib/102767512408133416189/reviews', 'en', 'https://lh3.googleusercontent.com/-TL4rwrAEeDo/AAAAAAAAAAI/AAAAAAAAAAU/oVoe2D39fX0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Fast and friendly service, going back next year. Recommend to everyone to go there', 1526779641),
(803, 170, 'Grim Durty', 'https://www.google.com/maps/contrib/106305117928552057169/reviews', 'en', 'https://lh3.googleusercontent.com/-dcSGJ69c3OU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1loHVabaaL8LF6rbBRq0s5I8sEyg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 3, '2 months ago', 'The exam was fast which was nice, the Doc. Was great, but they didn\'t charge the price on the coupon.', 1520292316),
(804, 170, 'coleman rossel', 'https://www.google.com/maps/contrib/100311229176910642017/reviews', 'en', 'https://lh3.googleusercontent.com/-hGQi0IgU3Qs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0GYqJKGdrCTLJM4G3P836-CfppDA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '5 months ago', 'Hands down one of the most friendly and EDUCATED staff around. They were incredibly helpfull and fast about the process', 1513291578),
(805, 170, 'Bryan Murillo', 'https://www.google.com/maps/contrib/100745619890552616855/reviews', 'en', 'https://lh4.googleusercontent.com/-zzaG4jNU_00/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0zQ_ThwJ70P5GHBiF1LnuxC_VJaA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'I want to thank red card district for treating me like a human being. I went to MedEval clinic for my renewal and they made me feel like a straight up criminal. Positive vibes and good people here. The doctor is a sweet older gentleman, that clearly has a lot of life experience underneath his belt. Stay away from MedEval clinic in centennial.', 1504732095),
(806, 171, 'Misha Zubovnik', 'https://www.google.com/maps/contrib/114352720995089386008/reviews', 'en', 'https://lh4.googleusercontent.com/-x9nXy6ZqgCs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq16ckHINK5OcV80jhp7xLeG9Y96bA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'Best Doctor that I am aware of in the state.', 1521839949),
(807, 171, 'Nash Chandranatha', 'https://www.google.com/maps/contrib/107939965625707515968/reviews', 'en', 'https://lh6.googleusercontent.com/-WzEgmnm_Y9Q/AAAAAAAAAAI/AAAAAAABR8M/fspj61KT0js/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '5 months ago', 'A great, caring doctor. I\'ve been coming here for years.', 1513466485),
(808, 171, 'Dan Stratford', 'https://www.google.com/maps/contrib/103549617930293420993/reviews', 'en', 'https://lh5.googleusercontent.com/-TDd1jj5snHg/AAAAAAAAAAI/AAAAAAAA-g8/3eWiv51eHak/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '8 months ago', 'Well, I cannot recommend this place at all. They neglected to file my paperwork with the state, so after paying them and the state my license has been rejected. Since they seem to no longer answer their phone, have not returned my messages and now their mailbox is full so I can\'t leave another message I assume they may be going out of business. Too bad because I did like the doctor.', 1505407944),
(809, 171, 'Brendan Christensen', 'https://www.google.com/maps/contrib/110943033609893997957/reviews', 'en', 'https://lh6.googleusercontent.com/-dmNIQViDVYE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq188bnuHMMI9UFeyGOiAiCtDwd2TA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'The only Doc I could find who would listen to my concerns regarding MMJ and help me find the right fit for my needs.', 1510088221),
(810, 171, 'MICHAEL SELINFREUND', 'https://www.google.com/maps/contrib/100359471552346231541/reviews', 'en', 'https://lh4.googleusercontent.com/-HuU29llS9Lk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq34eWb7wISysXmNoc9hSv0AHLqygg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Dr. Alan Shackleford is a kind, smart, experienced and an all-around awesome person besides being one of the prominent medical cannabis doctors in the world.  And his office manager, Caroline, is really nice and helpful.', 1475097995),
(811, 172, 'Tyler Baker', 'https://www.google.com/maps/contrib/103935821894745591232/reviews', 'en', 'https://lh4.googleusercontent.com/-MvIulWO-Whw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1vlyKkX-uJhpXHw7TUHBjs8uNfAw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Was in and out easily within 20 mins!! My Physician was Amazing in regards to help, unfortunately my state ID was considered \"invalid\" ( I got a new one but lost it and had my old one so just used it) so it delayed me getting my Med Card but once I got that fixed I was approve within 3 business days! Best staff, don\'t second guess going here!!', 1502841159),
(812, 172, 'Jake Scheck', 'https://www.google.com/maps/contrib/109974775781391562297/reviews', 'en', 'https://lh4.googleusercontent.com/-RNI5C7GsdJk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1WU3eO-RQKe0l4dsCITTzhKmVj1A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'Ive been here 2 years running, and cant say enough about the staff!! Going to always be my place to get my med card', 1505345070);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(813, 172, 'Scott Reimann', 'https://www.google.com/maps/contrib/105912490270439906817/reviews', 'en', 'https://lh5.googleusercontent.com/-56shf5ljzfI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0fxoMvN1AmKBVPqPkdKqQOFQLgkw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 years ago', 'Worst Doctor I have ever met with and probably the worst person in the industry I have ever met. Experience was horrible!!!! Do not go here for anything. Don\'t know if she doesn\'t like people or just me but stay away! The lady literally threw my paperwork at me because she thought I wanted an extended count (that I had for the last three years) because she said the paperwork wasn\'t good enough. I realize laws changed and wasn\'t expecting anything more then a renewal. What kind of DR does that?! Had she taken the time to find out she would have realized I was really only there for my friend who had recently got out of the Army and had combat related injuries with a book of doctors notes to prove it. We drove all the way down from Co Springs btwHe also had received a Purple Heart for his service. I literally stopped in the middle of her talking and said \"Is there a reason you are so damn rude to me\". I got up and left after some back and forth from this crazy lady who clearly made a snap judgment about me without hearing my story because I have a lot of visible tattoos on hands and arms. The guy up there is great and I was glad he was there to help diffuse the situation. She followed me down the hall yelling whatever she was yelling that didn\'t make any sense and at one point went as far as saying \"no wonder your on medication for your anger\". Thinking about filing a law suit on this place/doctor just to teach her a lesson on empathy since she was so rude. This ended with her ripping the folder of paperwork up in front of me. She is a real class act.', 1461159658),
(814, 172, 'Lisa G', 'https://www.google.com/maps/contrib/105703288915690535507/reviews', 'en', 'https://lh4.googleusercontent.com/-_qwm4sLZIlk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ar-jHSjz49aZS2qrwKs1yyaCxIw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 years ago', 'My experience with Herbal Health Systems was very favorable. I found the staff to be compassionate, knowledgeable and very professional. Exactly what I was looking for. I have read some of the previous reviews of people requesting cards and being denied based on the fact that they don\'t have a qualifying condition. The state standards have not been set by Herbal Health Systems, but by the voters and the legislature. Do yourself a favor and check to see if your medical condition qualifies you for medical marijuana before you make the appointment. I would and will refer friends and family to Herbal Health Systems. I really want to thank these folks for being there for me. I will come back next year.....', 1373746766),
(815, 172, 'John Doe', 'https://www.google.com/maps/contrib/101863207074790890958/reviews', 'en', 'https://lh5.googleusercontent.com/-BFnUbdVl8mM/AAAAAAAAAAI/AAAAAAAAABQ/vdpv_pR9M10/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'Despite some of the negative reviews I decided to give this place a try anyway.  I\'m glad I did because both Channing and Dr. Schmidt are the nicest people I\'ve met in the 3 years I\'ve lived in Colorado.  The clinic is very clean and professional.  There\'s plenty of parking and it\'s not in a bad part of town.  Dr. Yin/Yeon doesn\'t work there anymore so you don\'t need to worry about that!', 1458602288),
(816, 173, 'Peter Cieplinski', 'https://www.google.com/maps/contrib/101632632896012953506/reviews', 'en', 'https://lh3.googleusercontent.com/-c8vqkOPK27w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq179G5rnG7T8ZV0UzFz0GURvboBsA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'SUPER NICE people, Great Doc. In a out in about an hour. (With appointment) They like to talk. Super easy. BRING ANY PAPERWORK on your illness/ injury (\'s) makes life easier.', 1520118512),
(817, 173, 'Day Bacchus', 'https://www.google.com/maps/contrib/104586002620941749997/reviews', 'en', 'https://lh4.googleusercontent.com/-EYKdWihiRew/AAAAAAAAAAI/AAAAAAAAJvs/OETEnIhhYX0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '4 months ago', 'Was in and out pretty quick. I would suggest to make an appointment, Fridays I think are their walk ins. They were very thorough and helped me set up my online registration with the State. I received my email the next day that included my Med card.', 1516742446),
(818, 173, 'Ashleigh McLean', 'https://www.google.com/maps/contrib/115969964622056051352/reviews', 'en', 'https://lh5.googleusercontent.com/-0Lu0kdokIXQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3DQ3ela-Zs1k2ekKN2MGL0U_5GgA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, 'a month ago', 'They dont live up to their end of the bargain. They tell you they will help you with everything to get your card but arent even informed on new policies and they they basically tell you that you are on your own and you basically wasted your time and money.', 1522530327),
(819, 173, 'Cavy Care Inc.', 'https://www.google.com/maps/contrib/107883589837914496736/reviews', 'en', 'https://lh5.googleusercontent.com/-duZmp-PUZi8/AAAAAAAAAAI/AAAAAAAACs8/uSXi6Wpe4oM/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'I was very impressed by these folks patients and they try to help most...I was also amazed by their patients with folks who had NO ligetimate reason to be there other then they want cheap pot!  I would recommend them for legitimate folks who need medical marijuana.', 1519584076),
(820, 173, 'Ann Brown', 'https://www.google.com/maps/contrib/101023790845422458295/reviews', 'en', 'https://lh5.googleusercontent.com/-SO1Rhjuj2O8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Hmtavq1YK3UflqZLa5XWlG6mUqg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Excellent doctors and staff.  Professional, friendly and EXTREMELY helpful. Thank you!', 1518554280),
(821, 174, 'Michele Ducharme', 'https://www.google.com/maps/contrib/103881529412854987134/reviews', 'en', 'https://lh6.googleusercontent.com/-mP7ul06LvSQ/AAAAAAAAAAI/AAAAAAAAAQI/jbQM2PQFOOQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'Super clean and friendly doctors office the front-end staff is very outgoing and will make you feel welcome and comfortable the doctor I sawl was very easy going and easy to talk to. Would recommend this place for anyone considering getting their marijuana evaluation', 1520633230),
(822, 174, 'Margaret Smith', 'https://www.google.com/maps/contrib/112812269208865001807/reviews', 'en', 'https://lh4.googleusercontent.com/-iEU0hcReRA4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0zOkmfHhjYLGmGWQOzH-mkYPvP5g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Updating my review to 5 stars.  I had received a letter from CDPHE saying Healthy Choices did not include the processing fee with my application.  After talking to Healthy Choices, I found that they did send the check and it was CDPHE that misplaced it.  The woman I spoke to ensured my it would be taken care of.  Martha would be calling CDPHE as Healthy Choices has a copy of the check that was sent.  She will also drop off another check if necessary.  They said this is not the first time CDPHE has lost checks causing delays in application processing. Thank you to all for the assistance and excellent service.', 1520702017),
(823, 174, 'King Luta', 'https://www.google.com/maps/contrib/106726561488538662844/reviews', 'en', 'https://lh5.googleusercontent.com/-DYbJkTwaGS8/AAAAAAAAAAI/AAAAAAAAA00/vbXrn2zoUZQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, '3 weeks ago', 'Horrible Customer service I asked if I could ask a few questions, I didn\'t get out more than 3 words and the lady started to tell me what she thought I was asking. Not helpful at all.', 1525708031),
(824, 174, 'Justin Watkins', 'https://www.google.com/maps/contrib/103554784359684571103/reviews', 'en', 'https://lh3.googleusercontent.com/-y6Kz42hsqLU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq14HsbWWVhILmueFaPTMcTx4JahBg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Shout out to the lady working the front desk at the Edwards location today, she went out of her way to help me get my card that was lost in the mail, great staff, very friendly and would highly recommend', 1515722438),
(825, 174, 'Matthew Majane', 'https://www.google.com/maps/contrib/116601404114702676845/reviews', 'en', 'https://lh4.googleusercontent.com/-NUKnHXDe7tA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3g4uuLBMSodQPIJ5_1kW9ikN4Yww/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Love this dr office... every one is so friendly and helpful I come here every year to renew... wouldn\'t go anywhere else.', 1509579644),
(826, 175, 'Kevin Lethco', 'https://www.google.com/maps/contrib/115649562890101914300/reviews', 'en', 'https://lh5.googleusercontent.com/-MboZeNoM-RU/AAAAAAAAAAI/AAAAAAAABaE/5lVgMnV8w2o/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Was in the Pueblo location today and have to shout out the young lady and the lady doc that were there. Both of them were extremely professional, courteous and friendly. I really appreciate their customer focus and I will be a return customer because of them. Respect', 1511063955),
(827, 175, 'Jeff Duewiger', 'https://www.google.com/maps/contrib/107176570721081817962/reviews', 'en', 'https://lh6.googleusercontent.com/-ZYWyoimMIRg/AAAAAAAAAAI/AAAAAAAAADE/Q6VcChhkXow/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 months ago', 'Great place,professional staff,friendly, knowledgeable. Wow best place I\'ve been to for help.Thanks Dr. and staff', 1519751816),
(828, 175, 'Jeff Duewiger', 'https://www.google.com/maps/contrib/106034345982037443352/reviews', 'en', 'https://lh5.googleusercontent.com/-4l28AAw-58s/AAAAAAAAAAI/AAAAAAAAACI/p8_sk4TdCZI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '7 months ago', 'Very nice environment, friendly staff. Great place for pueblo', 1507134179),
(829, 175, 'Carol Jones', 'https://www.google.com/maps/contrib/110581671220743276467/reviews', 'en', 'https://lh4.googleusercontent.com/-6E82qmHfS-Y/AAAAAAAAAAI/AAAAAAAAgkw/i6_LZCtyBZM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '7 months ago', 'Everyone was friendly, the girls and Dr were great!!  The visit was fast!!  Awesome!!', 1507153725),
(830, 175, 'Maria Herrera', 'https://www.google.com/maps/contrib/116657843022571503551/reviews', 'en', 'https://lh3.googleusercontent.com/-oLUFyrCk2iw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3gsO6eAm1tlDUfxXVooW4GCQpd_g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Aisha she is awsome and very  helpful.she made my wed much better!!!!', 1503524022),
(831, 176, 'Wesley Billstone', 'https://www.google.com/maps/contrib/118295636444143155764/reviews', 'en', 'https://lh5.googleusercontent.com/-x9YjEFNTwl0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2xePgqFjA4S3d8og0MZ8ZcvbPtgQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'First time here, great experience. Was first patient of the day, was in and out in 30. Great staff, pleasent interior, tons of parking.', 1527019727),
(832, 176, 'Adrian DeAtley', 'https://www.google.com/maps/contrib/107925131632509588711/reviews', 'en', 'https://lh3.googleusercontent.com/-Fehg2omlIK8/AAAAAAAAAAI/AAAAAAAAAAc/36ZLoSDcBj4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I went to this clinic last thursday and this is the best medical marijuana clinic in town. Very friendly staff, very professional doctor, very clean place. I got my card the very next day! Will come here again next year. Shout out to my best friend John that give me his $5 coupon', 1521918414),
(833, 176, 'levi Sarikov', 'https://www.google.com/maps/contrib/115802838695576908023/reviews', 'en', 'https://lh5.googleusercontent.com/-RNpPLAjwTsM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3SPIbAwwCpkgpIaC_FTQtsK73izA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Got my exam today and the experience was amazing.  I highly recommend this clinic.', 1527108448),
(834, 176, 'Shelly Lopez', 'https://www.google.com/maps/contrib/118418922863592346324/reviews', 'en', 'https://lh3.googleusercontent.com/-X48COmIsMuA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq10IhAxcAhLNmbKrGSeco0PfD5psA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I have been coming here for the past 5 years. Would NOT go anywhere else.  Very professional and helpful with all questions.  These guys are GREAT!!!', 1520555492),
(835, 176, 'colt anyone', 'https://www.google.com/maps/contrib/108742663715953162683/reviews', 'en', 'https://lh5.googleusercontent.com/-7JGVKKHrD8A/AAAAAAAAAAI/AAAAAAAADwM/3cKJ2He_A0M/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Super Professional, I’ve been coming here for the past 2 years and it’s nice to see the same friendly faces.', 1523910781),
(836, 177, 'Stephanie McCormack', 'https://www.google.com/maps/contrib/100912780540156491776/reviews', 'en', 'https://lh3.googleusercontent.com/-KQsD6XA1yP0/AAAAAAAAAAI/AAAAAAAAAk4/hHv3PCxINYk/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 weeks ago', 'Had an appointment Thursday 4/19 and it is 4/30 and the physician certification is still not uploaded. I emailed them via their website and someone responded saying they will look into it and that someone will give me a call letting me know what is going on (Tuesday 4/24). I\'ve called the office and left a voicemail Friday 4/27, and still have not heard anything.  This is extremely concerning given the professional image the office aims to keep. I can\'t believe it has taken this long to get any where and I\'m still stuck with nothing and I can\'t renew my card.', 1525130521),
(837, 177, 'Goat Miseriae', 'https://www.google.com/maps/contrib/102915265312013905821/reviews', 'en', 'https://lh6.googleusercontent.com/-Nh6hOdpoEmI/AAAAAAAAAAI/AAAAAAAAAEs/oyHcnr9K1YM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I\'d say disregard the poor reviews, I went in to  see Dr. Branch and had a much better experience than I had at previous clinics.\n\nIf you bring your medical records, follow the clear directions stated all over their website, then you will enjoy the same quality found at traditional clinics.\n\nMy paperwork was in the online database ten minutes after I had left the office, the whole process took about 45 minutes. Will definitely be returning and recommending.', 1511804128),
(838, 177, 'Tiffany', 'https://www.google.com/maps/contrib/115199047605906279466/reviews', 'en', 'https://lh3.googleusercontent.com/-TXO0ASRjH9Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1McmPFRVM_t8ceCCI_sbbYU6_r-w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I had a great experience with DR. Branch. He was very attentive, and the staff was very knowledgeable.  I had my card in 3 days after my visit (I did the online registration).', 1510599127),
(839, 177, 'William Salisbury', 'https://www.google.com/maps/contrib/118038632993200138714/reviews', 'en', 'https://lh6.googleusercontent.com/-QJabRfNg42Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3g4z4_VUvmywovC2r85vX40dco0w/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '7 months ago', 'Absolutely terrible, doctor is rude and non-understanding. Taken a week for him to put info into the system that I was told should have been done the same day of my appointment. Just ridiculous, if this was my medicine for my thyroid, I\'d be dead by now. If he was a real doctor he would lose his license and practice faster than I can say \"you\'re fire\" absolute trash experience. would not recommend anyone to this doctor or clinic. Only good part was the receptionists.', 1507238836),
(840, 177, 'Aaron McBroom', 'https://www.google.com/maps/contrib/113248612699041792641/reviews', 'en', 'https://lh3.googleusercontent.com/-2biGw3s-IOE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2lAu_MSnUc-to054P_wXsRaI1WoQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Great service would highly recommend. Friendly and great staff the doctor was pleasant and very understanding', 1509647877),
(841, 178, 'Josh Gale', 'https://www.google.com/maps/contrib/107644854901004239731/reviews', 'en', 'https://lh5.googleusercontent.com/-94_6WOWR-ok/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0lGUUBzz7Qw9EijUHYSjpbMPWYVQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '4 weeks ago', 'This place rocks very friendly and understanding staff definitely there to help you as a patient. Thank you so much for the outstanding service.', 1525196580),
(842, 178, 'Jackson Kelly', 'https://www.google.com/maps/contrib/112041315515662841994/reviews', 'en', 'https://lh4.googleusercontent.com/-0TrLm2rav4U/AAAAAAAAAAI/AAAAAAAAA_U/2e_K-Q18k8A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', '​I am adding to my review. As for your response, it is lame. You are slow, dirty and have terrible attitudes. Now the New Doctor is a really mean jerk. Her name is Roselia Conrad and she is not even a real doctor she is an Osteopathy or Psuedo Doctor. She is abrasive, argumentative and basically a jerk to deal with. Whatever happened to Dr. Stone. He was awesome. I WILL NEVER GO BACK!!!  DO YOURSELF A FAVOR AND GO ELSEWHERE!!!  Their new motto should be, \"twice as expensive and twice as slow, and three times as mean!!!\"', 1525307951),
(843, 178, 'Dean Luttrell', 'https://www.google.com/maps/contrib/107567595569632085721/reviews', 'en', 'https://lh6.googleusercontent.com/-_InEg-lYleI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1WMc9RKStxXlRenkeIc2_-Mxxtqg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Renewed my med card ,they make it easy,  and treat you good and very respectful . Definitely going back and will refer friends.', 1522717489),
(844, 178, 'John DiMartino', 'https://www.google.com/maps/contrib/117792102630235447868/reviews', 'en', 'https://lh6.googleusercontent.com/-t9ZT4BZgCUI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1mjbHCW-dINOLwri_k8q8hFwAEPg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', '1st-The staff were quite cheerful upon entering, very warm hearted,welcoming.\n2nd-HeidiLynn aka  \"Button\" treated me like a friend and gave me a significant discount. She has a gift at making people feel cared for.\nThe doctors visit was quick and sweet and there was even a therapy dog.\nAwesome. Everything went well and am looking forward to seeing them again in a year. These folks care and treat people with dignity and love. \nWonderful experience. I drove 150 miles roundtrip and will be happy to do it again next year. I will remember your kindness toward me and I will remember you in my prayers. Peace...', 1519955126),
(845, 178, 'teri hervey', 'https://www.google.com/maps/contrib/102937120576155176396/reviews', 'en', 'https://lh6.googleusercontent.com/-c3tUhsB8-fA/AAAAAAAAAAI/AAAAAAAAGHA/SObTohbzlbw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Everything here is professional. Top of the line Doctor, everyone is very kind and helpful. I will never go any other place. They are 100 in my book.', 1517516672),
(846, 179, 'Oh Fudge', 'https://www.google.com/maps/contrib/113990882098547009059/reviews', 'en', 'https://lh6.googleusercontent.com/-e-VI7Ow2aWk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq37j6ws_aW-aiGUqCK4kiWVNuNksw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I\'ve been a patient at Relaxed Clarity for 8 years and they make getting your medical cannabis patient certification quick and simple. They provide all the information you need and even forms on their website so you can fill them out before your appointment. All the staff are kind, courteous and helpful.', 1524511776),
(847, 179, 'Shawn Caroline', 'https://www.google.com/maps/contrib/109822675417048570962/reviews', 'en', 'https://lh6.googleusercontent.com/-OktntylNIVg/AAAAAAAAAAI/AAAAAAAAAAw/_26ftijaDxM/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '4 months ago', 'Very nice staff.  Took me a long time get in, though. Appointment was for 12:20pm, but did not get it to talk to the doctor until almost 1:00pm.  Last gentlemen I spoke to who explained the Colorado registry information, spoke almost too fast for me to understand him.  Fortunately, everything was also written down.  Overall I was satisfied with everything, but the unexpected long wait and the first waiting room area, which desperately needs a make-over and I mean, desperately.  Maybe comfortable chairs and better lighting and even color on the walls?  If people are going to have to wait for awhile, it is nice to have a soothing place to sit.', 1515619835),
(848, 179, 'sonia lopez', 'https://www.google.com/maps/contrib/101107922193147849909/reviews', 'en', 'https://lh6.googleusercontent.com/-MNj1EpzfN-s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1U_SlIB89ZqM1KQaimxbFhdqr5ww/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I have renewed my license 6 times through  relaxed clarity.  Not only are they a super friendly professional staff. Their office is clean and efficient .. i recommend relaxed clarity to anyone who is interested in a wonderful doctor that is understanding and kind .. \nThere is no place like relaxed clarity', 1523625570),
(849, 179, 'Jane Ireland', 'https://www.google.com/maps/contrib/110245708587512075561/reviews', 'en', 'https://lh6.googleusercontent.com/-Mn6AzzqswMk/AAAAAAAAAAI/AAAAAAAAAAo/IlIfq0m2_V4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Lisa, Joan and Dr. Stacy are a breath of fresh air, making the process to acquire my card effortless. Also, the cost is less than comparable options. Thank you very much.', 1526834435),
(850, 179, 'Jeff E', 'https://www.google.com/maps/contrib/106155461247588222240/reviews', 'en', 'https://lh6.googleusercontent.com/-KWgZ4TmCvFE/AAAAAAAAAAI/AAAAAAAAyi0/lUaDH1uq3EY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'In and out on a Saturday fairly quickly\n\nStarted out with cashier who let me use Facebook coupon no issues. \n\nMet with Doc, answered a few questions and moved on to next station \n\nFinal step went fast mostly explaining how to complete online application. \n\nReceived approval Monday \n\nWho could ask for anything more?', 1525983732),
(851, 180, 'Alysa Jackson', 'https://www.google.com/maps/contrib/100312286811987685220/reviews', 'en', 'https://lh4.googleusercontent.com/-6Lx3B7CmLGA/AAAAAAAAAAI/AAAAAAAAU6Y/ZLsKAtCU9ZY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I love the new Doctor,  the old one was great too and as always.. a welcoming feel from the staff when I\'m here. I have been happy with their care for over 5 years. Thank you C.A.R.E.S!', 1522854907),
(852, 180, 'Lorraine Joseph', 'https://www.google.com/maps/contrib/103332630844534390932/reviews', 'en', 'https://lh5.googleusercontent.com/-__dzYdgq6E0/AAAAAAAAAAI/AAAAAAAAU8I/ix-s6dJrQFw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Don\'t waste your time or 100 USD on this place.  Unless you are a male, the receptionists are not interested in helping you.  I was totally overlooked by them and you could tell preferential treatment was given to the male patients who were in the office. \n\nI went here on March 6 and they would not even submit my information to the state because they did not know how to do it without a Colorado ID.  As a result, I am still  waiting to hear back from the state on my medical card... so something as simple as a document submission would have taken care of this and they would not do it.  \n\nThe doctor saw me for less than 10 minutes and hardly said anything of value to me.  He did not even assess my chief concern, Krames ovarian tumors with chronic pain.  He is clearly just there to get your 100 bucks and be on to the next patient as quickly as possible.\n\nThis place is a rip-off and they do not care about female patients.', 1522642871),
(853, 180, 'Donna Pinner', 'https://www.google.com/maps/contrib/105029232250977928033/reviews', 'en', 'https://lh3.googleusercontent.com/-SLk7-cI9xdU/AAAAAAAAAAI/AAAAAAAACEM/ktj0vN4n0F8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The staff was friendly and informative. I got in and out in less then an hour. The doctor was very caring and informative as well since I was new to this. Thank you CARES.', 1523413926),
(854, 180, 'Crissida Tyler', 'https://www.google.com/maps/contrib/117185460133251874121/reviews', 'en', 'https://lh6.googleusercontent.com/-30lctZR1dLU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1r0KUXiFVU_PoFrHiiQ_Z5SYXYQQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'The people at C.A.R.E.S. is what makes it such an amazing place. We\'ve received fabulous customer service from each person in the office every single visit. This place has a lovely, welcoming atmosphere. I have and will continue to recommend it to my family and friends. Thanks for being great!', 1511930387),
(855, 180, 'Clinton Bell', 'https://www.google.com/maps/contrib/117790829562107371866/reviews', 'en', 'https://lh4.googleusercontent.com/-lvfrhbIeI7o/AAAAAAAAAAI/AAAAAAAAAQo/6MNo7nhbuHo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I have Being going to Cares for several years now. And I have always likes the people there. The new Doctor is a great person. Easy to get along with. And will laugh with you. \n  The ladies out in the front. I don\'t know where people get saying there not nice people. I know I love them. They are most helpful. Even when you call them with a question. And You feel like a fool. Cuzz you figured it out while waiting. They answered my calls promptly. \n  I look forward to using this service  for years to come. \n                                                                           Thank you.', 1512058589),
(856, 181, 'Vic 6764', 'https://www.google.com/maps/contrib/111882025446353039144/reviews', 'en', 'https://lh6.googleusercontent.com/-1C8Sn2aXJGU/AAAAAAAAAAI/AAAAAAAAAEc/IQzPJTmu-YM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'If you are a medical patient, Green Cross of Cherry Creek is the best I have come across and I\'ve been to plenty of dispensaries. They have an amazing selection of bud, cartridges, and edibles.\nThank you GCCC!!', 1522776637),
(857, 181, 'Donny', 'https://www.google.com/maps/contrib/102647189661090465992/reviews', 'en', 'https://lh4.googleusercontent.com/-WiewmSY_Jrk/AAAAAAAAAAI/AAAAAAAAAHA/TAZpzl6ZDso/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'The friendliest shop I\'ve been to. Super low-key but always stocked with an insane amount of flower. You can\'t go wrong with green cross of cherry creek.', 1519584455),
(858, 181, 'Marth FPS', 'https://www.google.com/maps/contrib/109061964444279716095/reviews', 'en', 'https://lh6.googleusercontent.com/-jYUT1mjbRoU/AAAAAAAAAAI/AAAAAAAAAAs/mKsJ6UIUY-E/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'One of the best dispensaries I\'ve ever been to!  The bud tenders and owners are incredibly kind and I feel like family walking in!', 1523139187),
(859, 181, 'Josh Young', 'https://www.google.com/maps/contrib/117424075157103119740/reviews', 'en', 'https://lh5.googleusercontent.com/-pRUMb8z70ig/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2k5ymoknXsro7WG2csf4ynFQJTSg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great shop, friendly staff, great prices. If your medical and want good selection. This is the place.', 1519928122),
(860, 181, 'Luke Schwanke', 'https://www.google.com/maps/contrib/105123264321604805658/reviews', 'en', 'https://lh3.googleusercontent.com/-BQolaw2N35Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2-mRX3Yb3gS8dRubOCE2sUiPuGGA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I just got back from a quick trip to this hidden heaven of high quality low priced concentrates and WOWWW!!!!!  Alex gave me a rundown of the shop and the benefits as well as grade A customer service for being in there my first time.  WIsh I would have known about this shop for the last 3 years...I will be a billboard for medical patients who want to be able to chit chat with their budtender and purchase something that will make them not wanna talk but just taste!!!!  You\'ll wish your eyes had tastebuds when you smell the live resins, needless to say there are about 10-20 choices as well.   I felt at home for the first time in a dispo and it made me realize that smoking is a way of life and this shop absolutely is my new favorite go to place!  Thanks much!!', 1521168910),
(861, 182, 'Jackson Hetue', 'https://www.google.com/maps/contrib/112902486248022806744/reviews', 'en', 'https://lh6.googleusercontent.com/-BcGg2dfB7n0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2KD7Fbadv4ulDojGFr8_W6BkDBhQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'A very smooth and enjoyable experience at Relaxed Clarity. I made an appointment online, and prepared paperwork ahead of time. Check-in staff were polite and fast, I was called back within 10 minutes. The notary (I can\'t recall his name) was great. Dr. Gordon was very personable and gave useful recommendations. Paige was friendly and extremely helpful with instructions for next steps. Will definitely return next year.', 1525923550),
(862, 182, 'Dutch V', 'https://www.google.com/maps/contrib/108117071663006100196/reviews', 'en', 'https://lh4.googleusercontent.com/-CtxI8p7lwzc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2XZ8EpYV6CVxuu3-dQhDKG3WRozw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Year three going to Relaxed Clarity and I couldn\'t be happier. \nThe coolest part of the visit is interacting with the staff.  Starting up front, you are handled with kindness and dignity. \nThe wait is a bit extreme. \nThe notary is an amazing human. \nThe doctor is always cool and has the experience and vocabulary to get you treated and keep you legal. \nThe last person, (sorry,  I don\'t know their title), helps walk you through everything and anything you may need to do. \nFinally, everyone is willing to answer questions and help if you hit a snag or don\'t understand something. \nGot my card within 24 hrs.\n\nThank you,  RC.', 1523471548),
(863, 182, 'Shar R.', 'https://www.google.com/maps/contrib/116314935648579248275/reviews', 'en', 'https://lh6.googleusercontent.com/-UXDeuYSAy8w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0xFFB-uL6IOVge0JYSzFEmPBdPmg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I was in and out on my lunch break from work. Very affordable, friendly and genuine. Of course some times will be busier than others. Do you really think this should take 5 minutes? You’re here to get your medical marijuana card, not to pick up a candy bar from 7-11. I feel very fortunate to have been helped by Relaxed Clarity and will always go back. ', 1524659834),
(864, 182, 'Warren Bush', 'https://www.google.com/maps/contrib/103879466854292502123/reviews', 'en', 'https://lh4.googleusercontent.com/-mSCYZRd84-I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1MS7gzQY5U6DUkfvudVZW7TCZrEg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'My experience with Relaxed Clarity was an awesome one. I called to make my initial appointment and was scheduled the exact same day. I\'m talking in office 2 hours after I made the call, same day. Amazing. Everyone was super helpful, friendly, and professional from start to finish. Dr. Gordon was very informative in answering all of my questions. The online process has your MMJ card the next day. The wonderful young lady was kind enough to complete the entire process for me. Much appreciated. Definitely a five star experience.', 1525730486),
(865, 182, 'Mike Ryzak', 'https://www.google.com/maps/contrib/112150329673961501511/reviews', 'en', 'https://lh3.googleusercontent.com/-lpS6juVBg6M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1fXWmOerZxCGm5rRb0KGfz1fYhdw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'My wife and I have used them for the past 5 years. These guys are great. Always have coupons available to help financially. And they will help you during you appointment till you are satisfied and even afterwards.', 1527087290),
(866, 183, 'Vegan Buddhist', 'https://www.google.com/maps/contrib/105461829161688984038/reviews', 'en', 'https://lh4.googleusercontent.com/-KZcpVbGNWTU/AAAAAAAAAAI/AAAAAAAAAhY/0hbYaSsf-Jo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I had a great experience here when we visited Denver! The sales girl was super helpful and patient explaining the products to us. I went in only planning on buying some edibles but the price of the vape as well as the girl explaining it in detail to me made me go for some concentrates and a vape pen. Overall pleasant experience, helpful staff, only weird part was the security standing there watching you the whole time and that they don’t have an ATM. I wish I remembered the girls name, but thank you! I hope to come back', 1526923596),
(867, 183, 'Bryan Stephenson', 'https://www.google.com/maps/contrib/103846062515393080075/reviews', 'en', 'https://lh6.googleusercontent.com/-aUH-Zsm_cSg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq37vpkVvHXFDil4cTuXrOglutPL2g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Dr Orders is the one of the few recreational dispensaries that I see have got things right over the years evolving with recreational times. It is the best recreational dispensary that I know of when it comes to pricing structure and fairness. The team is great there and very helpful. They have daily specials and times during the day that you can decide to use any daily special of the week. Their pricing includes tax. It is hard to beat this dispensary. I think they have done an amazing job, so that the consumer doesn\'t even feel they need a coupon to get online or anything. They also answer the phone when they call and don\'t have a lame long computer voicemail. Keep up the good work. Only thing I\'ve ever noticed that I\'d criticize is that I don\'t think it as secure as other places.', 1517479075),
(868, 183, 'King', 'https://www.google.com/maps/contrib/109058395874875459160/reviews', 'en', 'https://lh6.googleusercontent.com/-dmJcBimjNaA/AAAAAAAAAAI/AAAAAAAAARc/tbXyRnCDAr8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'One of the best dispensaries for concentrates! They always have a huge selection of strains, and it’s always so pure and good quality. I’ve been to well over 100 dispensaries over the years and can honestly say Dr Orders is the most consistent when it comes to their concentrates. The budtenders are always very knowledgeable & friendly (except for\nThe older blonde lady). I cannot recommend more!', 1525071669),
(869, 183, 'Jennifer Blea', 'https://www.google.com/maps/contrib/100610638246875385233/reviews', 'en', 'https://lh3.googleusercontent.com/-TbemfznUPU0/AAAAAAAAAAI/AAAAAAAACK4/Go1hAQcY7HE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Bunch of super cool people that work here! Sometimes busy but well worth the wait! Love the daily deals and tax is included!', 1524275940),
(870, 183, 'Maisie Smyth', 'https://www.google.com/maps/contrib/117246408483493070543/reviews', 'en', 'https://lh6.googleusercontent.com/-19iFmJszOPQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0uLbbAmt5bbyv4JoaNvWkWzXOM8w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I L O V E Dr\'s orders. They have one of the best budtenders in Colorado. I actually followed her from her old place of employment. Echo is sassy and sweet and very smart on the THC,CBD hardships of an aging stoner. Echo recomends the best tasting weed and is very fluent on all aspects of the medical and non medical benefits of marijuana. I just really dig the lady. You are lucky if you get Echo as a budtender,and Dr.\'s orders is better by just having her as an employee. They got my business.', 1524330875),
(871, 184, 'Arron Barringer', 'https://www.google.com/maps/contrib/105079917094123235293/reviews', 'en', 'https://lh3.googleusercontent.com/-GD83--L5y78/AAAAAAAAAAI/AAAAAAAAQsc/TzT4RutJtWk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I am a disabled Veteran who moved to Colorado after eight years on VA psych meds. Dr. Ivker and his staff are exceptional. The receptionist is very warm and helpful. Dr. Ivker spent over a half hour speaking with me. (No VA Doc has ever talked to me that long) He educated me on the different types of Cannabis, pros and cons of various methods of consumption, and the many uses of the myriad of compounds within Cannabis. Furthermore, he gave me several handouts which contained links to additional  information. \nDr. Ivker is a published author, and an expert in his field.\nMonths after meeting with Dr. Ivker I had a minor issue with the State. The receptionist and Dr. Ivker were even more helpful than I anticipated, and even made phone calls on my behalf in order to keep me from having to set up an additional appointment. \nI\'ve had my medical recommendation for six months now. My quality of life has drastically improved. Sure, the exercise and mountain air has a lot to do with it- but my emotional regulation is the best it\'s been in years, and I credit Cannabis with healing what pharmaceutical medications made much worse. My depression is far more manageable, and I\'ve lost 30 pounds by snacking on veggies when I get the munchies.\nDr. Ivker has this Marine\'s endorsement.', 1519163030),
(872, 184, 'Sandra Bowen', 'https://www.google.com/maps/contrib/105256516285978866069/reviews', 'en', 'https://lh3.googleusercontent.com/-_we6swKE-bU/AAAAAAAAAAI/AAAAAAAAFwU/eZXqwQzuYxA/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '2 months ago', 'Hustles overpriced vaporizers -- ( w/ mouth pieces that heat up, bad for people who worry about lip and mouth cancer )\nOutdated info on sleep (never heard of biphasic)\nGood location, nice art work, good paint colors on walls', 1520087963),
(873, 184, 'ElizaBeth Bratton', 'https://www.google.com/maps/contrib/109595171109271061992/reviews', 'en', 'https://lh4.googleusercontent.com/-9yeMPaWkkZU/AAAAAAAAAAI/AAAAAAAADIw/Ko6y1gRqods/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Dr. Ivker does a fantastic job of listening to your individual needs and making recommendations. I have been a medical Cannabis patient since 2009 and seen many physicians, but Dr. Ivker is the first to really take the time to hear about me and my needs. Thank you, Dr. Ivker!', 1499724417),
(874, 184, 'timwaldorf', 'https://www.google.com/maps/contrib/110176670141051097768/reviews', 'en', 'https://lh4.googleusercontent.com/-XgAXgwemIAY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0WlXQlPlEvA4_B1MC_Gi8MT3hvYA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'I am a patient with Dr. Inker for several years now. A great experience, as usual. Very  professional.', 1458517100),
(875, 184, 'Honest Person', 'https://www.google.com/maps/contrib/102119872243915166138/reviews', 'en', 'https://lh5.googleusercontent.com/--UMgxHpiewo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1T9FmEdnWiqn6J6p7I0S5u-xYykg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 years ago', 'This was the most professional MMJ doctors office I have been to in the 10 years I have had my license. Highly (no pun intended) recommended! ', 1423158541),
(876, 185, 'Keith Retired', 'https://www.google.com/maps/contrib/103135869680259610102/reviews', 'en', 'https://lh6.googleusercontent.com/-RMTmD-evm_w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1khKnkVIQKeZm8uItMaY6xhbFbMQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Good, fast yet very professional and competent. Didn’t just try and push MMJ on me, actually talked to me about ALL my alternatives. They were so dedicated to keeping the appointments made that they never even once mentioned canceling my appointment that I showed up for, in a freak Colorado Springs blizzard. They have my business from here on out!', 1526872850),
(877, 185, 'camron russell', 'https://www.google.com/maps/contrib/117113162048564567291/reviews', 'en', 'https://lh3.googleusercontent.com/-kUQf8OrD3lQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0vpcjdZ9GdVlnEx9nJc16xU0VXKw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Absolutely amazing staff that will always go above and beyond to take care of their patients. If you were to have any difficulties or questions in regards of obtaining your medical card I highly recommend Doctors of Natural Medicine! Thanks for the 5 star customer service I look forward to renewing my card with you all next year!', 1525985254),
(878, 185, 'Astrid Keith', 'https://www.google.com/maps/contrib/106537569718255097871/reviews', 'en', 'https://lh4.googleusercontent.com/-DmYAJ16iZkY/AAAAAAAAAAI/AAAAAAAAAsc/0k-XO51ge6w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Great place. The staff is super professional and patient. They even kept appointments in a blizzard that we had here in Colorado Springs. That they didn’t just cancel shows commitment. There is nothing that you could ask about the correct and safe medical usage of marijuana, that they would not have anything but knowledge to share about. This is the very first experience that I have experienced with medical marijuana. I could have not felt like I was in better hands anywhere else. Thanks guys, and hats off to you. See you in a year!', 1519329593),
(879, 185, 'Baylin Borin', 'https://www.google.com/maps/contrib/105315514245336515675/reviews', 'en', 'https://lh6.googleusercontent.com/-P96cu_qgTRw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3uB3K22-4uSwm7CGzervsctyit_A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I definitely enjoyed this experience more than my previous experiences with Medical Marijuana doctors so this was a nice change. Everyone was extremely nice and helpful and I thought having the computer room for people was very thoughtful and smart. I was even told if I didn’t have a printer or couldn’t figure out the paperwork that I could come back and get whatever help I needed. Just overall it was my best experience so far with a clinic of its type. Thanks for everything and we will definitely see you next year!!', 1519174496),
(880, 185, 'Cassandra Johnson', 'https://www.google.com/maps/contrib/114641425488897600178/reviews', 'en', 'https://lh5.googleusercontent.com/-wcRxGSv2XxI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq08fX2FGolL_nmYKGiMlT2b4AVgZA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Love them. So nice and respectful. I hope everyone get the same 200% attention that I got. Thanks so much.', 1527348344),
(881, 186, 'Michael Armstrong', 'https://www.google.com/maps/contrib/113180140244372730437/reviews', 'en', 'https://lh6.googleusercontent.com/-1mJrO3ryHn0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq13ZOriJfyyoW1rxY-BHsuO0PhHiA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Today was a streamlined process at MedEval. Arrived early to do paperwork, appointment was on time, and everyone was happy. The doc was professional and pleasant to talk with. Veteran discount offered as well. \n2 years now they have renewed my card, and I will continue to come back. \nKeep up the good work, as you affect lives.', 1524674597),
(882, 186, 'Kyle Reed', 'https://www.google.com/maps/contrib/116834997158092281669/reviews', 'en', 'https://lh6.googleusercontent.com/-phk7W6HI55k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0mGhegcmBp11R-uLN5oZ7Xz5aqvw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 weeks ago', 'The doctor was very professional, kind, and empathetic; more of the doctors at the hospitals and private practices around town could learn a lot from this man on bedside manner.  Instead of pushing pills and perpetuating the medical–industrial complex that is so prevalent in 2018 America, the doctors at MedEval see the benefit of an herb that has been on our planet for millennia.  I know medical marijuana can help a plethora of ailments, most of which are not recognized by our state; however if you truly have a qualifying medical condition and have the medical documentation to show, they are able to provide an easy and stream-lined process to getting your medical marijuana card.\n\nI want to mention the non-medical staff here specifically, for they are the reason I gave this place  five stars.  Wonderful people like the lady at the front desk are few and far between here in Colorado Springs, being as kind, compassionate, and empathetic as she was.  I witnessed her abounding patience while helping a patient through the online process, including creating an e-mail address for him so he could proceed to get his card.  There was not a hint of frustration in her voice, even after explaining the process to him several times over a course of 30 minutes.  Keep doing what you are doing, and hopefully more people will pick up your attitude and demeanor when dealing with fellow human beings.\n\nThere are many people that are in need of the help that medical marijuana can provide, so please understand that this place can get very busy at times, especially after 420 weekend.  They normally operate on a first come, first serve basis so be aware that you may spend some time here even if you have an appointment.  Plan ahead, allot an appropriate amount of time, do some breathing exercises, and smile at the fact that you will soon be able to enjoy God\'s gift of a healing herb.', 1525627202),
(883, 186, 'Laryn Ferguson', 'https://www.google.com/maps/contrib/116659538215381550662/reviews', 'en', 'https://lh6.googleusercontent.com/-BPepswlPrmg/AAAAAAAAAAI/AAAAAAAAAK0/Fcv3JvQBWWk/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Atrocious customer service. I walk in for my appointment 20 minutes early and am treated like I\'m some stranger after I have spoken to them many times on the phone and email confirming my appointment and inquiring the information needed for the appointment. I travel often for my job and have to schedule appointments on the days I am home, therefore this appointment was scheduled 2 weeks ago. They never mentioned medical records. I now arrived to an appointment early only to be poorly addressed an hour later stating I wont be seen today. They would not work with me whatsoever to help obtain my records. They may be cheap but so is their work ethic and choice of employees. Poor physician is losing money due to horrible staff.', 1524341682),
(884, 186, 'Jeremy Lansky', 'https://www.google.com/maps/contrib/109066572532663053172/reviews', 'en', 'https://lh3.googleusercontent.com/-2m0Qju7yeGM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0CYSwQvzArg5rlasnrw-XSfd_WDg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'Horrible place. They messed up my paperwork and I cannot access it online.   don\'t ask them to help you or help correct the problem they will just direct you to the state and lie to you over the phone. I\'m working with the state to try to correct their mistakes. If you want your card quickly without complications go somewhere else. Too bad I had to learn the hard way. If you make an appointment there make sure you are early I was seen almost 20 minutes after my appointment with no apologies or reason to why. The only good thing I can say about this place is the doctor was good and professional he has much knowledge and will gladly answer your questions until you\'re comfortable... but don\'t expect the same from the rest of the clowns there.', 1518892008),
(885, 186, 'Jacoby Reynolds', 'https://www.google.com/maps/contrib/104626539554023011535/reviews', 'en', 'https://lh3.googleusercontent.com/-WBC-3waDoKE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Gf44cCWM6ZstrEZWRhuYalpLxTg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'i was truly impressed with my visit to medeval. I saw a few negative comments on here about staff and them not letting people know they need medical records but they let me know that right away and it even says so all over there website so maybe some people should just pay attention more im not sure but overall keep up the great work medeval staff! you will have a repeat customer out of me. thanks again!', 1525886712),
(886, 187, 'Joshua Wynn', 'https://www.google.com/maps/contrib/101526572815565936724/reviews', 'en', 'https://lh4.googleusercontent.com/-yqIJpMirvws/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2bzzWPJRqup4uy5rtywjSd_YvASQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'Very professional staff that really care. Very helpful at assisting the patient with the proper medication. There are many different diagnosis that can be treated. My personal experience would be that this office, and the program that regulates these licenses should be acknowledged for helping to save my life. Dedicated to treating my diagnosis with modern medicine. THE GREATEST DISPENSARY IN CONNECTICUT!!!', 1527054423),
(887, 187, 'Saturn Saviour', 'https://www.google.com/maps/contrib/117369372587123497717/reviews', 'en', 'https://lh6.googleusercontent.com/-K_hbQlrCXkc/AAAAAAAAAAI/AAAAAAAAAaY/Bt7FF8yhpMQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Knowledge staff and I\'m always treated with care when I visit. Great products. Thank you!!!', 1525476638),
(888, 187, 'Wayne Smith', 'https://www.google.com/maps/contrib/101249540953443526670/reviews', 'en', 'https://lh6.googleusercontent.com/-uugHCtRkerY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2i6oDLfscIlAFSQgtQLstl1DivgA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'The staff is very friendly n knowledgeable. Very comfortable setting.', 1521554937),
(889, 187, 'Stephen Trajeski', 'https://www.google.com/maps/contrib/105024014104754661282/reviews', 'en', 'https://lh3.googleusercontent.com/-iCoP9W-t76Q/AAAAAAAAAAI/AAAAAAAAEQc/F3uFI9gy32w/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '4 months ago', 'The staff and pharmacists are very helpful since this is new to a lot of people. They have any answers you need know about your condition and what would work the best for your situation.', 1516830069),
(890, 187, 'Lyneaann Cervera', 'https://www.google.com/maps/contrib/114298218390449921756/reviews', 'en', 'https://lh5.googleusercontent.com/-4aAAj7c_7cQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2_A_xnLHxmmn9rEK5YSNTyTxh35A/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Amazing customer service! Love Justin :)', 1524365979);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(891, 188, 'Mike Jacewicz', 'https://www.google.com/maps/contrib/109245102754315169662/reviews', 'en', 'https://lh6.googleusercontent.com/-nwlcijw6PG4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq31Wl8QBHvDTi5ilxDxt3GdcYfvVQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The staff at Arrow Alt. Care are some of the nicest people you will ever meet. They will go out of their way to help you with anything and answer all of your questions. Every visit is fast, friendly, and efficient. Thank you guys', 1525100609),
(892, 188, 'Heather Knight', 'https://www.google.com/maps/contrib/113458495973276269793/reviews', 'en', 'https://lh4.googleusercontent.com/-B-OYsJa-kCo/AAAAAAAAAAI/AAAAAAAAM30/IYDluTVJoMM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 weeks ago', 'Erin and Dianna were absolutely amazing they literally helped me and my friend (who came in for her first time) with everything and was a very pleasant experience. Love this place!!!!!', 1526147384),
(893, 188, 'Deb Calavas', 'https://www.google.com/maps/contrib/117126959830042618659/reviews', 'en', 'https://lh3.googleusercontent.com/-6JddTm0xh9c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Ss_DgTdE5A2wnqZ0A3MPJK6xUbg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'The entire staff at the Arrow Hartford Dispensary are friendly and helpful !n all things from helping to file card paperwork to guiding you to the best product for your particular issues. Everyone goes out of their way to make you feel comfortable and at home.', 1520743465),
(894, 188, 'Beth Rocks', 'https://www.google.com/maps/contrib/106240083756487074016/reviews', 'en', 'https://lh5.googleusercontent.com/-wUgL_HJE9WM/AAAAAAAAAAI/AAAAAAAAIH4/HXBX497Nt6s/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'WOW! I love this place! I got spend a fantastic amount of time w/the pharmacist. I\'m not looking to hey high, I\'m looking to get out of pain as soon as possible - and I was! Location, staff, product selection... I could go on & on, but you go check it out! (Hmm, & to think my mother told me to stay away from this \"drug.\" Course, that was the 80\'s! LOL!\")', 1517516322),
(895, 188, 'Pamela Cartwright', 'https://www.google.com/maps/contrib/103613947879322913520/reviews', 'en', 'https://lh4.googleusercontent.com/-hU90A258YhA/AAAAAAAAAAI/AAAAAAAACXE/DXypZpHd3OQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Very pleasant experience Diana and Erin were terrific. My first time', 1526208099),
(896, 189, 'Jessica Oppel', 'https://www.google.com/maps/contrib/101235459728276065269/reviews', 'en', 'https://lh6.googleusercontent.com/-d_k85yGGoUI/AAAAAAAAAAI/AAAAAAAAAaY/ZPF0OEGyKj4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I am so happy I switched to Arrow Alternative. Not that I was displeased with the other dispensary I had gone to. It was just too much of a drive and not convenient to make a \"quick trip\". I switched before the Milford office was open So I went to Hartford for a few months. The drive there was still totally worth it.  The pharmacists and staff made me feel so welcome and they are so helpful and even if I had stupid questions they make me feel at ease , I will always suggest Arrow to friends who are joining the program.  The waiting area is so tranquil and doesn\'t make you feel claustrophobic and crowded as the other dispensary made me feel.  And again everyone who works there just makes you feel comfortable.', 1519853215),
(897, 189, 'Candi Edwards', 'https://www.google.com/maps/contrib/111664651696585190745/reviews', 'en', 'https://lh6.googleusercontent.com/--hdCD9BS5Fo/AAAAAAAAAAI/AAAAAAAAAQk/qNIvd8w6RLg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The staff is Incredibly helpful and Willing to help you out with any problem. I’ve been coming here for a year and have zero complaints. \nI highly recommend Arrow Alternative care ️', 1523572380),
(898, 189, 'mike rich', 'https://www.google.com/maps/contrib/110592200141383688312/reviews', 'en', 'https://lh6.googleusercontent.com/-BGeV-4plKn8/AAAAAAAAAAI/AAAAAAAAABU/GhekjzsH4Vk/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '5 months ago', 'Best dispensary IMO, great staff, knowledgeable, great hours and the best prices too. Feels like I\'m going into Cheers everyone is so cool. Mention I sent you for the best pricing.', 1513352265),
(899, 189, 'Mary Beth Tobin', 'https://www.google.com/maps/contrib/100494905729668409271/reviews', 'en', 'https://lh4.googleusercontent.com/--NePQAQkXbQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3qoKOo9qm4luM0zO0oPOqQLUPDhA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Always a smile on everyone\'s face! Very knowledgeable and caring.', 1525535096),
(900, 189, 'Cardell Ray', 'https://www.google.com/maps/contrib/116874478908508392963/reviews', 'en', 'https://lh4.googleusercontent.com/-DMhQ_Z_aS6c/AAAAAAAAAAI/AAAAAAAAABQ/MSeDjfQElX8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Nice informative staff. Friendly and helpful people makes the experience pleasant', 1518384447),
(901, 190, 'Michael Lambert', 'https://www.google.com/maps/contrib/110813362850658742417/reviews', 'en', 'https://lh5.googleusercontent.com/-HYABj7_74bI/AAAAAAAAAAI/AAAAAAAAuBA/NXF5xyucrzY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'in the last week', 'An absolutely an amazing dispensary. Everyone that I\'ve mete over the year\'s that have worked at CCC has be extremely helpful, caring, knowledgeable and over all wonderful people. These Employeess go out of there way to work with you and to help you make sure you understand your purchases and how to use the product. I would highly recommend this dispensary to any person that obtains their MMJ license in CT. A+ rating in my opinion.', 1527519878),
(902, 190, 'Alexis Broadhurst', 'https://www.google.com/maps/contrib/115882398118501097645/reviews', 'en', 'https://lh4.googleusercontent.com/-BW5gMW9yfSk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3t5fl7q0L7gF7Xw1vYD-vEOzMnrg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Every one of my visits have been pleasant. Staff are very friendly and are very knowledgeable.', 1525714734),
(903, 190, 'Christopher Sweeney', 'https://www.google.com/maps/contrib/112352307074209995441/reviews', 'en', 'https://lh6.googleusercontent.com/-E_7hkyNwtiA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1GV-s0_mGiyB2xoflF6Nnd1Lu9Qw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '5 months ago', 'I love this place so much, not only are the staff the nicest,  warm and welcoming people; So are all the customers!  You can learn so much about alternative medicine here. They can tailor specifically to your individual needs and will go the extra mile to ensure the comfort of what you\'re going through.', 1512742498),
(904, 190, 'Rebecca Caraballo', 'https://www.google.com/maps/contrib/112199027233981716654/reviews', 'en', 'https://lh5.googleusercontent.com/-h56KLH6W9T0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1PJIqlrtQjdtrkk6tut8VKhcLCzw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, '4 months ago', 'Great staff! Very helpful. Also very expensive. Make sure you check other dispensaries in the area because they price match.', 1515195357),
(905, 190, 'Rebecca Caraballo', 'https://www.google.com/maps/contrib/105902051910897145890/reviews', 'en', 'https://lh3.googleusercontent.com/-VqY8yT41MFQ/AAAAAAAAAAI/AAAAAAAAiSY/vPjRgJPGHMk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '5 months ago', 'Great dispensary! Knowledgeable, friendly staff and decent selection. A little overpriced but they price match local dispensaries so it works!', 1512767913),
(906, 191, 'Dez M', 'https://www.google.com/maps/contrib/100004747516123423750/reviews', 'en', 'https://lh3.googleusercontent.com/-8SdKgAf3eHM/AAAAAAAAAAI/AAAAAAAAE-0/hXBikhjM9ko/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 weeks ago', 'This establishment is very clean,the staff is very knowledgeable about the products they sell,so they offer great, helpful advice for those who need guidance.  I appreciate seeing most of the same people working there regularly so you do get to know them as you go more often. As a whole, they only had one mistake made and it was quickly fixed. I would recommend this place for the cleanliness, friendly and knowledgeable staff and very good products!', 1525802300),
(907, 191, 'Nicole Eaton', 'https://www.google.com/maps/contrib/117015143803024852342/reviews', 'en', 'https://lh5.googleusercontent.com/-BhRjaY-ZHh4/AAAAAAAAAAI/AAAAAAAAAA8/1fOzD2a6Ppw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'The staff here are amazing! Great place to get my medicine anytime I need it. Thank you.', 1526751112),
(908, 191, 'Jill P', 'https://www.google.com/maps/contrib/104472884254152887135/reviews', 'en', 'https://lh5.googleusercontent.com/-4jzzT0WvXCs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0oBOju2DbKSP7s9196E-Hl5QKOoA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Very friendly staff, reasonable prices and great products....would definitely recommend this dispensary.', 1515789899),
(909, 191, 'Tara Spiess\'lucas', 'https://www.google.com/maps/contrib/104549562408728022011/reviews', 'en', 'https://lh3.googleusercontent.com/-Cwmzp7xjT9k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0BbwxgXX4j7XTHEG1u0xcGxZ9mlg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great place, professional and educational and very user friendly.', 1521203167),
(910, 191, 'Daniel Wright', 'https://www.google.com/maps/contrib/116295348741036826735/reviews', 'en', 'https://lh5.googleusercontent.com/-MKoHnBO4lG0/AAAAAAAAAAI/AAAAAAAAAAA/sAOgDTHq7o4/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '6 months ago', 'Setup appointment and immediately entered in my phone. When i arrived they told me I had the wrong appointment time and told I needed things they never mentioned when I setup the appointment. If you want nothing but problems, go here.', 1509649207),
(911, 192, 'Joann Deno', 'https://www.google.com/maps/contrib/108183939723583182299/reviews', 'en', 'https://lh5.googleusercontent.com/-nt644g8_8Hg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2YF518C096gRm9rsYnzJE84F4FEg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a week ago', 'My son goes here and really likes it. Staff is very helpful even with helping renew your license. They also have good prices according to my son.', 1526731175),
(912, 192, 'Mark Ciotti', 'https://www.google.com/maps/contrib/117608492263445531527/reviews', 'en', 'https://lh3.googleusercontent.com/-8QsE1uAWhDM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2tVSHaxUVHDXfVotX1F4yxy2G-Wg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Dave and Colleen the pharmacists Are just so knowledgeable, Understanding and caring!!!\n Its been such a pleasant experience from day one...\n All the girls in the office are so knowledgeable, helpful And go out of their way to help you.\nReally has been an awesome experience from day one... So many things have change in my life  And it\'s only getting better...\nI have to go now i have a DATE with T29 lol...\n\nTHANKS \nSo much guyzzz&GIRLS\nMark C. #420', 1512771450),
(913, 192, 'Ron Preston', 'https://www.google.com/maps/contrib/117583339359506713488/reviews', 'en', 'https://lh6.googleusercontent.com/-ezzIGnFTmus/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1a0OnjVxd-5rUTwMsSYsuG61kbJg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'Great place very clean and comfortable  employees are very friendly and go out of there way to explain things and help you purchase the correct itens. Always well stocked with a great assortment. I recommend this place to anyone looking fo a dispensary 5 stars', 1516849951),
(914, 192, 'Justin Mitchell', 'https://www.google.com/maps/contrib/105117844382562627203/reviews', 'en', 'https://lh6.googleusercontent.com/-aKQ_K6lLlng/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0c5SqWmOTyqz1m_vY7RaKmzNAaLw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'Great place and atmosphere. Would recommend this facility over any others.', 1520640123),
(915, 192, 'Shane Michaud', 'https://www.google.com/maps/contrib/102803362404663571192/reviews', 'en', 'https://lh5.googleusercontent.com/-EpoTsCBUSww/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1zmTZk0Zf9BCyMwq6b7gPfTpYBRg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'Very nice staff i recommend this place to all medical marijuana user\'s', 1525355444),
(916, 193, 'John Esposito', 'https://www.google.com/maps/contrib/115496023414507284314/reviews', 'en', 'https://lh3.googleusercontent.com/-alT7OqiqnEc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq34otlgFBb-O1jd1HEvzi_B2paMNA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'The staff here are 1st rate. They are very kind and very helpful. And always with a smile. Yale physicians should take a page out of Bluepoints handbook on bed side manners. Bluepoint has the best people of all the dispensaries. You people are phenomenal. Thank you for your compassion and professionalism. \n10 out of 5 stars!!!!', 1520419564),
(917, 193, 'rxdogs', 'https://www.google.com/maps/contrib/103252528061477161620/reviews', 'en', 'https://lh4.googleusercontent.com/-CTAk6rIgnFo/AAAAAAAAAAI/AAAAAAAAAEE/-XokZeNHZ38/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'I have found most of their Bud Products are over dried, over processed, not stored to preserve the desinty of the product. It is not worth the cost, it disintegrates when touched & burns mush to quickly. \nI tried contacting the Suppliers and they blame BluePoint Wellness for improper storage. Without being able to examine the product before purchase needs to change. Their only solution is to provide checmial packets to restore moisture to a natural product...ugh...once the potency is comprimsed, the product is also comprimsed...Black Market wins!', 1519740705),
(918, 193, 'Bart Connors Szczarba', 'https://www.google.com/maps/contrib/110032138715806848045/reviews', 'en', 'https://lh3.googleusercontent.com/-k8S5bU5MkSc/AAAAAAAAAAI/AAAAAAAFMGU/06Y_f9zcjxA/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg', 5, '2 months ago', 'Companionate care, helpful advice.', 1522281340),
(919, 193, 'Heather Joseph', 'https://www.google.com/maps/contrib/105159196941514618844/reviews', 'en', 'https://lh5.googleusercontent.com/-vlEKANdsWBc/AAAAAAAAAAI/AAAAAAAAEqE/PbDnbQRJqyg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'This business should be a model for all.the staff is so helpful and transparent.they stand by their motto of happy healthy and well..proffesional..comfortable..completly convenient.', 1502814798),
(920, 193, 'Catherine Murphy', 'https://www.google.com/maps/contrib/110160931794535991592/reviews', 'en', 'https://lh5.googleusercontent.com/-rtDJjKzafww/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2MVyDtneWkD3iU0yfSP0TiYs-wWQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'The staff at bluepoint have helped me reduce my medications by half already! They explain the products specific to my needs. With PTSD and anxiety I was so grateful to find the staff very kind. MMP has changed my life! Thanks BP!', 1498320089),
(921, 194, 'Jesus Matos', 'https://www.google.com/maps/contrib/113848531483859799862/reviews', 'en', 'https://lh4.googleusercontent.com/-LNTj1yjcqbA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1GXPq5QTPdDUmLW1U4mTpCD0x8AQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '4 months ago', 'Nice clean dispensary. The people are really nice and kind to you. Also they really know their stuff. Only Downside and the reason i rate 3 stars is their prices. At times they have good prices other times not so good. I find that a lot of the time the caring nature has cheaper prices. Also they offer their patients better bulk deals. If you can choose i would say go with the caring nature. Could end up saving 20+ dollars.', 1516135639),
(922, 194, 'John Doe', 'https://www.google.com/maps/contrib/102959927610887234105/reviews', 'en', 'https://lh6.googleusercontent.com/-_G8XUDYLQUw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0k44XK8mC6EAa30SJQSHaitFKCkA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'I tried to complain about moldy flower to Dave Slomski to which his response was \"If you don\'t like it go buy your weed on the street\"  \n\nGiven that response I would say that you would be safer doing what you do and not signing up and putting yourself on a list because the DCP won\'t protect you from these people. \n\nI told them that Dave told me to break the law and their response was \"it\'s not like he is a medical doctor\"...seriously.  Mind you that this is a guy who would walk out of the back office hitting a customers replacement vape pen which itself even if he had a cannabis card would be illegal to consume in the dispensary and would be illegal to share a patients medicine.\n\nFor three months the owner hid in her office when I would come in knowing that I had asked other employees to relay to her that I needed to speak to her in regard to Dave telling me to break the law until finally one day she called me immediately after leaving the store to tell me I would not be allowed to go to my assigned dispensary any more.\n\nIf you are a potential qualifying patient and would like to see and hear proof, feel free to contact me at this ID, I offer this because someone needs to actually protect patients who use this flower for wellness because to these privileged people the only thing this program is about is a dollar sign and a fake smile.\n\nI would advise not going here based on my experience with them and because of how the state and the DCP protects growers and dispensaries (and not consumers) I would refrain from buying from any of the dispensaries at least until a time where someone who know cannabis and actually cares is actually overseeing the program. \n\nIf you already are getting your medicine from someone who actually respects the product they sell and maybe even you, just stay away from this program until you have the legal option to grow your own and if you must sign up because you have absolutely no other option, avoid this dispensary at all costs...they really don\'t care about anything other than method of payment.\n\nHowever, if you don\'t know much about cannabis and like being used as a prop and another story that these people can use to further satiate their own greed...go for it and thanks for being part of the problem.', 1527540251),
(923, 194, 'Toetagga of300', 'https://www.google.com/maps/contrib/116474637731023782693/reviews', 'en', 'https://lh5.googleusercontent.com/-BpltFixI_EA/AAAAAAAAAAI/AAAAAAAAAEY/-URpJDECgeA/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a week ago', 'Very Helpful, Cool Setting, Caring Staff, No Long Waits ,and the most important GREAT BUD can  get what you need right there  need a lighter for ya pre rolls they got it need papers/cones to roll ya flower they got what ever you need they if don\'t have it I\'ll be Shock be they need to get that KK THO That\'s why I gave it 4 1/2 star', 1526864023),
(924, 194, 'Steve Weber', 'https://www.google.com/maps/contrib/104328945861631279633/reviews', 'en', 'https://lh5.googleusercontent.com/-Fo2co5t8C_g/AAAAAAAAAAI/AAAAAAAAA3U/hShLgcb2Boc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Love love love this place! They have the nicest staff, cleanest facility, and always good medicine! The pharmacist’s are extremely knowledgeable and always there to help. Wish there was more places like this! I’d give it 10 stars if I could! :)', 1513109835),
(925, 194, 'Crystal Massicott', 'https://www.google.com/maps/contrib/114307602265620409814/reviews', 'en', 'https://lh5.googleusercontent.com/-DarUcCwPiVs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3-YBNs5tFjclmEthQHsDeEQK9mAg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Everyone here is super friendly and makes you feel so comfortable! Everyone is very welcoming and the Pharmacists really take their time with you to get to know about your conditions, symptoms, and explain what can help you, and how it works etc.  It\'s not just a job for them they actually care and it shows. I would give 10 stars if I could!', 1509757496),
(926, 195, 'Chantelle Gileau', 'https://www.google.com/maps/contrib/106107465965383268201/reviews', 'en', 'https://lh4.googleusercontent.com/-hePf6oGDOh0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2_0NWWSoejiBjws8vMDh0RDOeEcA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Everyone at Canna Care were very compassionate and caring. Answered all of my questions and concerns. I highly recommend this place. Loving and caring from front end to back!!', 1521757362),
(927, 195, 'Kristen Dannahey', 'https://www.google.com/maps/contrib/108317717355891537223/reviews', 'en', 'https://lh4.googleusercontent.com/-xwr5Gpj7ipc/AAAAAAAAAAI/AAAAAAAAAJg/ywPnsPQW7x4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'What a great experience! Each staff member was friendly, welcoming, and knowledgeable. They treated you like a human being. No shame, no unnecessary runaround, and they were very forthright with information. I got a sense that each person working there was very genuine and that goes a long way with the doctor/patient relationship. \nThe doctor herself was just fantastic. She was understanding and compassionate. She listened to my story and I left feeling validated. The triage nurse is funny and engaging and had answers to all my questions. \nThe office was clean and relaxed, the bathroom was spotless. There is quite a wait usually, as I understand, and I did spend almost 3 hours there but it was worth the wait. Just bring a book! \nHonestly, I can\'t think of a single negative to report and that is not my default attitude towards doctors. Highly, highly recommend.', 1489753001),
(928, 195, 'Jessica Watson', 'https://www.google.com/maps/contrib/105588288782936082820/reviews', 'en', 'https://lh6.googleusercontent.com/-behtvToah0I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3tJccHHaAUOTt5FLmhbkU4kTrI9g/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'This place is a joke .. find a different place to go. First time I came here had to wait 2 hours just to have them check my blood pressure and vitals. Then was told to wait in the waiting room to see Dr. Would be 3.5 hours. Staff said come back Thursday well get you in and out..  So I came back they didn\'t open till 10:15 suppose to open at 10.. so waited to see the Dr.. after waiting an hour.  The staff mentioned the Dr was not even there and would hopefully be in within the next 30 mins.  Are you kidding me who runs this joke of a Doctors office ?!!! oh and by the way waiting room packed with screaming kids.  Never again. And the charge $ 200.dollars go somewhere cheaper and where staff and Doctor appreciate everyone\'s time is valuable', 1491490473),
(929, 195, 'Maggie Pires', 'https://www.google.com/maps/contrib/117823714475347946688/reviews', 'en', 'https://lh5.googleusercontent.com/-0mZPyRbSvfY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1BLxQltgkHVE6ASH6-8nvr6Nb4sw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Very pleasant experience.  Made me feel at ease', 1494680950),
(930, 195, 'Stewi Alvarez', 'https://www.google.com/maps/contrib/116910550817332086581/reviews', 'en', 'https://lh4.googleusercontent.com/-VW9QiOmFlpY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3gzHcFZaFkoOE1hk0F0yt7AbtwjA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'Great place.Awesome staff,very helpfull', 1505313565),
(931, 196, 'Mic Dea', 'https://www.google.com/maps/contrib/103517513619026124589/reviews', 'en', 'https://lh5.googleusercontent.com/-G8ju-uJRCqA/AAAAAAAAAAI/AAAAAAAAX10/hTHnxNJEy8E/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 months ago', 'Very personable and knowledgeable employees and some good conversation in the waiting room! Everyone there is helpful and ready to answer any questions you may have, I thought it might be a little uncomfortable going in. But I was mistaken! The whole visit was centered around your needs, and what you didn\'t understand, was explained to you in a way that you could. Wonderful work and thank you for making our lives a little more tolerable with your help and time.My go to for? answers and my medication!.', 1519403831),
(932, 196, 'melszy727', 'https://www.google.com/maps/contrib/115017416134121834850/reviews', 'en', 'https://lh5.googleusercontent.com/-SKzkKTNDj7Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq06sOxDt5ysAQnC0O5UbqsBO9sS2A/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a week ago', 'Great choice of product.  Awesome workers. Very helpful and they have lots of knowledge of products', 1526666842),
(933, 196, 'Bruce Provencher', 'https://www.google.com/maps/contrib/116036581178756086265/reviews', 'en', 'https://lh3.googleusercontent.com/-a0hkMPqNbWg/AAAAAAAAAAI/AAAAAAAACwM/M69soeDuHKk/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg', 5, 'a month ago', 'The people here are super cornflour and helpful. We walked in pretty blind and naive and they patiently at with us and explained everything embedded to know. No judgement or ridicule, just honest down to earth explanations and help.', 1523885572),
(934, 196, 'Lisa Lynn', 'https://www.google.com/maps/contrib/108067701681723836797/reviews', 'en', 'https://lh4.googleusercontent.com/-Cf8A8AvaauU/AAAAAAAAAAI/AAAAAAAAELU/xtx8xgHHnq0/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'Your in great hands here, everyone is so helpful, respect, and knowledgeable. Always Superior Customer service for all. It\'s so refreshing.', 1525517888),
(935, 196, 'Nicole LaRose', 'https://www.google.com/maps/contrib/103006299603802402315/reviews', 'en', 'https://lh3.googleusercontent.com/-_MC81PKnwDw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0AQBDYsrVyibKbCwf_GuGBQWpUAA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'New building & location is beautiful, with an added \"open to public\" Arcadia Smoke shop attached , with lovely warm welcoming and educational staff eager to help.', 1526952081),
(936, 197, 'Richard Crispi', 'https://www.google.com/maps/contrib/108221823623029673920/reviews', 'en', 'https://lh6.googleusercontent.com/-emMs9blhQJM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2DxCtlyJQC0biLzkyObPQAX4BxUQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great atmosphere and people.  Aleks made us feel welcome as soon as we walked in the door.  Dr. B. was very thorough and explained the treatment and process in a very professional and easy to understand manner.  The videos and articles they e-mailed us to read and view were very detailed and informative.  Looking forward to our relationship with them.  Thank-you Dr. B. and Aleks.', 1522337642),
(937, 197, 'wandi romano', 'https://www.google.com/maps/contrib/100697627733971351381/reviews', 'en', 'https://lh3.googleusercontent.com/-h-xJNn9jks0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ogMRVJmM0yqsRSUuFmxfEkgRxjA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Wonderful doctor! Caring and compassionate. Great staff. Great information.', 1527152255),
(938, 197, 'Julio Maldonado', 'https://www.google.com/maps/contrib/112008781500142263450/reviews', 'en', 'https://lh6.googleusercontent.com/-N3aE3i39Ob8/AAAAAAAAAAI/AAAAAAAAAFk/QyMjNaPTvWU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'My experience at REN Health was very pleasant. I was prompt by seeking a natural remedy for my condition, Dr. Bibikau was very informative by presenting the pros and cons of cannabis. I highly recommend anyone to visit or set an appointment for anyone seeking healing by other means. I thank REN Health and the staff for allowing me to come in. ', 1522153862),
(939, 197, 'jeannette allegretta', 'https://www.google.com/maps/contrib/114684096399538479773/reviews', 'en', 'https://lh3.googleusercontent.com/-cfqYLXW9z3A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1SwhPMIZibLF0_MpB_UWsEbyjr7g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'My experience was wonderful.. Starting at the doctor\'s office, the whole day was a wonderful experience. Bless you and thank you all for all your help.', 1524686263),
(940, 197, 'Harry Kravet', 'https://www.google.com/maps/contrib/114848646425448878418/reviews', 'en', 'https://lh5.googleusercontent.com/-Eks8YHtsA0c/AAAAAAAAAAI/AAAAAAAAABM/br62qP503g8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I cannot say enough good things about my experience with REN Health Center. I was treated with the utmost respect. The doctor makes it very clear he is here to help us live the best quality of life we can. We aren’t just a number here. Im privileged to have met such caring smart people. Thank you team !!', 1519073845),
(941, 198, 'Tanya Simon', 'https://www.google.com/maps/contrib/114526205735494952741/reviews', 'en', 'https://lh6.googleusercontent.com/-SiHF9ZmQnr4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1DoruyFXgM4Fwn2Dn4o43VsKghow/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '2 months ago', 'Unfortunately I can\'t say anything good about this Practice. From what I\'ve heard, my family member has never been seen by an actual doctor at this Practice. Only by a Physician\'s Assistant which is the Mother of Corey Jaquez; Janice Jaquez. Everytime I call the office the staff IS RUDE AND CUTS YOU OFF WHEN YOU\'RE SPEAKING TO THEM. HOW DARE THEY!!!!!!! My family member has yet to see the real Dr. Jaquez and is suffering from a fall. The office has done absolutely nothing to get in contact with my family member regarding a referral for an injury. She is currently suffering at home, not being able to walk well enough to get to the bathroom and they still haven\'t approved a commode and a wheelchair for her. Very unprofessional in my opinion. I am looking to get to the bottom of what is really going on in this office. They don\'t seem to care about their patient\'s at all. - My aunt ended up passing away on September 25th, 2017. She couldn\'t walk down the stairs after her back surgery and now she\'s gone. They could have cared less about my Aunt Debbie, with their inability to be a good caring physician when she was hurt!!!! Shame on you Corey and Janice!!!', 1522367038),
(942, 198, 'Marwa Fedda', 'https://www.google.com/maps/contrib/104517749243559316485/reviews', 'en', 'https://lh3.googleusercontent.com/-J8B7jBspLfA/AAAAAAAAAAI/AAAAAAAAAMM/elR_fkpcxyk/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'Wooooow I don’t know who gave this “doctor” his certification but he’s terrible. Not only is the staff very unprofessional it’s feels like I was talking to ghetto people not trained medical professionals. They lost my files multiple times AFTER I PAID. The staff gets loud and has a reallllly bad attitude. Not only that but you can barley understand some of the bilingual workers (I’m an immigrant and I’m trilingual but I wouldn’t hire someone my patients wouldn’t understand). Getting in contact with the doctor himself is nearly impossible. They give everyone the run around and always tell patients the doctor is having a busy day but you’ll never hear from him. I hate this doctor and his staff and has a previous 5 star review but trust me that was my review after one visit a year ago before they lost my files, THREE TIMES!', 1515519805),
(943, 198, 'Terry McGinn', 'https://www.google.com/maps/contrib/116254089690185130261/reviews', 'en', 'https://lh6.googleusercontent.com/-6J1O_qizbQw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq09uI8XTSkrEvUkf2-bZo3ldv_ilw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I saw Dr. Corey Jaquez.. from the moment entering the office there’s a relaxed atmosphere. Receptionist and medical assistant were also top notch. Dr. Jaquez was through and easy to talk to. I would highly recommend using Dr. Jaquez, he’s great!!', 1515958944),
(944, 198, 'D. Norris', 'https://www.google.com/maps/contrib/114974518784941044824/reviews', 'en', 'https://lh3.googleusercontent.com/-EMLkGApGocg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2G8hKeZ_zh9ZUyjcL1YbSQvl3fYw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Dr. Corey and the staff have always been friendly and professional. The wait is never more than is expected in any doctor\'s office. He listens to what you\'re saying and asks questions, as well as answer yours. My paperwork is usually done promptly. This is my third year and I will definitely go back next year.', 1508542800),
(945, 198, 'Cin V', 'https://www.google.com/maps/contrib/113898263540613037318/reviews', 'en', 'https://lh6.googleusercontent.com/-totN105Hymo/AAAAAAAAAAI/AAAAAAAAACc/SJZl7yQb9z4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Staff was nice; Dr. Jaquez was very nice and understanding. As long as you have your diagnosis from another MD and payment getting your Cannabis card is easy. My appt was at 9am on a Saturday I was out by 9:45. I would definitely recommend him!', 1510570168),
(946, 199, 'Keisha Cruz', 'https://www.google.com/maps/contrib/118132325116803705689/reviews', 'en', 'https://lh4.googleusercontent.com/-OT0nIHtUdqk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq18xywjF1Use4yJBUghuOwlRO9nEA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Came here with my cousin for primary care and the office was a mess. There’s papers thrown all over the place, the staff is back and fourth looking very miserable you can hear the doctor from all the way down the hall being very loud I recommended my cousin to never go there again very unprofessional and disorganized do not reccomend', 1522874438),
(947, 199, 'D. Norris', 'https://www.google.com/maps/contrib/114974518784941044824/reviews', 'en', 'https://lh3.googleusercontent.com/-EMLkGApGocg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2G8hKeZ_zh9ZUyjcL1YbSQvl3fYw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'I see Dr. Corey once a year for my mm  card. He\'s always been very good! He asks how I am, physically and if it\'s helping. He spends quality time listening to me. The staff has always been nothing less than pleasant. They even bought the entire waiting room coffee once. See for yourself. Don\'t judge on bad reviews!', 1504728972),
(948, 199, 'Charles K', 'https://www.google.com/maps/contrib/111622429163420461747/reviews', 'en', 'https://lh4.googleusercontent.com/-1ujIa8cMLzo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2WVjpT51cS34inAvDd-APBgkTmNQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'Dr. Jaquez is very nice and I\'ve never felt rushed. The staff was kind and friendly.', 1505163541),
(949, 199, 'Jesus Matos', 'https://www.google.com/maps/contrib/113848531483859799862/reviews', 'en', 'https://lh4.googleusercontent.com/-LNTj1yjcqbA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1GXPq5QTPdDUmLW1U4mTpCD0x8AQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I\'m not sure why this medical practice is getting such bad feedback. I was there about a week ago and they were Great! Very professional and compassionate. Doctor Corey is a great doctor and the PA was also good. She was very nice to me and made me feel comfortable. Ignore all those other reviews and see for yourself, trust me you won\'t regret it. They are caring and very informative when explaining things.', 1465386267),
(950, 199, 'Kathryn Mas', 'https://www.google.com/maps/contrib/110806557360963074877/reviews', 'en', 'https://lh4.googleusercontent.com/-k08AIxuS55M/AAAAAAAAAAI/AAAAAAAAANI/AD7ZjVsvyNU/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'a year ago', 'I was pleased with Dr. Jaquez, however it ends there. I had to fax a letter to the office twice because no one could locate it. The office is rather small & it\'s a mystery as to how it could go missing. I have the confirmations so I know they were received. The office person then asked if I could hand deliver it? I was under the misguided assumption that that was fax machines were for!! Then I called to check once more if the letter had been found before I drove well out of my way to hand deliver it. Their listed hours are 8-8, but when I called at 10:40 I reached a voice mail. This has delayed my treatment by more than a  week because someone cannot keep track of incoming faxes. I\'m upset about the cavalier attitude that prevails in this medical center & the poor treatment that is offered.  ', 1476370370),
(951, 200, 'Peter Didomenico', 'https://www.google.com/maps/contrib/109986085535968849233/reviews', 'en', 'https://lh3.googleusercontent.com/-5z1bTELSBcA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq17lvGK5_XTQM0IKM5q5m5JogutNQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'She changed my life. My PTSD is all better. Thank you so much Kelly', 1513553477),
(952, 200, 'damian monick', 'https://www.google.com/maps/contrib/107009130626940663566/reviews', 'en', 'https://lh6.googleusercontent.com/-fzk61FTp8l8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1l7TU5M_Bao_tnab_N69sPMn9TLA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Great experience with Kelly!  She was informative and caring.  Not business as usual like some other doctors.  Will be back for renewal.', 1511378321),
(953, 200, 'Mary C', 'https://www.google.com/maps/contrib/105283273053452499768/reviews', 'en', 'https://lh5.googleusercontent.com/-5mLZ0R0prF0/AAAAAAAAAAI/AAAAAAAAACM/SLw7sp1LOv4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Had a great experience with Kelly! Changed my life :)', 1513553405),
(954, 200, 'liz A', 'https://www.google.com/maps/contrib/116769281130896230310/reviews', 'en', 'https://lh3.googleusercontent.com/-YWC6cwthwZg/AAAAAAAAAAI/AAAAAAAAAPI/qp55PYrdN0Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', '', 1513377317),
(955, 201, 'Cj Kovacs', 'https://www.google.com/maps/contrib/114481573339527179910/reviews', 'en', 'https://lh5.googleusercontent.com/-9uPCy4oV0uQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0vDlEc2PK37Ip_1F0OvfUB2c1DQg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Had a pleasant experience, very polite and nice. Dr. Major had gone out of her way to get me in quickly too when my card came close to expiration. She was incredibly helpful, knowledgeable and polite and I recommend her to anyone who\'s in the same place I waa', 1523898283),
(956, 201, 'Linda Purcaro', 'https://www.google.com/maps/contrib/111070784277840405821/reviews', 'en', 'https://lh4.googleusercontent.com/-RHXSAkl5Nnw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0cH5QZaJwpM00NuXJpCUPfecSQbw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Dr. Majors is so compassionate, easy to talk to,  and extremely helpful. I was in so much pain, had difficulty walking until I booked an appointment with her. I have severe Psoriatic Rheumatoid Arthritis, without Dr. Majors  I cannot imagine where I would be. Thank you Dr. Majors for all your help. You also have the best staff ever.', 1518810938),
(957, 201, 'Chris Carberry', 'https://www.google.com/maps/contrib/112330033003673097496/reviews', 'en', 'https://lh3.googleusercontent.com/-O-Y2ys7DrUg/AAAAAAAAAAI/AAAAAAAAFww/6iW1WnP6iT8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '11 months ago', 'In addition to having an amazing office staff, Dr. Major is one of the kindest, most knowledgeable doctors in her field. I live 1.5hrs away, but the reason I always come back to her for my recertification and always will is because of her extraordinary level of care and service. Thanks to Dr. Major\'s recommendations I no longer have to worry about seizures, and I\'ve gone from only being able to handle liquid foods and weighing 115lbs as a 6ft1in male to being able to eat real food, and I saw dramatic improvements in my weight and equally dramatic decreases in the nausea and vomiting that had plagued me in the past, and my seizures have been under control. When I came in for my office visit today, within 10 minutes I was in the room with the doctor, she asked me about all of my issues, paid attention to each of them, told me about what would work absolutely best for me, and most of all she genuinely cared about me. Before I even left the building she had submitted the recommendation to the state and I received an email. If you want quality care from someone who knows what they\'re talking about, she\'s the doctor you want. ', 1497637898),
(958, 201, 'fran coleman', 'https://www.google.com/maps/contrib/110614843912988472990/reviews', 'en', 'https://lh3.googleusercontent.com/-dv1Hv6vc3ok/AAAAAAAAAAI/AAAAAAAAGq4/x6r0c5bM3jM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a year ago', 'I understand what people mean when they say that she is quick and to the point. \n I suppose you could call her abrupt, if you did not understand her mannerisms you might even call her rude, but I don\'t believe she is rude.\n\nI called, received an appointment for the very next day, went in and everything in my file was 100%, so the process was quick and smooth.\n\nI\'ve already done the third step – which is filing online and sending in my picture/payment for my card, now I am impatiently waiting for my temporary card to get here.\n\nShe\'s knowledgeable about what she does, she does not need to sugarcoat anything, or baby you. \nYou both know why you were there so there\'s no need to play coy.\n\nI for one was particularly grateful for her mannerisms and her professional way. I was not there to make a friend I was there to get down to business and go home. I can be friendly with the Doctor that referred me to her because he is the one I see more frequently.', 1484797359),
(959, 201, 'Lucealaina Mariano', 'https://www.google.com/maps/contrib/114258760780625091149/reviews', 'en', 'https://lh3.googleusercontent.com/-5UhklpUw1aU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2zrghEFlbVE2b9TLGimU7yYUd_2A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I\'m Grateful for Dr.Major\nShe has changed my life! \nDr Major, is a wise doctor.She understands \nWhat is best for the human body,Where\nModern medicine was doing more harm then good to me.\nI needed a doctor who educates one self to look for what works.\nI found her:)\nThank you Dr. Major', 1484364808),
(960, 202, 'Michael louis667', 'https://www.google.com/maps/contrib/106529478195146687956/reviews', 'en', 'https://lh5.googleusercontent.com/-Ad9m5JoX8RM/AAAAAAAAAAI/AAAAAAAAABw/ZaclJIYAu2g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Dr. Said  and Brittney are wonderful. I recently lost my fiance and they\'re getting me through a tough time in my life. Non judgemental. Best PCP I have ever had hands down', 1524491504),
(961, 202, 'Arielle Decola', 'https://www.google.com/maps/contrib/110076585745483671353/reviews', 'en', 'https://lh6.googleusercontent.com/-olHRwnpP6NE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2PyVFNgJPWHpWzjHeHe4CL10Kpgw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Dr said has helped me for years now. His patients have grown so much over the years due to his kindess and willingness to LISTEN. Yes hes a doctor who actually cares and listens!! I drive over an hour and half just to see him every month because of how much he truly cares about his patients and their well being!', 1518830804),
(962, 202, 'ian compton', 'https://www.google.com/maps/contrib/116821149190700005770/reviews', 'en', 'https://lh3.googleusercontent.com/-11O_MvHhPdA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0l4Wn0rtMOAQlPXgpiV-z4sDIlDg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I live in Connecticut and went in for an mmj certification. Everyone seemed bright & cheerful, especially for 9 AM on a Saturday. There is a cute tiny little doggie in the office named Rocky, very friendly. (I think I heard someone say hypoallergenic.) He\'s smaller than a cat. If it\'s an issue for you, fair enough but the clicking of his tiny feet made me laugh, and the office was clean.\n\nI got a standard mmj certification, provided the needed docs, and was given the required rundown on how the program works.\n\nFor an extra $25 they take care of everything needed by the state including on-the-spot ID photo. It\'s great if you can do it because if you miss one thing, your application gets held up. Very satisfied. Got my temp card email from the state in 2 weeks.', 1523986691),
(963, 202, 'Brittany DelSanto', 'https://www.google.com/maps/contrib/102055897273184533692/reviews', 'en', 'https://lh3.googleusercontent.com/-d2UEQq6EJWg/AAAAAAAAAAI/AAAAAAAAJSM/_cXyoo-KzJw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'I can honestly say I\'ve never felt more comfortable and cared about by not only the doctors but the entire office staff. I\'m truly thankful to have doctors that actually care about my well being. Thank you all so much!', 1525957390),
(964, 202, 'Gina Madden', 'https://www.google.com/maps/contrib/101680125216448176915/reviews', 'en', 'https://lh3.googleusercontent.com/-FlqQSa4ljm4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0RcIyobuyhHPQq11DhRkFaF-jL1w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Everyone in the office is wonderful. They are very patient and caring especially DR. Said.', 1527347315),
(965, 203, 'Tara chan', 'https://www.google.com/maps/contrib/103566516866555738527/reviews', 'en', 'https://lh6.googleusercontent.com/-DnI17qdTaX0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3IrvZNqVlcKsH8TYl-ivzEltCBwA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Dr. Bonanno is the most kind, caring and understanding Psychologist I have had the pleasure of speaking with. I\'m usually anxious before speaking to strangers but after researching him I knew I was in good hands. He helped me understand what I believed was happening to me and gave me plenty of options with advice on how to get the help I\'ve needed. I couldn\'t be more appreciative and relieved to start my journey of healing. I will be recommending him to my family and friends who need someone as knowledgeable as Dr. Bonanno.  Thank you so much Doctor!', 1525980160),
(966, 203, 'Christopher Sweeney', 'https://www.google.com/maps/contrib/111217843028452015730/reviews', 'en', 'https://lh3.googleusercontent.com/-cdsk7e2S_4A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0dU5MQJ5zmAZMOqHV0oWQ1aL-NmQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Doc Bonanno is an incredible heath professional. After doing my own research on Dr. B i was pleasantly surprised to learn that he isn\'t just a doctor in his field, he has lived and fought within his own life, much of what he diagnoses therefore he\'s the real deal. Its a good feeling to know that your therapist can relate to the same problems you are dealing with, bcuz in this day and age it seems like everyone has an opinion yet NOBODY has experienced the problems. \n\nIf you want to smile again and know that your doctor has your best interests at heart(and not just your cash), give Dr. Dave Bonanno a call.', 1525372500),
(967, 203, 'Theresa M', 'https://www.google.com/maps/contrib/111900780982744798572/reviews', 'en', 'https://lh5.googleusercontent.com/-IsY0pqjIcxg/AAAAAAAAAAI/AAAAAAAAAJk/nTjrGQov_Xw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Dr. Bonanno is the best Psychologist that I have met. He is understanding and caring. I was so nervous before my appointment but Dr. Bonanno made me feel at ease. He knew exactly how I was feeling. He offered a few options to help me get well.  I am very thankful for him and recommend him to anybody seeking treatment.', 1523382101),
(968, 203, 'Louise Male', 'https://www.google.com/maps/contrib/113637642369760625929/reviews', 'en', 'https://lh6.googleusercontent.com/-_yEDTmQzBX0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3KpxC45mWHes2g6BxVjMtrWCebpQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'This is one amazing Dr.  I truly can\'t believe the service, patience, and helpfulness from Dr. Bonanno.  There are still doctors that you can talk to and will address you as if you aren\'t an idiot.  He reminds me of the doctors of old that actually make house-calls.  I can recommend him fully and unequivocally as 100% genuine and worth every penny!', 1519651722),
(969, 203, 'David Davidsen', 'https://www.google.com/maps/contrib/109263529209195927254/reviews', 'en', 'https://lh6.googleusercontent.com/-Y_h1LZCKvzA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1kL8Afw0t5EVUNQec_Xuinv0r7SA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Dr. Bananno was very knowledgeable and attentive to my situation. He gave me the confidence to address my needs and move forward. I would and will recommend him to friends and family.', 1526497920),
(970, 204, 'Barry LaFleur', 'https://www.google.com/maps/contrib/104031066817778870573/reviews', 'en', 'https://lh6.googleusercontent.com/-92hCkdRIAa4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0_QoFIgUver1z9NqxwzFAmd-thUw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', '', 1514470156),
(971, 206, 'C Gosnell', 'https://www.google.com/maps/contrib/101307228449998153421/reviews', 'en', 'https://lh6.googleusercontent.com/-iLa7gzg5Sks/AAAAAAAAAAI/AAAAAAAArBU/GypI2x6UjaU/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Thank you Dr Burnham. You and your staff were very kind, understanding of my condition, professional and caring. You listened to me, my concerns and explained everything to me clearly. You have improved my life greatly and I thank you very much.', 1522676928),
(972, 206, 'Joanne Marnett', 'https://www.google.com/maps/contrib/107791203078380919960/reviews', 'en', 'https://lh5.googleusercontent.com/-Nn_ZG0ONxXQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq37V2vBovZvYHkzeReLmRM6Mj8qBQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '6 months ago', 'I saw an ad for laser hair removal.  Came in for consultation.  Was promised two things 1) The results would be permanent or at least VERY long lasting and 2) It would be virtually pain free\n\n1)  The results were spotty and sporadic.  I had six treatments.  Hair quickly grew back after each treatment just as full and dark as it was before I spent $3,000.00.  Never even got one hair-free week.\n\nAlso, to avoid liability, they made me sign a (we can\'t promise any results) type of waiver the morning of my treatment when I was already committed to it after hearing their promises on our initial consultation.\n\n2)  The process was excruciating.  It felt like sizzling grease was splattered on my skin thousands of times.  I gritted my teeth throughout the whole process.  Then I was left with painful bright red patches.\n\nThe people were nice there but most people are nice when they take your money after making false promises.', 1510071782);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(973, 206, 'Emily Sunderland', 'https://www.google.com/maps/contrib/116342572403534134402/reviews', 'en', 'https://lh4.googleusercontent.com/-EHZDhKFKQIU/AAAAAAAAAAI/AAAAAAAABBs/nYtG-2kzBQM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I’ve known Dr. Burnham for years and would highly recommend him. He has excellent judgement and perspective and so much experience. He also has a great personality.', 1519153413),
(974, 206, 'Peggy mchugh', 'https://www.google.com/maps/contrib/117716005923661981617/reviews', 'en', 'https://lh3.googleusercontent.com/-O159V5F6NVQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0jDTHOr6EVQNepiQ0157RoadKsMw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '11 months ago', '', 1496758951),
(975, 207, 'Travis Tangredi', 'https://www.google.com/maps/contrib/110078094090757205967/reviews', 'en', 'https://lh3.googleusercontent.com/-9osWsGVVxQ8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1pBYYG_kHlmM12qv6qkdcyEJO1pg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Great experience for obtaining a Medical Marijuana Evaluation!', 1499404250),
(976, 207, 'Kelly Bucci', 'https://www.google.com/maps/contrib/109445096766714587743/reviews', 'en', 'https://lh3.googleusercontent.com/-fgqEXFeZYRE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1h2t39IzK4CqyA_5FP_Inx3koNWw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'excellent staff, no waiting, compassionate and caring', 1500042142),
(977, 208, 'ZackTheMac', 'https://www.google.com/maps/contrib/100718396631632519273/reviews', 'en', 'https://lh4.googleusercontent.com/-qQdA3xJdJT4/AAAAAAAAAAI/AAAAAAAAAMM/3f5i_H9Li_U/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'If they keep the 100$ credit reward for 1000 points this store will stay 5 stars all around. A little pricey but, the closest you\'ll get to what you should actually be spending on bud. This is coming from the first person in Colorado to get my medical card underage; I was 16: 25 now. I know what I\'m talking about. Probably the one person in Colorado who has made the most visits and spent the most time in dispensaries out of your average citizen. Staff are cool and always upfront about everything you need to know.', 1525297481),
(978, 208, 'Claire Nobles', 'https://www.google.com/maps/contrib/109641626071611765613/reviews', 'en', 'https://lh6.googleusercontent.com/-SOzbxCjQuEk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1gX0tOR3tsN0xyWXxcT4YEKkQtVA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Best dispensary ever. They always remember me, my name, and what my favorite strain is. They are more expensive, but you get what you pay for. It is HIGH QUALITY and AWESOME service. And on top of all that, it\'s so beautiful, sleek, clean', 1526067312),
(979, 208, 'Angelina Kianka', 'https://www.google.com/maps/contrib/103901472554175162547/reviews', 'en', 'https://lh6.googleusercontent.com/-dhS9vlzlmfc/AAAAAAAAAAI/AAAAAAAAAKs/UQhnTVcnkwc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Such friendly staff and amazing customer service! Jason was wonderful! It was my first time in a dispensary, and I had a ton of questions but I left feeling completely confident in my choices. Thanks a bunch!', 1525908121),
(980, 208, 'Kaitlyn Vachon', 'https://www.google.com/maps/contrib/104914734983790462308/reviews', 'en', 'https://lh6.googleusercontent.com/-3DH0Q8RHers/AAAAAAAAAAI/AAAAAAAAAQg/j3vZAFjH6Cw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'Amazing customer service! First time in a dispensary and they gave me a really special experience. My birthday had just passed and they even hooked me up with a free birthday goodie. Great place for edibles & the staff is super knowledgeable and friendly!', 1525198382),
(981, 208, 'Sarah Scalise', 'https://www.google.com/maps/contrib/106710926642698161194/reviews', 'en', 'https://lh4.googleusercontent.com/-wICPI5-bMGw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1_lfbS45Btv0E_mduiXmiNkQ2Dig/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 2, '2 months ago', 'I have been a member for past year, however the last couple months have been disappointing as a regular customer. First, the maximum withdrawal at ATM changed from $400 to $200--simultaneously the fee was raised to $2. Because I now have to complete two transactions for my purchase the ATM fee quadrupled. When I mentioned this to staff they failed to understand the concept and repeatedly insisted it had only gone up by $1. Second--you have stopped carrying o.pen cartridges. I\'ve asked on 3+ occassions when these will return and staff is unable to give clear answer. Third--they have temporarily eliminated strain of the day for some type of promotional contest. This increased cost by $25! Part of the responsibility of running a medical dispensary is being aware if your customers needs and budget. This gimmicky contest fails your repeat medical customers shopping on a budget. I will use up my points at this location and then transfer to a more patient focused dispensary.', 1520036871),
(982, 209, 'Audrey Jones', 'https://www.google.com/maps/contrib/105719049652797416785/reviews', 'en', 'https://lh6.googleusercontent.com/-haHkCDOmcSY/AAAAAAAAAAI/AAAAAAAAAP4/ZMsxO1BzCZQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'a month ago', 'I have been here at this practice now since I turned 18, I am about to turn 21. Please seek other practices if you are looking for relaible treatment. They are extremely short staffed and their walk in never seems to be open when you need it... Everytime I am sick I just go to the emergecy walk in now because they are so unrelaible. If you love to be stuck at the doctors office for 2 hours this is the place for you. I had a fever of 102.5 once and sat in the room without seeing a nurse until an hour and a half later. I wasnt seen until I eventually got up and walked into the hall and said “can someone come see me so I can go home.” I also had a physical and I was told I would get my prescription the next day. It has now been over 2 1/2 months and I still have no perscription. I called and talked to the front desk and they say they will call me back asap with news about the prescription and guess what! They never call back! Today I finally decided to leave this practice. Staff is very nice but thats about the only good thing I can say about this place \nLong story short look elsewhere for your health needs..', 1522959031),
(983, 209, 'Ryann Lenning', 'https://www.google.com/maps/contrib/105171670144589711563/reviews', 'en', 'https://lh3.googleusercontent.com/-20uLahDEyqI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2SGLFE60eiBD2xDZSt3rvGoNRRkA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Yesterday I had my first appointment with Dr. Pecher. I\'ve seen many doctors in the past, but not a single one of them can compete with the level of care and compassion that Dr. Pecher and her staff showed me. First my appointment had to be rescheduled due to the snow day, but Dr. Pecher was nice enough to fit me into her busy scheduled so I wouldn\'t have to wait another few weeks to be seen. The moment you walk in the office there is such a positive energy! The ladies working the front desk are very nice, and you can tell just from their packet you have to fill out that they truly care for you as a patient as they ask almost every medical question you can think of! \n\nBefore Dr. Pecher saw me, a gentleman who I can\'t remember his name, took all my history and did my physical. He was so calm that it eased all the anxiety I had about being in a doctors office in the first place. \n\nAfter that I was able to talk to Dr. Pecher. The first thing I noticed was she didn\'t look at all like a stereotypical, scary doctor! She had a very cute outfit on that was both professional and relaxed. She took a lot of interest in what I had to say about my health, she even ordered some labs for me and gave me a couple referrals just to rule out anything there could be. I\'ve never had a doctor be so thorough!\n\nI would highly recommend anyone looking for a doctor who applies both traditional and modern medicine to go see Dr. Pecher!!\n\nThank you so much Dr. Pecher, and your lovely staff, for making me comfortable in a doctors office setting for the very first time! :)', 1521128950),
(984, 209, 'Gary Smith', 'https://www.google.com/maps/contrib/114087488595916902557/reviews', 'en', 'https://lh3.googleusercontent.com/-bp03RPTlEt8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1kkou7OA_ZYY8zfrA7zhbk0O8KlQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'One of the most caring physicians I have ever met and listens to her patients. I am lucky to have her as my PCP.', 1504227349),
(985, 209, 'mike lumpadump', 'https://www.google.com/maps/contrib/112255800839657764827/reviews', 'en', 'https://lh4.googleusercontent.com/-v0Cx0yU2Zl4/AAAAAAAAAAI/AAAAAAAAANA/m7CC8aeMfIw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Great clinic! Wonderful and caring staff, thank you all for making my visit so pleasant today! \nDr. Pecher is amazing!', 1500937652),
(986, 209, 'Terry Baruffa', 'https://www.google.com/maps/contrib/103367994597817590550/reviews', 'en', 'https://lh3.googleusercontent.com/-0Yk2RiLSsAw/AAAAAAAAAAI/AAAAAAAAAQg/AcDkOKBJrtI/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '7 months ago', 'Awesome group of Drs,  PAs. And Admin staff.', 1508857397),
(987, 210, 'Lachlan Estep', 'https://www.google.com/maps/contrib/110738428136013703822/reviews', 'en', 'https://lh4.googleusercontent.com/-o_jMLF_nh2I/AAAAAAAAAAI/AAAAAAAAIHA/S3tg5puKrX8/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, 'a week ago', 'The people are excellent. The product is good. The only reason I can\'t rate it five stars is the availability of product and the hours. While it\'s great they\'re open later for people who work, I would love it if they\'d open earlier!\n\nThe product availability will ease as more stores open. They\'re supplying the entire state at this point, it\'s difficult to keep everything available, I get that! \n\nThe staff is absolutely AMAZING though. Cannot give them enough praise. I\'ve been a patient there for over a year and have noting but good words for all of them. (Honestly this was up for two months and no one let me know my phone autocorrected there to they\'re!?)', 1527091270),
(988, 210, 'Maddie Johnson', 'https://www.google.com/maps/contrib/116357310067584142448/reviews', 'en', 'https://lh6.googleusercontent.com/-LLfSqExnyZc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3JDzr03pn2g9w5lX5qbhC78c_A8g/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'in the last week', 'I usually have a wonderful experience there, but today was a very different occasion. For a reason that I didn’t get explained to me, I was skipped in line 3 times. The lady at the desk (who was very nice) showed me that I was at the top of the list and she had no reason they were skipping me. I had 24 mins I was waiting so far in addition to the time waiting outside. Then, after I brought it to her attention TWICE another person was called ahead of me AGAIN. I stood up for myself finally and said it was my turn. I felt discriminated against because everyone that was called ahead of me were white and I am a young black female. This may be a simple coincidence, but my advice is if you think about coming here you should keep track of who is in front of you. Medicine is very limited and someone making that “mistake” could cost you a trip. Hopefully a new dispensary opens soon so I won’t have to see this building again afterwards.', 1527607733),
(989, 210, 'Mickayla Brown', 'https://www.google.com/maps/contrib/107293552154881959653/reviews', 'en', 'https://lh5.googleusercontent.com/-PUQgcX6whJg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3n8yYLeRWfF6OEMTQgL8LzIAO15A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'LOVE this place! Everyone is so warm and refreshing! The prices are reasonable in my opinion.. ', 1525548247),
(990, 210, 'Venus Lynn Usher', 'https://www.google.com/maps/contrib/103972130667415659508/reviews', 'en', 'https://lh3.googleusercontent.com/-VYVHARSPfAc/AAAAAAAAAAI/AAAAAAAAAeI/qYz8lpDyfRQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Everyone I\'ve met has been helpful and kind. The security is great, and I love knowing what works best for me. Since going to botanicals, my life has only become better. Thank you for being a part in my recovering from the problems pharma caused.', 1518706980),
(991, 210, 'Henry Cutts', 'https://www.google.com/maps/contrib/114133370731624008327/reviews', 'en', 'https://lh3.googleusercontent.com/-Y3CcSTTLig0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq275JR2IKo49r1JAJBaqnODhwW63Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The weed really helps certain conditions..marijuana has to ingredient ...thc..n..cbd..the cbd.is mostly 4 ailements. Trully a blessing for insomnia..cesures..', 1523671066),
(992, 211, 'john doe', 'https://www.google.com/maps/contrib/116601970220481421957/reviews', 'en', 'https://lh3.googleusercontent.com/-OzAZ6L52hBw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2R4RZijmxvkPyG92CfiEhuVR7lZA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Great atmosphere, and very informative about cannabis treatments. I do have brain tumors and cannabis has shrunk them dramatically. Thanks!', 1526472396),
(993, 211, 'V R', 'https://www.google.com/maps/contrib/101273777961755667028/reviews', 'en', 'https://lh6.googleusercontent.com/-nJcgFgltPUo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1VrDj_IiKGE2gK4gDtnvAzl-ABDA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Went there today 12/30/2017.  Very respectful and I could tell he cares about the patient.  As a person in the helping profession, I was impressed with how extremely knowledgeable and forward thinking he was during my visit.  Anyone who gives this man a bad review had unreal expectations or just trying to tarnish his business.  He was training a young/new office manager, and he was respectful and patient.  I got good vibes from this young man. His business partner/colleague was top-notch as well!!', 1514677870),
(994, 211, 'Celia Wildridge', 'https://www.google.com/maps/contrib/103674782705393528387/reviews', 'en', 'https://lh3.googleusercontent.com/-EQCGpB1_of4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2ppM3-ELqqJV9Oktw9EtYkOk1xdw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Went to see Dr.Roman as my new PCP. Had a ton of problems with the last one. I was misdiagnosed by them, always being sent to get more medications and being told I was basically crazy. Anyway, so glad that I have a Doctor that is interested in the quality of the lives of his patients. He is caring and thorough. He is highly recommended and appreciated by not only myself, but checkout the reviews!', 1517255030),
(995, 211, 'S Gaither', 'https://www.google.com/maps/contrib/106789797373538863332/reviews', 'en', 'https://lh3.googleusercontent.com/-gbRcOHSZ6OQ/AAAAAAAAAAI/AAAAAAAAT1k/dnmhKqYTkPY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I was reading a few of the comments about the establishment and the doctor, and I dont understand why he was ever given a 1 star...To start, I went to his Wilmington location where you can tell this is NOT his main office OR that he is doing the best with that he currently has regardless the office was clean the staff was courteous and polite and my appointment was on time (I hate making a appointment only to sit and wait past the time it was scheduled). In regards to the doctor, he did NOT come off rude or insensitive. He actually was kind and we made jokes from start to finish. We started with what brought me to his office in thr first place speaking on my illness and how the medicine could potentially help (nothing is a for sure fix), we spoke of the process with the state and went over my paperwork..the man does his job, he\'s not there to read you bedtime stories, and hold your hand...those who was denied well thats on the State, how can you blame the doctor for the state denying your request? Your A1 in my book doc, see you on my next visit', 1523366470),
(996, 211, 'James White', 'https://www.google.com/maps/contrib/101870206078001473757/reviews', 'en', 'https://lh3.googleusercontent.com/--cVh6Yup1ew/AAAAAAAAAAI/AAAAAAAAAA0/pvAE7cmqXcQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'Be careful when dealing with Dr. Roman. He will lie to you and tell you that you will get approved for medical marijuana treatment just to take your money. Then when you get denied by the State, he will act like he can help you get approved next time but for more money of course. Scam artist. Either you qualify or you don\'t. Don\'t lie to people then ask people for referrals and to give you a 5 star rating online.', 1517968711),
(997, 212, 'Brendin Wessman', 'https://www.google.com/maps/contrib/104572524469383998683/reviews', 'en', 'https://lh4.googleusercontent.com/-wo6TGiOavRU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1GlKA2gnibcf2r6mwuocb9UqckAw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'Staff is incredibly friendly and quality is not bad(not great either in contrast with the price point). That being said now to the negatives.... first off prices are sky high not sure how patients are supposed to be able to afford their medicine at these high cost. They never have quantity which would offer a break in the price this only closes the door on savings for the consumer and leaves a limited window for the patient to purchase over priced smaller portions typically with very limited supply. How FSCC was awarded 2 of the 3 licenses to operate in Delaware blows my mind... they have totally cornered the market and are taking full advantage of this monopoly and continue taking advantage of those they were supposed to be helping. Hopefully maryland, jersey and pa will offer reciprocity to Delaware patients so we\'re no longer limited to going to a place where their top priority is dollars.', 1525865827),
(998, 212, 'Jake The Snake', 'https://www.google.com/maps/contrib/109561470548945326921/reviews', 'en', 'https://lh3.googleusercontent.com/-A_Dzb7UD9VM/AAAAAAAAAAI/AAAAAAAAAso/L94ultgDIZI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '5 months ago', 'First of all Guards are totally nice and cool because these guys truly are the first thing you see when you walk in.  They have lockers for your phone and keys cause you can\'t bring metal in.  Friendly staff greets you at the main counter and at the supply counter.  They have quite a few stations and you feel personally helped in each one of them, don\'t worry about having a favorite they are all the same.  Explanation of what the strain, paraphernalia, information, and what they are for really shows they are prepared to answer anything you have to ask.  I firmly believe this Lewes Store has now set the standard for it\'s industry.', 1513710214),
(999, 212, 'Daniela Rink', 'https://www.google.com/maps/contrib/107164986946961305845/reviews', 'en', 'https://lh5.googleusercontent.com/-OZWnGTuaINg/AAAAAAAAAAI/AAAAAAAACv8/yD7cIVEaTsM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 weeks ago', 'The staff are so friendly and patient. They answered all my questions and explained everything. Keep up the fantastic job!', 1525623751),
(1000, 212, 'Michael Rush', 'https://www.google.com/maps/contrib/104720759261230256416/reviews', 'en', 'https://lh6.googleusercontent.com/-PBl0vrSUNFo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0mU1ipE0NHOSDrgrY1QHz603Jh4A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I went to the Lewes store. As a new card holder, this was my first visit. Everyone was friendly and knowledgeable. All my questions were answered. I easily give 5 stars.', 1523334581),
(1001, 212, 'sharron Garrison', 'https://www.google.com/maps/contrib/108261333603666276802/reviews', 'en', 'https://lh4.googleusercontent.com/-cxDOs42G1o4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0PoXFf9WJiclZJXny7wzUvI1Mssg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, 'a week ago', 'Very pleasant experience. About time you can get medicine made by God, not big pharma!', 1526672838),
(1002, 213, 'Barbara Tintle', 'https://www.google.com/maps/contrib/104327716414843002864/reviews', 'en', 'https://lh3.googleusercontent.com/-LPrEkHAVb9E/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1G1mDoSK0k4SOcXXwshmfnZfFEiA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Amazing people!!  Jenna, at the front desk, is SO helpful!  She walked me through the entire process, as I had never been there before.  Consultation with Nick was very professional, patient and incredibly kind.  He taught me just about everything anyone would ever need to know about medical cannabis, from the properties of the plants to the regulations and laws in DE.  My visit was perfect!  I’d give more stars if I could.  There was no wait when I went.  I’d HIGHLY recommend them to everyone.', 1526656946),
(1003, 213, 'Mike Whiter', 'https://www.google.com/maps/contrib/105059130104090954661/reviews', 'en', 'https://lh4.googleusercontent.com/-mZ7qgAplUEs/AAAAAAAAAAI/AAAAAAAAdGE/TZ7onaF0VtU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Being a long time cannabis activist and advocate, you\'d think it would be easy for me to obtain a medical cannabis card in my home state of Pennsylvania, right? WRONG! \n\nI called no less than 12 doctors in Philadelphia who were on the registry and none of them were accepting new patients. Luckily, Canna Care Docs  has a PA licensed physician who is in the PA registry and was able to alleviate this stress.\n\nIf I hadn\'t known anything at all about cannabis, Erica would have made me feel completely at ease. Her knowledge of medical cannabis and the Pennsylvania and Delaware programs is impeccable and she can answer any question you have. The rest of the staff is also very knowledgeable and friendly and even with extreme social anxiety, I felt completely at ease and cared for.\n\nI 100% recommend Canna Care Docs to anyone who qualifies for medical cannabis. Go there. Talk to them. Learn about this healing plant! One Love!', 1522100482),
(1004, 213, 'Timothy Haney', 'https://www.google.com/maps/contrib/101829840818005212891/reviews', 'en', 'https://lh3.googleusercontent.com/-tAVZzGfPNCs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1R64_WLcLnHBNmaalDme93IZqhdA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'This place was honestly way above of what I thought it\'d be. The staff was helpful,caring,and very understanding. I would recommend this place to anyone seeking alternative medicine. 10 out of 10  hands down... The staff was very professional and knowledgable and the office is clean just as any doctors office would be.', 1526589572),
(1005, 213, 'Christine A', 'https://www.google.com/maps/contrib/118413135029556495398/reviews', 'en', 'https://lh4.googleusercontent.com/-ZmvfuLvSJzE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Cv9q02vOgW8RsnEQx1elF0FZqeQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'So far, the process has been professional without being stuffy. Staff are welcoming and make you feel comfortable. They are also cognizant of confidentiality and privacy and are respectful (not judgemental) of the issues which bring you to their services.', 1526494778),
(1006, 213, 'Renee Ford', 'https://www.google.com/maps/contrib/113312822234118322954/reviews', 'en', 'https://lh5.googleusercontent.com/-FVNduHWro78/AAAAAAAAAAI/AAAAAAAAAIQ/xguxZUUu8Ro/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The folks at Canna Care Docs are wonderful.  They help make the process of obtaining a medical card very simple and easy.  Definitely recommend them to anyone looking at completing the process.', 1526930153),
