(1020, 219, 'daisey', 'https://www.google.com/maps/contrib/113594446811934762534/reviews', 'en', 'https://lh6.googleusercontent.com/-Pazg8qE4zok/AAAAAAAAAAI/AAAAAAAAAAk/kdIc9b7VU8Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'When i first had my appointment made by phone,it was easy to arrange a time and day of the week...when i arrived, i  was greeted by friendly staff and signed in it took about 2 hours of being checked out to see and review all of my paper work ,health records,and i even got to sit down and talk about my pain levels what happens and how its effecting my life and marriage being disabled with spinal cord injuries is no fun,and i had four kids on top of it all which complicates things for me my pain levels range from 10 with no medication, and \nAfter i was fully evaluated and ready to leave i was asked for payment and left back home where i was able to enjoy life again.......\nSo its a special thanks to premier chronic pain care and its staff...which always were professional and so kind an generous...', 1461699086),
