(1032, 222, 'Rickey Crowell', 'https://www.google.com/maps/contrib/103820538717550329381/reviews', 'en', 'https://lh3.googleusercontent.com/-SjvGV6B_8YA/AAAAAAAAAAI/AAAAAAAAACU/Wa1STLG7seg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '2 months ago', 'At first it was like going to prison to see my son. Hated it.\nNow I feel like my friend is at the door, now we talk story.\nWant to come up? ( Aloha Green) Check this out; We have 16 licences for dispensary\'s, 8 licences 2 shop\'s per licence holder.\nApproximately 1300 Hawaiian (locales) have their Medical Cannabis cards. For the use as medical conditions. These are Locales, who are sick and need the relief, fight Cancer, etc.\nNow this 1st. year, if everyone bought a ounce of med\'s PR month at $250.00/200.00 PR once. The profit to each licence would be approximately 3.9 million dollars each!\nThat\'s a conservative estimate.\nSee; Medical Marijuana industry could lead to pot of gold in Hawaii Pacific Business on Google.\nYour lowering prices now on GM\'s and 1/8ths.\nGo all the way top shelf $250.00\nMed $200.00.\nThat is the average prices on main land. I am not a tourist, $500.00 a ounce, I can get 2 for less. Medical cannabis I know it\'s name and great tight fully grown and fire the guy who coure\'s your medical cannabis, your losing on flower taste, ect.\nGoogle it.\nPeace Rick', 1522477169),
(1033, 222, 'mike wazowski', 'https://www.google.com/maps/contrib/114411349105328790330/reviews', 'en', 'https://lh3.googleusercontent.com/-qS3yXuOjx44/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2VZ9Olz8-50A7mcWsnfTkA3aXChA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '8 months ago', 'First off let me say that I understand that it took a lot of money fighting legal battles to make this store possible BUT, just as a  customer on a budget I will most defiantly be getting my medicine elsewhere. It\'s nice getting medicine from a actually facility that puts it in a nice container with labeling, but I\'m I\'m not going to pay more than double for the same product just different packaging. I\'ll come back in a 6 months to a year and see if the prices are somewhat reasonable. Until then I\'ll just print my own labels.  Stay medicated my friends.', 1506209063),
(1034, 222, 'Pamela Waller', 'https://www.google.com/maps/contrib/111037268957681342679/reviews', 'en', 'https://lh4.googleusercontent.com/-_OZVma_6ENU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1xVKrptTcpoVK0TGekIRkCuzNCnw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'I Was number 30 on the first day of opening! My first time experience this.  And I  love the  Topical Pain Relief!  It really works. I rub it on this aching body! And it works! Waiting on A big bottle to purchase?  Hope it doesn\'t cost me a arm or leg? We all are hoping the prices go down a little bit.  But other than that no COMPLAINTS! And I love the security in front and outside everyone is !  I give Aloha Green a 10 .', 1507941031),
(1035, 223, 'Honolulu Wellness Center Cannabis Card Clinic', 'https://www.google.com/maps/contrib/109122407174988319935/reviews', 'en', 'https://lh5.googleusercontent.com/-k2rCycZceVI/AAAAAAAAAAI/AAAAAAAAAKc/GkdlPZrLCeE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'While I was deployed as a volunteer American Red Cross, Mega-Shelter Manager, to Houston Texas in the wake of Hurricane Harvey I referred any and all patients of my wellness clinic to Malie Cannabis Clinic. When I returned I contacted all possible patients we referred and they all had wonderful things to say about our fellow-clinic and I\'m so grateful that we\'re able to collaborate more than compete. Truly, we\'re able to \"Live Aloha.\" Mahalo to Malie Cannabis Clinic. I\'m always here for you too! Mahalo, Paul/patient-advocate', 1508679889),
(1036, 223, 'Hdhdhdjd Djdjdjdjdjd', 'https://www.google.com/maps/contrib/100789839763842615871/reviews', 'en', 'https://lh3.googleusercontent.com/-OGgOwbHtmbE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3AucgwxxB62wrGPq3rIFGTpt2CmA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Most professional high class intellectuals you will ever meet. They will guide you through every step of the process and make it as easy as possible.', 1509924727),
(1037, 223, 'Blessed Always', 'https://www.google.com/maps/contrib/117131243788605754908/reviews', 'en', 'https://lh6.googleusercontent.com/-5P2C2dYFIX8/AAAAAAAAAAI/AAAAAAAAAGk/taQf-zA6pTM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '8 months ago', 'I would recommend Malie Clinic to anyone seeking a natural alternative to Big Pharma.  I suffer from PTSD.  After years of trying different medications, that always resulted in terrible side effects, I decided to give medical cannabis a try.  I am very happy with the results and will never go back to taking Pharmaceuticals again! \n The staff at Malie is very friendly and knowledgeable and they made the whole process easy and enjoyable. \nMahalo Plenty.', 1505096932),
(1038, 223, 'Jay Holton', 'https://www.google.com/maps/contrib/118201104044660725392/reviews', 'en', 'https://lh6.googleusercontent.com/-XuT66rpOSJc/AAAAAAAAAAI/AAAAAAAAAFE/Nlktq7ZtawE/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '9 months ago', 'Great place to get a 329 card in Honolulu. Excellent service.', 1503994029),
(1039, 223, 'Carolyn Golojuch', 'https://www.google.com/maps/contrib/116510782260204000429/reviews', 'en', 'https://lh3.googleusercontent.com/-ipmu4cRs7o0/AAAAAAAAAAI/AAAAAAAABJc/DdHcXSt5bvg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'If only the Hawaii State Senate Medical Committee would stop stonewalling the people\'s access to their pain relief! Again our 2017-18 Hawaii 329 Marijuana Medical Cards are useless until the State of Hawaii opens the Dispensaries for the people! This is my opinion and no one even asked for it!!!!', 1499740752),
(1040, 224, 'Ar1iee', 'https://www.google.com/maps/contrib/114879337702172133010/reviews', 'en', 'https://lh5.googleusercontent.com/-wF7iBfMI9I8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0bm2RARy-_xNqo4nj6zJ8BbGqHgg/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '2 weeks ago', 'I\'m giving a two star review (as I think one would\'ve been too harsh and they definitely don\'t deserve more). Although it has NOTHING to do with quality, The prices are CRAZY !!! ..I know a lot of work went into establishing themselves and creating a market here, however the deals/sales they have are inconsistent, no rhyme or reason and they seem to be getting worse as people catch on (like some flowers went from 25% down to 15 with their weekly sales (also it seems that they move their daily deals around so it\'s more sporadic now so some clientele aren\'t sure what & when anything will be on sale, because that\'s the ONLY time Worth coming in.. personally have a lot of experience with both recreational and medicinal, and usually medical is more reasonable in pricing (NOT THIS PLACE (you will pay upwards of $25 a gram AND near $90 for a 1/8th oz .. For people that deal w/ this for pain and anxiety and other issues , it\'s NOT FAIR !!!!!!! ..', 1526113912),
(1041, 224, 'raeanna kauhola', 'https://www.google.com/maps/contrib/117687351942981667396/reviews', 'en', 'https://lh6.googleusercontent.com/-8PSaaLnTN1k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2yZ24qwskRILGza2T_ZRFfpW9qDg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'WOW!  The staff is amazing.  Very friendly and helpful. Sandra  Helped us out a lot she\'s very knowledgeable,  Patient and friendly.  It so beautiful inside. I give it 10 Star\'s!!', 1522037612),
(1042, 224, 'Ron Wright', 'https://www.google.com/maps/contrib/105669487333312598488/reviews', 'en', 'https://lh3.googleusercontent.com/-cKC8DuwnMic/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3nV9MRipLI1fdXKSth5Ael7FM56w/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 3, '3 months ago', 'All the way up to roughly two months ago I would have gave this place 5 + Stars. But recently they seem to only want to cater to a certain clientele. I see that because  the products that they have besides flowers  I\'m not for everybody. The staff is great! I don\'t know if they have input on products that they sell but if they do they need to really listen to serve the clients or other 329 card holders. Hopefully I can write it it another review in a month or so. Aloha', 1519120004),
(1043, 224, 'Adriel Robidoux', 'https://www.google.com/maps/contrib/100837718745102061920/reviews', 'en', 'https://lh3.googleusercontent.com/-aRjGw_GaFKU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3I2eutRaoFgLY4HM2iHPqmkGe4-w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This place is wonderful. The service is friendly, the menu is constantly updated. And they have a consultant on hand to offer treatment advice and suggestions. Check them out!', 1522374893),
(1044, 224, 'Nikki', 'https://www.google.com/maps/contrib/110123135298689814355/reviews', 'en', 'https://lh5.googleusercontent.com/--2YHut5Afws/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2hWAa9CgrSXPrqbJWeFqw0aMk18g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Very friendly and helpful staff. Very neat and clean facility. Product menu has grown and I love that they keep you well informed of each of their products, from their benefits to the effects it may have on you.', 1519310480),
(1045, 226, 'Rebecca Bee', 'https://www.google.com/maps/contrib/103943957997696151525/reviews', 'en', 'https://lh4.googleusercontent.com/-RlnXKufRsUU/AAAAAAAAAAI/AAAAAAAATbA/sUea93QUyh0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'Dr. Chris and Matthew provide a casual and friendly service to all who enter their office. They are professional during the certification process and embody the Aloha spirit, with no shoes required!', 1506113908),
(1046, 226, 'Jordan Trudel', 'https://www.google.com/maps/contrib/101701119012889600837/reviews', 'en', 'https://lh5.googleusercontent.com/-obmqt9RzOf8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3wghxv-YtI64yo6keCOe_zFHI8xw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 years ago', 'Watch that receptionist/office manager--she doesn\'t have a clue about policy, confidentiality and will try to provoke you if she doesn\'t take to you.  The principle staff is completely out of touch with what is happening out front in the waiting room.  Appointments tend to be \"cattle calls,\" you\'ll arrive at your appointment with a room FULL of people.  The waiting room is dirty, there are no published charters, rights, regulations or patient rights.  You will be treated as if you are powerless--I was lied to by both the receptionist and social worker.  The social worker doesn\'t return calls, even after offering counselling virtually at your convenience.  The doctor makes an occaisional appearance on the filthy rug in the waiting room, in bare feet.  If you are seriously ill and require a professional environment, I suggest another clinic on the island.  This isn\'t very legitimate, the waits are excrutiating and reception contemptuous.  I had a nurse case-worker with me--they were appalled--move on.  ', 1457088913),
(1047, 226, 'steve scott', 'https://www.google.com/maps/contrib/103864691485283193277/reviews', 'en', 'https://lh5.googleusercontent.com/-cvXFyDsbA7M/AAAAAAAAAAI/AAAAAAAAAEI/AiBFlJdJs4M/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Have been going to Mathew for years..He has always been respectful and professional...Some people are just mad at the world...', 1466474868),
(1048, 226, 'Heather Blodgett', 'https://www.google.com/maps/contrib/112931756294446285435/reviews', 'en', 'https://lh3.googleusercontent.com/-YC5k5aZCMyM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3xDJGffquGHsItuSXpEU2p-kVOgw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'What a great professional service!', 1481741002),
(1049, 229, 'Erin Montgomery', 'https://www.google.com/maps/contrib/108857637388715094445/reviews', 'en', 'https://lh3.googleusercontent.com/-btCIL-_tAvo/AAAAAAAAAAI/AAAAAAAAAbI/alWSlkMP4jw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'Hardly any educational stuff. Mainly people just trying to sell.  Upset I paid 20 bucks for this. Waste of time and money.', 1518477691),
(1050, 229, 'Tanya Hatakenaka', 'https://www.google.com/maps/contrib/109405359707412174101/reviews', 'en', 'https://lh3.googleusercontent.com/-kSOSstWY7Gc/AAAAAAAAAAI/AAAAAAAAAAA/EAZt2Bm7k2I/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '4 months ago', '', 1517082124),
(1051, 231, 'Tony Kim', 'https://www.google.com/maps/contrib/116030439117384909047/reviews', 'en', 'https://lh3.googleusercontent.com/-jfmN6IAyypg/AAAAAAAAAAI/AAAAAAAAABs/huYnoU3tnq0/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Treat the patient as if they know as much as you do and show it by giving the best effort without inflating anything \nAlso trust me when I say 1000mg korova bars from California at $50 will keep you medicated for a long time for small dent in your wallet', 1527033076),
(1052, 231, 'Connie Severin', 'https://www.google.com/maps/contrib/110429747533999327754/reviews', 'en', 'https://lh6.googleusercontent.com/-65f75B7t66s/AAAAAAAAAAI/AAAAAAAAABI/2OR-zejWv3s/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'What an experience!  Excellent, wonderful parking, especially for Honolulu. I was met at the door by a very pleasant greeter and the pleasant receptionists. I had already filled out the online form (I\'m a caregiver for my husband who has chronic pain) so it only took 5 to 10 minutes in their spacious and comfortable waiting room.  The entire place is tastefully decorated. After verification I was escorted to the showroom and introduced to a very helpful assistant. He took the time to show me all the various equipment that could be used for administration, also beautifully arranged and displayed but unfortunately not for sale (things have come a long way since the early 80s). I ended up with a nice variety of strains to try for my husband and a wonderful little journal to keep track of which strains worked best for his problem. My only complaint, and this has absolutely nothing to do with the shop, is that the State prohibits them from selling any of the administration devices. Can you imagine buying an asthma drug without an inhaler?', 1512241450);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(1053, 231, 'Mia Canino', 'https://www.google.com/maps/contrib/106207415322168090861/reviews', 'en', 'https://lh3.googleusercontent.com/-7fhoyPEKCK0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0l6lnE47_hDB1j3mYZWqhfXnIzHQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'Very knowledgeable and friendly staff!! It was my first time ever going to a dispensary and was super easy and I didn\'t wait long till I was taken back and helped. Rating 4 because I should have gotten a military discount (even told her upfront like they say and showed ID) and one product I asked for I didnt receive but didnt realize till I was on my way back home yesterday. Kinda bummed but liked this over the other place!!', 1521159616),
(1054, 231, 'Rickey Crowell', 'https://www.google.com/maps/contrib/103820538717550329381/reviews', 'en', 'https://lh3.googleusercontent.com/-SjvGV6B_8YA/AAAAAAAAAAI/AAAAAAAAACU/Wa1STLG7seg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, 'a week ago', 'Whole thing was a lie! The donations were going into NOA POCKETS, to buy more VAPES and Carthage\'s.\nAll my donations of my Filters went in some one\'s pockets! 8 boxs donated to the vets. I Rickey Douglas Crowell \nOwner of Rick\'s Hawaiian Filters and Crutches\nAm in no way involved with CAMO, NOA, ONLY VEST I WILL HELP ME HAVE A REAL STAND DOWN.\nI will try my best to find real VETS LOCALS, the best VAPES, glass straw\'s, Hawaiian papers, my Filters.\nI have nothing to do with the mess of snakes there.\nAsk to see records where your donations went get them back. \nMy attorney will find out all if can and illI\'keep you posted.', 1526941085),
(1055, 231, 'Bad Poo', 'https://www.google.com/maps/contrib/115194207100839080482/reviews', 'en', 'https://lh3.googleusercontent.com/-59Ct6QwOR34/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3v4sJ_Bhy6lsyIfw5c0u91Gg_FUg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'Synthetic Poo. Their concentrates are garbage. I had taken synthetic THC capsules from my real doctor long ago (nasty) and they have a distinct feeling. On the 2nd batch of concentrates that noa botanicals ever provided, it had the same feeling as synthetic. Out of 1,000 other samples from the mainland and a few in Hawaii, i.e. getting some shatter from dude, I never had that happen. As wild as it sounds, it also seems they have very low level synthetic sedatives in these concentrates. As a very physically active, diet conscious person with a decades long medical record, this is my absolute opinion, no matter how unusual it sounds. \n\nIn a state that just voted to allow sick people to kill themselves, in a state where physically fit healthy people are not conducive to the medical industry, doctors & hospitals. Illness benefits the healthcare industry and economy, it is a very big incentive for people to be lethargic, unhealthy and without improvement. This is what will happen to people who use this bad poo.', 1525909887),
(1056, 232, 'J ared', 'https://www.google.com/maps/contrib/113171212338581525615/reviews', 'en', 'https://lh5.googleusercontent.com/-KM4vwBFINLY/AAAAAAAAAAI/AAAAAAAAaNY/8mPwXi0b4jo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The owner Paul helped me renew my card after my old physician Dr. Greenly passed. This place is really interested in helping improve patients quality of life and well-being. Thank you so much for everything, I really recommend these guys as my first choice 100%. Mahalo.', 1523557420),
(1057, 232, 'Matthew Kane', 'https://www.google.com/maps/contrib/101219188635622518128/reviews', 'en', 'https://lh3.googleusercontent.com/-q5KRDALGpHk/AAAAAAAAAAI/AAAAAAAABJw/z7lQTfjwlzw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Best doctor visit ever. Everyone is very knowledgeable and helpfull. Great place for renewals!', 1527200879),
(1058, 232, 'Jody Libed', 'https://www.google.com/maps/contrib/113441716075633275190/reviews', 'en', 'https://lh5.googleusercontent.com/--pt1UO4umns/AAAAAAAAAAI/AAAAAAAAAL4/Nx2yKEHcy4Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Paul is amazing.  I have an arthritic neck and he explained how a topical cream can help.  The pain went away and I can move my neck much easier.  Though my card didn\'t come right away, it was due to the state\'s shortage of workers, not HWC.  They have been very helpful and informative.', 1511377781),
(1059, 232, 'scottyG808', 'https://www.google.com/maps/contrib/100856333959934795878/reviews', 'en', 'https://lh3.googleusercontent.com/-7Se9RQzOgLw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2lXFUAmgMpXnn89vA-GqU6BYymyQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'This is definitely the place to go. Top professionals in every way, from the reception, the preparation of documents, the doctors appointment, question answering, and follow up. If you want full concierge service, this is the place for you. They fill out all of the paperwork for you, answer all of your questions, give you information about how it all works, ask about your symptoms, and make suggestions as to treatment(s) for helping you out. They also offer classes and functions (no charge to their patients) to further educate you on how to manage your pain, such as cooking, tincture making, and many other beneficial remedies for their clients. They also include two follow up visits at NO CHARGE to help manage your symptoms. I highly recommend Honolulu Wellness Center, simply the best.', 1495503363),
(1060, 232, 'Paul Coffman', 'https://www.google.com/maps/contrib/117087193681579448382/reviews', 'en', 'https://lh5.googleusercontent.com/-DnayvRFYhUs/AAAAAAAAAAI/AAAAAAAAAQ4/8_S4aWfMYnw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '6 months ago', 'Paul Klink and his staff at the Honolulu Wellness Center are simply amazing. I have scoliosis, a pinched nerve, bulging disc and calcium buildup forming spinal fusion, all in my lower back. I did NOT want to get hooked on heavy pain killers like Oxy or anything full of Acetaminophen as all of these are very addictive and destroy your internal organs, especially  your liver and kidneys. I was lucky enough to meet Paul and discuss the benefits of Medicinal THC as an alternative to pain. He showed me several different options of e-cig/vapor pens (disposable and rechargeable.)  I spoke with my primary doctor (who had already offered to get my my State THC Card) and he agreed it was the best option. So I visited the Honolulu Wellness Center and was very impressed. Their on-site MD went through a thorough series of questions and tests and approved me for my card. Once I received it from the state in less than 2 weeks, I started using the vapor pen for my constant pain (I live at a minimum pain level of 4 and some days its an 8). \nAfter Paul took extensive time to tell me about the different strains and Indica vs Sativa, the level of \"high\" I would experience with each. I explained to him that I did not like feeling \"high\" and had not smoked any THC in 20 years as it made me paranoid (20 years ago). Paul selected 2 different options for me to try and I can\'t say how amazed I was. I only take 2-3 small hits off the pen around 7:00pm when my back is always at its worst from sitting down in a chair all day at work. \nThe vape pen not only did a better job of any prescription meds I\'ve been given for the past 3 years, I also did not have any overwhelming of feeling high. No paranoia, no \"over thinking\" or anything else negative.\nIt was a fully positive experience. It also made me sleep very well and without any of the groggy side effects I got in the morning when I took a prescription pain meds.\nTHIS IS ALL 100% my true experience!! I\'ve been using The Honolulu Wellness Center\'s medicinal help for 4 months now. I\'m back in the Gym, I\'ve lost 22 pounds because I\'m not tired from prescription pain meds and can exercise again. I\'ve even started doing Sunset Yoga near the Waikiki Aquarium. I can honestly say that it\'s changed my life for the better. I don\'t smoke during the day, but on the rare occasions that my pain level is high during the day, I take one small toke off the vape pen and no pain, but also no high with just one 2 second pull on the vapor THC pen.\nThank you VERY much Honolulu Wellness Center and Paul Klink for helping me change my life. I\'m 45 years old, have my six pack abs back and veins in my biceps and shoulders. I promise this is all true. I can\'t tell you just how amazing my life is now that I\'m not drugged out on Oxy or other pain meds.\nMahalo Paul!!!', 1510261451),
(1061, 233, 'Jack Meadows', 'https://www.google.com/maps/contrib/109609092867132573437/reviews', 'en', 'https://lh6.googleusercontent.com/-qepPQlToeBg/AAAAAAAAAAI/AAAAAAAAAEw/TOQHK5fe2VM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'The best on the island.  Dr. Hansen is kind, understanding, friendly, and completes your application in a timely manner.  Also, the woman in the office is very nice as well!  I just got my first medical card for chronic back pain and I couldn\'t have asked for a better experience.  Office was pretty easy to find with lots of on street parking and a public lot nearby. Will be visiting again when time to renew.', 1490995544),
(1062, 234, 'Chubby*Otaku*Mama', 'https://www.google.com/maps/contrib/108155763180419283996/reviews', 'en', 'https://lh6.googleusercontent.com/-KmZmff460mg/AAAAAAAAAAI/AAAAAAAAARQ/UbQKRyI9UCM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'I\'m a mom from Oregon and suffer from postpartum depression. While back in Oregon I would take a couple of hits outside to keep calm when my anxiety or depression go to bad, here in Idaho I have to rely on antidepressant pills, mood stabilizers, bp pills and meds to help me sleep.', 1498519782),
(1063, 234, 'Alisha Schneider', 'https://www.google.com/maps/contrib/110221698622037700803/reviews', 'en', 'https://lh3.googleusercontent.com/-UFjsr1SnFHc/AAAAAAAAAAI/AAAAAAAAAQo/n6lUFzvJdXE/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'Lots of great products, cheap and competitive prices', 1521064385),
(1064, 234, 'Lauri Walton', 'https://www.google.com/maps/contrib/117662995416663973269/reviews', 'en', 'https://lh4.googleusercontent.com/-3jFBe_pkDrw/AAAAAAAAAAI/AAAAAAAAKjo/_Vn5xe_yQUw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a year ago', 'Understanding others and very helpful!', 1495107647),
(1065, 234, 'Jennyvonne Samson', 'https://www.google.com/maps/contrib/113249084860843769164/reviews', 'en', 'https://lh3.googleusercontent.com/-hOCs_CGGWVc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1hEOXns5UBf4JnuWSKcWLwtEijIg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '9 months ago', 'Natural', 1503724810),
(1066, 234, 'michele wadsworth', 'https://www.google.com/maps/contrib/100075321033605046117/reviews', 'en', 'https://lh4.googleusercontent.com/-7jRrdKPur1g/AAAAAAAAAAI/AAAAAAAABFI/_qM6oKa3whU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', '', 1524250919),
(1067, 235, 'Sarah Farmer', 'https://www.google.com/maps/contrib/110296294403607252261/reviews', 'en', 'https://lh5.googleusercontent.com/-rHiZ73U0l60/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1egdAlfWx336r54CToMq_ayT3Rlw/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a month ago', 'First visit to this shop. Just moved up from CO and was discouraged at first here by the difference in price and quality. Staff was friendly and helpful and able to answer all my questions. They also offer a decent military discount, which is great for my retired husband. We were able to get out the door with what we needed at a fair price (for WA). And so far are very happy with the quality of our flower.', 1523148582),
(1068, 235, 'Logan A', 'https://www.google.com/maps/contrib/103970680586779130194/reviews', 'en', 'https://lh5.googleusercontent.com/-xFvVdpvL0II/AAAAAAAAAAI/AAAAAAAAAo0/qYRV6c6Qx_g/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 4, 'a month ago', 'I enjoy this place.  The staff is friendly and not only tolerates small talk and chit chat but also engaged and encouraged dialog with consumers which I enjoy.  Prices are comparable to the market.  No thank you for my business which did not go unnoticed but they did give me well wishes for my evening', 1524634650),
(1069, 235, 'Yolanda Leggington', 'https://www.google.com/maps/contrib/110609714594461399168/reviews', 'en', 'https://lh3.googleusercontent.com/-zoSvgSwpLoo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2LLLev6HxeWkICGFvohMSEIQnHMQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Cool spot I’ve been going to this other cool place for some time now wanted to try out a new spot close to me and checked this place out today. I like it very helpful budtender that happens to be a Leo too! Great prices as well and specials! I will be back! Thanks!', 1521341641),
(1070, 235, 'Joseph Solis', 'https://www.google.com/maps/contrib/114494258612988638232/reviews', 'en', 'https://lh4.googleusercontent.com/-QGmbVpWGRXo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3TyauwCVHWAZvXvU3NjC_Whc-YSg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I\'ve only been there once but felt like I was a regular. Great service and amazing people. Thanks for the experience.', 1526758065),
(1071, 235, 'Janai Bakken', 'https://www.google.com/maps/contrib/116703332107039260531/reviews', 'en', 'https://lh5.googleusercontent.com/-9QvmzvO0q18/AAAAAAAAAAI/AAAAAAAAAgc/UJj_I8vb5LY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Everyone is so friendly and knows their stuff. If you aren\'t sure ehat you\'re looking for they will let you know and are not rude about it!', 1525410534),
(1072, 236, 'Sam Sam', 'https://www.google.com/maps/contrib/102873933973358469406/reviews', 'en', 'https://lh6.googleusercontent.com/-_7egChQmuFE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq01iA8hfKIfYecfBgteyZyHEaBukA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 2, '3 weeks ago', 'Interesting experience, first shop I have visited where I had to wait. After the 30 or so minute wait I was impressed by their selection. Got an ounce of strawberry fields for $90. Even though the person that trimmed it left it very leafy it was worth it. I don\'t think I will ever go back though. Every other shop I have been to I have gone right in and out, waiting for a half hour really is a turn off', 1525890289),
(1073, 236, 'Alia Hall', 'https://www.google.com/maps/contrib/115176056752859043206/reviews', 'en', 'https://lh5.googleusercontent.com/-STAf1Gb6ZGs/AAAAAAAAAAI/AAAAAAAAAEw/CO7Okl92dC4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Everytime we go in, I am so impressed with how great everyone is. The girls are very sweet and they always laugh with me. I always leave with a smile, the prices make me happy. It feels like home, which makes buying my medicine there much easier!', 1527619164),
(1074, 236, 'Teddy Daxton', 'https://www.google.com/maps/contrib/115795506538068796609/reviews', 'en', 'https://lh5.googleusercontent.com/-xuNglUytqG8/AAAAAAAAAAI/AAAAAAAAGJk/jLIjGMiTAlI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'Best in the West!!! Great selection of top shelf and budget pricing flower and shatter. Friendly staff with great product knowledge with a laid back but professional atmosphere. Daily specials keep me coming back time and time again, well that and a love for the green country side.', 1519968014),
(1075, 236, 'Charles Straub', 'https://www.google.com/maps/contrib/102961620611864423688/reviews', 'en', 'https://lh4.googleusercontent.com/-5-DKQ3_B0dA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1FIuOAqDTHUo1VVVD_w7yKK0rGvA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'You are always rushed here. They have alright products. But the budtenders aren\'t passionate about what they do and almost refuse to make recommendations. The last time I was here Saturday I asked for a specific type of concentrate. They gave me a different one. I also asked for 2 different flowers that didn\'t find their way into my cart when I checked out. Overall super disappointed.', 1526877052),
(1076, 236, 'Chad Lozano', 'https://www.google.com/maps/contrib/115190024046577942825/reviews', 'en', 'https://lh3.googleusercontent.com/-JuhuJo8m-64/AAAAAAAAAAI/AAAAAAAACtw/se4tMaIfw8o/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'Cool people and they are even little jokesters. I grabbed a water bottle from the fridge thinking it was free and the front desk lady told me that it was $5 after I drank it. I asked \"Really, I would have just waited if I knew that.??\"  She laughed and told me that she has never had that work on anyone. So I guess f me right?? Haha!', 1526794406),
(1077, 237, 'Erika Barry', 'https://www.google.com/maps/contrib/107658636873945028689/reviews', 'en', 'https://lh4.googleusercontent.com/-lnZ4b2SNJoo/AAAAAAAAAAI/AAAAAAAAAMI/obkDdo7K9As/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a week ago', 'My first time at the Hot Box Farms dispensary was a cool experience.. The lady up front was kind and helpful. We did come 30 minutes to closing so I had to hurry but they didn\'t seem to mind too much. I will definitely be back soon. Excited to visit the dispensary again.', 1526850837),
(1078, 237, 'James Huffman', 'https://www.google.com/maps/contrib/100527203518362668890/reviews', 'en', 'https://lh6.googleusercontent.com/-nwqeaxRD7xE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3gNXdueBRW4LoClmH7sODJDRJe6g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'We love this place. The staff is super helpful and they are very friendly and knowledgeable. We have been there over 10 times and have yet to have a bad experience.  They have great deals and we have bought both flower and edibles and tincture. They all were excellent, they have the most delicious dark chocolate with sea salt candy bar edible, couldn\'t stop eating it!', 1523607939),
(1079, 237, 'chikita Sam', 'https://www.google.com/maps/contrib/116410619265095079769/reviews', 'en', 'https://lh5.googleusercontent.com/-c-881caPRRs/AAAAAAAAAAI/AAAAAAAAABA/zTm4JygQEYc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Best dispensary EVER! I love this place. It’s so clean and they have the best deals every week! My favorite are their Select Cartridges. The bud tenders are very kind and knowledgeable and always help me find what I need. Definitely recommend this dispensary in Huntington. (Beware of going on Saturday! It’s ‘Shatterday’ so 10% off all concentrates and i always end up waiting an hour or more! You have to be the first one there or it’s a long wait) every other day of the week is no wait though :) enjoy!', 1522517254),
(1080, 237, 'Jovanny Ferreyra', 'https://www.google.com/maps/contrib/106324556062678978583/reviews', 'en', 'https://lh3.googleusercontent.com/-K3rZIN0DTFA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0mY1Rwm-NXcl7MFMywBMAwQqWarw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Great service and friendly staff. Very informative and helpful in decision making. They have daily specials that change day by day. The prices are very reasonable/generous, especially for the quality of the products they offer.', 1526314665),
(1081, 237, 'Lanaya Elliott', 'https://www.google.com/maps/contrib/104690965929638875751/reviews', 'en', 'https://lh6.googleusercontent.com/-pMw8vSyjvAY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3iORBVO3Azo3OP8ryeaErNDnavnQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'I love visiting this place! The other customers are easy-going. Most of the staff are happy and pleasant Fun place to spend time and money', 1524331677),
(1082, 238, 'Alexander WILSON', 'https://www.google.com/maps/contrib/107828177834079461122/reviews', 'en', 'https://lh3.googleusercontent.com/-mHfkoIKp88k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0bDO3CpZ06uVzasXzZtr1FBY-VnA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I had a fantastic experience! The staff were on top of carding people at the door as well as a comfortable atmosphere. The customer service was impeccable by the way.', 1522725067),
(1083, 238, 'Photios Hugo', 'https://www.google.com/maps/contrib/106736974528915210647/reviews', 'en', 'https://lh6.googleusercontent.com/-7fSwZglTME8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3eVgdVoKVjKYQVP_ZLfI3olK_rqw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'I love the friendly attitude and they are always smiling. They are very respectfully and are very knowledgeable on what they carry .', 1526169651),
(1084, 238, 'Tango Charlie', 'https://www.google.com/maps/contrib/102988153610429488276/reviews', 'en', 'https://lh4.googleusercontent.com/-A_J-Rburulc/AAAAAAAAAAI/AAAAAAAAAVg/CNzD7NurdoA/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'I support this shop because its local, I was glad when they opened up and sent people to the shop with out ever being inside. I feel if prices are fair and obviously if you are local to otis its great.  My experience with customer service has been 50/50.', 1521528331),
(1085, 238, 'Kimberly Beasley-Shelly', 'https://www.google.com/maps/contrib/113248420556781288520/reviews', 'en', 'https://lh5.googleusercontent.com/-K8njSCgFL5c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3eGOV2-sHSdJkzI3jFMmq4Lligpw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Chelsea is so knowledgeable,and love to see her happy face,and...she\'s quick and great with her customer service!Thanks Apex\nLove you guys!!oh and my Jeep guy there...he rocks it too!', 1524108770),
(1086, 238, 'PNW- LSL StonerGirl', 'https://www.google.com/maps/contrib/116328709747996168739/reviews', 'en', 'https://lh6.googleusercontent.com/-RNUdCBqf3b0/AAAAAAAAAAI/AAAAAAAABHE/6MciwOb_dvk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I love apex!  The prices are great and you can\'t beat their daily specials and discounts!  Also the staff is so helpful and knowledgeable about their products.  5 stars hands down no questions asked!!  Will definitely be going here for a long time ', 1510849384),
(1087, 239, 'Nitaboo 7116', 'https://www.google.com/maps/contrib/115088047628311465826/reviews', 'en', 'https://lh3.googleusercontent.com/-vhPFjnnDAGA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2_9EXXeMYLvRzI0Xsthm5SsNVV2w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'It was great. The staff answered all of my questions, explained the different strains and how they help with my needs. I really recommend this dispensary and the prices are good too. Just ask for the \"Three Musketeers\" , they really made me feel at home!', 1515813991),
(1088, 239, 'Ill. Dollaz', 'https://www.google.com/maps/contrib/109753985925197425582/reviews', 'en', 'https://lh6.googleusercontent.com/-H1T9sqyYD54/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq33-GjZAkCGCQ20AR-s6wVPDBE_Ow/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '3 months ago', 'It was awesome they have allot of flavors.. There great just need better pricing on larger products', 1519480041),
(1089, 239, 'Don Schaefer', 'https://www.google.com/maps/contrib/101177335953580280286/reviews', 'en', 'https://lh6.googleusercontent.com/-AryX-iO_6oM/AAAAAAAAAAI/AAAAAAAABmI/AcH-AzKSkuM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Everytime I am in this part of Chicago I visit this dispensary.  They have all of the best Growers from Illinois represented here.  The staff is very friendly and they always give me a senior discount!', 1519847609),
(1090, 239, 'K Jump', 'https://www.google.com/maps/contrib/100977633457954730220/reviews', 'en', 'https://lh5.googleusercontent.com/-lw1Xemm3CJM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3qe-aDpWNUCUQ3Ly5OdP0hS3lRxQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Mission IL is off to an amazing start! It had only been open a month when I visited it from out of town. I am not from Chicago and was visiting with my children in tow and needed to make a few purchases. The staff was amazing and made me feel comfortable to bring my children along. One of the staff members sat in the waiting room and talked with my kids aged 8-12, while I was in the purchasing room. Even though you can see the waiting room from the purchasing room it made me feel comfortable knowing someone wanted to help look after them. Making sure a patient has access to the medicine they need and they feel safe is their top priority, and they definitely do that.\nI was able to take my time and pick out the things that I needed and did not feel rushed into making a purchase from the budtenders. Some are patients themselves and were able to offer their person opinion on strains I was interested in trying. They had a diverse selection of products and had several affordable options to help patients get the medicine that they need. I would have liked to see a few more CBD products in flower and Concentrate, but this is an issue that is found across the state. The few CBD products that they did have were amazing strains, and I have now doubt in my mind that they will attempt to expand this selection as well.\nThis is the only minority owned dispensary that I know of in the state, and they have a few bilingual staff to help reach out to the Spanish speaking community. If you are in the south side of Chicago you need to check out Mission IL. If you are just visiting like I was and need to make a few purchases consider Mission IL, you will not be disappointed.', 1502460753),
(1091, 239, 'Joe Feltham', 'https://www.google.com/maps/contrib/116615297693302576376/reviews', 'en', 'https://lh6.googleusercontent.com/-hyoZ7CsoH6c/AAAAAAAAAAI/AAAAAAAAABQ/qvf0tuAjNIo/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '9 months ago', 'Great staff.  Large menu selection and good prices', 1503848833),
(1092, 240, 'Christopher Bryant-Stitt', 'https://www.google.com/maps/contrib/103338898309303038658/reviews', 'en', 'https://lh3.googleusercontent.com/-C9kFFTwWyxQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2bO4XqpxF2qpEJJkok_8zk52COkA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Went for the first time this week and really satisfied with the product and service. It\'s a slight bit pricy compared to the street and my experiences buying at stores in LA, but I\'m clearly paying more for a better selection, sanitary packaging and facilities (something completely lacking in CA), and I\'ve never had a street dealer with a points rewards program. \n\nDanny gave me a joint for nothing my first time there. He\'s extremely helpful, informative, and pleasant. Dave assisted me the second time and he was nice and a happy guy.\n\nOne downside is that you can\'t try the bud in the dispensary, and there aren\'t any hotties selling dabs and rolling joints behind the bar like in LA, but it was still a good experience.', 1527242984),
(1093, 240, 'Justin Cass', 'https://www.google.com/maps/contrib/106999602911337334486/reviews', 'en', 'https://lh5.googleusercontent.com/-grmIhu06F8s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0uJ4ZlZudS8w11FC2srxE2KCvXAA/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '3 months ago', 'People at the sales counter are cool as the other side of my pillow, but they got a dude behind glass who seems to be the resident mellow harsher. He\'s the reason i give 4 instead of 5 and the reason ill be changing dispensaries. Nuts to Good Time Terminator. Im trying to recover from surgery and illness, not be harassed by some jag off. Well the prices piss me off too, but all dispensaries in IL are shaking patients by the ankles. They act caring and most employees seem like they really do, but the owners are clearly robber barons.', 1518642418),
(1094, 240, 'Cathy Adams', 'https://www.google.com/maps/contrib/115208166469918924269/reviews', 'en', 'https://lh6.googleusercontent.com/-00p0SCITFAg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2MdyRWkusqQHQ4V2nl89pNGPRi1A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'AMANDA I LOVE YOU AND THE STAFF FOR BEING SO KIND AND CARING AND YOU PICK GOOD GURL ', 1526230892),
(1095, 240, 'Jennifer Lopez', 'https://www.google.com/maps/contrib/102642698809582348235/reviews', 'en', 'https://lh6.googleusercontent.com/-3VgC2gjIMdg/AAAAAAAAAAI/AAAAAAAAAB0/QAZQFV8NMNA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Great products and great prices. The staff is extremely helpful and nice.', 1525828484),
(1096, 240, 'Jenn K', 'https://www.google.com/maps/contrib/106608028312410866175/reviews', 'en', 'https://lh5.googleusercontent.com/-pAWndfetZD8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq38PySX3RkRkikZ_6dlK52kDQTenQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '5 months ago', 'Always long wait times! They try to be this \"trendy-hipster\" dispensary, all like \"we sell prime buds bro\" that\'s the vibe I get while I wait over 45 minutes for my medicine! Your also limited because again they want to be this \"Top Shelf\" dispensary. They sell no shake no kief to make your own edibles etc. I go to the Suburbs and buy in bulk and save on average $200. Call around and price compare. Remember Downtown rent is expensive, and you would be surprised about the difference.', 1513028293),
(1097, 241, 'Kip Carlson', 'https://www.google.com/maps/contrib/112531475670734975595/reviews', 'en', 'https://lh4.googleusercontent.com/-4RMcy1oQS3w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq18CCQBaBi-2rrjT0KVVeJmt6iJsQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'If you\'re looking for the best run and most educated staff in IL. This is the spot. Iv been a customer for over two years now. Have never had one bad experience. 5 stars doesn\'t even do them justice the place is a dreamscape for cannabis users.', 1524349244),
(1098, 241, 'Nadia Alexandra', 'https://www.google.com/maps/contrib/102004968472093197718/reviews', 'en', 'https://lh3.googleusercontent.com/-Y3wiPk3gtFM/AAAAAAAAAAI/AAAAAAAAAA0/XzOEdAB8b_k/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Dispensary 33 is my sanctuary. I\'m new to buying from dispensaries and I was helped thoroughly my first two times there. Paul was especially helpful today in helping me find the right strain for me. I absolutely love his recommendation and they all just make you feel like you are special and deserve to get help.', 1520037754),
(1099, 241, 'Becir Behari', 'https://www.google.com/maps/contrib/101045294694226773801/reviews', 'en', 'https://lh4.googleusercontent.com/-Iv9D-cId4jY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq340sd-x1_qsPsLuG_0s33XeQrjTA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'I called in for some simple questions on getting a  medical card . The lady who answer the the phone was super rude like she just wanted me to get of the phone...the dummy dosent relize without customers she wont have a job..she needs more customer service classes...', 1527625551),
(1100, 241, 'Vaughn Buxton', 'https://www.google.com/maps/contrib/114805693065500236379/reviews', 'en', 'https://lh4.googleusercontent.com/-Ax2mrZY_ASE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0HAuuzabA1FjOmqqX1KAS42ViKgQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '8 months ago', 'I went in to ask some basic questions about the application process and the guy working the front was a bit busy but he took the time to answer all my questions.   He was friendly in a professional manner but not rude.  I\'m giving the place 4 stars because I was only in the reception area and not in the \"back room\"', 1505060948),
(1101, 241, 'Vasily Deris', 'https://www.google.com/maps/contrib/112361052268757851509/reviews', 'en', 'https://lh4.googleusercontent.com/-LKLgdL5PMCg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq09vfhpD9MfLhJZUfuCqWb3jn4Ezw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Sarah is super helpful and has so much knowledge! The staff is all friendly and it’s super clean and has a lot of choices to help ease the pain.', 1514075339),
(1102, 242, 'Justine Pesti', 'https://www.google.com/maps/contrib/110081012670678273971/reviews', 'en', 'https://lh6.googleusercontent.com/-k6bsBriPt0Y/AAAAAAAAAAI/AAAAAAAAAAo/zP1PcU-trVA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'I would highly recommend Quantum 9 services. Not only is the company amazing, but the owners and employees backing it truly know how to treat their customers. 5 stars is an understatement for this establishment, great job!', 1525544358),
(1103, 242, 'Samuel Blackwell', 'https://www.google.com/maps/contrib/106526271777720281863/reviews', 'en', 'https://lh6.googleusercontent.com/-g_1nVeMYR08/AAAAAAAAAAI/AAAAAAAADVE/D2U7MiSpxQI/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Here are white men poised to run big marijuana businesses, dreaming of cashing in big. Big money, big businesses selling weed, after 40 years of locking up impoverished black kids for selling weed. Their families and futures destroyed. Now  white men are planning on getting rich doing precisely the same thing.', 1524489793),
(1104, 242, 'Alina Petre', 'https://www.google.com/maps/contrib/100163261681003718951/reviews', 'en', 'https://lh4.googleusercontent.com/-SVaJwnBspXY/AAAAAAAAAAI/AAAAAAAAAEA/k9N1MYhSpWk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Class-act employees and an amazing organization that truly sets the industry standard. I highly recommend Quantum 9\'s consulting services in all respects. They showed great care and diligence with us. The results speak for themselves. I\'ve personally worked with the entire Quantum 9 team and each division, from security to brand writing to graphics, make you feel top priority at all times. Their patient-first approach creates a path for positive patient outcomes. You can tell their heart is in each project and their incredible passion and hard-working ethic really goes the distance.', 1495754341),
(1105, 242, 'Andrew Poole', 'https://www.google.com/maps/contrib/114284228466657260712/reviews', 'en', 'https://lh5.googleusercontent.com/-2t9pNqvGBcU/AAAAAAAAAAI/AAAAAAAAAP0/9-cz9ogVZJI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Detail oriented. Great people to work with.', 1521503744),
(1106, 242, 'keum-lee mayes', 'https://www.google.com/maps/contrib/102283959335876720549/reviews', 'en', 'https://lh6.googleusercontent.com/-A4PvtAHbm20/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0gs7UIg-Yww5hxZWV8uWj7v2CYFg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'As Michael\'s mother I would have to say he is the best CEO I have ever met. He started this cannabis consulting company with the goal of being the best marijuana consultants in the industry. I can\'t speculate on if he has achieved that status yet but I know he truly cares about patients.', 1507826967),
(1107, 243, 'de Vlieg', 'https://www.google.com/maps/contrib/106027633201268437671/reviews', 'en', 'https://lh3.googleusercontent.com/-XbsAjBWqJxU/AAAAAAAAAAI/AAAAAAAAA5w/p3RzxGWJLRc/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 weeks ago', 'All in one package of services. Woman owned business, single sourcepoint submission of all documents.  Genuinely compassionate. Price includes app fee, Dr\'s visits, fingerprint, background check and all submittances from them via the net.', 1526327762),
(1108, 243, 'Daniela Castro', 'https://www.google.com/maps/contrib/110713397537094629527/reviews', 'en', 'https://lh6.googleusercontent.com/-tldvinD1Itk/AAAAAAAAAAI/AAAAAAAAACY/ljOJs2CyZBo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Excellent communication & prompt reply to queries and concerns! I am entirely satisfied and delighted with The Healing Clinic services. I would recommend The Healing Clinic to anyone, Staff are always polite friendly and happy to help. Great customer service!!', 1516012580),
(1109, 243, 'karen hovey', 'https://www.google.com/maps/contrib/108445663607371565177/reviews', 'en', 'https://lh5.googleusercontent.com/-UGtN5SO4XWs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3IqOkQiq2T2siGT0OlPGyz1Lllkw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Ms. Castro and all who work there are very knowledgeable.  All they want is to help people get the medicine so they can live a happier life . \nHats off to this great bunch of healers.', 1515968851),
(1110, 243, 'Ross morreale', 'https://www.google.com/maps/contrib/117812414660805509953/reviews', 'en', 'https://lh3.googleusercontent.com/-H8u9p2eAvcU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3OqvqCod2TeAsnzQTaoFXY3T-q7g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'The Healing Clinic is a patient owned organization which really sets them apart from other doctors who have copied their model.\nThese people actually care about patients and were the pioneers of MMJ patient advocacy in Illinois. If you are looking for honest, friendly and patient centered care choose THC!', 1515939430),
(1111, 243, 'Adrian Mehmedi', 'https://www.google.com/maps/contrib/109511552994040560399/reviews', 'en', 'https://lh3.googleusercontent.com/-o6pTcyJL18w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3KV3WERaHvZNcXmfiGG4bCG5AeXg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Feliza and the rest of the team are amazing! Highly recommend working with them as they are the original medical cannabis doctors office in Illinois!', 1516132879),
(1112, 244, 'Alexander R', 'https://www.google.com/maps/contrib/116778334769887333119/reviews', 'en', 'https://lh6.googleusercontent.com/-x59JglPnEnE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2SbvCBxdtwjQzgPX5GLH6kTpbGIA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I can say for my first experience at a dispensary Maribis made me feel welcomed and comfortable. They were very helpful and  patient; they also took the time to go over all of the products  available to me and suggest items that would help me throughout my day. Thank you very much Roberto and Jordan you guys were very knowledgeable and helpful. Highly recommend for first time purchase and for any information about cannabis\nALEXANDER R.', 1520263084),
(1113, 244, 'STRO CAPONE', 'https://www.google.com/maps/contrib/112233607661807046720/reviews', 'en', 'https://lh4.googleusercontent.com/-YEXVEJYvb8s/AAAAAAAAAAI/AAAAAAAADqM/IRBGZ5TvqtM/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Worst dispensery in Chicago. This was a great dispensery prior to new management. Since March 2018 It is TOTALLY NOT what it used to be. Most Prices are based on favortism. Deals are NOT deals. Do not be fooled. I was sold a half ounce of \"shake\" that was grains for the price of a regular half ounce. I was told by manager that it was NOT grains and i was fooled. Their \"shake\" is NOT the shake made for smoking. Its made for cooking.  And they do not have enough strains. Not worth it.', 1523731313),
(1114, 244, 'Jimmy Jam', 'https://www.google.com/maps/contrib/112722600759078349364/reviews', 'en', 'https://lh4.googleusercontent.com/-o97a-FTTTyY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2XGCCRhysEJyLly202ubWWaiyyoQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Nice place, good guidance and selection, fair prices.  In & Out fast !', 1499977657),
(1115, 244, 'Rick Nunya', 'https://www.google.com/maps/contrib/101735402679038677626/reviews', 'en', 'https://lh5.googleusercontent.com/-vWXY1ivZb98/AAAAAAAAAAI/AAAAAAAAAB0/UAgVq2WOnxU/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Don\'t waist your time. Or money. Not worth it.', 1523732053),
(1116, 244, 'Dan D', 'https://www.google.com/maps/contrib/110960456198739676846/reviews', 'en', 'https://lh5.googleusercontent.com/-ZT0LsHjQ9ds/AAAAAAAAAAI/AAAAAAAAgX4/7zIQhBgCfxk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'helpful and good inventory', 1499280346),
(1117, 245, 'Dennis Moczynski', 'https://www.google.com/maps/contrib/114814047201469292524/reviews', 'en', 'https://lh6.googleusercontent.com/-iCoFor_Y8DA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq09B0_Gy0Q1OnSJxvAuSRRJH3ePtg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I had a great experience, innovated express care is the place to go. I strongly recommend it. I had my first taste of telemedicine and it was awesome.', 1495159204),
(1118, 245, 'D. M.', 'https://www.google.com/maps/contrib/109389096702892626225/reviews', 'en', 'https://lh6.googleusercontent.com/-pwoJf2fk_64/AAAAAAAAAAI/AAAAAAAAAAU/XadH_aNUsUA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'With a thorough, yet sincere and compassionate approach, I genuinely recommend and trust Dr. Khare and his knowledgeable staff in maintaining one\'s overall well being. Everyone is definitely professional and profoundly educational when any questions come to mind. From the assessment of one\'s conditions to the following up of any concerns that may arise, rest assured, you will be treated with dignity, and leaving with a peace of mind in this clean and well kept doctor\'s office.', 1479338202),
(1119, 245, 'Barry Knerr', 'https://www.google.com/maps/contrib/116149232705537829943/reviews', 'en', 'https://lh3.googleusercontent.com/-fBVMiJ4-3KQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Oa98drU2HbRdmPne-AdYmTMZWng/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Thumbs way up! If you\'ve thought about investigating the possible value of marijuana as part of your medical toolkit, this is the place to go. The staff is courteous, friendly and helpful as could be. Dr Khare is a pro and very easy to talk to. They know all the discounts that are possible. They have ample parking. They take care of all the paperwork to relieve you of that drudgery if you choose to apply for a dispensary card.  For me it was a no brainer, if something might help, why not check it out? I\'m glad I did.', 1479390444),
(1120, 245, 'Keep It Real Yoga Danielle', 'https://www.google.com/maps/contrib/104408040681751131026/reviews', 'en', 'https://lh4.googleusercontent.com/-x_6LpRUvVsg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq18wkefEUssNpGnI-sLJD0B3ByRlA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'The Doctors and entire staff at Innovative Express Care are the most professional and compassionate MMJ Doctors in the Chicagoland area. Dr. Khare is the owner and Head Doctor at this practice. He is caring, intelligent, and very knowledgeable about Medical Cannabis. Innovative MMJ Care has staff that can answer any questions you have about Medical Cannabis and will walk you through the entire application process at NO EXTRA CHARGE! You can complete the Cannabis application on site, including photo and fingerprinting, so that you can get everything done in one place and know that it will be done right the first time!', 1479393203),
(1121, 245, 'Stuart Foster', 'https://www.google.com/maps/contrib/113083274928236330383/reviews', 'en', 'https://lh6.googleusercontent.com/-dlmQ7WttUCU/AAAAAAAAAAI/AAAAAAAAACA/Xt0yx_n2dAI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Expert help. Dr. Khare and his staff were phenomenal in providing me with all the information I needed to apply for my medical marijuana card. He\'s a fantastic doctor for medical marijuana resources.', 1479315254),
(1122, 246, 'Juanita D. F. Trevino', 'https://www.google.com/maps/contrib/114104336074193985036/reviews', 'en', 'https://lh3.googleusercontent.com/-9Mi3r0VJ6oc/AAAAAAAAAAI/AAAAAAAAQaw/FkvmyQ3QfZA/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a week ago', 'Sorry for not including the explanation. After visiting many dispensaries, Seven Point is still one of the better dispensaries to find \"hard to get\" products in Illinois, however, some front end staff seem less knowledgeable in products and it\'s medicinal purposes as opposed to others. \n\nOn top of this I have had a few instances that I\'ve had to call in multiple times to make a request for a menu to plan out my trip when it should be a one call ordeal. \n\nAlso there are times that the  dispensary agents push certain products instead of listening to my needs as a patient and end up looking like sales people trying to get their quarterly incentive which is not attractive as a patient trying to alleviate my symptoms instead of looking for a quick high.\n\nAt the end of the day I do not mind coming and making purchases at Seven Point, however, it also kind of upsets me that loyalty points that I have obtained from previous purchases cannot be redeemed all at once which hinders obtaining medical supplies during emergencies.', 1527101508),
(1123, 246, 'Azim Hemani', 'https://www.google.com/maps/contrib/109752438528183202431/reviews', 'en', 'https://lh6.googleusercontent.com/-C78ySeZUQ0E/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3i0l62kLgFQT3Xxow81Lw7jla_GQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Awesome looking place with great people working.', 1527713985),
(1124, 246, 'EDGAR PEREZ', 'https://www.google.com/maps/contrib/102413391281199805769/reviews', 'en', 'https://lh4.googleusercontent.com/-KD108pjWwQw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3T3avaKLj8PzVynWGI5qM1GugV8Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Great service I get all the time.', 1526766471),
(1125, 246, 'J', 'https://www.google.com/maps/contrib/103869958253443546577/reviews', 'en', 'https://lh5.googleusercontent.com/-nylI8b9H-wM/AAAAAAAAAAI/AAAAAAAAAC0/dqjoTp37qU8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'Seven Point was my first pick dispensary when I applied to be a registered patient in Illinois. They hosted workshops and helped me a lot as I prepared my application, answering all of my questions and even helping me with the fingerprinting and photos/documentation. \n\nEver since I\'ve gotten my medical card, I\'ve remained with Seven Point. The staff here is incredible; everyone is very genuine and knowledgeable. Some dispensaries I interacted with in the process seemed to have their chin up about their business and were difficult to approach with all of my questions... but at Seven Point it doesn\'t feel at all like that. I especially thank Yahaira, Kim, and Lisa! They have really taken time to get to know me and help me be informed about my medicine.', 1498919229),
(1126, 246, 'The Olivers', 'https://www.google.com/maps/contrib/109447639645894111035/reviews', 'en', 'https://lh6.googleusercontent.com/-hFlVCkJAKOw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq36WwEF3x1EMt5rxX_f8TfUQZZumQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Knowledgeable and helpful staff. This place is awesome!', 1521979532),
(1127, 247, 'Steven Niday', 'https://www.google.com/maps/contrib/103783739392415128237/reviews', 'en', 'https://lh6.googleusercontent.com/-WpA_hwgZ8Nk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq04KUPbvpOXERrdSM9u1AkONvBbFw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Always very friendly and extremely helpful with my million questions for them every time. The environment is very cool and calm but also futuristic its neat. After only my second time getting product from them I have found what works best for me already. I thought it would be a lot of trial and error but they found what I needed fast. Looking to keep going every week.', 1523732335),
(1128, 247, 'Jamie Newell', 'https://www.google.com/maps/contrib/113144893682127889672/reviews', 'en', 'https://lh4.googleusercontent.com/-lF9Jyb3C59I/AAAAAAAAAAI/AAAAAAAA1xw/fVpeMGrw92Y/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 weeks ago', 'Very friendly and helpful staff. I love the promotions they offer, too. Just a comfortable experience EVERY time.', 1526413250),
(1129, 247, 'Marcus Huston', 'https://www.google.com/maps/contrib/115071215302192399530/reviews', 'en', 'https://lh4.googleusercontent.com/-SMXjGwCvpyk/AAAAAAAAAAI/AAAAAAAAABw/MeF6woyU4us/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '7 months ago', 'Overpriced. Mid grade stuff. You find cheaper higher qaulity on the streets', 1509514061),
(1130, 247, 'Terri Plethora', 'https://www.google.com/maps/contrib/115297420593565149782/reviews', 'en', 'https://lh5.googleusercontent.com/-IcFv-O2q1A0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq11lABlFYUIMtM1JbdyFwnDlO2uhg/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a year ago', 'Fantastic experience.  Made my first dispensary visit  not at all intimidating.  Took the mystery out of medical grass.  There\'s hope with these caring and patient folks.  Go here!', 1481788535),
(1131, 247, 'Freddie Dickerson', 'https://www.google.com/maps/contrib/106069105359696717489/reviews', 'en', 'https://lh6.googleusercontent.com/-1iB15HskNMY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0GfC7s6kPz0O9HSw-wUne6mOgVfw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Great people and a great place!', 1515949966),
(1132, 248, 'Daniel Metcalfe', 'https://www.google.com/maps/contrib/101435780081098297827/reviews', 'en', 'https://lh5.googleusercontent.com/-jxOIxZiD1X4/AAAAAAAAAAI/AAAAAAAABD8/3jt4gmtklTA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Before I started using Midwest Compassion Center I used another local dispensary that was limited in product and I have several issues with the operation of there carts. When I came to Midwest they immediately made me feel at home. They always greet me with a smile and are able to help you find the right product for whatever may be troubling you. They are incredible to both veterans and regular citizens alike. They treat everyone the same...GREAT! If you happened to have just received your card and are brand new they will make sure that you understand what you are walking out the door with, and if there are any uncertainties they will make you feel at home and confident about your sale. Bottom line the place is great and the people are even better, 1st time or novice you will feel comfortable, I encourage you to go to Midwest Compassion Center 1st before trying any other dispensary in the area, you won\'t be sorry.', 1526689527);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(1133, 248, 'Katie Chentorycki', 'https://www.google.com/maps/contrib/116102345456549384610/reviews', 'en', 'https://lh5.googleusercontent.com/-t2u2QJDKejA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1TP51PDnRNHZea_MuUKd-BMzmMBw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I love this place I switched back two times after just searching for the best fit and Midwest is just it. The staff are very friendly and knowledgeable people.  Bill is the sweetest guy and helps you in every way. Adam also a very sweet guy is very knowledgeable about the products and what will help and for exactly what. Tom goes over my order right in front of me saying the products name, amount in grams or however it comes, how many I am buying and so forth. I really like them they remember my name and are just very SWEET. The products are A+ rated. Never had anything bad product wise. I really recommend this place and only this place to people with the cannabis card or who are trying to getting it. They even have classes on how to go about receiving your medical card. By the way, you are going to love their point system so you can earn free product. Great discounts to for disability, veteran, and others I believe. A++++ Thanks Midwest Compassion Center for everything. Katie', 1521558540),
(1134, 248, 'Evey Fuentes', 'https://www.google.com/maps/contrib/103590118360617698600/reviews', 'en', 'https://lh3.googleusercontent.com/-MCQ8ItcxU2w/AAAAAAAAAAI/AAAAAAABeOQ/6VmANs5QisY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'I choose Midwest Compassion Center for my dispensary after my  research of nearby locations.  MCC had great reviews from their patients.  I am pretty new to the Cannabis ways and needed help to decided what medicines would be helpful for me.  Can I say the staff is amazing!   I made an appointment and instantly felt comfortable asking the many questions that I had. I didn\'t feel foolish asking the questions that I needed to ask. I love that I can call and talk to anyone about the different options that they offer.  They have a great selection and the online ordering is so convenient.  The regular emails I receive are much appreciated.  I highly recommend MCC.', 1527710677),
(1135, 248, 'Snow Kitten', 'https://www.google.com/maps/contrib/117122479670401275744/reviews', 'en', 'https://lh3.googleusercontent.com/-pkPMgyJPAyQ/AAAAAAAAAAI/AAAAAAAARyE/ayF6W1NFek0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Every person working at the Midwest Compassion Center is awesome! They have all made me feel so comfortable and welcome each time I visit.  The staff is also very knowledgeable about their products and very helpful with reccomendations based on your medical needs. Oh and the BEST is they have online ordering. So quick to order and no waiting in lines at all.  Highly recommend using them as your medical dispensary.', 1518208694),
(1136, 248, 'Christian Lamas', 'https://www.google.com/maps/contrib/116415300915250026903/reviews', 'en', 'https://lh3.googleusercontent.com/-rcZh1bDo9Q0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1JyE4V7q-gpFDXZr0dQ-DaIfDj6Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Customer service at MCC is the best I have dealt with at any of the three dispensaries as a patient of the pilot program. A variety of products and specials are offered with the staff being very knowledgeable about the products of the products. Their website is super user friendly. Make sure to take advantage of online ordering!', 1519861223),
(1137, 249, 'Tips Tricks and Reviews Too', 'https://www.google.com/maps/contrib/102764893121958055732/reviews', 'en', 'https://lh3.googleusercontent.com/-ouPuyUe8TtU/AAAAAAAAAAI/AAAAAAAAAAk/fSctp8WSQ7Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I love this place. People here are so knowledgeable and nice. The prices are great plus they have sales. My money is well spent. I\'m very happy here. Ty for making mindful a Great place for all my pot needs.', 1510246132),
(1138, 249, 'Bradford Armstrong', 'https://www.google.com/maps/contrib/113670206603016571109/reviews', 'en', 'https://lh3.googleusercontent.com/-b4OJzPi1MtM/AAAAAAAAAAI/AAAAAAAAACE/ftoQp-8g7v8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Hands down a seriously people driven establishment with a phenomenal spirit of care. We are new but it has been a real pleasure to come!', 1517866807),
(1139, 249, 'Gerry Phipps', 'https://www.google.com/maps/contrib/103388354072208976869/reviews', 'en', 'https://lh5.googleusercontent.com/-iDUBma1djKo/AAAAAAAAAAI/AAAAAAAABjs/_zlHcga159o/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Wonderful group of people who couldn’t help me then and there but were so kind and helpful .', 1518982880),
(1140, 249, 'Stephanie Kekepania', 'https://www.google.com/maps/contrib/104959596461692483326/reviews', 'en', 'https://lh3.googleusercontent.com/-0AGgOMYUfpY/AAAAAAAAAAI/AAAAAAAAAHY/RHVaXbGtLg0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'The Mindful team is awesome! They are all so kind and extremely helpful. The interior atmosphere is calm and beautiful! You feel a sense of ease and serenity making the overall experience amazing. The menu has a great variety of different cultivators and products. The chalkboards add a nice personal touch with written deals, specials and cannabis education.\n\nMindful also provides free yoga sessions for registered patients!', 1499566019),
(1141, 249, 'Jill Bayner', 'https://www.google.com/maps/contrib/117699069782215363347/reviews', 'en', 'https://lh5.googleusercontent.com/-OKZRyKInSJ8/AAAAAAAAAAI/AAAAAAAAGLk/BrLmdM5NJDU/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '6 months ago', 'It\'s a great experience, especially when you are new to the world of weed!  The staff are very helpful and very knowledgeable about everything! I felt very comfortable and it\'s because of the staff. So if your looking for one on one attention, then this is the place to go!!', 1511642260),
(1142, 250, 'Dan Peterson', 'https://www.google.com/maps/contrib/100044264024021307034/reviews', 'en', 'https://lh5.googleusercontent.com/-JGHAZ0-JZp0/AAAAAAAAAAI/AAAAAAAAAIU/enRwsI74nsk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This is a great place to choose as your dispensary. They are very knowledgeable and always have the best up to date information and recommendations. Keep helping people feel better!', 1521567959),
(1143, 250, 'Courtney Diesel', 'https://www.google.com/maps/contrib/118275868175119843028/reviews', 'en', 'https://lh3.googleusercontent.com/-bPWSnw0FayY/AAAAAAAAAAI/AAAAAAAAJbE/M6noIxB7-qQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Elevele has been extremely helpful and knowledgeable with helping chose products that best suit me.  They are welcoming and a great crew!  Thank you!', 1521646913),
(1144, 250, 'lizz harrison', 'https://www.google.com/maps/contrib/102058505180199985246/reviews', 'en', 'https://lh4.googleusercontent.com/-aCgOKB-FEbA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2yAuf9-hT6cdFbEMLaT8ACG2k10A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Such a great place. Everyone is so nice and helpful. Def recommend coming here!!!', 1521560385),
(1145, 250, 'MrTrapMoney420', 'https://www.google.com/maps/contrib/112811478733953218972/reviews', 'en', 'https://lh4.googleusercontent.com/-vV7G7cD17xw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0hXSprULhKtSq-dUMqa494kiYB6g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great products, awesome staff all around awesome store', 1521218087),
(1146, 250, 'Diane Banks', 'https://www.google.com/maps/contrib/118233547841403403358/reviews', 'en', 'https://lh5.googleusercontent.com/-E9dnkdLg80A/AAAAAAAAAAI/AAAAAAAAEXg/-O5gEuCqcmI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Firendly and helpful staff.', 1521838376),
(1147, 251, 'Margo Vesely', 'https://www.google.com/maps/contrib/111667834565321967707/reviews', 'en', 'https://lh3.googleusercontent.com/-DriEx2eECIs/AAAAAAAAAAI/AAAAAAAAAn0/_7y5NbMbIMo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Not a lot of people are happy with our state of Illinois and the policies, along with the prices. I share these frustrations, too. But I know that we will get there someday soon and I personally advocate as much as I can. It can be especially frustrating after getting a product/device that doesn’t function correctly. I usually just call and tell EarthMed what happened and I  have them exchange it for the same product. \n\nI recently witnessed a well maintained employee dealing with a disgruntled patient by the front door. I heard the patient walking away complaining she had to drive over 3 hours to be unsuccessful in whatever it is she was dealing with. The employee softly spoke to another employee explaining that JR was disheartening to be dealing with such a situation moments before closing and to start off the weekend. I got the feeling he was probably yelled at by the patient. But without focus he turned around with a smile on his face greeting me and making me feel good. He made some suggestions of varieties of items I was looking for. I told him that he has great resilience to turn around and drop what was on his mind with the previous patient and greeting me like I was a special person to him.\n\nThank you! You could have just as easily spread the frustrations the patient put into you but instead you put a smile on your face to make someone else’s day better.\n\nWe need more people like that in our world.', 1519533617),
(1148, 251, 'James Edwards', 'https://www.google.com/maps/contrib/111680952527523688606/reviews', 'en', 'https://lh5.googleusercontent.com/-BoYaffO3STA/AAAAAAAAAAI/AAAAAAAAAAo/Fl2dP5m4uXc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Best dispensary in my area, been to 3c, the clinic mundelien, mindfull and Earthmed is the best by far, Best selection, best prices and the most variety which is most important to me.  Nicest people too, Rachel and Paula are super nice.', 1526618517),
(1149, 251, 'KingTinyy420', 'https://www.google.com/maps/contrib/113029720540558439809/reviews', 'en', 'https://lh4.googleusercontent.com/-8rNMlDVGdXQ/AAAAAAAAAAI/AAAAAAAAAMs/Q7RoElGmlkY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The staff are so friendly,like a type of friendly where it\'s makes u never ever want to change dispensary . The staff have great custom service they make me feel comfortable and actually take the time to explain different stains with me n make sure I make good choices for my condition .. Love u guys , every single one of you !!! I WILL BE BACK SOON . I honestly choose to travel an hour and a half away to shop here instead of the one I live by . I just love EarthMed’s employees very kind and theirs always deals here 24/7 trust me where ever your driving from\nIt’s worth the drive !! Very respectful security as well', 1527081152),
(1150, 251, 'Sammy D.', 'https://www.google.com/maps/contrib/114903750079805514535/reviews', 'en', 'https://lh5.googleusercontent.com/-XRKOe8p9uC8/AAAAAAAAAAI/AAAAAAAAB54/MAWWDEF1qLo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I switched from 3c in Naperville to EarthMed and love it! The people are informative and definitely know how to put a smile on your face! Great place!', 1524197272),
(1151, 251, 'Ryan Soul', 'https://www.google.com/maps/contrib/117113292798734838633/reviews', 'en', 'https://lh6.googleusercontent.com/-bE1lucTL2xM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0U3IPsO0VD8H33UGsV1KZ4eF4viw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Received a terribly unsafe product. They did not take it off the shelves even though I provided pictures with the proof. Even in the microscope it showed all dead trichomes and a fuzzy nasty web of mold throughout the cannabis. These guys will sell you mold and deny the issue. They will keep selling it to other chronically ill patients with no remorse. I really dont know how a company so unprofessional and shady can still be standing to this day. If only the health inspectors would do their job and start testing random products from each batch. The labs in IL are fake. They really are making outrageous claims with these test results. No flower is testing at over 30% thc in IL. Thats a false claim. I hope this company and the whole IL cannabis industry gets investigated for all the shady stuff going on behind the scenes. Godbless all the fellow patients who need medical cannabis. It breaks my heart to see that not only we are paying an outrageous price for low quality meds. But meds that are not safe to consume. This \"medical\" cannabis industry is just as harmful, if not more harmful as/than the pharmaceutical industry.', 1526681439),
(1152, 252, 'julia Duke', 'https://www.google.com/maps/contrib/101204055388528890260/reviews', 'en', 'https://lh6.googleusercontent.com/-lldDQNn4J8w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1r8onge_fOwEbtxy1Uaft3p8W6PA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Terrible experiences this place. Will be contacting the Better Bureau of Business regarding discrimination and overall lack of knowledge of the laws and limitations regarding medical marijuana. Never been so terribly serviced at ANY form of business. Worst experience ever. Don\'t go here. Don\'t let your friends go here. Word to the wise.', 1527120090),
(1153, 252, 'Mike McDowell', 'https://www.google.com/maps/contrib/112273928670548556673/reviews', 'en', 'https://lh4.googleusercontent.com/-tlXtrlfDYUE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0cXwdlkq-c1CrTTrh--LYIVKgN_Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '2 weeks ago', 'One of the bud tenders that\'s worked there longer is a real piece of work. Every one who works here is an entitled Ann arbor person/u of m student and it clearly shows. It also clearly shows that that\'s all they can possibly hope to accommodate is said entitled people. Have fun getting ripped off students!!! For any adults out there drive off campus and the prices are so much cheaper forget about the gas it may take. If you must stay in town due to laziness fine but for your sake don\'t go here.', 1526521041),
(1154, 252, 'Brandon Moody', 'https://www.google.com/maps/contrib/111243958660324597941/reviews', 'en', 'https://lh4.googleusercontent.com/-DNy9Q6hN3VM/AAAAAAAAAAI/AAAAAAAAACE/wQGVmmdLL5I/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I had a great first visit! Very friendly and helpful staff. Really nice selection and really good prices. I will definitely be stopping in again any time I am near Ann arbor.', 1520221295),
