(1160, 253, 'Shaunna Katz', 'https://www.google.com/maps/contrib/105038891881132323411/reviews', 'en', 'https://lh6.googleusercontent.com/-nN5bibqBmdI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1YdInwliZNL5kN32CzUW5yVIWM-A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 years ago', 'Thank you so much!!  I was desperate, my daughter has epilepsy and finally the State of Illinois is starting to help us. The staff at Good Intentions was so helpful.  I was lost.  I finally have some hope again.   I never realized all the requirements and road blocks the State has put in place.  I would recommend them to anyone who needs help.  Thank you so much.\n\n', 1407340524),
(1161, 253, 'Erasmo Rangel', 'https://www.google.com/maps/contrib/102281987049588510426/reviews', 'en', 'https://lh4.googleusercontent.com/-o3GtpGoCYb0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq263LVcWCH2cxwtKAJWQzhQs8WLdA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 years ago', 'The crew at Good Intentions are awesome. They where very helpful and informative. I had no idea that how to go about with my application process with all of the loops you had to jump through with the state. They helped me fill out my application and did my fingerprints and submitted it to Springfield. They are a gift of God! I would recommend anybody who wants to  apply for the pilot program to go through Good Intentions.Thank you so much for making me feel like I belong. ', 1417275452),
