(1180, 257, 'Zack Quas', 'https://www.google.com/maps/contrib/102493664409430203243/reviews', 'en', 'https://lh5.googleusercontent.com/-dNlO0nPs2kc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0pfl1DqihkrLTpqIeiILhPKPK7_Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great atmosphere from the moment you walk in the door thanks', 1520106997),
(1181, 257, 'AJ Kane', 'https://www.google.com/maps/contrib/109654425324762377387/reviews', 'en', 'https://lh6.googleusercontent.com/-hB-MI-6IGAw/AAAAAAAAAAI/AAAAAAAALx4/i4XzIR8NSws/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Tiffany at Soul and Wellness did a great job with helping me obtain my medical marijuana card. I hate dealing with paperwork and government bureaucracy and she helped me cut right through all of the red tape.\n\nPros:\n1. She took care of all of my filing.\n2. She helped me find a sympathetic doctor to prescribe (I didn\'t want to risk my relationship with my regular doctor by asking for it through her since medical marijuana is still controversial). \n3. She provides on site photography for your card.\n4. A few times a month she has on-site finger printing you can come in for. If you can\'t make it she can again provide easy referrals. \n5. She is incredibly responsive over the phone. I never had to wait even 20 minutes to be called back.\n\nCons:\n...Nothing really. Be sure to bring her phone number with you when arrive at her offices. I needed to call her to get the right door. There\'s obviously no marijuana on premises, but they still keep signage to a minimum for security reasons.\n\nA note on parking:\nParking is really easy, but it doesn\'t look like it at first. Right in front of the office is usually full, but if you go just one small block South to West 21st Street there\'s always a ton of easy street parking.', 1482337172),
(1182, 258, 'D Ger', 'https://www.google.com/maps/contrib/113416396860259224215/reviews', 'en', 'https://lh6.googleusercontent.com/-NvGbHCIyUQM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3cwolCpib_JpLo6LdjNHVnD4I5iQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'My recent visit at the Lincolnwood location was very pleasant. The staff was extremely helpful and friendly. They made my visit a very smooth process. Thank you!!', 1520916553),
(1183, 258, 'eric arndt', 'https://www.google.com/maps/contrib/101130076911625828033/reviews', 'en', 'https://lh4.googleusercontent.com/-mIpIwcWsIYk/AAAAAAAAAAI/AAAAAAAAHRU/jB2wdwzJSl4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, 'in the last week', 'The owner Eric Sweatt is a Domestic Abuser! Do not go to this Criminal..', 1527611851),
(1184, 258, 'Angelia Gish', 'https://www.google.com/maps/contrib/106062316280217984350/reviews', 'en', 'https://lh6.googleusercontent.com/-xHYEOXSd4VU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3c_Ljk2EjM3pTopHC3yDod1eXVVw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'I had my appointment today and I have to say that it went great. The staff are amazing and make you feel so comfortable and they are all very helpful.', 1501374946),
(1185, 258, 'Withjayme !', 'https://www.google.com/maps/contrib/107588472609071442629/reviews', 'en', 'https://lh5.googleusercontent.com/-UVLuxfirLaw/AAAAAAAAAAI/AAAAAAAAAC0/CzQXT2qEQhk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Cannabis experts!! Got me in fast! Helped me with all my questions & paper work. Even answered my many phone calls with questions that would randomly come up as it was my first time applying. The doctors are amazing & non judgmental, MCO even has an office at the doctors office, & is there to help with any questions. My paper work was sent off & I received my card about a month later. The people at MCO are amazing! They even reached out to me after I received my card to see if i had any questions & how everything was going. I loved the care they provided & the extra mile they went for me\n\nThanks for everything MCO!', 1500851634),
(1186, 259, 'April Kalmoni', 'https://www.google.com/maps/contrib/114808605149342431734/reviews', 'en', 'https://lh3.googleusercontent.com/-2oZpmxamjTc/AAAAAAAAAAI/AAAAAAAAXHo/dtRmVTlWb5c/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Wonderful energy is immediately felt as soon as you walk through the door. The owner and other employee are incredibly knowledgeable and will go above and beyond to assist with the customer understanding their products.\n\nI can attest that their CBD products work for both physical and mental ailments, and the amount of holistic healing supplies is enough to keep you there for a couple hours at least!!! If you just need a place to go to feel better, by surrounding yourself with healing energy; enter this beautiful space.', 1521384808),
(1187, 259, 'Scott McGlothlen', 'https://www.google.com/maps/contrib/117080015057118846269/reviews', 'en', 'https://lh4.googleusercontent.com/-voXvO_BIQMY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3k3zQyZjJYY9-4aQemC7PErXubfQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'I was curious about all the news on CBD oil so I stopped in to the Corner Store Apothecary and was highly impressed by the staff.  This young man took his time and educated me on all the benefits and how CBD oil works.  I ended up buying the muscle warming rub with CBD oil in it.  I have been living with back pain for 10 years now and this product definitely gives me the best relief I have found to date.  As a matter of fact that\'s what motivated me to write this review.  I forgot to apply this morning and I am now sitting at my computer with a sore back...  It works!  They also have many other products for other ailments.  I hope this helps someone out there living with pain.  Thanks', 1525271962),
