(1199, 262, 'kayla byers', 'https://www.google.com/maps/contrib/114605028128140527605/reviews', 'en', 'https://lh4.googleusercontent.com/-vMmYqahXd9U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq10tZHLCveq202ShOHi2NJ-C1Iqzw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Great array of products and very knowledgeable staff. They care about their patients and their work shows it.', 1508525399),
(1200, 262, 'Patt Gee', 'https://www.google.com/maps/contrib/113282421897683381618/reviews', 'en', 'https://lh5.googleusercontent.com/-F7jMBh0Km4Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Z3bidw0hr__OkmNubCE_wPm5Pnw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I have been to several dispensaries in Illinois, and Nature\'s Treatment of Illinois if by far the best. It has the widest variety of products that are of the highest quality. I recently made a trip to Denver and was disappointed because there was nothing comparable to what Nature\'s Treatment has to offer. The employees are always friendly and very professional. They are educated on their products and can make recommendations based on what you\'re looking for or what your symptoms are. They are located minutes away from the GTI dispensary, so they receive the best Tier 1 products before anyone else.', 1485404782),
(1201, 262, 'chance hengehold', 'https://www.google.com/maps/contrib/113260451378234787113/reviews', 'en', 'https://lh6.googleusercontent.com/-UcDktSchOY0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1pKi31M7CbIcUXIy0dklbCZ_CMPA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Best place in the world.  The people are extremely knowledgeable and very friendly. I would recommend anyone with their card to go here.  5 of 5', 1489336268),
(1202, 264, 'Cary Horton', 'https://www.google.com/maps/contrib/114135584735321272067/reviews', 'en', 'https://lh3.googleusercontent.com/-bBsSNwtFfGE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0zVCrBYUzKrTRu0qOF4_GA1YwbjA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '10 months ago', 'Dr. Voth is quite possibly the most ignorant person holding a medical license. I find it both offensive and appalling the he\'s allowed to practice medicine. Obviously he\'s  lacking the scientific understanding to efficiently treat patients. Otherwise he\'d change his opinion regarding medical marijuana. The facts are in. And data collected that supports the use of marijuana to treat a number of diseases including cancer. So it\'s plain to see that he\'s either ignorant or lacking compassion. Neither of which are qualities you\'d hope to find in a physician.', 1500705364),
(1203, 264, 'Fishfry anon.', 'https://www.google.com/maps/contrib/105495687588113438733/reviews', 'en', 'https://lh3.googleusercontent.com/-ghgvAsANi0o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq35rgCqsVtFzCTrDilw1KOxrQ39Fg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 years ago', 'Dr. Eric Voth is a difficult person to tolerate. He is on a mission to create lies about medical marijuana and it\'s benefits that simply are not true. Oddly he supports the use of alcohol in moderation yet he doesn\'t see this as hypocritical. Alcohol kills 1,000\'s of Americans every year due to drunk driving and cancer of the throat. But to him marijuana is still the evil weed of the 1930\'s film \"Reefer Madness\". \n\nHe has been brainwashed by the same government that refuses to allow clinicians to even study the potential benefits of using marijuana medicinally.\n\nOf course all of this is to protect is financial interests invested in his drug rehab business and actually admitting to the benefits of medical marijuana would take money out of his pocket.', 1408664815),
(1204, 264, 'Judy McCoy', 'https://www.google.com/maps/contrib/102204384326749456096/reviews', 'en', 'https://lh5.googleusercontent.com/-3rLM_mkukMo/AAAAAAAAAAI/AAAAAAAAFWs/oizSY7bhVYQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 years ago', 'You said it Cotten O Neal group is a monopoly here in Kansas in 2004 one one their doctors almost killed a dear family member they switch doctors every 3 day then and we came in seeing one cardiologist but we was off the day they did the angioplasty and he poked her too high and she lost a lot of blood at the hospital . Then they sent her home 6hours later . When asked for what sign to look for ,for internal bleeds they said that will never happen .then was asked for what signs to look for to tell if the sight started to bleed again was told you do not need that information it never happens . Then when I told here o the bleed she had the unknown doctors nieces said it was all taken care of . So she was discharged with no paperwork other then the \"Cotten O Neal heart diet\"& he appointment to come to their office building. I do not trust them at all and would not get any one I love worked on by them.\n', 1418500843),
(1205, 264, 'S Bebee', 'https://www.google.com/maps/contrib/101499106092490768502/reviews', 'en', 'https://lh4.googleusercontent.com/-HQf1YP6SVSA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3I4fbB58qH4hmfc0DFdWkNoKrRmg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 years ago', 'Eric Voth should not be practicing medicine. PUSH THE PILLS ON SOMEONE ELSE!!', 1434314233),
(1206, 264, 'Eric Wolf', 'https://www.google.com/maps/contrib/116668817634396666785/reviews', 'en', 'https://lh6.googleusercontent.com/-lvY8_sU8OjA/AAAAAAAAAAI/AAAAAAAAEKE/5U4gGBFLEas/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 years ago', '', 1434297383),
(1207, 265, 'Scott Dias', 'https://www.google.com/maps/contrib/102557562511098793299/reviews', 'en', 'https://lh3.googleusercontent.com/-DlZXGTm6uGs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq31yoeIZU5lOmK7M8k4-OGYwJStIw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I suffer from Ankylosing Spondylitis which is a severe form of arthritis. I have found tremendous pain relief from using CBD oil and Maeng Da powder as a tea once a day in the morning. The Cannabis Phrog in Bardstown, KY has helped me find a natural alternative to manage my chronic pain. Thank you!', 1522420052),
(1208, 266, 'Richard Merrill', 'https://www.google.com/maps/contrib/115969128663636070013/reviews', 'en', 'https://lh4.googleusercontent.com/-0_QPPaBjB5I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3NIAdgJCgIFV_n2cQK8EzkPxFDdQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a month ago', 'Great place people are cool too. Pricey though,but its legal.', 1523801039),
(1209, 266, 'Debby Brown', 'https://www.google.com/maps/contrib/111544597815172995042/reviews', 'en', 'https://lh5.googleusercontent.com/-WNuAPRExzAs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0GoE_IKFtv5RpLlkzyYhHpHKT5SA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'They have the greatest staff, both knowledgeable and friendly. Never a bad experience!', 1513113314),
(1210, 266, 'Jeremy Dalton', 'https://www.google.com/maps/contrib/106264596970438971488/reviews', 'en', 'https://lh6.googleusercontent.com/-8g20jeycIyE/AAAAAAAAAAI/AAAAAAAAA9g/ewSCz0Ssi-0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Always have what I want and treat you like a person not just another sale.', 1512510826),
(1211, 266, 'Dara Doan', 'https://www.google.com/maps/contrib/116730252457673713390/reviews', 'en', 'https://lh4.googleusercontent.com/-n3hSjY59O_Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1r22c0Xbm-7ixspp0DCK6Pl1kU1g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Very compassionate and caring people and I would not go anywhere else.', 1510680645),
(1212, 266, 'Robert Mittendorf', 'https://www.google.com/maps/contrib/112347434374360391365/reviews', 'en', 'https://lh4.googleusercontent.com/-_hu0qvT3uGk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq26XLSxzmAutg2nbmrHIP17XmoLyQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Best dispensary in Southern Illinois', 1525663521),
(1213, 267, 'Jake Hancock', 'https://www.google.com/maps/contrib/115674771680920075998/reviews', 'en', 'https://lh6.googleusercontent.com/-Sc9GCx10szc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3WdSc_IpVLQR5tYOKVxcGNjtT6Wg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'I drove an hour for the cashier to tell me that the half ounces had been reserved by people that weren\'t there. Don\'t waste your time or money. The Green Solution, let\'s you mix and match quanties for half ounce prices.', 1527682770),
(1214, 267, 'Michael Barlow', 'https://www.google.com/maps/contrib/118129850825709760275/reviews', 'en', 'https://lh4.googleusercontent.com/-PLCkNZtM1YQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0dUrCr9_dOsmWIc1FlemUHVwch_w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The staff is so helpful and make sure you feel comfortable', 1526670438),
(1215, 267, 'Driplife YTB', 'https://www.google.com/maps/contrib/116690104423370643687/reviews', 'en', 'https://lh3.googleusercontent.com/-aiu2vK3Ukh0/AAAAAAAAAAI/AAAAAAAAACQ/VMAGGjvoirA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'I Wanna Know How To Apply  For Your Job I Love Your Store \"So How To Apply\"', 1504334904),
(1216, 267, 'Philip Harville', 'https://www.google.com/maps/contrib/114230577041712539483/reviews', 'en', 'https://lh5.googleusercontent.com/-0gtsHKWuN6A/AAAAAAAAAAI/AAAAAAAAKSQ/C1zP_QgkLJM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'The staff is very helpful and they know their products. I have had Great results!', 1490104714),
(1217, 267, 'Roberta Marshall', 'https://www.google.com/maps/contrib/115117235853775384175/reviews', 'en', 'https://lh6.googleusercontent.com/-ekZfngtydLg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0u2_zOglFoFCSksZpG6xGs57VWgw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a year ago', 'Because the staff treat you like family and the product is good they\'re very knowledgeable and help you with anything you ask them for or about', 1489335741),
(1218, 268, 'Kaysey Kendrick', 'https://www.google.com/maps/contrib/103362128189635659067/reviews', 'en', 'https://lh4.googleusercontent.com/-kAJZTTU_Ut4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1-LQNJlE0Z1r3Fr0x022LtJ9sBmQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Great atmosphere. Shelton hooked it up!! And by hooked it up I mean he made sure we were well taken care of. He noticed I was a little lost - he phrased it as \"independent\" but I can admit it! It was my first time at a dispensary. My boyfriend was off somewhere knowing what he was doing. Shelton jumped in and ensured both of us left 110% satisfied. Friendly, knowledgeable, and intuitive to our needs, he for sure added the extra 10% to our experience. I would drive 8 hours back to Glendale just to visit this store. Above and beyond customer service and great experience!', 1526520149),
(1219, 268, 'Wess Wiesen', 'https://www.google.com/maps/contrib/111624486746367805597/reviews', 'en', 'https://lh6.googleusercontent.com/-iQ4ElGfbn5s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2x09hZPSqT9JjPwe6Oo59HbxbGSw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Shout out to Matt and \"Fat Chris\"!  The best store in Colorado!   These guys will take care of you. Awesome products and prices. The only place I shop.', 1527273646),
(1220, 268, 'jahmarri De', 'https://www.google.com/maps/contrib/100575882509919634006/reviews', 'en', 'https://lh6.googleusercontent.com/-SRJX_Qysz-A/AAAAAAAAAAI/AAAAAAAACsM/FybcMjc-e_o/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Personally, I go to a TON, and I mean a TON, of dispensaries in the Denver area and the green solution is BY FAR; in my top 5. 9 times out of 10 when I come in, the tenth time being the one time I don’t come in, the service is beyond exceptional. Nick, Shelton, And my favorite Matt, are always up to the challenge when it comes to getting me what I need! The products are amazing, the environment that they create is exceptional and I just want you guys to know that you deserve 5 stars. It’s awesome what you guys do and I’m very glad you are apart of my continued Cannabis experience. You guys really make it worth while.', 1517193665),
(1221, 268, 'Stevie Gordon', 'https://www.google.com/maps/contrib/111879254733031903441/reviews', 'en', 'https://lh5.googleusercontent.com/-Kk3Wg0VfWQw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3BhaYurNKx2CbmUqEkDeoKUVX-KQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This dispensary is clean, well organized, and the staff is always friendly and eager to help! I was loyal to another dispensary down the road before I found this place, and I will continue to come here! Ask for Austin- he is super knowledgeable, friendly, and will help you out in any way that he can!!', 1524608745),
(1222, 268, 'Nick Miller', 'https://www.google.com/maps/contrib/116454182241756035120/reviews', 'en', 'https://lh5.googleusercontent.com/-54tRGxPTuYc/AAAAAAAAAAI/AAAAAAAABgU/ICEMna9s0fM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'By far one of the best dispensaries in town! The employees are always helpful and friendly. Tonight Austin helped me find what I was looking for, and was both of those things in spite of it being 11:30 at night. Definitely a must visit dispensary!', 1523426116),
(1223, 269, 'Charlie McAloon', 'https://www.google.com/maps/contrib/117314262445190568477/reviews', 'en', 'https://lh4.googleusercontent.com/-zGx0QW6HlO8/AAAAAAAAAAI/AAAAAAAAJ1o/c7Iq7zsjc08/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Love them ..helped out alot good product ..great service and always polite and quick.', 1524054320),
(1224, 269, 'Paula Lewis- Given', 'https://www.google.com/maps/contrib/100579949542118376395/reviews', 'en', 'https://lh4.googleusercontent.com/-mvisG7QKNFI/AAAAAAAAAAI/AAAAAAAATpY/_8ZpN9t4m5M/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '8 months ago', 'It\'s a very calming atmosphere.', 1504991869),
(1225, 269, 'Alexy Pagan', 'https://www.google.com/maps/contrib/118226166136029117915/reviews', 'en', 'https://lh3.googleusercontent.com/-HVnKehw8Tww/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Gobyc1HRlzTyMYG3N_0P_BTa1tw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'My go 2 4 now recommend 2 anybody', 1500490302),
(1226, 269, 'c cmc', 'https://www.google.com/maps/contrib/106740233302145226195/reviews', 'en', 'https://lh5.googleusercontent.com/-j1t83MTXVpg/AAAAAAAAAAI/AAAAAAAAAJo/rVKf_IFQ4CU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Very grateful for the Bath location....helpful staff.. and quality products to help with my chronic pain. Great hours!', 1476366916),
(1227, 269, 'Zev Keisch', 'https://www.google.com/maps/contrib/107944241371031381477/reviews', 'en', 'https://lh3.googleusercontent.com/-jsE0XcLJ8Lo/AAAAAAAAAAI/AAAAAAAAABU/CnB05l5L5AE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I am so happy that the great people from Thomaston are mostly at this very convenient, cheerful and professional new location in Bath.', 1478522530);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(1228, 270, 'Scott Dearborn', 'https://www.google.com/maps/contrib/115289296239993474974/reviews', 'en', 'https://lh3.googleusercontent.com/-PH12KsjsNS8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq23oJSpEkIOrS5-UcY2_fObdH1V0w/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a week ago', 'It\'s hard to judge.  I\'m no expert.  This was most convenient.  Prices are higher than anyone on the certified care giver list by almost double.  \n   Frustrated when I\'d call a few times, not get an answer or call back.  I\'d finally go in and they don\'t have Indica tincture I came for.  Thats happened 4 times since January.\n    The staff are fabulous and knowledgeable!!! \nThey told me how to go online to check what is in stock.  Then I preorder it, pay with Can pay App, go in and pick it up. Much better!\nMy mother and I are both members going on Three years.  We wish they still had the hot chocolate.  Their pipes and such are not cheap.  Mostly designer glass stuff.  They have great promotional sales!\n     Overall very satisfied!\n                                                  Scott D.', 1527005747),
(1229, 270, 'Adam King', 'https://www.google.com/maps/contrib/113166286457997110357/reviews', 'en', 'https://lh6.googleusercontent.com/-2I2p12dQGfg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3zMZmI2bHEscvHdgqj3UE7gnWFYA/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '4 months ago', 'its ok. better than the other ones in state. but a bit expensive. decent offerings', 1515042852),
(1230, 270, 'Tim Poitras', 'https://www.google.com/maps/contrib/109953132199653912336/reviews', 'en', 'https://lh5.googleusercontent.com/-Lmb6YZPxyak/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3_GDN29TmznoCHbhP_QmmLiGGNXg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Great place, Nice, Sociable Staff, that know about the products they sell !\nAnd they always have nice quality  \nProducts, always been happy !!', 1516662436),
(1231, 270, 'Brianna Morton', 'https://www.google.com/maps/contrib/116269357399443269899/reviews', 'en', 'https://lh3.googleusercontent.com/-lW4L9FxOvbM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3ZImcFTm7J0xPazbpxmJq4ptpVtQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '11 months ago', 'The staff is great and super friendly the only\nComplaint I have is their cones are not packed well and burn unevenly every time. For the price I think the quality of the cones could be improved. Otherwise I have no complaints!:)', 1498607667),
(1232, 270, 'Consuelo Smith', 'https://www.google.com/maps/contrib/102390140552523920975/reviews', 'en', 'https://lh5.googleusercontent.com/-_Qy3bKZPdEA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1TTndcQdwPhGnWXil5PhMk3O6u0A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'The staff are so nice and polite they know almost everyone by name. The atmosphere is always so relaxed.', 1508188947),
(1233, 271, 'Ariel Emerson', 'https://www.google.com/maps/contrib/111501728475284415410/reviews', 'en', 'https://lh5.googleusercontent.com/-LXd6PbnHWYQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2btEnVlRz_vgyDo4tadtGICIPNPw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Well, some real honesty. I just got my card, so I was a little nervous and didn\'t know much about marijuana. When I went out back I met with a gentleman named cam. He showed me a lot of knowledge about different strands and what will help my body pain, depression Etc. He showed me all the edibles they had, as well as everything!! I felt comfortable, which is hard for me. He\'s very patient, and answers all questions. If you go here, you should definitely request to see him! I\'ve been back sense and awesome service. Everyone there is kind.', 1525975188),
(1234, 271, 'vw seth', 'https://www.google.com/maps/contrib/100434519117285238928/reviews', 'en', 'https://lh3.googleusercontent.com/-GbdOlqdBBTU/AAAAAAAAAAI/AAAAAAAAhCg/_StlEhRFPGA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Excellent staff. Super helpful and knowledgeable. \nEnjoy my visit every time.', 1525459309),
(1235, 271, 'Mason James Moshier', 'https://www.google.com/maps/contrib/106964097540924295293/reviews', 'en', 'https://lh3.googleusercontent.com/-KhaDf5yi1Xo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2KeO1_OQSAg7GSEktZocwuE-JwvQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'I had been going to this place since 2012 for my meds. I always ranted and raved on about how great the staff was there- they were my happy place and felt like a loving family. Things are NOT at all like that with their new staff. I can no longer order over the phone- after years of doing so. All of a sudden I am\ntold I MUST order online. I am chronically ill and there are days I am simply too sick and foggy headed to use their website. I really don\'t believe these people care about the patients anymore at all- its all about the money to them. You\'d think for as many people they have working, that quickly writing down a phone order could not be that hard. \nTaking my business somewhere where I am treated with kindness and respect. NOT like a number.... They seem to be forgetting the whole \"customer service\" side to running a business.', 1519484834),
(1236, 271, 'Meredith Briggs', 'https://www.google.com/maps/contrib/108479885530901299709/reviews', 'en', 'https://lh4.googleusercontent.com/-tjsFFbABMSs/AAAAAAAAAAI/AAAAAAAABWk/PabjjhGkp8k/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Such an awesome variety. The staff is amazing and always willing to help however they can.', 1521421097),
(1237, 271, 'Barb Thomas', 'https://www.google.com/maps/contrib/113153312752697906762/reviews', 'en', 'https://lh3.googleusercontent.com/-bcRa_9h5BOE/AAAAAAAAAAI/AAAAAAAABCw/f0gN4oc4Srs/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '2 months ago', 'You need to expand on the CBD options and cartridges. For those of us that are limited to CBD. I love your staff, shop and the new points system. Also your staff do their jobs very well. They are very knowledgeable, friendly and helpful.', 1520115294),
(1238, 272, 'Brian Thompson', 'https://www.google.com/maps/contrib/110026527614348712532/reviews', 'en', 'https://lh4.googleusercontent.com/-aKDTVm1B5mQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3rNYw-qy0uvSzDrqwig-DJcw6kSQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'I am new to medical marijuana and thought that Wellness Connection of Maine in Brewer would be a good place to go. For me it was not. I called twice to discuss the \"intake\" process but had to leave a message both times. So I sent an email through the Wellness Connection website. No response. I finally received a call from a guy in Gardiner telling me that if I showed up by 5:30pm I could go through the \"intake\" process. Not true. The woman who turned me away from the Brewer location has zero customer service skills and seemed to care less.\nThis is all new to me, I thought a dispensary would be a good place to go where I might find compassionate and knowledgeable people. I was wrong.\n\nUPDATE: I went back and received outstanding customer service.', 1508068393),
(1239, 272, 'Miranda Hamm', 'https://www.google.com/maps/contrib/112714239758580489820/reviews', 'en', 'https://lh5.googleusercontent.com/-TwxVyc0aZcs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0H9iu8WupoNnI8MiGrANcK-dyZNA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '6 months ago', 'Go to Ellsworth almost all there grams are 7$ except maybe 2 there a really good deal 3gs for 22$ can\'t beat that Brewer is just a rip off', 1510856044),
(1240, 272, 'Jessica Rossignol', 'https://www.google.com/maps/contrib/117580511778392144839/reviews', 'en', 'https://lh4.googleusercontent.com/-hVmal-wm-Io/AAAAAAAAAAI/AAAAAAAAABk/Ut--aYPO9f4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Love this place. You guys gonna be open this morning in brewer 2/7/18', 1518006575),
(1241, 272, 'John Smith', 'https://www.google.com/maps/contrib/113524509392503881480/reviews', 'en', 'https://lh6.googleusercontent.com/-WXJtYm3mfBA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3jzXU0g1X666kpxOdTXS1pIn-PKA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '6 months ago', 'If you\'re a drug dealer who has a little side business going this place is great for you they have lower prices for bulk and cater to people who buy their limit. But if you\'re actually disabled you\'ll never be able to afford the marijuana here as medicine. Smaller amounts are more expensive and the deals are for the  those who can buy in bulk. Maybe a couple times a month for recreation.', 1509915957),
(1242, 272, 'Jane Campbell', 'https://www.google.com/maps/contrib/105407243356203796791/reviews', 'en', 'https://lh5.googleusercontent.com/-83b_tTy7i8k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq33iWFaC4mQ50DVKixogKsbLtZQsg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Experienced staff, good number of strains (including edibles and products). Very professional, checking required docs, recommendations, security cameras).', 1511559361),
(1243, 273, 'M B', 'https://www.google.com/maps/contrib/110187017871516996400/reviews', 'en', 'https://lh4.googleusercontent.com/-BhXTWZeflVw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0_P-kX63HEg1dsde5o0QZ3Dqb46g/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'The worst dispensery I have ever been to. Never again ! \nTerrible service. Was going to take weeks before they would let me enter. My med card an I.d. were in hand and up todate.\n Never again. \nU lost my bussniess an the man Standing behind me that day.', 1521298690),
(1244, 273, 'Lisa Fournier', 'https://www.google.com/maps/contrib/113619309904354321901/reviews', 'en', 'https://lh3.googleusercontent.com/-vNRV2pUy4iM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2GN-_xmy9NG8dMph2xxme6b0OLCg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 months ago', 'The place in Gardiner is great\nEvery one is super nice. They are they only ones that have my Indica chamomile tea', 1517858042),
