(1246, 273, 'Bert Ernie', 'https://www.google.com/maps/contrib/111858300813541142616/reviews', 'en', 'https://lh3.googleusercontent.com/-6zRAGJfB5_s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1NiI_aKTwPieUpJPHC_a6nnt6IEA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Very patient, well knowledged when it comes to knowing what kind of medicine a patient needs. I\'m always treated with the utmost respect every time I have dealt with the Wellness Connection. Thank you guys very much for being the best dispensery I have been to yet!AKA.....Jason Corbett Sr.', 1508202509),
(1247, 274, 'Jennifer Horton', 'https://www.google.com/maps/contrib/115742139227486912723/reviews', 'en', 'https://lh5.googleusercontent.com/-3U234Dxod2M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3t3cjs0VoXaG7rPIWv3CECT52iEw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'My meeting with the NP, Jay, made me feel so much more comfortable with my decision to apply for certification. I was very nervous about this step and she helped with guiding me toward the best options for me and how medical cannabis could make my life better. The office staff and the resource room were amazing.', 1526403287),
(1248, 274, 'Brad Byther', 'https://www.google.com/maps/contrib/106590044026560362492/reviews', 'en', 'https://lh3.googleusercontent.com/-p2YIoO_x_iw/AAAAAAAAAAI/AAAAAAAAAC8/I1IaCoqujdY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 weeks ago', 'My visit with Dr. Sulak was extremely comfortable,  engaging and enlightening for me as I learn how to better manage my chronic back pain symptoms.  Dr. Sulak has allowed me to see Medical Cannabis in a whole new way.  His specialized pain management approach will allow me to better engage in a healthier future.', 1526129426),
(1249, 274, 'Karen Hutchins', 'https://www.google.com/maps/contrib/106109789429292183955/reviews', 'en', 'https://lh3.googleusercontent.com/-MTCogliEDfI/AAAAAAAAAAI/AAAAAAAAACU/RPRFPEgwey4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Dr.Sulak is knowledgeable, professional and takes the time needed to explain things.  We left feeling confident with the advice we received and would  highly recommended  him to others in need of natural alternatives.', 1524687130),
(1250, 274, 'Barbara Graham', 'https://www.google.com/maps/contrib/110536574328894900658/reviews', 'en', 'https://lh4.googleusercontent.com/-4O-s8DZtOFQ/AAAAAAAAAAI/AAAAAAAAABE/ji-9PS2POhg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'It was very educational and thorough. Dr. Eng was so kind and so personable - he explained everything carefully and answered all my questions.', 1524602857),
(1251, 274, 'Maggie Carr', 'https://www.google.com/maps/contrib/106563776153029657789/reviews', 'en', 'https://lh5.googleusercontent.com/-s7Zy6uDggcw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3AKIyr5ss62ViqYEIKxOgRA8MK4w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Everything! The connection with Dr. Mike is wonderful. Knowledgeable. Interested in you as a person. All staff are very nice.', 1520098118),
(1252, 275, 'Laura Blackler', 'https://www.google.com/maps/contrib/114983360717033695767/reviews', 'en', 'https://lh4.googleusercontent.com/-LJntu4zonVI/AAAAAAAAAAI/AAAAAAAAAAA/GXn5vOdDkLY/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'Called on 1/5/18 to find out if they were open after the storm on 1/4. Message was old, from end of December! Left message asking for a call back to see if they were open. Didn’t get a call back. DROVE ALL THE WAY FROM AUGUSTA ONLY TO FIND THEY WERE CLOSED!!! Google had them listed as Open! The only way to know they’re closed was to drive here and read the sign on their door!!!  Bad business practices! Get your details straight!', 1515174891),
(1253, 275, 'Heather Hamby', 'https://www.google.com/maps/contrib/112016587344223458767/reviews', 'en', 'https://lh5.googleusercontent.com/-bWIc0SQeJsQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3FBEQhOBZ1_G84u_ZlYbU9l-2K-Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Quick and easy. The ladies were super sweet and helpful!', 1519675175),
(1254, 275, 'Matt Ricard', 'https://www.google.com/maps/contrib/101218280316330499389/reviews', 'en', 'https://lh6.googleusercontent.com/-2V4MaIVDAGg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3N4o8_2kKMcV6I97e97vUsoEKvOw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'The relief clinic is a great place to get certified for your medical marijuana card! The nurses there are amazing and they really thrive to help there patients. My experience was wonderful & fast. They have snacks and drinks for people who are waiting to be seen. All around great vibes at the relief clinic. Way to go relief clinic keep up the amazing work! Thanks ladies :)', 1459261079),
(1255, 275, 'Milani Del Rosario', 'https://www.google.com/maps/contrib/108054078314393186468/reviews', 'en', 'https://lh5.googleusercontent.com/-rTMfT05djAo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Afx6LGJtpfaumah0zEMxF7CkW2A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'Dr. Levitt has been more then helpful in helping me understand my new medical options. He explains things thoroughly in a way that is easy to understand, and when I need his assistance, he is more then happy to do so. I would like to thank Dr. Levitt and his staff for bringing such relief to my life. I don\'t know where I would be without them. Thank you so much.', 1458838506),
(1256, 275, 'Greener Pastures Holisticare', 'https://www.google.com/maps/contrib/108403653149184841539/reviews', 'en', 'https://lh4.googleusercontent.com/-WGivYmw2Kx8/AAAAAAAAAAI/AAAAAAAAATQ/pPxOZGe_if4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Relief Clinic has an amazing staff of knowledgeable and friendly folks! They are very warm, welcoming and helpful to their patients.', 1473104347),
(1257, 277, 'Jenna Carlson', 'https://www.google.com/maps/contrib/108955491443799434393/reviews', 'en', 'https://lh6.googleusercontent.com/-rl_VgdXVz_A/AAAAAAAAAAI/AAAAAAAAIpc/ai8IWdtuQYc/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '2 weeks ago', 'The doctor I went to recommended I go here to get tincture and I see why.\nThe staff here are great, they are able to answer a lot of my questions I had.\nThey have a great selection and prices are really good too.\nOh and did I mention that each day they have a different special or deal.  Like free edibles, a percentage off certain items or free flowers?', 1525958729),
(1258, 277, 'Faegan Pan', 'https://www.google.com/maps/contrib/102632651365957293307/reviews', 'en', 'https://lh5.googleusercontent.com/-vqpesxZyidU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq13h7rhNvA4TU1WeESr3kcyMeiIWg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '4 months ago', 'Lovely, helpful, knowledgeable staff. They are always kind and attentive, no matter who helps me.\n\nI’m new to marijuana as medicine, and it has helped me more than any of the 20+ “conventional” medicines I’ve tried for my chronic illness. I figured that because I am so young the staff would laugh at me if I asked them basically how to smoke pot. They didn’t laugh at all or look at me funny: they were friendly, knowledgeable and genuinely happy to answer any and all questions I had, and continue to do so to this day. I look forward to picking up my medicine here just to say hi to the people. \n\nGreat product, great sales as well. I’m always surprised when I go in and my medicine costs me a fraction of the price it normally does! It’s very helpful, as I do not have a lot of money. Definitely happy this is our local dispensary.', 1516835788),
(1259, 277, 'CL Stokely', 'https://www.google.com/maps/contrib/110973525937299624507/reviews', 'en', 'https://lh5.googleusercontent.com/--Ahj2eu7Xjk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1N5Z3IUvP9CfrMEN4GCI1i1jP1Vw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The staff are very knowledgeable and friendly. They always have a wide variety of product and the prices are very reasonable.', 1524922983),
(1260, 277, 'Leanne Tupper', 'https://www.google.com/maps/contrib/107298735877411793970/reviews', 'en', 'https://lh4.googleusercontent.com/-lGlg5rdBw2Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq27WY9OPkHVdhS1Tum7UXhiuL7IfQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Had a very pleasant visit at my favorite dispensary. My bud-tender recommended moon rocks. I asked if I could vape it... she said I might want to vape it a little higher then usual. Tonight I tried Moon rocks......Great tasting and nice feeling from the indica!', 1524279158),
(1261, 277, 'Elliot Lee', 'https://www.google.com/maps/contrib/104473456231849544248/reviews', 'en', 'https://lh4.googleusercontent.com/-awuajgPuakI/AAAAAAAAAAI/AAAAAAAAAAA/RzDrEY8M9YU/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Very disappointing. I live in town here and am 8 years experienced with smoking but initially went to Canuvo in Biddoford an hour away due to reviews about Remedys management. Once I got myself established there with a dosing of CBD that really managed my issues I decided to try Remedys oil since they\'re so much closer. Was initially impressed with the atmosphere and the building but that certainly does not compensate now that I\'ve had my experience. I purchased their olive oil CBD (made with a strain called shark something or other - not a known potent CBD strain) and a gram of their super saver bud which is over $14 a gram! $15 for their regular menu!! The flower had SEEDS in it and is still sitting in a drawer because it\'s ditch weed basically. I gagged on the first dose of oil and ended up in the ER after switching dispensaries. The oil also solidifies in the fridge! When confronted with this information I was told that I didn\'t dose correctly and that it works for many other patients. So basically there was no accountability or genuine empathy about my experience. This really upset me and I left completely dejected. \nNeedless to say I went back to Canuvo! $10 a gram for consistently very good quality bud that gets tested more than Remedy. They aren\'t just in it for the THC money making game, sucking money off of people dealing with physical pain management. Their edibles (brownies, etc) are also 3x cheaper than this place!! Canuvo is more professional and secure. They also don\'t SCAN YOUR LISCENCE. They have a couple CBD strains and numerous others CONSISTENTLY on deck. The oil is made with a potent AC/DC strain, always, and the oil tastes/feels great. Made out of coconut oil so it absorbs quicker. Even with tolls, gas and time; it is cheaper and well worth going elsewhere. Definitely will keep passing the word around.', 1524004475),
(1262, 278, 'Kim Cote', 'https://www.google.com/maps/contrib/100818622011603192934/reviews', 'en', 'https://lh3.googleusercontent.com/-6qeAGVCRm1A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3A9rE1ypVsOo-DamX5xNx8BoTetQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 3, 'a year ago', 'Friendly people, good product.. it just sucks that a person has to pay so much though. I mean who can go wrong having your stuff brought to you at no extra charge.. thank goodness. Usually  good buds.. a lil leafy.. but once you know what is good.. it great.', 1476281226),
(1263, 278, 'Bob Marquis', 'https://www.google.com/maps/contrib/108033778790848841547/reviews', 'en', 'https://lh5.googleusercontent.com/-wvvB-mJjuNo/AAAAAAAAAAI/AAAAAAAAAuk/lXqBYqzBZZo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'First Rate! Very professional. Informative.', 1495796199),
