(1271, 280, 'SmartBytes Maine', 'https://www.google.com/maps/contrib/104362352884799504799/reviews', 'en', 'https://lh5.googleusercontent.com/-ci5pWJLMxhA/AAAAAAAAAAI/AAAAAAAAAAo/64KNLdOVYVE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '9 months ago', 'Great selection and incredibly helpful staff.  Takes their MMJ seriously! No \"weed life\" stickers or garbage trap house music here. ', 1504271322),
