(1274, 280, 'Laurie Rich', 'https://www.google.com/maps/contrib/104212249442761256302/reviews', 'en', 'https://lh3.googleusercontent.com/-iZ_pFT8jTXM/AAAAAAAAAAI/AAAAAAAADpI/6fl5TB6jjTg/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a year ago', 'If you need medical Marijuana this is a great dispensary.  The information provided is clear and concise.  Staff very helpful in finding what will work for you.  Wonderful new office.', 1477954174),
(1275, 281, 'Dan Thompson', 'https://www.google.com/maps/contrib/103666962310053978778/reviews', 'en', 'https://lh4.googleusercontent.com/-hDAheZ-6xv8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3ucl5rbadDb3l9Qn1LdRePBeAAqw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'By far the best dispensary around! Procure has a very knowledgeable staff that are down to earth and not pushy towards any products at all. I drive about an hour or so and will continue to do so because of their exctensive selection of craft quality concentrates and flower at and affordable price!', 1506620331),
(1276, 281, 'don driver', 'https://www.google.com/maps/contrib/116462306019295628017/reviews', 'en', 'https://lh3.googleusercontent.com/-e2AUYReAbsg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2T6kfX5LnUuIxh0T8926IHF_Bc3Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'This dispensary is very close to home but more importantly the employees who work here are very informative and friendly! Marley Glad weedmaps added them to the list because their prices are very  reasonable! Quality is amazing as well especially those topself concentrate .', 1506647293),
(1277, 281, 'Sarah Sales', 'https://www.google.com/maps/contrib/110253930966128966944/reviews', 'en', 'https://lh3.googleusercontent.com/-huNeznztXE4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0cL4k0mtICcpcuuqhYx-DjGpeKcA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'The environment, staff and products have always been above and beyond my expectations. I\'ve yet to find concentrates that even remotely compare to the xtracted lines. I would recommend Procure LTD to any patient without hesitation', 1506629176),
