(1280, 282, 'Ken Lacasse', 'https://www.google.com/maps/contrib/107727046143913133555/reviews', 'en', 'https://lh5.googleusercontent.com/-VSMRbC62Www/AAAAAAAAAAI/AAAAAAAAACI/hK_itUYdFe4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '9 months ago', 'Very experienced staff. Extremely informative in assisting me with my medical needs! Compassionate and caring, what most doctors are missing today!', 1502725385),
(1281, 282, 'Mike Jones', 'https://www.google.com/maps/contrib/111904675982538565354/reviews', 'en', 'https://lh3.googleusercontent.com/-PcizT0YPtHM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3pm8UxIjmJ_D0o0q9iXHIGFF0Kpg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'I\'m a current patient. Called on 05/21/2018 to ask a question after being certified. Spoke with Brooke. Was turned away and told they only certify patients they don\'t answer questions.', 1526922670),
