(1283, 282, 'josh jm', 'https://www.google.com/maps/contrib/116717306703708626466/reviews', 'en', 'https://lh4.googleusercontent.com/-l90vexbyJbQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1cWNKEtfFWRqgGQhoJYceBvp1khg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 years ago', 'I am not a Maine resident so they couldn\'t help me in the standard ways, but they gave me great information. They were very kind and understanding and really helped get me ready for my next visit to Maine. Great understanding people for sure. ', 1450552270),
(1284, 282, 'Jeremy Whynot', 'https://www.google.com/maps/contrib/115163563534299142597/reviews', 'en', 'https://lh5.googleusercontent.com/-lFOfKBiN95o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1nyDce7ex4Y8wZ1AKVQvf6MTm3sA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'It was great, this place is open tuesdays in Biddeford .', 1486495635),
(1285, 283, 'JOEY DELO', 'https://www.google.com/maps/contrib/116441918669229983472/reviews', 'en', 'https://lh5.googleusercontent.com/-22WvQH15kxg/AAAAAAAAAAI/AAAAAAAAD4s/8acarpBlgG4/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '6 months ago', 'This is by far hands down best spot to get your medical cards. The people in the office here are awesome. They always take care of me when I come in. It\'s always a fast and easy process weather it\'s getting your card or renewing your old card. They really make you feel comfortable. I would recommend them to anyone and everyone that asks me where to go to get there cards.', 1511894408),
(1286, 283, 'Donald Quirion', 'https://www.google.com/maps/contrib/113593153403778813089/reviews', 'en', 'https://lh3.googleusercontent.com/-Ilc4B0pj7ng/AAAAAAAAAAI/AAAAAAAADbg/I6HFyGJTJQ4/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '8 months ago', 'I was happy with there service when I went into office! I just did a video conference renewal and all went good till it comes time to get my card I have called been told they will get back to me then tell me they can\'t find my file then it yes come in and pick up your card oh we don\'t do that it\'s been 2 weeks I haven\'t got my card or a phone call back telling me what is going on!!! Very frustrated and not to satisfied with the way they are handling patient files and questions!', 1506955865),
(1287, 283, 'josh murray', 'https://www.google.com/maps/contrib/104377781925072512584/reviews', 'en', 'https://lh4.googleusercontent.com/--jKvQp6yLhg/AAAAAAAAAAI/AAAAAAAAAA4/ypjZsAecbdc/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '9 months ago', 'I found the receptionist was rude and condescending\n\nMaybe invest in more public relations courses for your staff.\n\nShe was not very pleasant.', 1504217107),
(1288, 283, 'Catherine Smith', 'https://www.google.com/maps/contrib/100177311066477186610/reviews', 'en', 'https://lh4.googleusercontent.com/-UzbJEfR9CJs/AAAAAAAAAAI/AAAAAAAAAEM/EceWGoTtmRA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'I used the telemedicine option.  All I had to do was download the Zoom app on my phone.  It was so quick and easy and the provider was friendly and helpful.', 1501853301),
(1289, 283, 'erica leighton', 'https://www.google.com/maps/contrib/104639382036649175677/reviews', 'en', 'https://lh3.googleusercontent.com/-J4nQroj1V_g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2MArtM9hrYq2iMmQ9QZvm-hYk_Cw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'This team of people is amazing! They are knowledgeable and friendly!', 1504641115),
(1290, 285, 'Mike Simoes', 'https://www.google.com/maps/contrib/116201649717877883829/reviews', 'en', 'https://lh4.googleusercontent.com/-q3MPDM3NXK8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0v0jCJwalIZBckOJOvlqjf5HvfEQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'Really awesome place besides the women working the front desk, anytime I\'ve called she answers the phone with HELLO, and then proceeds to give an attitude for no reason at all', 1488999110),
(1291, 285, 'Chris Bissett', 'https://www.google.com/maps/contrib/106832161145332348059/reviews', 'en', 'https://lh3.googleusercontent.com/-_wxzWbNXk3s/AAAAAAAAAAI/AAAAAAAAGWA/f9CqhUaC360/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a year ago', 'I\'ll start with the bad. When moving g locations they lost my and I can only assume more patients medical paperwork. When I went back the second year I had to provide all my medical records again. My first appointment I was told was an initial fee and renewing would be less afterwards. I never received a discount for renewing I pay full price each time.  \n\n With all this in mind I still choose Spiegel over Sulak. I don\'t need raiki or my back electrocuted for a skin condition, in my opinion, treatments Sulak offices perscribed', 1483561355),
(1292, 285, 'Leona F', 'https://www.google.com/maps/contrib/114694172097399470758/reviews', 'en', 'https://lh3.googleusercontent.com/-y76MqHi6FEA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ZliMLTb1iwamCuPga9LaJlQcG7A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 years ago', 'After reading the reviews, I was skeptical. What a wonderful place. Ashley was very pleasant, not at all like I read. I highly recommend Casco bay medical. Very informative! I felt comfortable. \nThanks for the positive experience. ', 1421257646),
(1293, 285, 'Helene Jarvis', 'https://www.google.com/maps/contrib/109499478299995718954/reviews', 'en', 'https://lh5.googleusercontent.com/-aSA4R2qrkGk/AAAAAAAAAAI/AAAAAAAAAAs/wgpseB-gPV4/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '11 months ago', 'If you lose your card they charge an additional $100. Just for a signature ', 1498072828),
(1294, 285, 'Erica Myers', 'https://www.google.com/maps/contrib/109500048932028283606/reviews', 'en', 'https://lh6.googleusercontent.com/-pI3DJHlu758/AAAAAAAAAAI/AAAAAAAABpE/e-st8SYXvwg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'the understand what you\'re there for what you need everyone is very nice professional but also make you feel comfortable I would recommend to anyone seeking this sort of helpthe doctors and counselors are amazing they don\'t pressure you they ask you what you want and what you think you need and they try to work with youto accomplish those goals', 1438177215),
(1295, 286, 'Jennifer Parker', 'https://www.google.com/maps/contrib/109338032921503147902/reviews', 'en', 'https://lh5.googleusercontent.com/-nj8euEkneX4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq13_w3fd9-XdwyFrPp2B8kBiF9aVA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Amazing staff! They are all very helpful, caring, compassionate, personable and the atmosphere is great. I would recommend them to anyone. 10 out of 10!', 1526067293),
(1296, 286, 'Cynthia Rosen', 'https://www.google.com/maps/contrib/108197260652711407549/reviews', 'en', 'https://lh3.googleusercontent.com/-EcJllipny7s/AAAAAAAAAAI/AAAAAAAABfk/fCRaVF6zyRo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'While the office staff is professional and supportive, the quality of care by the providers has been supreme and applied expertise consistently appropriate. Dr. Saad has been invaluable to us. I am so grateful to have you people in our court. Thank you.', 1522414434),
(1297, 286, 'Karen Gallagher', 'https://www.google.com/maps/contrib/110672604619917238669/reviews', 'en', 'https://lh3.googleusercontent.com/-8p2VjqOuV6U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0kxQO9HEMG9W3geGZke7W9yn_Gxg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'Such a great place to go dr. sulak actually cares! I\'ve been going there for 6 years and wouldn\'t go anywhere else. Quality Healthcare a supportive staff make it a pleasure to go see the doctor.', 1525437742),
(1298, 286, 'Kelly Malynn Bean', 'https://www.google.com/maps/contrib/104980445359340208893/reviews', 'en', 'https://lh3.googleusercontent.com/-YfhTLA0ejgM/AAAAAAAAAAI/AAAAAAAAAWY/AA5Gr0HUFLE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 months ago', 'Finally a healthcare office where I have felt completely heard, always have my needs met, and leave pain-free!', 1519820294),
(1299, 286, 'K Rae Hunter', 'https://www.google.com/maps/contrib/112578791238754013129/reviews', 'en', 'https://lh3.googleusercontent.com/-wF1Du0TNOEY/AAAAAAAAAAI/AAAAAAAAAdI/DvXxcA0WJXw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Friendly, courteous, answer all my questions, great services.', 1521286367),
(1300, 287, 'M B', 'https://www.google.com/maps/contrib/101791896605828366008/reviews', 'en', 'https://lh3.googleusercontent.com/-hK8J30IRKrc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0-oI-r7QS1Lya0XA9Wv3lolw44mw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Very pleasant staff. Comfortable environment. Dr. Wah is quite personable and offered abundant information. We discussed all relevant issues, and he provided a detailed plan for me. I felt extremely comfortable during the whole experience. I highly recommend this facility.', 1527007140),
(1301, 287, 'Ann Colmus', 'https://www.google.com/maps/contrib/101503463205161630910/reviews', 'en', 'https://lh6.googleusercontent.com/-hIY1o-hlU3s/AAAAAAAAAAI/AAAAAAAAClY/NzyRt4qvcYo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Very nice office, very clean. Secretary top notch and very helpful.   Physician answered all my questions and evaluated all my medical documentation. Yes, the office was a real medical office just like your primary care physician. I would highly rate this office for your required medical examination. I was seen on time and all my questions were answered.', 1522087662),
(1302, 287, 'pviper101112', 'https://www.google.com/maps/contrib/113297906904375922720/reviews', 'en', 'https://lh6.googleusercontent.com/-gutkOj9bcfI/AAAAAAAAAAI/AAAAAAAAACw/2vtYp3bKBsg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I saw Jon Wah for my Recertification. Great doctor. Gave great advice. See you next year!', 1526668736),
(1303, 287, 'Blu Mi\'yu', 'https://www.google.com/maps/contrib/105557588511888922895/reviews', 'en', 'https://lh6.googleusercontent.com/-Q9dBA3v8xvU/AAAAAAAAAAI/AAAAAAAAAO0/AYKHTauL-BY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'The receptionist was very nice and Doctor Wah was very knowledgable, friendly, and helpful. Thanks for helping me figure out the right medical cannabis for me.', 1527111932),
(1304, 287, 'Marlon Jordan', 'https://www.google.com/maps/contrib/108253931457593778482/reviews', 'en', 'https://lh4.googleusercontent.com/-86qN3ls-3OM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0fW26wC2tuf4e8wfelEueae9amkg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Quick and easy if you have your stuff together.  Great location, clean professional facilities. Glad I went..', 1524356382),
(1305, 288, 'maxwell schulbaum', 'https://www.google.com/maps/contrib/111511181389648175846/reviews', 'en', 'https://lh5.googleusercontent.com/-1V1dTRBYONo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq34AEg7hzJG2zVR4V24aG4KbBpXdw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This is one of the best dispensaries I have ever been to! I have been to dispensaries all over the country and none have the large menu, excellent quality and knowledgeable and caring staff! This is a family business and you can really tell by the overall happy and loving atmosphere that is exuded by the family and employees. This is not just an orodiary dispensary but an experience as well.', 1524623383),
(1306, 288, 'J. Gray', 'https://www.google.com/maps/contrib/118403799537679031413/reviews', 'en', 'https://lh4.googleusercontent.com/-tYrWkTF5XmA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2flgESaCzK00EkVYBW5Tx7HqgWkg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I\'ve been with Takoma Wellness from the beginning, and it\'s been a pleasure to watch them grow and flourish. I can\'t imagine a more compassionate, knowledgeable, and welcoming extended family. The nurturing environment is complimented by top-drawer selection, certain to comfort medical users across the spectrum. Highly recommended.', 1510684009),
(1307, 288, 'Spencer Thompson', 'https://www.google.com/maps/contrib/108764367793765627882/reviews', 'en', 'https://lh5.googleusercontent.com/-p3ekh34imYU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1hSNshQE-96iYsI7KgnANpSObyxg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'This has been my dispensary for as long as I\'ve been a member of the DC MMJ program and I\'ve never considered going anywhere else. The staff here treats you like family and tailors your care to your needs. In the three years I\'ve been coming I\'ve seen them never stop working to make improvements to their shop, their selection and their prices. TWC is wonderful and you shouldn\'t even begin to consider going anywhere else!', 1515779155),
(1308, 288, 'Jajuan Hill', 'https://www.google.com/maps/contrib/102786405028243274593/reviews', 'en', 'https://lh6.googleusercontent.com/-NbiWetg3Bw0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0-smm383YP5-lLs73Dd_FxCd7b4A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I went to see Dr Patrick Fausi last month and I went to Takoma Wellness last week. They are like family. Can\'t wait to try some medical marijuana.', 1520136618),
(1309, 288, 'Brian Fleming', 'https://www.google.com/maps/contrib/106807172678494698482/reviews', 'en', 'https://lh6.googleusercontent.com/-0amPyjCp-uw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1dfoc97t78ei3NvFeOHBXW2gtSjA/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '6 months ago', 'The Takoma Wellness Center is a wonderful place ! They are very helpful and knowledgeable , always making you feel at home and comfortable. I particularly enjoy being waited on by Daryl at the counter, he is a great guy and very helpful. Overall a very good experience!', 1510344693),
(1310, 289, 'Bee B.', 'https://www.google.com/maps/contrib/109045710899580379873/reviews', 'en', 'https://lh6.googleusercontent.com/-oUl2CZH2gh8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1_Ywliz4jBZFk8KscbUn38qirGOw/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 weeks ago', 'Everyone here from the call center to the receptionist to the doctor is helpful, friendly, and knowledgeable. I actually felt listened to and heard by the doctor. All of my questions were answered and I was put at ease the second I walked in the door. The practice is clean, has plenty of seating in the waiting room, and was stocked with information. If you have been on the nervous about using MM, I strongly suggest that you give their office a call and they can help guide you through the process.', 1525360558),
(1311, 289, 'Greg Englar', 'https://www.google.com/maps/contrib/108457792135557903599/reviews', 'en', 'https://lh6.googleusercontent.com/-5WdJ4ML3PS8/AAAAAAAAAAI/AAAAAAAAARQ/91eEXyuD2GM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This place is ran better than almost all other Doctor\'s offices I have ever been to. Incredibly knowledgeable staff that make the process easy.', 1523570032),
(1312, 289, 'Kristina Trent', 'https://www.google.com/maps/contrib/107645491660229353704/reviews', 'en', 'https://lh6.googleusercontent.com/-RRKbgq7z4s4/AAAAAAAAAAI/AAAAAAAAADE/Ht-l10p_2Tg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Incredibly helpful, knowledgable, empathetic, and kind staff!  The wait was minimal and I still cannot get over the friendly and helpful staff members!!!  The facility was neat, welcoming, and easy to locate.  Thank you, Green Health Docs!  You are awesome!', 1515867204),
(1313, 289, 'Richard Pfistner', 'https://www.google.com/maps/contrib/102283444994049702925/reviews', 'en', 'https://lh4.googleusercontent.com/-zTfuwoTa4b0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Bw7Qy_cY56Sw0YOGfBtq-FqHXbw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Great help in guiding me through the process of qualifying for medical marijuana. The staff is knowledgeable as well as friendly. I would recommend Green Health based on my experience.', 1515178483),
(1314, 289, 'Cindy Gass', 'https://www.google.com/maps/contrib/104424341783805263777/reviews', 'en', 'https://lh3.googleusercontent.com/-jK7nKtq9PdM/AAAAAAAAAAI/AAAAAAAAFEs/yHRAr4FVlg0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Just got here everyone is so nice. I can\'t wait till they call my name. I can only imagine how nice it will be when i meet the Dr. It\'s easy to review when everyone out front is sweet. Have a great day.... Cindy gass', 1510414239),
(1315, 290, 'Steven Bishop', 'https://www.google.com/maps/contrib/114858275255992929199/reviews', 'en', 'https://lh4.googleusercontent.com/-nv9xGMkCJt4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2qKiQtr0jrShw3AnipHDUAYAlJsw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Wow, I was so amazed on there knowledge and there customer service was beyond words. I told them what I was after as in a good day time bud and a good night time bud and all products they recommended I bought and there all very amazing. They just gained a Hancock Maryland boy  as a constant customer the hour and twenty minute drive is no problem at all. See you guys soon.', 1527261471),
(1316, 290, 'Emily Nash', 'https://www.google.com/maps/contrib/117713915201804517007/reviews', 'en', 'https://lh4.googleusercontent.com/-0xsx_Hjtu3s/AAAAAAAAAAI/AAAAAAAAGTk/tqTQtsjcg0E/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'So happy I took the almost 2 hour trip here.. this place was absolutely WONDERFUL. The staff is so friendly and very helpful. They definitely know how to educate someone who knows so little on Cannabis. Definitely very happy with my first visit :)', 1526311304),
(1317, 290, 'Keith Bress', 'https://www.google.com/maps/contrib/117413614653367367478/reviews', 'en', 'https://lh6.googleusercontent.com/-dwm5EVtwFx8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq09LB2GZsPDuFfBF3v3kkpXtVzmmQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'This place is nothing less of AMAZING & the budtenders couldn’t get any better!! Will is my guy, the rest of the crew is super dope as well, full of knowledge and wonderful customer care. The product is top shelf!! I can’t say enough about that so I don’t wanna spoil it for you. Just take my word & stop by that joint! You will NOT be disappointed ', 1525793109),
(1318, 290, 'Pascale Fox', 'https://www.google.com/maps/contrib/115942621547932193391/reviews', 'en', 'https://lh6.googleusercontent.com/-0Mn5Zf1y5Wo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1n7u_pancn7pGW8lA9zctgfiX3yg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I was a little nervous to go buy Cannabis in Maryland because it is so new, but right when I walked in I was immediately greeted by 2 very friendly, and professional staff members. They talked me through the process, since I told them I was a new patient, then I walked to the back room. Honestly the first thing I thought of was how well it was decorated. I felt very welcomed and was immediately assisted. The menu is also available online so I knew what I wanted right away. And if you are new to using any of the products, the staff all seemed very knowledgeable of all the products offered and would explain their experience to you. Overall I had a GREAT experience, was in and out within 10 minutes, and was very satisfied with my purchases.', 1522451346),
(1319, 290, 'Rosary Bovello', 'https://www.google.com/maps/contrib/117668800187326299673/reviews', 'en', 'https://lh6.googleusercontent.com/-iKYfB-pX8kA/AAAAAAAAAAI/AAAAAAAAABk/D3E_Cu8iaaM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Just the best experience. I sampled other dispensaries but after Bloom, there’s no reason to shop elsewhere. Knowledgeable staff, friendly and eager to help me find the best solutions to help my pain and insomnia. Great ambiance, great displays, lots of choices. Vicky has guided me about making edibles. I basically knew nothing, but I’m getting there. Thanks for the guidance!', 1526151684),
(1320, 291, 'Daniel Choe', 'https://www.google.com/maps/contrib/103223602521550871396/reviews', 'en', 'https://lh5.googleusercontent.com/-_jC7AUrzwrg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1bPGTr8b4quPdoFS5pNueRJgdCzw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'These guys are awesome. So excited to get my medicine from Maryland dispensaries once they open. Thanks again. \n\nBtw, Warren was fantastic. Gonna tell all my friends about yall.', 1501908288),
(1321, 291, 'Natalie Mazzei', 'https://www.google.com/maps/contrib/116816923962318046201/reviews', 'en', 'https://lh4.googleusercontent.com/-iS6l8BGCTJQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2b9UdbLRKRjE8GUfQf7vc_hz4_4A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'If you dont go with MetroXMD your missing out. Their process is safe and simple and I love what their doing. Soooo awesome.', 1503254544),
(1322, 291, 'Sally Sue', 'https://www.google.com/maps/contrib/105966795799161438575/reviews', 'en', 'https://lh6.googleusercontent.com/-pfxbfcu6OrY/AAAAAAAAAAI/AAAAAAAAAAc/XyHuJES_gQI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'Awesome service and great team! The doc was super nice and definitely helpful. I was able to use my recc in Vegas. Thanks again MetroX!!!', 1497222660);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(1323, 291, 'Lei Ouyang', 'https://www.google.com/maps/contrib/106671125087336786177/reviews', 'en', 'https://lh6.googleusercontent.com/-fzTCZ1dgyzY/AAAAAAAAAAI/AAAAAAAAAgE/vZifwbf8Rvw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', ' Great service and much appreciated. Before applying the MetroXMD program I had many consideration for I am an Asian Deaf person. Would I be discriminated? Would I be teased or treated like a sub-classed citizen? However, none of these worries did happen to me. My consultant Warren was very friendly, enthusiastic and helpful. The best part was he always answering my texts quickly and containing as much details as possible. The team made the process so smooth and with least pressure.', 1471296791),
(1324, 291, 'Akam Ahmedi', 'https://www.google.com/maps/contrib/114910242741950737508/reviews', 'en', 'https://lh3.googleusercontent.com/-3Y1nKIZG6Lg/AAAAAAAAAAI/AAAAAAAAACE/xGB4pPZhWTc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Quick & Easy. Highly Recommend if you need a Medical Card!', 1501188905),
(1325, 292, 'pete sommerfeldt', 'https://www.google.com/maps/contrib/114263629822757603298/reviews', 'en', 'https://lh3.googleusercontent.com/-1blOyswIcFA/AAAAAAAAAAI/AAAAAAAAK0g/RbkzNr0fNzo/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'in the last week', 'Definitely recommend. Dr. Weng and his staff are professional and friendly. The waiting room with coffee and tea maker was a nice bonus. Walked me thru the entire process, thank you!', 1527279770),
(1326, 292, 'Lee Sussman', 'https://www.google.com/maps/contrib/114388255662214974811/reviews', 'en', 'https://lh3.googleusercontent.com/-hjoVhdRV7nw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0j_BqL1V-sM2bZU0Ez9ZoGcRqy2w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Dr. Weng is excellent and has the patient\'s best interest in mind. He takes his work very seriously and is a great person to work with.', 1516477633),
(1327, 292, 'Tom Askey', 'https://www.google.com/maps/contrib/109754633297021049061/reviews', 'en', 'https://lh4.googleusercontent.com/-9VZR8k-Jok4/AAAAAAAAAAI/AAAAAAAAABE/n8c420UlZn8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Wonderful staff. Dr. Weng was knowledgeable, interested and compassionate. Could not recommend him more.', 1512586287),
(1328, 292, 'Sharon Collins', 'https://www.google.com/maps/contrib/109863188776936933911/reviews', 'en', 'https://lh6.googleusercontent.com/-760dr48jssI/AAAAAAAAAAI/AAAAAAAAAG0/_x2W6_6Azt0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'From the staff the doctor, they treated me with dignity.  I am chronic pain patient with multiple spine surgeries and a rare form of spina bifida and scoliosis.  With the help I have been able to do more and have some relief from the nausea and back spasms.  Thank you.', 1511557319),
(1329, 292, 'Timothy Reilly', 'https://www.google.com/maps/contrib/113876897450558222738/reviews', 'en', 'https://lh6.googleusercontent.com/-cX0h7TATuOE/AAAAAAAAAAI/AAAAAAAAEvU/FCZWzwyvbaA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Office staff was helpful and courteous. Dr. Weng is great, he is very knowledgeable of treatments and products. He answered all my questions and got me what I needed.', 1508356961),
(1330, 294, 'Timothy Reilly', 'https://www.google.com/maps/contrib/113876897450558222738/reviews', 'en', 'https://lh6.googleusercontent.com/-cX0h7TATuOE/AAAAAAAAAAI/AAAAAAAAEvU/FCZWzwyvbaA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This place is great! Friendly, knowledgeable staff. Great selection and prices. Easy to get to, much better than some other dispensary.', 1521648933),
(1331, 294, 'DJ DPA', 'https://www.google.com/maps/contrib/104814626596522641484/reviews', 'en', 'https://lh3.googleusercontent.com/-ynlQyoMgflk/AAAAAAAAAAI/AAAAAAAAADM/smkHO4Vlnhw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great Staff, Great Product and Sales!  If you\'re in the area, check out NCW! As a Chronic pain sufferer, I can truly say they have some of the best medicine to help relieve my pain.', 1523549202),
(1332, 294, 'Bill Kerr', 'https://www.google.com/maps/contrib/102903165933305566520/reviews', 'en', 'https://lh3.googleusercontent.com/-7PEsCYzTYvc/AAAAAAAAAAI/AAAAAAAAAA0/c51YBWqP-to/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'The whole experience was top-notch! The staff was very helpful, informative and compassionate. They listened to all of my questions and answered them as best as i could ever asked. I highly recommend any patients looking for a better quality of life to consider NCW for all your medical marijuana needs.', 1516846119),
(1333, 294, 'Michael Trimble', 'https://www.google.com/maps/contrib/104651865038612605503/reviews', 'en', 'https://lh3.googleusercontent.com/-Suy4BKg6Jfg/AAAAAAAAAAI/AAAAAAAAAIg/RC16RmXKSYE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'This place was amazing! Very knowledgeable, very professional! I will be recommending this place to everyone, and returning for all my future needs. Great experience!', 1518122258),
(1334, 294, 'Marine PSU', 'https://www.google.com/maps/contrib/109144403129820869224/reviews', 'en', 'https://lh4.googleusercontent.com/-2iQtaXjo6Sg/AAAAAAAAAAI/AAAAAAAAAAA/PgTWL90J9OE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Excellent, knowledgeable and professional staff. Great selection, from glass to vapes, and tincture, concentrates, and a wide selection of dry flower which grows daily. If you are new to medical cannabis, then stop on in and they will be more than happy to help. I\'m a disabled Marine, who went from 16 meds, to 2. Thank you so much NCW!', 1521491727),
(1335, 295, 'Michael Rohrs', 'https://www.google.com/maps/contrib/103235416664432710512/reviews', 'en', 'https://lh6.googleusercontent.com/-_bTHyImRSfk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2NS9KuGxqZbLbRF8F88MllWKNK2A/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '7 months ago', 'First to those  Complaining about medical cannabis be held back it\'s by no doing of this business. There not open yet and till state gets everything straight it\'s not on them. I personally called them spoke with  Brandon was very polite and didn\'t blow smoke up my a** straight up told me they don\'t expect to open till ist quarter of next year. I called others they tell you few weeks month time passes and get same run around. Furthermore who cares where he lives or is from. May understand if was like liquor stores one every corner it seems saying you won\'t shop there well enjoy your trip there only 12 scheduled to open (2 may not of 12 since schools own land within the no go zone even though school has no plans of developing it and at best it would be an after school sports field maybe ten yrs down road according to the school) also if there not open how can a race card be used assuming there African American the law passing said there had to be diversity and only white people had gotten approved. And the you people comment use shows how  Ignorant the person to post that is. But there only one open in state and been sold out for months. So when they actually open and can go there i be happy to give 5* give 5* If there as polite and nice as people on the phone and of course prices are fair for the quality you chose to get.', 1507584241),
(1336, 295, 'Mark Sutherland', 'https://www.google.com/maps/contrib/113727783727883879315/reviews', 'en', 'https://lh6.googleusercontent.com/-XP9l2Njj7-M/AAAAAAAAAAI/AAAAAAAAJWM/lWfG5s9buTM/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, '11 months ago', 'Any company that denies and delays licenses and medicine for patient access due to legal issues with the commission clearly lacks the vital understanding of the \"patient first\" ethical  standards that ideally drive the health and wellness industry. Shameful.', 1497809194),
(1337, 295, 'Michael Johnson', 'https://www.google.com/maps/contrib/112967300926917400370/reviews', 'en', 'https://lh6.googleusercontent.com/-4QAYKqWfs4o/AAAAAAAAAAI/AAAAAAAAAdE/y2I6d39I1fQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '6 months ago', 'Terrible that they are holding up the process because they didn’t get what they wanted!', 1509918710),
(1338, 295, 'Tobey Garner', 'https://www.google.com/maps/contrib/103824177516920012283/reviews', 'en', 'https://lh6.googleusercontent.com/-JYWs2pvz7nw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq36tQOuo0Q5JC7tHEYbSl7aYeLyuw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '9 months ago', 'These people don\'t care about the patients needing this medication. To hold up an entire states medical marijuana industry because you didn\'t get something you wanted shows exactly why you\'re in this field $$$$$$$$$$$.', 1502585762),
(1339, 295, 'Christopher Gray', 'https://www.google.com/maps/contrib/102531790296551192039/reviews', 'en', 'https://lh3.googleusercontent.com/-zFFyz1c2nOQ/AAAAAAAAAAI/AAAAAAAABrM/slCdNce1rBs/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '3 months ago', '', 1519908838),
(1340, 296, 'R M', 'https://www.google.com/maps/contrib/102374718149247609084/reviews', 'en', 'https://lh4.googleusercontent.com/-gCAGI8vyA4k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3uM2KYh9jGy_5DfeZ12oa9jd1VwQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Overall the experience was very good. The staff are helpful, knowledgeable, and able to answer medical questions plus explain Maryland State laws. The process is relatively quick. I would encourage others to try out Canna Care Docs.', 1517950581),
(1341, 296, 'Rob tyndale', 'https://www.google.com/maps/contrib/103654100760927917192/reviews', 'en', 'https://lh3.googleusercontent.com/-9L7tyOk5g3o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0rXUSR1WSWTUIn1qjmcwzS5-T9fg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Came for the grand opening on Powell Ave. Great staff. Very friendly and helpful. Erica was extra nice.', 1522426166),
(1342, 296, 'droddt2000', 'https://www.google.com/maps/contrib/112348442146519778852/reviews', 'en', 'https://lh5.googleusercontent.com/--ZavurBKMZc/AAAAAAAAAAI/AAAAAAAAAC4/kPYrofVmNTE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Everyone there was so helpful and professional. They even helped me to get a copy of my VA medical records as well; which is a huge deal. Top notch service and professionalism. I can\'t recommend them highly enough. Certainly Veteran friendly as well.', 1515516207),
(1343, 296, 'Judith Davis', 'https://www.google.com/maps/contrib/108520362240052340208/reviews', 'en', 'https://lh5.googleusercontent.com/-bDOTc7Oz3H4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2L9Nh_s5Xpuavq5ySa1RY91IWrhg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'The staff was very helpful and knowledgeable about the entire program, how to get registered, what documents to bring etc from start to finish.  I would definitely recommend utilizing the services of this location.  Very professional but also nice and friendly.', 1515553757),
(1344, 296, 'sidra kirnon', 'https://www.google.com/maps/contrib/117895112200658459375/reviews', 'en', 'https://lh6.googleusercontent.com/-A3kl9m8FCEE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0TUWXAmKC7VS863JTUQ6AOwgbGOw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Amazing attention to the client/patient. Very knowledgeable, professional & pleasant! Enjoyed my visit immensely!', 1518532048),
(1345, 297, 'Monica Jones', 'https://www.google.com/maps/contrib/100701770583173982112/reviews', 'en', 'https://lh4.googleusercontent.com/-7XijHG6tohk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3IJ57weLJmdqq44QkJe3qC8hjCSA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'In the last 3 years I have been diagnosed with 2 auto immune diseases.  It is not unusual for many people that have 1 auto immune disease to be diagnosed with others during their life time.  Both diseases cause chronic pain and the medications for disease maintenance are heavy-duty but do not always control pain.  I did an online search for some alternative medications and found Dr. Frye.  After my initial visit with Dr. Frye I am using Cannabis Salve, CBD Oil or Hemp H20 and my pain level is much more manageable!  Thank you Dr. Frye and Tamika for your professionalism and excellent service!', 1509572289),
(1346, 297, 'Mollee McWhorter', 'https://www.google.com/maps/contrib/104589221151396374933/reviews', 'en', 'https://lh6.googleusercontent.com/-C6WBbPeHCKU/AAAAAAAAAAI/AAAAAAAAACc/Ac0TWkTQ6jA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I first saw Dr. Frye on July 20, 2016 and was prescribed CannaBiDiol oil, also known as CBD oil, for mood stabilization.  I have been going down off of pharmaceutical drugs for Bipolar Disorder, Anxiety, and ADHD, all of which I have been diagnosed with and all of which the CBD oil is effectively treating.  I was on 2 medications along with 30 mg more than the average dose of Buspirone for anxiety, totalling 90 mg, and still felt the physical sensation that comes with anxiety. I am a professional musician so I had anxiety with performance as well.  I am now off of the Buspirone and the CBD oil has taken away all of the physical feeling of anxiety unless it is near time for a dose of CBD oil. Even then, when I take the dose the anxiety disappears within minutes. I am now performing on my own without a family member there in support because of the lack of anxiety.  My friends have noticed and mentioned my moods are even and stable and my concentration on daily tasks is much longer than before the CannaBiDiol oil. The last 15 years of my life have been plagued by the pharmaceutical industry, however, now I can say that medical marijuana, CBD oil, are changing my life for the better!! I highly recommend making an appointment with Dr. Frye to discuss how CBD oil can change your life for the better as well!!!  Thank you, Dr. Frye!!!', 1477521175),
(1347, 297, 'Mike Bell', 'https://www.google.com/maps/contrib/101789412358795395315/reviews', 'en', 'https://lh5.googleusercontent.com/-Dvr8Lcj3aeU/AAAAAAAAAAI/AAAAAAAAACw/ft-3QOJrXGk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I am so glad to have Dr. Frye as my physician. She is extremely knowledgeable &  easy to talk to.', 1468430446),
(1348, 297, 'miles frazier', 'https://www.google.com/maps/contrib/105237138377426333583/reviews', 'en', 'https://lh3.googleusercontent.com/-ktNgPO9TqOY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0_LrFmP0RGh44Fx3RIicaIB002Pg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'great customer service. very caring and knowledgable.', 1475159624),
(1349, 297, 'Orlando Rodriguez', 'https://www.google.com/maps/contrib/114157110140537126336/reviews', 'en', 'https://lh5.googleusercontent.com/-uhF6RIsDquw/AAAAAAAAAAI/AAAAAAAAAoo/zS4eTTzkhEg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Very informative', 1474289204),
(1350, 298, 'Leslie', 'https://www.google.com/maps/contrib/109392145600989251328/reviews', 'en', 'https://lh4.googleusercontent.com/-LEHMTLCiSZM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Q42pjZ5aSFIux4iwrHjH9IxrYNw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I am glad I called them and get educated on how to get my medical card. The lady on the phone explained to me the process in a detailed manner and told me what I need to do and the medical records that I need to bring. They are so helpful. It\'s a bit tricky to find their location with all those tall buildings though but they are really excellent.', 1521131021),
(1351, 298, 'cancerwarrior20', 'https://www.google.com/maps/contrib/111313979951237639804/reviews', 'en', 'https://lh5.googleusercontent.com/-k0z6vbPXQng/AAAAAAAAAAI/AAAAAAAAAAc/2RTh1uFEIPk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Their medical team makes you feel at ease as soon as you arrive. There was a bit of a wait so I suggest you make the appointment sooner. They are kind enough to accommodate me for an appointment even if I called the day before. The nurse practitioner was very accommodating and took her time with me to answer all my questions. The amazing view of their location is a plus! You would not mind waiting on the line while seeing the view.', 1515427302),
(1352, 298, 'Ashley Fletcher', 'https://www.google.com/maps/contrib/107712114253375925513/reviews', 'en', 'https://lh6.googleusercontent.com/-HUd674bjf4E/AAAAAAAAAAI/AAAAAAAAAAc/8T8xMcyTk_k/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Finally got approved for the medical cannabis program. They helped me request for my medical records from my pain doctor. The consultation is quick and easy. It\'s a plus that they have free parking area.', 1524105823),
(1353, 298, 'Robert Snow', 'https://www.google.com/maps/contrib/115017899119307601154/reviews', 'en', 'https://lh3.googleusercontent.com/-tS2yGDwqTnM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq11rhLxXiSX9RaPGK4jQ3WrtIkrdw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Called their medical cannabis clinic to see if my condition can be approved. The lady on the phone was very helpful and asked me several questions to make sure I can be certified and I met all requirements before I come for an actual appointment. I don\'t regret choosing them to help me. I\'ll see them after a year for my renewal.', 1517243032),
(1354, 298, 'Brandon Jones', 'https://www.google.com/maps/contrib/101702720959098939478/reviews', 'en', 'https://lh5.googleusercontent.com/-XZkVjzMLzj0/AAAAAAAAAAI/AAAAAAAAAA8/Hh7QI4SwabM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I got my marijuana approval same day. i booked my appointment after I received my MMCC number which a day before the appointment and they made sure I will have what they need on my appointment.  I have to wait for 30 mins before I was seen but I have no complains as I am glad they still took me in last minute. They also gave me some dispensaries in the area which I can go to.', 1520354024),
(1355, 299, 'Billy Inscoe', 'https://www.google.com/maps/contrib/101807771470214996900/reviews', 'en', 'https://lh4.googleusercontent.com/-OVgIReDqjC4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1WVef8wWcCP7j6cwmTLA_2ZlzRbQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'This location in Annapolis is horrible.\nNo receptionist so there is no help walking in the door just fend for yourself and figure it out. I had an appointment set for 1:50pm and arrived at 1:30pm. I signed in paid and proceeded to wait.... After 2 hours of waiting and watching others come in after me and get seen before me I decided to ask for a refund and seek a more organized doctors office. Given the abundant selections of doctor\'s available now there is no reason to seek help from this specific location unless you are local to Annapolis.', 1524771761),
(1356, 299, 'Lori B.', 'https://www.google.com/maps/contrib/109053602406017392215/reviews', 'en', 'https://lh4.googleusercontent.com/-McKPIn55k4A/AAAAAAAAAAI/AAAAAAAAF7Q/JiFMqcZGSnU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'I didn’t pay the $200 fee until I saw the doctor.  If you’re not approved, you don’t pay.  I was in and out within 15 minutes.  It is a little confusing on which office door to go to for Greenway Consultants but that’s the design of the building.  The office staff and doctor are fast, friendly and helpful.  Let’s not forget, this is all new to Maryland residents as well as the Consultants, dispensaries etc.  Give these establishments a break if something doesn’t go smoothly.  We’re all new at this.  I would definitely recommend Greenway Consultants.', 1526297216),
(1357, 299, 'Tony Rogers', 'https://www.google.com/maps/contrib/102227467250294161272/reviews', 'en', 'https://lh5.googleusercontent.com/-sWK7e19irQA/AAAAAAAAAAI/AAAAAAAAK4k/L6nJNrtW_F4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Quick Easy Painless. Get their early it gets packed but the DR. moves fast', 1514414344),
(1358, 299, 'Raymond Muhlert', 'https://www.google.com/maps/contrib/106250615561007262796/reviews', 'en', 'https://lh6.googleusercontent.com/-8T3a5axaWV0/AAAAAAAAAAI/AAAAAAAAACc/pUywSXTyyl4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Very professional, extremely helpful, you cant go wrong with Green Way...', 1514937325),
(1359, 299, 'Tommy Richardson', 'https://www.google.com/maps/contrib/105313590673531619878/reviews', 'en', 'https://lh4.googleusercontent.com/-jSENafHAmXE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2X5zr0d3ggohgSfVkgOQGJYqUVgQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '10 months ago', 'So far they have kept me updated on everything ', 1499326957),
(1360, 300, 'Joanna DeBaugh', 'https://www.google.com/maps/contrib/109294930240907618740/reviews', 'en', 'https://lh3.googleusercontent.com/-xhUseJbZc5Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0C0Ioh3KO2fLYqOtvfYTAEZ9ugWQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I went to the dispensary yesterday and was greeted by the friendly staff as usual. Just in casual converstion I mentioned I had been hospitalized over the last few days . When I went to make a purchase, I asked if they still had some specials running for a certain product and I was told they were not. Without hesitation, the staff asked me to wait a moment to see what they could do. They graciously gave me the special I had asked about (saving me $$$) because I was in the hospital! How amazing is that?! The staff is always very helpful, kind and compassionate to me every single visit. I never feel uncomfortable and the personalized experience I have can\'t be beat! Thank you Wellness Solutions!', 1524655868),
(1361, 300, 'Val E.', 'https://www.google.com/maps/contrib/101462854856738394540/reviews', 'en', 'https://lh3.googleusercontent.com/-iYmZl1mQBFM/AAAAAAAAAAI/AAAAAAAAAEw/r4LG6SzPDF0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I went in for the first time in mid February 2018. I had a good experience. Yes, I had to have a quick consultation that maybe lasted 5 minutes. It was pretty casual because I already know what I want and need. They said that was required for the first purchase at the dispensary, but you don\'t have to bother after that unless you have questions. I wasn\'t charged anything extra for that consultation. Everyone seemed pretty nice and helpful. The security guard was friendly. I went right when they opened in the middle of the work week. It wasn\'t crowded.\n\nThe prices seemed a little high and the selection was still limited, but they said that on their website. The production in Maryland is still catching up to the demand as everything FINALLY comes online. It was still far better than all the typical nonsense of trying to buy off the street, for the same or more money, and not having all the quality assurances.', 1518548860),
(1362, 300, 'Roy Jaquez', 'https://www.google.com/maps/contrib/114767298709117180877/reviews', 'en', 'https://lh6.googleusercontent.com/-DFynHRkfti4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3wN2Y6BeBjKd0k5WwCJX-BjGutBA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Phenomenal staff, from the front desk, through purchase.  The time they take to ensure you get what you need, reviewing in depth your treatment plan and discussing products from a position true knowledge of their product.  It even came with this awesome smell-resistant and childproof bag.  Highly recommend visiting this dispensary.', 1522429392),
(1363, 300, 'Gretchen Lane', 'https://www.google.com/maps/contrib/116903950082913162841/reviews', 'en', 'https://lh4.googleusercontent.com/-TiP8bA21VDc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0G2ITM1PrSOdbn_tGCkzdBtHb1Yg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'The staff here is amazing for starters. Compassionate care, support, and assistance with the whole process. Prices seem to be in line with other dispensaries in Maryland plus they deliver!!! I am beyond satisfied with EVERYTHING. Even the location makes it convenient and feel safe coming here. 5 stars! This place is great!!!', 1515784086),
(1364, 300, 'john rutledge', 'https://www.google.com/maps/contrib/107522727395848100073/reviews', 'en', 'https://lh3.googleusercontent.com/-HBOu_2bcU8o/AAAAAAAAAAI/AAAAAAAMyF8/MiPKyMUvjNs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Professional Pioneers , making Frederick stand tall. Everything about this place makes me smile. Staff is competent, efficient, polite & knowledgable. Products are amazing, considering third generation grows. Selection is wide open, with many deliciously strong cures.Prices good for A1 produce. Favorite place to shop, for a goodnight sleep.', 1523499487),
(1365, 301, 'FeFeline KandyGem', 'https://www.google.com/maps/contrib/112691196385378402736/reviews', 'en', 'https://lh4.googleusercontent.com/-6Q1gauHmA4c/AAAAAAAAAAI/AAAAAAAAABE/gBjNiLSMKSo/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'They never followed through despite many emails... I’ve spoken to Jaelen & Matthew M 3 times. They claimed each time they needed my registration number which I sent each time in bold font so it was easy to find and read.  Nope still not registered. I feel I was scammed. I would never recommend them to anyone.', 1526029171),
(1366, 301, 'airsoftology 101', 'https://www.google.com/maps/contrib/100368108942018874657/reviews', 'en', 'https://lh3.googleusercontent.com/-zp4PXe8QK-c/AAAAAAAAAAI/AAAAAAAADSM/VmsX8V1FAQY/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'Man this place dont exist. I drove around for hours. And had an appointment! Soo why are you guys hiding so well if you want buisness soo bad? Im about to do some bbb investigations on this place believe that!', 1525538770),
(1367, 301, 'Hemptress LLC', 'https://www.google.com/maps/contrib/110278405092057701258/reviews', 'en', 'https://lh6.googleusercontent.com/-ukFOjY8HQaE/AAAAAAAAAAI/AAAAAAAABgE/q1gH9Alun5k/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I\'ve know the people at MyCannX for several years. They consistently go above and beyond for their clients. MyCannX is truly unique in this industry. Compassionate, caring and knowledgeable. I highly recommend!!', 1517252858),
(1368, 301, 'Emily Nash', 'https://www.google.com/maps/contrib/117713915201804517007/reviews', 'en', 'https://lh4.googleusercontent.com/-0xsx_Hjtu3s/AAAAAAAAAAI/AAAAAAAAGTk/tqTQtsjcg0E/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'This place does not exist. I had a 5 pm appointment last week and Literally drove around Columbia for 2 hours and when you call them they can’t even explain to you where the building is located. Finally after they gave me 2 different address and I still could not locate them.. I must have called 20 times and no one ever got back to me.', 1526311099),
(1369, 301, 'Justin Murray', 'https://www.google.com/maps/contrib/117589769126046456181/reviews', 'en', 'https://lh6.googleusercontent.com/-RAFdwUGLqcY/AAAAAAAAAAI/AAAAAAAAJ9Y/Y6vEOVIDfro/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'Get your Maryland cannabis cards here, they are appointment only, so call or make an appointment. They have the best doctors in Baltimore and many other areas of MD.', 1515194109),
(1370, 302, 'Andrew Braswell', 'https://www.google.com/maps/contrib/108923697654006974183/reviews', 'en', 'https://lh3.googleusercontent.com/-zznDuPDsi-0/AAAAAAAAAAI/AAAAAAAAAlQ/Rlmi2WOTFCM/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Very Knowledgeable, professional, and friendly. Great selection and great quality, you definitely pay for it though.', 1523034673),
(1371, 302, 'Tarik Cranston', 'https://www.google.com/maps/contrib/104102179681667482270/reviews', 'en', 'https://lh4.googleusercontent.com/-DwH93LdA9yo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2GfFaYyoXu8DwS8FYmynM0cbmC5w/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '9 months ago', 'Everything from the service,  to the the product, to the very courteous employees is great. They above and beyond to ensure your happiness. No photos of the inside, they are not allowed but I can tell you that it is comfortable. They have a beautiful waiting room and a great store section.', 1503357017),
(1372, 302, 'Ms. Daniels', 'https://www.google.com/maps/contrib/116768719992743482220/reviews', 'en', 'https://lh4.googleusercontent.com/-e8kUMGQ2CAk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2W_EQR6sASs_oS2DsihnO3GMTYsw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 2, '8 months ago', 'Good thing is they are open until 7pm. Bad thing is their products are overly priced.', 1506858679),
(1373, 302, 'tyre white', 'https://www.google.com/maps/contrib/104958951808237408981/reviews', 'en', 'https://lh6.googleusercontent.com/-hONSdbJPRTw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0yWXdlsZyzdqwLE9izFzQ6TJgRYg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', ' I recently just became a medical marijuana patient in Washington D.C. I highly recommend those who are looking to become a medical marijuana patient in D.C to sign up with capital city care they live up to their name of capital care. I purchased my medicine  earlier from this establishment and I have to say the batch smelled very delightful. I haven\'t tried it yet.  These guys are very professional and knowledgeable about their business!  You get a five star for me capital city care!!️    \n Sincerely  Tyre\'', 1453165556),
(1374, 302, 'Elliott Jones', 'https://www.google.com/maps/contrib/118173075146295442832/reviews', 'en', 'https://lh4.googleusercontent.com/-c9nVZkU-huk/AAAAAAAAAAI/AAAAAAAAN4Y/wJTFcS46SCE/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '6 months ago', 'Hands down, this is the best dispensery in DC.', 1510697121),
(1375, 303, 'Brad Loy', 'https://www.google.com/maps/contrib/116460058211943453805/reviews', 'en', 'https://lh6.googleusercontent.com/-iJP-c44otKg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2kgDx4d03stidi5bvb02tpNvxktg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'The staff here made me feel extremely welcome and provided me with the very best levels of service and information I needed.', 1521087500),
(1376, 303, 'Mariam Ordonez', 'https://www.google.com/maps/contrib/116042723123799214019/reviews', 'en', 'https://lh6.googleusercontent.com/-I6DFqxoHGT0/AAAAAAAAAAI/AAAAAAAATqM/7Dt9w0jV2J4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Amazing service! They saw me on time and the doctor was so informative for my specific needs. Love them!', 1514595260),
(1377, 303, 'Curtis Phinney', 'https://www.google.com/maps/contrib/115147794372642601528/reviews', 'en', 'https://lh6.googleusercontent.com/-tN39cFxhfEg/AAAAAAAAAAI/AAAAAAAAA3M/C9jaNmAISqQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '10 months ago', 'The medical aspects of my experience were top-notch. However the office has requested the same (submitted) documentation so many times that it shakes my faith in their ability to keep their (my!) records straight.', 1500155705),
(1378, 303, 'Vene Morehead', 'https://www.google.com/maps/contrib/109871717139410668460/reviews', 'en', 'https://lh5.googleusercontent.com/-MYUWeJa6tXo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3d5zB_Ej-q6f-sO9YbBqebAsw9Cw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'Extremely efficient. Personality +! Thanks yall!', 1498230112),
(1379, 303, 'Billnye Thescience', 'https://www.google.com/maps/contrib/102526466470582038501/reviews', 'en', 'https://lh3.googleusercontent.com/-lho4vGqLfz0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1nm8yShOuCfAo-KF4vouBUkC4oMg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Canna care was very knowledgeable and helpful. They offer appointments but also do walk ins which was very convenient for me. I will definitely recommend friends and family to this establishment.', 1469723900),
(1380, 305, 'Helaine Burch', 'https://www.google.com/maps/contrib/102707843044668291693/reviews', 'en', 'https://lh3.googleusercontent.com/-Zqc2nCQWzPE/AAAAAAAAAAI/AAAAAAAAAAA/O3BaSNJemMs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I want to thank Integrative Physicians for a very friendly and efficient experience in getting my MMCC certification done in a very businesslike manner. The process was carried out in absolute accord with the guidelines set forth on the Maryland certification website, which included help with the application, evaluation of my condition, an educational discussion with Dr. Randy DeCarlo, M.D., and the submission of my application to MMCC. As, according to Maryland law, I then had to wait a few weeks for the certification to be approved by the state and a number to be assigned to me; and, when that arrived via email, Integrative Physicians contacted me and the prescription was written, and usable, on that same day. The experience couldn\'t have been better, leading me to write this review of praise, and wonder if a previous reviewer before me even went to the same business. I highly recommend Integrative Physicians for their quick and compassionate service...and, btw, there was no pee test, nor either the hint of one, for me or my friend who was also certified there. Of course, different patients may require different handling procedures. I, personally, am a happy camper.', 1522874894),
(1381, 305, 'Jill F', 'https://www.google.com/maps/contrib/109538202169340785019/reviews', 'en', 'https://lh6.googleusercontent.com/-0aS2FQ4hD4s/AAAAAAAAAAI/AAAAAAAAAAA/0v1F6jc7HEI/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'They require you to take a URINE TEST, fyi.  This is not mentioned on their website, it is not told to you when they call to make an appointment and it is not written in the email(s) they send you.  They also take your health insurance information in order to submit the test to insurance.\n\nI can only comment on my experience.  This group seems to run things VERY differently from the other physicians/physician groups in (all counties of) MD.  I wish I had known this (and had been more educated before my appointment) in order to know that this is not the way most places (if not all others) are run. \n\n*  You are required to take a urine test, which is not mentioned to me until after I paid.  They do not tell you what they are testing for, they do not mention that they are submitting to insurance or who (else?) is going to receive your results, etc.  If your insurance does not cover the urine test the medical lab writes the bill off.  No other physician/group seems to be doing any testing other than this group.\n\n*  You are required to give health insurance information so they can submit the urine test.  No one I have spoken to has heard of any other physician/group taking health insurance information at the appointment. \n\n* You have to wait for them to email you your certification.  From what I have heard everyone else is given the certification there at the end of their appointment.  I personally waited a week to receive it via email.\n\n* My time with the physician himself took almost two hours.  This is much longer than what other people experience.  \n\n* It was implied that I would be re-tested when I came back for renewal of certification.\n\nApparently many are apprehensive concerning physicians testing and/or sending insurance the claim (for the safety of the patient) when it comes to medical cannabis.', 1516214421),
(1382, 305, 'Patrick Daly', 'https://www.google.com/maps/contrib/114251611288217343976/reviews', 'en', 'https://lh6.googleusercontent.com/-QRexE54pPc4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3IWb_ezheM-ijEIzyj6xaAsjzsJg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'They were supportive and helpful', 1526832007),
(1383, 305, 'Kitty Armstrong', 'https://www.google.com/maps/contrib/102528682867209102446/reviews', 'en', 'https://lh4.googleusercontent.com/-4fVcQDEkYk8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3AhAQVCiFetZc9L5GzKV11iA3N7Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', '', 1526739378),
(1384, 305, 'marjorie lewis', 'https://www.google.com/maps/contrib/100322126879027411193/reviews', 'en', 'https://lh4.googleusercontent.com/-UzLYbbVytOE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq27A0pcECNBsxrms1XCOWM0Opc6vQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', '', 1506436348),
(1385, 306, 'MacKenzie L', 'https://www.google.com/maps/contrib/111611027050091791120/reviews', 'en', 'https://lh6.googleusercontent.com/-rYo2tZeF3Ls/AAAAAAAAAAI/AAAAAAAAACY/_e46mZwgGi4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, '2 months ago', 'This dispensary is all over cannabis news sites right now. HOW DARE YOU ban patients from getting medicine for practicing their first amendment rights. Even if they say they think the prices are too high you ban them. Well they are too high. $84 for an eighth of Ace of Spades is absolutely sickening. \nNow I understand the states new to medical marijuana, the good news people like the owner of this dispensary will lose a bunch of business once other dispensaries open up in the area.\nHe\'s making people go 90 miles away to get their Medicine, that\'s the nearest dispensary to them other than this place that bans people for giving negative reviews. If you can\'t handle negative reviews you\'re not going to make it in this industry.\nHow can you turn away people suffering from things like cancer all because they hurt your feelings by leaving anything other than a 5 star rating?\nPeople like you are so selfish. You\'re like those gas stations that price gouge things like water during a natural disaster. Oh there isn\'t a dispensary for 90 miles if you say anything slightly resembling constructive criticism then ban them! Who cares if they don\'t have a vehicle to get to the other dispensary? I\'m the only one around so I can do what I want! \nHate people like that.\nFear not west Virginians, as time goes on you\'ll get a lot more dispensaries, ones that actually care about the patients.\n\nHave fun trying to ban this Arizonan from your dispensary. Considering I can get eighths of Ace of Spades for $20 I don\'t think I will ever need to go to your establishment.\n\nStop turning away PATIENTS. You don\'t see hospitals turning away patients do you?', 1521913845),
(1386, 306, 'ENON ENON', 'https://www.google.com/maps/contrib/112133954840683632717/reviews', 'en', 'https://lh6.googleusercontent.com/-eo5jBCglw5Y/AAAAAAAAAAI/AAAAAAAAB80/aJMtvqzgoxo/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'The only reason there is one star is you must to post. \nWhat a crybaby! Owner can\'t handle any negative feedback. Most businesses would see the opportunity to improve but this guy bans patients that post about a negative experience! Also, in Colorado you can purchase top shelf ounces for $125.! \nEven \"street\" prices are lower, across the nation, $45. an eighth / $80. a quarter, again for top shelf flower.\nThis guy does not have patients in mind, only in it for the bucks. Bet he was a street corner beater (and still is) !\nBoycott this jerk!!', 1521807687),
(1387, 306, 'Heather Iser', 'https://www.google.com/maps/contrib/116192917148570705361/reviews', 'en', 'https://lh4.googleusercontent.com/-sd_70COLJ70/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq07G3gybql6CGTCVzVEMzucrnmSgQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I went for the first time last week. After years of suffering with medical problems I sought out medical marijuana. I had no idea what I needed or what to expect. The place was very nice and everyone was so friendly. They explained everything so well. I asked tons of questions and Becca who was my budtender was very patient and showed me what to do with each item I purchased.', 1523456597),
(1388, 306, 'Eric Caudle', 'https://www.google.com/maps/contrib/113423307451084767850/reviews', 'en', 'https://lh5.googleusercontent.com/-jCPwCEtlYm8/AAAAAAAAAAI/AAAAAAAAF9w/hiwCvrCpsWs/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 2, '2 months ago', 'Was ok. Prices are higher than most places. Of all the dispensaries I\'ve been to this one had the most paperwork. The one concerning thing they require you to sign a release of Information Form in case they get subpoenaed for your medical records. Not sure why you would need my approval for release of information if you got a court subpoena kind of useless at that point. When I asked about this the receptionist went and got what I assumed was the owner who came out carrying a sidearm with aggressive body language. Personally I felt slightly uncomfortable. Now I hear they\'re being investigated by the state for Banning people for bad reviews which is a violation of state law.', 1522318112),
(1389, 306, 'Zoe Fei', 'https://www.google.com/maps/contrib/107146703607460812279/reviews', 'en', 'https://lh5.googleusercontent.com/-_byb33lokaA/AAAAAAAAAAI/AAAAAAAAGRM/zGWPwc9ml9E/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'They have an Amazing Staff, Beautiful Facility and an Excellent Menu... Great overall experience! Thanks so Much AMMD ️', 1524362802),
(1390, 307, 'robert snowden', 'https://www.google.com/maps/contrib/107495833953657636224/reviews', 'en', 'https://lh3.googleusercontent.com/-MjtLGNoNDFc/AAAAAAAAAAI/AAAAAAAAAS4/VHxt8E5srk4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great staff. Great product. Awsome rewards system. Who doesn\'t love free products. Best flowers in town.', 1524853556),
(1391, 307, 'K Ro', 'https://www.google.com/maps/contrib/103488374430276046586/reviews', 'en', 'https://lh4.googleusercontent.com/-E7Yd42zBct0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3LS8qn9L_dzYKRXWbpt5I5FMAvNA/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '2 weeks ago', 'Not open on time and theres an issue with online ordering. I can never get through to anyone when i call. Im probably going to switch dispensaries, not very happy with them.', 1526142745),
(1392, 307, 'joe tim', 'https://www.google.com/maps/contrib/105323330870115191354/reviews', 'en', 'https://lh3.googleusercontent.com/-LSBO2x2447k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1cIpfDdRiSueQlOUmJJIJdk3g0Yg/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '4 months ago', 'Metropolitan wellness center is a medical marijuana dispensary. They are located in SE D.C. Next to a cell phone repair shop. They serve D.C. Residents with a D.C. department of health medical marijuana card.  They Cary a wide variety of products related to marijuana.  The employees seem to be knowledgeable and courteous at times.  Maybe they have a high volume of customers. They close at 8pm sharp.', 1515196340),
(1393, 307, 'c b', 'https://www.google.com/maps/contrib/102450952066450269788/reviews', 'en', 'https://lh5.googleusercontent.com/-AtAf6XRn1hg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq28V793icUiCBl-7uaDgpxirNJACA/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a month ago', 'I have visited twice in the past week, aI have a home dispensary but this particular one had a product my dispensary did not have in stock. My 1st experience was great, seemingly good customer service and knowledgeable staff. My second visit i figured Id try online ordering to make my experience faster (at my dispensary i never wait more than 2 or 3 meetings to be seen here feels like for ever) ok so again I oreordered and went around 1230. Yes they dont open until 12 but from my personal assumptions the preorder are supposed to be priority so that you wouldnt have to wait. The guy at the counter may have thought he was joking with me but i wasnt joking. I needed my meds and they werent ready then the girl who ended up helping me messed my diacount up the 1st time then had no real knowledge of the product. I was completely dissatisfied. My point that i was supposed to earn never went to my account and their payment systems seems a little screwy if my bill is 161 why charge me 165. I dont like it and wont return. Ill wait til my home dispensary gets more product before i ever return. True lack of organization.', 1523707553),
(1394, 307, 'Kevin N. McGriff', 'https://www.google.com/maps/contrib/116265990838605053392/reviews', 'en', 'https://lh4.googleusercontent.com/-78_ztrluRlU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0rRrgdXyu67JIyD5xgO5ACzn1q3Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Medical Marijuana.\nVariety, Discounts, Explanations, and Helpful Service .', 1524247227),
(1395, 308, 'Mary McLaurine', 'https://www.google.com/maps/contrib/100434919224830920795/reviews', 'en', 'https://lh3.googleusercontent.com/-J0hcU58fgi8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1PgfTQg2xAz0sQx7lczdY41yoUEw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', '5\nI cannot say enough great things about Euphoria Wellness Maryland. Their hours make it convenient for those who have to work a 9 -5 job and they\'re open on weekends, even Sunday, unlike many other dispensaries in Maryland. The staff is incredibly friendly and knowledgeable AND they take debit cards. Everywhere else I\'ve been to is cash only. Their products are consistently good and I for one, will continue to patronize their business. Great place! ️️️️️ 5 Hearts from me.', 1523728335),
(1396, 308, 'Steve Strickland', 'https://www.google.com/maps/contrib/104113645705199481244/reviews', 'en', 'https://lh6.googleusercontent.com/-EG__LQt1H14/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq34XAaav5W8Pb_rw83Z8h1vXqliiw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great place.  Very friendly and knowledgeable.  They have a great variety and stock.  Grassroots “Pootie Tang” and “Willies Tour Bus” are excellent!!', 1520097109),
(1397, 308, 'Joseph Jirsa', 'https://www.google.com/maps/contrib/112367865891009444859/reviews', 'en', 'https://lh6.googleusercontent.com/-fvk8k0wYkO4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq16K81yFttFEjCA-m4D9IJh0NHVXQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Very easy service. Looking forward to more visits. Great job!', 1521491713),
(1398, 308, 'Derek Taylor', 'https://www.google.com/maps/contrib/116238759672695136590/reviews', 'en', 'https://lh3.googleusercontent.com/-mlyXJDKsLVc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0fHDoGU5OYf_nQFQW7vet8KX9DvQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Amazing experience my first time there was awesome staff is knowledgeable and it is clean organized And had planned a full selection as far as I was concerned.', 1521060491),
(1399, 308, 'colette P', 'https://www.google.com/maps/contrib/102178152617272802173/reviews', 'en', 'https://lh5.googleusercontent.com/-yzdl3obocQc/AAAAAAAAAAI/AAAAAAAAACA/QbxjFQZV81Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Was there this morrning on opening day. Great security and easy and fast check in. Staff in the back were all upbeat and ready to answer questions.  Only negative is that I ordered and paid for 3 concentrates. 2 green apple and 1 Bubba OG. I didn\'t check the bag (They staple them shut in plastic bag) until I got home. They gave me 2 Bubba\'s and 1 Green Apple. I called to let them know and the person who answered apologized and told me to return them. I was unable to get back that way so I told her I\'d just keep what I have. It sucked but every new business has it\'s kinks. I\'m sure they will double check the orders from now on. :)', 1519864435),
(1400, 309, 'LGK Baltimore', 'https://www.google.com/maps/contrib/105390772077644454593/reviews', 'en', 'https://lh3.googleusercontent.com/-8P5RCuD3454/AAAAAAAAAAI/AAAAAAAAGVU/45LvYncQItA/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'in the last week', 'Had the pleasure of stopping by this place today, very close and convenient. Staff was super friendly and manager very knowledgeable about medicinals. They have acupuncture and massage that I’m def going to hit up. Product seems legit  can’t wait to try some healing goods here.', 1527305047),
(1401, 309, 'Elise Lewis', 'https://www.google.com/maps/contrib/112629449116530150934/reviews', 'en', 'https://lh3.googleusercontent.com/-BeR_tOu3IlE/AAAAAAAAAAI/AAAAAAAAEmc/Y3yl_zIlUN8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Curio Have excellent customer service  the products  are out of this world  Highest Quality! They take pride in WHAT THEY DO CUSTOMERS FIRST. THEY DEFINITELY AIM TO PLEASE! GREAT LEADERSHIP. GREAT VARIETY!  THANKS CURIO FOR ALL YOU DO TO SAVE & CHANGE  LIVES FOR THE BETTER. ', 1519865573),
(1402, 309, 'Kim Sanders', 'https://www.google.com/maps/contrib/105537897135265033975/reviews', 'en', 'https://lh5.googleusercontent.com/-Mvsg-Tr9LL8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1yCE2T9DPvQh0EEH1FppFRsMeSJA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'Everyone at Curio Wellness has been nothing but very helpful and kind.  I always enjoy my visit.  Excellent products and Surprisingly,  they have sales sometimes on Flower, Concentrations, etc...', 1525297633),
(1403, 309, 'Marie Simmons', 'https://www.google.com/maps/contrib/104268770197590157251/reviews', 'en', 'https://lh5.googleusercontent.com/-sxWDyU0448E/AAAAAAAAAAI/AAAAAAAAAGg/KGhEfUaFIVQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Great people and great products. I found a skin balm by Cannuka there and now heading back to try the rest of their products.', 1525704187),
(1404, 309, 'Melissa Myers', 'https://www.google.com/maps/contrib/110137506733012671521/reviews', 'en', 'https://lh4.googleusercontent.com/-7M3Q8Xgfii4/AAAAAAAAAAI/AAAAAAAAHmo/Zx2BwJlphaw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Very nice store with friendly and knowledgeable staff.', 1525715636),
(1405, 310, 'Camila Castrillon', 'https://www.google.com/maps/contrib/107305741953236004633/reviews', 'en', 'https://lh6.googleusercontent.com/-Dcu7lmQxu1U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3UVhwL9s5GU8pVVn1-ZMTWOGjxdA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The staff is very knowledgeable. They took their time to help me find the best available products geared towards my spouse who is fighting colon cancer. Even though I was unable to purchase their products their expertise was applaudable! Thank you! Best dispensary around in Maryland!', 1522769650);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(1406, 310, 'Kevin Mahoney', 'https://www.google.com/maps/contrib/111175605076331224279/reviews', 'en', 'https://lh3.googleusercontent.com/-Fx6enrB3Xtg/AAAAAAAAAAI/AAAAAAAAAho/cTA379SEKs4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'So happy Greenwave Dispensary is now Maryland and by the best business owners in the entire state!  Can\'t wait to see what the future brings.', 1518534676),
(1407, 310, 'Cody Weber', 'https://www.google.com/maps/contrib/107267365123493151710/reviews', 'en', 'https://lh3.googleusercontent.com/-FSeuNyHSDpg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2GHO3YUhLGjBTyi9lwTibqtui_Xw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'AMAZING staff. Very polite', 1524843832),
(1408, 310, 'Tom Tanner', 'https://www.google.com/maps/contrib/108604710181926266040/reviews', 'en', 'https://lh3.googleusercontent.com/-Odoj0QYRX5Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2UlxRzK7ufBBBYVWzlKEmCBTq1Ow/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Awesome experience, friendly staff, clean and inviting.', 1527357222),
(1409, 310, 'kelly brown', 'https://www.google.com/maps/contrib/107170055677816972912/reviews', 'en', 'https://lh5.googleusercontent.com/-SIAxbRWMkvA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2NwZPIjhSnvhpLWlyQTcDt_YRp3Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'I was impressed with the customer service I received,', 1526321160),
(1410, 311, 'Andres Mendoza', 'https://www.google.com/maps/contrib/100335910043732859986/reviews', 'en', 'https://lh3.googleusercontent.com/-t80zFmHb1Hg/AAAAAAAAAAI/AAAAAAAAHes/QBNNQyQ5pnU/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a week ago', 'Great shop with really nice and knowlegdeable employees. Always have quality products and I dont ever feel like they up sell to me.', 1526582425),
(1411, 311, 'Juan Jones', 'https://www.google.com/maps/contrib/103612842358246522688/reviews', 'en', 'https://lh4.googleusercontent.com/-aFGe2eL5FWw/AAAAAAAAAAI/AAAAAAAAAFI/Zb4pTmz-OAA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The best !!!!!  Dispensary  In the  Area  Well trained staff . To guide people who are new to medical  cannabis  Marijuana  also CBD  !!', 1523910560),
(1412, 311, 'Antwan Evans', 'https://www.google.com/maps/contrib/106437650047524794013/reviews', 'en', 'https://lh5.googleusercontent.com/-xUBWWvQOnpc/AAAAAAAAAAI/AAAAAAAAAIs/J4JoA2zcaUc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'Okay. So I am not a person to normally leave reviews, but there is no way I could go without doing so after my visit today. It was my first time there, and of course I was a little nervous. I was greeted with such a welcoming feel from all of the staff and Frankie worked me directly. I had a zillion questions, and she had an answer for every single one. She educated me on a ton of strains she thought would be best for my condition. Her customer service seemed too good to be true - she should host some sort of customer service class for some of these cell phone companies haha In all seriousness, she was just someone you could talk to forever. Even the other patients that came in were really friendly and just a good vibe all the way around. I did a lot of research before picking them, and it was surely worth it. They have a great menu and good quality product!', 1498195294),
(1413, 311, 'SilentHashassin\'', 'https://www.google.com/maps/contrib/116914746656614288192/reviews', 'en', 'https://lh5.googleusercontent.com/-piWSt-Mtp88/AAAAAAAAAAI/AAAAAAAABFo/_7t-ZRlxgyI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Prior to signing up I reviewed various dispensaries and was literally getting ready to commit to MWC due to a friends recommendation. After realizing their prices are higher along with every other shop, (asides from this one) I decided to settle with H.A. I do not regret my choice at all, the setting of the dispensary alone gives a clean, office type of feel. Has the essence of a medical setting, instead of smelling the usual hospital/dentist office smell, you get hit with a mixture of the various herbs. The staff is extremely helpful and knowledgeable. Very good selection as well.', 1466084412),
(1414, 311, 'danoff2009', 'https://www.google.com/maps/contrib/102809228442549754265/reviews', 'en', 'https://lh5.googleusercontent.com/-4rTCSfr1YQ4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Pbd8YC5NT-YBl-19zdsOVM5yR9w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'Wonderful knowledgeable staff. Great product.', 1498873498),
(1415, 312, 'Missy Flynn', 'https://www.google.com/maps/contrib/109140088778006434144/reviews', 'en', 'https://lh5.googleusercontent.com/-jTw-Zl8Skts/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3X6YWgZRutuNP2YSQ3O-6y4daLjA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'They were very nice and informative. They took their time to explains the different strains. They let me know which was best for my needs. I did not feel rushed.', 1526998506),
(1416, 312, 'Brent Bain', 'https://www.google.com/maps/contrib/112308401580047811527/reviews', 'en', 'https://lh6.googleusercontent.com/-kI0V1G-ocMI/AAAAAAAAAAI/AAAAAAAAECg/e84tZtsHKE8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Great customer service, I felt welcomed and was taken care of in a very professional manner.', 1527712847),
(1417, 313, 'John Jeffery', 'https://www.google.com/maps/contrib/100033222445533028499/reviews', 'en', 'https://lh6.googleusercontent.com/-OuUWrDHChIE/AAAAAAAAAAI/AAAAAAAAANc/0QlHlQL2NP0/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'Every other dispensary offers a veterans discount! The management is VERY rude. I\'m an Afghanistan veteran that needs cannabis for PTSD and they choose not to offer any discount to vets. Disgusting. In the CAPITAL of our nation! I will make sure NO veterans that I know ever go here', 1526063247),
(1418, 313, 'Wayne Arminavage II', 'https://www.google.com/maps/contrib/110592483376852683760/reviews', 'en', 'https://lh5.googleusercontent.com/-MNfozGskzzk/AAAAAAAAAAI/AAAAAAAADFI/2rAb_9GKQus/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Saying NHHC is the best dispensary in the city is a dramatic understatement. NHHC provides five-star service at every turn with a knowledgeable staff, a deep and diverse product selection, and a welcoming atmosphere that embodies everything a medical marijuana program should strive to be. \n\nIf the process of getting a medical card seems daunting or frightening, rest assured that it\'ll be made worth it once you make it to this dispensary.', 1520613609),
(1419, 313, 'Abigail Rodriguez', 'https://www.google.com/maps/contrib/116131433720633417837/reviews', 'en', 'https://lh4.googleusercontent.com/-6gM54ezEiv8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Vwi3Ft8jNXB41DkiTxGui-urZdw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Does anyone know if you can buy it without a medical card if your 21 and over? Im not from here so I don\'t know of it\'s legal like that', 1514841835),
(1420, 313, 'M.D. Brennan', 'https://www.google.com/maps/contrib/109476880677729623909/reviews', 'en', 'https://lh4.googleusercontent.com/-7R4g0z5CKVQ/AAAAAAAAAAI/AAAAAAAAAVY/DIs5v9pjpUs/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'in the last week', 'Thanks again!', 1527442577),
(1421, 313, 'Jason Perkail', 'https://www.google.com/maps/contrib/109309702885817169029/reviews', 'en', 'https://lh3.googleusercontent.com/-6WphWy9EncQ/AAAAAAAAAAI/AAAAAAAAAC4/8itFxMm8Z-c/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'This is hands down the best dispensary in DC. All four of the employees are friendly. They\'re all owners and it shows. They\'re experts when it comes to answering my questions and always have new strains coming in. Best thing is the prices are the lowest in town... plus I get a free preroll with EVERY order and they are two blocks from the metro @dupont circle. What\'s not to love!', 1469912719),
(1422, 315, 'Hope Saige Perry', 'https://www.google.com/maps/contrib/111536770352593329226/reviews', 'en', 'https://lh5.googleusercontent.com/-2V5Urxr-Bsk/AAAAAAAAAAI/AAAAAAAAg44/pFAqeBfPj38/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'in the last week', 'Awesome employees. Will definitely be back. The employee who helped my husband & I was so helpful, he knew so much, I felt like I was talking to a doctor or scientist lol. So either they make sure their employees know their stuff or their employees are just that knowledgeable.  Everyone from the employees in the front & the employees in the back where so nice. The MMCC site kept having problems & the staff up front took their time & was able to help us. \nThe flower was fresh here. They had a wide variety. Prices are decent. We got 5 grams for $70. Usually qet 3.5 grams for $60, some $40. So 5 g for $70 is good. Especially when its a good strain. I will be back & have already recommended to friends.', 1527435435),
(1423, 315, 'Lesa Fox', 'https://www.google.com/maps/contrib/107208996574760256898/reviews', 'en', 'https://lh3.googleusercontent.com/-ZsRlyKfmg_w/AAAAAAAAAAI/AAAAAAAAACs/M6YNVXe7ABg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Open for business!!! Fantastic group! Very knowledgeable, especially Austin!!! Don’t be shy! Get your medicine and be free of pharma!', 1527016955),
(1424, 315, 'Pam D', 'https://www.google.com/maps/contrib/100918689160684409754/reviews', 'en', 'https://lh3.googleusercontent.com/-hoX6HKHobYM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq09fZyuiFheoNDCGaqxQrwuLOeSgw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I dropped by the this dispensary, but they weren\'t open for business yet. People in their were really nice and friendly and they helped me to register for my patient card and even directed me to a doctor that could help me. The location looks really nice and bright. I\'ll be back', 1518911241),
(1425, 315, 'Tlee Dee', 'https://www.google.com/maps/contrib/117328129276989663036/reviews', 'en', 'https://lh4.googleusercontent.com/-NDooYFb5AUs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0KW3tjEUE9uIX832PrehCSdx2YBA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I was invited for the VIP opening. There was a long wait while they got all the kinks out but the employees were very friendly, kind and understanding and they even rewarded our patience with a nice discount . The product is awesome. I will definitely return!', 1520000494),
(1426, 315, 'Mariana Davila', 'https://www.google.com/maps/contrib/102790376273180608639/reviews', 'en', 'https://lh3.googleusercontent.com/-KwRBdCFcupA/AAAAAAAAAAI/AAAAAAAAAEQ/c8FJzY0fKjw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I was so satisfied with their recommendation of dried flower for anxiety. The employees have well known knowledge of the products they are selling.', 1520530645),
(1427, 316, 'C Ceste', 'https://www.google.com/maps/contrib/104014017482308336804/reviews', 'en', 'https://lh5.googleusercontent.com/-ov55XGrt1DI/AAAAAAAAAAI/AAAAAAAAAiQ/EyKgbL0BWxY/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 weeks ago', 'Sour Diesel looks like its grown well but the trim job is sub-par. And if youre looking for a pretty 1/8th you may not get it. Consistant popcorn nugs.', 1526239905),
(1428, 316, 'Tina Henson', 'https://www.google.com/maps/contrib/116189779469920535147/reviews', 'en', 'https://lh4.googleusercontent.com/-bdpjBAsC-1s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1y_xaeCKSEoPP6AJJ6QnOjfCgu1Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I use a lot of their product at our local dispensary and LOVE EVERYTHING that I\'ve tried. Keep up the PHENOMENAL growing GLEAF', 1521763640),
(1429, 316, 'Barbara P', 'https://www.google.com/maps/contrib/108440079576045743856/reviews', 'en', 'https://lh3.googleusercontent.com/-9_4NRDUQWeY/AAAAAAAAAAI/AAAAAAAACF4/g5KP1-m8eME/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'Know', 1515188299),
(1430, 317, 'Jasmine Raheem', 'https://www.google.com/maps/contrib/111844582764226001204/reviews', 'en', 'https://lh5.googleusercontent.com/-pVyySDe_qoQ/AAAAAAAAAAI/AAAAAAAAH68/o9d4B_ZxnQI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'I have been seeing Dr. Yura Williams for several months now.  I believe she is an excellent psychiatrist and very knowledgeable about her craft. She has always been pleasant with me and attentive to my needs.  No wonder she comes highly recommended by other healthcare professionals! One major thing I like about seeing her as y psychiatrist is that she takes time to listen to my issues which I know are usually not within her scope as I have a psychologist whom provides these needs.  Dr. Williams office environment is always pleasant.  If you are looking for a great psychiatrist your search ends here.', 1523033565),
(1431, 317, 'Jan J', 'https://www.google.com/maps/contrib/104168528196707151017/reviews', 'en', 'https://lh6.googleusercontent.com/-8oXnUKXyPw0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0sxcaSyCH9SNQ_sjSF70LI8JdcYw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Dr. Williams is a total professional.  She took the time to listen to me and consider my entire situation before she suggested any medications.  I will say that Dr. Williams is very direct at obtaining the information necessary to make an accurate diagnosis.  She also appears to be aware that there are other patients in the waiting room and that time is of the essence.  She uses time management and has a pleasant disposition.  I would recommend her for anyone who is serious about emotional stability and reclaiming their life.', 1522952861),
(1432, 317, 'Domonique S', 'https://www.google.com/maps/contrib/111258487044201214989/reviews', 'en', 'https://lh4.googleusercontent.com/-DkHFaMaFU8o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0FMuBJSKwhztpolmJFtq8f_UtxDQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'As a woman that has struggled with mental health issues for the greater part of my life, I\'ve encountered many mental health professionals. Unfortunately, not all my experiences have been great but I love Dr. Williams. I know that I would not be on this earth today, living and functioning if it weren\'t for her. I have been seeing Dr. Williams for almost ten years. I have followed her through different locations because of the professional and excellent care with a very appreciated personal touch that she has always given me. I never feel that I\'m just another client, I know she cares. At times when I had given up on myself, she encouraged and fought for me to continue to fight. And I\'m so glad that she has. I have so much respect for her as a doctor and African American woman that is consistent and reliable with the care that she always provide. I could go on and on but I\'ll just end by saying that she has been a true blessing in my life and I pray that she continues to bless myself others.', 1522069589),
(1433, 317, 'Beth Tolle', 'https://www.google.com/maps/contrib/116517031481141916388/reviews', 'en', 'https://lh5.googleusercontent.com/-vq8AbbCJiQA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1y378GRUXF37I1QqryR2puxFWSag/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'From my 1st visit with Dr. Williams, about a year ago, she makes me feel at ease, her office is cozy and the office manager is kind.  Dr. Williams helped me accept that it\'s okay to change; I am not the same person I was before my daughter was born. My depression and anxiety started when materity leave ended 8 years ago. Dr. Williams is personable; with each visit she makes me feel like she knows and understands me a little more. She has shared her personal stories and relates them to my situations. I appreciate our visits and the thought she has put into the medication she prescribed. Thank You!', 1522375829),
(1434, 317, 'Alexia S.', 'https://www.google.com/maps/contrib/112649673973318064500/reviews', 'en', 'https://lh5.googleusercontent.com/-KeuRIY2QTE8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3C1xWNzGFj4joouhPZx6-M_mOmTg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Was looking for a psychiatrist of color to help me with managing depression, anxiety and binge eating. Did not do a thorough intake, as a matter of fact, within 5 minutes, she was telling me what I need to take and do for my depression without having asked any questions. Doesn\'t appear to take interest in involving her clients in their own care. Very short and doesn\'t listen or show much empathy. Prescribed meds, and when telling her the side effects experienced, wanted to go up on the dosage rather than find something else. I knew she was not the doctor for me when I expressed a desire to utilize some of my own strengths to help manage my issues, and she said \"you shouldn\'t have to use your own strength, that\'s what medication is for\". I got a second opinion after not seeing results from a way more thorough and professional psychiatrist who was appalled at the medicine she put me on for the binge eating. I am much better now. So put it like this, if you just need a drug dealer to sling drugs to you, this is your doc. If you are an informed and/or empowered patient who wants to be involved in your own care, run in the other direction.', 1521410634),
(1435, 318, 'Maurice Whitehurst', 'https://www.google.com/maps/contrib/106291672673170289178/reviews', 'en', 'https://lh4.googleusercontent.com/-giy8EQlaFRk/AAAAAAAAAAI/AAAAAAAAAMQ/u5N4yRN0xco/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Emailed records over. Got reply of receipt. Scheduled time was good. By the time paperwork was filled out, Dr. was ready. Super friendly. Seems very caring. Reception guy handle with kid gloves. Very professional and compassionate. Good parking and excellent turn around. Instant availability makes or shows DC system\'s inadequacy. Maryland bureaucracy at its best.', 1521313978),
(1436, 318, 'Jeannie Cobb', 'https://www.google.com/maps/contrib/116423407671477994837/reviews', 'en', 'https://lh3.googleusercontent.com/-VLbvjyU3wYU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2LhMgVnCa2S_hm5qrfkp1dZoWrKg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I was so impressed by how attentive and polite the medical receptionist was he was so polite and so helpful and so caring he made me feel so important he alone gets 5 stars from me and the Dr. she was very professional and understanding I like this place and would recommend it to others like me God Bless this clinic and the staff.', 1524336442),
(1437, 318, 'Chelsee Covington', 'https://www.google.com/maps/contrib/109304511449077491409/reviews', 'en', 'https://lh3.googleusercontent.com/-JtnIJGACYAc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0foYypbSjmqeUlLUtC09JmcxBk7A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Very comfortable and clean! All staff was extremely friendly and helpful, a very pleasant experience!', 1521358872),
(1438, 318, 'Nathan Cole', 'https://www.google.com/maps/contrib/103302549155560087696/reviews', 'en', 'https://lh4.googleusercontent.com/-sjgD-iQ1Zdw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1JJ3wsreaEijYAxoxk48HVo47c4g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'These guys are extending professional and welcoming. They go out of their way to help you through the process.\n\nWhen I arrived, I was greeted by Daniel who already had all of my paperwork completed and ready to submit to the commission. Daniel handed me some basic paperwork to fill out.\n\nOne thing I noticed was how clean and professional the office and waiting room was. It felt like a brand new office. \n\nAfter completing the paperwork, I went in for my appointment with the doctor. This lasted no more than 10 minutes. \n\nThe whole visit lasted maybe 15 minutes and now I’m cleared to receive my license. With these guys, it couldn’t have been easier.', 1507243454),
(1439, 318, 'Daniel Parsons', 'https://www.google.com/maps/contrib/116824519846690883503/reviews', 'en', 'https://lh6.googleusercontent.com/-NChIFzLsNI4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1B_iM-chQHHzr5Yfou6W05E8FGog/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Great space with a friendly staff. Very professional. An informative and efficient visit with knowledgeable medical personnel.  Centrally located with easy parking. I highly recommend.', 1509140698),
(1440, 319, 'Me Credle', 'https://www.google.com/maps/contrib/107716857156013062641/reviews', 'en', 'https://lh5.googleusercontent.com/-Jgkiutcfxuc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq13l2zwfXI27Gts68z1ObsTlw-KQQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'What an exciting day!  I\'m getting my certification today.  The staff is very knowledgeable and treats like family.   There\'s not one question  I asked,  the was not able to answer.  I highly recommend Green Health office I\nBaltimore.   Thank you for making feel comfortable and at ease. I will surely recommend you!! Happy New Year to me!!!', 1515254733),
(1441, 319, 'Faith Vrablic', 'https://www.google.com/maps/contrib/112429529524195651710/reviews', 'en', 'https://lh5.googleusercontent.com/-vFM37gHUiHw/AAAAAAAAAAI/AAAAAAAAKcY/ZZS9LPhjULs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Green Health Docs is absolutely amazing! The environment is so chill and the staff is so helpful! I’m so glad I did this. I suffer from severe anxiety/panic attacks and I did so much research to make sure this was the right option for me. And it definitely was! Now, I’m off to the dispensary.', 1519847423),
(1442, 319, 'Michael Wilson', 'https://www.google.com/maps/contrib/100436372031039224663/reviews', 'en', 'https://lh5.googleusercontent.com/-v2yVww8ubhs/AAAAAAAAAAI/AAAAAAAAAB0/sCWpuYygA8o/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Very Professional and helpful.  The office is very prompt and welcoming to patients as well as walk ins.  I was able to feel safe and secure with my medical information in their hands knowing the doctor evaluating my care was very credible and thorough. Thank you Green Health Docs !', 1509807425),
(1443, 319, 'Denise Bailey', 'https://www.google.com/maps/contrib/100275565797678800819/reviews', 'en', 'https://lh5.googleusercontent.com/-P1Okm4TCCFg/AAAAAAAAAAI/AAAAAAAAFjQ/vBOyBftU3Fw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'When you walk in you feel very welcome and no question is unanswered!!  The entire process was so simple!!!  When you see the wonderful doctor you are assured this is the right treatment for you(yes I was nervous). The entire staff is great!!', 1512238375),
(1444, 319, 'Maddie Walz', 'https://www.google.com/maps/contrib/103850900491104445781/reviews', 'en', 'https://lh6.googleusercontent.com/-hLrFLxDJ7S0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3mSmEYfuVLsiUy3tTkBvE4OXRg9A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Great experience! Everyone was so friendly and helpful. They are very understanding and will work with you to get the help you need. Also they are extremely knowledgeable about MMCC.', 1511033713),
(1445, 320, 'T Black', 'https://www.google.com/maps/contrib/112968916214010158952/reviews', 'en', 'https://lh4.googleusercontent.com/-JI55VC5f3do/AAAAAAAAAAI/AAAAAAAACOU/sV2w53St-MY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'Really easy and pleasant experience. Do your homework. Be sure to bring in medical records and things should go smoothly. Professional staff. Karen at intake did a great job expediting the entire process and Nancy the NP also was very professional. The only thing I would change are their hours. Otherwise I highly...recommend :)', 1520622131),
(1446, 320, 'Tim Rossini', 'https://www.google.com/maps/contrib/103888691745412006466/reviews', 'en', 'https://lh5.googleusercontent.com/-IfxoVp3eWCE/AAAAAAAAAAI/AAAAAAAAFmw/DcEjeAyuTeM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'My visit to Green Health Docs was fantastic\n It took about an hour,but staff was,amazing and,helpful.  I highly recommend making an appointment as they are very busy.  I HIGHLY RECOMMEND GREEN HEALTH DOCS in Rockville, Md.', 1518467305),
(1447, 320, 'Mustafa Abdul-Aziz', 'https://www.google.com/maps/contrib/113617920204742968880/reviews', 'en', 'https://lh6.googleusercontent.com/-BwqRXVSlXoo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2p0wWdqAEDBo2zRzgmKo2pcUHJtw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'With proper qualified medical documentation, it was unbelievably fast and helpful towards becoming legally registered for medical cannabis products. The extensive information available makes me even more of a believer of natural herbs for medicinal use. Green Health is a great place to help you find a naturally healthy feeling.', 1511915973),
(1448, 320, 'smpjlp601', 'https://www.google.com/maps/contrib/105668937014240661657/reviews', 'en', 'https://lh5.googleusercontent.com/-56Kru32-ZUk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3jf5LlzNdjpSd5cu4Ntu7BVXfDQQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'The staff are super friendly and helped me feel relaxed. I suffer from severe anxiety but the staff and Nurse Practitioner put me at ease. The whole process was quick and painless. Would definitely recommend this location!  ', 1504629519),
(1449, 320, 'Renan Augusto', 'https://www.google.com/maps/contrib/109463188309848562817/reviews', 'en', 'https://lh5.googleusercontent.com/-TMiizuA3_zY/AAAAAAAAAAI/AAAAAAAAKsk/OD-JO9tV59E/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '10 months ago', 'I showed up for my appointment and was immediately greeted by the receptionist. I filled out a form and then saw the doctor. Then I was referred to another office where two ladies helped me with the rest of the process. \n\nOverall, I was very impressed with how professional, timely and clean this office is. I will definitely return for my check ups and highly recommend this place. Go here!', 1501257196),
(1450, 321, 'Leslie Somerville', 'https://www.google.com/maps/contrib/101283438738455396647/reviews', 'en', 'https://lh4.googleusercontent.com/-sZt-LutLXf8/AAAAAAAAAAI/AAAAAAAAACE/Oi5NY9uFPG0/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '2 months ago', '', 1522017025),
(1451, 322, 'J Scott Dixon', 'https://www.google.com/maps/contrib/114398861104333997933/reviews', 'en', 'https://lh6.googleusercontent.com/-HxFQOVaMjTY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2qU4_7mmZPjU05Pv6FNIgTV5yqMA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'These folks were great!!  I am telling everybody about them. It costs $140.00 to get started. You just need to show proof of residence and medical documentation of your illness. I am an Activist and believe that medical cannabis will be a big part of ending the Opioid Crisis. I have a facebook page called Hippie Christian Fellowship and we encourage the use of medical cannabis and spirituality as a way to move beyond addiction. Go check out Green Docs, bro. You need to get healthy and legal. You just call them and set up an appointment on a Saturday.', 1526670421),
(1452, 322, 'Jason Hartman', 'https://www.google.com/maps/contrib/112246056862317840183/reviews', 'en', 'https://lh4.googleusercontent.com/-IaVTOa46AOw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2SvVw1tiISihRFbvGv3JbFmbhsEg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Very good experience here. The secretary was very nice and explained everything very well. She also was able to answer all of my questions. It was also a plus getting a free t shirt.', 1512849459),
(1453, 322, 'Tylor Frazee', 'https://www.google.com/maps/contrib/100628299114817409689/reviews', 'en', 'https://lh6.googleusercontent.com/-Z6yT7zAieQU/AAAAAAAAAAI/AAAAAAAAAMw/zV-OhzaSOG4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '9 months ago', 'The office has a very comfortable environment and extremely helpful staff. The nurse practitioner was very knowledgeable. This place gave me a good understanding of what to expect and helped with all paperwork. The visit went very smooth I would recommend this practice if your in the Cumberland area. Thank You', 1503166960),
(1454, 322, 'Joe Worrell', 'https://www.google.com/maps/contrib/116830770626338395252/reviews', 'en', 'https://lh5.googleusercontent.com/-XiwMzJi8DEY/AAAAAAAAAAI/AAAAAAAAACo/ySPo4P9oKhY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'AWESOME place - Colorado transplant...everyone was so pleasant and very helpful during the entire process - the staff and Doc made me feel right at home and comfortable.  Everyone was very knowledgeable of the entire process from start to finish; both at the medical level and what you need at the state level.  Finally a place where everyone talks with you and not just rush you through!  HIGHLY RECOMMEND!!!', 1503441865),
(1455, 322, 'Jeffrey Martin', 'https://www.google.com/maps/contrib/102801177011987957846/reviews', 'en', 'https://lh5.googleusercontent.com/-dIJyipetAmw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3F5Hzww1_TXCuEfSslE9ft-GQhBA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'I really enjoyed my experience. All staff members are really friendly and helpful. I was able to set my appointment, go in and out, all without any hassle.', 1508279179),
(1456, 323, 'Jennifer Roberts', 'https://www.google.com/maps/contrib/112382438302282825292/reviews', 'en', 'https://lh5.googleusercontent.com/-4Qv87sQs-kk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3oZYjLclyGRUT59NuSRMeMg83_HQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'I am in love with this place!! The people are friendly. Products are amazing. I go in nervous because I am new to all of this. By the time I walk out I have a HUGE smile on my face. Best experience at a dispensary yet! Great deals! Will def be making this a permanent place to visit!', 1525364720),
(1457, 323, 'Peabody Museum', 'https://www.google.com/maps/contrib/106739883598097416900/reviews', 'en', 'https://lh4.googleusercontent.com/-ULWX9_nvjms/AAAAAAAAAAI/AAAAAAAANtQ/TeFVBPOOgaQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'They have excellent storage. They have friendly educated staff. They don\' t over charge and they have good products. I also like that they have specials/deals. I recommend this dispensary over others. A very well run business from a clients perspective.', 1524077931),
(1458, 323, 'Joe Strummer', 'https://www.google.com/maps/contrib/109569144577330960203/reviews', 'en', 'https://lh4.googleusercontent.com/-vKGVlD7d584/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1n1M-iUwye6JTO9_BBTSGPxHcoHQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 weeks ago', 'Really nice bud, selection is solid with great regular rotations and tantalizing specials. Good people, decent prices though they refuse to allow combining 2 or more strains to total and receive the better ounce pricing. Can\'t figure why some dispensaries won\'t do this but it\'s a major turn off when they want about  around $100/qtr and $300/oz. Just makes me feel taken.', 1525242608),
(1459, 323, 'Umair Khan', 'https://www.google.com/maps/contrib/114084268796725747419/reviews', 'en', 'https://lh3.googleusercontent.com/-Ege2ZYNEEps/AAAAAAAAAAI/AAAAAAAAAEQ/TMYHLm1BQ4c/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 weeks ago', 'What a fantastic place, everyone there is super helpful, knowledgeable and  pleasant. Their menu is great and prices are decent. Highly recommend', 1526424089),
(1460, 323, 'Adam E', 'https://www.google.com/maps/contrib/112034227123176363745/reviews', 'en', 'https://lh5.googleusercontent.com/-PMFWkLcvMHs/AAAAAAAAAAI/AAAAAAAAROk/KmY6TyLPQV8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '3 months ago', 'The staff are super helpful and nice. The location is a bit out of the way for me but the product is worth the trip(I like the scenery). Plenty of parking. You generally can’t buy more than 1/8th of a particular strain at a time because of the “small batches” that are produced(my only complaint). The prices are nice and the website is easy to read. Theory is in my top 3 dispensaries to frequent.', 1518123185),
(1461, 324, 'julio viana', 'https://www.google.com/maps/contrib/117586695703378684659/reviews', 'en', 'https://lh3.googleusercontent.com/-TmqNPvsKDIE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3UT9nwTBBkW9jgucqfweeHiq7jBA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'Great prices on flower a bit high on concentrate but all around getting better and prices are going down they just need a better and bigger selection of flower and other stuff really but still good place to stop in once in a while and yes its only medical', 1526647032),
(1462, 324, 'will smith', 'https://www.google.com/maps/contrib/102043448232260675487/reviews', 'en', 'https://lh3.googleusercontent.com/-cvsQ2qzEM5c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2iOV_QgjyhOsi0VE6j0aPG9STfxA/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 weeks ago', 'The staff was pretty cool. Not extremely  Knowledgeable but enough to serve the general public. Flower was decent at best but nothing special. I grabbed \"chuck OG\" which was definitely not an OG. The concentrates were actually pretty solid the 3 chems wax was actually pretty gassy. Not a bad spot overall would probably go back here and there but only for concentrates.', 1526530338),
(1463, 324, 'Marie D', 'https://www.google.com/maps/contrib/102027633163190118553/reviews', 'en', 'https://lh4.googleusercontent.com/-X_aDLTdjbJo/AAAAAAAAAAI/AAAAAAAASQI/0YK4FbCazi4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Always great service, never a long wait and the product is great quality. I highly recommend the Chernobyl wax. I travel over an hour to get it. Best I\'ve ever had in my opinion.', 1524330800),
(1464, 324, 'Dk Niels', 'https://www.google.com/maps/contrib/114288491854470078592/reviews', 'en', 'https://lh5.googleusercontent.com/-E1hVhh1Crck/AAAAAAAAAAI/AAAAAAAAAR8/LmVfV9WG2OI/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'When you walk in it can be a bit daunting the first time, because it is a large room with bright lighting. No need to feel uncomfortable though, because the staff is great. They are friendly, knowledgeable, and want to help over being required, with the exception of one or two. Wait time is low. I like the quality, and potency of their edibles, over any dispensary I’ve been to in Ma. Energy shots, and brownies (when in off duty mode), and caramels, are my fav. Best cbd oil I’ve tried. They have a great selection of products.', 1522328137),
(1465, 324, 'Valerie Petrie', 'https://www.google.com/maps/contrib/102381364854696808477/reviews', 'en', 'https://lh5.googleusercontent.com/-_2pGu4mLttE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1vWcRq9dL6lL5ZxDqHqUAxSiKmsQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'Staff here is not very knowledgeable but their friendliness makes up for it. I have asked and they are not required to take any sort of classes to work here so don\'t expect big knowledge on what these strains can do for your pain. You\'d be better off looking at their website first and then doing your homework on the strains before you get there', 1517870829),
(1466, 325, 'Maeve McCluskey', 'https://www.google.com/maps/contrib/102500560368284326729/reviews', 'en', 'https://lh5.googleusercontent.com/-S3WWSfYyD1g/AAAAAAAAAAI/AAAAAAAABbw/6JBavNVygSA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I just visited Garden Remedies for the first time this week and I cannot recommend them highly enough! As a new med card holder and someone who has not really experimented much with marijuana, I had absolutely no idea where to start and came in with a laundry list of medical issues and just as many questions. Bridget, one of their staff, met with me for the better part of an hour to figure out what exactly was right for me for every situation I might need it for. It was such a positive experience, and everyone there was so welcoming and was genuinely happy to help a newbie out. Can\'t recommend it highly enough.', 1518717938),
(1467, 325, 'nomadkhan84', 'https://www.google.com/maps/contrib/101684997271120125312/reviews', 'en', 'https://lh3.googleusercontent.com/-Hx95BwIQrkM/AAAAAAAAAAI/AAAAAAAAANg/J7xFCmsF-6Q/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, '2 months ago', 'Garden Remedies: You need to properly \'burp\' your cannabis otherwise it becomes musty and degrades in quality and effectiveness. Despite my attempts to fix what was delivered, I have been unable to completely get rid of the musty scent. I was certain it wasn\'t due to powdery mildew, because how would a medical dispensary have the balls to call PM cannabis medical quality?! I had imagined it was due to improper \'burping\' and storage of the medicine, which was confirmed when I checked the date my cannabis was packaged, about 2 months before I purchased it. Cannabis needs to be \'burped\' or breathe to encourage the curing process and assure the cannabis doesn\'t become musty. Dropping a moisture package in a batch and storing it away is not effective because the moisture package can only take on so much moisture, then the remaining excess moisture begins to destroy the medicine you have worked so hard to produce. You could maybe call yourselves a recreational dispensary but most certainly not a medical one. Not until you begin to care about your patients and the medicine you provide them.\nP.S I\'m the veteran from the Berkshires that originally had an issue with you agreeing to deliver and then backing out and then agreeing again only to deliver musty inferior medicine. This IS a medicine and I think you forget, disregard, or perhaps simply don\'t believe it is.', 1522071666),
(1468, 325, 'Audrey Barnes', 'https://www.google.com/maps/contrib/109043487166351082571/reviews', 'en', 'https://lh6.googleusercontent.com/-AoBxB97KmCE/AAAAAAAAAAI/AAAAAAAAKpk/-kdqZjw43Ro/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Amazing personable staff with amazing products!! Cleanest products around Boston and hands down the best edibles i have ever had!!!! I would even love to have the caramels with no THC they are so good!!!!! Worth the money for the cartridges too!!', 1515800537),
(1469, 325, 'Jon Mahoney', 'https://www.google.com/maps/contrib/105479544619026048741/reviews', 'en', 'https://lh5.googleusercontent.com/-T7XPAspuAhE/AAAAAAAAAAI/AAAAAAAADbQ/jdJOosplgTs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'The whole operation is on point top to bottom!!!:) after the smoke and dust clears and things begin to settle down here in the early days of the Wild West it’s gonna come down to two things.... #1 ) Quality of the flower!! I \nAnd \n#2) Customer Service!!!!\nWord-of-mouth will take care of the rest, one way or another!!!  ask for Andrew he’ll take Good. Care or you, He’s gone above and beyond what I would expect and his knowledge of products mixed with his compassion and wonderful bedside manner he shows hasn’t steered me wrong yet:)!!!\nThanks to him and the whole GR team for their hard work!!!!', 1508596419),
(1470, 325, 'Atticus1128', 'https://www.google.com/maps/contrib/100852912992981929957/reviews', 'en', 'https://lh4.googleusercontent.com/-Yd3KOs7wE18/AAAAAAAAAAI/AAAAAAAABFU/7nO2jhTxG-k/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'I recently received my medical card (about two months prior to the writing of this review) and could not be happier.  The staff is extremely friendly and knowledgeable.  I\'ve asked countless questions pertaining to a wide variety of products and every answer is immediate (insinuating detailed knowledge of the entire inventory), easy to understand, and extremely helpful when deciding on what products will work best for treating your condition.  The facility itself is impeccably clean, open, and inviting; not to mention right off the pike.  10/5', 1502745760),
(1471, 326, 'Samantha Skoglund', 'https://www.google.com/maps/contrib/109483568648745299067/reviews', 'en', 'https://lh3.googleusercontent.com/-tA5O4-RkE3s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ARoHVCWDQdnNUUrdh3lIlLbxS1A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I seriously love patriot care. They\'re always changing up the strains and I really enjoy trying something new. The staff is friendly and passionate about what they do. And they constantly test high. Really amazing, clean good vibes. Just wish they had my strawberry fields always.', 1520977473),
(1472, 326, 'Syrena Merrow', 'https://www.google.com/maps/contrib/117068894931076157200/reviews', 'en', 'https://lh6.googleusercontent.com/-lYE7QbzrzfY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2_ZOsnNPwnX1HP6tl7axW3swA7HQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'One of my favorite dispensaries. Great customer service and always a large variety of choices. Never disappointed.\n\nMay 2018 really glad they added kief to the menu. And the chocolate chip cookies are awesome.', 1525642408),
(1473, 326, 'Michael Swiderski', 'https://www.google.com/maps/contrib/101810145992164994974/reviews', 'en', 'https://lh5.googleusercontent.com/-ohIZb_PgwMo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0THi-8f4MS4zKdopxI5zWE7IeiVA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Every purchase of PC’s products goes directly to wealthy investors and their Goldman Sachs CEO. That’s why they pay their employees minimum wage. I would know, I used to cultivate there. Also, their plants are sprayed with 3 different pesticides, one of which is extremely deadly to bees and other beneficial insects. They also recently bought a dehumidifier because their fail rate for mold was about 30%. PC will fail once REC is established...and I can’t wait!\nThe pics below prove that I worked there AND this nasty mold infested area is where they “clean” equipment and mix nutrients.', 1524583390),
(1474, 326, 'Tra Prash', 'https://www.google.com/maps/contrib/105929023511548749102/reviews', 'en', 'https://lh4.googleusercontent.com/-kaW2AK0_P4k/AAAAAAAAAAI/AAAAAAAAAAU/oH4hykS1Voo/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'High quality flower and very knowledgeable staff. Flower terpines are usually high, thus creating a smooth, tasteful flavor. The flower is also connoisseur cut, giving you more. Patriot is by far, the best and the strains are always available for my medical needs. Edibles and oils are available in different doses and flower is flushed properly, to maintain a great, flavorful taste. There is not ever a long wait and ample parking is available.', 1521582621),
(1475, 326, 'TabbyStrings_ Blake', 'https://www.google.com/maps/contrib/115847988148391374036/reviews', 'en', 'https://lh3.googleusercontent.com/-ww5QHA0N2Gs/AAAAAAAAAAI/AAAAAAAABFg/Jwu9-UgRSmM/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a month ago', 'Patriot care is pretty great. often times products that aren\'t flower sell out immediately or aren\'t in stock, but other than that no  real complaints. staff is knowledgeable and friendly. Very clean establishment.', 1522882350),
(1476, 327, 'Rudraneel Chaudhuri', 'https://www.google.com/maps/contrib/101904649155053351306/reviews', 'en', 'https://lh6.googleusercontent.com/-ht7g2C_smaA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2g3rNEsseyalEuwpHh4-X3fl0VQg/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a week ago', 'I find it weird that they open at 8 and close 6 on a Friday night. Especially for a dispensary that is right in the heart of Boston. I don\'t see how that makes since. Especially when people are on their way home on the red line and they want to make a quick stop downtown to get some bud. They got a  pretty good recycling program though where they trade a dollar off for every bag or bottle you turn in. Even from other dispensaries. I wouldn\'t buy flower here though. It\'s like 25 dollars for a gram. Stock is very inconsistent. There isn\'t a clear menu on products. There\'s just a list with stuff that isn\'t available crossed off. But when I go to the counter to ask for the edible i wanted he went to get it and it was out of stock. I had to ask for at least 3 items that were not there but listed on the menu. Until finally I just asked them what they had. They don\'t usually keep in stock vape cartridges. But they are very cheap than other places, I believe they are only 44 bucks. The good thing is they give you two transportation credits at the beginning of every month for 10 dollars and they also give rewards points for every time you visit. So overall I\'d say if you really need to get high you can get 4 10 milligrams candies for like 5-7 bucks if you use your transportation credits or other discounts.', 1526751242),
(1477, 327, 'the droid lives', 'https://www.google.com/maps/contrib/107535473845221199785/reviews', 'en', 'https://lh5.googleusercontent.com/-IaEeIRYJDAg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3C7EwsQ-pRypTzU0LqBKDe05kbSQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Staff is super friendly and knowledgeable.  In and out in no time.  Would recomend for someone looking for a decently sized selection of flower.', 1527458559),
(1478, 327, 'Daniel Kilbreth', 'https://www.google.com/maps/contrib/116373123142574625451/reviews', 'en', 'https://lh6.googleusercontent.com/-WZG6cijULRs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3AhrlmwY1vGHljl3e9R0qUj2_2EA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'As clean and neat as any medical office and staffed by the most patient, knowledgeable and friendly folks who are unfailingly helpful.  I tend to get  anxious when I visit, however, I am immediately put at ease by the staff member helping me and my questions are always answered thoroughly with friendliness and respect.  Patriot brings a level of science and professionalism to the use of medical marijuana that I believe will, in the long run, remove any perceived stigma that may be preventing other patients from finding pain relief rather than suffering in silence.', 1519235198),
(1479, 327, 'Michael Swiderski', 'https://www.google.com/maps/contrib/101810145992164994974/reviews', 'en', 'https://lh5.googleusercontent.com/-ohIZb_PgwMo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0THi-8f4MS4zKdopxI5zWE7IeiVA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Every purchase of PC’s products goes directly to wealthy investors and their Goldman Sachs CEO. That’s why they pay their employees minimum wage. I would know, I used to cultivate there. Also, their plants are sprayed with 3 different pesticides, one of which is extremely deadly to bees and other beneficial insects. Many times, their products have tested positive for human dna, which means they are completely careless while processing their flowers. They also recently bought a dehumidifier because their fail rate for mold was about 30%. PC will fail once REC is established...and I can’t wait!\nThe pics below prove that I worked there AND this nasty mold infested area is where they “clean” equipment and mix nutrients.', 1524583625),
(1480, 327, 'daniel P', 'https://www.google.com/maps/contrib/116497855963660996627/reviews', 'en', 'https://lh3.googleusercontent.com/-5M_SCZ5FTJ8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3-Rr_WMO30ayfJSA3uqKZh45A_Lw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Always and in an out deal, I\'ve never waited more than 20 minutes here, bravo!  edit:  Obviously does not understand what supply and demand means. They introduced vape oil which is really good about 3 weeks ago and haven\'t been able to keep up with demand. Supposed to have gotten a shipment in the morning, and by 1 pm its sold out. I guess I\'ll just spend my cash elsewhere until they get it together. -1 star\nEDIT: its been in stock every visit for a few months now.', 1520195146),
(1481, 328, 'Kate callahan', 'https://www.google.com/maps/contrib/116250404655683360212/reviews', 'en', 'https://lh3.googleusercontent.com/-Eqwgc5HrEvQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1KH8oJn5SlURtbHzBkwUWHLq-Zug/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Excellent staff, incredibly knowledgeable about products. Kind and patient without exception. Products do what they are supposed to do. Great selection and very high quality. Amazing amount of edibles to choose from. I\'ve been going here for a year and wouldn\'t think of going anywhere else. Never had a bad experience. I suggest anyone writing a negative reviews of this place must have ulterior motive. VERY well run. Thanks Ermont. So glad to have you in Quincy.', 1523625989),
(1482, 328, 'Adam E', 'https://www.google.com/maps/contrib/112034227123176363745/reviews', 'en', 'https://lh5.googleusercontent.com/-PMFWkLcvMHs/AAAAAAAAAAI/AAAAAAAAROk/KmY6TyLPQV8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '3 months ago', 'Would be my top dispensary if they were more consistent with their products. With that being said, they are producing so many different edibles that I can’t be mad at the lack of consistency. The pricing is solid and you can’t always buy more than an 1/8th but the flower is very nice(black widow & sherbet are top notch). The staff is helpful, friendly and kind. Good parking and the location is hidden but close enough to the highway to be considered convenient. Top 2 dispensary in the state ', 1518123917),
(1483, 328, 'Lauren Bizek', 'https://www.google.com/maps/contrib/106756329774614157203/reviews', 'en', 'https://lh5.googleusercontent.com/-CUFHXoIny_8/AAAAAAAAAAI/AAAAAAAAAII/4a8yGi96QbY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'Best dispensary in MA., great consistency in strains, by far has the highest quality flower - They also have a diverse selection of edibles, and literally every single employee has some type of unique and helpful insight/knowledge regarding cannabis. Cannot wait for blueberry pie to return, it makes my life better!', 1521402068);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(1484, 328, 'Eye See', 'https://www.google.com/maps/contrib/103787381331374278939/reviews', 'en', 'https://lh4.googleusercontent.com/-0LW2hzKSHLk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq05WPpTRsItwZ9X0mhjpVNL30f0sA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Medicine man was my fave strain here! One of the most potent strains in the city! Black widow was strong too and my second best for smoke when they are out of Medicine man. Place is packed towards closing time and they run out fast around then. Hate it when I\'m in line and they just sold the last of what I came in for! Ermont has legit bud. Dayum good! Seen?', 1521242995),
(1485, 328, 'Tedster 9000', 'https://www.google.com/maps/contrib/116505123989599340691/reviews', 'en', 'https://lh3.googleusercontent.com/-H-iFqAgheHk/AAAAAAAAAAI/AAAAAAAAACg/TlyT51HJkVA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '4 months ago', 'I just visited Ermont for the first time today. They have a good selection of various types of flower products. The staff is friendly and seem knowledgeable about the product. They seem like a good option for patients in this area and I look forward to seeing what new products they are offering as time goes on. I\'ll definitely be returning.', 1516955893),
(1486, 329, 'Sarah Coletti', 'https://www.google.com/maps/contrib/116359587023592844485/reviews', 'en', 'https://lh4.googleusercontent.com/-PLJH4T_F_vg/AAAAAAAAAAI/AAAAAAAAVoE/QMfYaixF3wk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'They\'re absolutely amazing! Definitely check their website before you head to the dispensary so you know what they\'ll have on hand when you arrive. I also recommend checking out the sales. They offer $50 off a purchase of $100 or more for your first-time purchase. Very friendly, knowledgeable, staff, totally recommended!!!', 1527052406),
(1487, 329, 'Richie Pelosi', 'https://www.google.com/maps/contrib/113237671306778900710/reviews', 'en', 'https://lh3.googleusercontent.com/-ZpIcpzA2RcE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0wGFwbQTaQX56D5-p5zQMib9IcSg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'The nest medical marijuana dispensary i have been to yet! One of their bud tenders, Jason, was more then helpful. He explained everything in full detail, answered every single question i had. Was very kind and patient with me. I would reccomend this dispensary 10 out of 10 times! My new favorite spot and they have amazing products.', 1527441624),
(1488, 329, 'Maggie Mcginn', 'https://www.google.com/maps/contrib/108620367849792222542/reviews', 'en', 'https://lh5.googleusercontent.com/-mFgdCa0ZWsE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ZPLjLA5OMCZa56Vvnf0ypB1fwyg/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 weeks ago', 'Great place.. nice people... good bud.. and awesome hours.. They have a good selection bit I wish it would vary more different strains', 1525983591),
(1489, 329, 'James Fleming', 'https://www.google.com/maps/contrib/102163286755608771447/reviews', 'en', 'https://lh3.googleusercontent.com/-pAvL1fiMp0Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq12oTe19gOcOs3rZHDnyOoovu7Y8w/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a week ago', 'Everyone who works here is great to you and informative.  Now the draw back is it is just like a visit to the RMV when it is busy.  Take a ticket and wait.  The also have some of the most expensive flower compared to other pharmacies.  I have been going here for three years but am expanding to another pharmacy just as far away as Salem  I will always go back to Salem cause they taught me so much but it will no longer be the only pharmacy I visit', 1526838093),
(1490, 329, 'Eye See', 'https://www.google.com/maps/contrib/103787381331374278939/reviews', 'en', 'https://lh4.googleusercontent.com/-0LW2hzKSHLk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq05WPpTRsItwZ9X0mhjpVNL30f0sA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Amazing flower. So amazing, that one toke of smoke and you\'ll fly like a butterfly and think you\'re a bee. Some mellow choices as well if you like the couch. What a magical place filled with friendly green gems. Took away my depression and anxiety. Right on!    ', 1521245489),
(1491, 330, 'Vincent D. Farina', 'https://www.google.com/maps/contrib/111199651672110887411/reviews', 'en', 'https://lh4.googleusercontent.com/-6YAYtY5wiU8/AAAAAAAAAAI/AAAAAAAAAQ8/cJFGAARh7iA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Great experience! The consultant was very informative and friendly, along with the rest of the staff. The doctor was very well educated in alternative medicine. 110% satisfaction ', 1516295848),
(1492, 330, 'Annmarie Conant', 'https://www.google.com/maps/contrib/101872240654524470459/reviews', 'en', 'https://lh6.googleusercontent.com/-19vMT4Q5xxw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq07qiv95hMMiPvhSQBAgzxnj2K8iQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'I paid almost 300 for my card and just did 45 days in jail the Webster police don\'t recognize a medical marijuana card total waste of money now I got 3 and a half years in jail and community service and drug tests for over a year I wish I never wasted my money at canna care just another way for america to take advantage of you! I wouldn\'t recommend getting a marajuanna card the cops will still arrest you.', 1518894082),
(1493, 330, 'Gina Goldenberg', 'https://www.google.com/maps/contrib/108203009768862646834/reviews', 'en', 'https://lh5.googleusercontent.com/-F-Mi2lZZGu4/AAAAAAAAAAI/AAAAAAAADW4/32gzdHgX0VA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'I was in and out. Patient Rep and Doctor and office staff were beyond helpful, very professional and just all around awesome. EVERYTHING was explained at great detail and all rules and regulations were explained so I felt very comfortable about my decision. Would recommend to anyone needing guidance', 1508763390),
(1494, 330, 'DankDabs AllDay', 'https://www.google.com/maps/contrib/111127233791581209874/reviews', 'en', 'https://lh4.googleusercontent.com/-kRuJuKf87fs/AAAAAAAAAAI/AAAAAAAAACU/QkmfSfEffFA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Today was my 3rd trip to Canna Care. I love this place. The staff is great. I have extreme anxiety and going anywhere is stressful but everyone @ Canna Care always makes me feel comfortable and accepted. I always have a great convo with everyone that works at Canna Care while I\'m waiting to see the Doc too which is nice. All the Doctors have been excellent. Good people. Stay medicated 24/7/365. Peace and Love.', 1502512374),
(1495, 330, 'OSRS UNI', 'https://www.google.com/maps/contrib/104689335151958476118/reviews', 'en', 'https://lh5.googleusercontent.com/-U4GcA5sFGHQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq10COp0n1VncTYfyuGKQ2K6E90iqw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Amazing staff and doctor very knowledgeable I defdinitley reccomend.', 1520295253),
(1496, 331, 'Dan MacDonald', 'https://www.google.com/maps/contrib/115236376199090146751/reviews', 'en', 'https://lh6.googleusercontent.com/-1ZpzGbiRGy0/AAAAAAAAAAI/AAAAAAAAAEU/4JFwWjLdWMU/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'The staff is always friendly and helpful and very knowledgeable of the different products they support. They\'re so good their stashes don\'t last long and run out of products at different times but the heavy stuff they always have. The location is convenient via bus, or other local transportation they do have a parking lot but small and they are always busy. Don\'t get scared by the police out front they are there for the site and their customers protection as well traffic duty. I highly recommend this location (no pung intended)', 1527286730),
(1497, 331, 'Sarah Coletti', 'https://www.google.com/maps/contrib/116359587023592844485/reviews', 'en', 'https://lh4.googleusercontent.com/-PLJH4T_F_vg/AAAAAAAAAAI/AAAAAAAAVoE/QMfYaixF3wk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'This was my first time ever going to a dispensary. The visit couldn\'t have gone any better! The staff were all educated and extremely helpful. They have a wonderful savings program if you visit them within the first thirty days of obtaining your Medical Marijuana License. Also, absolutely beautiful location! I will certainly be visiting again and I completely recommend them!', 1524972619),
(1498, 331, 'Will Knapp', 'https://www.google.com/maps/contrib/116710279528969788325/reviews', 'en', 'https://lh5.googleusercontent.com/-3VuG5IwnLgQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2WmNAWd7kP8rAEAkIV122Y134mLg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Best dispensary I\'ve found! I regularly drive out of my way to go here. They have a large selection and the online menu has always been accurate. If you are a new card holder or have just renewed ask about the $200 in gift cards (4×$50 gift cards to be used on separate visits)', 1524773018),
(1499, 331, 'Bob P.', 'https://www.google.com/maps/contrib/100358541069443463598/reviews', 'en', 'https://lh3.googleusercontent.com/-tN1g0WoDg7g/AAAAAAAAAAI/AAAAAAAAAOk/moTgZQo97aA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I went with my friend. We both have I just wanted to check it out. Everyone on staff was so polite & helpful. Much better than the  Salem dispensary. Prices were actually affordable! I\'ll  definitely going back to NETA!', 1524948220),
(1500, 331, 'Unknown Trouble', 'https://www.google.com/maps/contrib/111121846097338527139/reviews', 'en', 'https://lh6.googleusercontent.com/-sM6BD_mgSas/AAAAAAAAAAI/AAAAAAAABE4/qrA4ExtqY7s/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Love this place. Their selection is one of the best, and prices some of the lowest in the city. The staff is excellent, really know their stuff and always happy to help. They even have an express lane if u don\'t wanna shop around, know what u want, and just want to pick up. Wont go anywhere else', 1522363312),
(1501, 332, 'craig mccoy', 'https://www.google.com/maps/contrib/115798142911770456941/reviews', 'en', 'https://lh4.googleusercontent.com/-JO-XthBz-ww/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2p-AqRJ3RBZ_gA_jhjLFi6JhbAJg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Been A long-time patient-excellent service great doctor', 1527714860),
(1502, 332, 'Laura Kocen', 'https://www.google.com/maps/contrib/112964803024373913205/reviews', 'en', 'https://lh6.googleusercontent.com/-MCAlQnAbKnM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq05wafzPhWJMghH1Hs_SgT0Vf0u_g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Outstanding professional service. Highly recommended!', 1490298821),
(1503, 332, 'Julie Foster', 'https://www.google.com/maps/contrib/115511211171041791979/reviews', 'en', 'https://lh3.googleusercontent.com/-8SQ23301V3o/AAAAAAAAAAI/AAAAAAAAABM/YivTTOgV738/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Professional and experienced', 1495557948),
(1504, 332, 'Jen F', 'https://www.google.com/maps/contrib/104022433671542394276/reviews', 'en', 'https://lh4.googleusercontent.com/-sggCaraNruo/AAAAAAAAAAI/AAAAAAAAITk/taElrAruQBg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', '', 1524068606),
(1505, 333, 'Kristen Bates', 'https://www.google.com/maps/contrib/114065060238646811968/reviews', 'en', 'https://lh4.googleusercontent.com/-dulRXQK8xzo/AAAAAAAAAAI/AAAAAAAABM4/ZBtWQZ5UOrk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I\'ve had nothing but wonderful experiences each time I come to NETA Northampton. The staff are all so welcoming, knowledgeable and patient. Outstanding quality and reasonable pricing. Very clean & comfortable environment.', 1521412734),
(1506, 333, 'justin roman', 'https://www.google.com/maps/contrib/108378389363434138207/reviews', 'en', 'https://lh6.googleusercontent.com/-WAI9um5IURQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0TYZgCeoVAcoqjfUPlhg5cG2cHKQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 months ago', 'Great location great staff an assortment of items my only issue is the flowers look great they just lack flavor. I went yesterday and tried two more flavors and was very disappointed in the overall taste of the products once again. I’m hoping sometime soon this problem is fixed because I genuinely enjoy the environment it’s just the flowers aren’t great even with the variety they offer. Please work on your flavor profiles as there are some very tasty weeds in this world.', 1522003356),
(1507, 333, 'Jessica Pearson', 'https://www.google.com/maps/contrib/100160673721004765463/reviews', 'en', 'https://lh4.googleusercontent.com/-Dix94CBRRmA/AAAAAAAAAAI/AAAAAAAAAF0/RVFCiwNcPc4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'NETA Northampton is very attentive, thorough and knowledgeable about all products they sell. They also have multiple discounts that help make your medicine more affordable. Would def recommend this dispensary to new patients as well as seasoned.', 1525195211),
(1508, 333, 'gloria cruz', 'https://www.google.com/maps/contrib/109736925682976381142/reviews', 'en', 'https://lh5.googleusercontent.com/-2qzeuj8q_SQ/AAAAAAAAAAI/AAAAAAAAx94/NJ0XtTegjtg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The best dispensary I tried rise I wasn\'t impressed NETA I hope you stay amazing and get better you in my opinion set the standard for distribution of medical marijuana and others should follow those same guidelines your the best', 1526936799),
(1509, 333, 'Anna H.', 'https://www.google.com/maps/contrib/112286810643792044347/reviews', 'en', 'https://lh3.googleusercontent.com/-aL4Gh9dRvQU/AAAAAAAAAAI/AAAAAAAAFHI/2PWPizmnZLU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'They treat you like you\'ve been their friend for years. Good product, good attitude, great staff. Thank goodness they\'re here!', 1524030325),
(1510, 334, 'Marshall Hurley', 'https://www.google.com/maps/contrib/108966978883507589665/reviews', 'en', 'https://lh3.googleusercontent.com/-EPeXTrA9AP4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2qr4HR4HAF7fR1SRD7Rh8wtevxHg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'The front desk people were very helpful and nice which was their only saving grace.  After I waited an hour to meet with Dr Doran she wouldn\'t give me enough time to discuss my concerns saying she had others to get through and just got up out of her chair to get me out.  She was rude and dismissive and refused to discuss the risks mentioned in the handouts given. She asked what risks and when I showed her the list she mockingly said she knows them by heart like it\'s a joke. So do you know about the risks or not? Either way, how would a geriatric doctor know about younger patients like myself? Later that evening I received a call from Rob the director saying that Dr. Doran said we had more questions. I guess that\'s suppose to make up for it in her mind. I scheduled a later time to speak with him and I never heard from him again.', 1523555447),
(1511, 334, 'Diana Shelton', 'https://www.google.com/maps/contrib/108639310878248169263/reviews', 'en', 'https://lh4.googleusercontent.com/--lHcSRPgdjw/AAAAAAAAAAI/AAAAAAAAOGM/085HFGDc1kc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I was reluctant to get certified because I didn’t think I wanted to get stoned all the time &  that was what some people who got their cards for using them for.\n\nI explained that to the doctor at MedWell and he explained to me that there are plenty of products with CBD not THC and that is what makes you healthy in the body He very careful he made sure I understood as he explained that the THC is a mind thing will CBD is a body thing  and that CBD would be my friend.\n\nPatient & friendly, knowledgeable doctors and staff await you at MedWell if you are concerned about getting your medical marijuana card I highly recommend you contact them!!', 1516505986),
(1512, 334, 'Heidi', 'https://www.google.com/maps/contrib/113441664220758413675/reviews', 'en', 'https://lh5.googleusercontent.com/-IvdBjTWVhrw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3iBXkswKgz4tjAT4kXg9Rz0yuAmA/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '10 months ago', 'Wonderful experience.  Staff was friendly and professional.  The Doctor was very nice and I feel was truly concerned for my well being. I received several informational handouts to help me with this process and guide me in decisions.', 1500484797),
(1513, 334, 'John Obrien', 'https://www.google.com/maps/contrib/112665300472054551110/reviews', 'en', 'https://lh3.googleusercontent.com/-1KNMiCQuED8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq33jPKcjfqdJNcUXyKdriWRX1cJyA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'I had a similar experience myself with the female doctor rushing patients with no emotion.  You\'d think she was forced to work there or something. The front desk unfortunately wasn\'t very friendly either', 1520264745),
(1514, 334, 'cannabis king', 'https://www.google.com/maps/contrib/109917446435741994645/reviews', 'en', 'https://lh6.googleusercontent.com/-fVZ0uGfmn8Y/AAAAAAAAAAI/AAAAAAAACmI/V5gQ3ZNXRdQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '6 months ago', 'The Cannabis King was very pleased with his visit Dilly Dilly', 1510010861),
(1515, 335, 'Michael Mulkern', 'https://www.google.com/maps/contrib/106333446811595205527/reviews', 'en', 'https://lh6.googleusercontent.com/-oU5rhpEqgGY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0SL7T4OFIgDkM3MIoC0ama4UvOXw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Excellent staff and atmosphere. Dr rideout is extremely knowledgeable and passionate about medical cannabis and his patients. Answered all my questions and concerns. The rest of the staff was great as well, made my renewal visit a breeze. Would absolutely recommend this location to a friend or family.', 1516333611),
(1516, 335, 'Karen Lindquist', 'https://www.google.com/maps/contrib/101779058361220479544/reviews', 'en', 'https://lh3.googleusercontent.com/-Gxa5PBO082c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3dMlOSrpM4gvl_PLAt3iwtowH2YA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'The clinic was very helpful with getting me the physical and ascertaining that I would indeed benefit quite a bit from medical marijuana.\n\nI am happily on my way to receiving my medical card and getting help with my medical issues. Thanks!', 1516310119),
(1517, 335, 'Brad V', 'https://www.google.com/maps/contrib/100642144689781866930/reviews', 'en', 'https://lh3.googleusercontent.com/-rnzu5Z-kk7k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2R6ouF2WmIjt0WSJywnJ78BmpgPw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'Called before driving into Salem.  Got there and was turned away.  Not cool.', 1515868491),
(1518, 335, 'Devin Monahan', 'https://www.google.com/maps/contrib/113465518465216300813/reviews', 'en', 'https://lh6.googleusercontent.com/-syt_BtCLVpg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1NXUMYYWOshcJqH0-rEyoZ0pGyTA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Great experience overall, everyone who works in the office is very knowledgeable and friendly! Everyone was more than willing to answer the questions I had as well. I arrived at 11am on a Thursday and was through the entire process at 1:30pm, so keep in mind coming here that the process does take awhile. If you want to avoid a wait arrive early and be patient! Will definitely be returning here for my renewals.', 1502999873),
(1519, 335, 'Angel Torres', 'https://www.google.com/maps/contrib/112876562867295498166/reviews', 'en', 'https://lh6.googleusercontent.com/-L4AsO-Xhkn4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2gXfctVMPW5X9YPHOQ3hRB_fPahw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'got what i needed .... and very nice people ..', 1517667817),
(1520, 336, 'Bill Wright', 'https://www.google.com/maps/contrib/116273006726112628403/reviews', 'en', 'https://lh6.googleusercontent.com/-z4tGPqNC_-o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1GDHPWIhs38jdF8WzivW1MUQPkxQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'On a Saturday I found THC and selected them as nearby, reasonable prices and good reviews.  Made an appointment same day and showed up.  Very basic waiting room, but clean and well run.  Courteous and helpful staff answered my questions and medical interview was thoughtful and caring.  Patient receptionist guided me through documentation and instructions for registration with State.  Later had to call with question and got very good instructions.  Thanks, THC, today I made it through the State registration process!!  BTW, I\'m not a relative or prior patient.  I just wish more places were as professional as THC was.', 1522096785),
(1521, 336, 'Jay Vitale', 'https://www.google.com/maps/contrib/105246090488391530949/reviews', 'en', 'https://lh3.googleusercontent.com/-y4-8ynBC5Xg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0HgjHleeiRO3i-7XlKhnJL4qgXag/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '5 months ago', 'Found the Holistic center on line..I was treated like a patient. Also they call me for follow ups to see how I am feeling..i recommend This place .', 1512748730),
(1522, 336, 'Vince R', 'https://www.google.com/maps/contrib/102860137510947351668/reviews', 'en', 'https://lh5.googleusercontent.com/-GDfjMCpEcSM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq18Bd1m1cW-JiXjpF-k5yIaxzs-aQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'The staff here was great. The nurse was really knowledgeable and helpful. My appointment was over quickly and I felt very taken care of. Glad I chose to come here and I definitely recommend them :)', 1503633771),
(1523, 336, 'Ray J', 'https://www.google.com/maps/contrib/113503053349653979088/reviews', 'en', 'https://lh5.googleusercontent.com/-KbgxOOPKjd4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0vosRNlnAJBIIUgwZhNvpEhpUVDw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'Brought all the documents required. Showed up and was certified the same day. Easier then I thought. Def will be back when it time to re register. Fast and easy', 1458322987),
(1524, 336, 'Jennifer Hurley', 'https://www.google.com/maps/contrib/107553121919001967814/reviews', 'en', 'https://lh3.googleusercontent.com/-qARQwfEIaBc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq101yTfmommQuqxZ7Ka-aXzLz3-2Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'Such a good experience! No problem finding the place & it was such a fast and easy process. Friendly staff who answered all my questions! Very professional & I had no problem getting an appointment.', 1458260866),
(1525, 337, 'starchild34', 'https://www.google.com/maps/contrib/115208828195221707640/reviews', 'en', 'https://lh3.googleusercontent.com/-yPyAqyXqpfw/AAAAAAAAAAI/AAAAAAAAABc/CpUEsSKccZM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'This place gets 5 stars for a reason. I walked in without an appointment last Tuesday and ended up waiting 20 minutes tops. Every single person that I dealt with (I\'m awful with names) was friendly and extremely knowledgeable. After walking out of there about 30 minutes after being seen by the first person, I left with a wealth of knowledge and my road to wellness begins now! I can not thank you all enough.', 1518645290),
(1526, 337, 'Patrick Colburn', 'https://www.google.com/maps/contrib/117773713471991322144/reviews', 'en', 'https://lh6.googleusercontent.com/-7yD4Xz_xt_k/AAAAAAAAAAI/AAAAAAAAAEY/4lT5o76iGvY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'The entire staff are extremely helpful, kind, and really make you feel comfortable for your entire visit. I went with a friend for support and the moment they walked in and talked to the woman at the front desk they felt relaxed and safe.', 1520570736),
(1527, 337, 'Daniel Mijares', 'https://www.google.com/maps/contrib/117193309606748925552/reviews', 'en', 'https://lh3.googleusercontent.com/-WhJr6hu3E-g/AAAAAAAAAAI/AAAAAAAAABY/ijTBqOA_0BM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Both times I have come here they\'ve been very professional and informative. They make you feel very comfortable and are always happy to answer questions. They take time to counsel you (if needed) and explain the process of signing up and how to properly use product. The fee you pay to register also allows you to come back whenever (free of charge) for any additional help you may need, which I thought was pretty cool! I have very much enjoyed my experiences with Canna Care Docs.', 1504109248),
(1528, 337, 'bits of wisdom', 'https://www.google.com/maps/contrib/111515417612897408704/reviews', 'en', 'https://lh5.googleusercontent.com/-E-QvcArb4g0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1tWDRYvKm0fB2NWvpIrsUNh6vBIg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'They said it would take about an hour. It took way longer. I met with some educational people and some other kind staff, totaling a little over an hour. Dr Caplan was really great - answered all of my questions, like an encyclopedia of useful information. He makes it obvious why Canna Care Waltham has the reputation it does. I was referred by a friend for Dr Caplan, and everything she said was true - I wish all doctors were like this guy. I\"m psyched for our follow up visits -  talking with him is like going to Cannabis school! Too bad it took so long.', 1518931520),
(1529, 337, 'Laura Rogaishio', 'https://www.google.com/maps/contrib/117665715587246117947/reviews', 'en', 'https://lh6.googleusercontent.com/-bIYJ9fnBkUg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2xzsYlzQHAXKBAu3Y5MDgMeKrPHQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'It was such a pleasant experience.Very Professional,Yet,down to earth,and So helpful.I went to Waltham.The Dr.was exceptional! The Whole staff, The  Receptionist greeted so polite and helpful.Oscar,My Nurse Really Helped me with an orientation,He was Most helpful.He also took my vitals,and was very professional.After I saw The Dr.Who was GREAT,I saw Doug.He assisted me in the Final steps,towards getting My card.He was Exceptional Also! I wish I could give more Stars! They were ALL WELL Above 5 Stars!   :)', 1504895715),
(1530, 338, 'Jordan Sweeney', 'https://www.google.com/maps/contrib/104518548974111978726/reviews', 'en', 'https://lh5.googleusercontent.com/-EVy1kXc2lEU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0YnBZF5N35Ve8cZsB38tvxHd0erg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Love this place! Every time I go it\'s a nice and welcoming environment that treats everyone with respect. Jamie especially is thorough and goes above and beyond in helping with everything.', 1502812833),
(1531, 338, 'eny marsh', 'https://www.google.com/maps/contrib/110297671322376297686/reviews', 'en', 'https://lh3.googleusercontent.com/-iaGFywxRwK4/AAAAAAAAAAI/AAAAAAAAATI/zhjjDr4rp7w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Super helpful and informative people in this office!  When I called with questions after my appointment Jaimie was friendly and had the answers I needed.  During my visit, all three of the people I had contact with in the office were friendly, courteous and patiently answered any and all questions I had!', 1501705318),
(1532, 338, 'Guy Tarara', 'https://www.google.com/maps/contrib/100636037695326929341/reviews', 'en', 'https://lh5.googleusercontent.com/-C9KFfLKgP28/AAAAAAAAAAI/AAAAAAAAACA/ppEYfYfREAA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'I absolutely adore the staff. Super friendly. Thank you for making my life easy! I love Raechel and Jamie!!', 1502382334),
(1533, 338, 'Carol Marandola', 'https://www.google.com/maps/contrib/111682887714426211856/reviews', 'en', 'https://lh3.googleusercontent.com/-JyC0mWYFiAI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2G8UBd7Vbwp2S6chq58PXH-ownMQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Excellent Service. Very Helpful! 5 Stars!! Thanks for the help registering Jamie!', 1502288894),
(1534, 338, 'Josh R', 'https://www.google.com/maps/contrib/107979722836022171232/reviews', 'en', 'https://lh3.googleusercontent.com/-NvUMnWB-j80/AAAAAAAAAAI/AAAAAAAACQ8/p_YlDeT8Vi8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'These guys were great, very professional, and willing to take the extra time to answer all my questions. ', 1502719224),
(1535, 339, 'Daniel Fagundes', 'https://www.google.com/maps/contrib/101348361375652870810/reviews', 'en', 'https://lh3.googleusercontent.com/-JiLgjIQi480/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2VtXv5M2iau6GR3GfbpP6djOfB_A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I\'ve never been to any other MMJ provider but I can say that Canna Care takes cares of you and just about everything, paperwork, etc. The phone staff is phenomenal and actually cares about helping you. The Doctor I had my first visit 2 years ago in Fall River was great and friendly and answered any questions I had. Several friends have had same experience as myself, positive. 2 years ago the Seekonk, MA office was 3-4 hours wait time for a walk in. But I\'ve been assured that bigger staff has cleared that problem. I\'ll see for myself this week. Any glaring changes I\'ll post update, but from prior experience I definitely recommend Canna Care Docs.', 1523542903),
(1536, 339, 'Melissa Reed', 'https://www.google.com/maps/contrib/106437313058940930695/reviews', 'en', 'https://lh3.googleusercontent.com/-LIBVaI2Mim8/AAAAAAAAAAI/AAAAAAAAABM/T4GE2_wg79Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Great place. Caring professionals. The wait was forever but once you actually see the doctor he is very knowledgeable and compassionate.', 1519052280),
(1537, 339, 'Rossy Morillo', 'https://www.google.com/maps/contrib/102759112883131536889/reviews', 'en', 'https://lh4.googleusercontent.com/-Nd8ADnjp7jI/AAAAAAAAAAI/AAAAAAAABWg/VqXK7AyWUrs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'This place was amazing . At first i was a little nervous but the first time i walked in the receptionist was so nice and considerate. Then when i went to my appointment everything was explained to me in a concise and knowledgeable way. They made me feel like i was just a regular patient all kindness, professionalism, and care. Even if you just want some information on what this amazing plant can do for you this is the place to go. Thank you so much for helping me guys i felt heard and important.', 1504915737),
(1538, 339, 'Chris Jimenez', 'https://www.google.com/maps/contrib/101912399754071836720/reviews', 'en', 'https://lh4.googleusercontent.com/-FkfS0H9tAZ8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3k8i2aFYZLoWv7IdJkm3lfavvvWQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'Awesome but get here EARLY, like 15 min before they open or you\'ll be waiting all day to be seen', 1521637564),
(1539, 339, 'Christine morton', 'https://www.google.com/maps/contrib/115491679717451467996/reviews', 'en', 'https://lh3.googleusercontent.com/-_ivoOO-U824/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0vC75OMGhBamIuFWhir2qri_nq4g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Great place! The staff is very helpful and cautious of your needs. The doctor has a great personality!', 1518541010),
(1540, 340, 'Kevin Cintorino', 'https://www.google.com/maps/contrib/104324743822268118142/reviews', 'en', 'https://lh6.googleusercontent.com/-zJ5S1BzRWzc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3qstyoteHFD6mvXIPP3sfciE3t7g/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '10 months ago', 'Great staff fast service for a walk in clinic, I recommend an appointment day especially if renewing like myself. Love canna care docs I\'ll be back again to renew, you guys help me co time to access high quality properly dosed and labeled medicine and I can\'t thank you enough for that! #cannacarestoughton ', 1500246851),
(1541, 340, 'Stacey Voight', 'https://www.google.com/maps/contrib/118403643191293737367/reviews', 'en', 'https://lh3.googleusercontent.com/-inqbmexVJcE/AAAAAAAAAAI/AAAAAAAAABg/p5eyxy9pvv0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I was extremely nervous going in. I had put it off for years due to it. I got there before opened. Waited with others to be let in. The gentleman at front of the line I thought was a patient because he was in a wheel chair. Taught me not to assume. Lol the entire staff there is top notch. They take all time not rush you answer all your questions. Then the doctor was like no other. He asked me to tell him about myself in general. Really listened. Wish I could give more then 5 stars. Worth it highly recommend the visit. Thank you so much.', 1486388449),
(1542, 340, 'Snake Pleskin', 'https://www.google.com/maps/contrib/104630102781186827890/reviews', 'en', 'https://lh4.googleusercontent.com/-GTHBR98-g1o/AAAAAAAAAAI/AAAAAAAAEto/nXg_WlWm-fk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Amazing staff and the doctor was beyond compassionate. I brought a close friend with stage 4 liver cancer and the doctor returned his $200 saying we do not charge are stage 4 patients. Great people!', 1490532408),
(1543, 340, 'Travis Broussard', 'https://www.google.com/maps/contrib/113975294354311552612/reviews', 'en', 'https://lh5.googleusercontent.com/-s5rlvgNBmag/AAAAAAAAAAI/AAAAAAAAAB4/kSrhcD5Pnhk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'The staff were kind, compassionate and left me without any questions. I would recommend this office to any veteran.', 1471005432),
(1544, 340, 'Alex De Andrade', 'https://www.google.com/maps/contrib/108074076643649065886/reviews', 'en', 'https://lh3.googleusercontent.com/-8n5c3xKCU8Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1JKo8wgInZIBjcNE_odAAyIG9n2Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 years ago', 'I recently went for an evaluation at Canna Care Docs in Stoughton, and my experience was very positive. I spoke with one of the regional managers prior to meeting the doctor, and she answered each question I had with knowledge and enthusiasm. She also provided a packet of information on classes, legal, and other relevant knowledge pertaining to cannabis. \n\nThe receptionists were also pleasant, efficient and knowledgable on registration processes. Once I met with the physician, we spoke person to person, and it never once felt like I was a patient who should be ashamed about seeking marijuana as a form of treatment. These people are passionate, and really know their stuff. \n\nMy only negative in this entire experience was the wait time, which was roughly 3 hours. I was told that Thursday afternoons between noon and 3pm are the busiest time to be seen for an evaluation. \n\nI recommend anyone going to Canna Care Docs, my advice is if you have a legitimate reason for wanting your medicinal marijuana card, please bring any supporting documentation or medical reports to substantiate and expedite your process. They will deny you without good cause or documentation. ', 1422647063),
(1545, 341, 'Patricia Kinahan-Smith', 'https://www.google.com/maps/contrib/113939174699651204717/reviews', 'en', 'https://lh5.googleusercontent.com/-9P9u9y3rlQw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1__wBgqHl4dyMm8vBmwN_tFQWRrA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I was referred to Schwartz Medical Group and I was amazed at the level of service I received.  I was so impressed that every person in the office from the receptionist,  Doctor\'s Assistant and Dr. Schwartz himself was so kind and helpful.  They all took the time to answer all of my questions and concerns and time was not an issue.  I do believe the level of care far exceeded any expectations I had prior to my visit.  I would highly recommend them.', 1496103880),
(1546, 341, 'edward priestley', 'https://www.google.com/maps/contrib/100641306030249177185/reviews', 'en', 'https://lh3.googleusercontent.com/-vv0aXOlxt10/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0gcI4etmOmzbnK8JNpvj8TvXI3mA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '7 months ago', 'My nurse practitioner , is the best of the best , her name is Mary Dockery. Before I came to Shwartz I some what was worried about my health. I have had two other doctors in my life.  She by far blows them out of the park. Mary is so up with it she shares with me every detail. Also sets life goals with me. She found me a phyc doctor with in a week! Mary really is re assuring. Very intelligent to say the least. Also Rita & Stephanie are great at reception, superb customer service. \n\n      Shwartz Medical really did change my life. As a patient I highly recommend Shwartz to anyone seeking help with primary care.', 1508894063),
(1547, 342, 'S P', 'https://www.google.com/maps/contrib/102049956504089380956/reviews', 'en', 'https://lh6.googleusercontent.com/-alUwNR05fpc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0sx4OwA77Ex4AIqteS-SVaG5eHYQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I had a wonderful experience here yesterday. People here really showed compassion and enthusiasm about what they do. Usually in offices I feel like a burden and out of place, but not here at all! All of my questions and concerns were answered attentively even after asking question after question. Even the locations of the best/affordable dispensaries in my area were pointed out to me for my convenience.Thank you Canna Care Docs!', 1526586983),
(1548, 342, 'Michael Kelly', 'https://www.google.com/maps/contrib/104580595271469544376/reviews', 'en', 'https://lh6.googleusercontent.com/-Vqd3NjlIDoU/AAAAAAAAAAI/AAAAAAAAAFc/mAnb4PIbpXo/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '8 months ago', 'When I arrived there were 3 people in front of me. It took an hour and a half for the doctor to see the first patient. Didn\'t have time to sit around for 3 more hours so I left without seeing the doctor. The staff was great though', 1505062045),
(1549, 342, 'Stephen Budau', 'https://www.google.com/maps/contrib/105713585741570781524/reviews', 'en', 'https://lh4.googleusercontent.com/-Xc0fdM2mBZw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ByK9jLgK7kbEXcjwfdkCHSDLnAg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'They make it very easy. Nice people..', 1512766525),
(1550, 342, 'Steven F. Wayne', 'https://www.google.com/maps/contrib/101776841937870081701/reviews', 'en', 'https://lh6.googleusercontent.com/-E45M2NfW5to/AAAAAAAAAAI/AAAAAAAAAQM/c4L_L8KumQY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Feel at ease...I can\'t imagine another Center taking care of your needs any better than the folks in Peabody. They were an excellent support and they know what needs to go down. They are  a Friday and Saturday walk-in  center so no appointment  is necessary Bring any med. doc. you can get (or not), and a good book  to read while you wait for your turn and be on the way to getting the assistance you need. You are on your way to gettitng your chronic, debilitating and/or deteriorating conditions taken care of. A big thanks to the staff.', 1493837775),
(1551, 342, 'Shaun Tufts', 'https://www.google.com/maps/contrib/109641459826422473828/reviews', 'en', 'https://lh5.googleusercontent.com/-_B9EbmEg5rg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ARKEPG4qxXO2df-PU1UksIJP2tQ/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 4, '7 months ago', 'Good experience. Everyone was nice and informative.', 1507599534),
(1552, 343, 'sashutt', 'https://www.google.com/maps/contrib/105424782169906910246/reviews', 'en', 'https://lh6.googleusercontent.com/-yCXgptDV698/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1qF2s9ndtE9VooCf8PUpgzQNapDQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'a month ago', 'Ordered once from here and won’t be ordering again. I don’t smoke flower often- mostly edibles and concentrates- so I can’t speak to the quality of the flower. The good news is that the edibles were great- very tasty and good potency. The bad news is that their concentrate cartridges for the vape taste TERRRIBLE. Like, straight up burning plastic. Not good at all. Very disappointing considering I spent $200+ on cartridges and batteries. The battery broke within 5 min of using (the button cane clean off). When I called they said that they don’t do returns or exchanges unless it’s defective. I told them that the cartridges taste like burning plastic, to which they said “Yup. That’s normal”..... um..... maybe for you, but not for the rest of dispensaries across MA. Would have loved to exchange my cartridges for some flower or more yummy edibles, but since that isn’t possible, I’ll be taking my business elsewhere. Such a shame- as I loved the idea of delivery!', 1525116415),
(1553, 343, 'Umair Khan', 'https://www.google.com/maps/contrib/114084268796725747419/reviews', 'en', 'https://lh3.googleusercontent.com/-Ege2ZYNEEps/AAAAAAAAAAI/AAAAAAAAAEQ/TMYHLm1BQ4c/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 weeks ago', 'Love this place and the options they offer here. Just wish they would update their menu often. Twice I went to get something and it was out of stock and not updated on site.', 1526424143),
(1554, 343, 'Courtney Taylor', 'https://www.google.com/maps/contrib/102327346218722663541/reviews', 'en', 'https://lh5.googleusercontent.com/-Jroe15Cd0qI/AAAAAAAAAAI/AAAAAAAAC7g/eGVpFbe2Yus/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'Just left there drove all the way from fall river. Love the staff, the prices and the product. I definitely recommend in good health. ', 1525203240),
(1555, 343, 'James Wing', 'https://www.google.com/maps/contrib/109836302161010673303/reviews', 'en', 'https://lh4.googleusercontent.com/-5bygwlJV4So/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3-2ocg-trB52mCjLuHELkJ0Ybg4w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great staff! Always fantastic bud and yummy edibles. Highly recommend this place. Try the dark chocolate coffee bar it’s out of this world and you will be too after eating one ', 1521055164),
(1556, 343, 'Samantha Smith', 'https://www.google.com/maps/contrib/107380140332601475025/reviews', 'en', 'https://lh3.googleusercontent.com/-oFiJBk78glo/AAAAAAAAAAI/AAAAAAAAARY/Xjj-fdp5VLo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'So convenient for those of us who don’t want to travel all the way into the city. First time here I bought edibles (Lozanges) which were amazing. Staff is super nice and my first experience was all around fantastic. Not overwhelming like other places can be', 1518368408),
(1557, 344, 'Susan S', 'https://www.google.com/maps/contrib/109455747494517277878/reviews', 'en', 'https://lh5.googleusercontent.com/-n5ef6ZiKwgc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3ng6GQ0pKwdMzuRnL-6YxAgLIOfg/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '4 weeks ago', 'Very glad Greenfield is open, it\'s much closer than Boston.  Easy to find and very helpful and friendly staff. Excellent selection even two days after the grand opening. I will update when I get home and can try the product.', 1525280922),
(1558, 344, 'Donny Butynski', 'https://www.google.com/maps/contrib/108541465830545701807/reviews', 'en', 'https://lh5.googleusercontent.com/-X05ldGq7vxY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2j1RUKa3jIu_bO_Km3rJaxdDFHKQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I went to the soft opening today.  Everyone was great. The store is nice and organized.Great bud selection. definatly will be returning', 1524691681),
(1559, 344, 'Lynn Langevin', 'https://www.google.com/maps/contrib/108081938810271981102/reviews', 'en', 'https://lh6.googleusercontent.com/-a-JCjdZpkf8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq21Dnbs0G-6QkBGUbKeRJUO4dj_QQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'The staff was very knowledgeable and very quick to help me with all my questions. I went in on the soft opening of the dispensary,  and was greeted and helped by a very friendly staff.', 1525268841),
(1560, 344, 'Melody Whelden', 'https://www.google.com/maps/contrib/114995621705080549935/reviews', 'en', 'https://lh5.googleusercontent.com/-JXpbz3aSYsc/AAAAAAAAAAI/AAAAAAAAAA8/ctPN5GadHvY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'very happy to have a place close to Charlemont and the service is really great. product is fresh and tasty!', 1526330561),
(1561, 344, 'Jennifer Eagles', 'https://www.google.com/maps/contrib/102501601174236687537/reviews', 'en', 'https://lh5.googleusercontent.com/-mSKTgZttVXo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2XGxX0SMCh4E4T-ju0gYtcunOQdw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'It\'s a totally different dispensary than I\'ve ever been to...it is discrete,theres no odor and they\'re employees are knowledgeable and nice. Definitely recommend to anyone getting into Medical Marijuana.', 1525225694),
(1562, 345, 'Scott Drew', 'https://www.google.com/maps/contrib/107576244193644445468/reviews', 'en', 'https://lh5.googleusercontent.com/-SFSpMQ89FTE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq18P9O63Jh4SqGFQBzF4qLOk_7msA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This place has the best staff.  Very friendly and knowledgeable.  Courteous and professional.  I always leave feeling taken care of.  They also have high quality products.  They do call ahead appointments only.  I usually give them a 20-30 minute heads up that I\'m coming.', 1522777657),
(1563, 345, 'Rachel Berube', 'https://www.google.com/maps/contrib/111244602567855858411/reviews', 'en', 'https://lh4.googleusercontent.com/-jwMpSd2Jp8U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1jTJeOT8JXvja89N_wxu5Q_z3ohw/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a month ago', 'The staff is super nice and helpful if you have questions. I personally just find it to be pricey for what you get, my flower has been on the dry side the past couple visits which means it burns faster and lasts shorter. When you pay 50 for 1/8, you wouldn\'t expect to be handed a bottle thats been packaged 2 months ago...', 1524345010),
(1564, 345, 'Mike Sherockman', 'https://www.google.com/maps/contrib/103485542604402657386/reviews', 'en', 'https://lh3.googleusercontent.com/-6FVo7r13NiE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3LRtB62M1tyvdOwcgrfEX_WdXzWQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Love this place, the staff is excellent. Very clean establishment. Great selection of medicine. Great job at keeping everything up to date! Stopped by today, noticed you now have a display for flowers that are available.', 1513616109),
(1565, 345, 'Crystal Blais', 'https://www.google.com/maps/contrib/111208834050615673958/reviews', 'en', 'https://lh5.googleusercontent.com/-g2yJme3pWFg/AAAAAAAAAAI/AAAAAAAAABA/-voXOaMk8ZQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'This is by far my favorite!  Comfortable atmosphere, helpful staff and they deliver.', 1525789093),
(1566, 345, 'Tyler Quintana', 'https://www.google.com/maps/contrib/109838874881513437866/reviews', 'en', 'https://lh5.googleusercontent.com/-Z7-DEIAH_OI/AAAAAAAAAAI/AAAAAAAARVg/4wIdUGLqPco/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '6 months ago', 'Always a pleasant experience here, everyone is all smiles and very helpful. I’m always in and out, there is rarely a wait time. I have been to clubs in Cali, Nevada, Colorado and every club in Mass and this place is the best as far as customer service goes. Prices are descent and menu is still expanding but for a two year old place it excels like it’s been in business for a decade.', 1510962262),
(1567, 346, 'Jennifer Donlan', 'https://www.google.com/maps/contrib/116527843037076108342/reviews', 'en', 'https://lh4.googleusercontent.com/-kR_eJONY65Q/AAAAAAAAAAI/AAAAAAAAC_4/rkYW_cwkGCU/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', '', 1522346391),
(1568, 346, 'Derrick Sanders', 'https://www.google.com/maps/contrib/101200997268582168829/reviews', 'en', 'https://lh3.googleusercontent.com/-ze752yYJC4Q/AAAAAAAAAAI/AAAAAAAAAE8/8Ins5ReykUY/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'a year ago', '', 1480216275),
(1569, 347, 'Kelly Maynard', 'https://www.google.com/maps/contrib/101040825565635021902/reviews', 'en', 'https://lh6.googleusercontent.com/-20eS6NbaGbA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Lb92PhR7ONqLgXzM8C-P-Trx3SA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'First time going in and I have to say the staff is extremely knowledgeable and so very nice! The best experience ever! Thank you for all that you do! ️', 1518305595),
(1570, 347, 'Lilla Collins-Malone', 'https://www.google.com/maps/contrib/115337899624778019139/reviews', 'en', 'https://lh5.googleusercontent.com/-KTk1nhW0dzI/AAAAAAAAAAI/AAAAAAAABP4/KD9WWHyzQHY/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '3 months ago', 'It\'s so cool to have a dispensary in Georgetown! Everyone is so polite, and smart about a product. You don\'t have to feel stupid if you don\'t know anything, these guys explain it all.', 1518982262),
(1571, 347, 'David Lightbody', 'https://www.google.com/maps/contrib/116053930657958403707/reviews', 'en', 'https://lh5.googleusercontent.com/-TsiAZ49ljoI/AAAAAAAAAAI/AAAAAAAAAEE/7Xde3LZXkVA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Very nice,helpful,they make everyone feel relaxed and comfortable and don\'t rush you out the door I give this place a 5/5 and I have only been two three places including healthy pharms and I like healthy pharms shadder is the best bye far but there flower lacks big time but makes up for it with the price cut $12 prerolls but they have been closed and it\'s been awhile almost 3 weeks and it suxs bad I hope you guys open again sooner than later', 1520471468),
(1572, 347, 'Chris Rabbit', 'https://www.google.com/maps/contrib/109756545624395538660/reviews', 'en', 'https://lh4.googleusercontent.com/-MFil9vkOmzs/AAAAAAAAAAI/AAAAAAAAAE4/Bln1_x3VUWE/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Great staff, excellent accountability and transparency throughout their business. A welcome addition to dispensary scene.', 1522677468);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(1573, 347, 'Martin Heller', 'https://www.google.com/maps/contrib/100730482429607730997/reviews', 'en', 'https://lh5.googleusercontent.com/-3X5ivPAU7Hw/AAAAAAAAAAI/AAAAAAAATb4/v3m6zEGH6R4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'Healthy Pharms in Georgetown is currently my go-to MMJ dispensary. Like any business that grows its own crops, some MJ strains and forms of processed cannabis tend to go in and out of stock, but I can usually find what I need.\n\nThe staff is knowledgeable and friendly, and I don\'t feel rushed when I\'m placing orders. If I ask about a particular strain, there\'s always someone to tell me its effects, and if I ask about a desired effect, I\'ll always get a few suggestions about what might fit the bill. If I want to smell a strain (which tells me quickly about the terpenes), there are jars of flower samples.\n\nOn the rare occasions that I\'ve had problems with products, I got a credit without any grief.', 1517776029),
(1574, 348, 'Susan S', 'https://www.google.com/maps/contrib/109455747494517277878/reviews', 'en', 'https://lh5.googleusercontent.com/-n5ef6ZiKwgc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3ng6GQ0pKwdMzuRnL-6YxAgLIOfg/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 3, 'in the last week', 'Easy to find, check in as new patient was the easiest. No option to smell, touch, or see products. Display is poor. Staff friendly and polite. Will update when I get home and try it.', 1527263097),
(1575, 348, 'Shawna Geary', 'https://www.google.com/maps/contrib/104913679775307968737/reviews', 'en', 'https://lh4.googleusercontent.com/-hf4Fm838vAE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0WSZRLJKjX71PdFK8rwY-EwF3p_A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The staff are very friendly and helpful.  They have a great selection of flower, concentrates, edibles, and infusions. Check out their menu online.  They have the best flower prices around!', 1525118080),
(1576, 348, 'Cheryl Fischer', 'https://www.google.com/maps/contrib/102384625104460098236/reviews', 'en', 'https://lh5.googleusercontent.com/-E59voJl54ec/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq12mkXLfOIa0ygOIOHTk9KoiWlWHw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Experience people who know what they are doing.  The girl new just what I needed for my cancer. Went home smoked some weed thought I\'d take a nap and before I knew what happened I woke up 3 hour\'s later no pain either.', 1526502813),
(1577, 348, 'John Green', 'https://www.google.com/maps/contrib/115989455080655704689/reviews', 'en', 'https://lh6.googleusercontent.com/-gc6bTCtYSSw/AAAAAAAAAAI/AAAAAAAAAEw/KwUV8AdYBYw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Knowledgeable folks, great selection, helpful. Product well screened for pesticides and such.', 1527096857),
(1578, 348, 'Frank Demarinis', 'https://www.google.com/maps/contrib/117753653920128947349/reviews', 'en', 'https://lh5.googleusercontent.com/-l7lHfDr62mo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3SRC7yQjbILWpzaKeTrX_GOT0qLw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'The place is unbelievable and the grow team is producing the best product in mass.', 1521990154),
(1579, 349, 'Donald Grant', 'https://www.google.com/maps/contrib/107567092025899984494/reviews', 'en', 'https://lh3.googleusercontent.com/-vEUV90caa9A/AAAAAAAAAAI/AAAAAAAAxMw/r2GBu-w3ttM/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '3 months ago', 'So far not bad. No edibles though they are coming soon. Everything is pre-weighed which is not ideal. The staff is minimal but very friendly. They didn\'t offer a lot of information and seemed a little unsure about THC content in the bubble hash, but overall it was a good experience. I will repeat visit. especially for the new patient discount on the first two visits. Prices are high, but being a patient means the tax isn\'t part of my pricing. Reasonable overall for a dispensary, perhaps a little high on the flower. More concentrate would be great as a regular. Understanding that the growth cycle is complete here is important to me and I was a little surprised the counter person wasn\'t more forthcoming about the whole process. I even prodded him a little by asking if he liked his job and he responded Yes, of course, but didn\'t really elaborate much or seem to have much pride in the fact that it is all in one building. Nice clean friendly.', 1519762357),
(1580, 349, 'Scott Benham', 'https://www.google.com/maps/contrib/103447204146440008598/reviews', 'en', 'https://lh3.googleusercontent.com/-cJ2dlauH-Nk/AAAAAAAAAAI/AAAAAAAAAEs/W1rmKTSCcuE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Great place, and great location. The staff are very knowledgeable and professional. Plus they are all just so nice, patient and a pleasure to work with. They are the only place in the Worcester area worth going to. They have a great selection, and are still growing.  Highly recommend going to Cultivate in Leicester ', 1519710058),
(1581, 349, 'Aaron Little', 'https://www.google.com/maps/contrib/107032873016815033056/reviews', 'en', 'https://lh6.googleusercontent.com/-K7J4OoM8MrU/AAAAAAAAAAI/AAAAAAAAycs/d1z5jE3l9Ok/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'Great products in a clean spacious storefront. Friendly and knowledgeable staff. Convenient location and rarely any kind of wait or lines. Really glad this place is here.', 1524198127),
(1582, 349, 'charlie alcorn', 'https://www.google.com/maps/contrib/114259040384312304459/reviews', 'en', 'https://lh6.googleusercontent.com/-8mjTvU5-CmQ/AAAAAAAAAAI/AAAAAAABWhM/IWXYIk6NEu4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'Great place and helpful staff. Great product as well. I would highly recommend Cultivate.', 1524192750),
(1583, 349, 'Ryan Houlihan', 'https://www.google.com/maps/contrib/100455136124256692809/reviews', 'en', 'https://lh6.googleusercontent.com/-oAt3oOOjzHo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0tGTcapx9CNonW6qtYHFsSOPwVcQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Very helpful employees as well as quality product! Prices are a bit high but manageable', 1525555854),
(1584, 350, 'Stacy Shorr', 'https://www.google.com/maps/contrib/100276778558846425644/reviews', 'en', 'https://lh4.googleusercontent.com/-ZQ_Y3ww7hi8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2xWTvYqsVVhjNZE6-ywXtGPi6zuA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'Nice variety of products. They have been adding new edibles, with different dosing. Knowledgeable budtenders. \n\nPleasant, welcoming, clean, very zen environment. Seating area, tea or water offered. Short paperwork on 1st  visit. \n\nThey have different deals, for example, $200 off, in $25 each, for new customers. Also, they have frequent special offers; I suggest signing up for regular emails. Oh yeah, and they deliver!', 1527216728),
(1585, 350, 'Niveria Laureano', 'https://www.google.com/maps/contrib/114670649590655661415/reviews', 'en', 'https://lh4.googleusercontent.com/-GnvpWSXjjNU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq24BGbhfKjl9bfoHenYJn4hQzGN7Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, 'a month ago', 'Nice place, people there are great and helpful. They had a  pretty good selection of products, but just like the other dispensaries the prices are high. Especially for a lot of us medical patients. Vets, people on disability and others just can\'t afford the prices these dispesarys want.', 1524314122),
(1586, 350, 'Daniel Richards', 'https://www.google.com/maps/contrib/116711996120278331044/reviews', 'en', 'https://lh4.googleusercontent.com/-o_gWqXFx1Kc/AAAAAAAAAAI/AAAAAAAAAWQ/Cuuzp6g1bLE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'So I am a 60 old retiree looking to get relief from pain issues that i can’t seem to get resolved.  Today i made my first  visit to a marijuana dispensary and it was a very pleasant experience.  Parking was plentiful, staff was friendly and knowledgeable.  I didn’t know exactly what to expect, but the staff made me feel welcomed.  They provided me with a variety of options, and helped me make the right decision.  I will surely be back.', 1522968651),
(1587, 350, 'Joel Colegrove', 'https://www.google.com/maps/contrib/110167897454698447790/reviews', 'en', 'https://lh5.googleusercontent.com/-vZBMGTF_wzU/AAAAAAAAAAI/AAAAAAAAAGo/hPLB5MJMlaM/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Revolutionary was my third Clinic visited and they were very accommodating to my handicap accessible needs, and they offer hardship and discounts for handicap patients. I am a patient of Partners MS center, and hope they will offer the same $200 match that NETA offers for new patient promo.... it\'s the best clinic visited so far, I will continue to report and rate marijuana dispensary clinics for handicap accessibility and promotions.', 1524560569),
(1588, 350, 'Alan Rauta', 'https://www.google.com/maps/contrib/113255022073559702149/reviews', 'en', 'https://lh5.googleusercontent.com/-yPTOOenO2yo/AAAAAAAAAAI/AAAAAAAAA14/mMyOU7n5GT8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'Interesting set-up. You talk to a “pharmacist”, make your selections and pay at the counter, then you pick it up at the window and exit through another door. Super cozy and friendly. Their CBD vape is great!', 1526338469),
(1589, 351, 'Susan S', 'https://www.google.com/maps/contrib/108626352642283660868/reviews', 'en', 'https://lh3.googleusercontent.com/-I0OpKf4lipA/AAAAAAAAAAI/AAAAAAAAAcI/2VoMcT9om80/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a month ago', 'I was so surprised to see that Hanover has a dispensary already open! I thought it wasn\'t til next year. So anyway they are open and absolutely wonderful! There is a 25% discount for first time buyers! They accept the masshealth discount! Their prices are cheap and the strains are plentiful! 2001 Washington Street Hanover! I was lucky enough to have Julie for my first experience! She is so nice,  knowledgeable and funny!! It\'s a quick and painless process in and out! Check out their website with a full menu! Love this place and so close!', 1524049106),
(1590, 351, 'John Walsh', 'https://www.google.com/maps/contrib/106899915887463705812/reviews', 'en', 'https://lh4.googleusercontent.com/-JFXrIclTYkc/AAAAAAAAAAI/AAAAAAAABUo/HOMyl3RHu9c/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 months ago', 'I have gone here a few times everyone is right up there with knowing  the product. Everyone is always happy to take great care of you. I a. Slightly handicapped and they always help me with a chair. In and out in just a few minutes.', 1517592921),
(1591, 351, 'jorge gomez', 'https://www.google.com/maps/contrib/103763009255493394940/reviews', 'en', 'https://lh5.googleusercontent.com/-N0P3ZLMNnUg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1oz1w7zX2lhfyoogiXzSLC6qQWpQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Do not go there. I bought a pre roll yesterday, and when I got home, I took it out of the package and it looked pathetic and tampered. Out of principle, I returned today to exchange it, but the person had a terrible unapologetic attitude towards the situation and it ended up being a bad experience. I am a good customer! I am never returning!', 1524926088),
(1592, 351, 'George Lagos', 'https://www.google.com/maps/contrib/116013842882003779391/reviews', 'en', 'https://lh3.googleusercontent.com/-wouksB0yGy4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0NIrzth89n1p9fKENu2Jprb7hpoA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I love the fact that all the staff is so nice .  The flower is right on   Curaleaf is a great deal at 40 1/8.    CURALEAF is great', 1518615681),
(1593, 351, 'Melanie Crowell', 'https://www.google.com/maps/contrib/102879753592480642489/reviews', 'en', 'https://lh6.googleusercontent.com/-hcS4W6QA4Dk/AAAAAAAAAAI/AAAAAAAAAM8/eoTX-1CiuQ0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I can’t say enough good things about this dispensary. Friendly staff, excellent selection and great prices. Definitely will be back .', 1510529063),
(1594, 352, 'Ryan Bengle', 'https://www.google.com/maps/contrib/115391393364105084747/reviews', 'en', 'https://lh3.googleusercontent.com/-qBeSB6Qut9M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0_5LTjEE7kcSGY-WbBNLD7l01feg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Great experience. Very helpful.', 1522947769),
(1595, 352, 'Erica B', 'https://www.google.com/maps/contrib/106215832576237266281/reviews', 'en', 'https://lh6.googleusercontent.com/-ocNzcY4O10Q/AAAAAAAAAAI/AAAAAAAAPCs/0pP3uOMj73A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Shes good and helpful, hope the renewal process goes smooth too.', 1516564803),
(1596, 352, 'Joey Boud', 'https://www.google.com/maps/contrib/103991371086715869901/reviews', 'en', 'https://lh3.googleusercontent.com/-iRz4t0BLcjw/AAAAAAAAAAI/AAAAAAAAABk/_jG2uN7Vssw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Very helpful and understanding', 1526343188),
(1597, 352, 'Andrew Lamb', 'https://www.google.com/maps/contrib/115344082091708826666/reviews', 'en', 'https://lh4.googleusercontent.com/-aepuQ_9afLc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2L4o18Xnd6U1D8TeUgs40UnZ3zBQ/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '11 months ago', 'Grate service wonderful Dr I learned alot and was explained so I could understand I will be​ returning and will recommend friends and also the best price around', 1497898420),
(1598, 352, 'Kimberly Dotiwalla', 'https://www.google.com/maps/contrib/101064475512602955262/reviews', 'en', 'https://lh5.googleusercontent.com/-Ce2T1P-hEmA/AAAAAAAAAAI/AAAAAAAAAC8/-2QPHkAiNiw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Dr. Kapell is a warm and intelligent woman. I  highly recommend her.', 1493322303),
(1599, 353, 'Sean Sullivan', 'https://www.google.com/maps/contrib/114294449121462479052/reviews', 'en', 'https://lh4.googleusercontent.com/-w9tfV3hnR4w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq392jxbzbD6PWcfqiDqFj7hoAinSg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Today is my third year applying/reapplying for my medcard. Dr. Getz and Nicholas (hoping I got the spelling right) are the heart and soul of this office, and they both show nothing but compassion from the minute you call to make an appointment up until you leave the appointment. The original process was as simple as sending over my medical records, talking to Dr. Getz about harms and benefits cannabis can provide, methods of ingestion, and how I feel cannabis could help me. The renewals have been a simple sit down with Dr. Getz, reviewing how I have felt cannabis has helped treat my illnesses over the past year. I cannot recommend Marimed Consults enough!', 1526474636),
(1600, 353, 'Michael Recor', 'https://www.google.com/maps/contrib/107171867701183369993/reviews', 'en', 'https://lh3.googleusercontent.com/-uZjXxqNk4dg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0uCt1L2AbGCCrVS0mxuqzY9d32MA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'Very professional. Will help you any way they can.', 1526829377),
(1601, 353, 'fred slattery', 'https://www.google.com/maps/contrib/108180092193074711054/reviews', 'en', 'https://lh6.googleusercontent.com/-Hun-_VXARFs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0PG5cYDQswC1TVDdvVh_hrVSnOQg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Very well organized, Dr. goes over symptoms and either approves or rejects you a medical card.', 1521358342),
(1602, 353, 'MIND OF MAHONEY :-P', 'https://www.google.com/maps/contrib/101903777824158434649/reviews', 'en', 'https://lh3.googleusercontent.com/-THBk6du7qN4/AAAAAAAAAAI/AAAAAAAADDQ/k8nN2ezSjPw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'Im interested in Making apointment.  Do you Eccept mass health, if & How much is process how long...\n  Im on suboxin due to Chronic back pain FROM pain pills(10 yrs on subs and NO OPIOIDS).. :-)\n I Smoke marijuana for 20+ yrs..IM 35 NOW.....\n      *** I Have INSOMNIA  Anxiety,adhd,chronic Back pain,ptsd....\nDoes it sound like im Eligable ??and If so i WOULD LOVE GET STARTED....\n             \n      -I sick of Risking Buying GARBAGE MARIJUANA off Streets.\n  Im a Chicoppee Mass Resident', 1504897238),
(1603, 353, 'Max Power', 'https://www.google.com/maps/contrib/110765360845640469612/reviews', 'en', 'https://lh6.googleusercontent.com/-_Xg24fa1hvk/AAAAAAAAAAI/AAAAAAAABRU/4qgaPHx8CrM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'This was the best experience I\'ve ever had with a health care provider.  Dr. Getz is an amazingly caring and enlightened physician with the bravery to help patients who are neglected by the current system.', 1490034996),
(1604, 354, 'Mark Angelo', 'https://www.google.com/maps/contrib/101405137014634297016/reviews', 'en', 'https://lh4.googleusercontent.com/-zjQCE_-tTQY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2v8tsk16CVV726LRuJy1QL0w7gjA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'AMAZING PLACE AMAZING PEOPLE.....AS LONG AS YOU HAVE YOUR MEDICAL DOCUMENTS YOU ARE ALL SET THEY ARE VERY HELPFULL AND FRIENDLY AND THE RECEPTIONIST IS HOT AS HELL!', 1511938754),
(1605, 354, 'Liberty V', 'https://www.google.com/maps/contrib/118389401692618698271/reviews', 'en', 'https://lh3.googleusercontent.com/-Am7Alz8uVuI/AAAAAAAAAAI/AAAAAAAAANc/17zjp5ghZmk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '3 months ago', 'Out of business - at least at this location', 1518120689),
(1606, 354, 'Anthony Baker', 'https://www.google.com/maps/contrib/115572653798814699775/reviews', 'en', 'https://lh5.googleusercontent.com/-HEBi_50Hew8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ybyFDOeSmOrRhwBtRbmmPji60xg/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a year ago', '', 1476906753),
(1607, 355, 'Kim Daly', 'https://www.google.com/maps/contrib/117909829490134803858/reviews', 'en', 'https://lh3.googleusercontent.com/-KKSvrCUH90o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3tgjHNDu8kDxE_Ms_0hYgCrMLNzw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Dr. Altvater is awesome!  He is super helpful, knowledgeable and super friendly!\nThank you for sharing your knowledge and passion for nature’s healer!', 1527620729),
(1608, 355, 'Kathy Grelle', 'https://www.google.com/maps/contrib/116013152428414375070/reviews', 'en', 'https://lh6.googleusercontent.com/-AwYqVc-SAYo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2gmKMNYzB1NUfdnt6pzjObx4kxmQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Very informative. Very satisfied with my visit sorry I did not go sooner.', 1527620463),
(1609, 355, 'Q Fierce', 'https://www.google.com/maps/contrib/113587148514442644122/reviews', 'en', 'https://lh6.googleusercontent.com/-i3ADmtAdXZU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3SpToU7JE4n9Aalq_OAX-4ZkURVA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Dr. Altvater is always available to help and give advice where nevessary.  Very knowledgeable and helpful.  The appointments are quite entertaining, as well- he has a sense of humor and a cute dog.  Thank you, Dr. Altvater!', 1523810762),
(1610, 355, 'Zachary Wilhite', 'https://www.google.com/maps/contrib/104759722336471567042/reviews', 'en', 'https://lh5.googleusercontent.com/-zV8--JuGJqw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2d5WR9HuH1ENwu26NHa2bW5Ja48g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Very professional, well spoken. I would recommend this to anyone looking for cannabis health care. The doctor knows what he is doing, and makes everything easy to understand.', 1516826069),
(1611, 355, 'Mike Steve Matt Cali Kelly Rachael', 'https://www.google.com/maps/contrib/108232308133227669016/reviews', 'en', 'https://lh4.googleusercontent.com/-OEWrB-8rULI/AAAAAAAAAAI/AAAAAAAAOZA/JNarsFM2bEk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '4 months ago', 'Excellant practice and thorough. All they require is medical records and poof! That\'s it!\nYour either in need or not. Period.\nEdit* the 2nd time I needed a card he took my money plus additional fees for processing, administration and another fee to set up my account online or something? Then I waited 2 months and several angry phone calls later, I get my card. I verify that it is good by going online then travel a long distance to a pot shop only to find out the doctor removed himself from being my doctor, rendering my card useless and this man never returned my money. So he kept all my money and never gave me a working card. i contact the BBB and now I am going to the police.\nDO NOT GO TO THIS PLACE! FIND ANOTHER!', 1515709597),
(1612, 357, 'Lilla Collins-Malone', 'https://www.google.com/maps/contrib/115337899624778019139/reviews', 'en', 'https://lh5.googleusercontent.com/-KTk1nhW0dzI/AAAAAAAAAAI/AAAAAAAABP4/KD9WWHyzQHY/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '4 months ago', 'Can\'t believe it took me this long to go get a card! Cost $200 for the visit, $50 to register, and I should get my card in a week', 1515777908),
(1613, 357, 'Andre C', 'https://www.google.com/maps/contrib/116713313922467625765/reviews', 'en', 'https://lh4.googleusercontent.com/-hjuWtZscVO4/AAAAAAAAAAI/AAAAAAAAAwc/sl4-LebHQ8U/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'open fridays ONLY', 1524145332),
(1614, 357, 'Justin Parker', 'https://www.google.com/maps/contrib/116856813850504468899/reviews', 'en', 'https://lh5.googleusercontent.com/-bRZtEDwK6lA/AAAAAAAAAAI/AAAAAAAAAHc/jFd7AzUBlV4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 years ago', 'Excellent Experience. i had to take my grandfather here who suffer from constant pain due to many surgeries on is rotator cuff in his shoulder. These people are compassionate and really care about their patients well being. I cannot express in words how grateful i am for the compassion they had for my grandfather and i would highly recommend Casco Bay to anyone Seeking alternative healing and getting off dangerous and harmful medications, either for yourself of some one you care about. Top Notch Staff and knowledge. ', 1407009674),
(1615, 357, 'Josephine Curiale', 'https://www.google.com/maps/contrib/101415377508482730640/reviews', 'en', 'https://lh6.googleusercontent.com/-p2sD4rfBN0w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2A9Efp2KmrtwwEApzntif5g4L2rg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'Dr. SPIEGEL  is fantastic. This is my third year as his patient. Everyone I know who sees him agrees. He and his assistant Jen are incredibly knowledgeable, caring, and considerate. The appointments are very quick and they are happy to help you with state registration process.  Answered all qurstions, returned calls quickly.  Thankso so much!', 1462333374),
(1616, 357, 'Miss YogaTube', 'https://www.google.com/maps/contrib/109221917454961257110/reviews', 'en', 'https://lh4.googleusercontent.com/-6dlEOlIumoc/AAAAAAAAAAI/AAAAAAAAADU/BFAmSxMOOEc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', '', 1514923855),
(1617, 358, 'Becca West', 'https://www.google.com/maps/contrib/117704976109124440291/reviews', 'en', 'https://lh3.googleusercontent.com/-s9ySVIKFbV0/AAAAAAAAAAI/AAAAAAAAE0E/yKG2A8P3eTU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Dr. Altvater is one of the most amazing, caring, and knowledgeable doctors I have ever seen. I don’t say that lightly, as I have had severe health problems for the last 13 years, and have seen many different doctors, the good, the bad, the competent, the incompetent, the caring, and even the abusive.  Other medical marijuana doctors I have seen, I would charitably refer to as “doctors”.  Dr. Altvater is an incredibly talented and knowledgeable doctor with a background, not only in medical marijuana (which he studied in Israel, where the study of medical marijuana is far ahead of where it is in the US), but also in anesthesiology, and pain management.  He is also incredibly empathetic towards his patients and treats all of them as people, not just a chart number.  I wouldn’t recommend going to any other medical marijuana doctor.  He has really changed my life for the better, and for that I am incredibly grateful.', 1509209714),
(1618, 358, 'K. MacIntosh', 'https://www.google.com/maps/contrib/102539173745298438454/reviews', 'en', 'https://lh6.googleusercontent.com/-fqyTcfscNLs/AAAAAAAAAAI/AAAAAAAAANM/MNU1Gje0oYA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Great doctor. Great guy.', 1525092240),
(1619, 358, 'Michael Marashian', 'https://www.google.com/maps/contrib/109603199627816029126/reviews', 'en', 'https://lh3.googleusercontent.com/-vEnkLtpwiXw/AAAAAAAAAAI/AAAAAAAAABc/P7PU-fpQpFo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'High marks for Dr. Altvater and everyone associated with Delta 9 Medical Consulting.  If you are in need of any medical marijuana work for the state of Massachusetts, you cannot do better than to work with Dr. Altvater.', 1462219857),
(1620, 358, 'Alex B', 'https://www.google.com/maps/contrib/105538221224261344203/reviews', 'en', 'https://lh6.googleusercontent.com/--_oe79Xoe_E/AAAAAAAAAAI/AAAAAAAAAGc/7Wxhpi08X5Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '7 months ago', 'The guy is a jerk, very rude', 1507739733),
(1621, 358, 'Frank Cioffi', 'https://www.google.com/maps/contrib/111912973791699698531/reviews', 'en', 'https://lh4.googleusercontent.com/-ldqssgT_kqM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1dZx5z7IpvlapV7Jg2zHAMWFEO8w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 years ago', 'Dr Alvater and his associate provided excellent care and counseling about my conditions, Rheumatoid arthritis and PTSD. He spends as much time as necessary to speak to my questions and conditions. I have and will continue to recommend a him to any/everyone I know who is living with pain and/or physiological issues. Kind, understand and considerate experience with Dr Alvater and Delta 9 medical consulting !', 1373563276),
(1622, 360, 'Theresa Gately', 'https://www.google.com/maps/contrib/104893779858121211636/reviews', 'en', 'https://lh4.googleusercontent.com/-CaQgrtITqUQ/AAAAAAAAAAI/AAAAAAAAAIM/Ih3snZRTvhA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '9 months ago', 'The staff was kind, helpful and professional. I seen Dr Bring, he was kind, informaive and concerned. I became educated and learned other self supporting methods to care for my condition. I will return in 6 months. I look forward to seeing the doctor and staff again in the future.\n-Theresa', 1503795359),
(1623, 360, 'Nick Musial', 'https://www.google.com/maps/contrib/105726072822876637863/reviews', 'en', 'https://lh4.googleusercontent.com/-ACrUk_g5U54/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0vAOVP_bXLDicxUxg45GN-tIh7Cw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'One of the most amazing life changing experiences I\'ve ever had in the medical field thank you guys and I hope that this type of treatment countinues for those who know and I hope it spreads to those who don\'t it\'s time to realize and expand all the benefits that cannabis has on the human body let\'s keep this going and growing in popularity thank you for taking the time to reach out and give me the chance to say how amazing this whole process is and I can\'t wait to continue my journey to better health to be able to live a better life', 1499633979),
(1624, 360, 'Justin Pickering', 'https://www.google.com/maps/contrib/105187728642370870122/reviews', 'en', 'https://lh6.googleusercontent.com/-ocACOlGuIwc/AAAAAAAAAAI/AAAAAAAAAAw/Ta-8pvKYPQE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'Candace (Regional Director), Nikki (Receptionist/Admin), Eva (RN), and Dr. Truong are helping a lot of people. Many people have been suffering with traditional Western medicine (pills/hospitals, etc.) for a LONG time. A new generation knows down deep that the \"pill\" method is only part of the puzzle to healing a human being. Integr8 Massachusetts is a welcoming place with very kind people who listen intently to your problems and are genuinely interested in your care. Also, check out the website and read up on the credentials of the people who work there - all graduates from major universities in their fields. Integr8 MA is THE FUTURE of health care in Mass. I am so happy that I went. They gave me hope that I can make actual headway in healing a condition that has had me in its grasp for 12 years. Thank you Candace, Nikki, Eva, and Dr. Truong. I am so glad we are working together and have a feeling we will be doing lots of collaboration now and into the future. CHEERS! - Justin', 1498313497),
(1625, 360, 'Mr Snuffles', 'https://www.google.com/maps/contrib/104019097302329727194/reviews', 'en', 'https://lh6.googleusercontent.com/-iEubbLJ32OE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1oVExYinqVuAG7O2vXf3vB2uygDA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '9 months ago', 'for an empty office...the wait is very very long.  45 minutes after my scheduled appointment is when they saw me, i am literally the only one in the office waiting.  the appointment itself seems useless-going through the motions to collect the money(it took about 10 minutes).  i will go somewhere else next time.\n\neach year is a different doctor, they seem to rotate their staff a lot.\n\ndo your job!', 1503063448),
