(1637, 363, 'Maggie Rombach', 'https://www.google.com/maps/contrib/104548852683119621257/reviews', 'en', 'https://lh3.googleusercontent.com/-4ZwyQ1N5ak0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1pKV44fJFX69ae2OsIgKDmMmyApA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I went here to get certified for my medical marijuana card and I\'m definitely coming back for my renewal. I\'ve never been to a certification clinic before so I was pretty nervous. It was a great experience. The office is clean, employees are professional and kind. 3 of my friends have already gone here to get their cards too! They made it so easy and simple for me. I never really write reviews unless the experience I had was really really bad or really really good. So thanks Greenlight!', 1511916528),
(1638, 363, 'Gmk Masonry', 'https://www.google.com/maps/contrib/103000649857523894233/reviews', 'en', 'https://lh4.googleusercontent.com/-VOCTy6SPxl8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1jV2sznkW55XLV9GOT71oxfSJOLQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'They will keep trying to take care of any problem until it is resolved.', 1519424921),
(1639, 363, 'Max S', 'https://www.google.com/maps/contrib/115888777716973621181/reviews', 'en', 'https://lh3.googleusercontent.com/-piOczI_AQ3k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq26OqhxR0FjNqbl8Vlt5hZhQ4NhkA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '9 months ago', 'This review is talking about this place BEFORE it went under new management I have no idea if the same disrespectful doctor is still there. \nI posted a real review about this place 2 years ago and received a threatening phone call from the owner also the only male doctor at the place 2 years ago to take down the review \"or else\".  I needed 2 doctor appointments at the time because I was a minor but with 32 pages of medical documents it wasn\'t that hard to get signed ( after this place)there were only 2 doctors at the time one male and female. The female doctor was very nice, knowledgeable, respectable, and professional. The 2nd appointment I went to I got turned down by the male doctor for a reason that had no connection to anything we were dealing with. And then they kept the money from my first appointment (still have been robbed by them to this day) and wanted to charge me to get MY medical records back that i handed to them.', 1502311657),
(1640, 363, 'jon adamson', 'https://www.google.com/maps/contrib/104468093256014387189/reviews', 'en', 'https://lh6.googleusercontent.com/-CvsTdMRkYi4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0srpYFftBD32dWvDpVs4nS8tZVWw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Easy good at what they do', 1527262459),
(1641, 363, 'Tom F.', 'https://www.google.com/maps/contrib/117649371493549267403/reviews', 'en', 'https://lh5.googleusercontent.com/-o60GW71P2lw/AAAAAAAAAAI/AAAAAAAAAAw/pmwiPyGdA98/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Been coming to green lite for 4 years now and have always had a great experience every time I have come.  Today I saw Dr Rob for the first time and she was very knowledgeable about the medication rules and laws. Debbie took care of checking my application and helping me get it ready to mail.  I was in and out in less that an hour!  Awesome work ladies at Green Lite, you all are great :)', 1465330880),
(1642, 364, 'John Kettle', 'https://www.google.com/maps/contrib/108875771156385360685/reviews', 'en', 'https://lh6.googleusercontent.com/-86oh44ifFhU/AAAAAAAAAAI/AAAAAAAAHNY/z6XeHGDYXUg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I loved it. I  was amazed at how friendly the staff was. I was in and out faster than a normal visit to the doctor\'s office', 1517636091),
