(1644, 364, 'Aaron Mann', 'https://www.google.com/maps/contrib/116681191478792185116/reviews', 'en', 'https://lh6.googleusercontent.com/-dg8UnRS1CrM/AAAAAAAAAAI/AAAAAAAAEZw/OwMffQnvOMw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, 'a month ago', 'Piss poor staff', 1522839254),
(1645, 364, 'Andrew Addiego', 'https://www.google.com/maps/contrib/102353203472786980370/reviews', 'en', 'https://lh6.googleusercontent.com/-6wwjiIGiFT4/AAAAAAAAAAI/AAAAAAAAAAA/_mmFmWdLC6Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 years ago', 'This place is an absolute cancer on the MMMP community. They take full advantage of being the only place in the area that does certifications by charging people $200.00 FOR ONE. For those unfamiliar with the MMMP system looking to get your card for the first time, that\'s $100-$130 MORE EXPENSIVE than just about ANYWHERE in Lansing. Spend the time, spend the gas, go to Lansing (or even Ann Arbor) to get your certification/renewal. These people are crooks.', 1446672936),
(1646, 364, 'Jackie Marske', 'https://www.google.com/maps/contrib/105540267084110434690/reviews', 'en', 'https://lh3.googleusercontent.com/-9BuiYPcpu5Y/AAAAAAAAAAI/AAAAAAAAAEc/xopmSCv2TSA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'Extremely professional & a top notch facility.', 1457037608),
(1647, 365, 'Electronic Clouds', 'https://www.google.com/maps/contrib/101533284561938581551/reviews', 'en', 'https://lh4.googleusercontent.com/--sgbQmP4ygA/AAAAAAAAAAI/AAAAAAAAAKI/49rq5Da6ovg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very enjoyable experience. I would recommend this place for flower prices and quality of the medicine. Nice location not hard to find. The staff here are very friendly and make it easy to find what you are looking for. I will be coming back for future visits. Thank you for providing great medicine to patients who want high quality meds and next level service.', 1523740585),
(1648, 365, 'Danielle S', 'https://www.google.com/maps/contrib/110017827592777397383/reviews', 'en', 'https://lh5.googleusercontent.com/-qGWytdnElXg/AAAAAAAAAAI/AAAAAAAADYo/XXQk1PoeiJY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '8 months ago', 'First visit was to be evaluated by their Doctor. There was a good a mount of paper work to be filled out so I suggest getting that before hand and having it all filled out. But it was nice meeting the doctor who genuinely cared about your well being. The staff was strict with their policies, which is good in my opinion. Them being strict doesn\'t mean that they were rude what so ever. They were knowledgeable and helped me make an informed decision. If you honestly don\'t have any experience with marijuana,just be upfront with them and they\'ll set you up with everything you\'ll need.', 1506968105),
(1649, 365, 'Nancy Hausserman', 'https://www.google.com/maps/contrib/112296040596803269685/reviews', 'en', 'https://lh5.googleusercontent.com/-f9PLn-pHSnM/AAAAAAAAAAI/AAAAAAAAABk/P0dLiV9rzOs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'The employees are very knowledgeable and helpful. I\'m a senior citizen and they answered all of my questions and I had a lot of them! \nThey\'re all very nice and friendly.', 1512498896),
(1650, 365, 'Cheese Puff', 'https://www.google.com/maps/contrib/103103161008187066012/reviews', 'en', 'https://lh5.googleusercontent.com/-r04PRtVAx_4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1fMtpodJb0WEnmMDGKxOwB5_763Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'This place is great. The bud tenders are knowledgeable, helpful, and I think most importantly HONEST. They have a great selection of products that are top quality. It\'s just a great dispensary and I really enjoy stopping in to buy my meds from this place.', 1504179722),
(1651, 365, 'Tamara Hauler', 'https://www.google.com/maps/contrib/108573212363536122172/reviews', 'en', 'https://lh3.googleusercontent.com/-YvG72hQ9oeQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2aaQPXGMZiEZaUa1fjZiMH5hvMCA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Very helpful easy access friendly staff highly recommend', 1513640801),
(1652, 366, 'Aneka Skib', 'https://www.google.com/maps/contrib/102940572488610614079/reviews', 'en', 'https://lh3.googleusercontent.com/-ci_XqlzmqII/AAAAAAAAAAI/AAAAAAAAAIc/f6gUs1wPfik/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'I would have really liked to give this place 5 stars  because the quality is so good! However, I had a really negative experience: after my last visit, the property manager, who should not have access to sensitive patient information, was allowed access to my contact information and full name. My phone number was incorrect, so he then looked me up and called my work to ask for my phone number and contacted me without telling me how he got my contact information, or revealing that he had been affiliated with the shop in the past until I threatened to file a report. He suspected the person I was driving with had committed a minor traffic incident and he accused us of causing it and took video footage from the shop, which turned out to be rather inconclusive and only showed a little scuff mark on his car - aka no damage. We are paying for whatever the repair estimate turns out to be because if we had thought we had actually damaged someone\'s car we would have offered to pay anyway. However, the accident itself isn\'t the issue, it\'s the fact that my personal information was given away without permission along with shop video footage, and this person went so far as to track me down. I would recommend going to Om of Medicine over this place, which is just down the road on Main Street. They protect their patient information there and would never give out video footage.', 1527718150),
(1653, 366, 'James Donahue', 'https://www.google.com/maps/contrib/110952413897264091081/reviews', 'en', 'https://lh3.googleusercontent.com/-XcDcOB3Sa5M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ScJoxg7VUF-tVvfbkLUJuIguyyg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Very overpriced!!!!!! It’s unreal. OM of medicine just down the road is 10x better and they don’t rip you off. It’s much more classy too. The staff there is actually educated on there products. Ann Arbor Wellness is a joke amongst dispo’s.', 1523280385),
(1654, 366, 'Logan Nordby', 'https://www.google.com/maps/contrib/112606772240853045422/reviews', 'en', 'https://lh6.googleusercontent.com/-aGXFI1nsW4g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3IW_EprS4GA_v5B2GTp__fvyDqHw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Excellent selection of quality foods. Extremely helpful and friendly staff. Will definitely be here again', 1517874711),
(1655, 366, 'Andre Thomas', 'https://www.google.com/maps/contrib/107623248784729531048/reviews', 'en', 'https://lh6.googleusercontent.com/-Mey-KU8pcI4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3adnMKsWomUz-1YqlbEu-r-q_WlA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'The dispensary that\'s been around from the Beginning. With Premium Herd and helpful staff. The holistic persona, from where we as patients, and proud of our medical needs being met with Thier products, and consistency of High Quality leaf', 1516027436),
(1656, 366, 'A M', 'https://www.google.com/maps/contrib/115082133052953719118/reviews', 'en', 'https://lh4.googleusercontent.com/-HOvoTyY8SHY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3DbA1Tf6wCCxHiemJm861DUXxAyA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Super helpful and friendly staff, with great bud selection and decent prices! I\'ll definitely be back.', 1513863451),
(1657, 367, 'Erika Katharina', 'https://www.google.com/maps/contrib/114185720901819250062/reviews', 'en', 'https://lh4.googleusercontent.com/-C5JlsD8wc3c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3eaWthhN_-A-U5_tylkfI80MtQrQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'Bloom City Club is easily my favorite dispensary! The staff is friendly, professional and helpful from the second you walk in the door. Eva was able to help me pick out the perfect products I wanted and educated me about the cartridges that I had previously used. I will definitely be returning!', 1527179882),
(1658, 367, 'Dawn', 'https://www.google.com/maps/contrib/115482432611068981397/reviews', 'en', 'https://lh5.googleusercontent.com/-iXDAfOD06Do/AAAAAAAAAAI/AAAAAAAAGTo/lEmS1jTNytA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'This dispensary is an oasis! The service and customer care was beyond par and Shayna was such an educator! The variety of flower is overwhelming in the very best way. I also appreciated the cleanliness and warm sunny atmosphere of the club. The little details are what make a small business great. From the \"funk free\" packaging for medicinals, to the treats offered in the waiting room and the \"swag\" bag gifted to new patients, Bloom is a model of such greatness. I consider this first visit the first of many. \nVery classy operation! Congratulations ladies your business is grand! Hope to see you soon for birthday swag!', 1522115671),
(1659, 367, 'Shaun Amos', 'https://www.google.com/maps/contrib/101871779498310282330/reviews', 'en', 'https://lh5.googleusercontent.com/-5uRCZ86uY3U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3L3lOyh1IYtzfqIGPH5JDYYlYJHw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Bloom to me is the best shop in MI. \nThe staff are so friendly, knowledgeable and helpful. No pressure, they take the time to answer any and all questions.\nVery warm environment from the moment you walk in the door.\nI go no where but Bloom, I suggest you do the same.', 1527176268),
(1660, 367, 'Kaity Stack', 'https://www.google.com/maps/contrib/115997774533968445974/reviews', 'en', 'https://lh4.googleusercontent.com/-7rVHFIgBODs/AAAAAAAAAAI/AAAAAAAAAQI/_Ev4qXn3ddI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'What a great place! Everyone working there is incredibly friendly and knowledgeable. Bernie was the perfect person to work with my mom and answer her millions of questions. He was very kind, patient, and just pleasant all around. He had so much information and did a great job of explaining things. We loved Bernie!!! :) To the owners: GREAT JOB! Your facility and staff are top notch. What a beautiful place!', 1518715107),
(1661, 367, 'Hope Swann', 'https://www.google.com/maps/contrib/100833386754588391362/reviews', 'en', 'https://lh4.googleusercontent.com/-WSF7svfWkzk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1qqUvPbBi7E7PNABbiiSqWSk5kqg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I LOVE Bloom City Club. A year ago, at age 70, I got my medical marijuana card to help me deal with trigeminal neuralgia, the result of getting Shingles in my eye. (I lost vision in the eye.) I was also in breast cancer recovery. I had an hour-long consultation to explore what my options were. The consultation was really helpful and informative and the recommendations were spot on. Every visit thereafter has been most pleasant. The staff is knowledgeable, warm, helpful, and eager to answer questions. That’s why I drive all the way over from Detroit to Bloom City, when there are a bazillion dispensaries much closer.', 1519612816),
(1662, 368, 'Jada noggle', 'https://www.google.com/maps/contrib/106271807302697277581/reviews', 'en', 'https://lh3.googleusercontent.com/-ooXXDPLMpzk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq08PDfyyircvmRWEabBo6aqufQzIw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'Can\'t ever find the store an the phone numbers for a credit union', 1518298866),
(1663, 368, 'James Verhhougstraete', 'https://www.google.com/maps/contrib/118368036381387058089/reviews', 'en', 'https://lh4.googleusercontent.com/-U-KjsGmCN1U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Jo2uB0GHWYAaMpW3QznsxX3ksCQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '2 months ago', '', 1520276079),
(1664, 369, 'Kelsey Morford', 'https://www.google.com/maps/contrib/115588078761635277221/reviews', 'en', 'https://lh4.googleusercontent.com/-nRVpWbpipRA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0FUViNNjJ8wu4-RXMtya6wHAVEKQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This is a tough industry to be in right now having to jump thru all the possible legal hoops, but if anyone is going to thrive it\'s going to be this place. They have excellent, knowledgeable staff who actually care about their patients and the product they\'re selling. They have a convenient scheduling process and always make you feel like a priority. Their inventory works for me! :) Thanks for having our backs guys!', 1521033749);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(1665, 369, 'Aaron Aaron', 'https://www.google.com/maps/contrib/107950676059464925650/reviews', 'en', 'https://lh6.googleusercontent.com/-SWd2TGBYWw8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2RU45QRnWn6aymDwkOhLQ744J7og/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Great place. Comfortable and friendly. Make sure to call or make an appiontment first.', 1526750370),
(1666, 369, 'Kelly Perysian', 'https://www.google.com/maps/contrib/118112717183523254025/reviews', 'en', 'https://lh6.googleusercontent.com/-tE1gCsOhzI4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1MZ-dHx9bWPwtrdr2wYyIhzxos_g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I have a great experience each and every time I visit.\nThe staff is very knowledgeable and helpful and friendly!', 1526927650),
(1667, 369, 'Gayle Grant', 'https://www.google.com/maps/contrib/109867240164459256569/reviews', 'en', 'https://lh6.googleusercontent.com/-PD8jdnVJszE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1hPhz1UOpt3r_k0TJG13GbGeDHCg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Awesome staff very helpful 1990s and they really no medical cannabis very impressed with the service I received', 1522786840),
(1668, 369, 'Tasha VanDeWarker', 'https://www.google.com/maps/contrib/115859319609238599218/reviews', 'en', 'https://lh4.googleusercontent.com/-0l6z38ANFFU/AAAAAAAAAAI/AAAAAAAAEnk/u8BiB9MiFEw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Absolutely awesome place! So very friendly & knowledgeable. The atmosphere is laid back & chill. Can’t wait to visit again!', 1512326612),
(1669, 370, 'Adam Dickey', 'https://www.google.com/maps/contrib/112348104587928035533/reviews', 'en', 'https://lh4.googleusercontent.com/-cf9Z9yTeo24/AAAAAAAAAAI/AAAAAAAAAI0/CqvUBC54ONA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'This place is absolutely amazing. I would recommend it to anyone and have. The staff is courteous knowledgeable and takes care of you. Everyone is always very friendly and the bartenders are very good and help you with any questions you have. I will not go to another dispensary this one is mine = )', 1526596566),
(1670, 370, 'Dimitrie Terpevich', 'https://www.google.com/maps/contrib/105572229079196629467/reviews', 'en', 'https://lh6.googleusercontent.com/-D0kFKp3xB5w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3V2a50oEx66PWURax-p0v0WKJnqw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I have never had a bad experience at this dispo, all of the bud tenders are fantastic people! Keith, Ken, Cali, and Anna are lovely individuals and can help you with whatever questions you have! The prices match the quality of products perfectly and the selection is pretty impressive. Love the atmosphere, never waited more than 15 minute\'s and they are always hooking it up.  I\'ve got a surprise for certain bud tenders the next time a come in for a visit!', 1524148525),
(1671, 370, 'Bubba Bentley', 'https://www.google.com/maps/contrib/108173691127969273496/reviews', 'en', 'https://lh3.googleusercontent.com/-LdU1p8uBc7k/AAAAAAAAAAI/AAAAAAAANOM/XNKv4X590_Q/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a month ago', 'I am grateful for these healers, they are knowledgeable and happy to take care of your needs. They have a curb side service for those who can not make it to their show room. They have a great selection if medical marijuana, from priemium cannabis, to top shelf oils and concentrates, they even have a kick butt selection of edibles! Shout out to Kenny, Will, and Keith! \nState law requires a lock box away from the driver. They do have them there, no fear! Stay medicated!', 1523026021),
(1672, 370, 'Sam Browning', 'https://www.google.com/maps/contrib/100184509108552337017/reviews', 'en', 'https://lh6.googleusercontent.com/-IFZUPiYpUWE/AAAAAAAAAAI/AAAAAAAAAA4/8XrN312HM1E/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '2 weeks ago', 'Everyone here is really helpful! They have a lot of good suggestions and are really good at pointing you in the right direction. Cant wait to come back!', 1526491665),
(1673, 370, 'PUBG With DB', 'https://www.google.com/maps/contrib/115027957779143066024/reviews', 'en', 'https://lh6.googleusercontent.com/-ZWgAr-jJLZ0/AAAAAAAAAAI/AAAAAAAAFro/Dn1mxHLy1fM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This place was awesome! Great parking, good location, good deals friendly staff and very knowledgeable. They literally have anything you can think of! Absolutely recommend and will be going back.', 1522895831),
(1674, 371, 'Carlos Milanes', 'https://www.google.com/maps/contrib/103970599905429213781/reviews', 'en', 'https://lh5.googleusercontent.com/-bBQM1onYu_I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3m8xdkSYpddQ03FleA3Df8kfKTew/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'So we buy 2 quarters today you think if u buy top shelf and pay top $$$$$ the bud attendant could at least give you 7 grams which is a quarter but no both quarters short one 6.9 the other full of stems 75$ for a quarter at least take out the stems .we buy 4.5 ounces a week.not going there again .', 1527454897),
(1675, 371, 'AAron Wood', 'https://www.google.com/maps/contrib/115468358879376450377/reviews', 'en', 'https://lh5.googleusercontent.com/-4LubCWv49W0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0wZZ4DXkeMA_3fl6gko5tZHZYMuw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', '***UPDATE***\nSO IT WASN\'T THERE ATM IS WAS THERE BUD TENDER WHO STOLE MY MONEY DOUBLE CHARGED MY ACCOUNT AND STILL MADE ME PAY CASH BEWARE!!!!! HAD TO CLOSE MY ACCOUNT GET A NEW CARD AND IM STILL DISPUTING THE CHARGES BEWARE!!!!!!!! \n\nWent in was told I could use my debit card. System was down was told I had to use there atm. Used it to bull 20 bucks was charged 100! When I called to ask where my money was was told over and over they do not own the machine and can\'t help me and was given an 800 number who Is only open four days a week. So I\'m out 80 bucks and for what reason. Not worth it plenty of other places to get product that\'s not over charged because it\'s \"lab tested\". Better off taking your chances on the streets.', 1525883647),
(1676, 371, 'Luanda Manzie', 'https://www.google.com/maps/contrib/109417930396081825205/reviews', 'en', 'https://lh3.googleusercontent.com/-v-TjdDjA4yw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq26AbVisC7xCCpc5_eK8yfFaQzXQw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'I\'m heartbroken. I\'ve come to this dispensary a plenty of times all the way from the south side. Well today I bought some Tangie weed and it smelled like pure gasoline. I called up there and I spoke with the manager. He says to me... bring it back up here... so I did. I asked him to smel the weed but he kept trying to smell it threw the bag.. I told him to pour some out and smell it. I know he could smell it but then he said  because I touched it ..i can return it and handed it back to me like oh well.. now I\'m out of twenty dollars... my last twenty dollar, I\'ve used more of my work gas to come back up to this dispensary and I don\'t have anything to smoke. I\'m not a happy customer and sad to say.. I will never come back here again and I hope they learn how to keep there customers happy because we work hard for our money too but I\'m the only one out with nothing.. and for the other customer who buy here.. be careful and be careful with this weed.. I\'M SO DISAPPOINTED. Not every dispensary is for the people  you\'ll know which ones are which,  because you will leave out and come back as a satisfied customer.. remember Greenwave.. we the customers are the ones that helps you grow into something bigger and better.. good luck..ONE DOWN..', 1516316998),
(1677, 371, 'cathy bassar', 'https://www.google.com/maps/contrib/102274895984891533207/reviews', 'en', 'https://lh6.googleusercontent.com/-lCo197mnilE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3_yWnkbyO7VYB990Rbbv__vn2CwA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Excellent knowledgeable staff combined with premium product. How does it get better than that??', 1523473656),
(1678, 371, 'Sandy Dykins', 'https://www.google.com/maps/contrib/109159900479181928288/reviews', 'en', 'https://lh5.googleusercontent.com/-u-Ih_ju8xnw/AAAAAAAAAAI/AAAAAAAAAEg/7JUBhKhroE8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Always short wait in afternoon. Outstanding  service and help every time.', 1526767003),
(1679, 372, 'ash ski', 'https://www.google.com/maps/contrib/103126541485148406258/reviews', 'en', 'https://lh4.googleusercontent.com/--o-MlWfXXQ0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0rR3at6Xe8ZCJkRp_0YE91iKVuRA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Dr. Vel was very nice and helped me with everything I was seeking. I didn\'t have to be there very long either. He was wonderful!', 1526512869),
(1680, 372, 'Saadia Robles', 'https://www.google.com/maps/contrib/102908769963479718181/reviews', 'en', 'https://lh5.googleusercontent.com/-G_daM5TgRco/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1PZPpboi-sr-Q013kYPLxdsOgKtw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Dr. Vel was wonderful.  He answered all my questions and concerns, was very easy to talk to and a real pleasure.  I  highly recommend him to anyone who is seeking MM as a more natural and alternative method for treatment.', 1523225164),
(1681, 372, 'Terri Tibble', 'https://www.google.com/maps/contrib/101382496458385823432/reviews', 'en', 'https://lh3.googleusercontent.com/-VSYBZ6WZbMY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0HzZdsIjhmLILrd3hYeDleK2-6bw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Dr. Vel was very professional and listen to all the health problems that I have. Looking forward to being a normal person again! I feel as though I finally have hope to live a normal life.', 1526830866),
(1682, 372, 'T. Hansen', 'https://www.google.com/maps/contrib/101253724250236941268/reviews', 'en', 'https://lh4.googleusercontent.com/-_f_SzhFtDpw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq05CJEzWDp0GawKh4deXUJzQ4zroA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very professional. From start to finish, was good. Answered all my questions. Made the process painless.', 1522790331),
(1683, 372, 'Ruth Routsaw', 'https://www.google.com/maps/contrib/103758852194923898258/reviews', 'en', 'https://lh5.googleusercontent.com/-hqZY5DXHyVo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ytrKesRMW_sv6pfLOX7CaEyOQ0Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The staff was very friendly and helpful. I would recommend this place to friends that need it', 1524499874),
(1684, 373, 'Vilidric Vile', 'https://www.google.com/maps/contrib/105335510946036620148/reviews', 'en', 'https://lh4.googleusercontent.com/-Vl5xdXgtqJY/AAAAAAAAAAI/AAAAAAAAAUY/VjiBfLbIqyc/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'a month ago', 'staff was great very friendly place helped me out with what i needed to fill out to become a first time patient... but the doctor decided to turn me down for having scoliosis and chronic back pain from a torn muscle having joint pain from me being double jointed in my arms and my legs on top of my anxiety and depression and still was not enough nope instead he wanted more and told me to walk out the door and get my money back. not happy at the least and wont be coming back to be denied for being in pain and cant seem to recognize it !!!!!!!', 1524090809),
(1685, 373, 'Ronald Bartley', 'https://www.google.com/maps/contrib/100789262784556583533/reviews', 'en', 'https://lh6.googleusercontent.com/-_NCycdPgKys/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3d4scFwCIdG9AR0qZqaBmH6RO-8A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'Horrible. \nMEDS ARE GARBAGE!!!\nMy patient \"Disabled Vet\", went in with medical records, no cartilage in both knees and PTST from confirmed knife combat kill in Somalia.\nRandomly Denied. \nWe had to go to a Real Legitimate MMM Certification location in Waterford to get him certified. \n\nI am returning Caregiver for 2nd Renewal. Life long Laborer. 12yr Steel Worker,  2 major car accidents \"as Passenger\",  fell 1.5 stories from ladder installing Satellite TV, was jumped 3 police who beat me into 7 day coma \"Florida\" Needed RENEWAL. \nThey turned me away.\nNow they are shaking everyone down for $30 medical records searches. \nHad to go to Real Legitimate MMM Certification location with real doctor who could examine,  make medical record based on my current conditions \"not past records\" and prescribe MMM.\n\nDO NOT ENTER THIS LOCATION. DIRTY LOBBY, CROWDED LOBBY, DISORGANIZED STAFF, .. \nBe prepared for $30 \"past medical records search\" because on site doctor cannot qualify you based on your present conditions. \nBe prepared to get hit up for another $50 for follow up visit by the doctor who couldn\'t qualify you to begin with.\n\nMy second patient took day off work to get re- certified on Thursday but office is closed\nOnly open 2 days a week \nHOWEVER!!!...\nWebsite shows hours..\nMonday 10AM–7PM\nTuesday	10AM–7PM\nWednesday	10AM–7PM\nThursday	10AM–7PM\nFriday	10AM–7PM\nSaturday	12–6PM\nSunday	12–6PM\nSHE LOST DAYS PAY BECAUSE OF THIS TERRIBLY UNPROFESSIONAL BUSINESS!!', 1527182402),
(1686, 373, 'Debi Ford', 'https://www.google.com/maps/contrib/115606428458184272133/reviews', 'en', 'https://lh5.googleusercontent.com/-uQaqdkZ1Weo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1EQCNL9NgzZKGZewwglpsRalHMMQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '4 months ago', 'The people were really nice. Showed us the different pipes. Really liked the silicone pipes. They gave us a good deal on our products that we got. And the free Tuesday deal. Different days is different deals. Check them out for all your needs.', 1516144332),
(1687, 373, 'Vicky C', 'https://www.google.com/maps/contrib/112496212707793303809/reviews', 'en', 'https://lh5.googleusercontent.com/-Tw5spZZpCEo/AAAAAAAAAAI/AAAAAAAAA9s/FBgpAEp20z8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'in the last week', 'Awesome as always! Polite and helpful too.', 1527201449),
(1688, 373, 'Dawn Rickle', 'https://www.google.com/maps/contrib/106547806369665577360/reviews', 'en', 'https://lh6.googleusercontent.com/-TUh1c1LSXws/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq00TzEN_NPnipyzj_MrqnuvSgtJag/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'I had taken off of work based on their website only to get there and them not be open. Loss of pay plus no card. Not happy!!!', 1527183464),
(1689, 374, 'Lexi Pipoly', 'https://www.google.com/maps/contrib/110854255984660216272/reviews', 'en', 'https://lh3.googleusercontent.com/-t-zI4N1USQY/AAAAAAAAAAI/AAAAAAAAACo/70hYCL604AY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Staff and doctor were very helpful and sweet in guiding me to where I needed to go and what I needed. And the process was very easy and smooth! I would come back any time and suggest them to my friends.', 1523717666),
(1690, 374, 'Kymara Kai', 'https://www.google.com/maps/contrib/104390508961629797222/reviews', 'en', 'https://lh4.googleusercontent.com/-UruCcavZuGI/AAAAAAAAAAI/AAAAAAAAKkk/YZiycqZRerE/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a week ago', 'The Dr & staff are awesome! They made the process smooth. Very friendly & treat you like family.', 1526837479),
(1691, 374, 'Duane Flippo', 'https://www.google.com/maps/contrib/104091053465645917284/reviews', 'en', 'https://lh6.googleusercontent.com/-rmWNHie1kXU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2mfxy8AykqGMNXcv6tp8isxdXQ_A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'The Wixom office is easy to get to right off the expressway. The office was nice, the staff was helpful, and it didn\'t take long. I\'m extremely satisfied.', 1526483799),
(1692, 374, 'Jillian Gonzslez', 'https://www.google.com/maps/contrib/117440899231889630871/reviews', 'en', 'https://lh4.googleusercontent.com/-QVZUnrKjJEM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Szv62-QrMjc5fJdo_ojwGtVNSnw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'If you would like to get your card at a place that is fast, efficient, and actually cares about theirs patients health and well being then look no further. I will recommend this office to anyone with ears! They have a life-long patient in me. Best experience EVER!!', 1521149020),
(1693, 374, 'Jeremy Joyce', 'https://www.google.com/maps/contrib/117148332839673415641/reviews', 'en', 'https://lh5.googleusercontent.com/-xNuXhsyYt9w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2LwOMnZlxdcUwyv3bcMOkFuN44jg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I have been to this office for the last 2 years to get my card.  Not only have i been treated like family, but they have really worked with me to help develop the best treatment for my pain.  They advised me on all different types of ingestion methods and worked with me until i was really getting the full benefit of medical marijuana use.   This stuff is alot more powerful than just smoking it.  Every time i call with questions or ask for advice they are always so nice.  I will be going to this place until the cows come home.  I love this place.', 1521172456),
(1694, 375, 'Jasper Murdock', 'https://www.google.com/maps/contrib/112026164002926786904/reviews', 'en', 'https://lh3.googleusercontent.com/-miqRWYi5DDI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0lSHxLRMeUQTDVyqtgEagPErQHjA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'The staff here is very informative and polite. I feel like I left their office knowing more about the program than when I arrived. The doctor was very professional and answered all my questions very clearly. Reasonably priced for the quality of service. I  would recommend Michigan Holistic Health to everyone who wants their card', 1522170590),
(1695, 375, 'Matt Sweet', 'https://www.google.com/maps/contrib/114242440097223060520/reviews', 'en', 'https://lh6.googleusercontent.com/-8JDsEedpZwQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3u7gvHhHSycKMr9JZpxUzN3dyDEA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '11 months ago', 'At Dr. Crocker\'s Kalamazoo office I was at an appointment with one of my potential patients.  We waited for 3-4 hours after his appointment for the x-rays to get sent over that they required.  After all of this waiting, they inform us that the x-rays have to be within the last 3 years; even though you could see the bone sticking out of his shoulder.  Then when I get mad, the secretaries get an attitude with me.  I will never send anyone back here, the 3 year policy should have been communicated with us prior to the appointment.', 1498575803),
(1696, 375, 'david wybenga', 'https://www.google.com/maps/contrib/115023194959899790478/reviews', 'en', 'https://lh5.googleusercontent.com/-fUzTbJ6Lsfo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0vMtRXG3Mxywj0hUU804GMtce_qg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '11 months ago', 'Unreliable service', 1498439466),
