(1699, 376, 'Kitsune Iwakura', 'https://www.google.com/maps/contrib/116104477589187213751/reviews', 'en', 'https://lh5.googleusercontent.com/-vQ5tJWWA2oY/AAAAAAAAAAI/AAAAAAAAAKg/EndVkmjK8O4/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '5 months ago', 'Called with inquiry,told to verify legality status by mms\'ing photo ID and MMJ card to another number. Did... never heard anything back still.\n\n/ update: around 3 hours later had missed call from them. Would of had loved just a follow up txt to ensure they received my message prior. Just an inconvenience. Will try another day again though.\n\nFinal update. Gave up,they never called back after calling another day and finally getting someone to answer. Found a much better MMJ service', 1512955831),
