(1703, 377, 'Grand Engin', 'https://www.google.com/maps/contrib/106789281895757277908/reviews', 'en', 'https://lh5.googleusercontent.com/-PP-Xf6m1xXU/AAAAAAAAAAI/AAAAAAAAAI0/66OjFTS8d9M/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great selection, Good deals pop up all the time. you can go in and have a great experience and ask any questions, see anything you like.\n\nOr you can simply order exactly what you need online, walk in and out.\n\nI just wish i found this place sooner', 1521856908),
(1704, 377, 'MAKEUP BY AMBER', 'https://www.google.com/maps/contrib/102447996390116900938/reviews', 'en', 'https://lh5.googleusercontent.com/-04FwsQ8b1L0/AAAAAAAAAAI/AAAAAAAAACE/7pyUazoVaYk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Best In town by far. Clean, upscale, knowledgeable bud tenders. Good security. Great relaxing waiting area. Ask for Deann, the BEST bud tender. She’s beautiful & super helpful!!!', 1522950488),
(1705, 377, 'Debra Kubiak', 'https://www.google.com/maps/contrib/107555169714381250116/reviews', 'en', 'https://lh4.googleusercontent.com/-gPKJ91huBPI/AAAAAAAAAAI/AAAAAAAAA2I/EmUJ60AEFVw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I really like that the people were so nice to me and very knowledgeable in their area of expertise. I like that the place was clean and it had been there awhile 7 years to be exact. I really liked the legality of it as well the packaging everything.', 1523457725),
(1706, 377, 'Jackie Burch', 'https://www.google.com/maps/contrib/105916849440926069413/reviews', 'en', 'https://lh4.googleusercontent.com/-3WmIqtWUg3A/AAAAAAAAAAI/AAAAAAAAEQI/acXRqXSN_vU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great variety, great staff, great management. I love it here and always come here for my medicine needs. Also the fish tank is awesome.', 1524494123),
(1707, 377, 'Bernard Cavanaugh', 'https://www.google.com/maps/contrib/113407050776871708058/reviews', 'en', 'https://lh3.googleusercontent.com/-siUFZgV5iqQ/AAAAAAAAAAI/AAAAAAAAAFI/8M2qThsUlKY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'Michigan marijuana dispensary. Large selection of Bud,concentrates and edibles. Safe and secured parking. Conveniently located on Baseline just east of Mound.', 1527246026),
(1708, 378, 'Mike McDowell', 'https://www.google.com/maps/contrib/112273928670548556673/reviews', 'en', 'https://lh4.googleusercontent.com/-tlXtrlfDYUE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0cXwdlkq-c1CrTTrh--LYIVKgN_Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, 'a month ago', 'They have a good selection. But terrible staff and what they show you in display is not always what your going to get. Much better options in and outside the city of Ann arbor. Not to mention like all but three places in Ann arbor ypsi they are way over priced. I won\'t mention names but look around and I promise someone else has a better price on any concentrate they have. Keep that in mind at all times. Thank you.', 1524151053),
(1709, 378, 'Jennifer McLeod', 'https://www.google.com/maps/contrib/107449196408296259958/reviews', 'en', 'https://lh5.googleusercontent.com/-g5BbyzkaCFc/AAAAAAAAAAI/AAAAAAAAAA0/SuzGffgeODk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Came in with a coupon, and it was honored. They had a large selection of flower, with some awesome strains that made it hard to choose from. \n\nScott was my budtender and was one of the most invested budtenders I\'ve met. He asked questions and was patient while I made my selection. \n\nThanks for the great experience. I\'ll surely be back.', 1526854309),
(1710, 378, 'Jason Walker', 'https://www.google.com/maps/contrib/106113006131294592114/reviews', 'en', 'https://lh5.googleusercontent.com/-ZX97qQ4pNuk/AAAAAAAAAAI/AAAAAAAABCk/Bm_m2HLQqKE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Love Arborside!! The staff are very cool and knowledgeable, the products are awesome. The donations are very reasonable to. Parking is hit and miss though,  there is parking available but it is limited but don\'t let that discourage you. Your experience there will be great. Mine always is ', 1517060430),
(1711, 378, 'Phoebe Narita', 'https://www.google.com/maps/contrib/106283357484119314854/reviews', 'en', 'https://lh4.googleusercontent.com/-OywmoM4TYIc/AAAAAAAAAAI/AAAAAAAADeY/LNLUwaUiCOU/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '2 weeks ago', 'They don’t have the thc, cbd or Cbg % labeled, they forgot my first visit preroll and product I did get was not the best despite being top shelf (maybe they put low grade on the top shelf?) they  Did not seal bags (it was zip lock and did not shut it) so the two strains I got fell out and got mixed up, and they did not staple my bag so I could have gotten in big trouble had I need pulled over.', 1525972569),
(1712, 378, 'Conie Stone', 'https://www.google.com/maps/contrib/111448096353023538545/reviews', 'en', 'https://lh6.googleusercontent.com/-qyGoVs1mtls/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3jLLBk8NdK6OkT1QLx3LKCGYPYQg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Love Arborside. All the staff is awesome but I\'m always extra happy when I get Colin! He\'s seriously the best - super friendly and SO helpful. Whenever i\'m working with a specific price range he helps me pick out the perfect product. Always makes my trips there an even better experience. 10/10 would recommend', 1517271212),
(1713, 379, 'James Devers', 'https://www.google.com/maps/contrib/116874905156190315620/reviews', 'en', 'https://lh4.googleusercontent.com/-uNi1-jSSCKs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2hD3S0TKPQIojB9xI5I97XEi59aQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Very Good People! Got welcomed at the front door by an older man and felt very comfortable waiting in the waiting room! I was in and out very quick!  Good service and good bud tenders! They make you feel very welcomed here and it was much appreciated! They’re top shelf is very good bud and  there variety of products is very great! I would so recommend this place if you are in the area or not! I live about 25 minutes away and it is very much worth the gas 10/10 service', 1520537020),
(1714, 379, 'larissa hines', 'https://www.google.com/maps/contrib/109315183390985194631/reviews', 'en', 'https://lh4.googleusercontent.com/-G0ewSOIWCBw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3TYBe-bWFBrwINmaToE0mqIe7PCA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This dispensary has never let me down they have great staff were very knowledgeable, great products for the price and a huge variety.. I have yet to run into an employee there that I was not happy with .. Thanks suit B for the best pharmacy around. \n-Larissa Hanson', 1523714933),
(1715, 379, 'Christiana Okamoto', 'https://www.google.com/maps/contrib/100445935393561305984/reviews', 'en', 'https://lh4.googleusercontent.com/-q7uBYctuNXc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3yYcowpZk_ZREQZVw0AnFBHpslLQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'Very friendly staff! Thank you for helping me pick something great, lady with the pigtail braids! (I don\'t remember your name sorry.) You guys have high quality medicines at fair prices. Thank you! Worth the hour drive!', 1518709940),
(1716, 379, 'Dawn Russo', 'https://www.google.com/maps/contrib/108205157067076065078/reviews', 'en', 'https://lh6.googleusercontent.com/-9a-PM0ugqzM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1a-9ylON2kDEP-J8eiAEizOb3FPg/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a month ago', 'Was gonna try other provisionary centers . But then a very sweet and helpful girl named NATALIE waited on me. I will definitely be back and recommend suite b and Natalie to everyone.', 1524775629),
(1717, 379, 'Dawn Crouch', 'https://www.google.com/maps/contrib/104707021043186364998/reviews', 'en', 'https://lh4.googleusercontent.com/-eRiAlZYwyIo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1GljPvf3qy1QxStZg21ty2e9A6OA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This is my go to place. Awesome staff that is very knowledgeable.  Excellent product every time. Don\'t forget to get some yummy, fresh popcorn too.', 1521129338),
(1718, 380, 'Terry cobb', 'https://www.google.com/maps/contrib/104029137035314220683/reviews', 'en', 'https://lh6.googleusercontent.com/-4oBWKQA3MTQ/AAAAAAAAAAI/AAAAAAAABzA/E5YRsmTkvTM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, '3 months ago', 'This is not a dispensary it\'s not even a good medical card provider. Look for one that promises to update your file every 3 months. Which is required by the courts. This normally costs around $180.00. Cards that cost $69.00 are dangerous and will not protect your rights in state/local courts.  My biggest gripe is, this company doesn\'t even belong under this heading. You can\'t buy a single tube of CBD oil to save a seizuring person\'s life should you be unfortunate enough to roll up on this place. That\'s why I say stiff fines should be put in place for riding on the coat tails of the true dispensaries. For faulty advertising a $500 fine should be placed intact to protect very sick patients who when go looking for a dispensary get the shaft.', 1518611227),
(1719, 380, 'Lauren Tori', 'https://www.google.com/maps/contrib/104258829778913458605/reviews', 'en', 'https://lh4.googleusercontent.com/-MRRaJC4FxlE/AAAAAAAAAAI/AAAAAAAACEo/dmIZC7Nz24o/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, '10 months ago', 'No warning on the website that it\'s by appointment only.  It also doesn\'t state that you have to be a member.  If you have a current caregiver even though your caregiver is out of stock they will not help you.  Best to go another place.', 1500135613),
(1720, 380, 'Joshua Higgins', 'https://www.google.com/maps/contrib/114246873821600072979/reviews', 'en', 'https://lh6.googleusercontent.com/-hKf3t6ldNmg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq37hVbEh7bMXaiZLFICB1h00_VJqQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'They wouldn\'t let me in. I have a card. This is a dispensary?', 1522698430),
