(1726, 381, 'loren schultz', 'https://www.google.com/maps/contrib/107177425769514187816/reviews', 'en', 'https://lh3.googleusercontent.com/-51OOUGhscqA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1kBS7Derhew6Pgaf4CPGAGWWDh-A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '9 months ago', 'Extremely unprofessional. Went today and was handed nothing but amateur service. If you want the real deal go to club med down the street', 1502241384),
