(1728, 382, 'Diana Mooney', 'https://www.google.com/maps/contrib/109451914331320998842/reviews', 'en', 'https://lh6.googleusercontent.com/-pN270h6sxhE/AAAAAAAAAAI/AAAAAAAAAG4/ozEAWTr53dI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Love this dispensary.  The bud tender and security guys are very nice, and helpful.', 1522630463),
(1729, 382, 'Enigmatic Paradox', 'https://www.google.com/maps/contrib/114215827145075259792/reviews', 'en', 'https://lh5.googleusercontent.com/-MKoEJELXFr8/AAAAAAAAAAI/AAAAAAAAGZE/A8Htwp2v7IY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '6 months ago', 'Great low key dispensary. Very secure and they make you feel safe. Great deals and great prices. I see no reason to go elsewhere.', 1511645867),
(1730, 382, 'john ryou', 'https://www.google.com/maps/contrib/103277319917256438237/reviews', 'en', 'https://lh6.googleusercontent.com/-IDBCW9z83TQ/AAAAAAAAAAI/AAAAAAAAAPg/4UQGaAn0PBs/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'If you give them your number they will text you every day from different numbers, and their selection leaves a lot to be desired.', 1515800979),
(1731, 382, 'John Gotti', 'https://www.google.com/maps/contrib/101401185997225280254/reviews', 'en', 'https://lh4.googleusercontent.com/-SmxCS9Mtyqo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1jg8zhrcAuJNvjMgsdQnJoKRndQQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Garbage. Sold me a garbage flavored vape and told me it was organic it can\'t be flavored and organic dummies there weed was garbage to', 1520404259),
(1732, 382, 'Tiffy Lately', 'https://www.google.com/maps/contrib/115204158972791806152/reviews', 'en', 'https://lh4.googleusercontent.com/-mFjaio_yWcM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Z0U0t_VcD5hAWVkkNwlKDviVLzQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I love coming they are very friendly. Great products. And you get a lot of free stuff loving it!!!', 1511994023),
(1733, 383, 'k sparkles', 'https://www.google.com/maps/contrib/115486692814050194193/reviews', 'en', 'https://lh6.googleusercontent.com/-XOwPM-MDmMs/AAAAAAAAAAI/AAAAAAAAACQ/PW7Hham_fxE/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'Drove over an hour to get there just to find out that the whole reason I was going (moon rocks) were not being sold as they claim they are on their website. Then I was given the impression that I was given some small items to make up for it when I had actually paid for everything! I was a new patient and didn\'t receive anything for it. Very disappointed. Will not be going back. They dispenseries in Detroit are much better.\n\n*I paid for the concentrate and was told it was free as well as being sold a used roll up bong. I would have expected better from an \"upscale\" dispensary.', 1526235540),
(1734, 383, 'Ethereum United', 'https://www.google.com/maps/contrib/110640111809404392858/reviews', 'en', 'https://lh4.googleusercontent.com/-H-VyFrq1dZk/AAAAAAAAAAI/AAAAAAAAADA/95ofnGC8T5w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Atmosphere and staff are always lovely friendly and helpful, they gave me a free top shelf pre roll today as a bonus. Honestly they often do when I go in it is great. Love this place they run an art studio on the side and have a VR in the waiting room. Overall .', 1527214995),
(1735, 383, 'Adrian Deychakiwsky', 'https://www.google.com/maps/contrib/106829605175663183366/reviews', 'en', 'https://lh4.googleusercontent.com/-sGRF_Aeg7QM/AAAAAAAAAAI/AAAAAAAADs4/W07lOll7-JU/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, 'a month ago', 'It\'s an interesting experience climbing the narrow staircase to the floor where the dispo is located, but you\'re rewarded with a large waiting area, helpful clerks and budtenders, and excellent prices.\n\nHowever, I find the selection a bit limited compared to most other dispensaries in the area.', 1524090875),
(1736, 383, 'Brian Schilling', 'https://www.google.com/maps/contrib/102580739715389075619/reviews', 'en', 'https://lh3.googleusercontent.com/-3A5lNMEqfXM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3CzEBtnVlszTYWn0D_w_V2oi1aDQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'Great staff, very knowledgeable of all medications that they provide. I love the furniture while you wait. Great art work from local artists for sale throughout the store. 5 stars always. Tnx guys ', 1516730249),
(1737, 383, 'Kristin Foor', 'https://www.google.com/maps/contrib/100212345116212348937/reviews', 'en', 'https://lh3.googleusercontent.com/-IjX511jqi4I/AAAAAAAAAAI/AAAAAAAAC9M/m9x7Ca4ENh0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great atmosphere,  friendly service.  An abundance of edibles,  highly recommend', 1520544701),
(1738, 384, 'rick koenig', 'https://www.google.com/maps/contrib/117730467753701053906/reviews', 'en', 'https://lh6.googleusercontent.com/-GVGk-3EJZCI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3H289IW9-2WCLap2ihVJw-eFmWMA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Apparently you guys aren\'t open on Tuesdays. Contrary to what you post I have called twice between 10 and noon and receive nothing but a voice message which hasn\'t been returned yet. I couldn\'t believe all the negative comments this place was getting. Now I understand. Either change your hours of operation or find somebody that can answer a phone or at least return a message. That turned out to be a good $350 saved.', 1524586495),
(1739, 384, 'Joe P', 'https://www.google.com/maps/contrib/107513313246548826364/reviews', 'en', 'https://lh4.googleusercontent.com/-30oeeaRT9Wc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0z9N8yk4lW6bh4bnUEZpMsaaWYJQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I\'ve been all over the state. This place consistently has the nicest flower. They will help you get he right strains for your needs are. They do not try to dazzle you with fancy stuff, they just stick to great service and product. I\'ve been going back here when possible, they will take the time to get to know what illness you may have,and what will help he best. The small staff is the most caring and least pushy I\'ve met.', 1523835305),
(1740, 384, 'Tim Antonides', 'https://www.google.com/maps/contrib/100938810784889839338/reviews', 'en', 'https://lh5.googleusercontent.com/-SHIct_UOFbA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0dkBalOA3GPUermUYI4Wn2CV3eOg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Just a month out and growing awesome.. strong plants. I should\'ve bought more.  Thanks guys.  I\'ll be back', 1525628296),
(1741, 384, 'Jason Foster', 'https://www.google.com/maps/contrib/112525515789685065973/reviews', 'en', 'https://lh3.googleusercontent.com/-ZKhw9poXeNY/AAAAAAAAAAI/AAAAAAAAAnA/jo8WATWKeoA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Inexpensive, friendly, and good product! Great experience every time!', 1526756352),
(1742, 384, 'Brian Brennan', 'https://www.google.com/maps/contrib/117420674426960955096/reviews', 'en', 'https://lh3.googleusercontent.com/-J6YsENozbu4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0mIL1WofHqH3lYkT_edkcM2jMmpg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Great prices! Awesome buds! For sure a return customer.', 1526146788),
(1743, 385, 'todd -', 'https://www.google.com/maps/contrib/102454963457239194609/reviews', 'en', 'https://lh3.googleusercontent.com/-bteXM2EAfZk/AAAAAAAAAAI/AAAAAAAAALk/G8Lp-VA_P6s/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Always quality strains at very competitive pricing. A decent variety of edibles to choose from at fantastic prices, too. Safe parking with security present. Wheelchair accessible.', 1518005373),
(1744, 385, 'David Wakefield', 'https://www.google.com/maps/contrib/105849425546701211239/reviews', 'en', 'https://lh6.googleusercontent.com/-SX-T4uc92Ds/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq20Fnle-3Xcs9X-9kYpi1ny_OkEIw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Very quick service. This has to be the quickest dispensary I\'ve been too. The meds are superb and all the meds are pretty much at a 10.00 set price. You have to love the fact that your getting quality for a set amount. My favorite spot hands down', 1514375124),
(1745, 385, 'Jennifer Hill', 'https://www.google.com/maps/contrib/113151389443972333395/reviews', 'en', 'https://lh4.googleusercontent.com/-oo4XRqTn1XM/AAAAAAAAAAI/AAAAAAAAABs/gh53pLMXA1Y/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '5 months ago', 'These budtenders are awesome.. always have good deals..so friendly and quick.. security is always there and cameras everywhere..I feel so safe', 1513139623),
(1746, 385, 'Carrie McConnell', 'https://www.google.com/maps/contrib/108165247526965794572/reviews', 'en', 'https://lh3.googleusercontent.com/-k4yo_5XTemU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq21H6saUeiASGDycl-emi-IH0p2KA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '5 months ago', 'Good prices!!! They can take care of all your medicinal needs and wants!!! You can take your time or be in & out. It\'s all about YOU!', 1512502179),
(1747, 385, 'Phillip Jones', 'https://www.google.com/maps/contrib/117591454738742265683/reviews', 'en', 'https://lh5.googleusercontent.com/-0DCrtbJwzSY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq14Si0WUP66JTmxepcnSxhGcxs79w/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '7 months ago', 'best bud in the metro detroit area. don\'t believe me go try it for yourself', 1507158299),
(1748, 386, 'Ellen Dowling', 'https://www.google.com/maps/contrib/107553190406548574259/reviews', 'en', 'https://lh6.googleusercontent.com/-Knrg1zpE84k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1qtVTK-lnvYdDzVW0iGiTLDWvccA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Dub’s is simply the best dispensary around!! The people are so nice and their flower is equally awesome! Quality medicine at a price the average person can afford. You also just get a good vibe from the place.', 1521082825),
(1749, 386, 'Kay Cain', 'https://www.google.com/maps/contrib/112954066920091963501/reviews', 'en', 'https://lh5.googleusercontent.com/--8vn5wI9ojE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1-vYzyBOcJh3qWxn6Yzg0HRNEY6w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Friendly, effective product with variety, and reasonable pricing. Convenient location; centrally located.', 1527735777),
(1750, 386, 'Zackary Whitney', 'https://www.google.com/maps/contrib/100809803134227282082/reviews', 'en', 'https://lh5.googleusercontent.com/-VW6Xby7QzFE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq16mwapqVnv_8JUcmsU9nWz_fVcwg/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '2 weeks ago', 'I\'m trying to call this place and can\'t reach them. I drive an hour for my medicine and when I got this distillate from them from the company P.M.O. little did I know that the glass cartridge would shatter in my hand i spent my birthday in the E.R. I\'m very upset', 1526227550),
(1751, 386, 'josh wells', 'https://www.google.com/maps/contrib/106375593938800111925/reviews', 'en', 'https://lh4.googleusercontent.com/-2Bk2Mo8Rqio/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1pA6p0dJjyKRq-8DzOmBN2TfAcvg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Stopped in for gorilla the bud taste really good! Looks potent friendly vibes . IL Be BACK!', 1504290315),
(1752, 386, 'nicole monti', 'https://www.google.com/maps/contrib/113384152308295142756/reviews', 'en', 'https://lh4.googleusercontent.com/-CX3ywQNd26g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3ipxtxo-b2iEHGtmLtUX1mG8oXQQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Friendly welcoming clean medsThe bud is!!!', 1503710298),
(1753, 387, 'Jessica Yount', 'https://www.google.com/maps/contrib/102037101348329136138/reviews', 'en', 'https://lh3.googleusercontent.com/-fSN0PAXcMuY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3cqSXiPGKKPHymnozwKG_acQb4vQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'This is my favorite one in Lansing. If you ask me, the security guard is FINE AS HELL!!!!  AND Tyler one of the budtender is amazing. This is my go to spot. Great prices. Great smoke. Great feel. I drive an hour once a week to only go here until GR gets done. I highly recommend this place.', 1525563823),
(1754, 387, 'Tawny Baker', 'https://www.google.com/maps/contrib/103739953643150455418/reviews', 'en', 'https://lh3.googleusercontent.com/-vsQOLEasOC8/AAAAAAAAAAI/AAAAAAAAAWg/HMz04Bny5ZE/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'They get you in take their time if you need them to get you what you need get you out in a reasonable amount of time. They know what their doing. The owner is awesome. Have a great day. I like these guys a lot.', 1526554127),
(1755, 387, 'Steve Guernsey', 'https://www.google.com/maps/contrib/115590431169535184330/reviews', 'en', 'https://lh5.googleusercontent.com/-OAyINMwtnJM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Q0rQ0-mWCcVGAtUcKcuzr0KTspg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '3 weeks ago', 'Nice friendly staff. Good quality products. Disappointed in a advertised price not being correct refused to sell for advertised prices. Still left fairly satisfied.', 1525552930),
(1756, 387, 'Christy Dan', 'https://www.google.com/maps/contrib/111684733027208954100/reviews', 'en', 'https://lh4.googleusercontent.com/-giN1dN7Tshs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2tYXgXuAcUgai46BlEOMim7Am8mQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'The best cannabis! I\'ve been all over Lansing, this is best! Grest, bud, great staff! Great prices, deals everyday! You must go here first. You won\'t be sorry!', 1525465279),
(1757, 387, 'Alice Brown', 'https://www.google.com/maps/contrib/115901266478878365980/reviews', 'en', 'https://lh5.googleusercontent.com/-OVo9YLAqtFM/AAAAAAAAAAI/AAAAAAAAASI/epAVo3p7diA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'Very professional and comfortable setting with many options available. Employees are friendly and helpful. I usually deal with Caitlin which is always a joy.', 1526773310),
(1758, 388, 'Brian Eller', 'https://www.google.com/maps/contrib/108796981288244343909/reviews', 'en', 'https://lh3.googleusercontent.com/-tWmiofmYNWE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2HK-zeEFBSn3xbUzOFOoPkorrM2w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'They are the best dispensary I\'ve been to from California to New York they are hands down the best!!', 1527616186),
(1759, 388, 'stefan sidorowicz', 'https://www.google.com/maps/contrib/114746491860643353173/reviews', 'en', 'https://lh6.googleusercontent.com/-ZK0IwQDE-4U/AAAAAAAAAAI/AAAAAAAAALI/CwogNv-DgPg/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'in the last week', 'great place goods buds nice budtender', 1527265401),
(1760, 388, 'Damon Kingston', 'https://www.google.com/maps/contrib/116982793587398579374/reviews', 'en', 'https://lh4.googleusercontent.com/-PfPRnzgsXLE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq03tPDjzSgUI4dsLCuaruX_e3MAdA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Very cool down to earth place to get your meds. Very knowledgeable bud tenders. Very safe on security as well. I will definitely be back soon.', 1511029784),
(1761, 388, 'Ninja JoH Mi', 'https://www.google.com/maps/contrib/111623552091958866516/reviews', 'en', 'https://lh6.googleusercontent.com/-VMgghRXpHOg/AAAAAAAAAAI/AAAAAAAAAME/Jy0QEifUWPg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Amazing great people very friendly . quick to help you . they are all very knowledgeable . they answer anything you ask them very great wellness center i recommend it .', 1501788991),
(1762, 388, 'Lisa Blevins', 'https://www.google.com/maps/contrib/106474124523987022022/reviews', 'en', 'https://lh5.googleusercontent.com/-yY4xmIBLl6w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3LcOHSfFBx--DSxTH3_w48hT4FOA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'The best top shelf weed ever....', 1499363504),
(1763, 389, 'pete curcio', 'https://www.google.com/maps/contrib/107846603689029779942/reviews', 'en', 'https://lh3.googleusercontent.com/-YBZQbU12Nxk/AAAAAAAAAAI/AAAAAAAADcU/A6K9Q6FlNt8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', '', 1505774786),
(1764, 391, 'Russ Russo', 'https://www.google.com/maps/contrib/114861990976108679067/reviews', 'en', 'https://lh4.googleusercontent.com/-sgu872eYuGk/AAAAAAAAAAI/AAAAAAAAAuc/k830R7Da3j4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Very helpful and professional', 1527698184);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(1765, 391, 'Tyler Doane', 'https://www.google.com/maps/contrib/115572535424539714844/reviews', 'en', 'https://lh4.googleusercontent.com/-yoRSIx-r5VA/AAAAAAAAAAI/AAAAAAAACE4/sX-y0UEWLc0/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'Do not give this office ANY of your money. Led me on for months saying I needed to keep bringing him different information and after I did that, NOTHING. Waste of $125 and a waste of my summer.', 1471030609),
(1766, 391, 'Morgan Day', 'https://www.google.com/maps/contrib/111955943141508498203/reviews', 'en', 'https://lh6.googleusercontent.com/-bDotSdA6skY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2S5vDFTRCyM75UT1CdbvPPmBvyUA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '12 months ago', 'my friend was charged $150 for a renewal what a rip off!!', 1496257120),
(1767, 391, 'lisa krolczyk', 'https://www.google.com/maps/contrib/106872548775566223468/reviews', 'en', 'https://lh3.googleusercontent.com/-gANQsXO7nJc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2ZqiLLAPJinoJDrb52lgeM0AtA3A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Friendly people. I\'ve been going there for many years', 1475205597),
(1768, 391, 'Brittney Cowles', 'https://www.google.com/maps/contrib/101662715400556759384/reviews', 'en', 'https://lh3.googleusercontent.com/-EfOX52ElAJ0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq17IgaS9Y1bt5yLoLGDjT8tZOzGCA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', '', 1512937745),
(1769, 392, 'Paul Mayfield', 'https://www.google.com/maps/contrib/117199215644438981540/reviews', 'en', 'https://lh5.googleusercontent.com/-kkR7JBKj7jo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1bNuMQgJq2P39I53m3b0pWznc0iw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Very professional and very friendly I\'ll recommend this place to anyone who is in need of medical marijuana certification', 1522889120),
(1770, 392, 'Angel Bentley', 'https://www.google.com/maps/contrib/115047865069959740009/reviews', 'en', 'https://lh6.googleusercontent.com/-KmC7PXrd3sk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2I8jAVaLayp6NlR6AX9gUgzMtyCg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'They asked the question of how does it help they care', 1518548003),
(1771, 392, 'Tyler Doane', 'https://www.google.com/maps/contrib/115572535424539714844/reviews', 'en', 'https://lh4.googleusercontent.com/-yoRSIx-r5VA/AAAAAAAAAAI/AAAAAAAACE4/sX-y0UEWLc0/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'Doctor\'s a rude person, kept asking me to bring in more and more information and ended up not getting my card after months of complying. Especially since I know I\'m qualified. Wasted my time and money on this place. Grungy office, DEFINITELY NOT WORTH YOUR MONEY', 1471030766),
(1772, 392, 'K Koz', 'https://www.google.com/maps/contrib/105633371400390582550/reviews', 'en', 'https://lh4.googleusercontent.com/-l7bPUelKChc/AAAAAAAAAAI/AAAAAAAAAxE/W498_9Bgi6E/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'Was so Unorganized and Lost My Medical records. Had to leave them there because there copier was Broke they said they would send to me 5 months later and 4 phone calls Nothing.. Big Mistake will go else where the next time.', 1494956643),
(1773, 392, 'Swipegoat K', 'https://www.google.com/maps/contrib/101879606100130250503/reviews', 'en', 'https://lh6.googleusercontent.com/--NvDmFXjfns/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1UHbZZz8GxQu-sKyMmlvGSFovDTw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '6 months ago', 'Just stroked me around and area is not safe at night', 1510730278),
(1774, 393, 'Brian Redboat', 'https://www.google.com/maps/contrib/103736528465249262307/reviews', 'en', 'https://lh3.googleusercontent.com/-DKTnjIWifUg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3vS3oIU15bU0HzJ7lpwdp1ohI95Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'Paperwork was so screwed up! \nCheck your paperwork before you leave and don’t walk away from window till they get it right !\nDr was great ! Just problems with the paperwork.', 1515362363),
(1775, 393, 'Emerald Quin', 'https://www.google.com/maps/contrib/101924379494993736627/reviews', 'en', 'https://lh6.googleusercontent.com/-3iAN3pajFsg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3GTUHQ2nY-yaNRLRrsX2tu3EOdtQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'If you\'re looking for help and are honest with yourself and with them, they will help you. They literally saved my life. Any negative review is someone they tossed out for not following their simple rules. Legitimate business, compassionate, intelligent and empathetic staff. I can\'t say enough about them.', 1502211088),
(1776, 393, 'Mike Holloway', 'https://www.google.com/maps/contrib/101412194868262489928/reviews', 'en', 'https://lh5.googleusercontent.com/-lvbRTF4n3-w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2AbKFP_kp2iCDpu07AwSOKmPMO0w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'I would recommend these fine folks to all my fellow mj patients.Doc was even nice enough to get me in 2hrs earlier than I was scheduled super professional, thorough visit with Doctor,friendly staff.I dont know where the negative review of a \"dirty place\" comes from but rest assured this is definitely clean and finally a reasonable price!!!', 1507840616),
(1777, 393, 'Evil Eye', 'https://www.google.com/maps/contrib/109106760414893233642/reviews', 'en', 'https://lh3.googleusercontent.com/-3Q8vHu0ITtg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq20i5PScXPzgbKor0fywuiHyiqL6w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Looks like the mgt cleaned house there. Dr Robertson is gone. Place is legit. If you want a candy man doc, this is NOT the place to go. They help you, and don\'t kick you out for medical marijuana use. Salty people in here either don\'t like how difficult it is to get drugs, or they are self entitled impatient folks.', 1507824937),
(1778, 393, 'Dmax86', 'https://www.google.com/maps/contrib/105251782648617811556/reviews', 'en', 'https://lh5.googleusercontent.com/-JkI3vu3C2Pc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1aO9TlGyzjSemv1nKcs4dBkisNqQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '10 months ago', 'This place sucks, bunch of crack heads looking for pain pills. Staff is nice until they up and kick you out for not being a doped up idiot. Place is dirty, they don\'t return your calls. I would not waist your time here.. it\'s a matter of time before they get shut down. oh and half the pharmacies won\'t fill from Dr Roberston\n  Can\'t wait to see this place in the paper :)', 1499290379),
(1779, 394, 'Tallulahgirl57', 'https://www.google.com/maps/contrib/117676965527122603979/reviews', 'en', 'https://lh6.googleusercontent.com/-6RdKc1_ud58/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2dJQISsllQe3Hk42UmVfyHjI3UXA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '6 months ago', 'BAD BAD....Phone problems, they don’t answer.  Call Alternative Solutions. Way better.  They answer phones and return calls.  They care about patients.', 1510693952),
(1780, 395, 'jessie stansell', 'https://www.google.com/maps/contrib/103697272636064419824/reviews', 'en', 'https://lh6.googleusercontent.com/-C3XNWSZIqZU/AAAAAAAAAAI/AAAAAAAAACQ/hRbsYC7ySLI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Best experience here. Got me in and out within 30 minutes. The staff called me back promptly, and were very helpful with all of my questions. Very friendly.', 1524683225),
(1781, 395, 'Justin Pate', 'https://www.google.com/maps/contrib/102869713615619621277/reviews', 'en', 'https://lh5.googleusercontent.com/-2rBDb3_ny5E/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0pYqfIpxoNFhemT31QAgD1Wq4nHg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I got my card here. So worth it!!! It was hassle free and fast. I waited till after I received my hard card in the mail to leave a review. But I got it and all is good. It was my first card. It only took about 2 and a half weeks to get in the mail. I recommend this place to everyone. (They recommend I go to Forbidden Fruits because they accept the paperwork. I suggest 420 Dank they accept paperwork as well and it’s a much better dispencery,)', 1516015402),
(1782, 395, 'Devon Walker', 'https://www.google.com/maps/contrib/112005065830067888465/reviews', 'en', 'https://lh6.googleusercontent.com/-RneOV_0mH6A/AAAAAAAAAAI/AAAAAAAAHv0/NZogvuIZwxw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '10 months ago', 'Absolutely amazing. Alexa is literally the best with everything. Paper work she\'s got it, phone calls she\'s got it. The most friendliest customer service I have ever got anywhere. Detroit location is nice and waiting rooms are nice the people are great. Doctors was really friendly and was in and out in less than 5 minutes. Absolutely all the credit goes to Alexa she made this an absolute breeze.', 1500853522),
(1783, 395, 'doug meske', 'https://www.google.com/maps/contrib/114146404424020199601/reviews', 'en', 'https://lh6.googleusercontent.com/-2lZrO7e03hE/AAAAAAAAAAI/AAAAAAAAAAc/ap6AvcY0Ff8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Another amazing location that is part of the Natures Answer company brand! These guys know certifications!', 1522943656),
(1784, 395, 'john collett', 'https://www.google.com/maps/contrib/116311302247937869587/reviews', 'en', 'https://lh5.googleusercontent.com/-F6LwUgf0nA4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Qqddn1VILKW8EciBMzVWfJoPIEQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Super super nice people...the women in front are very nice and the Dr. Was nice dude ... recommend to anyone....', 1521666756),
(1785, 396, 'John West', 'https://www.google.com/maps/contrib/100048045243529438482/reviews', 'en', 'https://lh5.googleusercontent.com/-rTTtCm0rkkM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1tB5_Plklho8sx9o43Ptn0d-4n_Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very professional,  very friendly, and very well maintained. My first visit they treated me like I was family, explained everything in full detail and helped me with questions I had. I would and will recommend first natural wellness to any and all family members and friends. Look forward to being in great hands!', 1524928312),
(1786, 396, 'Aubrey King', 'https://www.google.com/maps/contrib/111580133623331639401/reviews', 'en', 'https://lh6.googleusercontent.com/-dHmHq3P5LO0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2uiwyUw1JTq_PdVlNq8kOQtHx5Sw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Came in without an appointment and they took great care of me. Easy paperwork to fill out, and the doctor was well informed and very helpful. 10/10 would recommend', 1527347073),
(1787, 396, 'Jesse Fitton', 'https://www.google.com/maps/contrib/111758481800609128307/reviews', 'en', 'https://lh6.googleusercontent.com/-59fOsEHeLBA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2hIBz952MUrzGZ4b6QZkK7wtFJ4A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Great place nice service called promptly to reschedule appointment. And was very flexible. Clean and comfortable setting. Doctor was to the point and efficient.', 1525878786),
(1788, 396, 'Frank Scarpace', 'https://www.google.com/maps/contrib/116156012075861504782/reviews', 'en', 'https://lh3.googleusercontent.com/-lSkQXyNeTf0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3QDQqnbPElTxTjIPxFBJPc27bz5A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'The entire staff was so helpful and courteous!!! I can’t say enough good things about this business. Great recommendation on where to obtain medicine! Very nice office with large waiting room to make you feel comfortable while you wait. Very professional! I will definitely tell others about you guys! Thank you', 1517501613),
(1789, 396, 'Hailey King', 'https://www.google.com/maps/contrib/110299320212780597578/reviews', 'en', 'https://lh4.googleusercontent.com/-yBCNXjLXUaU/AAAAAAAAAAI/AAAAAAAAAFg/-2osr-Get-0/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'People at the front desk are amazing, the doctor is fast and to the point and very professional. I didnt know anything before I came here so they informed me and made me feel very comfortable :)', 1527346869),
(1790, 397, 'Zahra Nasser', 'https://www.google.com/maps/contrib/105407818080520093182/reviews', 'en', 'https://lh6.googleusercontent.com/-CkVE70VOnJc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1EDWRkHaWJhWIbSUfHnIXWunQU8g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Very helpful staff! Process was easy and quick! Very friendly! Highly recommend!', 1509987834),
