(1793, 397, 'Eric Weinstein', 'https://www.google.com/maps/contrib/101617822987773612105/reviews', 'en', 'https://lh5.googleusercontent.com/-0kkW4oUqauQ/AAAAAAAAAAI/AAAAAAAAF0w/39AAxRLychk/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, '6 months ago', 'Not a medical marijuana dispensary. Hard to find also', 1510686617),
