(1795, 398, 'Christie Mazur', 'https://www.google.com/maps/contrib/110441989521191403073/reviews', 'en', 'https://lh3.googleusercontent.com/-OoZK3pjsPI0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2oj7jX--HB8P1wh2gEWWdaLr7vfw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Awesome staff. When you walk in it looks like you\'re going to wait hours when really it\'s like a 30 min wait. Great price. great environment', 1524327733),
(1796, 398, 'Tim Lang', 'https://www.google.com/maps/contrib/106991133530246749298/reviews', 'en', 'https://lh4.googleusercontent.com/-UBQrLVqiVm0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq21XKzyIe9h8c5lm2NhLUMjvquw-Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Loved it! Fast, Polite, knowledgeable, and most of all friendly! To anybody out there considering getting a medical card, theses are the guys! Doctor Anthony Meram, and staff Katie, and Alexa are the bomb! ;)', 1527367007),
(1797, 398, 'Rick gieco', 'https://www.google.com/maps/contrib/113845051407943562482/reviews', 'en', 'https://lh3.googleusercontent.com/-SCjEcN93WUM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2O1S510_l21yKOYu9U8TpjsYW4Ng/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Amazing clinic! I got my card for the first time in about 2 weeks through a quick painless process. Doc was great and the ladies were very helpful and gave me the CORRECT answer to my questions', 1522415157),
(1798, 398, 'Michelle Hayes', 'https://www.google.com/maps/contrib/108971998970854947696/reviews', 'en', 'https://lh6.googleusercontent.com/-PvlUIp3W31Y/AAAAAAAAAAI/AAAAAAAAAA8/65eXQEgTNtQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'They\'re ... simply amazing! I\'ve coming here for 7 years now? It is still a very pleasant experience and I\'m in and out in like a half hr. Love the NEW LOCATION BTW (;', 1521215952),
(1799, 398, 'Steven Gaskill', 'https://www.google.com/maps/contrib/107700071539305013774/reviews', 'en', 'https://lh4.googleusercontent.com/-pVw86qEUaLQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3-bSU3O7a1jppFgvMh_A1Yla2WBQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This place is awesome!! Super friendly staff, quick and painless process!! Will be back for all my future certifications/renewals!! Smells exquisite in there btw', 1523495989),
(1800, 400, 'David Febo', 'https://www.google.com/maps/contrib/103728010054079292123/reviews', 'en', 'https://lh4.googleusercontent.com/-FqxzxXJCRZE/AAAAAAAAAAI/AAAAAAAAA-s/RJggikQU1Ps/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Went here today and it was the best experience i have ever had while getting my medical marijuana card.  The Doctor and his staff were very polite and extremely well organized.  The office is really nice as well.  They also were alot cheaper than everyone else which was also a plus.  I highly recommend these guys!', 1521055372),
(1801, 400, 'Shannon The Great', 'https://www.google.com/maps/contrib/116667744309170207480/reviews', 'en', 'https://lh4.googleusercontent.com/-fO75750osVo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Y-vu7t8ySuwgG0VVeYr-xUyIjDA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'The front staff was Amazing! They are super accommodating & awesome. DEFINITELY WILL RECOMMEND to others! \nThank you!', 1526481846),
(1802, 400, 'Jessica McGruther', 'https://www.google.com/maps/contrib/116210524111529566459/reviews', 'en', 'https://lh6.googleusercontent.com/-PhnodTmmJRs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2qAg3QgGJpfOBzjTnU-zMVt77cWw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'Quick & professional. No muss, no fuss even without medical records! Staff was great!', 1525279210),
(1803, 400, 'Ryan Hurtado', 'https://www.google.com/maps/contrib/111638104276176448910/reviews', 'en', 'https://lh4.googleusercontent.com/-ket_lNScHKo/AAAAAAAAAAI/AAAAAAAAADE/ey6VKNhqwG8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'Staff is very helpful! Set an appointment and they will get you in and out promptly.', 1525270722),
(1804, 400, 'Cassie Kerr', 'https://www.google.com/maps/contrib/110890923244560527685/reviews', 'en', 'https://lh6.googleusercontent.com/-VpbkqU3AIMw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0s--EPPR80zc0Gyu_WsQ-T2NFEtQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very friendly staff. Very easy! Recommend to anyone looking to get card.', 1524931860),
(1805, 401, 'Andrew Stoll', 'https://www.google.com/maps/contrib/112036398511442227361/reviews', 'en', 'https://lh5.googleusercontent.com/-PITZDfXcVjM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3U2bJvApb3iXpmhLdZe33NzE4hKQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Professional and compassionate, LeafLine has been my go-to place for medical cannabis for over two years now.  \n\nDealing with chronic neuropathic pain in my feet and hands since 2014 when a spinal untethering snipped my spinal cord,  I found what i could only describe as miraculous relief with LeafLine\'s products.  \n\nEven as other health concerns develop, LeafLine has kept a keen ear to my needs.  I plan on keeping with these guys for as long as I stay in Minnesota.', 1515977135),
(1806, 401, 'Aaron Schultz', 'https://www.google.com/maps/contrib/108118870191790617097/reviews', 'en', 'https://lh5.googleusercontent.com/-qIYRXu8Xr_E/AAAAAAAAAAI/AAAAAAAAELo/znbhhPM67AI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I would like to thank everyone there, especially Emily she has always gone above and beyond  with her compassion for the people that need there medication.and she has helped me personally several times with different issues I\'ve had and appreciate it so much. Thanks again everyone at leafline from Aaron', 1517266284),
(1807, 401, 'Gavin Fredrickson', 'https://www.google.com/maps/contrib/101687727243407944972/reviews', 'en', 'https://lh4.googleusercontent.com/-5u672oH9cQ8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0DggaXLanvTXdwrUqhOHicuun8NA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '7 months ago', 'Better off using the plant than over priced \"medication\" given to you by non professionals', 1507399903),
(1808, 401, 'David Mendolia', 'https://www.google.com/maps/contrib/110240943305603154042/reviews', 'en', 'https://lh3.googleusercontent.com/-OhUEax-8Igg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1tCJMU4KlkTVX_HTrwtiKvmH0KQg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, 'a year ago', '\"Meyer pays $300 out of pocket each month for tinctures of oral solution and two .5 mL oil cartridges for vaping. For a time, he picked up a second job to cover the cost.\"\n\nCannabis should be legal and cheap. Not help above our heads by a handful of corporations.', 1490795126),
(1809, 401, 'Jason Marshall', 'https://www.google.com/maps/contrib/100743061621953226577/reviews', 'en', 'https://lh3.googleusercontent.com/-SPSZw8Y3PCI/AAAAAAAAAAI/AAAAAAAAABQ/Jwq86Cwu3tE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Nice', 1511129962),
(1810, 402, 'garrett lesnar', 'https://www.google.com/maps/contrib/105108508990143709376/reviews', 'en', 'https://lh5.googleusercontent.com/-IuaWmXNFK2g/AAAAAAAAAAI/AAAAAAAAAjk/C_QL1jjt3ik/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Great staff and very knowledgeable pharmacists!... Awesome that medical cannabis is legal in Minnesota I am so fortunate for this place as now my pain is the most under control it had been in the past 10 years! Thank you!', 1526495231),
(1811, 402, 'Mnpretty', 'https://www.google.com/maps/contrib/117772311559137423550/reviews', 'en', 'https://lh3.googleusercontent.com/-OTDgYHc8uJc/AAAAAAAAAAI/AAAAAAAAAGQ/3YQyHVKEdig/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'Mpls location is amazing because of their welcoming staff. The rewards program helps with cost. I love that they are continually adding new product. The staff is super friendly!!! They deserve a raise. You will leave wishing Patti was your “Real Life” bestie!', 1525196420),
(1812, 402, 'Joan Nyakundi', 'https://www.google.com/maps/contrib/108361104005928721022/reviews', 'en', 'https://lh5.googleusercontent.com/-g_oG_pXHf1Y/AAAAAAAAAAI/AAAAAAAATe0/qCyGFWY1W0Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'I really like this location. As much as I am phobic of driving anywhere downtown Minneapolis, this location is very easy to get to AND park at (bonus for the location!)\nThe staff is very friendly and willing to answer any questions I might have. The online option is really nice and cuts down on wasted time in waiting. It\'s decorated very nicely, and you get a calm feeling being there under the circumstances. I highly recommend doing business there.', 1518059549),
(1813, 402, 'Mara K', 'https://www.google.com/maps/contrib/106238833435164542650/reviews', 'en', 'https://lh5.googleusercontent.com/-rW_1tRO81YE/AAAAAAAAAAI/AAAAAAAABr0/B-a_gSMguNI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '3 months ago', 'Very difficult to get ahold of anyone there—phone system loops you around endlessly and I’ve never been able to talk to someone when I call with questions, which is not good. I’ve left a number of messages in the past and have only once received a call back. I was trying to find information on products and pricing today but their website is down and no one was answering the phones.\n\nAlso, it’s been awhile since I went into the Mpls location, but when I was there the staff was often rushed and not very helpful or friendly. I’ve since switched to the other MedCan company/dispensary in town because they tend to be more friendly, patient, knowledgeable, etc. I’d like to give MN Med Solutions another try, but if I can’t get ahold of them or they don’t call me back, then I’m not going to bother.\n\n**Edit: someone did call me back today and they were moderately friendly/helpful so I upped my rating to 3 stars. But they definitely still treat you like a number instead of a patient. I need to go there to try one of their products but unless my in-store experience is better than my phone or lady in-store experience, I won’t likely be a returning customer and will stick with the other dispensary where they are friendlier.', 1519321489),
(1814, 402, 'Travis Ristow', 'https://www.google.com/maps/contrib/101945453684249915358/reviews', 'en', 'https://lh6.googleusercontent.com/-gXIVJxbiJ9U/AAAAAAAAAAI/AAAAAAAAAgE/5e21Xn_bW7Q/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '5 months ago', 'These people know what they\'re doing explain everything to the finest detail on what they have to offer each spot and location have different personalities so it\'s up to you where you want to go either way they all have the same products wheelchair push button entrances an elevator even at the Minneapolis location', 1513621156),
(1815, 403, 'Christa Richardson', 'https://www.google.com/maps/contrib/108692191403182586693/reviews', 'en', 'https://lh3.googleusercontent.com/-bl0anDhmlqg/AAAAAAAAAAI/AAAAAAAAIsA/0gGAfsQoJSk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, 'in the last week', 'I looked into this lab, they carry 3 products!!! One strain of med marijuana, 1 CBD oil and 1 balm. What is the point of a consultation if it\'s a one med fits all?! I called the other lab, they carry more than 35 variations. Easy decision!!!', 1527621776),
(1816, 403, 'Wayne Bentz', 'https://www.google.com/maps/contrib/104723029388233359388/reviews', 'en', 'https://lh6.googleusercontent.com/-B7EmWVY0lSc/AAAAAAAAAAI/AAAAAAAAAEk/5IERKRs_OHA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very professional operation. I feel very comfortable when ever I am there. The people are courteous and polite.', 1522886369),
(1817, 403, 'Miah Kay', 'https://www.google.com/maps/contrib/102339303993523260447/reviews', 'en', 'https://lh3.googleusercontent.com/-PBdAhKuGEeI/AAAAAAAAAAI/AAAAAAAAB2I/RISBWDBFkSE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'First off- SHAME on those of you who make patients who need LeafLine and their medication SCARED to go there by posting such negative, toxic and hateful things because you did not get what you wanted or didn\'t do any kind of research as to price...IT IS NOT LEAFLINE\'S FAULT THAT IT COSTS WHAT IT COSTS. PERIOD. As a matter of fact, they are very generous with pricing and giving help to those who qualify for it. I would also like to say that the people there are WONDERFUL!!! Monica is my Pharmacist and after being terrified to meet her because of reading a certain review seen below, I found her to be knowledgeable, caring and empathetic to my medical problems and my situation and genuinely wanting to do what she can to help me. Hey GRACE...you have MORE THAN enough grace and kindness! That goes for ALL of the ladies and gentlemen that I met at the front desk and back in the pharmacy pick-up area. Keep doing what you\'re doing ALL of you! You are greatly appreciated and St. Paul and the rest of Minnesota are very lucky to have you. Thank you!', 1512190213),
(1818, 403, 'Jack Peterson', 'https://www.google.com/maps/contrib/109684923481767483386/reviews', 'en', 'https://lh5.googleusercontent.com/-dfO3BlrSXIs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2B9HGhCOoiAmrM1D-avGWSMcrnnQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'The visit was comforting and the pharmacist explained everything thoroughly! also the medicine works great for my pain from Lyme\'s disease and I can go on living feeling great and enjoying life! *****', 1516489956),
(1819, 403, 'Barry Rubin', 'https://www.google.com/maps/contrib/102087202265109105998/reviews', 'en', 'https://lh6.googleusercontent.com/-7eUizK-PoA4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3SU8uFECrKufAVzYsUtKagWSd0WA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I have read a number of negative reviews of this place and went there on 11/13/17 very suspect of how I was going to be treated. Well that was a very faulty feeling. I am a primary caregiver for a patient so met with both the take in person (Grace) and the Pharmacy Clinician, Kim. They were both exceptionally caring and concerned. You could not have been made more comfortable and informed of the process. Everything that was taking place was carefully explained to my client. Exceptional customer service. My thanks to both.', 1510635806),
(1820, 404, 'Bryan Toutges', 'https://www.google.com/maps/contrib/108471491691107936834/reviews', 'en', 'https://lh5.googleusercontent.com/-e1wB3gxTU04/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2T8R4cx44Vk494KeFCXD73Uccbjw/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '4 months ago', 'Best prices in the state plus loyalty bucks add up FAST so you earn free stuff very quickly. Melanie in the Bloomington location is great to deal with and they offer educational seminars for free as well. Great product knowledge just wish the state itself would adopt a more Colorado type system.', 1516048537),
(1821, 404, 'Hydro House', 'https://www.google.com/maps/contrib/117749206617113111404/reviews', 'en', 'https://lh6.googleusercontent.com/-rQex1YhS4O4/AAAAAAAAAAI/AAAAAAAAAB0/palw2G5nhqc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Great staff very helpful clean office!\nGreat experience!', 1518704350),
(1822, 404, 'Q', 'https://www.google.com/maps/contrib/104105105709452421233/reviews', 'en', 'https://lh3.googleusercontent.com/-Dj_LtDTOMKs/AAAAAAAAAAI/AAAAAAAAALE/uviZKn-EptU/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '5 months ago', 'First, staff are rude. Then their Pharmacist is unaware of how their medication is made or what kinds of marijuana there are. To top the cherry I was scammed out of my discount. On their website it said 15% off for new customers and 15% off for people that have MA, SSI, SSD etc. when I brought this up expecting 30% off I was ridiculed. Then their Manager called and disagreed what was on their website. I took screen shots and employees agreeed in what it said. After returning home I checked again, guess what!? They changed it saying only one discount at a time! This was after being rude to me, refusing to allow my discount. \n\nPlease take your business elsewhere. Unfortunately we only have 2 companies in Minnesota that offer medical marijuana. Please use the other. Thanks.', 1513898804),
(1823, 404, 'David Clickner', 'https://www.google.com/maps/contrib/102765884135071967464/reviews', 'en', 'https://lh5.googleusercontent.com/-977InZTfMJU/AAAAAAAAAAI/AAAAAAAALQI/Y9I_wz1i5Lc/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '5 months ago', 'I got legal but I\'ll tell you this. At 1200.00 dollars a month for effective dosing... Fail. I moved to Colorado this month for my meds. I bought an oz of presidential cush today for 48 dollars in Denver. That\'s half a months meds and darn good meds. Sorry minnmed. Someday when the prices are right I\'ll come back home. Sorry peeps. You guys are wonderful and are on the front line of change. Love you guys.', 1514460156),
(1824, 404, 'Tyler Saro', 'https://www.google.com/maps/contrib/109354125772840308963/reviews', 'en', 'https://lh5.googleusercontent.com/-e1jvo_J92vs/AAAAAAAAAAI/AAAAAAAAADk/ml0eMn9awgk/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '10 months ago', 'It was an ok experience. I had to wait well beyond my appointment time to be seen. I would plan an extra 40 minutes into the appointment and that would be for waiting only. The staff was friendly however.  The receptionist and pharmacists were extremely nice and helpful.', 1501615215),
(1825, 405, 'George Brossart', 'https://www.google.com/maps/contrib/105600744848268119662/reviews', 'en', 'https://lh5.googleusercontent.com/-E1XQDNrCNfo/AAAAAAAAAAI/AAAAAAAAAEg/K801VYVhvuk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', '', 1527076224),
(1826, 405, 'Heather Villneauve', 'https://www.google.com/maps/contrib/115981257443972282109/reviews', 'en', 'https://lh5.googleusercontent.com/-qPRWeJG32o8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1HJ5vapOY7ZJRWQS2G_88w8EuGqw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', '', 1512093163),
(1827, 406, 'Greg Eckes', 'https://www.google.com/maps/contrib/101087233352328104740/reviews', 'en', 'https://lh4.googleusercontent.com/-6VkXnOCkHyY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1W37wyl7tIq-iY8BJ9tX91p2AOfw/s128-c0x00000000-cc-rp-mo-ba8/photo.jpg', 5, '3 months ago', 'From start to finish this place was welcoming and professional. The receptionist was cordial and clear with her instructions. The pharmacist was patient and very knowledgeable in her trade. An all around great experience. I would highly recommend this medical facility.', 1519066839),
(1828, 406, 'Nicholas Kreidberg', 'https://www.google.com/maps/contrib/116231984315298447968/reviews', 'en', 'https://lh3.googleusercontent.com/-qQNIQ34JlXA/AAAAAAAAAAI/AAAAAAAAO0Q/WCt2rjhj7ho/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '3 months ago', 'Very well organized, friendly staff and the best medical stuff you can get in Minnesota. Keep in mind this will be nothing close to what other states can provide. Things in Minnesota are extremely limited and expensive.', 1519490689),
(1829, 406, 'Aaron Montreuil', 'https://www.google.com/maps/contrib/117663644481804844925/reviews', 'en', 'https://lh5.googleusercontent.com/-x1PI8HiLYxQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1IpHvMbxEMKc-88A4yStZ1TUy2cg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I\'m a member and they are very accommodating.. I only wish products cost less.', 1522160951),
(1830, 406, 'Elizabeth', 'https://www.google.com/maps/contrib/100665880680923400052/reviews', 'en', 'https://lh3.googleusercontent.com/-J9el-6SPQy4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2N7ElkkbMpbpvQHgZNFKVAqO6dFQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '5 months ago', 'Easy to make appointments online; open weekends, as well as weekdays, for extended hours; friendly staff with tons of information, who will take the time to answer your questions; never a long wait if you have an appointmen; good products in a wide variety of formulas and ways to get the products in one\'s body; cheaper than the other dispensary yet just as effective (but buy your own refillable vaporizers, if you use them, and get bulk oils to save money); easy to send one\'s certified caretaker to pick up a refill. Cash only. Several van accessible handicapped parking spaces; lot is free parking (they\'re located in a strip mall of sorts next to a Jimmy John\'s sandwich shop and near a Lifetime Fitness center).', 1513553716),
(1831, 406, 'thomas kolbe', 'https://www.google.com/maps/contrib/100961356144005244605/reviews', 'en', 'https://lh6.googleusercontent.com/-yq-fjv_-Vdk/AAAAAAAAAAI/AAAAAAAAX3g/Xfp8ZQoQm7g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great staff great support love this place keep up the good work', 1523637424),
(1832, 407, 'Megan Keesling', 'https://www.google.com/maps/contrib/104980748671558862861/reviews', 'en', 'https://lh3.googleusercontent.com/-G-D6xmsy6CU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2vo01RV9T0v1r3o4e10osCjDUp0w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'My first visit went so smooth. Every one was so nice and helpful. I was scared at first but all my questions were answered and I felt so good when I left. I wish this program was available to more people who needed it. Thank you LeafLine Labs for being there for all of us.', 1525872135),
(1833, 407, 'Steve loch', 'https://www.google.com/maps/contrib/106896116045347573083/reviews', 'en', 'https://lh6.googleusercontent.com/-SmFKNIanXkc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq35rlxSdQGQZoUUlHzSixD3H1myrA/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'Great place for alternative medicine. Very professional and helpful. I  read a lot on line and they verified  everything I read I love that the have pharmacist on staff. Makes me feel better aboutgoingand using alternative medicine.  It has helped us.  My neurologists  was even OK with me lookingbintobalternstive treatments.   I beat the odds and made it a Year  before having to go back under theknife and haveanothervtumorvremoved.', 1522531452),
(1834, 407, 'Shirley Nelsen', 'https://www.google.com/maps/contrib/111646824312587312221/reviews', 'en', 'https://lh5.googleusercontent.com/-ceziO2DWWCQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3LNVDppmvwMK_qgO3Fh50MTJfC1g/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'The staff is amazing and I now can enjoy life with my Kids and Grandkids more often', 1524047406),
(1835, 407, 'Kristina Zapata', 'https://www.google.com/maps/contrib/113077998372770155482/reviews', 'en', 'https://lh4.googleusercontent.com/-kN5j_7Z0HRY/AAAAAAAAAAI/AAAAAAAABN4/v4I6vtSIQ04/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Very professional and very clean. Also the staff is amazing they answered every question and they treated me like a normal person.. i highly recommend them. Thank you LeafLine', 1517880427),
(1836, 407, 'Greg Renn', 'https://www.google.com/maps/contrib/110325962440119954986/reviews', 'en', 'https://lh3.googleusercontent.com/-TtB-zM2Mn4g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3FZ7tCrWXfvjvDJg_dud8Es7W8Uw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'My first visit went smoothly, the staff were friendly and helpful.\nMy second visit the staff were just as friendly and helpful as before.\nThe facility is easily accessible and very clean.\nAs a Veteran,  the discount is very helpful.', 1511822993),
(1837, 408, 'Andrea Richer', 'https://www.google.com/maps/contrib/110476741638481031559/reviews', 'en', 'https://lh4.googleusercontent.com/-2zXOfc_RVB8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0-GIoe89Ff9SS_zVvjzE56EElcTA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I would recommend this place to anyone and everyone! They are amazing. Very professional, informative and fast!', 1523302543),
(1838, 408, 'Jay Mattson', 'https://www.google.com/maps/contrib/116817946508261947465/reviews', 'en', 'https://lh5.googleusercontent.com/-gFoIBCnLuPk/AAAAAAAAAAI/AAAAAAAAAdg/7nIhaFmMqNU/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '5 months ago', 'Good clinic at first.dr Locketz takes no insurance although they want some type of insurance to bill for urine analysis and they bill you 5,000 dollars per u.a. simply robbery.He is a good man that once had good intentions.', 1513613821),
(1839, 408, 'Derek Pavelka', 'https://www.google.com/maps/contrib/100800670638460765514/reviews', 'en', 'https://lh5.googleusercontent.com/-MttV7-qHxMU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2i4gne_rzCrLnlBJ62ztywnxYKdw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'Everything changed after they moved locations it was always overpriced and there was never a way to get ahold of anybody I never spoke to my doctor on the phone one time in the two plus years I was going there the only word I ever heard when I walked in the door was payment and then you got treated like the piece of trash they think you are doctor lockets was nice at first and then brainwashed by whoever you talk to him when you go there and he knows nothing about you and won\'t see you but takes that money and after they take your money you get ambushed and they take all your meds away without notice and no refund of course horrendous', 1515305475),
(1840, 408, 'Grant Timm', 'https://www.google.com/maps/contrib/104791758701310724284/reviews', 'en', 'https://lh5.googleusercontent.com/-BL8L2fZcA60/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ABTWWBEyuEPwsqLG8L3g5iVKGig/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I simply cannot say enough good things about my experience with TimeWise Medical. Throughout the whole process I was treated with genuine concern and kindness from Dr. Locketz and his staff. I would urge anyone with intractable pain to make an appointment soon.', 1470332537),
(1841, 408, 'Jeffrey Thompson', 'https://www.google.com/maps/contrib/110237949905192391484/reviews', 'en', 'https://lh4.googleusercontent.com/-TwqyujMCmm8/AAAAAAAAAAI/AAAAAAAAAB8/DVxls6PHQkM/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a year ago', 'Great clinic, friendly employees and calming atmosphere. Dr Locketz is very understanding and cares about the patients and doesn\'t let big pharma dictate what\'s best for their patients. I would highly recommend going here if you need consolation about chronic/physiological pain and how to treat the underlining effects of pain.', 1468688081),
(1842, 409, 'Greg Eckes', 'https://www.google.com/maps/contrib/101087233352328104740/reviews', 'en', 'https://lh4.googleusercontent.com/-6VkXnOCkHyY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1W37wyl7tIq-iY8BJ9tX91p2AOfw/s128-c0x00000000-cc-rp-mo-ba8/photo.jpg', 5, '3 months ago', 'From beginning to end the whole office staff operated like a a well oiled, finely tuned machine. Reception was very clear and concise on their instructions. Phase one with Dr. Dodson was very informative. He listen to all of my questions and gave me clear answers I could understand. I never felt hurried. Phase two was completed with a minimal amount of effort from me and a maximum effort from the staff. I couldn\'t be happier. I highly recommend a visit for all your pain control needs.', 1518841177),
(1843, 409, 'Kathryn Meier', 'https://www.google.com/maps/contrib/104911738633883952878/reviews', 'en', 'https://lh6.googleusercontent.com/-P_RiJ1GPo64/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2qZWoZuGX0YnDe0YtVXChWv6uLKg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I have been seeing doctor Dodson for a couple years now and he is one of the nicest doctors that I have dealt with. He is considerate listens to what you have to say and makes a plan that fits your needs. He is actually concerned about what your issues are going on with you.  he has priorities and sticks within the ability\'s of his position. If you are caught doing the wrong things he will cancel you as a patient.  I was very lucky to be able to find him after my regular doctor ended  Her business. Doctor Dodson make sure that You are following his instructions in order for you to stay as a patient.. within the law.  His staff is very friendly also.', 1517073060),
(1844, 409, 'Anthony\'s Channel', 'https://www.google.com/maps/contrib/100117251236537397646/reviews', 'en', 'https://lh4.googleusercontent.com/-LnjJeQ-ND2E/AAAAAAAAAAI/AAAAAAAATo0/9JA0tH7s07I/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Dr.Dodson and his staff has given me the tools to live with a better quality of life.\n He has always been very informative and has your best interest in mind. From the massage\'s to chiropractic adjustments to help with my mobility and for those days(if you live with daily cronic pain you understand) that your pain keeps you down I was put on a safe treatment plan. Whats really nice is having my dignity back. They always have your best interest in mind and treat you as such. Not like we\'re just here for a script.They know there business and get you feeling better so you can start living again. \nSo thank you Dr.Dodson, I applaud you and your staff. Not just for helping me but for what you stand for.', 1516627623),
(1845, 409, 'Ashley And Aesthetics', 'https://www.google.com/maps/contrib/117966770422903024316/reviews', 'en', 'https://lh4.googleusercontent.com/-xSrGnPDLtBk/AAAAAAAAAAI/AAAAAAAAADU/9x1nL7M4m4s/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I was referred to Dr. Dodson almost 2 years ago. Before him I was seeing a Dr. in south FL. Who put me on a very wrong plan. I\'m so happy that Dr. Dodson helped me navigate through my last doctors \"plan\" He has helped me decrease medications and overall kept me healthy. I would strongly recommend him and his staff to anyone. He doesn\'t rush you, he hears your concerns and puts your health above everything. I\'ve been to so many doctors who don\'t care. It\'s been life changing to have a good doctor! \n\nHis staff is friendly and always works around my busy schedule. Everyone there is always happy and eager to help. Would recommend this clinic to someone who is looking to be healthy and make positive changes in their life!', 1516047988),
(1846, 409, 'Samuel Mullaney', 'https://www.google.com/maps/contrib/101850575679702305539/reviews', 'en', 'https://lh5.googleusercontent.com/-jRG4nLLmPlY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1glwu97CBGa5-LVO3_EjDJi_-ABA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I\'ve been dealing with chronic pain for over ten years. I have to say Dr Dodson and staff are compassionate, understanding and very professional. Dr Dodson is pleasant to talk with; he listens and actually cares. The facility is clean, and comfortable. I\'m so thankful to have some quality of living, and knowing that Dr Dodson is looking out for my well being.', 1517284148),
(1847, 410, 'Aunudrei Oliver', 'https://www.google.com/maps/contrib/112658986544969134943/reviews', 'en', 'https://lh6.googleusercontent.com/-XoDX88Rl2lQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0EDo88bwnPI1dzKtZPuERZ5SJrKA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'The office and the referral from this location was less than acceptable. This process feels like its better suited to benefit the company versus the patient. The physical therapy provider scheduling process was not convenient and in most cases confrontational and rude.The primary provider was more concerned on our next visit versus how the overall status of the patient was. I hear the technology here is top notch it\'s unfortunate the primary support system and associated partners are not.', 1522869698),
(1848, 410, 'Emily Wallin', 'https://www.google.com/maps/contrib/104677168117486162214/reviews', 'en', 'https://lh3.googleusercontent.com/-uGJ5oTpmDDU/AAAAAAAAAAI/AAAAAAAAAAA/8vjMNoC5WfM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Compassionate, understanding, great listener, knowledgeable, caring, humorous, great bedside manner, understanding. Absolutely recommend Dr. Cohn!', 1510284813),
(1849, 410, 'Lynne Weisskirk', 'https://www.google.com/maps/contrib/107771606240867832800/reviews', 'en', 'https://lh4.googleusercontent.com/-8JNvoUwpb30/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ucoPi-SGQsS5Az-YkiR8VW9v3dA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', '', 1474917791),
(1850, 411, 'Southern B', 'https://www.google.com/maps/contrib/107335836685113646978/reviews', 'en', 'https://lh3.googleusercontent.com/-M_ooKqUu9As/AAAAAAAAAAI/AAAAAAAAAVs/2X55lnj57rc/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '7 months ago', '', 1509229779),
(1851, 412, 'Amanda Lynn', 'https://www.google.com/maps/contrib/100306281322616243637/reviews', 'en', 'https://lh5.googleusercontent.com/-dTn8VwldMsw/AAAAAAAAAAI/AAAAAAAAAC8/aGvpj6hfXSg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Wonderful place. I stopped by yesterday with a friend for the first time after checking out Caregivers for Life for the first time and I\'m so grateful we did. The difference with Greenfields was like night and day. These guys were so friendly and knowledgable of CBD, the CBD products they carried, and the selection offered more CBD products than the place who claimed to have all the stuff and the 5 other stores we called around. Prices were super reasonable, wish we stopped there first.\nThe dude behind the counter was so friendly and patient with us even though the place was packed, and the whole vibe was just really great and helped turn my negative experience with the wedgie people in snobville into a really chill and positive one at Greenfields. A woman chatted with us and was really cool as we checked out too. I\'m definitely coming back. I can\'t thank the place enough. Besides knowledge and product selection, sometimes it\'s the little things that can really help a person get through. These guys made my day just by being decent human beings.', 1527361074),
(1852, 412, 'Caleb Williams', 'https://www.google.com/maps/contrib/110294901609722742494/reviews', 'en', 'https://lh6.googleusercontent.com/-THt16O5jXKQ/AAAAAAAAAAI/AAAAAAAAAGQ/_FKryupz1Mo/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '5 months ago', 'Great prices and good deals on small and large amounts. Very personable, engages me on what my preferences and told me about all the deals they had at that time, even small amounts. Nice clean sales area as well.', 1514786681),
(1853, 412, 'Sassafras 23', 'https://www.google.com/maps/contrib/101728509193526269287/reviews', 'en', 'https://lh4.googleusercontent.com/-vbrdaAKBps8/AAAAAAAAAAI/AAAAAAAAABs/PlI655dOCeg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '4 months ago', 'Prices are awesome! Employees nice and helpful. Only reason for 4 stars- locale less than desirable.', 1515185388),
(1854, 412, 'Johnny Montoya', 'https://www.google.com/maps/contrib/105285385487729863372/reviews', 'en', 'https://lh4.googleusercontent.com/-4FfvSPOIdFI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0u62JZMYv_ZOHqMgS-yd7_Or3NsA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Greenfields has good low every day prices , while not many medical bud still fairly good choice and quality side quite a good variety, and the bystanders are friendly , they greet you .', 1519702865),
(1855, 412, 'Z Howell', 'https://www.google.com/maps/contrib/109155097753704723230/reviews', 'en', 'https://lh3.googleusercontent.com/-tZbjNIodj9k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1cdDeqVYvqRyyFUoMckc0bxZTiDg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Friendly staff, great prices.', 1527135688);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(1856, 413, 'Greg Hanley', 'https://www.google.com/maps/contrib/117029151374097504818/reviews', 'en', 'https://lh6.googleusercontent.com/-waDH5XHsYkA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3GPpIpEIdaMIUo5hS1HoqL0buJIA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '2 months ago', 'I want so badly to give this place a good review. They have an amazing deal on concentrates and their selection usually can\'t be beat. That obviously comes with a big BUT...today I went in and the selection was horrible. There simply wasn\'t anything. I called the other branches and was told the weekend had hit hard and they were out. This is a Thursday so I don\'t know how the weekend effected today\'s stock.\n  I was put in contact with the manager Austin and he was downright rude to me; he spoke over and down to me. He rushed my words and did not listen not hear me at all. I simply wanted to know when the next shipment  would be there. Not a ridiculous question from someone wanting to spend hundreds of dollars. If Austin can read this he should know I have a lot of places I can spend my money. \n  Nice new facilities and normally a great selection with little hassle...today though. Maybe it\'s because I just drove 2000 miles and headed for this store only to have this experience. \n  They do have a decent reward system. Overall they are set up to succeeded but will need customer service training from the top down. If the manager is speaking to customers the way I was spoke to I can only imagine how he belittles and ignores his staff.', 1520534215),
(1857, 413, 'Angela Marie', 'https://www.google.com/maps/contrib/115576402137260715499/reviews', 'en', 'https://lh6.googleusercontent.com/-vdOMDdpqqWU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3ekTC-rK9O8g9tLPE4aRH8HwhuHA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'Some of the worst weed I’ve ever had (Colin OG). I work at a grow and I’ve never had something so tasteless and wet. Why would you sell wet weed? At least cure it properly. Till then I’ll continue to go to my work for better flower, concentrates, and syringes.', 1527375301),
(1858, 413, 'Daisy Mae', 'https://www.google.com/maps/contrib/111834927648138713483/reviews', 'en', 'https://lh4.googleusercontent.com/-sGVazsWgr2Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1BgmRqhrlAgNhccjTKzQzgEU9mWQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'HORRIBLE. HORRIBLE. HORRIBLE.  Me and my boyfriend, who is an Afghanistan veteran, went to the Mississippi ave location today at about 12:10 pm and after my boyfriend had presented his ID and the officer took it back he came out minutes later after cracking his ID and told him he could not shop at the store. I then called the shop to speak with a supervisor about your officer’s mishandling of our property to which he said no that didn’t happen and that I was unable to get a number or contact name for someone above him and that he refused to give me his name for reference and laughed at me over the phone. As we drove away from your store the officer and your “supervisor” stood at the door laughing and waving at us. As someone who has spent a lot of money at this particular location and never had a problem I’m livid to say the least. Our property is now damaged because of this employees carelessness. I’m also appalled at the lack of professionalism displayed. I will very happily never spend a dime here again and let every media outlet and person I know of our experience and offer them better shops to go to!', 1525718227),
(1859, 413, 'Nyk Zukowski', 'https://www.google.com/maps/contrib/101485504105287173760/reviews', 'en', 'https://lh4.googleusercontent.com/-CNVbFUi_HdU/AAAAAAAAAAI/AAAAAAAADIs/XAGtFFSzEHM/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '4 months ago', 'There is usually a wait time before getting in (popular place) but not overly so most times (within 10 minutes usually). They do make you feel a bit rushed, though. Other dispensaries can be more patient with you rather than trying to get you in-and-out.\n\nThey do have decent herb and decent customer service for the most part; some of their employees just don\'t give a hoot at all and have no people skills and act like you\'re bothering them somehow (yeah, at their place of employment, serving the public).\n\nThey have reasonable pricing, but they sell all of their flower pre-weighed instead of weighing it out right in front of you to the point like other dispensaries. If you actually weigh the flower with your own scale, you\'ll find that it\'s more than likely a few points short. Other reviewers can confirm.\n\nThey also (I assume intentionally) leave a bunch of stems (like...a LOT) on the flower in order to make it weigh more. Kinda shady if you ask me.\n\nIf they actually weighed product out in front of you and didn\'t include stems for weight, I\'d say it\'d be a great dispensary.', 1515104267),
(1860, 413, 'Joe Ayala', 'https://www.google.com/maps/contrib/101464948161177234152/reviews', 'en', 'https://lh4.googleusercontent.com/-y6WknghoXdA/AAAAAAAAAAI/AAAAAAAAB4w/bwjXbptdwMY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '3 months ago', 'The product was okay, lots of stems though. Edibles were great. Customer service could use a bit of attitude adjustment, I asked a couple of times what they had for their edibles selection and the gentleman just kept telling me about their discount on them when I was more or less looking for recommendations or new products I haven\'t tried, meh. Their terrapin packs are pretty neat though. Otherwise, color me unimpressed.', 1518631381),
(1861, 414, 'Nikk Smyth', 'https://www.google.com/maps/contrib/112437316413797846064/reviews', 'en', 'https://lh6.googleusercontent.com/-G3DkgDc37Q8/AAAAAAAAAAI/AAAAAAAAAyg/Svylk4gC_CM/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'I love the deals here. I am a frequent customer who is on his way to obtain enough racked up points to get a free ounce. Very affordable and friendly atmosphere. I choose this dispensary over all others because of the knowledgeable staff who are eager to help any way they can. Did I mention their daily incredible deals and variety?', 1523976244),
(1862, 414, 'Buff Monkee', 'https://www.google.com/maps/contrib/109320487754979482838/reviews', 'en', 'https://lh5.googleusercontent.com/-DDSz_9HlGp0/AAAAAAAAAAI/AAAAAAAAAZU/iS3CGpcc_KU/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'Excellent experience here.  Parking is touchy, advised to park directly near the store for best results.  Secure store here.  Have your ID ready to provide proof of age.  They keep it until a clerk is ready to guide you through their product selection.  Waiting room until that happens.\nFocused selection of edibles, cannabinoids, buds, tinctures etc.  They do accept debit cards here, but cash is king as there is a fee for debit.  Join the rewards club using only a phone number, earn a free joint after 100 points.', 1523658001),
(1863, 414, 'Nicholas Norwood', 'https://www.google.com/maps/contrib/116987731870837421704/reviews', 'en', 'https://lh3.googleusercontent.com/-lwZw_VI7FmY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0nbIMCEtwp7-qBE-M9gtnVwVXLKQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'The Bud-Tenders have always been very nice and personable.  They manage their busy times well and are very conscious of any long wait times.  Way better prices than The Green Solution.', 1520465655),
(1864, 414, 'Jared Reeves', 'https://www.google.com/maps/contrib/118382312009629374140/reviews', 'en', 'https://lh6.googleusercontent.com/--xGBvATF34Q/AAAAAAAAAAI/AAAAAAAAAI4/WVW-OAbk3jU/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '5 months ago', 'I try to come here often. I have never had a problem with the services. They are very friendly and informative. There is a great selection to choose from at good prices. I\'ve never had to wait a long time before going back to be serviced. It is a good looking building with a good clean environment. Easy to see from the street while driving in normal traffic. I think this is a great spot for a quick stop. Come in and check them out, you will not be sorry.', 1512680957),
(1865, 414, 'Megan Miller', 'https://www.google.com/maps/contrib/109038384607273977689/reviews', 'en', 'https://lh5.googleusercontent.com/-liycpFKLow0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1lOSOOYx6-eQSJLzw5a_9Cf1gkEg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This place always has great deals and great customer service. Kevin made my experience tonight great with his outstanding customer service. I am a frequent customer here and the bud-tenders always go above and beyond for their customers.', 1524104363),
