(1879, 420, 'Seanna Embry', 'https://www.google.com/maps/contrib/117516301489531922105/reviews', 'en', 'https://lh5.googleusercontent.com/-zjBwtVQVR9I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0xKRWkN8zWhmHBUOYV4t2TRsunZg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'This is my favorite shop that I have found in my county!! The woman that work here are absolutely fantastic and always willing to help. This shop has so much to choose from, and the dosage is always on point. They truly care about there customers and want the best for each of the conditions patients come in with. I would highly recommend anybody to go to Tamarack Cannabis, where your needs are met and you leave with not only the best product, but a big smile as well :)', 1519246885),
(1880, 420, 'Kayla Hamilton', 'https://www.google.com/maps/contrib/107663176969924626394/reviews', 'en', 'https://lh3.googleusercontent.com/-yT7h8BS0qvA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ioj-Z7lNZccI5wTKDVtSogQR29A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'I love this shop. They have some awesome strains. I love the ladies that work there. You walk in there and even when there busy with someone they still greet you. They are some amazing ladies and I’m lucky to know them :)', 1519088497),
(1881, 420, 'Tim VanSwearingen', 'https://www.google.com/maps/contrib/107027166732724416358/reviews', 'en', 'https://lh3.googleusercontent.com/-n7CUTcHUWhQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0YopoUawUbsamtSof3qRAKnkEc0Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Tamarack has a very friendly, warm environment from the time you walk in.  Everyone there is very nice to talk to.  They are also very educated and helpful when it comes to helping people decide which options to choose.  Highly recommended!', 1520012410),
