(1901, 425, 'T C', 'https://www.google.com/maps/contrib/100034026856260288080/reviews', 'en', 'https://lh5.googleusercontent.com/-BY77CviZ9Mc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2YHJyjPXJSra4GUKe3tnEDmuAhLw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'This is the absolute best dispensary in Bozeman, voted that for 3 years in a row and I couldn\'t agree more.  I wouldn\'t trust any other with my health.  Their growth processes are excellent and clean.  The staff is all well educated on products and they genuinely care about their patients.  I traveled to several free states and what I found was a bit of a joke in comparison.  WA state doesn\'t allow to touch and smell like Spark 1 allows, neither does AK and AK is expensive.  Do yourself a favor, go to Spark 1 and feel better!', 1518218779),
(1902, 425, 'Kent Sugden', 'https://www.google.com/maps/contrib/117352126495811602773/reviews', 'en', 'https://lh5.googleusercontent.com/-J61zDYp2kXI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0sJO7Rsg-K6k3NTuPtR3Uogubh4g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'High quality products, great service, and a nice relaxed atmosphere make Spark 1 a dispensary I will be happy to stick with. They are a little more expensive than other places, but that is more than made up for with the quality of products they sell. I have never seen its equivalent in 4 years of smoking.  Would definitely recommend to a friend, and not just because they give you a free eighth with a referral!', 1518048083),
(1903, 425, 'Cynthia Ivester', 'https://www.google.com/maps/contrib/105630256773993885035/reviews', 'en', 'https://lh3.googleusercontent.com/-GuFHbInpzeY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3kB8wIp5Qjx4vimsn4qw4KKj45DA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'They are very knowledgeable about all the different strains.  They give suggestions on what might help best for you.  They are very polite young ladies and gentlemen!!   Recommend you to anyone! I love all the employees there!! They are all AWESOME!', 1520260160),
(1904, 425, 'Courtney Hester', 'https://www.google.com/maps/contrib/107747580937651126510/reviews', 'en', 'https://lh6.googleusercontent.com/-Dbolu7NA84s/AAAAAAAAAAI/AAAAAAAAEH0/5WoVpoh77j8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I am SO glad I switched providers and came to Spark. Spark 1 is hands down the best dispensary in the Bozeman are for your medicinal needs. The staff is amazingly helpful and knowledgeable and they have an exceptional variety of strains. They do anything and everything they can to get you exactly what you need. I wouldn’t recommend anywhere else!', 1518205264),
(1905, 425, 'Delaney Knightly', 'https://www.google.com/maps/contrib/103851143724248743210/reviews', 'en', 'https://lh4.googleusercontent.com/-fTzusxwMi3w/AAAAAAAAAAI/AAAAAAAAAHE/7BEWdCsfSM0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'This dispensary is just the greatest! Very professional and knowledgeable staff. Great hours, great product and just an overall wonderful atmosphere. I definitely recommend! Another plus is their new location in Belgrade!', 1518106483),
