(1910, 426, 'Madian Fritts', 'https://www.google.com/maps/contrib/116601715386366568012/reviews', 'en', 'https://lh4.googleusercontent.com/-RkCo3BpDq5Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq13wAgIyi6zNmGqIeJpG8VDNUmRhQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 years ago', 'I have always been treated well as a patient. Quality bud and employees have been very helpful. I would recommend anyone thinking about a caregiver to come join ATC.', 1427195184),
(1911, 427, 'tina butler', 'https://www.google.com/maps/contrib/107671266384212239700/reviews', 'en', 'https://lh3.googleusercontent.com/-j-kMOttg0eQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2f7-cXhkxWj6OKr-DtisYT9AUREQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Dr. Hegyes is awesome! And the office workers are top notch, they make the visit smooth and enjoyable too.', 1521010389),
(1912, 427, 'Marianne Pester', 'https://www.google.com/maps/contrib/103114596988639201414/reviews', 'en', 'https://lh3.googleusercontent.com/-VPWMDKHRBgs/AAAAAAAAAAI/AAAAAAAAABs/I-HKirkbzqk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Doctor is relaxed and compassionate. Down to earth guy. I enjoy renewing my card every year because Mark is a dank doctor. Very respectful, kind and organized staff. Waiting room is usually super busy, but hey, cannabis is a big part of the Bozeman culture. I would highly recommend researching your caretaker. There\'s some mind blowing weed in Gallatin Valley and it would be a shame to get into trouble. Many caretakers in the Gallatin Valley will pay for your card (doctor\'s visit and state fee). ALSO RESEARCH THE LAWS as to know what you can and cannot do with a card! Show up to the clinic between 11am and 3pm(close at 4pm), bring a Montana state id and medical records. You get there, fill out some paperwork (choose your provider and applicable alliments) and wait about 45 minutes to an hour to talk to the doctor. Don\'t go to the clinic if you are in a rush. Overall great service for Bozeman. Thanks Dr. Mark!', 1520937224),
(1913, 427, 'Layer Cake', 'https://www.google.com/maps/contrib/118356896966190098129/reviews', 'en', 'https://lh5.googleusercontent.com/-EE2qvZsMedk/AAAAAAAAAAI/AAAAAAAAABE/_tKCKoGsBdc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'For a very busy place with many clients the people in the office remained kind, efficient and timely.', 1518725822),
(1914, 427, 'atc cannabis', 'https://www.google.com/maps/contrib/105535925216070880204/reviews', 'en', 'https://lh4.googleusercontent.com/-9LN7vv3YGgE/AAAAAAAAAAI/AAAAAAAAACI/qUUkmBkzY_Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a year ago', 'Great service thanks Doc.', 1490393241),
(1915, 427, 'Mark Delorenzo', 'https://www.google.com/maps/contrib/118039693486573965926/reviews', 'en', 'https://lh4.googleusercontent.com/-belQQ7xW9sg/AAAAAAAAAAI/AAAAAAAAABQ/p6pp-XSfjFE/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', '', 1467654948),
(1916, 428, 'Erik Randle', 'https://www.google.com/maps/contrib/108545681290978305466/reviews', 'en', 'https://lh3.googleusercontent.com/-yt52ApLD6Hw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0pXvy5qpoj_hUgOJTaFyhAj4sAGA/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '3 months ago', 'First and foremost the Medicine they dispense is the Cleanest I\'ve ever had, as are the concentrates. Their staff is very knowledgable and friendly. They give a military Discount which helps the numbers a lot.   They have several different strains to choose from with all sorts of fun names! Having gone through Montana Advanced Caregivers before I can honestly say that this cities dispensaries could learn a great deal from the product that Lighthouse grows and the proper CHEMICAL FREE ways to grow it. Their product is what they say it is and better you will never find Shake finely ground and being sold as Keef to put another 20$ in the companies pocket. I hope they keep up the good work and keep being the example of what the Montana Industry should be. I hope to hear of a heat press coming their way some day soon as well! \n\nNow for the not so cheerful. \n\nThey seem rushed while trying to help patients get in and out, even when things are slow. While I understand the need to be able to help every customer in a timely manner and not have to stay all night. It seems a sense of, and I hate to use the word, professionalism or perhaps warmness can quickly be confused when put into a rushed environment. While I have no knowledge of the companies financing or ability to purchase knew equipment it seems that in 2018 there would be a faster perhaps more electronic way to handle the checkout process which may in turn relieve the pressure on staff and help make the days more relaxed and each patients visit more thorough. In the sense that, they would be able to concentrate more on helping patients and a bit less on keeping track of all the logs and paperwork. Not to mention use much less paper.', 1517624307),
(1917, 428, 'Daphne Daly', 'https://www.google.com/maps/contrib/110855901724901137276/reviews', 'en', 'https://lh4.googleusercontent.com/-yB9XaN71vdE/AAAAAAAAAAI/AAAAAAAAKYI/sI5NKiw5npo/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '8 months ago', 'I have never had such a wonderful experience at a collective. Terrific staff! Beautiful products! And I love that they care enough about their patients to do fun contests and what not! So terrific!', 1504555535),
(1918, 428, 'josh saiz', 'https://www.google.com/maps/contrib/107505107994930737420/reviews', 'en', 'https://lh3.googleusercontent.com/-0_cToadb5Xc/AAAAAAAAAAI/AAAAAAAAAT0/gfnoXhqmKnQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '9 months ago', 'One of, if not the best place to get your medical smoke in MT. The owner and staff are a delight to talk with and they try very hard to answer all of your questions in a timely manner. The owner is constantly upping his grow game so his product is really good and keeps getting better. I was using a provider out of Bozeman but we just didn\'t vibe well and the product wasn\'t up to par to be honest, so give this place a try and I think you\'ll find the experience rather enjoyable.', 1503004176),
(1919, 428, 'Carri Vogl', 'https://www.google.com/maps/contrib/100152962111376479129/reviews', 'en', 'https://lh6.googleusercontent.com/-DrIXDClQ7cQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2-wV_TsodbSHgT7LatqBvx8BOlsw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '8 months ago', 'The best medicine around! I was taking 8 different pills a day prescribed by doctors. With the very friendly and knowledgeable staff I now take 2. The CBD  pills offer a lot of comfort for body aches and anxiety!', 1506805320),
(1920, 428, 'Brandon Siemers', 'https://www.google.com/maps/contrib/116042760398614206772/reviews', 'en', 'https://lh6.googleusercontent.com/-14ZK9Z_ZGec/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq28XOrITjzJ-4r7_OXNW3Npn4XnFA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'Great selection along with excellent customer service. A terrific, friendly atmosphere. Definitely one of the best.', 1504816446),
(1921, 429, 'Lamar Lathem', 'https://www.google.com/maps/contrib/118014725439559664164/reviews', 'en', 'https://lh5.googleusercontent.com/-Bos1YJ-uMG0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2lE_jOUSH-pSb3YBl8-7-IidWyfw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I\'m a new patient and the crew at the Commerce Ct. location have been very helpful insuring I get the meds I need for pain and insomnia. Thank you Alex, Aaron, John, and Thomas!', 1526660145),
(1922, 429, 'Barbara Hrella', 'https://www.google.com/maps/contrib/107471357960997508641/reviews', 'en', 'https://lh6.googleusercontent.com/-UsnbgCw9nyc/AAAAAAAAAAI/AAAAAAAAReg/k9q31sAnLNg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'Great service and prices', 1521838763),
