(1933, 431, 'Dustin Teasdale', 'https://www.google.com/maps/contrib/118407818752730549828/reviews', 'en', 'https://lh4.googleusercontent.com/-GgtBzgP2qz0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Re0BF8evdMQnd42-IWHRMRwX7Fw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Braxton the owner is very personable and friendly. Work is excellent. Highly recommended.', 1503353703),
(1934, 431, 'Llogan Fishbaugh', 'https://www.google.com/maps/contrib/105958236635620489682/reviews', 'en', 'https://lh5.googleusercontent.com/-TsAs8rkgscE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3UK0midrovlpqOiG6iRqAHHnwsSw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Best Clinic in Montana \"Highly\" Recommended!', 1518281040),
(1935, 432, 'Laura Parker', 'https://www.google.com/maps/contrib/106163725809986007457/reviews', 'en', 'https://lh3.googleusercontent.com/-vM1pE0-QEeA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq160P3tfloPlMyVZJB6QmPLtSBjtw/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'Not being open Sunday\'s kills me and slot of others I have to drive 2 hours just to grab an eighth sometimes and no delivery ever is a bummer too besides that they have great bud just missing shatter!!', 1521673442),
(1936, 432, 'Ian Hazel', 'https://www.google.com/maps/contrib/108122463014109300986/reviews', 'en', 'https://lh4.googleusercontent.com/--q8WP5VQlvo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq256tsH_7oawKpCCFldcv2nfSog_w/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '6 months ago', 'Great service, good selection!', 1511276312),
(1937, 432, 'John Carroll', 'https://www.google.com/maps/contrib/113039328497215496883/reviews', 'en', 'https://lh5.googleusercontent.com/-tYFGleqaJHI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1jQTOJij-FzQatqrm3KuCZFiLcxw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', '', 1484430808),
(1938, 433, 'Dessiree jagiello', 'https://www.google.com/maps/contrib/108125724050785226180/reviews', 'en', 'https://lh6.googleusercontent.com/-5QY9ckxtPBU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1NA2pJMJTNK0LSM2DWl24hwYmyUg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I\'ve been using them as my provider for a few months, Josh, Sarah are always so friendly and helpful', 1527287124),
(1939, 433, 'Scavenger Invader', 'https://www.google.com/maps/contrib/113363959375243691910/reviews', 'en', 'https://lh4.googleusercontent.com/-maetIPiF4ZA/AAAAAAAAAAI/AAAAAAAACH0/aSdu-lrWh_Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Best store in town for medical cannabis.  They have been at the forefront of the legal battles the Montana cannabis industry has been dealing with.  Not only to they keep up to date with the latest tech in the cannabis industry, they also fight for their patients.', 1522694547),
(1940, 433, 'Jamie Strohecker', 'https://www.google.com/maps/contrib/106131687350149232338/reviews', 'en', 'https://lh3.googleusercontent.com/-wcwyspox9UU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1usCh0XuSjfbG1acvChe9ckyhvWg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 months ago', 'Friendly and knowledgeable. Always so helpful & they have a nice selection of products.', 1518730588),
(1941, 433, 'Terri Quintana', 'https://www.google.com/maps/contrib/100747446821333839662/reviews', 'en', 'https://lh4.googleusercontent.com/-Qc8Pfc1SpOY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0VD5SgOPlWd25MhKbL3Q3Zd5fasQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Best medical marijuana dispensary. Lots of product to chose from.', 1521481839),
(1942, 433, 'rae-lynn aguilar', 'https://www.google.com/maps/contrib/110001487511313976306/reviews', 'en', 'https://lh6.googleusercontent.com/-k1eSc_-1sxU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq32OOdae0YfOTKTWLOdHlwgGgBa3A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I wasn\'t sure how I was going to do in Montana with all the pain I have to go threw every winter I\'m thankful to have mac and all the staff who direct me with what best suits me.', 1514846795),
(1943, 435, 'Brooke Felch', 'https://www.google.com/maps/contrib/103932137391518504596/reviews', 'en', 'https://lh3.googleusercontent.com/-sYxbwOR2hWI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0FUu_uwR_tGAURIMPLwugmFfIQEA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I love everything about lionheart and their staff! If you are in need of great medicine, and love wonderful people this is the place for you! Everyone here actually cares about you, and is always more than willing to help.', 1523558181),
(1944, 435, 'Laura Bales', 'https://www.google.com/maps/contrib/105303180843095182201/reviews', 'en', 'https://lh5.googleusercontent.com/-mIX9H9-zjhs/AAAAAAAAAAI/AAAAAAAAAfc/r1Efxb4LnUE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Nice wide selection of quality product. Relaxed, friendly environment. Very helpful and knowledgeable staff. 100% recommend. :)', 1523551763),
(1945, 435, 'Scott Thompson', 'https://www.google.com/maps/contrib/107313818913858555051/reviews', 'en', 'https://lh5.googleusercontent.com/-S_AKsYO68cA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq04MpbMjBrA86jQ8V9Db9JGzsayKw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Lionheart is absolutely phenomenal! Great staff, relaxing environment, and amazing products and customer service. 20/10 all day every day. Will always be a fan of lionheart cargiving', 1522259492),
(1946, 435, 'Raya Michelle', 'https://www.google.com/maps/contrib/103402810258851096430/reviews', 'en', 'https://lh6.googleusercontent.com/-g3PI9E2Z2Ts/AAAAAAAAAAI/AAAAAAAAAE0/_rXa5URKdok/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Best of bozeman. Smart and friendly  staff, With great product. You will never be disappointed', 1515532910),
(1947, 435, 'green beans', 'https://www.google.com/maps/contrib/115478311748997313776/reviews', 'en', 'https://lh5.googleusercontent.com/-SDvHV5Fc6O0/AAAAAAAAAAI/AAAAAAAAABU/aKeY7MN94Mc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'absolutely amazing! I\'m glad I started off with the best.', 1513651745),
(1948, 436, 'Marilyn Johnson', 'https://www.google.com/maps/contrib/108137718711083927767/reviews', 'en', 'https://lh4.googleusercontent.com/-Vitkx4YPbYQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1B8HcbSDIZEyp7J-GVFvggmzRWdg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'This is still the absolute best place to bring your medical needs! The staff are some of the most wonderful people and we have all really built up a relationship over the last year or so. They know me, they know my husband, if either of us comes in without the other, whoever is tending the counter asks us about the other and about our daughter. They pay attention to what we like and what we say doesn\'t work. This place is like a family and, moreover, they are obviously committed to excellence in their products and to keeping their patients healthy. You couldn\'t pay me to switch dispensaries. Just sayin....', 1527028266),
(1949, 436, 'M Miner', 'https://www.google.com/maps/contrib/106186542375580375919/reviews', 'en', 'https://lh5.googleusercontent.com/-ragGEYjFG-8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq25gdr1xNQH35APXL890AHgccmKDw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The amount of care the staff has for each individual is what makes the atmosphere here the best. Their products are top of the line! The amount of time the staff takes to get to know each person and what works best for them is something you do not typically see in the medical field anymore. Coming here is where your relief will begin!', 1526747963),
(1950, 436, 'michael weitzel', 'https://www.google.com/maps/contrib/108791630727413379164/reviews', 'en', 'https://lh6.googleusercontent.com/-93BgaRGm4eQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1b5NLSssAUQGBmoEv7uQ41bf70SA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Great staff and an awesome environment. I really enjoy the strains available and that there are alternatives to smoking presented.\nI always have a good expirience there', 1525448241),
(1951, 436, 'Jayden McKennize', 'https://www.google.com/maps/contrib/101436590049981752042/reviews', 'en', 'https://lh5.googleusercontent.com/-3E5cLO7Tt8s/AAAAAAAAAAI/AAAAAAAABCg/FyEBG8wAdJg/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a week ago', 'Lionheart has been the best dispensary I have gone through in the past four years. The people are very friendly and helpful and I have a lot of strains to choose from and I always leave happy plus I would recommend Lionheart to anyone I know', 1526557382),
(1952, 436, 'Julia Piller', 'https://www.google.com/maps/contrib/102587626543033945821/reviews', 'en', 'https://lh6.googleusercontent.com/-PjZ__sPmKaI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3W69YiaONShWpERPG41vNvgMvyow/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Lionheart is the best dispensary in town! The keep me stocked up with quality product from the friendliest staff!', 1527032980),
(1953, 437, 'isaac guilford', 'https://www.google.com/maps/contrib/118022760199478188780/reviews', 'en', 'https://lh5.googleusercontent.com/-YkmVfcu-0Lo/AAAAAAAAAAI/AAAAAAAAAEs/_oKU023Sxfw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'Excellent service, excellent products. Very helpful', 1526932689),
(1954, 437, 'justin pierce', 'https://www.google.com/maps/contrib/112150700898622182788/reviews', 'en', 'https://lh6.googleusercontent.com/-nilA41-xokM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3-mS6O8Aoxdi0kA3MO-t7NvN3Q0g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Great place, clean too. Comfortable shop. Laurel is very friendly and knowledgeable. Love this place!', 1511734679),
(1955, 437, 'Elizabeth Anderson', 'https://www.google.com/maps/contrib/111412486228442490957/reviews', 'en', 'https://lh6.googleusercontent.com/-sBCQRVKhATY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2poAYB05RHqruBVhjcyYuZXNA_UA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I love my shop it\'s the best I would recommend this med shop to all and every one. ', 1512159029);
