(1956, 437, 'Ryan Roycroft', 'https://www.google.com/maps/contrib/104874512961416514083/reviews', 'en', 'https://lh3.googleusercontent.com/-u-CbIwYFc4c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2FWGVNH-8UClLgby_Q8WQrT2JGIA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Remedy is my first dispensary in Missoula. The staff is so friendly, and extremely knowledgable in all their products. I highly recommend Remedy to new and existing patient in the Missoula areas.\n\nThank you Remedy!', 1503518543),
(1957, 437, 'Luv Joy', 'https://www.google.com/maps/contrib/111440190202117185961/reviews', 'en', 'https://lh6.googleusercontent.com/-f3HZHCi7hrg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2SQyuGR2vDae1Ch-KiLzRa8LiWyQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'Very helpful and friendly staff! Very knowledgeable about various strains, and products! ', 1504818337),
