(1970, 442, 'Sadie Taylor', 'https://www.google.com/maps/contrib/111629633056349349041/reviews', 'en', 'https://lh4.googleusercontent.com/-hsnv3qpxKGQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0a-RFM7y3nKiX9e3Hq7Jw90jAVEg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The women who run this place are passionate and knowledgeable about what they do. The products are some of the best I’ve EVER come across, and I know the quality is never compromised - organic, ethically sourced, mindfully and skillfully crafted. The energy surrounding Garden Mother Herbs is positive and healing!  I stop in every time I’m in Missoula - in fact, sometimes I make a special trip from Helena just to go there. Can’t recommend GMH highly enough!!', 1523022218),
(1971, 442, 'Justin Michels', 'https://www.google.com/maps/contrib/117573249136769922960/reviews', 'en', 'https://lh4.googleusercontent.com/-hU1kfDINYPY/AAAAAAAAAAI/AAAAAAAAALk/u9mfTFD_DuY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Top quality organic herbs, very knowledgeable staff and affordable prices on a wide array of great medicine.  Best I\'ve found, anywhere for any price.', 1520282591),
