(1976, 443, 'Rick Mueller', 'https://www.google.com/maps/contrib/113521715541254657550/reviews', 'en', 'https://lh3.googleusercontent.com/-DIrFiiHH-aU/AAAAAAAAAAI/AAAAAAAAACE/2xZIBWQGhdM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '6 months ago', 'Not only is the product Amazing! But the owner Sean is a nice local guy who takes tremendous pride into producing some of the best organic bud I\'ve ever smoked, dabbed and vaped .By far the best place to get Organic Medical Marijuana. This place beats all others in quality period. I\'m an X- grower and also was taught how to grow in Cali. Sean your Killing it Brother!', 1510772460),
