(1981, 444, 'Klint Cook', 'https://www.google.com/maps/contrib/107644353605186863183/reviews', 'en', 'https://lh6.googleusercontent.com/-byBBh_CJ_YM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1h3xgD2ijpb0k2oprHIJFf4XSAZA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Really great customer service there always friendly and they know what there talking about. awesome selection of  products from flower to edibles and also vap and dabs. Never disappointed when I go and I really like there shake a day game they got going on. Go check it out yourself you won\'t regret it.', 1517250819),
