(1992, 447, 'Jessi G', 'https://www.google.com/maps/contrib/100736328681673684374/reviews', 'en', 'https://lh3.googleusercontent.com/-NOqDxSDqU8M/AAAAAAAAAAI/AAAAAAAAAAo/8D_zODMQwdI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'I love everything about this place!  The smell just walking into the dispensary is amazing.  The customer service is wonderful, and the taste and quality of their mmj is the best!  I highly recommend them!!', 1501689278),
(1993, 447, 'Anthony S', 'https://www.google.com/maps/contrib/100275921660465863881/reviews', 'en', 'https://lh4.googleusercontent.com/-rlBtXMTozqk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3rHmFv0wxtt9e9v67H4AqFKw7dBA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Best Caregiver By Far\nEveryone claims to have the best product and a lot of people have some really good stuff but what this guys does has to be the best I\'ve seen. Each strain has a very distinct smell to it, unlike most people where each strain is just slightly different than the others each one of his have a very unique smell that is completely different from all the other strains. He has some strains that are unlike anything I\'ve ever seen before. Everything is organically grown, he flushes out every plant til its as clean as pure as it can be, trims everything by hand and comes out with the most vibrant, healthy and unique buds of the highest quality I can find here in Bozeman.', 1489002615),
(1994, 447, 'Dylan Orton', 'https://www.google.com/maps/contrib/100108180503599685992/reviews', 'en', 'https://lh6.googleusercontent.com/-ff9cEA8X1-Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq13qWw0a1q5AHQalEMpq1tZuihhFg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Great quality. Great prices.', 1501786626),
(1995, 447, 'Tony Jones', 'https://www.google.com/maps/contrib/115148850305619618867/reviews', 'en', 'https://lh5.googleusercontent.com/-nvYOQMAVyME/AAAAAAAAAAI/AAAAAAAAAxI/ozAtlx6Az9U/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Always good', 1518474517),
(1996, 448, 'Josh Reiner', 'https://www.google.com/maps/contrib/101583954069836781337/reviews', 'en', 'https://lh3.googleusercontent.com/-sPo7pQBX7Sc/AAAAAAAAAAI/AAAAAAAABnU/2VXNUHeYmdk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Had my first appointment today and I saw Kinsey Fisher. She was absolutely phenomenal. Made me very comfortable, was funny and very down-to-earth. She was professional, and explained things in a way that was easy to understand. The front desk staff was very welcoming. The office is in a great location and is very clean. I highly recommend people to check them out. I\'m glad I did!', 1525924817),
(1997, 448, 'Aatt True', 'https://www.google.com/maps/contrib/101982375177317930686/reviews', 'en', 'https://lh5.googleusercontent.com/-hNe7njdW_wI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Qw8UMMqqL1xE6z-HSNzGArsbwCg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'My first visit was amazing I felt very welcome and confident in the doctors care for my well being', 1526045580),
(1998, 448, 'Maddie Connell', 'https://www.google.com/maps/contrib/107973789396642036460/reviews', 'en', 'https://lh5.googleusercontent.com/-xYfOzQzfyQE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0FegbpyW4SXBcUvOvemI38R6UDJg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', '', 1521089976),
(1999, 449, 'Bobbi Hughes', 'https://www.google.com/maps/contrib/105936843838061919893/reviews', 'en', 'https://lh6.googleusercontent.com/-qMcoNcFdIpg/AAAAAAAAAAI/AAAAAAAAAoo/gg5nzNk2v9E/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, 'in the last week', 'This place is very nice and welcoming. The staff is friendly, patient and helpful. Yes the prices are higher, but that\'s what you get on the outskirts. They try to give deals and have sales to help people. When in need I\'ll shop here again.', 1527175923),
(2000, 449, 'Clinton Steinmetz', 'https://www.google.com/maps/contrib/115255231802612976881/reviews', 'en', 'https://lh4.googleusercontent.com/-4EVJc7Hj3A4/AAAAAAAAAAI/AAAAAAAAAHY/Fo_BlU63-Gg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, 'in the last week', 'Didn\'t smell right; either the smell of haylike and or not cured right. And the most expensive 8ths for not the value, having shake in container and tiny scraggles. Prepackaged ready for sale, cause they have so much going on and it\'s not like that makes the weed stale faster.', 1527390451),
(2001, 449, 'Evan Kreutzer', 'https://www.google.com/maps/contrib/118065001734863441311/reviews', 'en', 'https://lh5.googleusercontent.com/-nlwTG5xabME/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2hNUItsAqk-y7rPbUaCoFJgGrJKg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Possibly one of the worst dispensaries in the country.  Prices are 500%-1000% higher than the majority of the state and that is no exageration.  $60 8ths is almost criminal!  Since when is the black market cheaper than retail?  I waited in the empty lobby for almost 15 minutes before I was helped, saw their prices and walked out.  Their quality should reflect the prices and visaversa, but they  absolutely do not.  So, being dismayed at that, I walked next door to their garden supply center, only to find it locked shut during business hours.  I\'m well versed in the market and Sedgwick Alternative Relief is a joke to the industry.  Take the extra time to check out some much more affordable options just down the road in Fort Morgan,  Fort Collins or Greeley.   P.s.  I shopped here once 4 years ago, prices were still outrageous, but I spent 55 dollars on a syringe of what I was told was whole plant extract, aka Rick Simpson oil.  Nope.  It turned out to be a mix of whole extract and coconut oil for cooking.  Twice ventured and twice incredibly disappointed.', 1527087945),
(2002, 449, 'Nikita Donovan', 'https://www.google.com/maps/contrib/104214412702748627877/reviews', 'en', 'https://lh5.googleusercontent.com/-4m1Fdj_xXl4/AAAAAAAAAAI/AAAAAAAAAB0/fSd709uiF34/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I have worked here for the last 2 and a half years. I love being able to talk customers through their first purchase and make sure they leave with want they want. Yes a little more expensive, but worth it for saving me the  3 to 6 hour drive round trip! I love S.A.R.', 1515617465),
(2003, 449, 'Periodcoins O', 'https://www.google.com/maps/contrib/109996989115527227084/reviews', 'en', 'https://lh5.googleusercontent.com/-10IEx1-OL30/AAAAAAAAAAI/AAAAAAAAJeM/kFCo7CMqoRI/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, '5 months ago', 'Over priced and the products are not that great. Wait an hour and hit up either shop in fort Morgan. There was a blue haired guy working when I decided to try out this shop. I had been waiting a while and it was finally my turn but then all the sudden a guy walked in. The blue haired dude said \" sorry I have to take care did this co medical patient\" and took his buddy back. I walked right out. The blue haired guy just assumed I\'m not from co and not a medical patient. He never even asked. I\'ve never been to a shop where that matted when it came to waiting. DONT WASTE YOUR TIME STOPPING HERE!', 1514315991),
(2004, 450, 'Austin k', 'https://www.google.com/maps/contrib/102327834252283941827/reviews', 'en', 'https://lh5.googleusercontent.com/-dyXquk8wpaQ/AAAAAAAAAAI/AAAAAAAAAG8/Qd6gg9ZCq58/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, 'a month ago', 'Went on 4/20 and got their special bag (horrible compared to last year, don\'t bother showing up early next year). It contained a tiny shirt with the natures herbs logo on it... I can\'t wear a basically child sized shirt and I\'m damn sure not giving it to my kid for obvious reasons. \n\nI called to see if they would exchange the shirt for an adult size and they said they would just come on down. I arrived and was told that although they did tell me that over the phone it wasn\'t true and they wouldn\'t exchange it. The reason I called was to verify they would, and they said they would, to not waste an hour of my time. So I was a little shocked they wouldn\'t do it even knowing that the employee told me they would do it over the phone.\n\nThey sell shirts there for $1 if you spend over $20. A single dollar. I\'ve spent thousands here and even  several hundred just yesterday and they were not willing to exchange a still brand new shirt that they value at $1. If me shopping there isn\'t worth $1 to them then I won\'t be back. Green Stop has way better concentrates anyway.\n\nThe most ridiculous part is the reason I wanted the shirt in the first place was so I could wear it which is free advertising for then. This wouldn\'t even be an issue at all if they had just told me they wouldn\'t exchange over the phone. I wouldn\'t be happy about it but whatever. They should honor what they tell you.', 1524339748),
(2005, 450, 'pro devilsgaming', 'https://www.google.com/maps/contrib/110477374178007207379/reviews', 'en', 'https://lh5.googleusercontent.com/-kBMVr_5WgK0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2je5f_09gRLvAbkKeGIwJ567r7tA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'First time going into this buisness.  Everybody was friendly  and courteous. Was a bot overwhelmed with the new experience. The young man that helped was very good. If ever in the area again. I will most definitely give them my buisness...', 1527137605),
(2006, 450, 'Christina Fernandez', 'https://www.google.com/maps/contrib/101407913006025867934/reviews', 'en', 'https://lh5.googleusercontent.com/-mcHPwr7683g/AAAAAAAAAAI/AAAAAAAAAJY/pUMOwB9shs0/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'This was a very nice first experience for me and my boyfriend. Felt very comfortable and safe. Very pleasant staff very knowledgeable and helpful for first timers. We will be back.', 1522607747),
(2007, 450, 'Jamie Cordova', 'https://www.google.com/maps/contrib/106010828613678145774/reviews', 'en', 'https://lh4.googleusercontent.com/-A-33cEjNPZo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3FSokU-XFiXP6kz8MDJL2f6J2b0Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I Love these guys. I never leave disappointed. The girl at the front desk is awesome. Her name is Jennifer.', 1523146157),
(2008, 450, 'Alicia Carbajal', 'https://www.google.com/maps/contrib/112253637983529939498/reviews', 'en', 'https://lh5.googleusercontent.com/-2z4iL6bYkCk/AAAAAAAAAAI/AAAAAAAACPo/7dZFNq5iEFI/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a week ago', 'Great products.  Tried the cherry gummies.  ', 1527099174),
(2009, 451, 'Corey Minor', 'https://www.google.com/maps/contrib/114934612499621684123/reviews', 'en', 'https://lh5.googleusercontent.com/-Nm_hggI3ThA/AAAAAAAAAAI/AAAAAAAAAfk/IGSbknWirdM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'I\'ll drive across town to this dispensary. They have an A+ atmosphere and attitude. I left my ID there for two days and they had it waiting for me. Staff is amazing too! Please check in as I have NEVER been disappointed with there product or service.', 1527710137),
(2010, 451, 'Jerald Joubran', 'https://www.google.com/maps/contrib/112433162513075044790/reviews', 'en', 'https://lh5.googleusercontent.com/-cJH_HyEAQFk/AAAAAAAAAAI/AAAAAAAAsP0/gZjMS3ZbWUo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'I love this dispensary and have been going here ever since I’ve moved here over three years ago! They are nice, they have great prices, and most of all... they TREAT MEDICAL PATIENTS LIKE ARE TRULY MEDICAL (unlike other dispensaries)! I will always be back! ', 1525230435),
(2011, 451, 'Noah Farrell', 'https://www.google.com/maps/contrib/112060744179869555363/reviews', 'en', 'https://lh3.googleusercontent.com/-39lt421HZyY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1hpWDKPHNbXQVOvHBqg3pTNS0u_w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'definitely the best dispensary in Nevada. they have the best deals on wax in Las Vegas, and its quality too. staff is super professional, there is sometimes a line but its makes sense when your the best dispensary in NV :) i live a block from essence and that doesn\'t stop me from driving 17 miles to support this dispensary:)', 1527687041),
(2012, 451, 'Jake DiMartino', 'https://www.google.com/maps/contrib/109959773002500478535/reviews', 'en', 'https://lh6.googleusercontent.com/-jypR3CH2rTY/AAAAAAAAAAI/AAAAAAAAAB8/sXZOtq4-2eg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'By this point, staff recognizes me and I am a terrible human being for never making the time to fill out a review for whomever helped me out each visit.  \n\nJokes aside\n\nWith out a doubt my favourite dispensary in town. Mostly due to the amazing staff that works there, secondly due to great products at great prices. \n\nDeborah, Le, and Stone always get me set up and ready to go in a flash. I\'ve never asked a question about bud they haven\'t been able to answer... I look forward to interacting with all of them each visit. As they make the process of buying marijuana very enjoyable.', 1522351191),
(2013, 451, 'Leann Lujan', 'https://www.google.com/maps/contrib/106837594206759794923/reviews', 'en', 'https://lh5.googleusercontent.com/-M2KKjgHLWBE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Dd_DcMxSFQb0LfDTtedM9Rcf5Hw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'The representative was very knowledgeable about every product that I inquired about. She seemed genuine and passionate about the products and how they can help people who suffer with pain on a regular basis! The store was very clean and very discreet. I will definitely be back.', 1526010138),
(2014, 452, 'B Moore', 'https://www.google.com/maps/contrib/102460312141186769894/reviews', 'en', 'https://lh6.googleusercontent.com/-g8tY7Hiv5f4/AAAAAAAAAAI/AAAAAAAAADk/q6CI62SE5iM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Best dispenserary in Vegas! Great customer service, they always look out for me whenever I visit, I don\'t go to any other dispenserary! Love NWC!', 1526243546),
(2015, 452, 'jason Jefferson', 'https://www.google.com/maps/contrib/115953437013372527560/reviews', 'en', 'https://lh5.googleusercontent.com/-cYhK_eZgTqY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0k4A7DAPtJ9Jyz9dyV2gn2tJ_DGA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'My lady and I had a great experience here. Ms. Tandra answered all of our questions and was very friendly and professional', 1526006822),
(2016, 452, 'Scott Mc Cabe', 'https://www.google.com/maps/contrib/116208375826283200880/reviews', 'en', 'https://lh6.googleusercontent.com/-op6RLpZ9e28/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1hbfWkBbWNp8dMZ2anGldZXWL5og/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Very good service, great selection and I even got a senior discount.\nLovin it', 1516574470),
(2017, 452, 'Kevin cost', 'https://www.google.com/maps/contrib/105741259572131347657/reviews', 'en', 'https://lh4.googleusercontent.com/-wsVlRu_gPO4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1DnNpMlubUu5sAzaqw0EJJNX4SWw/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '5 months ago', 'Bought a disposable vape for $56.00, first one didn\'t work, they exchanged it for another of the same brand, it lasted 2 days and I\'m not a heavy smoker.  I told them they need to pull them off the shelf but I guess they rather put up with the complaints.  Great staff, but DON\'T buy the disposable vape here.  If you do, I\'ll read your complaint on here.  I DO love the staff there tho.', 1514742107),
(2018, 452, 'Benjamin Mage', 'https://www.google.com/maps/contrib/114694567770892749711/reviews', 'en', 'https://lh6.googleusercontent.com/-Z43FCLrXkY8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2iPgxzhXly6HT8kmQynquC7EgzAQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '4 months ago', 'used to be steady customer.. going two or three times a week.. but they keep raising prices on the same product.. its simply not worth it anymore. they tried to raise prices for more profit but lost a steady customer.. and im sure im not the only one. customer service is goos though.', 1515198377),
(2019, 453, 'Jeffrey Livingston', 'https://www.google.com/maps/contrib/110883796416002578406/reviews', 'en', 'https://lh6.googleusercontent.com/-HsVGhdq0bOo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3321VcbnvH4fKbo2TJfWHCMhcv8w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'This place has become my new favorite dispensary. Great staff with great products. Always quick too ', 1527375329),
(2020, 453, 'liz maynard', 'https://www.google.com/maps/contrib/104226443032720027440/reviews', 'en', 'https://lh5.googleusercontent.com/-cMChqQ89b2g/AAAAAAAAAAI/AAAAAAAAK2I/5Gkoct1H_9Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'We shopped there 2x during our week stay.in Vegas. Follow their rules.. They run a tight ship. They have quality stuff and knowledgeable staff. Reasonable prices.. I woould recommend. Educate urself on Nevada marijuana law. Be careful when sightseeing u can not bring it with you into surrounding states.', 1524733589),
(2021, 453, 'Darcie Cilley', 'https://www.google.com/maps/contrib/110279190325691835646/reviews', 'en', 'https://lh5.googleusercontent.com/--MmDh8DFyto/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0CwG72g6EULCL6Lhy-u1WJvzhaiw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'My second time there but first time purchaser my guy was very helpful and got me just what I wanted. My flowers are not dry repackaged or any of this other stuff I\'ve been reading. Go c 4 yourself.  Happy 4:20 everyone ️️', 1524197198),
(2022, 453, 'cindy clark', 'https://www.google.com/maps/contrib/110856817367733931857/reviews', 'en', 'https://lh3.googleusercontent.com/-tlN55iL9HGU/AAAAAAAAAAI/AAAAAAAAAGA/sQI6bSDvuYc/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'They sold me some weed that was over 8 months old  I got it home opened the jar it was so dry it just crumbled. It was so harsh I couldn\'t smoke it. Didn\'t get buzzed?  I took it back next day and the manager Cody who is too young to be a manager would not do anything about it. He said it was because it was opened. lol  It had to be opened to find out it was dried up. We would go there couple times a week. I will never go back there!  Also they are expensive !Don\'t shop at Shango they are not right!', 1522830568),
(2023, 453, 'Matt Hunsaker', 'https://www.google.com/maps/contrib/107466062341489363041/reviews', 'en', 'https://lh3.googleusercontent.com/-llj75JGtiyk/AAAAAAAAAAI/AAAAAAAABWU/0Q1MyNxGzRw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 months ago', 'As a medical patient, when the Shango stock is fresh, it is some of the best in the Southwest. When it comes to ANY dispensary..ya gotta check the dates and nutrient profiles to ensure what you need. Shout out to the whole team for being great care-givers in high-esteem, especially Mr. Wes. The products, packaging and pricing is supreme to most of Vegas on tha consistent. Maybe that is why most dispensaries around here carry your products, at a marked-up price point. Stay fly', 1519107146),
(2024, 454, 'Victor Chavez', 'https://www.google.com/maps/contrib/109136116907217674380/reviews', 'en', 'https://lh6.googleusercontent.com/-WaD1nnrEZEQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1_UWk2LaAjpnA6I20rUl_7_gHjcA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The best service you could ask for. Highest quality product and amazing staff. Bob and Megan are awesome and super helpful. Great rewards system too, it keeps me coming back!', 1526680333),
(2025, 454, 'Jeffrey Parker', 'https://www.google.com/maps/contrib/114854839609242921360/reviews', 'en', 'https://lh5.googleusercontent.com/-SCQOypfpkUY/AAAAAAAAAAI/AAAAAAAAAIo/tr62Fz8qic8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'The Apothecarium is a fine dispensary for both the recreational and medicinal user. Their selection is extensive in flower, concentrates and edibles. The main attraction comes in at pricing and staff. Their prices have a wide range from $9 and up. The low priced items are still good quality and definitely great if you\'re spending on a budget. The staff are friendly, knowledgeable and courteous with emphasis on knowledgeable. The Apothecarium has some of the most extensive knowledge about their products around. If their system doesn\'t have it in the testing book they\'ll print you a terpene profile. \nA couple honorable mentions of the shop is accepting debit card transactions and the staff having great knowledge off the top of their heads. \nIf you\'re considering making this your regular spot the staff will remember you and help make you feel like you\'re a valued customer no matter the amount you\'re spending.', 1519175283),
(2026, 454, 'dave kelly', 'https://www.google.com/maps/contrib/103325615650231138122/reviews', 'en', 'https://lh5.googleusercontent.com/-6l5Z8Oj2ltE/AAAAAAAAAAI/AAAAAAAAFbs/nZtuTvcLOtE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '4 months ago', 'I had a great experience here. As a first-time visitor, I had to fill out a form and register my ID, which was a simple process. I have not been to many dispensaries, but they were very nice and businesslike at this place, an associate came out and met me and escorted me to the counter. She helped me make a selection, and was very helpful and well-informed. I was pleasantly surprised to find that new customers get a free$9 joint. How can you not love that? Also, if I bring my resealable bag back I get 5% off subsequent purchases. It pays to recycle at The Apothecarium.', 1515033424),
(2027, 454, 'Aneirin Pendragon', 'https://www.google.com/maps/contrib/101522377255209265308/reviews', 'en', 'https://lh5.googleusercontent.com/-TTcZqDybOI8/AAAAAAAAAAI/AAAAAAAADKU/L5Siq_aE-kM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I went here for the first time today with my fiance and the service was wonderful! The wait wasn\'t long, and James was excellent, and double checked to make sure all of our questions were answered even if he didn\'t know off the top of his head. The points system they have in place is also great. We will definitely be returning!', 1520218990),
(2028, 454, 'marina brent', 'https://www.google.com/maps/contrib/118071591046240834678/reviews', 'en', 'https://lh5.googleusercontent.com/-PyAJn0C4cJE/AAAAAAAAAAI/AAAAAAAAAFE/GLv2dlo7bXU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I love coming here to see Vinny! He always helps me make the perfect choice! And always makes me feel at ease ', 1527364518),
(2029, 455, 'Chris Burns', 'https://www.google.com/maps/contrib/102722469246883499320/reviews', 'en', 'https://lh5.googleusercontent.com/-ljFW6CPSsXM/AAAAAAAAAAI/AAAAAAAAAFo/73KnLwkxnbY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'What a surreal experience.  Being from PA... Visiting Las Vegas.  It seemed unimaginable growing up.  Pretty much a wild experience.  Open 24 hours.  A cheap taxi ride from most of Vegas.', 1526901511),
(2030, 455, 'Chris Hancock', 'https://www.google.com/maps/contrib/109910532949611598375/reviews', 'en', 'https://lh4.googleusercontent.com/-KR_qhpttqJs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2zzmYl6VoTG7WwsXH55PhsCWoFdw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 weeks ago', 'Worst dispensary experience in my 5 years of visiting dispensaries across the country. I went in because all the reviews say great prices and good quality buds but those reviews must have been written by little kids and employees. I bought what was supposed to be an eighth of Train Wreck. Got home, weighed it out because it looked short and sure enough it barely weighed 2 grams. It\'s supposed to be 3.5 grams. The label on the shelf said 23% THC and the label on the jar is 18%. Flat out false advertising. I paid $55 after tax which is a horrible price even if you\'re a holigschooler  buying his first sack.  Not to mention the harvest date  was almost 6 months prior to the purchase date which resulted is horribly dry, powdery weed. Other dispensaries do include tax, contrary to the owners response to previous reviews. Don\'t be sucked into this tourist trap, you will get much better buds from any of the other dispensaries that are nearby.', 1525286908),
(2031, 455, 'Antony Fetigan', 'https://www.google.com/maps/contrib/111420464904268963117/reviews', 'en', 'https://lh4.googleusercontent.com/-zekvmUEwKrc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2liPTgqFkx07_alw47uiX_xgF3AQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Visited the dispensary while on holiday from England, the whole experience was great from start to finish. I visited the recreational side of the shop and found the guy to be friendly helpful and extremely knowledgeable. Fair prices and great products.\nWell worth a visit', 1524004038),
(2032, 455, 'Mr S', 'https://www.google.com/maps/contrib/111355451361544744115/reviews', 'en', 'https://lh5.googleusercontent.com/-vsql6G2_CE8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2gwiufA9YFSuZ3vJ7QYOLREu5e0w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Great staff very friendly and knowledgeable of their product. Very clean and classy inside. Vance is the best! He was very helpful and funny definitely will be coming back regularly (:', 1525474377),
(2033, 455, 'Kaycee Silvas', 'https://www.google.com/maps/contrib/116855332514754620331/reviews', 'en', 'https://lh5.googleusercontent.com/-bQJ9UY3dwt4/AAAAAAAAAAI/AAAAAAAAAJE/4MwjWezunIo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I absolutely love this place. I got a cake here for my birthday and it was amazing! I have made this my go to shop ever since. Fancy is my favorite Conceirge. He always treats me with such class. So far their is not something I haven’t tried whether it’s a craft Cannabis or AMA product. I am in love. I just picked up the 1:1 lotion which is 500m of THC and 500 CBD, I no longer feel my hands fall asleep at night and feel like it helps my carpal tunnel.', 1524017416),
(2034, 456, 'MARTELL HARE', 'https://www.google.com/maps/contrib/100494651777623481631/reviews', 'en', 'https://lh5.googleusercontent.com/-rtyW-W0e74k/AAAAAAAAAAI/AAAAAAAAAQI/wZlVQkiB_p8/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a month ago', 'Wow!!!  Just visited  this place again and got the best customer service I have received in a long time.  The clerk Jane, Skye and their supervisor Mary Ann are very informative and made me feel comfortable being it was my first visit.  The store is well decorated and very clean and organized.  I\'ll definitely be back in the future.  I have been here over a handful of times and every employee is so friendly and helpful.  Great job Pisos.  #1 in the state. Check them out.', 1524082642),
(2035, 456, 'Zachariah David Hales', 'https://www.google.com/maps/contrib/109959227544643969093/reviews', 'en', 'https://lh3.googleusercontent.com/-VqkT5DFwTTU/AAAAAAAAAAI/AAAAAAAAAHU/NS3YzqfPdLU/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a week ago', 'Wow. Amazing experience. The staff are customer oriented and let you really explore the products to find what will best suit you. The bus tenders are familiar with the products and can provide accurate descriptions. The containers also have a smell and magnifying glass section for seeing and smelling the offerings. Plus they’re open at 4 am. Awesome.', 1526862689),
(2036, 456, 'Joe Foster', 'https://www.google.com/maps/contrib/105898394292838987182/reviews', 'en', 'https://lh3.googleusercontent.com/-E1vdE1ezAmQ/AAAAAAAAAAI/AAAAAAAAAGY/H-ePQbEnVZE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'My first experience with a dispensary and I\'m totally mind blown!! Amazing products and the staff is very well educated. We met with Jane and made everything super chill and easy! Definitely coming back!!! -Ariele', 1526721964),
(2037, 456, 'Rasheika Smith', 'https://www.google.com/maps/contrib/115412436616321058911/reviews', 'en', 'https://lh3.googleusercontent.com/-E7jqW82Y1YY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq09FZvR8p3urN1QfdE4VhVOUuQ5gA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Visited the Pisos Dispensary and Jane helped us. She was extremely helpful and knowledgeable of the products. The customer Service and atmosphere is top notch; like the luxury doctors office style of dispensaries. Take notes dispensaries and seek out Jane when you get there! She’s awesome!', 1526169924),
(2038, 456, 'neha arora', 'https://www.google.com/maps/contrib/102274439683081524961/reviews', 'en', 'https://lh6.googleusercontent.com/-_0D--0LcokI/AAAAAAAAAAI/AAAAAAAAAX4/b7QMlvETPx4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'So I just visited Pisos for the first time and by far the best dispensary I have ever visited. Customer service top notch, selection is great and very chill vibes! I would recommend this place to anyone. If you are traveling through Las Vegas you must stop here !!', 1526163683),
(2039, 457, 'Tyler Harrington', 'https://www.google.com/maps/contrib/115762381706912135114/reviews', 'en', 'https://lh3.googleusercontent.com/-310OdACeUZE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1wi8oSpDKBX3xm0LBTCACiwEtiXg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I came here this weekend (4/21) looking for something new to try. The customer service was AMAZING! Julie was so helpful and knowledgeable about all the products. The selection was high quality and plentiful, even after a \"busy week\".  I described what I was looking for and Julie was able to give me suggestions and find exactly what I was looking for. She is very professional and so sweet! I highly recommend stopping in to see her. Will definitely be back!!', 1524337029),
(2040, 457, 'Gordon Murray', 'https://www.google.com/maps/contrib/109047698188154711321/reviews', 'en', 'https://lh4.googleusercontent.com/-tlNo6CUt_vg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3PwjHm1LNzl_N_0lPCbqjrf2IHfA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Just want to let everyone know that this is the dispensary u want to go. Has the best selection of herb you can get from the best growers out there. It it’s bomd more likely Show grow will have it.also today the bud tender who was helping me out name Rachel is so awesome, the girl knows her stuff about the product. She answer all the the question I was hitting her And was patient as well. She was so helpful and is great at what she does. Great job Rachel and thank u again. This is why I only go to show grow in Las Vegas n and other dispensary. Good herb and great women to help u out. Can’t go wrong with this place', 1527115992),
(2041, 457, 'Alice Wonders', 'https://www.google.com/maps/contrib/105431736813973913455/reviews', 'en', 'https://lh6.googleusercontent.com/-TMuU6r9R3sg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Za7c0fxG8-vrdiGh559p5SvIbtg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'ShowGrow is the best dispensary in town! With an unbeatable selection of all price ranges, and excellent customer service, this is the place to get your medicine! The staff is very welcoming and educated about all their products and the science of cannabis! They can answer any medicinal question you may have, and they were extremely patient with me even though I had so many questions. They also have an amazing Loyalty Rewards program, where you accumulate points for every $1 you spend and you can redeem for free medicine! Now you just can’t beat that, I love being rewarded and I love ShowGrow! Definitely a must-see, if you haven’t already! :)', 1522962053),
(2042, 457, 'Kenisha Taijeron', 'https://www.google.com/maps/contrib/111288868849810570501/reviews', 'en', 'https://lh3.googleusercontent.com/-D6Qtsko0Ke0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3KjsyLeY2KIsaoKAPvcK46l2j71g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'ShowGrow is the #1 dispensary in town. Not only is it refreshing to find a convenient location just minutes from my dads house, but it really feels like home when I walk through the doors. Everyone from the receptionists, the security guards, and the amazing bud tenders make ShowGrow the place to go. The first time I walked in, I was impressed by how clean and organized the shop is. It looked like a high end luxury place with the menu on the screens, and a wide selection of products for both medicinal and recreational needs. The one who made my experience unforgettable was Taylor Kay, the best budtender. She was very knowledgeable and even made recommendations that I would’ve never thought of. Don’t go anywhere else but ShowGrow!', 1523759806),
(2043, 457, 'Rodney Bocanegra', 'https://www.google.com/maps/contrib/110212750090207325055/reviews', 'en', 'https://lh3.googleusercontent.com/-ytkRb_IbaC4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1agL0IuU5w2snbFWHbvBM3t1Hg9Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Best shop in Vegas hands down. Girls are always on point with the recommendations. They have a good variety of product with a good range of prices. In an out never a long wait. They also have a royalty program. Great place. Love that they sell 2g to you. Does bot have to be 1 g or 1/8 like the choices.', 1526529296),
(2044, 458, 'Tony M', 'https://www.google.com/maps/contrib/100839437514983058441/reviews', 'en', 'https://lh6.googleusercontent.com/-cJGfqfNBe_s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3_xHdMtXLwjfPYTu77pEDBeQiZNw/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 weeks ago', 'Very impressed with them being the only shop in town to measure out in front of you.  Let you see how fresh it is, actually smell what you ARE getting and not whats in a plastic container sitting there for who knows how long.  Small inside but that\'s okay.  It was just enough size and they didn\'t sketch on their promotion for FTP.  Legit spot.  Highly recommend.', 1526093898);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(2045, 458, 'Esai Villegas', 'https://www.google.com/maps/contrib/107139585316560825738/reviews', 'en', 'https://lh5.googleusercontent.com/-frn4aVdWQDU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0z6cjkEaaFTzvTPS6l-nsRboriyA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'I have yet to have bad service or flower at Zen Leaf they are very knowledgeable about everything in the industry. Always the best recommendations. Alexa recommends some fire strains.', 1526085554),
(2046, 458, 'Rodney Kent', 'https://www.google.com/maps/contrib/101406950670713682478/reviews', 'en', 'https://lh4.googleusercontent.com/-jVCdmGwxx5s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0bz22UtjhiSkha4eXTZ23SR_ulRA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Great friendly place to visit. It always smells great Thank you for the great bud! Awesome variety. Devin is awesome , thank you !', 1523407831),
(2047, 458, 'Danielle Nicole', 'https://www.google.com/maps/contrib/115912947006615184044/reviews', 'en', 'https://lh4.googleusercontent.com/-QPY6cD3kMgk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3coxB3omlh8vn5UIFrCVLy_cLVQw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I was a first timer yesterday 05\'20\'18. Everyone was super friendly & helpful. I am now on my way back for more 05\'21\'18. Thank you!', 1526945288),
(2048, 459, 'Wendy Risdon', 'https://www.google.com/maps/contrib/109001448781268244880/reviews', 'en', 'https://lh6.googleusercontent.com/-4vasrfNXQgY/AAAAAAAAAAI/AAAAAAAAABo/XkI3m9OCA-o/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I have been to several dispensaries in the valley, but my favorite place to get my weed is Essence. They have a great selection, their prices are fair, the staff are friendly and knowledgeable. The inventory is consistent so you know you can always get what you want. They introduce new products and strains and run very good promotions so it is convenient and affordable to try new strains! Even when this place gets slammed, you are able to get in and out faster than any other dispensary. The amount of staff working really keeps the crowd moving, serviced and out the door with their purchase. The loyalty program is fantastic! They keep track of your points for you and use them as dollars of your purchase, use them or save them up for when you want to use them! I have never had a freshness issue or poor products from ANY dispensary I have been to.', 1519874510),
(2049, 459, 'je\'na givens', 'https://www.google.com/maps/contrib/109817682564361770253/reviews', 'en', 'https://lh5.googleusercontent.com/-YVXVFFjGWRs/AAAAAAAAAAI/AAAAAAAAIvc/Ij9I10MfXyA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'My favorite dispensary in town!!! I\'m never disappointed with the service or product. Quality is great at a fair price. Taxes are high, however they honor local discounts and the loyalty points definitely save me 1 to 2 bucks on most of my purchases. To top it all off, some of their male employees are easy on the eyes.', 1525135368),
(2050, 459, 'Tamny Lively', 'https://www.google.com/maps/contrib/112538806539213568031/reviews', 'en', 'https://lh4.googleusercontent.com/-wbgMw66FDgQ/AAAAAAAAAAI/AAAAAAAAKUg/bONsTFZLr3Y/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'By far thee very best dispensary for marijuana I have ever been to Not in San Francisco can beat this one Berkeley Patients Group is close but this made my trip to Vegas less painful Prices are comparable to CA dispensaries but this looked like a pharmacy Your weed did not come on w Ziploc baggy You do not have to worry about driving across state line with marijuana Get it there! This is on the Strip Our cab driver took us to a different one but we insisted he take us here. If you have a medical script show them! You go in first & get a discount. The Gentleman who waited on me took about 20 mins asking what hurt What I like What kind of high I like He was very knowledgeable of the product Spend $100 Make your trip memorable If you get drunk you will end up.married! So don\'t drink Burn one instead & go home happy & single!', 1523513750),
(2051, 459, 'Zach Nichols', 'https://www.google.com/maps/contrib/100456062978632693563/reviews', 'en', 'https://lh4.googleusercontent.com/-ablsgszZct0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq101X7QHym9tE3MuBqIFTHNeCGEIA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Best dispensary in town. 10% discount for locals. This is the place to go. Huge selection, low prices and and the staff doesn\'t try to push sales on you and are seem to be genuinely happy to work there.', 1526325999),
(2052, 459, 'Paul Lawrence', 'https://www.google.com/maps/contrib/117544269936232098715/reviews', 'en', 'https://lh3.googleusercontent.com/-C_XaaHGZ-c0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1z5K5pyXbYDL-0Y_jfSeHxqSwQ_Q/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Great selection, reasonable prices, and friendly bud-tenders. Plus they have a good loyalty program, which allows you to get in-store credit you can use toward future purchases. And, best of all, they offer military/veteran discounts AND a 10% local discount (you can use both together)! Great place. Can\'t reccomend enough.', 1523742218),
(2053, 460, 'Deborah Reasbeck', 'https://www.google.com/maps/contrib/113114363507107560438/reviews', 'en', 'https://lh6.googleusercontent.com/-o_6jiK9cVTk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0SwPJJQ_Tt4tx8mMsxXTOT3gQwxg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Hard to find the entrance. You have to go around back. Cash only. I was not impressed. $30 for 10 gummies. Nothing strain specific in their whole store. Was told they only have \"hybrid\" products. He said due to their high standards. High standards is great, but if you have no product knowledge to sell what is available, it is not helpful.  Bud tender offered no suggestions for products for pain. No  knowledge to help me in picking products for Medical use. Again, just a huge lack of knowledge, high prices and an attitude to boot. No thanks. Was better than nothing, but I won\'t be back. People in the front were friendly and nice. I was in pain and needed help, felt more like I got attitude instead of help.', 1525125624),
(2054, 460, 'Randall Slone', 'https://www.google.com/maps/contrib/100878987019667902990/reviews', 'en', 'https://lh6.googleusercontent.com/-1-xY0ehUBGI/AAAAAAAAAAI/AAAAAAAAAAA/L5FZlLg2eho/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'Great experience. Store easy to find, walked in and within 5 minutes was called to the back to shop. Staff was friendly and helpful. Cash only but there is an ATM right outside. 21 years old and up only. Good selection, good products.', 1526050202),
(2055, 460, 'Shannon Koehler', 'https://www.google.com/maps/contrib/108197074139810700053/reviews', 'en', 'https://lh5.googleusercontent.com/-kH9p-lsPB_Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1MMPvBq8CZE_Jb5JJzYn9i6BD6jg/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '3 weeks ago', 'Treat you with respect. Security very helpful and polite. Must have valid ID to enter building. Service with a smile.', 1525364906),
(2056, 460, 'Russell Henslee', 'https://www.google.com/maps/contrib/108242062191051596511/reviews', 'en', 'https://lh4.googleusercontent.com/-hKnGIQoGux8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0pyCzE78dnmTF_x-CWYJNXaTZPxQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '2 months ago', 'Their pre-loaded cartridges are satisfactory. I haven\'t tried anything other than that. (The four stars is for their product.) I don\'t know anything about their customer service or atmosphere.', 1522077262),
(2057, 460, 'rex haney', 'https://www.google.com/maps/contrib/102044083521243040011/reviews', 'en', 'https://lh5.googleusercontent.com/-ic2KyXAAYVs/AAAAAAAAAAI/AAAAAAAAMHc/55-2BhAO904/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I enjoy smoking weed and I don\'t give a rat\'s ass who knows yeah marijuana is good for you the Lord talks about it in the Bible Genesis 1:12', 1527483047),
(2058, 461, 'Chad Phillips', 'https://www.google.com/maps/contrib/109817198139650906227/reviews', 'en', 'https://lh6.googleusercontent.com/-MjKQzEK3z7I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0v-wXdOsiecF_iU-I-i6YOJO0PLg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'I\'ve been here twice and both times were great. The prices are cheaper than you\'d expect. The people are very nice, polite, and happy to help you out. Don\'t worry if the line looks kinda long, either. They have enough cashiers working to make your wait a really short one. I\'m hoping I get to go there at least 1 more time before I have to leave. Place is awesome.', 1525616009),
(2059, 461, 'Jade Barao', 'https://www.google.com/maps/contrib/116837722728661127547/reviews', 'en', 'https://lh4.googleusercontent.com/-uejaDkwxz5Y/AAAAAAAAAAI/AAAAAAAAMwo/1epgNPSqA9w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'So pleased with my first experience at a dispensary! Loved my purchases. The employees are so friendly and very knowledgeable. Will come back in two weeks!', 1525369196),
(2060, 461, 'KushTopia, Alaska', 'https://www.google.com/maps/contrib/103583649220279618265/reviews', 'en', 'https://lh5.googleusercontent.com/-h6KaPDm9Ie0/AAAAAAAAAAI/AAAAAAAAmkc/cUXQlrol_Qs/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '2 weeks ago', 'Such a great experience. We have followed Reef for years. The store is Amazing. The quality of product is so far high quality and compared very well with the NW.', 1526510557),
(2061, 461, 'T EATON', 'https://www.google.com/maps/contrib/105679927648314436397/reviews', 'en', 'https://lh6.googleusercontent.com/-qQNvrDkWwGs/AAAAAAAAAAI/AAAAAAAABbE/8FGpw2a-Ats/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Great service, Great staff. Best B-Day ever! Super convenient w/ wide variety and selection of high grade strains. You will not be disappointed.', 1522710412),
(2062, 461, 'Enrique Rodriguez', 'https://www.google.com/maps/contrib/116737303402564853983/reviews', 'en', 'https://lh4.googleusercontent.com/-ITVdFIwl13E/AAAAAAAAAAI/AAAAAAAAAPU/e1ASGM_sggU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I didn’t know what to expect as a first timer, coming from a non legalized state, but as soon as I walked in I was made to feel at home. Security checkpoint was smooth, polite. Once I got into the showroom, I was immediately assisted by a wonderful young woman, I didn’t catch her name, my bad, and she walked me through the whole deal. She was amazing. After her recommendations I went ahead and made my decision, no rush at all, and I was out the door. The entire experience took less than 20 minutes. I would highly recommend them to everyone, and my friends back home already know where to come when in town. Keep up the great work guys!', 1515396396),
(2063, 462, 'Sam F', 'https://www.google.com/maps/contrib/103784664300072323361/reviews', 'en', 'https://lh4.googleusercontent.com/-4vWqgD5IZn4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq19O4ixGS9sGLrGW8ekToBBD--qzg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 weeks ago', 'I had a fantastic experience here! I decided to switch dispensaries after a problem with cannacopia. Slater was a great wealth of knowledge. Excellent selection here, and the prices are great. I\'ll be back for sure! They carry nearly every major grower, huge selection of edibles, and even the hard to find items. The entrance is on the backside of the building, which is where more parking is. Don\'t look any further!', 1525465650),
(2064, 462, 'Andrew Green', 'https://www.google.com/maps/contrib/100284811245882725357/reviews', 'en', 'https://lh5.googleusercontent.com/-NFUZAqN911c/AAAAAAAAAAI/AAAAAAAADVQ/hKKgD2FtWC0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'This place is excellent! Great Staff. I had the pleasure of working with Lil Bit the last time i was in. Great customer service skills! Helped me purchase some great bud! Keep up the good work.', 1526529766),
(2065, 462, 'Penny Goodin', 'https://www.google.com/maps/contrib/109507575770750049621/reviews', 'en', 'https://lh4.googleusercontent.com/-t-j4IdJ9RTo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0l5w7-xkIDP6Sb40MqgLF9uFBW6w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This is the only place to go and thank you Essence for your great deals for 4:20. The best deals around town everyone it\'s just like family.   Thank you for your patience and your help all the time. You\'re always there to answer my questions and help me with my every need that I need. Thanks everyone great job ', 1524298534),
(2066, 462, 'Jason Ricardo', 'https://www.google.com/maps/contrib/111823829655166258450/reviews', 'en', 'https://lh6.googleusercontent.com/-wK9FKRlkyNc/AAAAAAAAAAI/AAAAAAAAFOo/JaEwJc5oeTQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'Close to MGM, Excalibur, NYNY, and a few fast food joints. Has a Quick Shop right behind. Reasonable prices for being so close to the strip. Large variety lots to choose from. Knowledge staff and very nice front desk people. Bathrooms and water fountain right at the entrance.', 1523848933),
(2067, 462, 'Joel Rasmussen', 'https://www.google.com/maps/contrib/116947657550246486893/reviews', 'en', 'https://lh3.googleusercontent.com/-5O0GbV1ewqQ/AAAAAAAAAAI/AAAAAAAAE1c/4bbpnlz1p98/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'This place is awesome.  Great product, reasonable prices. Open later than most so if you\'re at the casino and you want to increase your fun you can just head right over.', 1522712810),
(2068, 463, 'Geraldine Calloway', 'https://www.google.com/maps/contrib/113619732661543172262/reviews', 'en', 'https://lh5.googleusercontent.com/-u62N14SH6ZU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1omHZTI9Cma5mmYTox90DT3BPVUg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Jess displays great customer service and knowledge. It is refreshing to see someone of her generation to be so professional and respectful . Ten star Jess', 1527437398),
(2069, 463, 'ROSS MARTIN', 'https://www.google.com/maps/contrib/104843870855915414453/reviews', 'en', 'https://lh4.googleusercontent.com/-oDpQbOzyS-Q/AAAAAAAAAAI/AAAAAAAABag/2f2lc3kvPvk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '2 months ago', 'Very friendly and helpful people... and most surprisingly , the budtender that served me was young and I didn\'t think he knew any thing... But I gotta say that young man knew what he was talking about and was very helpful... I give the place 4☆\'s... buy that young man that served me  his name is \"ED\" I GIVE HIM A 5☆ RATING... Thanks Ed.', 1521066013),
(2070, 463, 'Martin Hruz', 'https://www.google.com/maps/contrib/102880147231164015834/reviews', 'en', 'https://lh3.googleusercontent.com/-9iwE3ht6YVA/AAAAAAAAAAI/AAAAAAAAAE4/E5GMEOFCrew/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I recommend this dispensary, especially for\nvariety and knoledgable staff. If this would be your first visit to a dispensary, rest assured you will feel at ease here. The staff here, is complemented by Francesca, the gal that answered all my questions. Highly satisfied \nwith the quality.   Thank You REEF\n                                           &\n                                      Francesca', 1518674109),
(2071, 463, 'Brandi Cicco', 'https://www.google.com/maps/contrib/111563204628824310622/reviews', 'en', 'https://lh4.googleusercontent.com/-aJt7yg6tTXg/AAAAAAAAAAI/AAAAAAAABgA/N2CtjDkGQjs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I\'ve been in reno for 4 years now, and I have gone to a few dispensaries once it was legal. And each time I keep coming back to the Reef. Not only for Friendly faces, they also know their product, and help me choose what is best for myself. They have really great flower, fluffy and fresh, some super crystallized. The prices may seem a little steep but you are totally getting what you pay for. I always attend the location in Sparks, and Francesca is always amazing and super friendly when assisting people as well as myself.', 1516331757),
(2072, 463, 'danny senkoff', 'https://www.google.com/maps/contrib/109287908982410351681/reviews', 'en', 'https://lh3.googleusercontent.com/-6RTfCE4Pmfg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1IL8mtLalpvY6RgleuE3f6l4D0PA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great staff. Extremely knowledgeable with diverse selection of medical cannabis. Prices are locally competitive.', 1523627751),
(2073, 464, 'Edgar Nunez', 'https://www.google.com/maps/contrib/114907821193983964380/reviews', 'en', 'https://lh3.googleusercontent.com/-GzHR0Wqqslk/AAAAAAAAAAI/AAAAAAAABuk/0Qc0pM-QWpw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I\'ve been to several dispensaries in the Vegas Valley, and let me tell you: in terms of customer service and quality at an extremely respectable price, Thrive is unbeatable.\n\nThe location is not my favorite as it is a thirty minute drive from my house and somewhat hidden from view, but that my be the only complain I have. Today I was treated to excellent customer service from Sabrina, and have never had a bud tender there who wasn\'t eager to help and suggest strains.\n\nThank you Thrive!', 1527623867),
(2074, 464, 'KushTopia, Alaska', 'https://www.google.com/maps/contrib/103583649220279618265/reviews', 'en', 'https://lh5.googleusercontent.com/-h6KaPDm9Ie0/AAAAAAAAAAI/AAAAAAAAmkc/cUXQlrol_Qs/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a week ago', 'What a great place. We stopped into 9 retail shops while in Vegas. This one was more unique and stood out to me for many reasons. The green throughout the building was consistent. Using wood flooring for walls was different and uniform. The couches were nice. \n\nThe entryway was comfortable and very welcoming. The products were consistent and high quality. The staff seemed very knowledgeable and helpful. \n\nChecking in and exiting were very seamless though they were not busy so could not tell you if it could be better or not during rush hours. \n\nDid not notice any particulars sales.', 1527126867),
(2075, 464, 'OROCHIMARU UWABAMI', 'https://www.google.com/maps/contrib/105160355782140595123/reviews', 'en', 'https://lh4.googleusercontent.com/-cYFRjbOttds/AAAAAAAAAAI/AAAAAAAAAqA/DMluHcL0Mcw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Let me tell you about THRIVE and their epic midnight madness sales! SUCH GREAT DEALS! And Megan is AMAZING!! She will take good care of you if you\'re a late visitor like me.', 1527065191),
(2076, 464, 'Denise Esquivel', 'https://www.google.com/maps/contrib/105685630063495556822/reviews', 'en', 'https://lh6.googleusercontent.com/-PPpij3kf4k0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Yzl5BDk6d5VMTcDebd9spZZLRjA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Great place to come. Was very new to all this and they were very helpful as well. Definitely recommend this place! Nice and relaxing waiting room . Very friendly staff..', 1526146279),
(2077, 464, 'Marshall Warren', 'https://www.google.com/maps/contrib/109578581479299019395/reviews', 'en', 'https://lh5.googleusercontent.com/-3RP3I7r_Qtg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3A-XvV55TK2JWqzFQHK6xksa47Sg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Thrive is gr8 awesome staff. Gr8 products. Awesome customer service recommend if in las Vegas\nAlways leave happy.', 1527444738),
(2078, 465, 'Sameer', 'https://www.google.com/maps/contrib/116107175151541598753/reviews', 'en', 'https://lh3.googleusercontent.com/-XSv7vRrD08Y/AAAAAAAAAAI/AAAAAAAAAa8/PDynnroDsr0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'This is a very fine dispensary located above Reno in Sun Valley. Their leaf  products are absolutely Superior and sold at the right price. They also have a great selection of concentrates. The staff here is very friendly and they will make you feel like you have just stepped into your own living room.\nThe prices here are less than you would pay in Reno.  There are many dispensaries in the area and it is a wonderful eclectic sort of town.   it is well worth a visit to Sun Valley to shop at all the dispensaries... and find your own favorite place.', 1525907200),
(2079, 465, 'FenexDragonis', 'https://www.google.com/maps/contrib/108575285654020825680/reviews', 'en', 'https://lh4.googleusercontent.com/-HLAWKK8SrMQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2pT4JODWq1yFXFsRIraic-_PaiGg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'First experience in a dispensary and it was phenominal.. staff was very professional friendly and knowlegable. They are more than happy to help you in any way they can.', 1527486413),
(2080, 465, 'Ken Heintz', 'https://www.google.com/maps/contrib/116771058234464167311/reviews', 'en', 'https://lh3.googleusercontent.com/-0GR6COJ3TB0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0plkhJjKJR2FSYxX543n37Xla8iw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I\'ve been there twice.  Both times,  no waiting   . And having Kendra for my bartender made it even better.  P.  S.   The product got 5 stars too.', 1521936589),
(2081, 465, 'Heather Streater', 'https://www.google.com/maps/contrib/106587619434730864293/reviews', 'en', 'https://lh6.googleusercontent.com/-eq-Z26iHjqA/AAAAAAAAAAI/AAAAAAAAABA/jMV1hNnp5ss/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This is my favorite dispensary in this city.  Every time I\'m here I feel so comfortable and the staff is so knowledgeable about their huge range of products. Would definitely recommend to family and friends.', 1521092068),
(2082, 465, 'Tiffany Blake', 'https://www.google.com/maps/contrib/115814068490607675773/reviews', 'en', 'https://lh3.googleusercontent.com/-3sdEpSTdFhw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Ds2Kmbo-K7irXAkBlo2YVvpe0YA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'ABSOLUTELY LOOOOOVE THIS SHOP!! i used to go to another one and loved it but this one has a GREAT selection & the tenders are very nice and helpful!!! will continue to use this shop as my GO TO #1!!!', 1522351207),
(2083, 466, 'Emma Jean', 'https://www.google.com/maps/contrib/109041097634348899220/reviews', 'en', 'https://lh6.googleusercontent.com/-VO9vjWctNp0/AAAAAAAAAAI/AAAAAAAAHeA/yJwyjdmBqkc/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 weeks ago', 'This place is awesome. The budtenders are very knowledgeable and the set up is VERY efficient! The buds are super fresh and they have a HUGE selection. They\'re menu online is also super accurate too, which is amazing because you can be in and out super quick if you just check online first. Anyway, thanks for being a grade A dispensary!! I appreciate it!', 1526356824),
(2084, 466, 'Alicia Gerhardt', 'https://www.google.com/maps/contrib/114521629764952180672/reviews', 'en', 'https://lh3.googleusercontent.com/-d9Sh0SgJSBE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0gXAuuYHgwOmUOmTbBnIN2aU8ezA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'Horrible products and horrible service... definitely will never go back.... I wish I could upload a picture of the stuff they want to call great products.. the flower just crumbles to pieces and usually doesn’t weigh the right amount.. so many other dispensaries don’t waste your time in this place....', 1526441834),
(2085, 466, 'Edward Putnam', 'https://www.google.com/maps/contrib/112465014332360322656/reviews', 'en', 'https://lh6.googleusercontent.com/-zfuSkZA4CO0/AAAAAAAAAAI/AAAAAAAAQS8/5kyoCVJEs2A/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'Best Dispensary  hands down. Been to All the others, had the others places cheaper deals, and got what i paid for.  The staff at Siver State Relief  are the some of the Best Budtenders in town.  They always go the extra step to help us(We are Medical Patients ). And are never Pushy or rude. And the product is Top shelf.  I have Very seldom been disappointed  in any product.  And how new items come available they have them.  Go here and you will come back I guarantee.', 1524225604),
(2086, 466, 'T&L Howard', 'https://www.google.com/maps/contrib/101586262679118016473/reviews', 'en', 'https://lh5.googleusercontent.com/-KQW0r4V-OOY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq18IkBDFtebsNEcQ-73-R2CrLCE-A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'Ordered Kalm popcorn off of Blackbird delivery. One bag showed up for $12.00. Problem was that it shows a box of THREE and doesn\'t say anything about it only being for ONE bag. So I call them and they tried to say it was Blackbirds web page and they weren\'t responsible for their content. BUT what Silver State DIDN\'T know was I had already checked SILVER STATE\'S web page and it was the exact same thing as Blackbirds...all they said was sorry?....I am a business owner and that wouldn\'t fly with MY customers.... RIPOFF!', 1527274541),
(2087, 466, 'lisamarie simmons', 'https://www.google.com/maps/contrib/105786541435475290025/reviews', 'en', 'https://lh5.googleusercontent.com/-P4-FBiRVvlg/AAAAAAAAAAI/AAAAAAAADwA/_pxNr09v1GQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 months ago', 'I love this place especially Jessica on the medical side.  She knows her stuff and is very helpful with recommendations for what ales you! They are all friendly and there is never a wait.  The prices are the best in town too!', 1519262436),
(2088, 467, 'John Carroll', 'https://www.google.com/maps/contrib/109560438018926044074/reviews', 'en', 'https://lh6.googleusercontent.com/-gHZwXuI6NWM/AAAAAAAAAAI/AAAAAAAAS8s/28mVHEAxQF0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'Easily one of the best dispensaries in Vegas. Right on the strip and very easy to find. The staff are friendly, informative, and professional.\n\nJenny checked us in and made us feel right at home while explaining how it all works. Then you walk into a room that\'s like Disneyland for adults (this is what our super awesome budtender said to us and we agreed). It\'s a little overwhelming but all you have to do is put yourself in your capable hands, let them now what you want and if you have any questions or budget concerns. Raphael was funny, super informative, and helped make sure our needs were met. \n\nDefinitely should be at the top of your list!', 1522513769),
(2089, 467, 'Chris Walker', 'https://www.google.com/maps/contrib/104147900073240217195/reviews', 'en', 'https://lh3.googleusercontent.com/-7OCYP-VLoPw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq14GOdcl8C_la85gPoqiYPef4uziw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Amazing experience.\n \nBrittany is a Great budtender. She is friendly, very knowledgeable and treated my Wife and I as if we were family. I highly recommend coming here if you haven\'t already. Loyal customer for life', 1527641952),
(2090, 467, 'Robin Lane', 'https://www.google.com/maps/contrib/109719941869982416159/reviews', 'en', 'https://lh4.googleusercontent.com/-DC9i-eO4rLU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3iwcPY63TqpUuMa8ouaZtJC7HaEA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'I went to this dispensary on May 14, 2018 while I was on vacation in Vegas. Well this was my first time ever going in to a dispensary and I was amazed. The customer service was very professional and informative. I was like a kid in the candy store! The staf was tremendously helpful and patient with my questions. The person that helped me recommended the Mendo for me to smoke based on what I told him I like. It was great!! I recommend this place if your in town. I will be visiting again soon..', 1526508569),
(2091, 467, 'Penny Goodin', 'https://www.google.com/maps/contrib/103764757453225033299/reviews', 'en', 'https://lh6.googleusercontent.com/-R0Q3TZ3zTGQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq25BL4luwfYf8Vg_cQe1bjiVSiMKQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This is a great place to visit to come get your daily smoke or edibles. Everyone here staff is great smiling all the time willing to help everyone prices are so reasonable this is the only place that I go. So come check them out they\'ll give you some great deals always got great specials going on to you', 1522302326),
(2092, 467, 'Ty Bryant', 'https://www.google.com/maps/contrib/113159945585084611023/reviews', 'en', 'https://lh5.googleusercontent.com/-B-hShVBG9FU/AAAAAAAAAAI/AAAAAAAAAUU/mbLJDU3HSpM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'My first time in Vegas and one of my first stops! The staff was very helpful and friendly L.P. answered all my questions she was patient she didn’t even mind letting me see all flavor choices! Definitely on my way back to see them!! Recommend Everyone Go See Them when in Vegas !!!', 1522426366),
(2093, 468, 'Susan Morales', 'https://www.google.com/maps/contrib/102596396257143451780/reviews', 'en', 'https://lh4.googleusercontent.com/-IFdhpQCQXFI/AAAAAAAAAAI/AAAAAAAAGBs/7tVrnJU2uW0/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'I love my dispensary!  The product is always great quality for the best prices, anddd The staff  here is so professional yet always friendly and super helpful. Definitely the way to go. ', 1526745774),
(2094, 468, 'Kristi O\'Neal', 'https://www.google.com/maps/contrib/104522645547645145270/reviews', 'en', 'https://lh4.googleusercontent.com/-XXf1JftfLKM/AAAAAAAAAAI/AAAAAAAAABk/71RhwnH_ZBU/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 months ago', 'I have been coming here regularly since they have opened. The security guards are great and have a good time with you. The bud tenders know their product. It\'s been a good experience all around until the last two times I have been in. Last time, the bud tender was more concerned with what time he was getting off the clock and talking to his buddies than waiting on customers. Tonight, I don\'t know if the security guard was having a bad day or if his tiny, tidy-whiteys were in a bunch but he had the personality of a wet mop. Maybe customer service is not his thing. With so many places to by product is seems a shame to lose a steady customer over customer service issues. Hope service improves or I will be taking my business to Thrive or Inyo.', 1521623773),
(2095, 468, 'Mike Sherman', 'https://www.google.com/maps/contrib/100877026151431052900/reviews', 'en', 'https://lh5.googleusercontent.com/-9cS4oti0uO8/AAAAAAAAAAI/AAAAAAAAAJE/rQ9SSlwtyNs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'This is by far the best dispensary in Las Vegas ... customer service is awesome. . ( super friendly cute girls behind the counter) ....the product is supreme ...  and because they\'re off the strip their prices are way better than any of the other spots that I\'ve been to.. \nThere electric pens and the oils are what I\'m into now.. 45 bucks worth of oil last me two weeks and I smoke. . Thanks for the good stuff. They recommended the cannalope haze man it was so good  ...', 1519668981),
(2096, 468, 'Yidanys Chala', 'https://www.google.com/maps/contrib/100959043179270003367/reviews', 'en', 'https://lh4.googleusercontent.com/-kmx5KDiObFc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Z14mSjvY1nyGVVKik8Cl-eQg3oQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'I’ve been a customer here since the beginning. This place used have great prices, selection, service and even a nice little reward program. All, but the reward program, has gone way south. I’ve been given the wrong strand of weed, which messed up my sleeping pattern for days.  I’ve been given old, dry weed (1/8 of Ultimate Indica). I’ve waited way too long in that line without anyone offering at least a waiting time estimate, someone coming around to take orders, for example. It’s the little things...and when I brought the issues to their attention no one did anything. I barely got an apology and no compensation was ever offered. Lastly, a night shift manager was unable to void a sale that had just occurred, without me leaving the register. I just wanted to exchange 2 pre-rolls for a gram of a different strand. Is that a difficult request? What type of POS system doesn’t allow voiding sales? What if I didn’t have the cash to pay for it? Terrible customer service. I’ve never even seen that manager before. He’s never out with the customers. Maybe greeting, maybe taking the time to learn the names of the regulars. The people who spend thousands of dollars in your establishment. I will not be going back. From the other comments it seems that I’m not alone.  You lost another good customer. Get it together.', 1524466413),
(2097, 468, 'Xerocorpse Boomer', 'https://www.google.com/maps/contrib/100494044977115831822/reviews', 'en', 'https://lh6.googleusercontent.com/-7IU-DDlDUfk/AAAAAAAAAAI/AAAAAAAAF7A/HmTaLXR0x0A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'One person can make all the difference! I decided to give Reef another shot and met a very friendly and knowledgeable staff member baned King Jay. He made me feel like I was at a friends house than a store. And any questiin I asked he was right on top of. Even the bud I purchased was top of the line! I swear that guy deserves a raise just for the way he carries himself! Way to go Reef! Because of Jay I am completely loyal to Reef and Reef only!!!!', 1517250843),
(2098, 469, 'Ariel Dille', 'https://www.google.com/maps/contrib/107250174168540349754/reviews', 'en', 'https://lh5.googleusercontent.com/-nTKgmTDopjU/AAAAAAAAAAI/AAAAAAAAAWI/Crc-0j6YFI4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Staff is always friendly and quick. My boyfriend and I enjoy the love we get from the staff as we are regulars and most of them tend to know what we are going to get and what we are looking for. I would recommend all my friends and family to go to thrive not only for their service but for the quality an quantity.', 1525420229),
(2099, 469, 'Bethany Richardson', 'https://www.google.com/maps/contrib/105007796161174052498/reviews', 'en', 'https://lh3.googleusercontent.com/-pj1uN1HK5Yo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1F6DDbi73gqrEL3EzGDIPu-YBB5w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Thrive is my favorite dispensary hands down! So clean, the staff is super nice and professional and really know about their products and how to choose what’s right for you. I’m here all the time! Thanks guys :)', 1527047013),
(2100, 469, 'Brianna Albin', 'https://www.google.com/maps/contrib/101799317437478675513/reviews', 'en', 'https://lh3.googleusercontent.com/-iZavJdBhW4Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3xVc7AVixRxqYabtjdUmi9X8-STw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'Contrary to all of their paid 5 star reviews. Finally giving up on this one after horrible experiences throughout the last couple months. Unfriendly staff who is more concerned with their own personal conversations rather than greeting customers is almost a given when visiting as of late. Lazy staff who would rather round up the amount charged on your card than remember 4 numbers as they walk to the credit card scanner result in unnecessary mistakes and confusion. Pricing and product quality being inconsistent paired with an unknowledgable staff guarantees dissatisfaction. BEWARE of being up sold Matrix concentrates as these house products Thrive provides have a strange consistency, irregular color, lack of flavor, and will not get you high. All of this is very unfortunate since this was my go-to spot for quite some time.', 1527374211),
(2101, 469, 'Angelo Orlando', 'https://www.google.com/maps/contrib/116620004532184743251/reviews', 'en', 'https://lh5.googleusercontent.com/-8RkC2BeItXU/AAAAAAAAAAI/AAAAAAAAAKs/SL8pRaGMUno/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Awesome place, great prices, and quality product. Very efficient during busy hours. One person helps you find what you want then you wait a little bit to pay and receive your product. \n\nThe bottom shelf is of good quality so no money is wasted here. \n\n- I’m a local google reviewer and I was not paid or bribed to write this ad!', 1520654272),
(2102, 469, 'Kevin Barahona', 'https://www.google.com/maps/contrib/100861839623771639032/reviews', 'en', 'https://lh5.googleusercontent.com/-xQWzRNPuAOQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3BdNwgJIrw_oMlGyoVRojZyR-klw/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'in the last week', 'Great staff!! First time so cant wait to try the flower! Also the bags are awesome\n\nEdit: I wrote that review just to spin wheel and win something and before I actually tried there flower... it was dry and top shelf wasnt very great. We also got two different strains of in our 8th. Both being pretty lame. Probably never going back.', 1527556217),
(2103, 470, 'Heather Irwin', 'https://www.google.com/maps/contrib/116844416513118797625/reviews', 'en', 'https://lh6.googleusercontent.com/-Obypl3hz38A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0h6cQXPCICpHE3QbAgQEQEpeRBUA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Unfortunately lost a brand new customer. Customer service was fine but we were shorted on a gram that we had purchased and when I called the store all they could tell me was sorry. Thanks, but no thanks on shorting us for what we paid for.', 1520067490),
(2104, 470, 'Shane Connors', 'https://www.google.com/maps/contrib/116742399599417068790/reviews', 'en', 'https://lh4.googleusercontent.com/-4zNWqaRFpDQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3CmVSwV8T0R1c0kT5r91yp7PqudQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'I went here 5 times. The first time it cost me about 40 dollars. The flower was okay. The 2nd time it cost me 47 dollars and it had seeds in it. The 3rd time it cost me 53 dollars and it was okay. The 4th time it cost me 38 dollars and it was dry as a chicken bone. The 5th and last time, it cost me 60 dollars and it tastes like chemical and wasn’t flushed properly. \nEveryday the prices are different. The night crew seems sketchy, and the weed sucks. Why would you want that?', 1521062265),
(2105, 470, 'mia h.', 'https://www.google.com/maps/contrib/112397596155183002176/reviews', 'en', 'https://lh5.googleusercontent.com/-FJLtRaFzIqw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0iQJPf6txBPz6qzl7en8XJ3RvvGg/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '4 months ago', 'Usually always a good spot, however today I went home and noticed I got shorted a gram on my quarter purchase and only received 6 grams even though I paid full price. I would suggest prepacking 1/4ths in jars rather than bags to avoid further mistakes. Very disappointed!', 1516401905),
(2106, 470, 'retro cat', 'https://www.google.com/maps/contrib/105727623999258022295/reviews', 'en', 'https://lh5.googleusercontent.com/-sZqTJp_Xoz8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2zk_uanilYDPZNggPerZDjqOBeAg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Been travelling and unable to sleep all week, and (the new guy?) Joey really helped me find the most suitable medication for my insomnia problem.  So happy we stopped in on our way home tonight and really enjoyed our conversation!  We appreciated the time you took to help us figure out the proper product for our need. =) Looking forward to a peaceful happy nights sleep!', 1507871711),
(2107, 470, 'Marc G', 'https://www.google.com/maps/contrib/104598346480692560211/reviews', 'en', 'https://lh4.googleusercontent.com/-hqe5_TnnAUE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2XA3KGaT3IEybFxBjhBO2h8PSatQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '3 months ago', 'Kind of attitudey staff and they have absolutely no respect for the recreational customers privacy they require you to be in their computer system which puts people at risk who have no need to be at risk. Almost every dispensary in Vegas does not require you to be put into their computer there is no reason to shop here when there are so many other places that respect your privacy', 1519840913),
(2108, 471, 'Terrie Lively', 'https://www.google.com/maps/contrib/103014938261579200818/reviews', 'en', 'https://lh4.googleusercontent.com/-BhjaffTe6kM/AAAAAAAAAAI/AAAAAAAAABw/xXCwhmWmaB0/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 3, 'in the last week', 'Nice selection, prices about average. I Did not get my points twice adding to about 200, yes they put my phone number in. When I called and discussed the matter, I was told I would get a call back, and I never did. In person, staff is great, over the phone... not so helpful.  Great costumer service goes a long way.', 1527635572),
(2109, 471, 'Roland 0311', 'https://www.google.com/maps/contrib/105079403779093320405/reviews', 'en', 'https://lh4.googleusercontent.com/-qs5Mdjy4lYY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Oi0y1Vt5CLqskXzauAgOmA8Ig0w/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg', 4, 'in the last week', 'Good place to start and begin your vacation.   All the places are very expensive for recreational.  But, have fun and be safe. Those edibles will sneak up on you.', 1527279133),
(2110, 471, 'Marik 444', 'https://www.google.com/maps/contrib/101512581718050008028/reviews', 'en', 'https://lh6.googleusercontent.com/-2E_-ckMVBdY/AAAAAAAAAAI/AAAAAAAAAFE/pHJe6ayxkSk/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'Awesome selection, wish I could have gotten Calvin the 2nd time. I specifically requested and the guy greeted me with \"well you got me instead\" and proceeded to high five every decision I made.. The reason I requested Calvin was because he saved me from myself the first time and recommended something amazing...\n\nWould have gotten 5 stars but I feel like I may have missed out of getting another great strain because I didn\'t trust the tender.', 1522528125),
(2111, 471, 'Saera', 'https://www.google.com/maps/contrib/116496717033836647597/reviews', 'en', 'https://lh6.googleusercontent.com/-MTIkrNGIH5A/AAAAAAAAAAI/AAAAAAAAAkI/JKHuY7QYR7U/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Great Staff. Emani (Sp) is Wonderful. Everyone that has helped me has been more than knowledgeable. Great fast, efficient service. Nice Atmosphere. Something for every Price Range. ', 1521322723),
(2112, 471, 'Eugene Godina', 'https://www.google.com/maps/contrib/102335956884660156714/reviews', 'en', 'https://lh4.googleusercontent.com/-C6jA9qapekI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1gld82mfNSuBEWCdjLxfPOhK5dqQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a week ago', 'CBD pre-roll is half the price at Blum.  Didn\'t have time to go else where.  But I\'ll plan better in the future.  Nice staff.  But was pretty disorganized.... maybe because it was 9:45 am. Maybe they were still opening ?   But price is my big observation of this specific product.', 1527097348),
(2113, 472, 'Patricia Smith', 'https://www.google.com/maps/contrib/103759126880485652506/reviews', 'en', 'https://lh6.googleusercontent.com/-BTTovg2ppeo/AAAAAAAAAAI/AAAAAAAAA0s/rg9V6ZLO9AA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'The nicest people. Free food Saturdays and helpful staff and you can smell the flower, unlike some stores. Well lit and well laid out store, clear signage and even smoke products wrappers and glassware. Clothes, edibles and more. Delighted at my experience and will be back! Thank you!', 1527392916),
(2114, 472, 'Joseph Brinkmeyer', 'https://www.google.com/maps/contrib/116669548340634170017/reviews', 'en', 'https://lh6.googleusercontent.com/-KUak6oLpnrM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ioEP5WulQSW5UEwxAPw6R9qIqwg/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 months ago', 'Very nice atmosphere with with quality employees and product. I am a medical patient that was just checking out Sierra Nevada College when i found this Incline Gem. I like it so much i am going to apply on Saturday. Cannot wait hope i get the job helping people and getting paid with benefits is a plus. Thank you Nuleaf for a great time will be back for sure. -A very satisfied medically discharged veteran........no really thank you', 1521834358),
(2115, 472, 'Robert-Francis : Sullivan.', 'https://www.google.com/maps/contrib/101127556493376774097/reviews', 'en', 'https://lh5.googleusercontent.com/-m9DjLA6vYBM/AAAAAAAAAAI/AAAAAAAAB00/FGj6E6s2UGA/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a week ago', 'Love the staff; location-monopoly, posh interior-design & premium service make NuLeaf worth the tourist-pricing (chill out price-critics! You’re in Lake Tahoe - lol  - not a filthy Reno back alley lol!)', 1526738390),
(2116, 472, 'necoll martinez', 'https://www.google.com/maps/contrib/117142435965511669210/reviews', 'en', 'https://lh4.googleusercontent.com/-g4-FIMx_2MU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1isJh2f0tx4NPAXIXlnm7ba4xZfg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'As a consistent recreational buyer they always have an awesome variety and keep the store bright and clean! They always have new inventory and great new suggestions for me when I come in. Everyone is super friendly and really knowledgable on their product, which makes you feel comfortable in what exactly you are getting. Every time I come in I get a happy hello and a satisfying goodbye to enjoy a new product or strand. They always ask me how I am feeling or what am I doing that day to start their sale, which makes me think they will suggest something I am looking for and not just a random strand. They really talk and get to know the person to figure out what they can provide to satisfy them. I am so happy to have a recreational dispensary in Lake Tahoe, but I am even happier with the quick line, positive vibes, and great product they distribute.', 1509140843),
(2117, 472, 'will strength', 'https://www.google.com/maps/contrib/107374020791887130433/reviews', 'en', 'https://lh6.googleusercontent.com/-6ZhLhbSPR00/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0y1hHRWDhXsZU5KZ-0p1D3kXcRDg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Awesome dispensary. The only walk-in dispensary in North Lake Tahoe. Great people. Really kind and helpful getting you what you need.', 1520313763),
(2118, 473, 'Patricia Mcclain', 'https://www.google.com/maps/contrib/105580337530828159712/reviews', 'en', 'https://lh3.googleusercontent.com/-nLDPHFRXvVg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq19bs8_1Grz25U9cBpnmF7rPDXs-A/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'Ok I went there for the first time on my birthday 2 months ago. I love it there! The greeters are always welcoming and extremely friendly and remember me each visit since the first. The inside and outside of the building are always immaculate. The bud tenders are so knowledgeable, friendly and so willing to answer questions and such. They recommended a couple things that I swear by now. They really helped me have a better quality of life without all the different pills I had to take prior. Prices are reasonable, packaging is cool, lines move quickly and I feel safe inside. I also like the texts I receive when they have specials. You guys are great. Keep up the great job and you\'ll have a customer forever!!!  ;)', 1515948147),
(2119, 473, 'Nathan Halliday', 'https://www.google.com/maps/contrib/104739164649185096065/reviews', 'en', 'https://lh6.googleusercontent.com/-9boRYBq2tlg/AAAAAAAAAAI/AAAAAAAAIEA/K0nQz9O9ah8/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'Thank you Lance for taking care of me Inyo has been one of my favorite dispensarys in the 702 I highly suggest taking the time and checking Inyo out. Great atmosphere awesome employee\'s and great selection of top shelf products I\'ve never been disappointed with anything I have bought from them', 1523558227),
(2120, 473, 'Beau Woodward', 'https://www.google.com/maps/contrib/108609322937645231770/reviews', 'en', 'https://lh5.googleusercontent.com/-5oDcpZOXZ4Q/AAAAAAAAAAI/AAAAAAAAE-s/-T9t5OjanuQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '3 months ago', 'What a team!!! I would like to thank Exotic Dancer Ashley Brooke Johnston for her customer service. You might know her from such clubs from Henderson, Can Can room, Little Darlings and many more. Cop calling snitch had cops come to an established tattoo shop putting other shop patrons and artists at risk! Shame on you Ashley. People have kids and families that you didn’t even consider could have been effected. Everyone that works here and visits here make sure you watch your mouth around Ashley.', 1518299137),
(2121, 473, 'John Sinclair', 'https://www.google.com/maps/contrib/107319794058433153905/reviews', 'en', 'https://lh6.googleusercontent.com/-oBaBUY8djcY/AAAAAAAAAAI/AAAAAAAAABM/xq5BDI6qY9E/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'Felix was my bud tender, he was knowledgeable, patient and actually remembered me from another purchase. Great service and great prices! Be sure to stop by', 1519533169),
(2122, 473, 'Pass pot', 'https://www.google.com/maps/contrib/100526400734878360971/reviews', 'en', 'https://lh4.googleusercontent.com/-tQYjkvDjpnc/AAAAAAAAAAI/AAAAAAAAAD4/rk0IVC59XSU/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'Really need to check out inyo. What a great staff too!', 1527141927),
(2123, 474, 'Miss Muffy', 'https://www.google.com/maps/contrib/110028292948989830799/reviews', 'en', 'https://lh6.googleusercontent.com/-czhHemHJlUc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2xGGv4iUR7OjN8lCsWy-43gUK8AQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Awesome place! Very organized and well run. You know exactly what to expect when you arrive. Good selection & high quality packaging. Super nice staff & great products! Highly recommend!', 1526329162),
(2124, 474, 'Jacob Beck', 'https://www.google.com/maps/contrib/102359682694860094546/reviews', 'en', 'https://lh5.googleusercontent.com/-MQLZSJ0bwX8/AAAAAAAAAAI/AAAAAAAAADY/oaCPLV0UZNk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Wow what a great experience for my first time at a dispensary. The staff is wonderful and eager to help. Shannon was a great help to me personally she answered all my questions and was just great to work with. If you are interested you need to come out here and check this place out.', 1526495310);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(2125, 474, 'Mallory Pettegrew', 'https://www.google.com/maps/contrib/108467704477317366344/reviews', 'en', 'https://lh3.googleusercontent.com/-p_CD2HP3S_k/AAAAAAAAAAI/AAAAAAAAAxw/zvUXVgij9-4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I love deep roots! The staff is super friendly and helpful. I love Michael and Kristine especially but everyone is so nice! They also have fun specials from time to time and their prices are competitive. And only shop in mesquite so you can’t beat that!', 1523673524),
(2126, 474, 'IR US', 'https://www.google.com/maps/contrib/115573528451414249380/reviews', 'en', 'https://lh3.googleusercontent.com/-2f0BgQIWrzc/AAAAAAAAAAI/AAAAAAAAAAs/UnczrzfEt34/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very cool atmosphere. Friendly staff. Great selection and smell. Little pricey. But well worth it. Fully recommend them. Michael s is awesome and friendly. And dinah was very kind and fun to talk to.', 1524856629),
(2127, 474, 'Christa Dietzel', 'https://www.google.com/maps/contrib/116689565087920795660/reviews', 'en', 'https://lh4.googleusercontent.com/-Wn0g9SquaCU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3QGXMrlWRsKeX4iMBXpHb_JGurfw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This is my main spot!!!  It’s the only Nevada dispensary I visit. They have everything for my needs, they have awesome deals and promos.  The staff is always very helpful and make it such a pleasure to visit. I love visiting Deep Roots!!  They take care of you every time. I love this place more than the California dispensaries I’m used to... check them out!!  So worth it.', 1522350194),
(2128, 475, 'Michael Johnson', 'https://www.google.com/maps/contrib/111913467021344891284/reviews', 'en', 'https://lh3.googleusercontent.com/-ecKWbBmZ0LA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0eEObaP3sMS5vQPBUVGY3zDWMO8w/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'So I have been to three dispensaries in Vegas can\'t remember the first off hand but I do know it was extremely over priced, second was Essence and I was very happy but Blackjack Collective, my third of three has to be my number one at least so far as I intend to try out other spots but Blackjack Collective will definitely be my go until further notice. Knowledgeable staff very friendly all around best so far!! Keep it up staff!! I am a med card holder from Colorado have not missed a day of smoking in over 5 years so I can say I know good product and so far best price.', 1523786099),
(2129, 475, 'dine2012native', 'https://www.google.com/maps/contrib/117390755927748065387/reviews', 'en', 'https://lh3.googleusercontent.com/-kVOXGGJgBQU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3QZCU96p_IuWbhc6BwOX7l5hiViw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', '1st time in yesterday, and it was an amazing. Friendly staff and good prices. the guy who helped us, Made sure we got all of the good stuff. He was very helpful and informative. I would recommend and come back to this place when I come to town or pass through Vegas again.', 1522679736),
(2130, 475, 'ahvasquez1420', 'https://www.google.com/maps/contrib/107955807122521646330/reviews', 'en', 'https://lh3.googleusercontent.com/-qKBoNmWl3Ps/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2K-n52LEIT__UuGcZctJoc5camKA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Went here for my first time a few days and going for my third visit soon. The staff is super friendly and helpful. They make your first time there a breeze everting is so easy. And their points system is definitely worth it!', 1526931757),
(2131, 475, 'Mark Stevenson', 'https://www.google.com/maps/contrib/108328220435618561185/reviews', 'en', 'https://lh3.googleusercontent.com/-c4c_Pa6QhqY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1McL8LDsRGr_5Th3_pESGwNhxR2A/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'a week ago', 'I really liked coming to blackjack, and have appreciated their staff, I work in Vegas often and was excited to come back. Unfortunately after getting a cartridge that was clearly wrong, not burned, nor a flavor profile that exists within cannabis but closer to metal and poison/earwax, and sharp enough to make me nauseous immediately. I planned to return this evening for more things but when calling in, was met with a definitive statement that I am wrong, and can not be helped due to it being purely “taste preferences” i have the entire cart still and intend to send it in for testing for contaminants. As much as I appreciate this place, them denying me assistance with a product they’ve provided that is potentially hazardous to my health, hast to lose my business. Any business that cares more about their inventory loss than a customer or potentially their health should not be supported, no matter my previous positive experiences. Extremely disappointed.', 1526698316),
(2132, 475, 'Jonathan Hall', 'https://www.google.com/maps/contrib/116495576472386595863/reviews', 'en', 'https://lh3.googleusercontent.com/-t5qjAleKk9E/AAAAAAAAAAI/AAAAAAAAAlo/Apw93MJ5EOY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'They always take good care of me. I appreciate this place being here. It\'s at a close distance to my place and good quality all the time', 1526274637),
(2133, 476, 'Alma Sanchez', 'https://www.google.com/maps/contrib/101990084697656476489/reviews', 'en', 'https://lh5.googleusercontent.com/-W3dlthRbJ-s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq16KAIPPhn8HOS263zzP3Xn4WvxoA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'I came here last year to get my medical marijuana card. The doctor showed up an hour late but I was seen and out within 5 min. Still sucked I had to wait a whole hour. Well now it’s time to renew my card so I’m back again. My appt was at 9:45am it’s now been over an hour and I’m still waiting to be seen. It just sucks they take forever!! :( but once you’re finally seen you’re done within 5 min. I’ll probably go somewhere else next year when it’s that time again. I don\'t have time to sit around all day waiting for something that takes 5 min. Also not mention the front desk girls always look pissed off and are rude. Not welcoming at all.', 1517856419),
(2134, 476, 'Bryan F', 'https://www.google.com/maps/contrib/110925390776666944713/reviews', 'en', 'https://lh3.googleusercontent.com/-k4_OnPES-0Y/AAAAAAAAAAI/AAAAAAAAFsI/71lZcBs89AM/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '9 months ago', 'Let me first say the women up front are world class. Top notch. Truly great at what they do. \nOn with the review. Expect to spend nearly 2 hours here for what takes no longer than 10 minutes. No exaggeration. So that alone just sucks. I\'m a return patient here and both my experience so here are exactly the same. The doctor  barely makes eye contact with you. The first time I was here I stood up to shake the man\'s hand he looked at me like I had two heads.  Then he sits at his laptop spouting off questions that only dealt with the legality of it all. No concern for me what so ever. Second visit same thing. World class service up front but a as usual sit and wait for nearly two hours for again what takes about 10 minutes.  Again the doctor could care less.Thankfully we\'ve gone recreational here in the Nevada so I won\'t have to deal with this again', 1502816779),
(2135, 476, 'Dan Soladay', 'https://www.google.com/maps/contrib/102824422441704541151/reviews', 'en', 'https://lh6.googleusercontent.com/--b0PcVEPmLI/AAAAAAAAAAI/AAAAAAAACkA/UZ_MN8gl2EY/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '5 months ago', 'Made an appointment for 2 on a Saturday when I got there they were closed when I knocked on the door a woman came to the door offered to make an appointment for me for Monday and give me a discount, when I showed up for my appointment I didn\'t get a discount but I was in and out in about a half an hour, the doctor I saw was professional not friendly but professional. The girls out out front we\'re both friendly and professional. Overall good visit.', 1513320935),
(2136, 476, 'John j', 'https://www.google.com/maps/contrib/115240490492113431242/reviews', 'en', 'https://lh5.googleusercontent.com/-v6AXH3V9aZM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2mrKdZPu3yUoXorQpc3lhORG7Ggw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Fred was extremely helpful and persistent and cares for people who suffer from ailments as I do. The doctor was very knowledgeable, card application put in friday night was approved sunday. Mail came next day. Monday. Great service!!!', 1513663735),
(2137, 476, 'Brent Calvin', 'https://www.google.com/maps/contrib/110997724118619651511/reviews', 'en', 'https://lh6.googleusercontent.com/-h5KBLljDU-k/AAAAAAAAAAI/AAAAAAACxXg/XB7HPtXMBR0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'First time here.\n- I use a cane; the staff took the time to walk me to a seat and explain the process their rather than have me stand at the desk.\n- We wanted our child to stay in the car (the place was clean and child friendly but she was in a mood).  The staff insisted that they go out to have her sign the Primary Care Giver information.\n- The staff periodically checked on me and offered water and noted where the bathroom was.\n\nI have never experienced such staff as those at Dr. Green Relief.\n- I brought thorough medical records so the my time with the Dr. was quick and easy.\n- Every question I had was answered.', 1491083895),
(2138, 477, 'Cyber Sell', 'https://www.google.com/maps/contrib/116590300948007224279/reviews', 'en', 'https://lh4.googleusercontent.com/-QwfY3MiehOw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0FrYTWfCUTYNlIqDxh9XnN9hUXkw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Doctor Price is an exceptionally intelligent, compassionate and caring Physician. My experience with her and the Staff of Paradise Clinic was professional as well as comforting. Having suffered from several medical conditions requiring multiple medications after my experience with Dr. Price I am finally able to be prescription free as well as my friend who also saw Dr. Price on the same day and is now off all of her Opiates and other Pain medications using only Marijuana Medicine. Thank you Dr. Price for being there for us and for Las Vegas.', 1517353019),
(2139, 477, 'Luis Pena', 'https://www.google.com/maps/contrib/114735394670260438950/reviews', 'en', 'https://lh4.googleusercontent.com/-RitKJiUdvxo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Px35vRW3NjfG5LFvwsjwCBmaG5Q/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'Paradise clinic is the place to go! Very reasonable pricing, don\'t go to Dr. Reffer for your medical card needs! Come to Paradise clinc instead where they take care of you', 1522193265),
(2140, 477, 'Wayne Scott', 'https://www.google.com/maps/contrib/101896569489455866937/reviews', 'en', 'https://lh5.googleusercontent.com/-1_nfkTiVUp4/AAAAAAAAAAI/AAAAAAAAAnU/S1W-bfeeR6Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'My original cannabis doctor closed his practice (after I saw him twice) & referred me to Dr. Carolyn Price at Paradise Clinic on So Rainbow. \nOn the day of my appt, I completed several pgs of new patient forms which took quite a few minutes to finish. I then paid $140 for the office visit.\nThere were 3 ladies behind the front counter. I had no idea if any of them were the doctor.\nOne lady had me follow her to the first office. Turns out, she was the doctor but never introduced herself so initially I thought she was a clerk. She very briefly glanced at my patient file & asked if I needed a state-approved Cannabis Card. \nI explained that I already had a state card, but needed guidance on weaning off opioid medications onto cannabis-based products for chronic back pain. \nShe told me she only helped patients obtain their state card & I would have to seek guidance from my pain doctor.\nI explained that my pain doctor had sent me to her for that & I was a novice in the field of cannabis treatment & needed guidance to get off opioid drugs.\nShe stood up & told me to email her with my progress in 6 months & walked me out.\nIt took me longer to complete the paperwork than the mere moments I was in her office.\nI attempted to ask her questions but was brushed off & walked to the door. I was in shock. It was a very expensive few minutes & I walked out with nothing but frustration for my trouble.\nDr. Carolyn Price AND Paradise Clinic were a complete ripoff & waste of time. \nWhen Lauren called from Paradise\'s office for my 6-month checkup & I explained why I was so unhappy with the service I received, Lauren insisted that a Dr. Carolyn \"always\" spends at least 45 mins with each new patient. She made me feel like she suspected me of lying about my quickie & ineffective appt.\nI\'m still seeking a cannabis physician to help me with my pain.\nUnfortunately, Dr Price & Paradise Clinic are ZERO help.', 1515539725),
(2141, 477, 'Mark M', 'https://www.google.com/maps/contrib/107922930203635840981/reviews', 'en', 'https://lh6.googleusercontent.com/-l1B3KY8F_3Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2O0LI9mkRJ7EmlM4RpqRyymOL9oQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Great Experience! All the office staff was so nice and friendly. I would recommend this business to everyone.', 1501801969),
(2142, 477, 'Mark Romero', 'https://www.google.com/maps/contrib/105415039590180893160/reviews', 'en', 'https://lh3.googleusercontent.com/-RaZROkSTbUg/AAAAAAAAAAI/AAAAAAAAAio/e0rLUfvU2GY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Best Clinic in Las Vegas. I have used Paradise for my initial medical marijuana approval and now for my renewal. The Doctor is very caring and knowledgeable. She provides great suggestions and really cares about her patients. I went to Paradise for my initial appointment a year ago and now for my renewal last week. I was able to get a same day appointment and get my approval letter very quickly. I highly recommend anyone looking for medical marijuana to use this clinic. It\'s the best! I will use Paradise for all my future renewals. Thanks Doc!', 1479412804),
(2143, 478, 'sandra moreno', 'https://www.google.com/maps/contrib/113670175507423347093/reviews', 'en', 'https://lh3.googleusercontent.com/-NajU8V3s7Rc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1JZQV2ltqzL1Fl9y4zWiCIoz8h1g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Excellent staff excellent service I LOVED MY EXPERIENCE HERE I GIVE THIS PLACE 2 THUMBS UP', 1524275623),
(2144, 478, 'brandon d', 'https://www.google.com/maps/contrib/110025468861616434364/reviews', 'en', 'https://lh4.googleusercontent.com/-VoZdC_uVU04/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3uq6gGjO6xFzwGTglp56DMG1k7dg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'They were great, very friendly informative and helped me get what i wanted in no time. Thanks Dr.Reefer', 1510613763),
(2145, 478, 'Eli D', 'https://www.google.com/maps/contrib/117722951232532142400/reviews', 'en', 'https://lh6.googleusercontent.com/-hgRA5jOvcyM/AAAAAAAAAAI/AAAAAAAAACY/FEaIzA23Mec/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'Great service! Loved the atmosphere, very professional. I am so going back for my renewal and I highly recommend it!', 1497329231),
(2146, 478, 'Eric Roy', 'https://www.google.com/maps/contrib/107668752220761709789/reviews', 'en', 'https://lh6.googleusercontent.com/-Ysxqu1xzaeY/AAAAAAAAAAI/AAAAAAAAAKQ/eqcBoPgCHsA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'This group is excellent.  Excellent customer service.  I don\'t hesitate to refer clients over to this group!', 1497463745),
(2147, 478, 'kinky squirrel', 'https://www.google.com/maps/contrib/102228947573035199563/reviews', 'en', 'https://lh4.googleusercontent.com/-WOVQCocAvNg/AAAAAAAAAAI/AAAAAAAALQw/Va8yNPLj3wM/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 1, 'a year ago', 'your receptionists is very rude. Huffing when some one has to cancel because they are geting a raging migraine is a terrible thing to do to a patient. further more when she walks into the lobby to give someone else their paper work, looking you up and down and asking if they are pregnant because i have a tummy, in front of the whole waiting room is embarrassing. i have a medical condition that deposits fat in my abdomen, there is nothing i can do about it. as you may imagine i\'m extremely sensitive about my medical condition. she hand ample time to ask me in private, when she took me in a room to ask about my reason for coming.\nit was extremely hard for me to build up the courage to go to your facility. the stigma of going some wear and admiting you need something that not to long ago would land me in jail is hard. i dont need to be demeaned by they staff who is supposed to help me.', 1492712515),
(2148, 479, 'Joseph Turner', 'https://www.google.com/maps/contrib/111049941275127018219/reviews', 'en', 'https://lh3.googleusercontent.com/-AUTk4tkrqhc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1DW3h0IqcZIeU5YGRX_JM5lyw_6A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'Tried calling for four days left several messages with no call back. Kept calling and finally got someone on the line and was told to call back tomorrow. What?  Call back the next day leave another unreturned voicemail and after calling another 5-6 times I finally get an answer. When I try to schedule a Saturday spot they tell me they don\'t have any doctors available then. They offer to setup a teleappointment for me tomorrow. I asked where their drs are located and if they have a dr I can see in person. They don\'t know where their drs are located and don\'t offer in person appointments any longer.  I had come here for the last three years and they have now lost my business.', 1487892643),
(2149, 479, 'Ben guzman', 'https://www.google.com/maps/contrib/116320222789083256209/reviews', 'en', 'https://lh3.googleusercontent.com/-DIcUiAgOGas/AAAAAAAAAAI/AAAAAAAAAAA/Uyubv1rvpB0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'Everyone that works here is very friendly and professional. The office is neat and clean!', 1435077102),
(2150, 479, 'Aareis Love', 'https://www.google.com/maps/contrib/108220630798958005892/reviews', 'en', 'https://lh3.googleusercontent.com/-CDc8a_moDr4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2gXOk1MQgwc6GFI-tw0YqfJ5Ewzg/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a year ago', '', 1484172824),
(2151, 480, 'Yakama Tom', 'https://www.google.com/maps/contrib/108011905142433888388/reviews', 'en', 'https://lh3.googleusercontent.com/-JxGpnG96Xow/AAAAAAAAAAI/AAAAAAAAALQ/DV1KjU4jwf0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This clinic takes the pain out of applying for (and renewing) MMJ licenses. Friendly staff, awesome doc, great pricing. Highly recommend!', 1522526102),
(2152, 480, 'Chloe Sarai', 'https://www.google.com/maps/contrib/100319129909273996043/reviews', 'en', 'https://lh5.googleusercontent.com/-8QrtvZSMV2Y/AAAAAAAAAAI/AAAAAAAABBI/mR6qnzEUE40/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Posted on Yelp, so you know I was really happy with my experience. Best place ever. I was in and out as far as paperwork. I spent more time talking. I made an appointment same day and it wasn\'t crowded during the time I went in.  Everyone is so informative and really cares about the issues. From start to finish, all of the guys here were welcoming and really listened to what my problems were and recommended great treatment.The owner was there and even chimed in and made the experience very personable so that my nervousness dissipated. The man at the front desk handled my paperwork in a timely manner and then broke down everything step-by-step. The doctor was even better and some with me a bit about things I could do or things that would help. He was also a cool cat. I\'ll definitely continue to use this company in future. Yeah, it\'ll be legal soon, but I\'ll always keep my card. Definitely the doctor and medical center to use. Thanks, guys!', 1480054455),
(2153, 480, 'Carina Robinson', 'https://www.google.com/maps/contrib/108095082599308188277/reviews', 'en', 'https://lh3.googleusercontent.com/-kZTLr53ngaY/AAAAAAAAAAI/AAAAAAAABz8/zE6pTwcZaZg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'CMC\'s MMJ patient registry services are TOP NOTCH and executed swiftly at the front desk. This is a marvelous place with professionals that guide you to a better understanding of the plant and how to consume the medicine. I was happy to see a cheerful, compassionate, caring, good looking physician ready to talk & walk me through the recommendation process. Prices are spot on for the services included! Not sure why anyone would ever use another service. I couldn\'t be happier. Thank you!', 1480459359),
(2154, 480, 'Erik Wunstell', 'https://www.google.com/maps/contrib/115915503981016878697/reviews', 'en', 'https://lh5.googleusercontent.com/-Vht_3fNG8XA/AAAAAAAAAAI/AAAAAAAABgo/j3NYfqld1yQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I was so impressed by the staff and their understanding of my situation and their efficiency in helping me and then getting things properly completed. This is a comfortable place with truly nice people.', 1484728898),
(2155, 480, 'K O', 'https://www.google.com/maps/contrib/106108599519377481410/reviews', 'en', 'https://lh4.googleusercontent.com/-hCqOVbzL824/AAAAAAAAAAI/AAAAAAAABXI/Rs-ofeuYlDM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'For 4 weeks I\'d been trying to renew my card ..\nMy license is about to expire tomorrow..\nThe people here \nHelped me through the process \nSo easily ..\nThank you so so much ', 1492033452),
(2156, 481, 'Margaret Reinhardt', 'https://www.google.com/maps/contrib/111742689288977110134/reviews', 'en', 'https://lh6.googleusercontent.com/-1gtR2c5P1xQ/AAAAAAAAAAI/AAAAAAAAAB0/pydVBHc-eD4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'The Dr. and staff are very friendly and professional. I\'ve been to others and this place is the best. The Dr. is well aware of the valuable medical benefits of cannabis. No long office wait either.', 1513700687),
(2157, 481, 'Jason Frost', 'https://www.google.com/maps/contrib/107609817097104422772/reviews', 'en', 'https://lh3.googleusercontent.com/-I49eFehjahc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3pOVBZnD6ZTtYZtIDC1XOkxrxnvQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Absolutely hands down the best place to go in Reno area.', 1524180721),
