(2159, 481, 'james murray', 'https://www.google.com/maps/contrib/111272681038096596554/reviews', 'en', 'https://lh3.googleusercontent.com/-OPynzgXLOtI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3a65grbjT-OdZnEk14kN6N9lS_qQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Made it easy and fast. Staff was very helpful.', 1492787259),
(2160, 481, 'Dustin Assad', 'https://www.google.com/maps/contrib/102216482184262222289/reviews', 'en', 'https://lh5.googleusercontent.com/-mSMwMo_w7zI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2PcalljhbAp6Y0H3JLJUMywUQIrQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'This is where you want to go if you need help with the process. The young lady that helped me was very patient, and the doctor came back to see me after he had already went home for the day. I had been through so much that day, and I drove to Carson twice. I could not believe the doctor was nice enough to circle back to the clinic to see me. I cannot imagine that happening in a traditional medical clinic. This is by far the best place to get your medical card.', 1472316135),
(2161, 482, 'MikeY T', 'https://www.google.com/maps/contrib/107940015574667119660/reviews', 'en', 'https://lh4.googleusercontent.com/-gyV1wk7r7pg/AAAAAAAAAAI/AAAAAAAAJAY/XSLajTUm3VM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, '3 weeks ago', 'Needed pills cause of torn rotator told me get aspirin at raleys', 1525497053),
(2162, 482, 'Stacy Slazas', 'https://www.google.com/maps/contrib/118355136085258405552/reviews', 'en', 'https://lh5.googleusercontent.com/-UC9IkOXiPBs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1DxHZSni0qpSO7F4TUP3NInDAckQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '9 months ago', 'I now have a screw in my finger due to my assault and robbery by the owner of Kind Releaf Brian Van Lier, 6 weeks of hell and trauma. He doesn\'t care. he sends me texts laughing about it. He found me right outside his office door and did this to me. At 6:15 PM when all the other businesses were closed. I had one of his customers reach out to me to tell me Brian has always been rude and a jerk to him. Do not bring business to this place, he is a horrible person!!! He posts about rape and degrading women all over his facebook.', 1502215103),
(2163, 482, 'Amber Couch', 'https://www.google.com/maps/contrib/110888316948629657566/reviews', 'en', 'https://lh3.googleusercontent.com/-HK9rJkX0BjQ/AAAAAAAAAAI/AAAAAAAAP1w/LGuvyr7ntKQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '10 months ago', 'This gentleman ripped my disabled mother off. He knew she was on a fixed income and gave her fake paperwork and took her money. Shame on him. She is now stuck with out her medical card and has to pay more money for someone else to get her legal. Be very aware of this man Brian.', 1501784883),
(2164, 482, 'Abraham Roberts', 'https://www.google.com/maps/contrib/114960495876362216454/reviews', 'en', 'https://lh6.googleusercontent.com/-8IgXtbNHT0s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0MfTD4OW3yOueM2DQWwwbSPw-XuA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'These guys are really caring.   The transportation was quick and easy.  Brian totally helped me all the way.   Definitely recommend.', 1490925727),
