(2166, 483, 'Ed Schwartz', 'https://www.google.com/maps/contrib/113347399801250091730/reviews', 'en', 'https://lh6.googleusercontent.com/-4kUHL_RWMvk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2wkcR98WaLtpShtuP-0dF224Kugw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 years ago', 'NO CARD AFTER 3 1/2 MONTHS. Sept. 23 2104, I paid Ultimate U medical $180 to submit my medical application. The check was cashed 13 days later. I will never see my card or my $180. Good luck trying to speak to a office manager as they don\'t return emails, phone messages and/or calling the office directly. Be prepared to be put on hold for an afternoon or just plain hung up on. I got through once (after many unsuccessful attempts, I think it was nine) pleading to the receptionist to get my health care provider to answer the damn phone. I was given a phone number in Carson City to call and as a passing of the buck and any blame. THIS COMPANY IS A SCAM. STAY AWAY.      Your local dealer is cheaper anyway.', 1420312231),
(2167, 483, 'William Geller', 'https://www.google.com/maps/contrib/103244675599883572954/reviews', 'en', 'https://lh3.googleusercontent.com/-Xj6bJ1neGtk/AAAAAAAAAAI/AAAAAAAAABo/nrGQwSBZDYo/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 years ago', 'I have been going there for five years for my medical card and have never had a problem with there services.and my the Doctor answers all my question ', 1450381441),
