(2173, 486, 'Luke Haruki', 'https://www.google.com/maps/contrib/115090276411936715629/reviews', 'en', 'https://lh6.googleusercontent.com/-IY1NkDdhwzE/AAAAAAAAAAI/AAAAAAAAAFM/kBzjw0qt7Ow/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg', 5, 'a year ago', '', 1479943378),
(2174, 487, 'Jim C', 'https://www.google.com/maps/contrib/115083200419918662547/reviews', 'en', 'https://lh3.googleusercontent.com/-ZisZeU-H_ZI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1SuwbXvMu4skdSJvaHjFK3JnG3yw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'DON\'T FALL INTO THE TRAP OF HAVING TO WAIT A MONTH OR MORE FOR YOUR FIRST VISIT AFTER RECEIVING YOUR MEDICAL CARD. PRIME MAKES IT SOUND LIKE YOU HAVE TO HAVE A MANDATORY CONSULTATION BEFORE YOU CAN PURCHASE PRODUCT..THIS IS NOT STATE MANDATED... PRIME IS MAKING PEOPLE SUFFER ADDITIONALLY BY MAKING THEM WAIT TO PURCHASE PRODUCT...THIS SHOULD BE A CRIMINAL ACT....CHOOSE ANOTHER DISPENSARY....I KNOW FOR A FACT THAT THERE IS NO WAIT AT SANCTUARY ATC....', 1527194973),
(2175, 487, 'Glenn Horner', 'https://www.google.com/maps/contrib/106771334170337316220/reviews', 'en', 'https://lh3.googleusercontent.com/-gW38vzsl6fk/AAAAAAAAAAI/AAAAAAAAABk/2Im1ws5q4uI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I had an enlightening interview with one of the staff on my initial visit learning a lot about the many components of cannabis and how they provide therapeutic value to the patient.  A great experience and looking forward to my next visit.', 1516837108),
