(2177, 487, 'Bernice Demers', 'https://www.google.com/maps/contrib/117119336968524156098/reviews', 'en', 'https://lh5.googleusercontent.com/-itMCFrCk-o8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3zd3CXEfrmwNsj2mrN8ivFVURqsQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Very kind and helpful great people here always willing to help me I feel at home here thank you guys ', 1514070239),
(2178, 487, 'carl winslow', 'https://www.google.com/maps/contrib/106085880735733664135/reviews', 'en', 'https://lh3.googleusercontent.com/-Q94rya-JdLQ/AAAAAAAAAAI/AAAAAAAAACE/WrKaADa03k4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '5 months ago', 'Very good product and the staff is amazing. Prices are out of control. 50$ for a half gram of shatter is not necessary. It\'s 60$ a gram for premium on street', 1512239308),
(2179, 488, 'C Moore-Vissing', 'https://www.google.com/maps/contrib/108202021044266637844/reviews', 'en', 'https://lh5.googleusercontent.com/-zBPgNyeimoQ/AAAAAAAAAAI/AAAAAAAAAMs/gX1Z33GqxGc/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 months ago', 'Incredibly friendly and comforting experience. I was very nervous at the beginning, I didn\'t know what to expect, and was amazed at how knowledgeable and professional (not aloof/cold, but serious about healing) the staff is. I believe that it is literally a \"wellness center,\" not a head shop or a casual dispensary. While you\'re free to choose whatever strain, edible, or other delivery method you prefer, I found that consulting with them to be dead-on in terms of the desired treatment. Their proprietary/in-house strains have had a better effect on my symptoms than more mainstream \"brand-name\" strains, not to complain about the quality of the better-known ones, but to say that Temescal really is working on the whole spectrum of what the plant is capable of providing in a medical sense.', 1519343467),
(2180, 488, 'Colby DuPont', 'https://www.google.com/maps/contrib/103150190694919110077/reviews', 'en', 'https://lh5.googleusercontent.com/-Mg5bebOQ3b8/AAAAAAAAAAI/AAAAAAAAAHA/Udcv8MPu69Q/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 months ago', 'Temescal Wellness makes sure patients get what they are looking for. From customer requested products that suit your medicinal needs, or simply just taking the time to make sure you leave feeling like you didn\'t forget anything. The staff is kind, empathetic and generous as well as the patients I have conversed with in the waiting area. Temescal is constantly growing, breaking ground, and making leading connections in the Medical Cannabis Industry. Thank You Temescal!', 1519575042),
(2181, 488, 'j fowler', 'https://www.google.com/maps/contrib/108537233794187619083/reviews', 'en', 'https://lh6.googleusercontent.com/-QP4njemxR88/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Lkp0TjNiTeSivf2r0VoUN9tAV_w/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 3, 'a month ago', 'They have great medicine. I just wish it was a little more affordable.', 1522633994),
(2182, 488, 'Michalene Perreault', 'https://www.google.com/maps/contrib/109264785149388129530/reviews', 'en', 'https://lh5.googleusercontent.com/-o_XlOmECGGU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0s3Cx3mkRvRMhEoJVEKe8awLSnpw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Today was my first visit, and I am so so glad I finally went. I have alot going on, and I have constant pain. The staff there was extremely welcoming, and very helpful explaining products to me.', 1520123674),
(2183, 488, 'Dolores B', 'https://www.google.com/maps/contrib/102074969361704031407/reviews', 'en', 'https://lh4.googleusercontent.com/-4_Wgv6teJdY/AAAAAAAAAAI/AAAAAAAAAF4/5pso_xzHkNw/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 weeks ago', 'They are often out of the products I use most. It is very disappointing when I count on them for my pain relief and New Hampshire state law does not allow you to go to any other location.', 1526167525),
(2184, 489, 'Jeremy B', 'https://www.google.com/maps/contrib/108636615449464782696/reviews', 'en', 'https://lh3.googleusercontent.com/-emxLDjXujW4/AAAAAAAAAAI/AAAAAAAAATk/nXu5Ckox-lQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'A very good thing for NH - excellent selection and caring staff. Admittedly a surreal experience. Hope to see more locations southwards...', 1522217675),
(2185, 489, 'Patticia Sebilian', 'https://www.google.com/maps/contrib/110530688294967321119/reviews', 'en', 'https://lh6.googleusercontent.com/-chx0tol2Eck/AAAAAAAAAAI/AAAAAAAAsOU/3gLY-WynwgU/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 weeks ago', 'A wonderful and helpful group of people assist you with the best products and selections for all that ails you', 1526152075),
(2186, 489, 'Jonathan Moulton', 'https://www.google.com/maps/contrib/110898110473890557179/reviews', 'en', 'https://lh4.googleusercontent.com/-mnKUETMy5NE/AAAAAAAAAAI/AAAAAAAARW0/tY5bWEjuIsE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '6 months ago', 'Excellent friendly and knowledgeable staff, large selection of products. Discounts for the disabled and sale events almost daily. The only problem is finding a doctor who will help instead of getting in the way. Might be helpful to contact sanctuary for a doctor referral.', 1511310544),
(2187, 489, 'Tonja Hibbard', 'https://www.google.com/maps/contrib/111902297463234997601/reviews', 'en', 'https://lh4.googleusercontent.com/-X2Xzsz8v1Dc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1bl2YiZP1dcp3KOoXyV1e6p-8FNg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The staff there is awesome so caring and friendly.', 1526926419),
(2188, 489, 'John Ash', 'https://www.google.com/maps/contrib/116786450608725335157/reviews', 'en', 'https://lh6.googleusercontent.com/-KJgaF2jSTEY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1s9qAkqAdmJ5qiTgTM1fYI1M39Gw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'I have been going here for about a month. Every time I go in everyone is very pleasant and willing to help. I was there last week and if I remember correctly I was helped by David. I have been trying to learn as much as I can from the web about different things that may help relieve my pain. He told my they were trying patches and I got some to see how it works. I haven\'t slept an entire night due to discomfort for many many years. After I took a shower Wednesday night I had my wife put a patch on the worst spot on my back. Wednesday was the first night in a very long time that once I went to bed and fell asleep I never woke up until my alarm went off. I used another one last night and got 2 great nights sleep. Not only did I sleep great my wife was able to sleep because I wasn\'t rolling around all night long. I will be getting more today for sure if available.', 1506707091),
(2189, 490, 'Heather Castor', 'https://www.google.com/maps/contrib/106225755896140332504/reviews', 'en', 'https://lh6.googleusercontent.com/-z38kYlUd0SQ/AAAAAAAAAAI/AAAAAAAAJL0/5nuE09lVLqY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'Awesome staff so welcoming paitent and understanding. All products are awesome just bring as much cash as you can. The products are pricy but worth it because the product is amazing. Can\'t wait to visit again!!!! Such a great experience.', 1526835857),
(2190, 490, 'Victoria M.J. Read', 'https://www.google.com/maps/contrib/113311663298140710672/reviews', 'en', 'https://lh5.googleusercontent.com/-wgw9iWKhERI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2zDWA_zLaOWSZjJGi3vPAYORBpfw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 weeks ago', 'Great place!  Good, caring staff.\nAnd Phil is the best!!', 1525467930),
(2191, 490, 'Jaclyn Cole', 'https://www.google.com/maps/contrib/112380952446598304325/reviews', 'en', 'https://lh3.googleusercontent.com/-s4vR8OzQhro/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1-KPB1rYTt2pjN_eyPk9xWavJi2A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'The Staff here is AMAZING! Very knowledgeable & helpful.', 1527727892),
(2192, 490, 'Beth Grenier', 'https://www.google.com/maps/contrib/112178610546331268044/reviews', 'en', 'https://lh5.googleusercontent.com/-c2_8c0bLIgY/AAAAAAAAAAI/AAAAAAAAAAU/PBcL_p7zSno/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'I\'ve been going here for almost a year,99 percent of the staff are great. There is one in particular who is just down right awesome and kind and unbelievably helpful...They have gotten better with they\'re product and supply. If  I had anything I would change is to be open on more days! Thank you too all the staff.', 1512518770),
(2193, 490, 'Ernest Rae', 'https://www.google.com/maps/contrib/116630164300126609577/reviews', 'en', 'https://lh4.googleusercontent.com/-XESqU2J5jkU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0J3Ax2k50hH00xE5NJkk6tWpRzXA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Just wanted to thank the staff at wellness in leb. Today was my first visit. And boy I was amazed at just how it seemed like a Dr office. You guys were so respectful of my needs. Special thanx to poor Lorie who helped me out. As she filled me in on so much I never knew. Lori was picking up on me and my needs as far as dosing ect. ect. Thank you evrybody. Now I can cut some meds out witch are killing me.. Love yall. Thanx for such respect and nice crash course in vaping. Never did it before. Point. Thank you guys for all you do for others in need. Keep up the GREAT WORK. see you in a wile. Thanx', 1515196971),
(2194, 491, 'Adrianna O.', 'https://www.google.com/maps/contrib/118208246158319444758/reviews', 'en', 'https://lh5.googleusercontent.com/-EgbYANXzuBg/AAAAAAAAAAI/AAAAAAAAB9E/puQFODgovlY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'I highly recommend this office!! The staff and the dr are highly supportive and very caring and compassionate. Appointments are recommended. The best place I’ve been and I’ve never evvvver felt judged or thought of differently. I love the doctors,I started here and I was one of the first to transition to new office!!', 1525314138),
(2195, 491, 'Ang Moulton', 'https://www.google.com/maps/contrib/113646915214398186081/reviews', 'en', 'https://lh5.googleusercontent.com/-nLTqGR9jgFQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1gV2m0txswMs9qfPx5c85EqKHFTw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Excellent care very professional but also a feeling of home,in the matter of comfort and outstanding interaction with all staff. I\'m very satisfied with my change of care! I highly recommend this place to all who would be interested...', 1482266453),
(2196, 492, 'Lisa Inglese', 'https://www.google.com/maps/contrib/116591309506261952617/reviews', 'en', 'https://lh6.googleusercontent.com/-3WNwfTSqwSo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1OIh6gOgFvyyWCazs9QVOFdn1DcA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'Lisa was great in terms if the work she does to advance cannabis use.\nThe office and staff were terrible. Misinformation more than once and now it has cost me my card. \nI recommend finding another Dr.', 1515509445),
(2197, 492, 'Joshua Winsor', 'https://www.google.com/maps/contrib/107531274078384508409/reviews', 'en', 'https://lh4.googleusercontent.com/-yJjwzUY17e0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2lZMl1HEv2k86QALM98N5vix5jBQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '9 months ago', 'extremely unproffessional. the owner, paul, was extremely rude and unhelpful, even raising his voice and being crass with me on multiple occassions. not a business that i would ever suggest going to. they are not compassionate, they are not caring, and all they want is your money.  there practice is not about pain management or a greater quality of life, its about taking advantage of the newly created medical marijuana program, and that is all.', 1504019157),
(2198, 492, 'Andy Trinh', 'https://www.google.com/maps/contrib/102157577093026450263/reviews', 'en', 'https://lh6.googleusercontent.com/-EtanleKizxk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0LCme6a_vzAHvuJAkIq1d3egEUqQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Lisa is the best and most of all, an Empathetic Dr, Paul is a fantastically caring receptionist.  All around an awesome medical office. I\'d never hesitate to refer everyone here', 1483630447),
(2199, 492, 'Mariel Button', 'https://www.google.com/maps/contrib/110455380708609651527/reviews', 'en', 'https://lh4.googleusercontent.com/-D_YN5iKFMHg/AAAAAAAAAAI/AAAAAAAACXE/bG8Q8vjKObI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'Except for the women who hung up on my through answering service, probably assumed I was done, but I adore Lisa and the staff so much!', 1505391370),
(2200, 492, 'J Kamitses', 'https://www.google.com/maps/contrib/109488042819690270271/reviews', 'en', 'https://lh4.googleusercontent.com/-7-yisz-O5W4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq35puZI7htMyvyc3smXe6BXeQaJrQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', '', 1520788524),
(2201, 493, 'Chris Carbone', 'https://www.google.com/maps/contrib/102113596215133777554/reviews', 'en', 'https://lh4.googleusercontent.com/-2yBn99L_EBk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1pYBk0RR1e-hcg_XCy3sI6q6DRew/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'I\'m so glad I came here, I was helped out by John who made me feel very comfortable and answered all my questions. The different strains and what would be best for my condition.  It was very knowledgeable and help me find the right medicine for me. Did a great job,  The place was great had everything you needed from paraphernalia to silicone  pipes.. And the best medicine for me can\'t wait to come back and try some new strains...', 1525731359),
(2202, 493, 'tyler pearlingi', 'https://www.google.com/maps/contrib/113721234491498681883/reviews', 'en', 'https://lh3.googleusercontent.com/-VfrvRivct5o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq29nPEMhyW7FlxPX8Wq3lkLVhbq3g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'High quality buds and competitive prices. I highly recommend the Atlantic sunrise or bubblegum.  Niko gave me the orientation and could not have been for informative. This was a great experience and worth the almost 2 hour drive', 1524761181),
(2203, 493, 'Mark Bauer', 'https://www.google.com/maps/contrib/111835420491430676023/reviews', 'en', 'https://lh4.googleusercontent.com/-ad_aibxNFKk/AAAAAAAAAAI/AAAAAAAAAY0/BL25xCPrfrA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Awesome dispensary! Beautiful, clean, private atmosphere with a good selection of a variety of Strains. A bit pricey however it is well worth it! A little bit goes A LONG way! Great stuff!!! Highly recommended!', 1526577716),
(2204, 493, 'The Original WHIPSNAY', 'https://www.google.com/maps/contrib/102615308018191757077/reviews', 'en', 'https://lh3.googleusercontent.com/-HWMtURKlO30/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq13LnCyub0BkGRNG54SPENUi6rEPA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 3, 'in the last week', 'Good place if you like flower or shake. They don\'t offer any other products. Most of the staff has no clue when asked questions like when asked how to clean screen in bud breaker I was told to use a knitting needles.', 1527555383),
(2205, 493, 'marc stein', 'https://www.google.com/maps/contrib/107977087083551296258/reviews', 'en', 'https://lh3.googleusercontent.com/-ZAcuuZV7IJw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0UwH62pExGavrLH5L9Z6kDe1U0TQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great staff and great product. Prices are a little on the high side . If I lived closer then 2 hours I would make this my primary dispensary . The councilor Niko was very informative and knew what he was talking about . Highly recommended', 1524852832),
(2206, 494, 'Traci Galante', 'https://www.google.com/maps/contrib/115977539639162364853/reviews', 'en', 'https://lh3.googleusercontent.com/-ClQTlJmjKgg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq34RbrvtWf0zDUm9sBlWxwUFfDlPQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'A very nice experience!! All of the Breakwater staff are helpful, respectful and kind. If you\'re new to ATC\'s & feel silly asking questions at first, the Breakwater team will completely set you at ease. They have a wide variety on their menu, and everything you\'ll need to get started in their display cases. They are always getting new things in to try and they have an impressive blown glass stock as well. It\'s the classiest head shop I\'ve seen to date- very professional!! Keep up the great work Breakwater team!!!', 1523394343),
(2207, 494, 'Thomas Aurora', 'https://www.google.com/maps/contrib/110295258228759507377/reviews', 'en', 'https://lh4.googleusercontent.com/-CthY8nQLovE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3xL3zNQla3hXdqGC9HnXt5L0akFw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, 'a month ago', 'People that work here are great and helpful.  They have just about everything you need.   Just wish they had edibles and the vape oil.   That would be awesome but of course they don\'t have it.   Not sure why Jersey won\'t let them carry that stuff makes no sense.  I definitely recommend this place.  Wish I worked there.', 1523559631),
(2208, 494, 'Jon Abel', 'https://www.google.com/maps/contrib/113604291917402074610/reviews', 'en', 'https://lh6.googleusercontent.com/-b0-5ztgHvr8/AAAAAAAAAAI/AAAAAAAAAD0/5p7YaFcO7iY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'in the last week', 'Best in the state! I have been too all 5 dispeneries and by far their products superior to all others. You can see, smell and taste the difference. The quality is A1 all others c-', 1527181288),
(2209, 494, 'mike k', 'https://www.google.com/maps/contrib/106392830009587344732/reviews', 'en', 'https://lh3.googleusercontent.com/-7-blYyvRA4I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq39YTyrnk56-8cZM4Jn0W0STFBmvg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great place to get your medicine . you can tell the cannabis is grown with care  and is persistent  from batch too batch . the quality  of the strain  almost never varies  from the label  or the previous Harvest With a friendly attentive staff that are knowledgeable and patient with your questions. And will try to help you to the best of their abilities figuring out the right strain for your ailment. \nWith a clean & calming environment.its not about the business to them its about there customers care Book an appointment or walk \nI normally do walk ins and I\'m out within 5 or 10 minutes . been going for years and never had a bad visit or bad medicine. you won\'t be disappointed', 1522524123);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(2210, 494, 'Steven Torres', 'https://www.google.com/maps/contrib/110801298987158717076/reviews', 'en', 'https://lh5.googleusercontent.com/-nWPfwdDZghI/AAAAAAAAAAI/AAAAAAAAARg/yy0iIrXoSFY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Today was my first visit to Breakwater, very professional staff, felt comfortable n welcomed. I had the opportunity to express myself with a listening staff. They  educated me with all the patience in the world. I had alot of quetions. All answered, I feel they to will see me again. I would like to Thank the Staff publicly.', 1527005694),
(2211, 495, 'Gary bartnicki', 'https://www.google.com/maps/contrib/108198999716877864681/reviews', 'en', 'https://lh4.googleusercontent.com/-J41patsiQ_Q/AAAAAAAAAAI/AAAAAAAAAEk/BqponLIXt-g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Thank God for Alternative Medicine. My wife is very ill and when they saw this they moved things alone so very quickly. I am so grateful to them, every single person in the office was so professional, kind and courteous. Both Michael Senisch, PA-C and Doctor Medvedovsky treated is with so much compassion and gave us tons of  information before we left. We  left there with a new sense of hope. Thank you so much for all that you did to help us.', 1522597193),
(2212, 495, 'Dennis Jefferson', 'https://www.google.com/maps/contrib/104475069749519722968/reviews', 'en', 'https://lh6.googleusercontent.com/-bSYyugQULQ8/AAAAAAAAAAI/AAAAAAAAALU/wUlZnO6jdtU/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '6 months ago', 'I have received a high level of quality assistance with each employee I\'ve worked with at this establishment. Everyone I\'ve spoken with here seems well educated in this business. The office is a busy place yet everyone was patient and attentive. I\'m really glad that this specific location, in Turnersville, is the first office opened by Alternative Medicine, it is a well run operation.\n\nThe education session however could have been better. I would like to see a more comprehensive package of educational materials given by the staff. Specifically, more information about the various methods of ingesting the medicine is needed, providing advantages and drawbacks to each other. Additionally, I thought the education class could have lasted longer and the Power Point slides could be better, more detailed and more informative.', 1511992078),
(2213, 495, 'Jeffrey Cann', 'https://www.google.com/maps/contrib/113396864437605052869/reviews', 'en', 'https://lh4.googleusercontent.com/-9qz5QrnIItQ/AAAAAAAAAAI/AAAAAAAAADk/lVcQQ3E0Q9Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This whole process and experience for me was smooth and painless. I had great support from all angles. Great practice', 1524682187),
(2214, 495, 'Mallory Hansen', 'https://www.google.com/maps/contrib/103218691650523088994/reviews', 'en', 'https://lh3.googleusercontent.com/-vIVCJrtGirQ/AAAAAAAAAAI/AAAAAAAAE9c/H9olRfMuz3A/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'The staff is very professional and approachable. They have genuine passion for alternative medicine and are more than ready to help you in any way they can. All are very knowledgeable about the subject and they\'re program is run well.', 1521638440),
(2215, 495, 'Kym Hannigan', 'https://www.google.com/maps/contrib/114569180515897816655/reviews', 'en', 'https://lh3.googleusercontent.com/-41MRGT08qSY/AAAAAAAAAAI/AAAAAAAAAAo/6MDf1xuF06o/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'If you want people that TRULY CARE,  then you DEFINITELY found the right place. EVERYONE is VERY FRIENDLY, but most of all they are helpful & extremely knowledgeable! I was completely informed about the entire process, educated, and no stone was left unturned. I\'m so happy that I found NEW JERSEY ALTERNATIVE MEDICINE, in TURNERSVILLE! I can\'t thank them enough!', 1512749162),
(2216, 496, 'Tim G', 'https://www.google.com/maps/contrib/106557966528743634123/reviews', 'en', 'https://lh5.googleusercontent.com/-sU1uEJXg1nY/AAAAAAAAAAI/AAAAAAAAHo0/B5nrneJ-BA0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'Paula girl you rock. This dispensary is truly the best in the state. I can\'t imagine what this place will offer in 5 years, 10 years.. even 20. They are about to open a new facility, so wait times should drop while quality and selection grow. With a little help from Trenton, we\'ll see waxes and more diverse edibles in the near future!', 1522789730),
(2217, 496, 'Daryl Hammerquist', 'https://www.google.com/maps/contrib/101260777040532133164/reviews', 'en', 'https://lh4.googleusercontent.com/--aSA9M93Kuw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Wbnn0PxUuWGESFC0fjX-lRQYxug/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, 'a week ago', 'They make you feel comfortable/at home. Very knowledgeable. Fast moving. Parking isn\'t great, very small lot and very congested.', 1527021397),
(2218, 496, 'Ed Emory', 'https://www.google.com/maps/contrib/115407503348885295017/reviews', 'en', 'https://lh4.googleusercontent.com/-9M_QT4pOxrQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Rn7zJzmR1HWslPjH5O2dX9WiPVg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'A wonderful place to purchase Medicinal Marijuana. I just wish it was closely surrounded by doctors who prescribed it. The closest I know of is in Camden, NJ, and I live in Runnemede, NJ....', 1527032877),
(2219, 496, 'Chopper Steve', 'https://www.google.com/maps/contrib/107926318188290595396/reviews', 'en', 'https://lh5.googleusercontent.com/-iDa-O3uH7Tw/AAAAAAAAAAI/AAAAAAAAErA/S1-7U5sFsgk/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'Bridget does not get back to patients. I had seeds and horrible quality cannabis and wanted some kind of refund but the people here are different from when they started and quality control and care for the patients and medicine is lacking big time! Don\'t waste your money here, these people and their products are horrible!', 1526062386),
(2220, 496, 'Thomas Nothstein', 'https://www.google.com/maps/contrib/116571586984299424519/reviews', 'en', 'https://lh6.googleusercontent.com/-TxyqwkkEg4E/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0JPfzrz5GYqY7dcrkZrTwr3jW71A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Great place to get quality medicine at affordable prices . Usually gets a little crowded and busy most day times, but hey that just shows how good it truly is. The people at compassionate sciences have given me my life back with their amazing selection of medical cannabis!', 1525572795),
(2221, 497, 'Kristin Snopek', 'https://www.google.com/maps/contrib/110359339723431325102/reviews', 'en', 'https://lh6.googleusercontent.com/-9APvNP9wndg/AAAAAAAAAAI/AAAAAAAAAWw/0jWQ2cMlWxg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'This is the first dispensary I am going to since I got my MMP card. The staff here is amazing. Upon your first visit, they will do a counseling session with you, so expect to be there a while. But once you get that out of the way, you can go in and pick up any time.  For those on their first visit, you will see others that seemingly came in after you that go in before you. These are just people picking up & do not affect the wait time for first visit counseling. I saw another review complaining about that, but I don’t think they realized there is a difference between basic pick up & first time visits so keep that in mind your first time there.  Also, if you want to speed up your pick up, just give them a call before you head out so they know you’re coming & can have what you need ready. \nSTAFF – the people here are AMAZING. They are not only super kind & understanding, but they are all very well educated on all topics relating to medical marijuana so if you have any questions at all they are more than capable of handling it. I really can’t express enough how welcoming this place is.\nPRODUCT – Although their inventory may be a bit limited from time to time, their strains & quality of the flower are fantastic. \nPRICE – Since this is only my first dispensary, I don’t have much to compare it to, but other reviewers say it can be a bit pricey.  I don’t have a problem with the pricing especially since it’s as good as it is. \nPARKING – This can be kind of tricky if you’re trying to get on the main road. However there is a side street right across from the shop & on that block is a metered parking lot that even takes credit/debit cards. If you don’t want to pay at a meter, if you just go over a few blocks on the side street there is 2 hour parking for free. \nI totally recommend checking out this dispensary.', 1526924940),
(2222, 497, 'koolio0900', 'https://www.google.com/maps/contrib/109940305038626386030/reviews', 'en', 'https://lh5.googleusercontent.com/-rWyyRZKIrqc/AAAAAAAAAAI/AAAAAAAAAB4/Tr1xGhjIfjg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'The quality of the product is bad! the price is outrageous compared to the quality. The weed actually smells and tastes bad when you smoke it. Like they took it out of the soil or something. Does not seem properly grown because all their different strains have the same aroma. And their kush strain does not even smell or taste like kush at all. It is very embarassing too i mean its a legal dispensary you would think they would be on top of their game especially since it was the first dispensary to open in the state. \n \nThe bud tenders and people who work there are fine. very helpful. But whoever and wherever they grow their product is terrible.. \n \nWhen it comes to prices you will be buying 3 eighths for the price of 2 quarters basically. complete ripoff. i only recommend coming here if you absolutely cannot travel to garden state dispensary or breakwater. Those places have actual exotic strains and a bit more fair prices.', 1527463686),
(2223, 497, 'Linda Passaro', 'https://www.google.com/maps/contrib/115685229259612427242/reviews', 'en', 'https://lh5.googleusercontent.com/-vGRiZg6O7CA/AAAAAAAAAAI/AAAAAAAAAF8/qbkiOq-oNuA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Don’t bother using this dispensary. Take extra time to go to Woodbridge. They don’t call the people in order. They have zero inventory. They can’t get bank to work with them on debit cards. Quality of staff in sub par. Gotta get Gov MURPHY open options for Northern NJ fast.', 1524839584),
(2224, 497, 'renton thurston', 'https://www.google.com/maps/contrib/112162441670392894841/reviews', 'en', 'https://lh4.googleusercontent.com/-urvxA4zBv4g/AAAAAAAAAAI/AAAAAAAAABw/YEaLxunSLug/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Very nice and helpful staff. Answered questions and helped find the best products for my needs.', 1525903998),
(2225, 497, 'Rachael Horn', 'https://www.google.com/maps/contrib/110786454238356689584/reviews', 'en', 'https://lh4.googleusercontent.com/-LesKHhvZYJQ/AAAAAAAAAAI/AAAAAAAAAAc/4M7F7B7ZL_0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I would personally love to thank each and everyone of you that make up “ The Tree” That truly symbolizes how all of you work together in such a beautiful and compassionate manor.... You all have taken the time you have in such a busy and potent arena.... to touch my soul as well as my body!  THE STRAINS ARE AMAZINGLY ACCURATE FOR SO MANY OF THE LOCAL’s  NEEDS!  I STRUGGLE WITH FINANCES.  I DO NOT TAKE THE EXPENCE OF THESE PRODUCTS LIGHTLY!  I KNOW GREANLEAF WORKS HARD IN THE FIGHT FOR OUR RIGHTS AS PATIENTS AND AS PEOPLE!', 1525105019),
(2226, 498, 'Robert Steffero', 'https://www.google.com/maps/contrib/112046523787045145729/reviews', 'en', 'https://lh3.googleusercontent.com/-eb-JYXSCrYE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1NLHPX5klORGh07C3Nfn8nEFBxaw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Excellent Dr. Anzalone is very compassionate, and as busy as he is he always takes time for you if you need him. He never says no', 1499363563),
(2227, 498, 'Katie McCarthy', 'https://www.google.com/maps/contrib/114208385892734446071/reviews', 'en', 'https://lh4.googleusercontent.com/-NOqxMb966vk/AAAAAAAAAAI/AAAAAAAAAHw/ng49DhWrN4w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'The entire staff was very helpful and knowledgeable. Keep in mind that they are all probably patients so you may have to remind them that you need something but they will get it for you. The prices ARE around street prices and if you\'re smart buy the shake. It\'s just as good as the bud and half the prIce, plus you KNOW what you are getting. You\'re not at the mercy of some street dealer who may be giving you a product laced with another drug.', 1476535981),
(2228, 498, 'Jose Guerra', 'https://www.google.com/maps/contrib/113220234746753679270/reviews', 'en', 'https://lh6.googleusercontent.com/-a8yJUY4gvgU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1kOp2yjVNl0je_5R2gQYDji_ngYA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Dr Anthony Anzalone is a great caregiver very understanding to your issue & needs. Thank you for your help Anzalone.', 1503323295),
(2229, 498, 'Margaret Hammed', 'https://www.google.com/maps/contrib/100493626795574077916/reviews', 'en', 'https://lh4.googleusercontent.com/-1eN4hognYhY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0oEZqe6i15uLsjpbkjsxWzH9FL8g/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'He’s compassionate and is dedicated to what he believes in', 1516045054),
(2230, 498, 'MOSTJOM', 'https://www.google.com/maps/contrib/100890427895419663619/reviews', 'en', 'https://lh5.googleusercontent.com/-YzOYRYZS-YM/AAAAAAAAAAI/AAAAAAAAAGs/PB0i3WmvnIw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'The process was very efficient and Dr Anzalone and his staff were easy to work with.  They accepted my VA diagnosis and medical records for proof of my PTSD as acceptable and helped me get my card.  The Dr visit was informative and about 30-45 minutes.   They were open to questions and even have magical butter machines for sale.  Their price for the doctor visit is great.  For me is was i think 200 to the state to get my card and 300 or 350 to the doctor for the visit.  100$ of that 350 is good for a 90 day prescription.  I believe that is standard regardless of who renews your script but to change docs you would need to pay another doc the appointment fee.  I have heard of NJMMP patients payong over 1600 for their card and initial script.  I would recommend  this Dr for those looking to use alternative medicine through cannabis ingestion.', 1485655721),
(2231, 499, 'N 201', 'https://www.google.com/maps/contrib/110245921096283448413/reviews', 'en', 'https://lh3.googleusercontent.com/-qNJu-0j0FPE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0SNvJbet2_6Opz2CbSBmMfKL7dvQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I really cant believe doctors like this still exist. I didn\'t feel rushed. All my questions were answered. The office was so clean. The ladies at the front were so helpful and were smiling when I walked in. Yes SMILING. I don\'t know about you but everytime I walked into a doctors office it smelled, staff is rude and it looked like they don\'t want to be there. So this office visit was a breath of fresh air. I\'m so happy my friend told me about Dr. Majchrzak. I would DEF recommend!', 1524089232),
(2232, 499, 'Mike Sisk', 'https://www.google.com/maps/contrib/117549398386024639072/reviews', 'en', 'https://lh3.googleusercontent.com/-m48RGHXoA7s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0f-1SFRZ5N40rH6M6hHF1EFPYg-g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Dr Majchrzak is by far the best all around Dr.He genuinely cares about each and everyone of his patients. I started going to him over 5 years ago and he has helped me get my health under control and is even went out of his way to make sure i get the medication that i needed that the insurance  company was giving me a hard time paying for. He went far beyond his call of duty. He always asks about my family and friends. If your thinking about swithching Drs Vita Med Family Practice is the place to be.', 1527691933),
(2233, 499, 'Lindy Pagan', 'https://www.google.com/maps/contrib/102314109383910293155/reviews', 'en', 'https://lh4.googleusercontent.com/-kQegpUoxDhc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2U3lSio1T72H-tI9-OoRPmlppK7g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'This doctor saved my life.  He is thorough and very professional. I will always be grateful for Dr. M', 1525776797),
(2234, 499, 'J J', 'https://www.google.com/maps/contrib/112724362544241907132/reviews', 'en', 'https://lh4.googleusercontent.com/-bRm1PR4Zrrs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0_sFn_PscoZD4OT4QV1KVxSJtZcA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'I\'m extremely disappointed in my experiences with Dr Tadeusz Majchrzak. I\'ve been a patient for two years and did not feel I got the attention or respect I deserved. \n\nThe front desk staff:\n-Unfriendly, rude, very stand off-ish\n-Will keep you on hold (phone) for an extended period of time (10-15m+)\n-Will not ever admit they are at fault or take ownership of a mistake (front desk, nurses, and doctor)\n-Everything falls under a \"policy\" and there is no budge/wiggle room no matter what the extraneous circumstances are\n\nWaiting room:\n-You schedule an appointment, show up on time, but you wait for 30 minutes. I\'m not sure what the hold up is, but this is not the greatest experience from the patients perspective.\n\nDoctor:\n-Moves quickly, talks quickly, doesn\'t take time to slow down and explain things calmly to you\n\nOther Notes:\n-It is a 100% Polish staff\n-Majority of other reviews appear to be from the Polish community (take everything with a grain of salt)\n\nSummary:\nEveryone is looking for a doctor who will listen to you, checkup on your general health, consult with you on your concerns, give you a proper prognosis, and most importantly, make you feel comfortable. \n\nIn my experiences with Dr Tadeusz, I feel like I didn\'t receive any of these items except for checking off the items on his list of \"general health\" concerns. \n\nAt every corner, the guy was trying to up-sell me on vanity services that they offer. If you go in for a physical, be prepared for blood tests, urine, lung test, EKG, and a sonogram. I am young and healthy, no need for a lot of this, but I figured, hey, better safe than sorry and if the doctor suggests it, why not?\n\nThis doctor also does medical marijuana licenses, botox, chiropractic services, neurology services, and a wide variety of other beauty and non-beauty services. Yet it is a small practice. What I\'m getting at, is that they seem to be after that paycheck to pump patients in and out through the cash cow and then up-sell to the patients that will take the bait on their extra services. \n\nI got royally upset when someone on the medical staff made a mistake and forgot to submit my requested test and would not admit fault. The reason why I got so upset is because I had to specifically sign extra paperwork and had discussions with the nurse and the doctor about the test I had requested. The doctor mentioned that the insurance would not cover the cost in my consultation and I said I want to do it anyway because it\'s for my health. The doctor had no recollection of this and he stated that a \"new policy\" was issued to them from the insurance (in the two weeks that had passed) saying that my insurance wouldn\'t cover the test, and instead of calling me to ask me if I wanted to proceed, they \"didn\'t put it through.\" In reality, someone forgot to put it through, didn\'t fill out the paperwork properly, and it never got done. If they had took responsibility for it and been frank with me, I would have felt better about the situation. If what he said was true, then he should have called me up to notify me that the insurance would not cover it and just double check that I would be okay with the expense. But in my experience, Doctors typically don\'t have a problem with putting this on the patient because we sign paperwork saying that if the insurance company doesn\'t cover the expense, we (the patient) are liable for the expense. \n\nI will never come back to this practice. I would advise anyone who is in good health to avoid this practice. To the sick, good luck, I would pick another doctor.', 1522266601),
(2235, 499, 'JJesenia vVelazquez', 'https://www.google.com/maps/contrib/103349890827293593442/reviews', 'en', 'https://lh5.googleusercontent.com/-CNKAwG79Izg/AAAAAAAAAAI/AAAAAAAA4eI/jZsaUUxUNAY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Hes an amazing doctor. He takes time with his patients and the staff work together as a team.', 1526395760),
(2236, 500, 'Tahsha Bennett', 'https://www.google.com/maps/contrib/107188175963602022227/reviews', 'en', 'https://lh4.googleusercontent.com/-_MdHoWjPg7M/AAAAAAAAAAI/AAAAAAAAAEE/_X09ePooJds/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'I came to this dispensary looking for a certain strain. And I actually fell in love with it. Very nice staff. One of the managers took time and explained SO much info to my cousin and myself that we felt should of been told to us prior. Even though its a 40 min drive, I will be going back.', 1526154879),
(2237, 500, 'David Alan', 'https://www.google.com/maps/contrib/103645042515604464262/reviews', 'en', 'https://lh5.googleusercontent.com/-mz4XV3maa7Q/AAAAAAAAAAI/AAAAAAAAAEQ/nNjk9RzSvAY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'Professional, respectful and knowledgeable staff. Well stocked with reasonable prices. Always great service by Cady, Maggie, Summer and others. Highly recommended.', 1526909281),
(2238, 500, 'Sue Pomar', 'https://www.google.com/maps/contrib/112836896384507052542/reviews', 'en', 'https://lh6.googleusercontent.com/-aI-Q_5plCH0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3LN8VF6AF5iglfzBvepobFOfx4Vg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I am so happy I have Compassionate Care Foundation.  I have been a complete novice to this whole experience, and they have been so supportive and helpful the entire way.  My husband was allowed to sit in during orientation, which made me much more comfortable my initial visit - which was also the only time I needed to set up an appointment, and the service has continued to be outstanding ever since as a returning patient.  It is nice to have such a wide variety of selection and choices, although I do tend to stick to my \'go-to\'s\' as I call it - which they always have in stock and available.  I\'m not sure what it\'s like in other states, but I know I have always felt safe, comfortable, friendly, coming to Compassionate Care Foundation.  A truly enjoyable experience every time, and the best part is - it really works!!!  Thank you.', 1515507077),
(2239, 500, 'Debbie Dolci', 'https://www.google.com/maps/contrib/100672843809944266221/reviews', 'en', 'https://lh5.googleusercontent.com/-SWf2RyMgUZE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3DUn8P-KHCpecHDIbyxZTkIe5-qw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Very Helpful. My first time at a Dispensary. Molly was wonderful. Took her time and explained everything. Looking forward to seeing them again.', 1526494494),
(2240, 500, 'Christina Moukhlis', 'https://www.google.com/maps/contrib/101843846765556756605/reviews', 'en', 'https://lh5.googleusercontent.com/-P3LYTvTqRVA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1RzMcbjMoEuKnz0Tb8D_KuAYB8Fg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I went in a bit nervous at my first visit but was quickly relaxed by everyone\'s friendliness.  My consultation with Jeff was fantastic. He really made me feel relaxed and confidant about my purchase.  Ronaldo was also very helpful as well during the consultation. So far i am pleased with the effects of my medicine and am excited to see future benefits. Looking forward to future visits ', 1522844385),
(2241, 501, 'Geo', 'https://www.google.com/maps/contrib/110613010711752720567/reviews', 'en', 'https://lh6.googleusercontent.com/-cMlUz-iyw4g/AAAAAAAAAAI/AAAAAAAABsE/8dg4ZIRFkQc/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'They are very pleasant on the phone and then they proceeded to tell you the cost $400 plus $100 for the card plus $100 every 90 days and that\'s without receiving any product', 1526049656),
(2242, 501, 'Tara Tucker', 'https://www.google.com/maps/contrib/109022219564300165543/reviews', 'en', 'https://lh3.googleusercontent.com/-7pcaIP-dnp0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3RkHZoy2uEPa-oSITmHKl8HAB4Dg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Staff was great, I was very nervous about going but the staff was very calming and patient with me. Dr. Medovsky took his time, and was very compassionate to my needs . He answered all of my questions, it was a great experience.', 1520222943),
(2243, 501, 'John Smith', 'https://www.google.com/maps/contrib/107898861713430813099/reviews', 'en', 'https://lh3.googleusercontent.com/--NjXJfRiIto/AAAAAAAAAAI/AAAAAAAAABc/CIKMu-K2p4Y/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'If you are interested in trying a safer alternative to hazardous medicines with known negative side effects this is the place to start looking for better a future. \nIMO the doctors and staff are very compassionate. \nHope may be just around the corner.', 1515526374),
(2244, 501, 'Anthony Massey', 'https://www.google.com/maps/contrib/116087090903704707607/reviews', 'en', 'https://lh6.googleusercontent.com/-KvFQLcpzY8w/AAAAAAAAAAI/AAAAAAAAspg/sqThfVLlncY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'I highly recommend New Jersey Alternative Medicine.  \nTrue professionals. \nAngelica was very friendly and great customer service.  \nEllys was amazing! So kind, so knowledgeable.  Truly passionate educator.  Informative & helpful. Can\'t say enough good things about Ellys\nThank you so much.', 1508121501),
(2245, 501, 'pretty with poise', 'https://www.google.com/maps/contrib/111007588392800787994/reviews', 'en', 'https://lh5.googleusercontent.com/-6n6sLXkhHg4/AAAAAAAAAAI/AAAAAAAAAwI/7nDqu-Tyk3w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I Love this place as soon as i walked in the building i got a sense of calm and that\'s with out speaking to anyone. Then speaking to the staff and seeing how nice and helpful they are it made me feel more and more like i was taken serious and not pushed aside and rushed out like any other doctor office my first appointment with dr. M was so calm and made me feel so at ease, hes very relaxed but in an official way. Your again not rushed and no one is throwing un natural medication at you im on a lot of un natural medication and im hoping this will help relive alot of the side effects caused from the un natural medication. All and all if your looking for a great place to feel wanted and not rushed and like your someone special go here!', 1516483339),
(2246, 502, 'Roland Green', 'https://www.google.com/maps/contrib/116120911307479916525/reviews', 'en', 'https://lh3.googleusercontent.com/-W2cGh06uCyQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq09s6VWHgzky5gDWKdpGEE7Z9_WhA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'This is most excellent doctors office I\'ve been to in years. I\'m a veteran I served my country and they served me well. The staff are wonderful, caring and not to mention the doctor is truthfully genuine. He is a great one on one doctor, I would recommend this office to anyone. I drive more then 2 hours to see them...EVERY VISIT\n\nI hope everyone has the same experience I had GOD BLESS', 1518794751),
(2247, 502, 'Michael Starkley', 'https://www.google.com/maps/contrib/103174916325244838606/reviews', 'en', 'https://lh3.googleusercontent.com/-3UWQdLQToMs/AAAAAAAAAAI/AAAAAAAAAGM/wkWazK4bbfg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Dr. George Moskowitz \n   Thank you so much for taking your researching  Medical Marijuana. I have never felt better than now do to Medical Marijuana. \n    And the entire staff in Dr\'s Office Are extremely nice, and will give a helping hand to make you fell, as if your Family!', 1515433173),
(2248, 502, 'Matthew Rubin', 'https://www.google.com/maps/contrib/106348257816437628933/reviews', 'en', 'https://lh4.googleusercontent.com/-9Myz5CChn7A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2wrmZMK0it-Ae2HLxEIpEwn5UfgA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Everyone in the doctors office are great all are caring people that go the extra step to be as helpful as they can . The doctor takes the time to listen he does not rush you not many doctors  out there like him anymore', 1515649577),
(2249, 502, 'Elan Amishay', 'https://www.google.com/maps/contrib/106211143563765567835/reviews', 'en', 'https://lh6.googleusercontent.com/-JMm_F0trgvQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq07XOrHNwLhW1xRivnHLv1NLlNlMg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'After a very short evaluation process, I met with Dr. Moskowitz, who happens to be a gem of a man. He explained why he introduced medical marijuana into his practice and why he believed this to be an exciting time for medicine. As a writer, I felt the need to capture how I felt going through this very simple process. I had been trying to get off the psych medications I had started taking last June and now, 3 weeks after my visit, I am truly happy and excited about life again. Thank you Dr. Moskowitz and God bless you!!', 1513187111),
(2250, 502, 'Tata El Bravo Kimbiza', 'https://www.google.com/maps/contrib/117592774165951244581/reviews', 'en', 'https://lh4.googleusercontent.com/-UBBGUAIAD-w/AAAAAAAAAAI/AAAAAAAALjk/PwK8sgnn5mQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Very respectful and caring people, they are very understanding, treat you very well and explain everything with great detail. The staff and doctors are very nice people and are very understanding.', 1502306038),
(2251, 503, 'Josetta Saccardi', 'https://www.google.com/maps/contrib/113152447300428641121/reviews', 'en', 'https://lh4.googleusercontent.com/-86F60UQ_m34/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0AwkuixpnUZ6HhSA_HANPcsx0rBw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'A little late in coming but.. My experience w/Alternative Medicine in Linwood was a positive one. From the start the crew being very friendly put me at ease. Through out the process when I needed help in certain areas they were more than willing to assist me & did so pleasantly. Even when, at one point, we had back n\' forth calls while at home. \nI recommend them w/o hesitation. With special thanks to Bob & Dana!', 1525179574),
(2252, 503, 'Don B', 'https://www.google.com/maps/contrib/111383516500884644535/reviews', 'en', 'https://lh6.googleusercontent.com/-ns-1TgVF7h8/AAAAAAAAAAI/AAAAAAAAGhA/mdWeaXg7ST0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This was a wonderful experience for me from start to finish.  The entire staff is friendly, knowledgeable, and comforting throughout the process.  I\'m very happy I chose the Linwood location, and look forward to coming back in the future.  Thank you!', 1523734387),
(2253, 503, 'Billy', 'https://www.google.com/maps/contrib/108955938304648485116/reviews', 'en', 'https://lh4.googleusercontent.com/-ToSkJDFQ76M/AAAAAAAAAAI/AAAAAAAAABc/22pieCqbOrk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Outstanding staff - professional, knowledgeable and customer-focused service.  Tip of the hat to all - keep up the great work.  :-)', 1527120997),
(2254, 503, 'cookiemonster 628', 'https://www.google.com/maps/contrib/114068345633062767577/reviews', 'en', 'https://lh6.googleusercontent.com/-PoQ58q2z-d0/AAAAAAAAAAI/AAAAAAAAADc/ShBS-iXdAhc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I called for information and appointment. Support staff is very helpful, called me right back with appointment. Doctor and staff are compassionate and  easy to talk to and I  was seen at my appointment time. Educator is knowledgeable of state regulations, dispensaries and medicine.  Excellent experience.', 1516795968),
(2255, 503, 'kendra hammell', 'https://www.google.com/maps/contrib/117511768127012780948/reviews', 'en', 'https://lh5.googleusercontent.com/-k6haX1t7p5M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2IbhDESrzVrxnHWxSKjIF8MjeNuA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'So pleased with the knowledge, care and education. By far an amazing journey and I’m filled with hope that I’m finally healing ', 1520511704),
(2256, 504, 'Andy B', 'https://www.google.com/maps/contrib/115356391870472235401/reviews', 'en', 'https://lh5.googleusercontent.com/-U6a9A9E7FL4/AAAAAAAAAAI/AAAAAAAAAII/P9ejOLyOS8A/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'It\'s easy to miss, heading North on U.S. 1 it\'s just over the Route 35 Overpass (crossing over St. George\'s Ave a/k/a Rt. 35). You\'ll see a Buick Dealership as you cross the Rt 35 overpass, it\'s the driveway immediately after the dealership and if you see the Bertucci Restaraunt/Shop Rite, you\'re one driveway passed it. You can park closest to the dispensary and follow a short path to Garden State Dispensary.\n\nIt\'s very hard to find, not easily seen from the road and your GPS will miss it as well.\n\nUnlike other dispensaries I have visited, Garden State offers one on one counseling answering any and all questions you may have. It\'s an education into the world of Medicinal Marijuana. You could have been smoking your entire life; you WILL learn something new.\n\nGarden State offers strains of CDB Marijuana that have no psychotropic affects, for those who may be adversely affected by high grade medicinal marijuana. It\'s a great choice for driving, operating machinery, functioning well at work, etc..', 1521464710),
(2257, 504, 'The Original WHIPSNAY', 'https://www.google.com/maps/contrib/102615308018191757077/reviews', 'en', 'https://lh3.googleusercontent.com/-HWMtURKlO30/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq13LnCyub0BkGRNG54SPENUi6rEPA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '4 months ago', 'Come straight and leave straight because you can not even smell what you are buying because of State Law. Or that is what they tell you. They can not even show you how to use some of the things they sell to smoke you meds with. Not to knowledgeable about most items. I asked how do I clean the screen in the bud crusher and the girl picked up a item that looked like a knitting needle and said push it they holes. But the holes are the size of a very small needle not something you would use a knitting needle on because the holes would be to big. And the one head guy always blames the State Law yet no one at the State Office can find that rule. Just like only 3 people allowed in back according to State, which is true. But that is because there is only one guard. State says if two guards than 6 can go in at a time. Once it goes legal in Jersey this place is going to either lose allot of business, prices too    high (no pun intended) or will make it big time if they change over to legal sales but only with lower prices and a stoner staff. The staff now claims they are not allowed to try product but if they hired people who are using it for their health than that could tell patients just what to get.', 1516666325),
(2258, 504, 'kaija hunter', 'https://www.google.com/maps/contrib/110734358263694957347/reviews', 'en', 'https://lh6.googleusercontent.com/-F3vf5shpNIo/AAAAAAAAAAI/AAAAAAAAFWg/2i6ME1L3sSU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'They\'re the best!! They have excellent customer service and support. They cater to each patient\'s individual needs. They truly care about your well being. It feels like a big family environment!! I love this place so much!!!!', 1505317056),
(2259, 504, 'Jeff Mount', 'https://www.google.com/maps/contrib/110782148671733427344/reviews', 'en', 'https://lh5.googleusercontent.com/-PZORLXtm5iI/AAAAAAAAAAI/AAAAAAAARlU/9RGhis3NrSQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, '6 months ago', 'PLACE IS A JOKE,  NOBODY ANSWERS PHONES, ANY BAD REVIEWS THEY BLOCK YOU ON FACEBOOK!  ALL LOW THC JUNK NUGGETS THAT ARE OVERPRICED.  GO TO BREAKWATER.   MUCH FRIENDLIER', 1512142798),
(2260, 504, 'Jason Huber', 'https://www.google.com/maps/contrib/110510034258189904028/reviews', 'en', 'https://lh4.googleusercontent.com/-JF9CeThHxQo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq31jdfaUegE2cOWPXoWRmeFyvo9Cg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'This is one of the best dispensaries in NJ.  Their cannabis flowers are like artwork.  The effects are exactly what I am looking for.  I used cannabis to kick a 10 year opiate and Xanax addiction (used it for withdrawal symptoms.)  It\'s been over a year and my life is amazing now!  :)   Buy your cannabis products here with confidence! \nPS- NO, you do not have to be dying to get your medical card here in NJ.  Just Google \"Dr Marijuana + NJ\" and call the 1st guy that pops up.', 1497640848),
(2261, 505, 'Jose Guerra', 'https://www.google.com/maps/contrib/113220234746753679270/reviews', 'en', 'https://lh6.googleusercontent.com/-a8yJUY4gvgU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1kOp2yjVNl0je_5R2gQYDji_ngYA/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 months ago', 'I was told by my doctor that this place would be open Feb. I went there to check it out, there was a tall skinny man with a long beard. I asked him if he knew when this place was going to open that I am a Marijuana patient. He gave me a look like he didn’t care so I repeated the same thing to him again, then he looks at me & tells me it could be next week, 2 weeks a month, 2 months. It looked & sound like he didn’t want to be there. I hope he’s not a bud tender because I’m going to ask for some one else. Bad first impression not cool at all. \n\nIf it’s true that the tall skinny man with the long beard is not a worker at Harmony then I will remove this  negative listing & Wright my first visit to Harmony.', 1522334163),
(2262, 505, 'Joel Black', 'https://www.google.com/maps/contrib/113822685331210449144/reviews', 'en', 'https://lh4.googleusercontent.com/-9sEiij5Y-FI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq327qbCqODO265MFlaabgMAZhwvgg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', '5 star to support local cannabis business ', 1525960872),
(2263, 505, 'asad rashid', 'https://www.google.com/maps/contrib/111952672802000438024/reviews', 'en', 'https://lh5.googleusercontent.com/-W3GdCjEDGuM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1NZvY6uh8BBz696KPTcVcrQ-npww/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Come on people!!!  Really!  You’re going to bad mouth a business that isn’t even open yet!  The guy with the beard was a construction worker.', 1521816703),
