(2265, 505, 'Wally Merced', 'https://www.google.com/maps/contrib/106794661108787922521/reviews', 'en', 'https://lh6.googleusercontent.com/-VjJOFS52Eg4/AAAAAAAAAAI/AAAAAAAAHUo/33ND8kf-DFE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', '', 1526567633),
(2266, 506, 'Don Webb', 'https://www.google.com/maps/contrib/113092330469541516603/reviews', 'en', 'https://lh5.googleusercontent.com/-Kp4pg8uHSJU/AAAAAAAAAAI/AAAAAAAAABE/SkPjnQyHzdg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The staff there is very professional, helpful, and care about each person...  very rare in doctors staffs today.. \nThe doctor is very informative and listens to everything.   He does not rush the process.', 1525045021),
(2267, 506, 'Robert Goldman', 'https://www.google.com/maps/contrib/106573658209099840339/reviews', 'en', 'https://lh5.googleusercontent.com/-W6MtSM9-PAI/AAAAAAAAAAI/AAAAAAAAVWE/TLo10Z0Adss/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Dr Magnone is a major asset in the medical field, his focus is to consider all of a persons medical conditions in order to design a comprehensive approach to restore a person to health with all the resources currently available in the medical field. I have been to many Dr\'s in my time and I am honestly very impressed with Dr Mangone, he is at he top of his profession in my opinion and wants to truly see his patients do well in every sense of the word. I am very happy to know that there are still medical professionals in the world who truly practice medicine with their heart and mind. Five stars for Dr. Jesse Magnone.', 1517842072),
(2268, 506, 'Mr Guzman', 'https://www.google.com/maps/contrib/101669068377195998411/reviews', 'en', 'https://lh4.googleusercontent.com/-l6eRg-a80-8/AAAAAAAAAAI/AAAAAAAAAOc/HXZlqwNZxWs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Nice place with good knowledgable people. Would recommend.', 1519586800),
(2269, 506, 'Gabriella Bernardo', 'https://www.google.com/maps/contrib/118312632716067212467/reviews', 'en', 'https://lh5.googleusercontent.com/-qTy4_NUevCk/AAAAAAAAAAI/AAAAAAAAAAo/RM-G88urzbQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', '', 1525884223),
(2270, 508, 'Jasmin Mieles', 'https://www.google.com/maps/contrib/104761324722821840724/reviews', 'en', 'https://lh4.googleusercontent.com/-NGyHOd-Ow8w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0QgaTMWs8GUfMV7gmP5U5EuZ-dPQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'This is the place to go!!! I love that they have several new locations central to all that I do and live. This facility is super helpful, honest and very welcoming. I was in a car accident some years ago and I am very thankful that the process of obtaining my renewal card is simple and painless. Clean facility, abundant parking available, super affordable, and all around chill experience - usually going to the doctor sucks but this is not the case here This clinic has been my go to for a few years now. Justin even remembered me and was quite helpful. I also love how central it is to both work and home. Both Dr Darcy and staff are extremely helpful and I didn\'t have to wait long at all. The doctor also recommended some exercises I could do for my knee and to meditate as well! Where does one ever get that!? I always recommend this clinic to people I know. They even have an option to renew online. Pretty cool.. I feel very fortunate!', 1517965727),
(2271, 508, 'Bobby Black', 'https://www.google.com/maps/contrib/106181494551655153120/reviews', 'en', 'https://lh4.googleusercontent.com/-H6gT_VZ7Tuc/AAAAAAAAAAI/AAAAAAAAAEM/jfGwyu8rGHc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very good mmj doctor. Tom was very good at helping me.  Great atmosphere.  Would definitely recommend them to friends and family!', 1523396102),
(2272, 508, 'Sean Padilla', 'https://www.google.com/maps/contrib/117718005287294557062/reviews', 'en', 'https://lh6.googleusercontent.com/-zfuhXGHn3Ro/AAAAAAAAAAI/AAAAAAAAABk/XN1obs2KTHk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'You get a great feeling walking in and leaving out. I was greeted by friendly and professional employees.  I highly recommend everyone to visit them.', 1523375238),
(2273, 508, 'Kyle Zafir', 'https://www.google.com/maps/contrib/104098690354624957420/reviews', 'en', 'https://lh4.googleusercontent.com/-ZcFFJZeZ5g4/AAAAAAAAAAI/AAAAAAAAACw/kNULekiwRiM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'I called several different medical marijuana doctors in Manhattan and i chose this location because this company seems to have the most knowledge and experience with medical marijuana since they originated in California and also have a location in Miami, Fl. \n\nThe process was simple as they helped me get my medical marijuana  card through the New York State  Department of Health. The staff was excellent and the Doctor was very informative about CBD , THC and medical marijuana products \n\nThank you Hollywood Easy Clinic! :)', 1508361823),
(2274, 508, 'sharita willis', 'https://www.google.com/maps/contrib/113284604744053123080/reviews', 'en', 'https://lh5.googleusercontent.com/-eeZlGfo6MRw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq13Lk-VjEKLjjH_cGAqVr8YaRS-hA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Amazing staff, the process was extremely easy and the medical marijuana doctor was very pleasant as informative.', 1522704209),
(2275, 509, 'Dave, videography Welsh', 'https://www.google.com/maps/contrib/117664474181041512113/reviews', 'en', 'https://lh6.googleusercontent.com/-WeJGGB_FnIA/AAAAAAAAAAI/AAAAAAAAANI/QtI2Mok3alw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Love it\n', 1500941800),
(2276, 511, 'Edward Denegre', 'https://www.google.com/maps/contrib/109507086610592517612/reviews', 'en', 'https://lh5.googleusercontent.com/-PStRhsIutLw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq37FtQoco0Kmhk9tCfRfKzVLoE7Lw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Dr. Park was very informative and helpful.  It was simple to set up an appointment and he answered all of my questions.   I didn\'t know what to expect because NY\'s MMJ program is so new, but this was a very positive experience.  I would recommend him to anybody.  Quick and efficient.  5 stars.', 1521051320),
(2277, 511, 'Yoonju Kim', 'https://www.google.com/maps/contrib/109648793151024704926/reviews', 'en', 'https://lh6.googleusercontent.com/-ae_UHnBrzIk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3KE6F0HP-aixi7_f5KyN1hqdj2Tg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'As I arrived at the building that Cannabis MD was located in, I was skeptical. Sure, there were gleaming steel-and-glass towers all around me, but this was an old building with an unmarked entrance. Am I at the right place? I checked the address as given on the website over and and before I took the elevator to the 3rd floor to find myself in the entry area of a surprisingly nice co-working space called Colab. The nice gentleman working at the front asked with a smile what I was looking for and I told him that I was looking for Dr. Oliver Park. He led me in to where his office was and I met the nice young doctor. I have a chronic ankle pain that has frustrated me over the past decade. It started as something I considered a mid-level sports injury; now it is something that actually figures in my decision making for strenuous activities. In a hustle-and-bustle city like ours that involves constant stair climbing, ankle pain can be just shy of debilitating. Having exhausted all other options (or seemingly so) I begrudgingly decided that I would consult a medical marijuana physician. Dr. Park was so thorough (and he kept insisting that I call him Oliver) and utterly patient with my page-long list of questions that I thought to myself that perhaps I should begin going to doctors more often. My favourite part of the experience was that even though his website stated (and he reiterated almost as soon as I got there) that he will not charge for the consultation that doesn\'t result in a certification, he did not try to push me to get one; Oliver made me feel cared for as a patient and not at all pressured. \nI have little doubt that many out there with real pains and ailments like myself are on the fence about medical marijuana. I strongly recommend you take the step to visit Dr. Oliver Park at Cannabis MD and get a consultation. It\'ll be worth your time, at the least, to become informed. I walked away with a certification and armed with knowledge that medical marijuana is not the gateway to a scene out of a Cheech and Chong movie.', 1517928366),
(2278, 511, 'Anne Pinto', 'https://www.google.com/maps/contrib/100730151155264585512/reviews', 'en', 'https://lh5.googleusercontent.com/-BCOoixcG_JU/AAAAAAAAAAI/AAAAAAAAAO4/SjgBGvuCE2o/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', '', 1526748496),
(2279, 511, 'xiaodi yan', 'https://www.google.com/maps/contrib/101883077628174484487/reviews', 'en', 'https://lh3.googleusercontent.com/-GHv4A3RB4q4/AAAAAAAAAAI/AAAAAAAAA0w/ZcqspkiJlEA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', '', 1522891456),
(2280, 512, 'Pedro Aviles', 'https://www.google.com/maps/contrib/112565825921806446658/reviews', 'en', 'https://lh6.googleusercontent.com/-bdGAsG52gso/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2o_VAhgQPhXUXwJ-I6Zy1kMTMKMQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'He\'s a great doctor the best', 1518657254),
(2281, 512, 'Laura Pullan Antorino', 'https://www.google.com/maps/contrib/106518370821987089330/reviews', 'en', 'https://lh5.googleusercontent.com/-I5kHQCUmGeg/AAAAAAAAAAI/AAAAAAAAG-M/xjjjotZJVGU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Dr. Polcer and the rest of the crew are absolutely wonderful!!', 1495904556),
(2282, 512, 'Nina Saffold', 'https://www.google.com/maps/contrib/109747546202390831803/reviews', 'en', 'https://lh4.googleusercontent.com/-hTDlgL75C-E/AAAAAAAAAAI/AAAAAAAAAAs/hre1YWuD_Os/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', '', 1465347202),
(2283, 512, 'Searina Bordley', 'https://www.google.com/maps/contrib/100684353955749968787/reviews', 'en', 'https://lh4.googleusercontent.com/-KE9x39z15IA/AAAAAAAAAAI/AAAAAAAAAcQ/fSa-4Xcdmv0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', '', 1450104163),
(2284, 512, 'Vee Ramos', 'https://www.google.com/maps/contrib/111359401630011336021/reviews', 'en', 'https://lh3.googleusercontent.com/-B_dnwio9cFA/AAAAAAAAAAI/AAAAAAAAIZ4/xSvHAIV9oWU/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '5 years ago', '', 1368725617);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(2285, 513, 'Frank Tank', 'https://www.google.com/maps/contrib/115654640121875730065/reviews', 'en', 'https://lh5.googleusercontent.com/-5Hnk2VR2-tI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1xzJk3BhPkZlwpzM1ttx-mJMq11g/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '3 months ago', 'I bought a gram of blue dream and it was short .2 when, I weighed it at home after my purchase because it looked small.  I could tell by eye-balling if it looks small and that is why I weighed it and sure enough it was short. I also noticed all the medicine on display are nice buds then when you buy it they are popcorn size. However, the managers resolved the issue and gave me what they owed me. Overall, High Desert Relief if good dispensary with quality smoke.', 1519185538),
(2286, 513, 'Stephen Chiles', 'https://www.google.com/maps/contrib/118046525242163055196/reviews', 'en', 'https://lh6.googleusercontent.com/-5up40zCYdt0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1zJmdYGymDaJD_gfBUilwE4OhTKA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'High Desert is by far the best producer of quality medicine in the state of New Mexico. Their knowledge and vast product base show just how dedicated the staff is to providing patients with medicine that is not only extremely well rounded , but extremely affordable. Best product base + best prices + best services = BEST dispensary in New Mexico!', 1518887367),
(2287, 513, 'Im Always right.', 'https://www.google.com/maps/contrib/101546025934501275338/reviews', 'en', 'https://lh5.googleusercontent.com/-7tzQVQuKLgo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Ssdh0t-sL8VR2M3WmWWvKJzzyAA/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '4 months ago', 'I\'m only giving two stars because the sale strain price point is rather good but 80 to 100% of the time they always taste like hay burns my throat like a mofo. \nGood flavor comes from soil cultivation and flavor has a lot to do with desired effect... seriously though guys you name one place on this Earth that cannabis grows naturally in water...i didn\'t think so..', 1517020272),
(2288, 513, 'Lisa Davis', 'https://www.google.com/maps/contrib/112272087205029001153/reviews', 'en', 'https://lh5.googleusercontent.com/-xYaJGwclulk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0t3XWn02ZkIxu2a7cIjWMPfW0sIA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I really like this dispensary it has friendly people fast service and good prices and discounts for out of town customers will definitely go back and recommend to others', 1526679192),
(2289, 513, 'MerlyRenae Tafoya', 'https://www.google.com/maps/contrib/103399962774374488317/reviews', 'en', 'https://lh5.googleusercontent.com/-kw-6Vafpq2M/AAAAAAAAAAI/AAAAAAAACaM/SoHlLB_LzyM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '5 months ago', 'I absolutely love High Desert Relief... Once I walk through the door I get greeted by my name which is so cool because all the staff take the time to get to know you & what you like! The medicine is great & so are their prices I highly recommend for you to try out this dispensary. I promise you won\'t be disappointed... Don\'t be afraid to ask questions they\'ll help you with everything!', 1512882152),
(2290, 514, 'Cam Bekker', 'https://www.google.com/maps/contrib/104429803702526875618/reviews', 'en', 'https://lh5.googleusercontent.com/-H4GfxCUgMKM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0deypgBF5-vv3ozRlwdCdI6a81jg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 weeks ago', 'I\'m giving this place five stars  cause they are really good however I wouldn\'t be coming back because the prices are ridiculous. I can get half an ounce for 40 dollars in Colorado n they charge 42 dollars for an 1/8 I was surprised. I got  banana kush in Colorado Trinidad for a lot less and today was my first day at any dispensary in new mexico. I do think they are a good place if u have money otherwise I think I\'ll go back to Colorado cause to me weed is weed', 1525471127),
(2291, 514, 'Joseph Anaya', 'https://www.google.com/maps/contrib/117556783434104435472/reviews', 'en', 'https://lh4.googleusercontent.com/-GwJdvdZnAY0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3p9Mhpx6G6gXX9Ho0frsCjxw3DUw/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'in the last week', 'The meds are good quality but highly over priced. 13$ a gram for over-cured dry flower! Thats top shelf price for substandard quality. Best to go when flower on sale. The genitics are good but should lower price for dry flower. Most of the staff nice, although there are a couple of bud tenders who act like they dont want to be there and are a little short with customers. I rate 3 stars! I would give a five for better prices and customer services! Thanks for reading hope this helps.', 1527381517),
(2292, 514, 'brandon banas', 'https://www.google.com/maps/contrib/109487948819401363201/reviews', 'en', 'https://lh3.googleusercontent.com/-qvtcfvS8Xe0/AAAAAAAAAAI/AAAAAAAALh4/XHV7J47znjY/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a week ago', 'Wow this place is the best place in town. So friendly and helpful.', 1526936593),
(2293, 514, 'M Reno', 'https://www.google.com/maps/contrib/107595575670951538208/reviews', 'en', 'https://lh5.googleusercontent.com/-EAiT-XLr26I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0krfC1OqmK3-eqMeKzBsV51Gkj2Q/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, '4 months ago', 'Product is good! Only problem is they get busy and you get skipped. Happened to me three times in one month. I\'ve watched people storm out mad after waiting an hour and dispensary isn\'t too apologetic. They need a better system', 1515189908),
(2294, 514, 'DUKECITYREAPER3', 'https://www.google.com/maps/contrib/115516789573616102426/reviews', 'en', 'https://lh3.googleusercontent.com/-I3BRoLAkB94/AAAAAAAAAAI/AAAAAAAAABo/-qwIwMoMFMc/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Purelife is definitely on my Top 10 Dispensaries in Albuquerque to visit. They have one of the best flower selections you can ask for. When you visit each dispensary you notice they\'ll  have different products and I personally prefer the Strongest Indica.', 1520748910),
(2295, 515, '505 Gaming', 'https://www.google.com/maps/contrib/109103210351716898112/reviews', 'en', 'https://lh4.googleusercontent.com/-NIGLbHMHGJk/AAAAAAAAAAI/AAAAAAAAAFo/KllgRoNQ7NY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Absolutely LOVE this place. The bud tenders are always super friendly and knowledgeable, and the medicine is some of the best in the state. One thing Everest does that not all dispensaries do is they separate the flower between “Top Shelf” and “Mid Shelf” and price them accordingly, so you won’t pay the same for some flower that’s 25% and some that’s 15%, so that’s nice. If you haven’t already, go check this place out.  Between the price, the selection and the service, you absolutely cannot go wrong with Everest Apothecary. Keep up the good work, guys!', 1515867686),
(2296, 515, 'Brent D-s', 'https://www.google.com/maps/contrib/102105125040026295551/reviews', 'en', 'https://lh5.googleusercontent.com/-J1dJT2GaKiI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2SQX5aIep_7nlCkQWddpoY-4F_jQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'I went in there today and the gentleman who helped me was so inebriated that he was unable to be of any help whatsoever. He seemed to be more interested in getting as high as possible. I use this mostly for  medicinal  purposes so I was kind of offended that he didn’t even take the time to really look at do any research to help me find the best weed for my needs. If you want to staff that is compassionate and tries to help I would not go here.', 1524811037),
(2297, 515, 'JOHN DOE', 'https://www.google.com/maps/contrib/110416004585318364218/reviews', 'en', 'https://lh6.googleusercontent.com/-i0cdu5eXTuk/AAAAAAAAAAI/AAAAAAAAAB8/RYrmGRUnlmA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'So rude!! Went in to register, and they were smug and rude when telling me no freebies without a purchase. The rudeness of the jerk behind the counter is enough for me to take my business elsewhere, especially since no freebie meant I dont know what they have. Good luck competing with verdes, ultrahealth, and purlife', 1527250569),
(2298, 515, 'JadenEntridius JadenEntridius', 'https://www.google.com/maps/contrib/113408965065743711841/reviews', 'en', 'https://lh5.googleusercontent.com/-aXN7bfePHcM/AAAAAAAAAAI/AAAAAAAAAdc/WK_p9lMTXUM/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a month ago', 'GOOD BUDS!!!! BUT!!!!!! I\'m very disappointed to learn they fill the pre rolls with garbage leaf, not even good leaf (which does exist). Very distasteful to push that on so called \'medical cannabis patients\'. Some of us are not just \'Partying\' on cannabis. I work my ass off and use it for sleep and appetite booster as well as a mood stabilizer for my bipolar disorder, smoking leaf is actually pretty disgusting and easily noticed to a seasoned user (I\'m a user for 18 yrs now ) I\'m pretty pissed off to find out I\'ve been deceived about the quality of pre rolled herb ciggs here. DO A BETTER JOB GUYS. OR IM NOT GOING BACK AGAIN FOR MONTHS LIKE I DIDN\'T BEFORE. Oh and thanks for the seed. ! That part was much welcomed. Good luck !', 1523496448),
(2299, 515, 'john evans', 'https://www.google.com/maps/contrib/107680281607435475463/reviews', 'en', 'https://lh3.googleusercontent.com/-VTFogWRu6ic/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq04Sh-Nv0nHAFYtPcqqfBva3dkssw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'One of the most professional staff in the entire industry !  You can tell John is a great manager just from how good his staff is.. Scott was incredibly helpful answering all of my questions.. the prices were great the the product is great and I\'m definitely coming back.  You always feel welcome when you\'re treated like family.   thanks you guys ', 1505850246),
(2300, 516, 'Nicole Diaz', 'https://www.google.com/maps/contrib/105513371203530408360/reviews', 'en', 'https://lh3.googleusercontent.com/-Fhl9dv12NwU/AAAAAAAAAAI/AAAAAAAAAA4/eNK46jTK0FE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'Shout out to CG ! Always available and extremely friendly ! I get everything I need here and the best thing ever just happened !!! They dropped their prices !!!! Def a regular here . Thanks CG', 1525198137),
(2301, 516, 'Christopher Lujan', 'https://www.google.com/maps/contrib/117812790709941426856/reviews', 'en', 'https://lh4.googleusercontent.com/-RvoYm2YXaDA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1j8YKb61g9CjKw6A0ExZ7Me3FmbQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '3 weeks ago', 'Very cheap n good bud. 9 a gram n it’s good bud too', 1525814785),
(2302, 516, 'Mamma Boo', 'https://www.google.com/maps/contrib/113762188927591433026/reviews', 'en', 'https://lh4.googleusercontent.com/-U3nspon9uFU/AAAAAAAAAAI/AAAAAAAAXWA/PjKctNVyFYo/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '5 months ago', 'First visit was great. Very nice inventory. The staff was very nice. They are very knowledgeable about there product also ready to explain to you what there product does. It\'s a no touch dispensary but you can examine the flower. Will be returning', 1512969540),
(2303, 516, 'Maria Gallegos', 'https://www.google.com/maps/contrib/110396292731547367210/reviews', 'en', 'https://lh5.googleusercontent.com/-skCpvG02tOM/AAAAAAAAAAI/AAAAAAAAWS0/8GVD47Ld2gM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'The staff is always super friendly and very knowledgeable. Their in-house cartridges and edibles are the best dosing and taste that I’ve encountered for a very reasonable price.', 1518666485),
(2304, 516, 'Becky Huff', 'https://www.google.com/maps/contrib/109378491925515780222/reviews', 'en', 'https://lh6.googleusercontent.com/-1_n90IfG8ik/AAAAAAAAAAI/AAAAAAAAEi8/gEU5sP-FgmE/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 2, '3 months ago', 'Decent flower and good prices but to bad they are not really for the working class. They are only ones who only give out deals on day of b-day only. No day before and day after here. Sad cause not everyone gets their birthday off.', 1518046512),
(2305, 517, 'Esmeralda Miramontes', 'https://www.google.com/maps/contrib/106437531312784409233/reviews', 'en', 'https://lh3.googleusercontent.com/-DMdJFSfCJCw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3p1LurrmgXECMkHXduKpRDW-OZIg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Looooove this Place, its my go to for all my medicinal needs. I tried the Juices on Friday. And i will be going back for more. I love when they have new products. And when they\'re this good, it\'s Passion that shows through their work. I enjoy all staff and customer service. Thank You MJ Express!!!', 1518912025),
(2306, 517, 'lowrance improvel', 'https://www.google.com/maps/contrib/103198239026049393552/reviews', 'en', 'https://lh4.googleusercontent.com/-snOVfme8_fo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq10wES-BKL_940oPJVZWsgkPFPpbw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The real eagle !\ngreat service ! kind folks, great medicine at great prices', 1526850376),
(2307, 517, 'necro_the_fallen_sand_monk', 'https://www.google.com/maps/contrib/118139966260770529276/reviews', 'en', 'https://lh4.googleusercontent.com/-_HaLZK8EnMI/AAAAAAAAAAI/AAAAAAAAG3A/A8MVEdTBKQM/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '3 weeks ago', 'this place is dirty and unorganized the edibles prices are good but the sativa selection is trash plus the wait time is ridiculous!', 1525475178),
(2308, 517, 'Jereme Manzanares', 'https://www.google.com/maps/contrib/114245395548698616476/reviews', 'en', 'https://lh6.googleusercontent.com/-YA0uWDAZQrU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1qcLP-u0X19hQDXa3jHQHSmIlxFw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, '7 months ago', 'Mjs has recently added multiple strains that can be purchased for 10$ per gram. The white fire is my favorite. And completely worth the price. Thanks for making it possible for all of us to be able to afford our medicine. Also 10%discounts throughout the week keep the price actually at 10$ per gram. (9.50). And Thursday a possible 26% off if u can name a marijuana strain for every letter of the alphabet. Keep it up mj\'s. Thank U!', 1508775198),
(2309, 517, 'melissa guerrero', 'https://www.google.com/maps/contrib/116768668365001750240/reviews', 'en', 'https://lh3.googleusercontent.com/-WE8rbmKZUPc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0cuXgsO6cTjPbr8q95dRQ-g44X1A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I love the new drinks they have the cherry is the best great price and size', 1521495637),
(2310, 518, 'JOHN DOE', 'https://www.google.com/maps/contrib/110416004585318364218/reviews', 'en', 'https://lh6.googleusercontent.com/-i0cdu5eXTuk/AAAAAAAAAAI/AAAAAAAAAB8/RYrmGRUnlmA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'The ladies working here were very knowledgable and friendly, the medicine was great. My friend got a white cookies preroll, which was spectacular. I got lavender jones which was so so. Cant wait to come back for more!', 1527251037),
(2311, 518, 'jesse terry', 'https://www.google.com/maps/contrib/112525635366641452123/reviews', 'en', 'https://lh5.googleusercontent.com/-MtDmYX2oCRs/AAAAAAAAAAI/AAAAAAAAA7k/93A17WFmRYY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '2 months ago', 'Got shatter for the Superbowl here. It was a wet gooey mess that in no way shape or form had the resemblance of shatter. Think watery wax. I find it pretty interesting that one of the most revenue generating dispensaries in N.M. is flat out ripping people off.\nThe atmosphere is the worst of the 3 dispensaries in the area and the prices aren\'t competitive.\nI got a msg to go buy \"shatter\" from them for St. Patty\'s day. It was a great reminder to review what a horrible place this is and why I will never recommend them.', 1521393282),
(2312, 518, 'Marcy Garcia', 'https://www.google.com/maps/contrib/109118391963777513607/reviews', 'en', 'https://lh4.googleusercontent.com/-99P8m-7jBN0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0EgDW3lc8Oa5BBOyp2MGFokga1FA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '5 months ago', 'This was my #1 and ONLY place to go for Rx but truly miss Kenny and D.', 1513708180),
(2313, 518, 'Brandon Be', 'https://www.google.com/maps/contrib/114988797425596801285/reviews', 'en', 'https://lh4.googleusercontent.com/-yLdjI8vWuG8/AAAAAAAAAAI/AAAAAAAAMxk/cg1M0Gmn6-0/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '10 months ago', 'A special thanks to the team! After trying the new CBD patch my wife was happy. She didn\'t use it, I did! After long and unusually stressful day I cut the patch in half, my wife placed it over a huge knot that had begun to bother me. In 10 minutes or so my mood had improved significantly, about 20 minutes in the pain melted away. A peaceful easy feeling lead me into a great night\'s sleep. Thank you so much for providing such a professional and functional product!', 1499570536),
(2314, 518, 'Amanda Mcclellan', 'https://www.google.com/maps/contrib/117353662031483561010/reviews', 'en', 'https://lh4.googleusercontent.com/-RvzZg0tSGkc/AAAAAAAAAAI/AAAAAAAAAAw/gBe8-xCo3o8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I love going here. The staff is awesome and welcoming! I have stopped going anywhere else. Great prices.', 1492534875),
(2315, 519, 'Rj Easley', 'https://www.google.com/maps/contrib/102964774300725052008/reviews', 'en', 'https://lh3.googleusercontent.com/-0wnlksbeF6Q/AAAAAAAAAAI/AAAAAAAABDk/AeQ-w0IMtyE/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'This place is fantastic, absolutely love the staff.. the discounts are great, especially for veterans. And if you remember ask to hear the guy who plays the pan drum thing it\'s awesome!! 5 stars!!!!', 1517245297),
(2316, 519, 'Julian Velasco', 'https://www.google.com/maps/contrib/110300017713331392039/reviews', 'en', 'https://lh5.googleusercontent.com/-1Cebb1Kky-k/AAAAAAAAAAI/AAAAAAAAAcE/J6NCmL6wpoA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'This is the best place I have gone to overall for what I need!!! I always buy rosin and they always have a variety of strains pressed, plus they sell the rosin by the .10 gram  to 1 gram increments  which is awesome for those times you are running a bit short on cash. They also giveback to the community with food drives and more which is a big plus + in my book!!! If you are looking for a dispensary look no further this place is overall the best in my opinion!!! Awesome customer service and awesome medicine!!!!!!', 1514580697),
(2317, 519, 'marquez floyd', 'https://www.google.com/maps/contrib/116421913274571711498/reviews', 'en', 'https://lh6.googleusercontent.com/-9_gi_3kzJl8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq10puz-jFiQUtgwyAmv963h8jw4tw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'The hospitality at this dispensary is one of the best that I have encountered. And the deals are to die for I highly recommend  SWOP', 1521226082),
(2318, 519, 'JUST GARCIA', 'https://www.google.com/maps/contrib/118156390401807675624/reviews', 'en', 'https://lh3.googleusercontent.com/-DRrmbTFfCLg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1C4OkeMtmOc9CFWrQnVgQnOicbmA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Everytime im close by I make it a point to stop by happy hour deals rock and the staff is knowledgeable. They always have specials. Rosin for people on a budge.', 1521138390),
(2319, 519, 'Maurizio Romero', 'https://www.google.com/maps/contrib/117203924863732393029/reviews', 'en', 'https://lh3.googleusercontent.com/-FNiW7UOi4Nk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1_FsSXKRShoBncSmta4LiP2mJ-Dw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Great place to visit with fantastic customer service. Consistently great flower with a huge selection. I\'ve been coming here since I\'ve gotten my card!', 1516651100),
(2320, 520, 'Joseph Keenan', 'https://www.google.com/maps/contrib/115520299901414532366/reviews', 'en', 'https://lh5.googleusercontent.com/-0JXwrYgzsyA/AAAAAAAAAAI/AAAAAAAAAR8/6u8PtktZuCY/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 weeks ago', 'While I would agree with the positives, over the past year it is less family and more like convenience store.  At least one of the sales staff is not the most helpful or pleasant to deal with.  One of the earlier reviews who said things have changed since the explosion and the atmosphere is not quite so homey.  As the listing says avg customer spends 15 minutes.  How much time does the sales staff spend doing much more than gathering an order, checking ID and cashing you out.', 1526496113),
(2321, 520, 'Jacob Proudheart', 'https://www.google.com/maps/contrib/101011946555546019295/reviews', 'en', 'https://lh4.googleusercontent.com/-P4OTRVO6SRw/AAAAAAAAAAI/AAAAAAAAAPc/k5bSPdrEXCk/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'in the last week', 'Oh my word I love this place.  Feels like a barn party.  I went for my first time on 4/20 I got a free pre-roll for my first visit a free pre-roll for 4/20 and pizza and soda for 4/20.  \n\nThey are dog friendly. Staff was very kind. \n\nIf you think your lost your not, it is at the end of the road under the big metal sign.  Gravel parking lot.  \n\nNext to Assistance Dogs of the West.\n\nPlease don\'t forget to give me a thumbs up if you found this helpful, many thanks!', 1527616984),
(2322, 520, 'Marla Maestas', 'https://www.google.com/maps/contrib/112060761216448206395/reviews', 'en', 'https://lh3.googleusercontent.com/--qArGDiXRFU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3KR2VemnLgWyzAzdqgHNem6SjMYw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Very help!  They explain everything to your level of knowledge!  Definitely will be a returning customer.', 1527020471),
(2323, 520, 'Holly Sharpe', 'https://www.google.com/maps/contrib/116567619920826475876/reviews', 'en', 'https://lh4.googleusercontent.com/-bnO1a5WuuwQ/AAAAAAAAAAI/AAAAAAAAANM/ViYwxT7uVMY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 months ago', 'Always an excellent experience! Great bud tender today, she really helped me pick the medicine that was just what I needed. I always feel totally safe & in trusted hands with them, always have. I love the vibe, the place itself, sort of a welcoming, safe, community place. Just hoping they\'ll one day be open on Sundays.', 1519082211),
(2324, 520, 'Fernando Rodriguez jr', 'https://www.google.com/maps/contrib/114036679819911502451/reviews', 'en', 'https://lh4.googleusercontent.com/-gEWNeEdpats/AAAAAAAAAAI/AAAAAAAANzI/dv0P_BHtyV8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Customer service is the best. Camiell always chooses the best products for me when i see her. I only go because of her knowledge.', 1524356060),
(2325, 521, 'JOHN DOE', 'https://www.google.com/maps/contrib/110416004585318364218/reviews', 'en', 'https://lh6.googleusercontent.com/-i0cdu5eXTuk/AAAAAAAAAAI/AAAAAAAAAB8/RYrmGRUnlmA/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'in the last week', 'A little tricky to get to, but very friendly staff who actually seem happy to be there! Got high CBD strain, it knocks me out whenever I smoke it. The buds were large and dense. Great place!', 1527250947),
(2326, 521, 'jesse terry', 'https://www.google.com/maps/contrib/112525635366641452123/reviews', 'en', 'https://lh5.googleusercontent.com/-MtDmYX2oCRs/AAAAAAAAAAI/AAAAAAAAA7k/93A17WFmRYY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'I like this place. The staff is awesome at answering any questions and is extremely thoughtful. They don\'t have specials but, they do have quality products at competitive prices daily which is so much better when it really comes down to it. First time patients receive gifts and customers who referred other patients receive gifts as well. No complaints here.', 1517782114),
(2327, 521, 'Tagem Bagem', 'https://www.google.com/maps/contrib/103482947998189350698/reviews', 'en', 'https://lh6.googleusercontent.com/-zjLanT-D2u0/AAAAAAAAAAI/AAAAAAAAAFQ/cFXwASd6NT0/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'Shop has really gone down hill quality and customer service wise. It\'s the 4th best shop in the area out of 4 shops. Sold me a bum battery and simply told me to buy another one less than 10 days after purchasing original. Also all the bud tastes like TRASH! ULTRA, VERDES, EVEN MINERVA ARE ALL BETTER THAN THIS SH*% SHACK!', 1525986008),
(2328, 521, 'D Rod', 'https://www.google.com/maps/contrib/102692050723354512657/reviews', 'en', 'https://lh4.googleusercontent.com/-ibSERpjMIsE/AAAAAAAAAAI/AAAAAAAABiA/PmGp5eJyv30/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'Nice selection and friendly staff! Also cool they have some edibles and oils. Now we can smoke legally and make tax money too. Thanks New Mexico.', 1515204762),
(2329, 521, 'Soul Refraction', 'https://www.google.com/maps/contrib/109463933185610148291/reviews', 'en', 'https://lh6.googleusercontent.com/-bB450GV9ycw/AAAAAAAAAAI/AAAAAAAAQSo/5AwTA0KQZcA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Great place, staff was very friendly, need more signs, it\'s a little hidden', 1522516454),
(2330, 522, 'jesse gutierrez', 'https://www.google.com/maps/contrib/116617501207977569469/reviews', 'en', 'https://lh6.googleusercontent.com/-nSXLWyUkMjU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3oI_rOJgiXZjcWct8C6heEt-LYNQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I was wonderfully surprised by the professionalism and courtesy I received here. My favorite part was the one to one individual attention. I read the review of the gentleman previously and what it looks like to me is that he had an expired Patient ID Or PPL. New Mexico law states that the dispensaries have the right to refuse service to patients that are expired and if they do its against the LAW. We want to keep the legit people in business. Shift keep up the good work!!', 1525114958),
(2331, 522, 'Sam Wilkins', 'https://www.google.com/maps/contrib/110534383906021450063/reviews', 'en', 'https://lh4.googleusercontent.com/-OnxwOqR8sLs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1VplesxzOlt4O61-d2Tu9RdcUA7g/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Everyone with a PPL license knows that they must keep their current medical card at their grow at all times. Shift would not serve me because the medical card I carry is not the current card. The current card must stay at the Personal Production License location.  They were able to check that my card is active and valid but won’t help their patients because they claim “medical patients must have their current card on them at all times.” So they are liars too. Also it’s my birthday. Shift New Mexico is an inexperienced and still very new dispensary catching up with New Mexico’s medical cannabis program. Get on board guys!', 1524956822),
(2332, 522, 'Coach Love3', 'https://www.google.com/maps/contrib/111318333438092716535/reviews', 'en', 'https://lh5.googleusercontent.com/-i8rLoB7NB8I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2gIPDkym2ngUFS2a5fEtyTV-X2ug/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', '#1 in cultivation if you ask me! Hats off to cultivation over here, the Bisochito and Stardawg are out of this world! You guys have such a great team and system going. Keep up the great work!', 1526148145),
(2333, 522, 'Aaron Vigil', 'https://www.google.com/maps/contrib/113186783443513096816/reviews', 'en', 'https://lh6.googleusercontent.com/-dKp0bim29bg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3wtBghWrAZno7df13pQ8VJZsf7cg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Incredible staff! Well concerned for patients well being. Great consultations for any questions.', 1521255988),
