(2351, 526, 'Nick T.', 'https://www.google.com/maps/contrib/115903222658060639021/reviews', 'en', 'https://lh3.googleusercontent.com/-iHNQQnxos_0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2AC9nUZSi5EnBR-LwooJZgvmgU_Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a month ago', 'Staff semi informative and knowledgeable about products they sell however pushy on the sale not impressed with any flower thus so far purchased product has been overcured n real gud aroma or nug profile present n for the outrageous price per gram not a fan but hope to return for a comp new experience had sum personal fav strains but needed better curing..', 1525021433),
(2352, 526, 'Ja J', 'https://www.google.com/maps/contrib/107081198388854782603/reviews', 'en', 'https://lh3.googleusercontent.com/-GhsUAnkPImU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2sTvXT_kLsAtkqdzuL6FguX02A6A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'They are really nice here, helpful, informative.  Thanks guys!', 1527453117),
(2353, 526, 'Renna Sillivan', 'https://www.google.com/maps/contrib/100055924319662319954/reviews', 'en', 'https://lh5.googleusercontent.com/-qXjxjdyHb9w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq24X_ajXUC9NZUSyITjJMQigaz7VA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Staff is friendly and answer any questions i have and the prices are even better than the service i \"highly\" recomend this shop location is perfect too', 1516746450),
(2354, 526, 'Kyah Kelley', 'https://www.google.com/maps/contrib/112878867377903574174/reviews', 'en', 'https://lh5.googleusercontent.com/-r1oGmmx9VU4/AAAAAAAAAAI/AAAAAAAAABs/dPmqshfNQgk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '9 months ago', 'They are nice, close to my house and fast. Their bud is good, but don\'t expect much from their top shelf strains. They don\'t always have the best in quality, but their deals make it cheap so it\'s still totally worth it to try here, plus they give you perks for different things, more than most dispensaries. They don\'t include tax in their menu price, just be aware of that. But yeah, still a great place. I will keep going here :)', 1503505981),
(2355, 527, 'Justin M', 'https://www.google.com/maps/contrib/100183671653499604297/reviews', 'en', 'https://lh6.googleusercontent.com/-Gm1dOdtZmA4/AAAAAAAAAAI/AAAAAAAAEzU/6OpLIRKZm3E/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'This is my favorite dispensary. The staff is amazing, the products a very high quality, and the prices are completely reasonable. I especially like their cookies. They are potent and taste great. I also love that my dog can come in with me. I take him pretty much everywhere and don’t like to leave him in the car alone.', 1525191500),
(2356, 527, 'Bobbi Sands', 'https://www.google.com/maps/contrib/102552306580005462014/reviews', 'en', 'https://lh3.googleusercontent.com/-0jyjaogCC0Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0dS8HJcWAxizgtjfEJfvfXw9vSHw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 weeks ago', 'You guys are all phenomenal! Your products are ALL extremely HIGH quality that can\'t be beat. I can\'t stress enough how very important quality is and Verdes IS QUALITY. I have found nothing that compares.', 1525986109),
(2357, 527, 'Andrew Valencia', 'https://www.google.com/maps/contrib/106530671918509563838/reviews', 'en', 'https://lh4.googleusercontent.com/-KwR_IoFQx1Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1LzByY0U5mOlEBGnBa2PfCACrfZQ/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '2 months ago', 'Really cool place. Its more like a lounge and that makes u feel more comfortable and the ambiance is great but the staff is what puts the icing on the cake. They r always so friendly and informative and more than happy to answer any questions or explain anything to u about any product, they don\'t make u feel like they r in a hurry or u need to stop asking so many questions they really wanna help. Cause I have had negative experiences at other dispensaries with those kinds of things. But not here. Greatly recommend it.', 1520275558),
(2358, 527, 'Jennifer Martinez', 'https://www.google.com/maps/contrib/116052593728502594213/reviews', 'en', 'https://lh5.googleusercontent.com/-oxOGEEKyySk/AAAAAAAAAAI/AAAAAAAAE9E/ygkJf18VqPc/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'Always a good price on the flower and they have the most welcoming environment. I really appreciate how the terpenes are clearly listed on the bottle as well as which ailments would benefit from each strain. I haven\'t seen that anywhere else. Their in-house edibles are delectable.', 1526498454),
(2359, 527, 'Shannon Raven', 'https://www.google.com/maps/contrib/112910201488086238884/reviews', 'en', 'https://lh4.googleusercontent.com/-0pkVz-LjY3s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0S6GxnuPwn1rH_RLJo6yBXEznvBA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The clerk, Brandon did an excellent job, he was very thorough and did and awesome job. He went above and beyond to ensure we got what we needed.  I would definitely use this  dispensary!', 1526760634),
(2360, 528, 'DUKECITYREAPER3', 'https://www.google.com/maps/contrib/115516789573616102426/reviews', 'en', 'https://lh3.googleusercontent.com/-I3BRoLAkB94/AAAAAAAAAAI/AAAAAAAAABo/-qwIwMoMFMc/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'R. Greenleaf is on my List of Top 5 Dispensaries to visit in Albuquerque. They always have a Great flower selection with excellent quality and at a decent price. New stock weekly and they can sell out of some selections fast. Great Quality Medicine.', 1520749687),
(2361, 528, 'Melissa Leyba', 'https://www.google.com/maps/contrib/107811124902428463218/reviews', 'en', 'https://lh3.googleusercontent.com/-qugy4PoKl2Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq36FxfUef9dd-qDZNc17OuBSdGxmg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '2 months ago', 'I will never go back to this place! The Coors location is where I went and compared to any other dispensary  the experience was awful! I was scolded for receiving a phone call in front of Everyone who was in there!(I didn\'t know it wasnt allowed) Then was pushed into buying 3.5 gram bags because your only allowed 2 singles per customer! Which is ludicrous! The whole experience left me with more anxiety then I went in with!  You don\'t even get to see them handle your medicine because its behind a wall like a shady drug dealer! Even the samples we\'re like pulling teeth to be able to see! Will never return to this place!', 1522169650),
(2362, 528, 'grace alderete', 'https://www.google.com/maps/contrib/102129344300490834363/reviews', 'en', 'https://lh4.googleusercontent.com/-Rln-VVYUTRc/AAAAAAAAAAI/AAAAAAAAAD0/MemerqYpGGs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Love this place!! Love the staff! Sooo kind and helpful and knowledgeable! It\'s my main spot!! #teamRgreenleaf', 1523490485),
(2363, 528, 'Khalil Joaquin', 'https://www.google.com/maps/contrib/106617529924225756473/reviews', 'en', 'https://lh4.googleusercontent.com/-52S5cYHbb58/AAAAAAAAAAI/AAAAAAAAADU/rvPjV-pzWu4/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '6 months ago', 'They used to be good but this place has went down hill in dramatic fashion the last few months.  They started selling \"strawberry cough\" on sale for $7g and it was worse than brown brick mexican weed.  Now they stopped doing special with no warning or reasoning.  The people that run this place ARE NOT and have NEVER been 420 friendly they\'re in it to make a buck and it shows. Selling cheap quality product for high prices', 1509834115),
(2364, 528, 'Saw wil', 'https://www.google.com/maps/contrib/115947360958048241981/reviews', 'en', 'https://lh3.googleusercontent.com/-bRBqRU5WH9A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0abgw99Us1iKo3Yd-FpYy1KofimA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Be careful buying 10g mix bag. Got one that was bad and when I returned it they performed a bait and switch on me and replaced with 3 less grams than I paid for. Bait and switch is illegal.', 1522085816),
(2365, 529, 'Martin Mcclenny', 'https://www.google.com/maps/contrib/101107745441460756992/reviews', 'en', 'https://lh6.googleusercontent.com/-3EdVMwu6Xtw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0aNpDHd3fyfF3UkycvHxBuGwtFAA/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '3 weeks ago', 'Came in last week with my lady to sign up and get evaluated for my ptsd from the military and was approved for my medical card. The whole process was relatively quick and the girl at the front desk was helpful and explained everything very well. Overall a good experience, only thing I was bummed about was seeing the military discount offered but didn’t get one when we paid, other then that very happy and looking forward to gettin my medical card in the mall soon.', 1525842480),
(2366, 529, 'Amber Trujillo', 'https://www.google.com/maps/contrib/108225191695965602083/reviews', 'en', 'https://lh5.googleusercontent.com/-tcJPG7Jr0ak/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0eZ3RbMMmFwgjZRJCplH0ssXJKnA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Friendly staff, great prices, knowledgeable information, great CBD products, & such a quick process! Will definitely go back!!!', 1525885796),
(2367, 529, 'cheyenne rose', 'https://www.google.com/maps/contrib/114284139983414436665/reviews', 'en', 'https://lh4.googleusercontent.com/-w6X1aMO7TOU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1VKoWSKtOJXPLonpD5zQlAmQtgyw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Zia health is not a dispensary, they do not have flower! But the staff is very helpful and can walk you through the process and answer any questions you have for the process! Their prices are very reasonable and they also have great CBD products!', 1519149535),
(2368, 529, 'Rudy Gonzales', 'https://www.google.com/maps/contrib/115814968935042003395/reviews', 'en', 'https://lh4.googleusercontent.com/-kjTj78C9UuQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3wwITuqvSVb89WGDfrsZN-bZrrIQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'The staff was respectful and the PTSD evaluation was thorough, and was excicuted very well and fair will be coming back to recertify. The Dr was the best part because she follows up with you and makes you understand why you feel how you do and how it will help. Thank you so much Zia Health and Wellness! The facility was also roomy and comfortable :-)', 1519938246),
(2369, 529, 'Southwest med grow', 'https://www.google.com/maps/contrib/110888648867140846628/reviews', 'en', 'https://lh6.googleusercontent.com/-GJD0o6ZKUA0/AAAAAAAAAAI/AAAAAAAADZg/DOD0feU-RhQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'Flower are week airy and not good at all go spend your money somewhere else not worth you time to even look at thats how bad and ugly those bus look I will never ever go back I will buy on streets before I got to them', 1517948707),
(2370, 530, 'Erin Oliver', 'https://www.google.com/maps/contrib/101231301821491959116/reviews', 'en', 'https://lh6.googleusercontent.com/-kOZ7F_8jjYg/AAAAAAAAAAI/AAAAAAABNzk/7dTjEzDyvOY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, '2 months ago', 'I would give five stars but they never have any edibles left when I tend to head down there. That said! I have tried a few other places but these guys are great. Their building and display area is immaculate. The flower is good and they have probably the best edibles in the state. They also have canna lemonade that is so so so good. They almost always have some sort of special. It\'s a bit off the beaten bath but I really like this place.', 1521496350),
(2371, 530, 'Stan Jankowski', 'https://www.google.com/maps/contrib/101316675230458997627/reviews', 'en', 'https://lh5.googleusercontent.com/-KzBra7n8ohI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq27EQP3J0lLeO-rKEbp0WkfRBWZGA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Wonderful people makes for a wonderful establishment. Reasonably priced,high quality products. Nice variety of paraphernalia. Grow shop on premises. Daily deals so watch the website. Rewards for loyalty.', 1524260537),
(2372, 530, 'Christopher Calderon', 'https://www.google.com/maps/contrib/104865133069498954155/reviews', 'en', 'https://lh3.googleusercontent.com/-fKfX3GQbXMI/AAAAAAAAAAI/AAAAAAAAABM/uivn7fVSn2M/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'Between two visits I waited around for forty minutes in the grow supply area.  On both visits the guy at the front desk just sits and plays on his phone.  Employees walk by the area, they look at me, see me but walk the other way.  No one stops and let’s me know that someone will be there to help me get my grow room set up and take $500 of my cash.  I will have to go to someone else that is organized enough to help a paying customer.', 1519499764),
(2373, 530, 'Ariella Candelaria', 'https://www.google.com/maps/contrib/113034470736752855027/reviews', 'en', 'https://lh3.googleusercontent.com/--J86VPYEkPc/AAAAAAAAAAI/AAAAAAAALWQ/f4bXoJPTwxQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'This  dispensary is one of the best I’ve been to! They are less than 20 mins from home. They remembered my name after 2 weeks even when I changed my full name! They are always willing to work with me to find alternative medicine especially when they are out of the flower which worked for me  previously. They have a CBD store so if you don’t have a medical card you can still buy CBD products because CBD is legal in all 50 states. However, a few times a month they run out of CBD products like the tranquility Heemp lotion and CBD chicken Doggie treats (which my Blue Heelers need a lot) and get back ordered for weeks at a time and every few months they chage the brand of their CBD pills which is anoying because Charlotte\'s Web 35mg were perfect for several elderly relatives and the  previous brand they had  wasn’t working at all. And now as of May 2018 they have another new brand which is kinda sorta working but again not as well as The charlottes web 35 mg. On the up side they haven’t run out of Jedi Kush flower and have constantly carrying it for a few months. If they are able to carry  searching flowers trains constantly without switching ever week that would be great because when I find a strain that works I want to continue to have access to it. Like Granddaddy Purple they had it for two months two years ago and it worked perfectly but never carried it again!', 1526912321),
(2374, 530, 'E. Dunn', 'https://www.google.com/maps/contrib/117079128478040998504/reviews', 'en', 'https://lh3.googleusercontent.com/--6gzlVT9EeE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0RPvbsn_L6dvPJu7CJ8Is3zNPgyQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '2 months ago', 'Great selection of smokable marijuana plus edibles like cookies and chocolate infused with THC. Close to home,great pricing, gives free gram of bud upon registration. I enjoyed the atmosphere, service was friendly and professional. Dispensor knew how to answer questions about the product ..like what is wax? Enjoy if you possess a current medical marijuana card which makes medicinal mj legal.', 1522519039);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(2375, 531, 'Ronnie Tarin', 'https://www.google.com/maps/contrib/116852608737414540279/reviews', 'en', 'https://lh4.googleusercontent.com/-6bGQcctnyuY/AAAAAAAAAAI/AAAAAAAAANQ/DwIhwD2P4SM/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Don’t call and ask questions about anything because they make you sound dumb as if you don’t know what you’re talking about. Definitely won’t be coming back here. Natural RX, Los Lunas never gave me problems. Better prices and customer service.', 1522776664),
(2376, 531, 'Julia Nicholson', 'https://www.google.com/maps/contrib/111440820975913062076/reviews', 'en', 'https://lh6.googleusercontent.com/-ng5JVNpjI1I/AAAAAAAAAAI/AAAAAAAAGM4/_kG9jUXTs7M/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'I like the fact that you can get everything you want from Minerva. I have been to 3 different stores of there\'s and they all have there own thing going on.\nHave always been greeted at the door in a nicely manner, the people who work at the counter in the back are always very pleasant and knowledgeable about their products.', 1525370784),
(2377, 531, 'Boss Lady z', 'https://www.google.com/maps/contrib/113538678249966302493/reviews', 'en', 'https://lh4.googleusercontent.com/-W3apNfFYmTM/AAAAAAAAAAI/AAAAAAABBR4/zk8InTc0Ydc/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'This place is great if you have questions. They are very knowledgeable and have lots of great advice.I highly recommend it. The staff is very kind and  compassionate .I travel all the way from Albuquerque .', 1524502445),
(2378, 531, 'Anthony Houle', 'https://www.google.com/maps/contrib/103798434502079539500/reviews', 'en', 'https://lh6.googleusercontent.com/-jpp2WG8d1xM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3EF_EMTzVYGj_RnQT68ab3eCdIpQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'Check your units often if you shop here. Employees will sign into your account and use your units. Management is well aware of this too.', 1526322148),
(2379, 531, 'pat poole', 'https://www.google.com/maps/contrib/114053605527007230691/reviews', 'en', 'https://lh5.googleusercontent.com/-b4NslzCVphM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1AIXR7TwIID9qz83JO06zXikBgkw/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'in the last week', '2 stars is a little generous they just aren\'t that nice and the product isn\'t organic or what I need.', 1527613373),
(2380, 532, 'Holly Friend', 'https://www.google.com/maps/contrib/112324016980537978142/reviews', 'en', 'https://lh6.googleusercontent.com/-nPUfryrnyrs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq05tMA4fIsew4JNmPGbEw0Brj56MA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'At the Earth Day celebration in Nob Hill. The artist was super friendly and so was his helper friend. :-) beautiful Glazes and super interesting shapes. Great stuff. :-)', 1524437981),
(2381, 532, 'Arthur Clingman', 'https://www.google.com/maps/contrib/110744121070247268544/reviews', 'en', 'https://lh3.googleusercontent.com/--D_HmOR37UA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3vTusYkeOjkQ59SwvF5pPMZoxJaw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'They have regular sales every day and when you go you know what to expect and they give senior discounts not just veterans . Also they will sell you what you have money for. And the tax is figured in the price, also on the senior discount they are the only place that does this. Arthur C. -- I give out of 5 stars a 6. Art', 1516545031),
(2382, 532, 'lexi benavidez', 'https://www.google.com/maps/contrib/102851016324177751273/reviews', 'en', 'https://lh3.googleusercontent.com/-6xFZDfnMm7c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1IQ54511RT0yr323fGU4KRxlX99A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'My favorite dispensary! There customer service is the best there very friendly and have lots of knowledge . (:', 1525575110),
(2383, 532, 'Richard Karakla', 'https://www.google.com/maps/contrib/111328505893735756009/reviews', 'en', 'https://lh5.googleusercontent.com/-o0pKP1E9Y1Y/AAAAAAAAAAI/AAAAAAAABXU/AbN-B7lMu_E/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Just as good as westside location the staff is great the prices are fair and there is always great medicine at ultra health.', 1520312792),
(2384, 532, 'killer Taz', 'https://www.google.com/maps/contrib/115518371844356411937/reviews', 'en', 'https://lh6.googleusercontent.com/-monOB2WRnoA/AAAAAAAAAAI/AAAAAAAAAN4/WpL1xtZEvB4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'Best place to go to and friendly and very informal information from staff.', 1525632926),
(2385, 533, 'Naughty Librarian Shoes', 'https://www.google.com/maps/contrib/114152367697072310669/reviews', 'en', 'https://lh6.googleusercontent.com/-ALujQbxB420/AAAAAAAAAAI/AAAAAAAAIOw/onn-k-IbEps/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a week ago', 'Best Bud Baristas in town. I love Urban Wellness inside and out from the modern upscale decor to the friendly and knowledgeable staff. There is always something new to try and the quality is consistent and potent. They always have great specials and discounts and a nice rewards program.', 1526932600),
(2386, 533, 'Clearcoffee AJ', 'https://www.google.com/maps/contrib/114463762241139278518/reviews', 'en', 'https://lh6.googleusercontent.com/-5JbpDusEItY/AAAAAAAAAAI/AAAAAAAAEc8/8RWbqInXeFo/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, 'a month ago', 'This is a good dispensary. However, very disappointed with 420 sales. California gives their loyal customers gifts and great discounts for this stoner holiday.  Actually, daily gifts are offered, not just on 420. The discounts offered were weak and were not worthy of my time or money. Very disappointed!! A little appreciation for customers who spend their hard earned money at your establishment would really be a boost to your business.', 1524391337),
(2387, 533, 'Bobert houston', 'https://www.google.com/maps/contrib/102329583721752126214/reviews', 'en', 'https://lh4.googleusercontent.com/-za6z1OEgoDg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3RCLLpoGumoJ624LwExxnjmNagzw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Always fantastic. The best quality at fair prices with awesome rewards program and veteran and student discounts. What\'s not to love', 1523821207),
(2388, 533, 'JayJs', 'https://www.google.com/maps/contrib/118041178821420655775/reviews', 'en', 'https://lh5.googleusercontent.com/-l5oux9_s2cg/AAAAAAAAAAI/AAAAAAAAABA/5u2X4MV-B2E/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Best in town hands down the people the environment the product nothing matches this  experience in town They know when patients need help and how to do it try not to go to another place but this one', 1525650248),
(2389, 533, 'Jeff Cowen', 'https://www.google.com/maps/contrib/117030680321845134062/reviews', 'en', 'https://lh6.googleusercontent.com/-0f_6iUWIYwU/AAAAAAAAAAI/AAAAAAAAAEs/gT2kh2pfexk/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, '2 weeks ago', 'Always a problem with this dispensery. Today assured that they are now on my never return list. The issue always seems to revolve around bait and switch. First they advertise sale products they don\'t have then try and up sale you. I went in today after getting the email. Karma Cookies 12 dollars. So I schlep over first thing, we don\'t have that flavor. Bud tender recommended a chocolate bar, twice I asked if it was the same price as the cookies and he said yes both times. It was 8 dollars more than the cookie. I said wait, I don\'t want this for 20 dollars. Honestly I can do better price wise, another dispensery has 300 mg for 23$ why would I pay 20$ for 200 mg? So after we straightened that out I said I\'ll take my second choice for the cookie. We\'d been talking about how I use indica for sleep. He came back said he had a indica cookie. Great, I\'ll take it. He failed to mention that it was 5 dollars more than the other cookies. They offered to take it back, but the issue is I don\'t drive, I am disabled, it\'s litterally 2 hours round trip on the bus. Not much they could offer me to make the trip again. Way to many options for dispenseries here. Prior to hitting Urban Wellness, I stopped by another dispensery for a 40 dollar quarter of 20 percent THC flower. \n Way to many choices to put up with this. With dispenseries offering quality bud for anywhere from 6 to 8 dollars,  this place looks worse and worse. Just received 3 email blasts, one dispensery having several strains at 6 dollars a gram, another dispensery with a 7 dollar gram, a 8 dollar gram and 9 dollar grams. As someone else pointed out their 4/20 was nothing really. While other dispenseries gave out free pro rolled, or 18 dollar 8ths or BOGO. Urban Wellness didn\'t offer much. \nI\'m sure there are people who love this place, I\'m not among them.\nUpdated 5/16. This typifies Urban Wellness. At 3 pm I get a call, goes to voice mail, no message. When I get home I dial the number it\'s Urban Wellness. I say someone called me from this number. He insisted he\'d been at the front desk since 2 and didn\'t call. I\'m like well how did I get this number then? Of course he sticks with his story. Must have been Russian hackers', 1526507045),
(2390, 534, 'kevin gallagher', 'https://www.google.com/maps/contrib/116177288696957320041/reviews', 'en', 'https://lh6.googleusercontent.com/-HqbDTy-3aSE/AAAAAAAAAAI/AAAAAAAAENI/74VRjqOyKqY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I don\'t think there is one dispensary out there that carries All of the products I like, but this place just about does. Excellent flower selection! Laid back staff, not pushy at all. Definitely my go-to shop', 1524576816),
(2391, 534, 'Jade Myers', 'https://www.google.com/maps/contrib/113104919381179930537/reviews', 'en', 'https://lh6.googleusercontent.com/-BRUgD-af1DE/AAAAAAAAAAI/AAAAAAAAAB0/H_yqOCs-bhg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I\'m a big fan of mother earth herbs. I was able to get my card for about half of what other places charge. The staff is super friendly and helpful. \n5/5 would recommend.', 1522527611),
(2392, 534, 'Paula A. Arellano', 'https://www.google.com/maps/contrib/112047557932535179493/reviews', 'en', 'https://lh4.googleusercontent.com/-wuEOI932T28/AAAAAAAAAAI/AAAAAAAAKKg/sAR8MX41nQc/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, 'a month ago', 'I travel from Rio Rancho namely for their top notch customer service! Although they didn\'t have the product I desired on a previous visit, they had ample supply this go-round!! I will be sure to enjoy their late nights until 9 p.m. too.....', 1524661930),
(2393, 535, 'Kristie', 'https://www.google.com/maps/contrib/108046922510974944962/reviews', 'en', 'https://lh3.googleusercontent.com/-T0GoILthCSQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1zFW2LOwn2FUQYgliM5XyQTC8wOQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a month ago', 'Staff is warm and helpful... great product considering all the unreasonable restrictions NY has forced on the companies. Stronger would be better, but that’s not Etains fault it’s the states. I use vape oil.. Doesn’t taste like garbage or burn throat like Vireo does. A little pricey but comparable to others cost, and the only one not cutting their vape oil with tons of chemicals. Hopefully NY will improve laws... I personally get worried since the research has been done on dry matter and feel NY didn’t know enough about vape oil side effects to force it on the people of this state who need the medicine.. however... atleast Etain is keeping it as close to pure as possible... update went to my ent and the vape oil is seriously irritating my tonsils ... thanks ny for forcing these chemicals on me in order to get the medicine I need', 1523725319),
(2394, 535, 'SUSAN SEALES-BURNETT', 'https://www.google.com/maps/contrib/103882321704638228383/reviews', 'en', 'https://lh3.googleusercontent.com/-Gxn3hARXMgQ/AAAAAAAAAAI/AAAAAAAAh9w/0fooKE8K1c8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '9 months ago', 'This was my first visit. I had a very great experience. They took the time to explain everything and answer all my questions.', 1503432036),
(2395, 535, 'Justin Schlenger', 'https://www.google.com/maps/contrib/112887777178748810062/reviews', 'en', 'https://lh4.googleusercontent.com/-55AzN-wEFVE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0cNLjVr9769v4c2g1wjMNMacELVg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Wonderful products, friendly people, the pricing is the best around, and the choice of delivery methods is great.  I, personally, love the spray!!!', 1510264299),
(2396, 535, 'Mary Heiliegh', 'https://www.google.com/maps/contrib/116015693904852699953/reviews', 'en', 'https://lh4.googleusercontent.com/-aK67f5nqci8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Hogml2AbF3XHkqB-JVVKPerL0zQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a year ago', 'I have been visiting Etain for several months. The staff is always welcoming and has a vast knowledge of the medicine they offer. The pricing is fair and they offer a rewards program that I think is great. Would highly recommend scheduling a visit.', 1489077358),
(2397, 535, 'Nicole Ndiaye', 'https://www.google.com/maps/contrib/114085255306775957035/reviews', 'en', 'https://lh6.googleusercontent.com/-lYE2eEebNO4/AAAAAAAAAAI/AAAAAAAAAB0/SOZBnvWdmkY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'Best quality so far.. A little pricey but well worth it!!', 1505127017),
(2398, 536, 'Jeff Stanalous', 'https://www.google.com/maps/contrib/102385343413823341110/reviews', 'en', 'https://lh3.googleusercontent.com/-GlT6gFstXrg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3F8gAbb8hGrJjofOGRcXXskS1zWQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'a month ago', 'I went to Columbia Care for the Pill they offer. Once there I was informed about the contents of them. I may as well go back to my pharmaceutical RX\'s. Why are the NY dispensaries altering a natural medicine and adding questionable ingredients to the products.   I did speak with Etain and they seem to be the only company that has natural products. I have an appointment on Friday to confirm. I will keep you all updated.', 1523969346),
(2399, 536, 'Jesus Aponte', 'https://www.google.com/maps/contrib/104038144480168981698/reviews', 'en', 'https://lh3.googleusercontent.com/-7urAuRXn7hg/AAAAAAAAAAI/AAAAAAAAAPQ/FUmuTY-S1v0/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'Very cool friendly environment. The staff is very helpfull  i recommend this dispensary to all in ny', 1525806943),
(2400, 536, 'NANCY OCONNELL', 'https://www.google.com/maps/contrib/114920228617931859761/reviews', 'en', 'https://lh4.googleusercontent.com/-yzyK2Po7RIE/AAAAAAAAAAI/AAAAAAAABTs/_xaXJfbFmFk/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, '3 months ago', 'You still wait with appt times.  Receptionist is very sweet.  The sales Pierson could have explained the vapor pen better.  It was my first time there.', 1518419895),
(2401, 536, 'Tony Dunlock', 'https://www.google.com/maps/contrib/101472748252611834673/reviews', 'en', 'https://lh6.googleusercontent.com/-vJOGtumCZTE/AAAAAAAAAAI/AAAAAAAAAB0/MIuWBNuPpUU/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a month ago', 'Great staff very knowledgeable. Only negative concern was security guard/doorman was very rude and obnoxious.', 1524020369),
(2402, 536, 'SilkyGoldenGlam Artistry', 'https://www.google.com/maps/contrib/114282345469500784373/reviews', 'en', 'https://lh6.googleusercontent.com/-0DTvMJd8i58/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1-eHa6oz9oj2DPKgIskf-BaaG88g/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'Super professional and welcoming.  The process is easy and fast.', 1524021824),
(2403, 537, 'Petros Kenaniah', 'https://www.google.com/maps/contrib/108288071549110906204/reviews', 'en', 'https://lh6.googleusercontent.com/-6JmOWgtnr6Q/AAAAAAAAAAI/AAAAAAAAAAc/-BnjIe0OnzU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very strong products. I did not have to spend 20 minutes vaping before being able to get going on the day. I\'m very impressed, huge menu of medications.', 1525030759),
(2404, 537, 'Daniel Wiley', 'https://www.google.com/maps/contrib/105862656946646501129/reviews', 'en', 'https://lh4.googleusercontent.com/-yNxrsDpt3OE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq24sFRhNHRQce4v28KxTqpoU5Kq9w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'The staff  are very nice and inviting. The product seems good but like others have said, it can be expensive. I don\'t blame them but NYS for these prices. Cannabis costs in this state is too high for sick individuals who may even miss work and pay due to the illnesses. You listening NY?', 1519929351),
(2405, 537, 'Michael Cluer', 'https://www.google.com/maps/contrib/116019816167474245209/reviews', 'en', 'https://lh5.googleusercontent.com/-bILPcBc-sno/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0yidypEMf8g2Pxou-2DUInggOaDA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great experience always with the helpful folks & medicine at Etain. Prices are high but the quality is top notch.', 1524346961),
(2406, 537, 'Carmen Ramirez', 'https://www.google.com/maps/contrib/118130184990820466985/reviews', 'en', 'https://lh5.googleusercontent.com/-BkcB6lhsh2s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2HAuEzDkxl23R4SOClTPFGwKAFoA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '3 weeks ago', 'Nice friendly place but quite pricey', 1525914093),
(2407, 537, 'John Brouda', 'https://www.google.com/maps/contrib/103343313955719213982/reviews', 'en', 'https://lh3.googleusercontent.com/-2eLHVZHeUJw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0R3Sc3E55mbKNp1dw-3GLa3bBBCw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Just wrote a longer review on Yelp, but the quality here is unbeatable. A bit pricey, but definitely worth it if you\'re looking for high-quality cannabis in New York. Definitely recommend this dispensary, especially for those of you that commute in to Grand Central/it\'s very close.', 1523028426),
(2408, 538, 'Stephen Depass', 'https://www.google.com/maps/contrib/101000334890400547729/reviews', 'en', 'https://lh5.googleusercontent.com/-4FDVsaLeJhk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1HAiTT5E0XKldzo2zqoZxwzqe2YA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'They helped my Dad with his Chronic pain and the results were fantastic. Thank you so much! I didn\'t know how much this would help!', 1502124090),
(2409, 538, 'Oscar Hood', 'https://www.google.com/maps/contrib/113649748671265235495/reviews', 'en', 'https://lh3.googleusercontent.com/-xFrSjW7EWyU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3tFkfWafAq_NgWQqSuODyjGDrDfw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', '', 1523587622),
(2410, 539, 'Donna Ferrante', 'https://www.google.com/maps/contrib/101696233663779519970/reviews', 'en', 'https://lh3.googleusercontent.com/-kYZQ_7DfE2I/AAAAAAAAAAI/AAAAAAAAABY/S1qqyxoxla8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Vireo Health is a very clean, efficient and well established facility set up for people who have special needs.\nI love there services that they provide. They have been nothing but kind and understanding to me since day one. I will continue to always use this particular facility.\nThere home delivery service surpasses my expectations. I don\'t know what I would do without it. They are always on time and give you up to the minute tracking information \nThank you Vireo Health.', 1526216034),
(2411, 539, 'Stuart Udell', 'https://www.google.com/maps/contrib/105905634810491626139/reviews', 'en', 'https://lh3.googleusercontent.com/-E8L0y7FLQ4M/AAAAAAAAAAI/AAAAAAAAACM/S7EoPjRoOEE/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '3 months ago', 'Lovely caring and efficient staff. They provided excellent pharmaceutical advice regarding product options and recommendations. Refills are always ready on-time for pick up.  Parking is a bit difficult, with very limited street/metered parking that is strictly monitored.  (Received a ticket once.) Tip: buy something at White Castle next door and park there when running in to make a quick refill.  Highly recommend Vireo above other dispensaries.  The quality of their products are excellent, too.', 1518550761),
(2412, 539, 'Paul Jackson Laura Jackson', 'https://www.google.com/maps/contrib/116968359939915271451/reviews', 'en', 'https://lh3.googleusercontent.com/-7IGoFqEOyGo/AAAAAAAAAAI/AAAAAAAAABk/jLpCQL4kI_0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I have nothing but great things to say about Vireo Health in Queens. The delivery service is excellent. Always prompt and professional!  Very happy with customer service. The only negative is the prices. Hopefully they will be more competitive and reduce the prices.', 1524955192),
(2413, 539, 'Gloria Martinez', 'https://www.google.com/maps/contrib/117293794800524792686/reviews', 'en', 'https://lh4.googleusercontent.com/-f0ef9XsiZPA/AAAAAAAAAAI/AAAAAAAAM_Y/T1JmvT6BVu0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Very good location in Queens, very good customer service prompt and professional. The pharmacist John is caring and explain to you in detail and uses a good vocabulary in terms of natural medicine and allows you ask questions. This medicinal marijuana allows me to a better quality of life. Thanks to the Vireo Team.', 1525867800),
(2414, 539, 'veronica sousa', 'https://www.google.com/maps/contrib/108853514542895829321/reviews', 'en', 'https://lh3.googleusercontent.com/-ejdBhN8-dcM/AAAAAAAAAAI/AAAAAAAAAPE/9gSOUpQjbuQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This dispensary is the best and they deliver right to your door.\nThey are completely professional and courteous. If you call with a  question, they call you back within hours. After trying all the dispensaries in my radius, I found that their product is superior to the others. It has helped my son with intractable epilepsy tremendously in controlling his seizures like no other anti-epileptic medication.', 1524489347),
(2415, 540, 'Alonzo Sanchez', 'https://www.google.com/maps/contrib/103567336068289167966/reviews', 'en', 'https://lh5.googleusercontent.com/-9htgOQXi7yk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq06qyIRDsX9OyRRgw--6d9IAewMoA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Medical Marijuana of New York is an excellent Clinic. They helped my Grandmother with her pain and I have to say, They were really wonderful! I would recommend them to every one! this is a fantastic service!', 1499797169),
(2416, 542, 'Allen Chernenkoff', 'https://www.google.com/maps/contrib/109303390092039952322/reviews', 'en', 'https://lh6.googleusercontent.com/-pk7rHCUCcwM/AAAAAAAAAAI/AAAAAAAAACE/hsbIWT3YKu4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'in the last week', 'Had a wonderful experience.  Staff is very warm, welcoming and compassionate.  A very holistic feel to managing health.  Location is kind of isolated, but that makes for ease when trying to find parking at least.    Staff provide a lot of valuable insight into which products to use to maximize efficiency of their products.', 1527719911),
(2417, 542, 'Mika Jen', 'https://www.google.com/maps/contrib/105010017844068168024/reviews', 'en', 'https://lh4.googleusercontent.com/-d9ZGKe-7moU/AAAAAAAAAAI/AAAAAAAAnTw/KEebznXxdO0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '4 weeks ago', 'Support this location! The staff is very friendly, helpful, and knowledgeable; this location offers a variety of medical tincture, capsules, and vapors; and they deliver! The prices are great compared to other dispensaries in the city and the center is very clean and inviting.\nThere is limited parking in front of the store, so you may have to park around the block. I\'m not sure how close it is to bus stops, but a cab might be your best bet if you have to travel from the train.', 1525207350),
(2418, 542, 'edgarcia012 Garcia', 'https://www.google.com/maps/contrib/107950480930388184370/reviews', 'en', 'https://lh5.googleusercontent.com/-0DBPrMVNkQA/AAAAAAAAAAI/AAAAAAAAIvs/Ei1umOjt8jQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The staff it’s asome waiting time less than 10 mins they need more products good stuff', 1527087399),
(2419, 542, 'Richard Vazquez', 'https://www.google.com/maps/contrib/112576950591607776429/reviews', 'en', 'https://lh6.googleusercontent.com/-s4LaZVmlKsk/AAAAAAAAAAI/AAAAAAAAAAs/JTozkdOO0Ug/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 1, '3 weeks ago', 'f i havent been inside but from the outside it doesn\'t look like much, but I hear that this is a medical marijuana dispensary !?!?!?! I wonder what is going on in there. puff puff pass?!?!?!?. i\nif this post was interesting, helpful, or  informative. please help me by hitting the like button below.', 1525743514),
(2420, 542, 'MsMelo360', 'https://www.google.com/maps/contrib/100487988943548116427/reviews', 'en', 'https://lh4.googleusercontent.com/-4zO5XRS8H1w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1E6XApnIWWCjZBXClojwuyp2XEZw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '4 months ago', 'Professional, compassionate and caring individuals.  I felt comfortable and all of my questions and concerns were addressed. I was not rushed or felt any pressure.', 1516023489),
(2421, 543, 'Bob Jason', 'https://www.google.com/maps/contrib/100611859207439066908/reviews', 'en', 'https://lh3.googleusercontent.com/-MPiw0l5NZNk/AAAAAAAAAAI/AAAAAAAAAfI/pyZ8lomnLQI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'After 1 visit I am happy to say that Dr Z is fantastic - fully knowledgeable, caring and totally open. She supplied and walked me through NYS registration and I had my card in about 10 days.', 1525282754),
(2422, 543, 'michael weinstein', 'https://www.google.com/maps/contrib/100305244513065869242/reviews', 'en', 'https://lh3.googleusercontent.com/--p4YICL5UX8/AAAAAAAAAAI/AAAAAAAAOjY/HZohZCf9zWg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a year ago', 'Doctor Zablozki  is a great doctor who really tries hard to understand the needs of her patients. The doctor also has a holistic focus in which she tries to recommend natural solutions to complex health issues. If you want a doctor who really has the ability to understand the whole patient, this is the one. I couldn\'t recommend a more competent  and highly analytical doctor.', 1492108287),
(2423, 543, 'Lisa Ortiz', 'https://www.google.com/maps/contrib/100085123764167199294/reviews', 'en', 'https://lh3.googleusercontent.com/-SVLetAX7RuU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2BmWE2VhbZrYKQ3Jvv5yNCUIyNUw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Went to Dr. Z and she helped me tremendously with my health condition. She was very informative and spent time explaining to me the possible treatments that would work best for me. If you are looking for a great doctor, go see Dr. Zablozki!', 1492001608),
(2424, 543, 'Lisa Metz', 'https://www.google.com/maps/contrib/110927674736864762768/reviews', 'en', 'https://lh4.googleusercontent.com/-eoXADZTRKrM/AAAAAAAAAAI/AAAAAAAAAXc/FjxaOqCGvl0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Dr. Zablozki goes above and beyond what your typical doctor does. She helped our family through the most traumatic period in our lives . She didn\'t just treat my daughter\'s symptoms or disease, she treated my daughter, the whole human being. She used a combination of her traditional vast medical knowledge with functional, integrative medicine. We were so lucky to have been able to have her treat our daughter and couldn\'t think of anything that should have been done differently because Dr. Zablozki handled it ALL!', 1492109640),
(2425, 543, 'scasa38', 'https://www.google.com/maps/contrib/106566734765740921215/reviews', 'en', 'https://lh4.googleusercontent.com/-jiqz_7yY_yk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ctHoX9lllAh_uG473TKYKEtowWw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I have nothing but good things to say about Dr. Zablozki. She is focused only on the well being of the patient. She guided us through one of the most trying times in our lives as our daughter suffered with severe Ulcerative Colitis. Her compassion and knowledge made us comfortable with our decisions. I couldn\'t recommend any one more highly.', 1492520509),
(2426, 544, 'Danielle Sondrol', 'https://www.google.com/maps/contrib/104618921805026568930/reviews', 'en', 'https://lh3.googleusercontent.com/-JKmiwjD1g1w/AAAAAAAAAAI/AAAAAAAAABo/wqDCL2Ad8Xs/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '7 months ago', 'Compassionate care & Straight forward. If you are in need of access to medical marijuana, Cannabis Doctors of NY should be the first place you call! The whole process is made easy by their excellent staff. Dr. Weinberg is fantastic and in addition to office visit he also performs house calls.', 1507050282),
(2427, 545, 'Laura Navarro', 'https://www.google.com/maps/contrib/118313424783013066331/reviews', 'en', 'https://lh4.googleusercontent.com/-Devs7WYEFxs/AAAAAAAAAAI/AAAAAAAAAD4/rOlysYkas74/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'I love to travel while I work but finding a great place for MJ is not easy. I\'m so glad I found MJ Dr. through BudTrader. I was able to also able to find great deals in New York.', 1499896792),
(2428, 546, 'Dana Hanbury', 'https://www.google.com/maps/contrib/108508099986661475356/reviews', 'en', 'https://lh4.googleusercontent.com/-2UbtddsF1lw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1SKGyJYL4dQZ4TbaHeGCURNbNHSw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '12 months ago', 'Outstanding! Can\'t say enough great stuff about this Doctor. Almost too thorough. Did more than I asked and spends plenty time explaining. This is a person who truly cares....I think he saved my life....', 1496366355),
(2429, 546, 'John Truax', 'https://www.google.com/maps/contrib/104926672999287117383/reviews', 'en', 'https://lh6.googleusercontent.com/-SouBMV_3tGY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1KU9R2wWCnOIYQ7QBXA-xeGwiIsw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'Very nice practice.  Easy to make an appointment, friendly staff, short wait time.  Dr. O\'Brien is in no hurry to get rid of you and answers all your questions in a knowledgeable manner.  He\'s very personable and has lots of unusual things hanging on his walls.  ', 1453419220),
(2430, 546, 'Jess Diller Kovler', 'https://www.google.com/maps/contrib/105660233910933686087/reviews', 'en', 'https://lh5.googleusercontent.com/-B_VAoiYGD_8/AAAAAAAAAAI/AAAAAAAAdMw/R3jXa1RUd1Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', '', 1452865232),
