(2435, 548, 'Robert Hercz', 'https://www.google.com/maps/contrib/116822629026334409492/reviews', 'en', 'https://lh4.googleusercontent.com/-WF7_2amNOBg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2hKQL6qc_gw9oTBk-v6sh63b4vWA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'He listens, takes however long time is necessary to understand your issues. He comes across as emphatic, and offers sensible advice. Recommended.', 1523542488),
(2436, 548, 'Dominique Calero', 'https://www.google.com/maps/contrib/113527606754811993068/reviews', 'en', 'https://lh4.googleusercontent.com/-ZRFuO33WNH0/AAAAAAAAAAI/AAAAAAAABC4/6I62YtWilUE/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '7 months ago', 'Best doctor ! Cares and loves each one of his patient\'s', 1507133027),
(2437, 548, 'Adriane Tropiano', 'https://www.google.com/maps/contrib/109453632396322998361/reviews', 'en', 'https://lh4.googleusercontent.com/-iE9IaUCtmts/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq08iaoXVdhYxgts6fpd4-19unagyA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Terrific doctor and awesome staff. Extremely competent all around, which is very rare these days. The doctor is compassionate, extremely competent and so personable. Ashley and the rest of the front desk staff are amazing to talk to as well. You will not be disappointed here.', 1482424556),
(2438, 548, 'Dwain Lee', 'https://www.google.com/maps/contrib/109523157637652578034/reviews', 'en', 'https://lh6.googleusercontent.com/-jkOsIU9iXww/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1hRzlZRNXO5po1NM8UlH92mcOcKw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 years ago', 'I like Dr. Moskowitz I feel he is detailed and tries his best to explore all options in making sure you\'re well but the assistants at the front desk are a POS. I did a walk-in because I had a fever of 102 and was very congested. I just really wanted to rule out pneumonia.  When I went in I spoke to the ladies at the front desk who told me that no doctor is there right now and they are completely booked and they don\'t do walk-ins. I understand if you don\'t do walk-ins but why lie about no one being here.  While she was telling me these lies I heard Dr. Moskowitz talking in the back and while I was walking out he actually came out into the waiting room. ', 1464100767),
(2439, 548, 'Jonez Datonetech', 'https://www.google.com/maps/contrib/111351749941664611027/reviews', 'en', 'https://lh3.googleusercontent.com/-nXUnGpFtD9c/AAAAAAAAAAI/AAAAAAAAIXc/jlCsC5TEQkA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'Worthless visit\nWorst doctor ever, he do not care about your condition, all he wants is your money, like any other drug dealer in New York, I paid $250 my first visit, to get my card, he told me to make another appointment for a follow up, to come back in 2 months, I did, but when I came for my follow up he tried to charge me another $250, ROBBERY PEOPLE PLEASE BECAREFUL!!!!!!!!!!\nThe Doctor only returns call\'s if you are Jewish\nEvil, evil man......', 1487347470),
(2440, 549, 'Vlads Five', 'https://www.google.com/maps/contrib/117078260371089991809/reviews', 'en', 'https://lh6.googleusercontent.com/-AID7lUU9OtQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2sRiRyCKEwV3OmjkGJaP11MauiOw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Switched doctor to Anna Yatskar over two months ago, Doctor Yatskar and doctor assistant Aleksandr are very nice and  Knowledgeable.  Nastya at the front desk is very friendly, caring and responsive. (Hard to get same type of friendly service at the front desk anywhere now days) Wait time is close to none, just few minutes. Very satisfied!!!', 1521063977),
(2441, 549, 'Nellie Haldey', 'https://www.google.com/maps/contrib/113423436834662354833/reviews', 'en', 'https://lh5.googleusercontent.com/-HZd3UmOIfpI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq24IpkdUd-LyJLQTYPItewOo5l0-w/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Doctor was great initially during the first few visits.  Then, upon asking for a referral to go to a blood specialist, the doctor categorically refused, saying, \' it\'s not my responsibility to give you referrals.\' Given that I have a life threatening blood disorder condition that I informed the doctor about during my first visit, it should have been an easy process. This was an unnecessary ordeal.  Given the situation, it was completely unprofessional for the doctor to behave this way.', 1520903249),
(2442, 549, 'Nao Fae', 'https://www.google.com/maps/contrib/102745699225688089962/reviews', 'en', 'https://lh3.googleusercontent.com/-fbju4OUAwRU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3PdDuMQ6sdJbw-kUPp9wlybxf2dA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'I would give 10 stars if I could! The entire process from beginning to end is excellent. The wait time is usually extremely short; the receptionist is friendly and nice; the medical assistant is also friendly, knowledgeable, and nice; and Dr. Yatskar is a true rare find. She listens to all your concerns, she is patient, kind, professional, understanding, and extremely intelligent. We feel very thankful and feel very blessed to have found Dr. Yatskar and her office.', 1513396427),
(2443, 549, 'Sergey Tyss', 'https://www.google.com/maps/contrib/113495493226603099915/reviews', 'en', 'https://lh5.googleusercontent.com/-LjB0vlvBq1s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0wxIWIL1XOxXdcqACPPgGYqkLxyQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Every time when my family and I have health issues, Dr. Anna Yatskar always helps us. She is very smart and professional , caring and friendly. She is extremely attentive to details, therefore her recommendations and treatment always are very effective. I highly recommend Dr. Yatskar for everyone.', 1514943679),
(2444, 549, 'j m', 'https://www.google.com/maps/contrib/113696951322641649462/reviews', 'en', 'https://lh6.googleusercontent.com/-WckItZO2YJI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq13SKR0MrU95jMXvTabwhNCVMs9dg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'I waited 3 hours!!  Made an appt with her & she was over 3 hours late. \nInexcusable. Total disregard for my time. Will NEVER go there again. Disgrace. Wish I could give a ZERO stars.  The office manager couldn’t give a hoot.  Busy doing nothing ... what a joke !!\n\nBe prepared to wait hours on end.  That office is a total disaster.', 1515626311),
(2445, 552, 'Sharron Talbit', 'https://www.google.com/maps/contrib/114430275069812895455/reviews', 'en', 'https://lh4.googleusercontent.com/-LcQ24yTBkZU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0P0u3vxW7yTWNvICx4hWo1lOqeDg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Very knowledgeable and caring doctor. He provides a good balance between evidence based medicine and alternative treatment. Really helped my mother who was debilitated by pain.', 1511139066),
(2446, 553, 'Maria P', 'https://www.google.com/maps/contrib/100164283845830042235/reviews', 'en', 'https://lh6.googleusercontent.com/-a6sx4UkyLow/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2UeNjwRvU8X-DWXv_J6jpLXZRB5g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Dr. Morgenstern was excellent. He was willing to meet with me to discuss the benefits and risks and science behind medical marijuana for cancer. He didn\'t even charge me for the consultation since I wasn\'t sure about whether or not I wanted to proceed. Highly recommend him.', 1525363372),
(2447, 553, 'Diana Altomare', 'https://www.google.com/maps/contrib/107829720237926637752/reviews', 'en', 'https://lh5.googleusercontent.com/-nGmINzLF-xk/AAAAAAAAAAI/AAAAAAAAACQ/xlqkMEVLxvE/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'This guy is the worst. He\'s in the business of robbing patients. I have MS and when I made my appointment I was told by the secretary that I would qualify because of my MS, what I wasn\'t told was that it\'s up to the doctor if you meet his standard to receive a medical card. What is most upsetting is that I\'m now out $250. Which is absolutely infuriating. $250 just speak to him is ridiculous. He needs to lower his fees. I went there in hopes of alternative medicine and I walked out $250 poorer and no alternative. So I\'m back to square one. Thanks for nothing you thief. He should be ashamed of himself.', 1525468849),
(2448, 553, 'Dianna K', 'https://www.google.com/maps/contrib/117274888663567832860/reviews', 'en', 'https://lh5.googleusercontent.com/-_nlhqfOzt0M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq22zb9r09qOumo3dmR0D6_Y8m8Nbw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'An excellent doctor. Very professional. Knowledgeable about medical marijuana. Really helped me.', 1513653109),
(2449, 553, 'Cheryl Friedman', 'https://www.google.com/maps/contrib/107611603077108627488/reviews', 'en', 'https://lh3.googleusercontent.com/-AF7FRYTupNQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq10rRM_KV61KfT8YUv71lgrrMz6BA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'My elderly mother began seeing Dr. Morgenstern about a year ago after exhausting all other treatment and medication options for her chronic and, at times, debilitating pain.  Despite initial reluctance due to her perceived  stigma  about marijuana, she realized in a relatively short period of time that this drug was indeed providing some much needed pain relief.  While not a cure-all, it did reduce her pain to a much more manageable level.\nDr. Morgenstern\'s genuine concern for his patients and the time he spends speaking with and listening to them is a welcome change from the \"assembly line\"  practices of many doctors today.  While the medical marijuana is not inexpensive and is not covered by insurance, it is well worth it to see a loved one live a better quality of life without overwhelming pain.', 1511730305),
(2450, 553, 'Phyllis Tierney', 'https://www.google.com/maps/contrib/101854907433104302604/reviews', 'en', 'https://lh5.googleusercontent.com/-Tipej55pBCw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0lh8srgu8tdqtgkgY1QX36hyjkgQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'in the last week', '', 1527351216),
(2451, 554, 'Jon Cheney', 'https://www.google.com/maps/contrib/105051272087126176408/reviews', 'en', 'https://lh6.googleusercontent.com/-kd95Z42nkXY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3TWXI2Od6THt4zC4SBzBmLRFUTng/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Very nice people here the card is an affirmative defense card which in an sum is all that you need. 250 total 50 at first for the appointment 200 for card if approved. With the card you can purchase you medical supplies in Michigan and it\'s as simple as that doctor was great.', 1527189411),
(2452, 554, 'Fuh Cue', 'https://www.google.com/maps/contrib/104305412846623224824/reviews', 'en', 'https://lh6.googleusercontent.com/-SBq3oAP5dvw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2OHtpqsMG8IQo8QX4xyJof1AGOKA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'There are Pros and Cons to doing this. \n\nPROS: 1. You don\'t have to wait for Ohio to get their program rolling, you can go to legit dispensaries TODAY. 2. You will have access to one of the top 5 dispensaries in the country (Holistic Health Wayne). 3. The affirmative defense is a real law, and this is real protection against prosecution for your medication. 4. If you have never been to a dispensary, your life will forever change as soon as you walk through the door of one especially a top ranked one. 5. The center is only 45 minutes from the dispensaries. You can go straight there as soon as you walk out the door. 6. You become somewhat humbled by seeing people with real health issues finally getting the medication they deserve. Then you realize it\'s finally happening to you, too. I am on my 3rd card.\n\nCons: 1. It\'s kind of on the pricey side for some at first. Expect to pay roughly $250-$275 out the door card in hand. In all honesty though, it\'s worth it. Buy your meds in bulk and get your money back that way. Places like Holistic Health Wayne have $30/gram extracts and $125/oz deals. 2. The card is only valid for 90 days. After the 90 days is up it\'s $125 to renew rather than full price.\n\nI would recommend anyone do this.', 1523306787),
(2453, 554, 'Cassie Hamm', 'https://www.google.com/maps/contrib/109141203557143570634/reviews', 'en', 'https://lh5.googleusercontent.com/-IuF3Dhc3DwE/AAAAAAAAAAI/AAAAAAAAABE/FcMAGd3JOH4/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'FAKE IN OHIO!! I\'m currently picking my husband up from the sherif Station from their fake cards! Who now is facing charges. Something will be done', 1491705491),
(2454, 554, 'Dan McCoy', 'https://www.google.com/maps/contrib/115415513082762399845/reviews', 'en', 'https://lh4.googleusercontent.com/-vKOIT6Spj8o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Ai0-bos-hBoY6Nfz51DJ01qOslg/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '11 months ago', 'Kinda seems like a racket.', 1497439326),
(2455, 554, 'anal Buettner', 'https://www.google.com/maps/contrib/110758708726997152728/reviews', 'en', 'https://lh3.googleusercontent.com/-qzvvuBsBEwM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2ALfl3KUdmMF98LvdUB3yiOnIBXQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', '', 1511850361),
(2456, 555, 'rapdracula', 'https://www.google.com/maps/contrib/105207075290341955547/reviews', 'en', 'https://lh4.googleusercontent.com/-ofwmDfSFXfU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2rUFdxoqsbUAyJpOLXyuxT5BCkig/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Very friendly staff. They called right on schedule and even called me right back when they said. I am excited for my first appointment!', 1527506533),
(2457, 555, 'charlie brown', 'https://www.google.com/maps/contrib/116549241525100683856/reviews', 'en', 'https://lh6.googleusercontent.com/-6uyd9b2EY8c/AAAAAAAAAAI/AAAAAAAAAVU/fbcmu65z2oQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '3 weeks ago', 'I was supposed to receive a call yesterday at 5 pm but got no response so now I\'m trying to set up for another call, I am really interested in setting up an appointment.', 1525870892),
(2458, 555, 'Ray Brown', 'https://www.google.com/maps/contrib/111968423649620246842/reviews', 'en', 'https://lh5.googleusercontent.com/-nLm7dLlmnOg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3a6V8lm87UB2QFvuWIBiv8CTlakA/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '3 weeks ago', 'I heard it\'s liquid marijuana is that true if so that\'s wack! Dad has card says it\'s liquid not the real thing', 1525894006),
(2459, 555, 'socalsteve555', 'https://www.google.com/maps/contrib/104377835007004730218/reviews', 'en', 'https://lh5.googleusercontent.com/-pFdoc-Eo2wQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Adga0MH3AA8ZKmucuDNhsxO6NYQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'I wanted to learn more about the medical marijuana program in Ohio because I just moved here.  The phone staff here was very friendly and patient.  They answered all of my questions about how to get approved', 1525898075),
(2460, 555, 'stephanie star', 'https://www.google.com/maps/contrib/114758032562383121082/reviews', 'en', 'https://lh5.googleusercontent.com/-sAAwjUf5fBU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1PoVwc9Sd6Ms2N-aa6i7S6C740Pg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Does anyone ever answer the phone for any location? Or return voicemails? Is this even real?', 1525106254),
(2461, 556, 'Tyler Lehmann', 'https://www.google.com/maps/contrib/117266398847625385854/reviews', 'en', 'https://lh6.googleusercontent.com/-ANjA6LdeL_M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3kfQHW1usc72e3B9TD-wLzp-jjHw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Just checking out Hometown Ohio Hemp Scene and nothing but great things from Toledo Hemp Center we hear. We see lots of our local Colorado Brands , we here at The Breckenridge Hemp Co with Brecken Gold Cbd and Pure Spectrum Cbd(UFC Guys) would love And honored to get an opportunity to be on your shelves. We have a box in the mail for samples if you give us the Yes Toledo Hemp Center. Great job guys keep helping our families.', 1524456986),
(2462, 556, 'Renita Kuehner', 'https://www.google.com/maps/contrib/114234351727956561257/reviews', 'en', 'https://lh3.googleusercontent.com/-ixPQKKb4arA/AAAAAAAAAAI/AAAAAAAAV8Y/esjHm7-aAq8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'I was skeptical.  But I bought two products to try.  I noticed lowered pain levels within 3 days.  I am not pain-free, but I am also not in tears anymore.  I’m going back for more lotion and some tea tomorrow!!', 1513992448),
(2463, 556, 'Zeth Nitkonič', 'https://www.google.com/maps/contrib/101882602278286787712/reviews', 'en', 'https://lh5.googleusercontent.com/-dIJqloe_0WY/AAAAAAAAAAI/AAAAAAAACEQ/_6J0TG7dnas/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '5 months ago', 'No where else provides a such a diverse selection of CBD Natural Products. Good Vibes, Tons of learning material.', 1513989613),
(2464, 556, 'Kathy Tucholski', 'https://www.google.com/maps/contrib/104592388353168710444/reviews', 'en', 'https://lh4.googleusercontent.com/-OCnMK9Wb6vc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ZBW-VuxmOmS1X1qKhp0xp9_46vw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Helpful staff ..knowledgeable in products', 1501851543),
(2465, 556, 'Steve Kosik', 'https://www.google.com/maps/contrib/110214571728786481918/reviews', 'en', 'https://lh6.googleusercontent.com/-qrSZXPOd9LY/AAAAAAAAAAI/AAAAAAAAAAg/6V6PRWt4O-s/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'Good prices', 1501556389),
(2466, 559, 'David Keller', 'https://www.google.com/maps/contrib/102475184003900398904/reviews', 'en', 'https://lh3.googleusercontent.com/-jTTRTSH4D9I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq19Gym4GsEIfa6S5GvzZO-Rcua_Ig/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'in the last week', 'From what I hear, it\'s like 150 every 3 months to maintain patient status. No excuse for that', 1527696217),
(2467, 559, 'Carson Ness', 'https://www.google.com/maps/contrib/112160254844355827424/reviews', 'en', 'https://lh6.googleusercontent.com/-j13tBF0lxvk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1jY16AOUlDmGoNp46Cu004JtMitA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great staff of helpful people.', 1523911162),
(2468, 559, 'Mike Wheeler', 'https://www.google.com/maps/contrib/105359531164551666838/reviews', 'en', 'https://lh4.googleusercontent.com/-VBgDt5H8Qt0/AAAAAAAAAAI/AAAAAAAABWw/HOGFr4rTzgs/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'Good place to get medical cards', 1518535080);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(2469, 559, 'mark gruly', 'https://www.google.com/maps/contrib/110274506484866279088/reviews', 'en', 'https://lh3.googleusercontent.com/-ZzLqPWNa2ZE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq25CtDyqxdpA3AcKS6RjlMX760XUQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'Great place, Great people.', 1520351172),
(2470, 560, 'James McCollum', 'https://www.google.com/maps/contrib/116418334032314801112/reviews', 'en', 'https://lh6.googleusercontent.com/-U9VPZeHy__M/AAAAAAAAAAI/AAAAAAAAKMo/m6eYfxNInsE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The two girls were both very helpful and knowledgeable.  They let me try samples and made sure I was buying something that would work for me.  I will be a returning customer!', 1523232329),
(2471, 560, 'Jennifer Cinocco', 'https://www.google.com/maps/contrib/107051656530517326584/reviews', 'en', 'https://lh5.googleusercontent.com/-DkxPxh788F4/AAAAAAAAAAI/AAAAAAAAAEo/iKRQgH6CRJ0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Was there to pick up some gummed for my bosses wife and ended up buying for my husband too. First time he\'s slept deeply in weeks was last night. I\'ll let you know in a month how he is still doing.', 1519743217),
(2472, 560, 'Selina Matthews', 'https://www.google.com/maps/contrib/111358252402737742943/reviews', 'en', 'https://lh3.googleusercontent.com/-mGGQl04FTrM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1diJbXrODUUNVTlAcZOR9KEq2fnw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'So disgusted by the way the assistant manager treated me and my fiancé. Absolutely no help when we were tying to view products. Assistant manager would not look up from her phone. Didn\'t even bother buying anything.', 1524350899),
(2473, 560, 'Julie Coke', 'https://www.google.com/maps/contrib/112437177009608001062/reviews', 'en', 'https://lh4.googleusercontent.com/-IEJYWNlFsLk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1JFFqvqtAAuVGsnmg6uVJGesmI2Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'They were very friendly, forgot to get my 50% discount but he promised on my next purchase to honor it. Friendly staff', 1519935178),
(2474, 560, 'Anonymous Joe', 'https://www.google.com/maps/contrib/100861192760836634372/reviews', 'en', 'https://lh3.googleusercontent.com/-Ow4HQLaDS3c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1sfl17iFXMitSKUjqjd02E08miZw/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '3 months ago', 'Hello all, first off i would like to say I’m very educated with cbd oils I have been using them for a little over 2 years I have done a lot of research before I first starting using cbd to help aid sleep I have purchased many products on line like charlotte\'s web and Restorative Botanicals these are great products for a reasonable price for what you get.\nThe reason I am posting 2 Stars is because the 3 guys behind the counter are extremely uneducated about cbd.\nI feel they got a very low grade product stuck it behind the counter and pretend it’s weed.\nThe guys that tried to sell me on the 2500mg product said “that’s only if you really wanna get messed up” \nThis is very very misleading for people that know nothing about cbd that are looking to a retail store for information about a product they know nothing about getting lied to.\nThat is extremely upsetting\nAlso I overheard another guy behind the counter saying “if you drank the whole bottle you probably won’t pass a drug test”\nWell the truth is CBDs maximum THC percentage is .3 in States that marijuana is NOT legal in in this case Oklahoma, depending on the type of drug test you take even a one time .3 consumption of THC can come up on a drug test , not if you only take an entire bottle ...\nI am a working professional we are subject to random drug test I work in sales and integrity is key for trusting customers \nI’d like to say the guy in the beanie was professional as well as both of the women working at the time.\nI’m personally posting this for the business owner so he or she could have educated  employees to not turn someone else away from your business that knows the product.', 1519970181),
(2475, 561, 'Robin Paul', 'https://www.google.com/maps/contrib/113160122408348751065/reviews', 'en', 'https://lh4.googleusercontent.com/-ZvynPq4DbDo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1_Ldf3IYKr1LlZEWafmO-QTDSxqw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'This has helped my teenager so much, it\'s incredible. Has his life back. Thank you CBD Plus for educating a reluctant mom. Never once felt pushed to purchase anything.', 1525896495),
(2476, 561, 'Kaylee Kerr', 'https://www.google.com/maps/contrib/105892198949812872862/reviews', 'en', 'https://lh3.googleusercontent.com/-ShpVFz9tvCw/AAAAAAAAAAI/AAAAAAAAAD0/VDqb6xXNdvs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'This store is amazing. The employees are extremely friendly and very ready to help. It is a very clean and welcoming environment and I definitely will be returning.', 1526075067),
(2477, 561, 'mheltcel', 'https://www.google.com/maps/contrib/113205092635195201130/reviews', 'en', 'https://lh3.googleusercontent.com/-az-zaIMH3Zs/AAAAAAAAAAI/AAAAAAAAABQ/hkUQBVHqMyw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I started the CBD to help with aches, pains, anxiety, and ptsd I suffer from due to a car accident I had in 2014. It has been life changing. The sales guy get runs this location is very knowledgeable and the store has a very relaxed atmosphere. I recommend this place to anyone.', 1526742832),
(2478, 561, 'Greg Nelson', 'https://www.google.com/maps/contrib/104110672965976913107/reviews', 'en', 'https://lh5.googleusercontent.com/-9fu5GGYEmCQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0lRO5SjeYvy3dKtYMyf2jpq1T3Aw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Every time i enter this location Reid the customer rep that is in the the store is excellent he will talk to you listen to what you are looking for and set you up has helped me tremendously i refer people here any time i talk with anyone. I will not go anywere but to this location. I appriciate everything thank u Reid.', 1526319116),
(2479, 561, 'Mark Carpenter', 'https://www.google.com/maps/contrib/102307710416300618510/reviews', 'en', 'https://lh3.googleusercontent.com/-bg-u1wrve_Y/AAAAAAAAAAI/AAAAAAAAFug/zlUXGyno8ss/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'I am very disappointed in this establishment. I bought some cbd oil and was told it was better than the stuff I was buying, from another provider. That is not why I am writing this bad review. They told me I could refund within 30 days. I take my oil in and do a refund, and the salesman is not allowed to give me a refund. He says a manager has to do it and tells me he will be back in 30 mins come back 30mins latter and he is still not there waiting for him the salesman walks up to my car and says my manager is in Newcastle.... If your going to offer a refund you should be able to get one any time.', 1526664552),
(2480, 562, 'Brandon Shavers', 'https://www.google.com/maps/contrib/114748972577948016844/reviews', 'en', 'https://lh4.googleusercontent.com/-KV6jZlMix-A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ou8y5uXpNSkqrn8UcCf593V0Hlw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I had heard about CBD a while ago when a friend used it as a way to help with her son\'s seizures. Looking into it I also found that it could also help with sleep and insomnia, without the daytime drowsiness of prescription drugs. I was very impressed by the knowledge of the staff at CBD+ and ending up buying a full spectrum CBD oil mouth spray. It works very well for sleep, I\'d say better than melatonin and other natural/herbal sleep aids, and none of the drowsiness or lightheadedness I\'ve had from Trazodone. Great stuff!', 1526576278),
(2481, 562, '86_Babi_Shree Campbellstrong', 'https://www.google.com/maps/contrib/117454132506442107336/reviews', 'en', 'https://lh6.googleusercontent.com/-4zJ11lhYlMY/AAAAAAAAAAI/AAAAAAAAAAQ/V3sv9Cf8ZJI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', '', 1525489219),
(2482, 562, 'Felicia Garnand', 'https://www.google.com/maps/contrib/116730623016396190262/reviews', 'en', 'https://lh4.googleusercontent.com/-D0Mko1LNXdk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1uuI2Z2iI-mYqqfvU1T2ztLIJRnA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', '', 1524961202),
(2483, 563, 'Scott Parker', 'https://www.google.com/maps/contrib/107928045135687711956/reviews', 'en', 'https://lh4.googleusercontent.com/-Y-ZyACakTKw/AAAAAAAAAAI/AAAAAAAAAJo/ncp1AXy29FU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Since my bike accident, I have a broken vertebra and a bunch of other stuff. After knowing my needs they help me to consult with a professional. He gave me a sample of the lotion, after using it I got amazing results in a few days and I could again move my neck in full motion. I am a very happy customer of CBD Plus and I highly recommended their store in OKC.', 1525854569),
(2484, 563, 'Lisa Taylor', 'https://www.google.com/maps/contrib/107117527880018319523/reviews', 'en', 'https://lh5.googleusercontent.com/-_HPLBvgpgOg/AAAAAAAAAAI/AAAAAAAAAE0/p0Xy3u_zi3o/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I have been using this product from CBD Plus for 2 months. I love this product. Very easy to use, great product and adds value to my money.\nUsually, I purchase this product from the store, but for the first time I purchased this product online and this is an amazing experience. My order arrived quickly and it was well packed. So, speaking from my personal experience, this product is the best on the market. Thanks to CBD Plus.', 1523609287),
(2485, 563, 'Cheri brock', 'https://www.google.com/maps/contrib/106318577036931001866/reviews', 'en', 'https://lh6.googleusercontent.com/-0PjQB3tioTI/AAAAAAAAAAI/AAAAAAAAAsg/pU8cx4nDfV0/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Great customer service.  Took time to answer our questions & explain the product.  Will definitely be back.', 1523834579),
(2486, 563, 'Traci Hulsey', 'https://www.google.com/maps/contrib/112552030331989350205/reviews', 'en', 'https://lh6.googleusercontent.com/-cDqmL68oBbI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1MNE4lXFElVDRC-NEgndThjD2hMQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great customer service and very knowledgeable staff. Love the atmosphere and it has helped my anxiety and depression so much!!', 1523219239),
(2487, 563, 'Josh Bruce', 'https://www.google.com/maps/contrib/102291076389657394585/reviews', 'en', 'https://lh3.googleusercontent.com/--Fstz8sUJNs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2SFNadZoWt-vn3heMxM6WqUgS0Cw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'I use a water soluble full spectrum cbd product that is much more cost effective than the products offered at this location. When I asked the employees if they carry water soluble they dismissed the product as \"just being an isolate.\" Fortunately I\'ve done enough research of nanaemulsion and water soluble products bioavailability to know that the claims the employees here made were misleading and altogether false. Please do your research on the absorption rate of newer technologies used to produce cbd products! The milligram label on the bottle is not the only contributing factor to bioavailability and cost effectiveness!\n\nReplying to the owner, I simply left an honest review of my experience in this store. If you don\'t like my review, maybe you could inform your employees of water soluble products. Its pretty petty when you completely dismiss a review as trying to hurt your business instead of addressing the content of my review. Take some accountability for your employees statements and educate them more thoroughly rather than making assumptions to try and dodge constructive criticism.', 1523652437),
(2488, 564, 'Christopher Thomas', 'https://www.google.com/maps/contrib/112379043535959597176/reviews', 'en', 'https://lh4.googleusercontent.com/-SYj9_8_GX3c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2On61NUYZVkzi7ua-zx7ZQjCTkHA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Five stars because the team of gentleman were 110% on point with customer service, knowledge about their products, and environment. I will be coming back here for sure, the quality/prices are too amazing to pass up. You guys rock socks.', 1527721023),
(2489, 564, 'Sarah Taylor', 'https://www.google.com/maps/contrib/107937024997483606682/reviews', 'en', 'https://lh4.googleusercontent.com/-3Lac9mIwJDs/AAAAAAAAAAI/AAAAAAAAAck/AFYogz8J9ww/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I love Ancient Remedies! I think it\'s actually my favorite dispensary in town. I love their happy hour deals, every employee is incredibly knowledgeable and helpful, and I always leave with great product and a smile on my face. I definitely mention Ancient Remedies to people who ask for recommendations to dispensaries in Salem. :)', 1527276728),
(2490, 564, 'Jon Sager', 'https://www.google.com/maps/contrib/105903912538782766881/reviews', 'en', 'https://lh6.googleusercontent.com/-Y1x6LJG7xpA/AAAAAAAAAAI/AAAAAAAAAlI/MlRH5EfKC7s/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 months ago', 'Courtney is the best. All the employees there are great! Very helpful and knowledgeable.  I love this place. However,  gram joints are a little pricey compared to other places but they have what you need all the time. That is guys!-Jon', 1517526924),
(2491, 564, 'Elizabeth Lamkey', 'https://www.google.com/maps/contrib/109489785289808589969/reviews', 'en', 'https://lh5.googleusercontent.com/-Bo8wKVuCsDU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2hGK724Dt_KwaAhVbb0zWT6kz10w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I love Ancient Remedies. Courtney is so friendly and helpful and I love their prices and professionalism when answering questions for the novice smoker.', 1527401415),
(2492, 564, 'denver eggerth', 'https://www.google.com/maps/contrib/113932534210279346240/reviews', 'en', 'https://lh4.googleusercontent.com/-277KIfq4NIA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0luSF-MzdDJPHg1qhECrww8vXVBA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Easily the one of my top favorite dispensary’s in Salem always a friendly group working, always down to try to meet your needs when it comes to you canabis needs', 1527269288),
(2493, 565, 'Skylar Chaney', 'https://www.google.com/maps/contrib/107772380651288386347/reviews', 'en', 'https://lh4.googleusercontent.com/-EMIRpEIDO78/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1-DGjW4fqeghHXZ95jAKG-SMnghA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Jim and his son, Lee, are very good business men and are very knowledgeable about their products! They always have great prices and we are always met with a friendly smile! Its so nice to find a business where the staff cares so much about their customers! I will always suggest this place to anyone looking for great buds in the area!', 1520273249),
(2494, 565, 'Robert Ouellette', 'https://www.google.com/maps/contrib/108920673348598275334/reviews', 'en', 'https://lh5.googleusercontent.com/-8N2jHqyewSY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0eKy5cf321PNVS_MTE0AtF0_7cnw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'One of the more affordable place in Eugene for concentrates or cartridges!!!!! This is why I\'ve been loyally going to them  on their Saturdays  for their $5 off concentrate deals for over 2 years now! Very professional Accurately informed budtender. Excellence in All strands of flower very nice  CBD strains. As well as some of the realest Super Skunk I\'ve seen since I\'ve lived on the west coast in 10 years!  All-in-all. Good real straight forward knowledgeable establishment! As I don\'t mind giving my hard-earned money to them.  In return for a good accurately priced quality Medicine.  \nONENESS RESPECT.', 1523728549),
(2495, 565, 'Jesse Walters', 'https://www.google.com/maps/contrib/111318905904092803289/reviews', 'en', 'https://lh3.googleusercontent.com/-VxPa3Y0NM-c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq35BMPhTfW4eVNVULllpnHnbpLiNA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Great prices and great selection.  They have a wide selection of cheaper strains, all the way up to some of the best stuff around.  Just a tiny little out of the way dispensary with friendly staff.  I like how they cut the stems off so you get clean buds.... This is the best dispensary, I have tried a lot of others, and still like a few, but this is my go to place.', 1509512949),
(2496, 565, 'Patricia Dunne', 'https://www.google.com/maps/contrib/109870717366443921407/reviews', 'en', 'https://lh3.googleusercontent.com/-76eMlSxCce8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2I27ffsGIUnShrmo_dTfn0gmjm7g/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '6 months ago', 'Friendly, knowledgeable, great products, great price. It was east to find, and has a parking lot. There is a comfy entertaining waiting area. Highly recommend.', 1511810963),
(2497, 565, 'Tina O\'Sullivan', 'https://www.google.com/maps/contrib/116744561566330774309/reviews', 'en', 'https://lh4.googleusercontent.com/-az4A6BTOCQI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1JMvP8fQdFW9gfg6xXct5YslvD2w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'My favorite place in all of Oregon! Amazing selection and amazing service!!', 1516244084),
(2498, 566, 'Jessica Bagdorf', 'https://www.google.com/maps/contrib/103818959152918845116/reviews', 'en', 'https://lh4.googleusercontent.com/-GkkvBTeEaMU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3iPdb1NzIuyhDotOZONLfA6-2Ivw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'My bf and I have been going to The Joint for a while now and we have had nothing but great experiences. In fact its the only place in Salem we go to. The staff is always friendly and helpful answering all questions about the strains or offering strain suggestions of ones they have personally tried. They have a wide variety of strains and price ranges. Highly reccomend that if you havnt stopped by that you do.', 1526581086),
(2499, 566, 'Sage Perkins', 'https://www.google.com/maps/contrib/103919293559662472830/reviews', 'en', 'https://lh6.googleusercontent.com/-AGi9Y7Ngzyg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2SMkBuYxFrlH3Ofe4sWM3Hfun6Cg/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '3 weeks ago', 'It a smaller shop on the inside but fun no doubt! As a fellow Budtender I felt they had a rather small selection even for the joint dept. Though don\'t let that derail you. Budtender Britney killed it with her customer service! and I left with a full flower joint will make my trip home all the better. \n\nThank you The Joint for the joint ', 1525634300),
(2500, 566, 'C Bigelow', 'https://www.google.com/maps/contrib/102371889255196056595/reviews', 'en', 'https://lh5.googleusercontent.com/-t18K8WrrqEY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2LqyIgWQkBKFw8KyewX1t7Jr4ALw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Amazing staff, great prices & the giant drum they play at 420 is my favorite. Really fun experience.', 1526079538),
(2501, 566, 'Edward Johnson', 'https://www.google.com/maps/contrib/108263024607269210939/reviews', 'en', 'https://lh4.googleusercontent.com/-7vIKh9KofY8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0uk8JlRuwotCbZIgyyOx7rjjIkdQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Owner/manager was very rude.  Poor quality products.  Would not go there again.  Much better places in the area.', 1526677784),
(2502, 566, 'Rebecca Hill', 'https://www.google.com/maps/contrib/106990164470242892323/reviews', 'en', 'https://lh3.googleusercontent.com/-q37-wo_J_1M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0di2mUCNpyz4LSr6md3QaIBJc1ow/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'This is Daniel Davidson and Everytime me and my partner Jay Jay come to the joint on market we can\'t wait to come.back great customer service awesome deals and they have happy hour stoners love happy hour. I especially want to say thank you to James Neal for always helping me find the perfect strand..love love love this place', 1526589952),
(2503, 567, 'Ryann Strife', 'https://www.google.com/maps/contrib/111113600711997730201/reviews', 'en', 'https://lh3.googleusercontent.com/-vEcwnP6gqYE/AAAAAAAAAAI/AAAAAAAAADg/1XmPkuvAfGo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'This has to be one of the best shops I have been in. Great deals. A little complicated to get in and super small location, but I prefer it over the overly spacious stores. This location has a lot to offer in a small space and the employees are always amazing.', 1527007421),
(2504, 567, 'Tom H', 'https://www.google.com/maps/contrib/108219696802262452746/reviews', 'en', 'https://lh5.googleusercontent.com/-CT7O8Kd02Bo/AAAAAAAAAAI/AAAAAAAADOI/-TVhNMU3N-k/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '2 months ago', 'I\'d like to give credit where it is due. My original review was negative - for several reasons, and I stand by the original review.\n\nBUT-\n\nThings have improved. My wife (I don\'t smoke marijuana) has been back dozens of times. Prices are okay. Quality seems consistent.\n\nThey still close on Saturday, so, if that\'s an issue for you then take it into consideration.\n\nThey\'re open on Sunday, which is a major thing for some people if they\'re not close enough to a dispensary who\'s open Sunday.', 1520966841),
(2505, 567, 'Angie Wilder', 'https://www.google.com/maps/contrib/117868254892321883619/reviews', 'en', 'https://lh4.googleusercontent.com/-XfpdsosKIMw/AAAAAAAAAAI/AAAAAAAAAK8/vr494OlQzE0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The staff is knowledgeable, helpful and they don’t try to push the high $$$ products on you. If you’re low on cash they will help you find something that will work for you!! If you go on Fridays you can get a slice of pizza while you shop and good deals, seriously go check them out!!!', 1525052207),
(2506, 567, 'joe wonder', 'https://www.google.com/maps/contrib/118167774216234541338/reviews', 'en', 'https://lh6.googleusercontent.com/-q0EAu6KiTno/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1NKl74kvcy85GarzgAbmohOI0u0Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Got some Peanut Butter Breath from Gadson Gardens all I can say is killer dank 26% Chronic for only $12 a gram. This is my new favorite place. got a great joint for just a dollar and a gram of snap and pull for just eight dollars. not a big shop but big on compassion!', 1520660726),
(2507, 567, 'erin watson', 'https://www.google.com/maps/contrib/110679939324008888770/reviews', 'en', 'https://lh3.googleusercontent.com/-KwW8-qSoUyU/AAAAAAAAAAI/AAAAAAAAK6s/6y3UGXQivk8/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a week ago', 'Great prices, good quality, crazy huge selection and amazing service...what else do you need?', 1526855605),
(2508, 568, 'Thomas Cashman', 'https://www.google.com/maps/contrib/111986656045796175574/reviews', 'en', 'https://lh4.googleusercontent.com/-QpnCJFChQis/AAAAAAAAAAI/AAAAAAAAG-U/ixjndst75bg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '4 months ago', 'This is a great shop for recreational and medical cannabis. Good selection, and you can almost always get an ounce of something fairly good for really cheap. Helpful staff that are focused and professional while also maintaining a laid back attitude. Good selection and great deals! Gotta love legalization!!', 1516772166),
(2509, 568, 'Morgan Huber', 'https://www.google.com/maps/contrib/118187695274868874371/reviews', 'en', 'https://lh6.googleusercontent.com/-6Y7yxpovdgE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0PnoTr50fVPmzevca3Z6Tqv-OM5Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Always friendly and nice clean facilty. Good quality but as well. Never had a bad buy from them. Thanks as always guys!', 1523387868),
(2510, 568, 'Stephanie Craig', 'https://www.google.com/maps/contrib/104487216177372142989/reviews', 'en', 'https://lh3.googleusercontent.com/-toPungc1n9E/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2TPW0JI9LF-CeCvi6tcCg98yiGxA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 2, '2 months ago', 'Good products, but won\'t return again. They won\'t refund a defective battery. Every other place in Yamhill County and PDX area will happily exchange or refund something defective. I wanted to use the refund and purchase something else.', 1522181739),
(2511, 568, 'Michele Finger', 'https://www.google.com/maps/contrib/112192122065780653204/reviews', 'en', 'https://lh3.googleusercontent.com/-ssunRj6cseQ/AAAAAAAAAAI/AAAAAAAAADM/e4j1IjKc6_Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'The budtenders are very knowledgeable, and the bus is awesome! With they opened earlier, and stayed open later. Also wish for birthday discounts. I love the place.', 1518985581),
(2512, 568, 'Dub Flow', 'https://www.google.com/maps/contrib/103663823924139175327/reviews', 'en', 'https://lh3.googleusercontent.com/-c41TXakH_Zw/AAAAAAAAAAI/AAAAAAAAACU/HnFUc8W959Q/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'Awesome people, great prices, I have a anxiety problem and the bud tender was very helpful and suggested a very nice CBD strain.', 1521853198),
(2513, 569, 'Bob Riehl', 'https://www.google.com/maps/contrib/110220849043622150289/reviews', 'en', 'https://lh6.googleusercontent.com/-8xUsAvcBKDo/AAAAAAAAAAI/AAAAAAAAAAA/-9qMLTOlgjk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Fist time in today. I had used another shop but their inventory was too variable.  Good selection and pricing. I\'ll go back when needed and see if they still have good inventory.', 1516306214),
(2514, 569, 'Cesar Tejeda', 'https://www.google.com/maps/contrib/113067894952450312558/reviews', 'en', 'https://lh6.googleusercontent.com/-5d57z9UUm-A/AAAAAAAAAAI/AAAAAAAAABU/UyZ8OgQ1k5g/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 months ago', 'Great selection of Flower and Concentrates. Friendly staff and awesome customer service! I highly recommend going here!', 1518910843),
(2515, 569, 'mnw702', 'https://www.google.com/maps/contrib/110006917494416056665/reviews', 'en', 'https://lh3.googleusercontent.com/-m6Tv_-HlE34/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1c48990tqrD6_x2r4r9ZUTKZ6ZVA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 3, '7 months ago', 'Dealt with an individual who couldn\'t manage to hold it together because of a song that was playing that reminded him of his girlfriend. Trusting that he was listening to what I was saying he still managed to give the wrong strain. I left and had to come back to explain to the manager who then told me they do not allow exchanges per old. I come here about once a month and have never had this issue. Check your product to ensure you are receiving the correct product you played for.', 1507428840),
(2516, 569, 'Michael Marcus', 'https://www.google.com/maps/contrib/117846521673494718196/reviews', 'en', 'https://lh3.googleusercontent.com/-tx0WIPzFYAA/AAAAAAAAAAI/AAAAAAAADZg/os40AUUuLzo/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 2, '4 months ago', 'Visited for a bedridden friend. Thank you for reply. Guess I understand regulations, but they need change.', 1516272087),
(2517, 569, 'Heathers Main', 'https://www.google.com/maps/contrib/106474375680157457220/reviews', 'en', 'https://lh6.googleusercontent.com/-IFhWMtilXjM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3sxJ3r98afinEQWm3kYNYBISaIng/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 2, '6 months ago', 'Just not my kind of place. But if you like your weed fancy... this is exactly that.', 1509751305),
(2518, 570, 'Charlene Stacy', 'https://www.google.com/maps/contrib/102231479772416808642/reviews', 'en', 'https://lh4.googleusercontent.com/-54rJyKe8-SA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3tANiZgqH557xZyYuAAR9wnAGJ6Q/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 months ago', 'The staff are always nice, not fake nice but genuine nice people. Everyone there also knows the business, none of them are dummy robots. Ask a question and you WILL get an answer. It\'s very refreshing to see folks happy with their careers. The flower stock is just amazing. So many to choose from. I will be a lifelong customer of Club Pitbull. The stock is never overly dry like at other establishments. I have been a marijuana smoker for well over 30 years and I am absolutely impressed with Club Pitbull!', 1519351154),
(2519, 570, 'Beard Grylls', 'https://www.google.com/maps/contrib/104836086909553366478/reviews', 'en', 'https://lh3.googleusercontent.com/-HgcSl-e9VtQ/AAAAAAAAAAI/AAAAAAAAAIY/9PreWA35TwY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Great shop and the workers were very helpful. Nice displays and the store looks clean.', 1523640564),
(2520, 570, 'Brittany Farmer', 'https://www.google.com/maps/contrib/107668370073860667714/reviews', 'en', 'https://lh4.googleusercontent.com/-2DBkXd81sRw/AAAAAAAAAAI/AAAAAAAAAUw/85AbUVKJV48/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Another great dispensary that my husband and I go to that is very friendly and makes you feel welcomed at.', 1520647156),
(2521, 570, 'James Lichlyter', 'https://www.google.com/maps/contrib/106852585366759285360/reviews', 'en', 'https://lh3.googleusercontent.com/-EegrRVzOmBE/AAAAAAAAAAI/AAAAAAAAAmo/vaoQyb3Zc5c/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '8 months ago', 'Lots to choose from.  Very friendly and helpful staff.  Good prices, good choices (on my part).  Over all....  Would and will return.  Thanks for a great day !!!!', 1506455408),
(2522, 570, 'Lori-ann Kellett', 'https://www.google.com/maps/contrib/107448591836490786322/reviews', 'en', 'https://lh5.googleusercontent.com/-KupC__LutrY/AAAAAAAAAAI/AAAAAAAAAZ0/_T8zXutDql8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I have been a regular for a couple of years and CP has one if the best menus to choose from along with great staff \"pot-tenders\".  The selection available and specials make it worth being my top choice for my go-to store!', 1511085445),
(2523, 571, 'Kayla Atay', 'https://www.google.com/maps/contrib/115127048132455006296/reviews', 'en', 'https://lh6.googleusercontent.com/-6bnkHiO4E7I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3W77SgMInkKlrcAQcDGwNs_DPx-Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I love it there at Cherry. Their selection is awesome!  Everyone is like family and they make sure every customer leaves happy. I’m happy I got to be apart of it. :)', 1521733579),
(2524, 571, 'Johnny Touchngo', 'https://www.google.com/maps/contrib/114146844579159848958/reviews', 'en', 'https://lh3.googleusercontent.com/-q_4EgV5hFMA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0K5n5GzeZKUzSQ9RVBzls865r_kA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Manny who runs that store is a complete POS. Treats customers as if there scum and stupid. As a 9 medical patient this might be the worst dispensary I\'ve ever been too. Prices are way too high and it\'s poorly ran. Save yourself the trouble and go to hi cascade or capital green leaf they both have better prices, quality and service', 1520651145),
(2525, 571, 'Kathryn Lueck', 'https://www.google.com/maps/contrib/107422306257232832262/reviews', 'en', 'https://lh3.googleusercontent.com/-ATcxlNCmZYk/AAAAAAAAAAI/AAAAAAAABXQ/RR-PoslJuZw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Always awesome prices, and the best people work there, they are all very helpful and nice, thanks guys', 1523931704),
(2526, 571, 'Michele Livingston', 'https://www.google.com/maps/contrib/113449939483176922103/reviews', 'en', 'https://lh4.googleusercontent.com/-NiTL6lnT9Ic/AAAAAAAAAAI/AAAAAAAAGII/FgZ6p-4wxU0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, '6 months ago', 'Totally friendly. Although,  a little overwhelming / intimidating with big tall shelves. Maybe more lighting could help? Were the employees elevated?  I don\'t know, still pretty cool.  Definitely helpful people. Good prices.', 1511800220),
(2527, 571, 'Makenna Kaleido', 'https://www.google.com/maps/contrib/105552206981749560058/reviews', 'en', 'https://lh3.googleusercontent.com/-ghZQwKQoXbo/AAAAAAAAAAI/AAAAAAAAEF4/5g_efQMj75A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very nice people. Clean and organized', 1524689076),
(2528, 572, 'T W', 'https://www.google.com/maps/contrib/118086045191449547672/reviews', 'en', 'https://lh3.googleusercontent.com/-M4vbeNng7es/AAAAAAAAAAI/AAAAAAAAAFc/20YP3B-bbUQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'This is hands down one of the better dispensaries I\'ve been to. The products are reliable and fair priced. Customer service was great too! Very friendly and informative.', 1516262813),
(2529, 572, 'Michelle Mather', 'https://www.google.com/maps/contrib/102431203317103386978/reviews', 'en', 'https://lh6.googleusercontent.com/-c731xyOcwYQ/AAAAAAAAAAI/AAAAAAAAABk/H9460CTjmtw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '2 months ago', 'My husband and I are practically regulars at this Shango and we will be taking our business elsewhere from here on out after our visit on Mar 4, Sunday afternoon.\n\nShango used to be one of the most laid back shops regarding handling and smelling the sample jars. I now know the OLCC is cracking down and they had to change their system up, totally understandable.\n\nWhat I don\'t understand is why you wouldn\'t politely explain this change to your customers who don\'t know about it and pick up the glass jar you set on the counter (without saying anything), rather than rudely snapping at them to leave the jar on the counter and then offering no explanation.\n\nWe left and went to Chalice Farms that day (they are literally minutes down the road), got insanely better service, and happily paid their slightly higher price. We weren\'t allowed to touch the sample jars at Chalice either, but rather than expect customers to bend down awkwardly to smell the jar on a super low counter, their budtender nicely held the jar out to us to smell.\n\nCustomer service is king guys, and there are other weed shops minutes away from you. I would think about this before letting your customer service slip like that. I usually got pretty good, friendly service from you, but all it took was getting snapped at by a woman wearing green lipstick and I don\'t plan on coming back for quite a while, if ever.', 1520360998),
(2530, 572, 'OG Ganja', 'https://www.google.com/maps/contrib/100741779213546964285/reviews', 'en', 'https://lh5.googleusercontent.com/-jSoVFEVDfGo/AAAAAAAAAAI/AAAAAAAAAF4/p8YuX_S4i2g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Shango is the best! From their joints to buds to edibles to oil always top quality at a reasonable price.', 1522769837),
(2531, 572, 'Jeremiah Ullman', 'https://www.google.com/maps/contrib/114245940711602454418/reviews', 'en', 'https://lh6.googleusercontent.com/-6xcylaPIVdE/AAAAAAAAAAI/AAAAAAAAAAA/jF8ZFo5a8g0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Grate people good prices couldnt go wrong.', 1525559788),
(2532, 572, 'Liz Vonglakhone', 'https://www.google.com/maps/contrib/104050361142053652869/reviews', 'en', 'https://lh5.googleusercontent.com/-v77jhDT3QLM/AAAAAAAAAAI/AAAAAAAAACk/fJy5K7dlBUg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'Asked if there was a sale, worker replies \"yea man, i mean its a store, obviously.\" okay.. And he didnt even tell us the sales.. We had to wait for them to take notice of us for help.. Idk but i hope weed is better than the service.', 1518649802),
(2533, 573, 'David Hill', 'https://www.google.com/maps/contrib/107181222397234286980/reviews', 'en', 'https://lh4.googleusercontent.com/-rlkfx-JtvhE/AAAAAAAAAAI/AAAAAAAACVw/bAoY7xRQYnQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'Not sure what everyone else\'s deal is but I always have great customer service Everytime I go in, which is about 1-2 times every few weeks for the past 2 years. They just dropped their prices to 6-10/gram for flower too. I never have to wait too long either, sometimes I\'m in and out in a few minutes and the longest being around 10-15 when super busy at peak times. I have nothing but good things to say regarding this location and service', 1527399048),
(2534, 573, 'Tj Weldy', 'https://www.google.com/maps/contrib/114200938897591572969/reviews', 'en', 'https://lh5.googleusercontent.com/-_fmXWdzENQw/AAAAAAAAAAI/AAAAAAAAAYA/7NPEJrkZOQ8/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Generally they have good supplies, but the staff is truly terrible. I was asked what I was going to do with the RSO I tried to purchase. I said I use it topically on my wife and that my medical card just expired, but that my wife\'s cancer was so severe none of the prescribing doctor\'s I know could accommodate her disability to fill out the paperwork. Now I guess you can\'t say anything about buying for anyone else which I did not know. Instead I was castigated by the clerk as \"Admitting to everyone in the building that I was buying it for someone else and that there was no way we can sell it you and you need to leave\" Note that they could have said, \"Ah, I\'m sorry to inform you but the law states that we can\'t sell to someone stating that they are buying it for someone else.\"  In which case I could have responded that I didn\'t know and I won\'t make that mistake in the future. Though to be fair, they really shouldn\'t ask if it puts their customers and business in jeopardy because you\'re buying medical marijuana for a cancer patient. Nevertheless, I was a tipping customer that purchased $500+/mo when my wife still had a medical card. If you go here, I recommend not talking to the clerks more than absolutely necessary.', 1520298575),
(2535, 573, 'Dig Doug', 'https://www.google.com/maps/contrib/116079939115741060514/reviews', 'en', 'https://lh4.googleusercontent.com/-qqTOqtb9PqE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2wwgeIf5YJj_RdkfWPcpMr1BeVWA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'From the ATM fee to all of the product... this Shango is WAY WAY more expensive then the one by the airport... for example, this shango charges $70-$75 for a gram of a shango distillate cartridge... shango by the airport only charges $50...$20 less.. wtfing F?!? not to mention the customer service at shango by the airport is WAY WAY better and your in and out much quicker.... save your money and get double the value at shango over by the airport!!', 1525471034),
(2536, 573, 'Lawrence Booth', 'https://www.google.com/maps/contrib/102484523331767626705/reviews', 'en', 'https://lh5.googleusercontent.com/-3shTNcb6lQc/AAAAAAAAAAI/AAAAAAAAACU/OX8AXx975es/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '6 months ago', 'There product has seeds, they said they had a \"Good deal  I went for it.  You cannot hold or open the packages there and it is illegal to open it in your car.  When I got home I found a tiny sticker stating \"Disclosure: Bag contains seeds.\"  What the hell how was that disclosed to me? hidden until I got home.  Happy Veterans Weekend.', 1510534275),
(2537, 573, 'Patricia Carter', 'https://www.google.com/maps/contrib/117016442739281067120/reviews', 'en', 'https://lh5.googleusercontent.com/-EdaH2axJa7k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1HSbiXh48c-jfqe70K220v2RYi7g/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '5 months ago', 'Horrible customer service! Must be nice to have business be so good to where you can be so rude to the point that as a customer, you don\'t buy anything there. I\'ll take my business to establishments that appreciate taking my money.', 1513998659),
(2538, 574, 'chris lyons', 'https://www.google.com/maps/contrib/116262407900466958352/reviews', 'en', 'https://lh5.googleusercontent.com/-AdKIxu95kM8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0CfHjaw2FoXg5VwnN6d6NQANfPgw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'this neighborhood location is perfect for me.  23rd Street has a great feel! This neighborhood is worth visiting for a happening time. I often eat and shop and now I can easily get good bud.  these owners and staff are super friendly!  and the bud tenders know their business too.  The bud was fresh, smelled great and smoked as advertised.  I loved it!!\n\nI\'m going to go back soon -', 1526414610),
(2539, 574, 'Andrea Martinson', 'https://www.google.com/maps/contrib/102805247391233810881/reviews', 'en', 'https://lh6.googleusercontent.com/-YV_6Rts93oY/AAAAAAAAAAI/AAAAAAAAAQk/DzPYexAuH-8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Quaint shop with an excellent rotating selection, good specials, and knowledegable staff.', 1526684636),
(2540, 574, 'Robert Smith', 'https://www.google.com/maps/contrib/113045061013883593530/reviews', 'en', 'https://lh3.googleusercontent.com/-mUfSMGqoO9o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq14hmi4StTjIX5SgguRekW-2iwEXA/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '2 months ago', 'Staff always seemed to be overly high and not very knowledgeable on products. I never seem to get the correct change from the stoners working behind the counter. Flower is always dry and low quality. (Even top shelf) Owner should bring in staff that knows about the pot industry and products/farms...and not 21 year old stoners with no experience.', 1520011370),
(2541, 574, 'Kechia Simmons', 'https://www.google.com/maps/contrib/113960195267394279759/reviews', 'en', 'https://lh6.googleusercontent.com/-if9Ow-FTkPQ/AAAAAAAAAAI/AAAAAAAAAC0/taiiefenISQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'Must go, everything you need to feel relaxed.', 1527060125),
(2542, 574, 'James Parks', 'https://www.google.com/maps/contrib/118206300650621358022/reviews', 'en', 'https://lh5.googleusercontent.com/-qDVqj_pbzIo/AAAAAAAAAAI/AAAAAAAAs_0/FKH7vShBRNw/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '5 months ago', 'Man....I\'ve never seen anything like this in my life. the people who work here are really friendly and they let you look at anything you want to. HUGE selection.', 1514271542),
(2543, 575, 'Me You', 'https://www.google.com/maps/contrib/112186222247002063838/reviews', 'en', 'https://lh3.googleusercontent.com/-TwkUcM6UUr8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0FIEpQ1TK6_i5k4m71f908N1LuPA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Awesome staff great line up of products.\nGideon always had good recommendations for me', 1523203355),
(2544, 575, 'John Mabry', 'https://www.google.com/maps/contrib/100641939627389486733/reviews', 'en', 'https://lh6.googleusercontent.com/-fUk-VGMAeL8/AAAAAAAAAAI/AAAAAAAAAlo/37LxpNhcotU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Gideon & kathy offer top notch service...friendly, helpful, compassionate . Hood river naturals has great quality indoor flower and a good selection of nicely priced oil. Wide variety of edibles. Dont waste your money at the gorge greenery (medically unfriendly) low quality overpriced products.', 1517508511),
(2545, 575, 'Dhawk', 'https://www.google.com/maps/contrib/105150841818907485501/reviews', 'en', 'https://lh6.googleusercontent.com/-LD79sWQdkPM/AAAAAAAAAAI/AAAAAAAAACc/9WH88Y7gsl0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Wonderful experiences every time.', 1521850375),
(2546, 575, 'Ashlee Noyes', 'https://www.google.com/maps/contrib/103443683125892290331/reviews', 'en', 'https://lh6.googleusercontent.com/-kuLO6NRXGVg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3JmMJNk4zp9m2aQHymIr8OI9fYDQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Best place to go! They have a huge selection and Cathy and Luke are so nice! Definitely a reason to go back!', 1477438595),
(2547, 575, 'shy laroy', 'https://www.google.com/maps/contrib/117420834887537118618/reviews', 'en', 'https://lh5.googleusercontent.com/-6xxG6XuHd7M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1hpAkKdzBgIGWBqJr4oshQ2ztFWg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a year ago', 'One of the absolute best in the state! Cathy is remarkable and as far as prices on good product go, it\'s worth a drive.', 1482623962),
(2548, 576, 'scott williams', 'https://www.google.com/maps/contrib/113154613062231309266/reviews', 'en', 'https://lh5.googleusercontent.com/-zI_2XAEZnEg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2AThMNedCOJpM_WlrMmvfF8ZnB4g/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'As a business owner it has always been a priority of mine to find a trustworthy and knowledgeable accountant. I finally stumbled across Glenda and wow! I’m so impressed. So fast paced so energetic! They even had me thinking about making a career change to get on their station wagon!', 1525819653),
(2549, 576, 'Arvid Marlette', 'https://www.google.com/maps/contrib/109614872261327143486/reviews', 'en', 'https://lh5.googleusercontent.com/-YHd8ZfufNzY/AAAAAAAAAAI/AAAAAAAAByQ/8J1skAwpDj4/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a week ago', 'Unbelievably good. Wow, on the recommendation of the budtender I purchased the Forbidden Fruit. Excellent strain for those with a higher tolerance level. Indica dominant hybrid almost black in color. Great selection and quality products.', 1526664258),
(2550, 576, 'Nina Pelayo', 'https://www.google.com/maps/contrib/100079990263106342637/reviews', 'en', 'https://lh4.googleusercontent.com/-CAfQYCN8A-o/AAAAAAAAAAI/AAAAAAAAA30/4FTHw5bHupk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Medical or Recreation, Herbal Choices provides top of the line products. Staff are educated, professional, and genuinely cares for their customers.  Highly recommend checking them out!', 1518896636),
(2551, 576, 'Andrew Taylor', 'https://www.google.com/maps/contrib/105117316439634224915/reviews', 'en', 'https://lh5.googleusercontent.com/-8IgLlwrAvOA/AAAAAAAAAAI/AAAAAAAAG_k/Z81kapgbJY8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'My wife and I have been here 4 times now in the last month, first time was to look around see what they had, picked up a gram of grand daddy purple  to try it out, shop prices are alright, not the cheapest but not the most expensive.. we\'ve keep coming back because the people that work there. my wife really likes Lauren. she knew her stuff and was really excited about her job, more people need to be like that.', 1502918819),
(2552, 576, 'Stefani Eaton', 'https://www.google.com/maps/contrib/110174661232162797828/reviews', 'en', 'https://lh5.googleusercontent.com/-IM6inQD4XDQ/AAAAAAAAAAI/AAAAAAAArbE/5andWaX-qrE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '10 months ago', 'Seriously the best staff around. I can always feel confident in the recommendations made on products. Its the only place i shop now. Knowledge is so important. Not all of us are just looking to get \"High\"', 1501712095),
(2553, 577, 'Donna Baim', 'https://www.google.com/maps/contrib/102543078430774247052/reviews', 'en', 'https://lh5.googleusercontent.com/-0eN90-PBqWI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2z30QIORuQEnuTJCvT6Y0IJPNL5Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I love this store.  The selections and deals are great but the best part is the staff.  Helpful and just plain awesome.', 1523192293),
(2554, 577, 'Vincent Vierra', 'https://www.google.com/maps/contrib/114057839331004021650/reviews', 'en', 'https://lh3.googleusercontent.com/-coktRtFx25E/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2aKbVWTQID3jB2zMGELOrGh5VKXg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Great experience all around! Knowledgeable and very friendly staff. Some of the best flower I\'ve seen. Competitive prices. Mom and Pop feel, loved it!', 1516858361),
(2555, 577, 'Lucas Skeels', 'https://www.google.com/maps/contrib/104816854482207468963/reviews', 'en', 'https://lh5.googleusercontent.com/-xbNzKpjLpA0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1mo7ldJJAc64ZMZOiz3y-RwkKueQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'My gf and I go here all the time and can\'t see going anywhere else. Always treated good and never disappointed. The young couple that work here are totally kickass!', 1523222494),
(2556, 577, 'Latisha DeLeon', 'https://www.google.com/maps/contrib/104824791590168436574/reviews', 'en', 'https://lh3.googleusercontent.com/-2SeLy7OvizI/AAAAAAAAAAI/AAAAAAAABkw/lzQBX7eVIQs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I have only had the pleasure of visiting Positive Vibrations a couple of times, but everytime I have they are so friendly and helpful. One of my favorite places to go to get my medicine', 1522381428),
(2557, 577, 'James B', 'https://www.google.com/maps/contrib/106889377434993906451/reviews', 'en', 'https://lh3.googleusercontent.com/-Pu82icAA5Hc/AAAAAAAAAAI/AAAAAAABH5Q/Df0sDjtfm4w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'This was my first stop in Coos Bay and it was great! The staff was very helpful and friendly. The atmosphere is very relaxed. Needless to say, I found my shop anytime I\'m in town.', 1516419523),
(2558, 578, 'Jessica King', 'https://www.google.com/maps/contrib/109129396794884829286/reviews', 'en', 'https://lh3.googleusercontent.com/-90HeVDdTCko/AAAAAAAAAAI/AAAAAAAAABI/iYpkrm9PRAc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'The staff is extremely friendly and helpful. They were attentive to the type of flower I like to purchase and even though they didn’t have the exact strain, they were able to help me find another equally good strain, if not better. While the flower was a bit out of my price range, they did weigh out any dollar amount I wanted. They even pulled excess stem from bud, which I think is awesome. The name of the flower is Citrus Sunshine and it is a five-star flower. It smells good, looks great, and tastes heavenly. It has a strong tangerine taste and will not disappoint.', 1512164937),
(2559, 578, 'brad pollitt', 'https://www.google.com/maps/contrib/106489261191971270116/reviews', 'en', 'https://lh3.googleusercontent.com/-jbZqUm-hGws/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1B9I9rQgUgzhUUFOMlwH1hZQopuA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'This dispo always has very positive and helpful staff as well as great products! My favorite in corvallis forsure!', 1525404785);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(2560, 578, 'Rachael Mohlman', 'https://www.google.com/maps/contrib/110748215562722984685/reviews', 'en', 'https://lh3.googleusercontent.com/-ayz-TAQflq4/AAAAAAAAAAI/AAAAAAAAASY/G7mQdziTtYM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'High Quality is the best. The employees are so friendly and knowledgeable, it\'s very welcoming. They have high quality (no pun intended) products and are very keen to offer special deals and discounts. Love this place!', 1510705208),
(2561, 578, 'Mathew Coddington', 'https://www.google.com/maps/contrib/115558467162144770103/reviews', 'en', 'https://lh4.googleusercontent.com/-wm4UMPELquA/AAAAAAAAAAI/AAAAAAAAANs/w0EEoE9MD94/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Awesome people, always uplifting to see. Great buds and great prices. They truly appreciate a person over their money. Very grateful they are in my town!', 1512695357),
(2562, 578, 'Dallan Maguire', 'https://www.google.com/maps/contrib/111123638593855486413/reviews', 'en', 'https://lh4.googleusercontent.com/-vNCUqgYSX9o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3zBLciTnlNW6KSWUG5gltcRdaOTw/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'Awesome service, great deals and usually a good selection. Love tue rewards program too', 1520964545),
(2563, 579, 'Carlo McCoy', 'https://www.google.com/maps/contrib/116787170073269126172/reviews', 'en', 'https://lh3.googleusercontent.com/-mLHxzvIMy2E/AAAAAAAAAAI/AAAAAAAAPYg/SinEgzOOuG4/s128-c0x00000000-cc-rp-mo-ba6/photo.jpg', 4, '2 weeks ago', 'Hey People, Don\'t Follow The Trend Of Some Reviews, As I Am Sure These Are One-On-Experiences...With That Said, I Ended Up With A \"BudTender\', Goes By KC...Maybe Meaning Kind Customer Service!  This Dude Was A GrandFather Of Information, Must Have Completed His Kronic Studies Down On The Farm.  I Chatted At The Front Desk, With The Recept And With That Happy Smile, She Set Me Up With KC.  As, I Patiently Waited, Browsed, Set...I Noticed Several Distinctive Products. \nThe Lines Started To Flood The Building And I Thought I would Get Trapped In The Closet Alone, But The Recept Was On Point.  She Brought Me To The Front, As I Was Noticeably In Pain...Neither Here Nor There..., Check Out All My Goodies!  The Honey Sticks Of CBD,  Are The Bomb, I Felt Signs Of Relief, Almost Instantly! After Chewing The Plastic Off This Yummy Potion, My Day Went So Much Better!  Being A Caregiver Is Hard Enough, But They Cared For Me This Time.  O\'ooo My Bad, I got $5 Off As A Virgin Connoisseur.  Thanks For My 1st Ever Visit, To A Live Happening, Dispensary!  The Selling Out Fast Is A Plus, Thus Keep Grinding, It\'s A Rough Industry.  Also, Shoutout To My Asian \"PorkChop\'...She Use To Work There, I Met Her While Upfront, Hit Me Up,LOL!', 1526496886),
(2564, 579, 'Sam Griffiths', 'https://www.google.com/maps/contrib/100411103297960498365/reviews', 'en', 'https://lh3.googleusercontent.com/-v3DJMbCU5fs/AAAAAAAAAAI/AAAAAAAAA1w/g7sdt5pkKNg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This is where I always go.  Have been to many Pot Shops around PDX and this is my favorite.  I like how they have it set up so you can browz before you buy. Budtenders know what they are taking about and don\'t mind spending a little extra time with you answering questions.  Jamie and Kelsey take good care of me.', 1523155066),
(2565, 579, 'S Sullivillain', 'https://www.google.com/maps/contrib/109217385456746100495/reviews', 'en', 'https://lh6.googleusercontent.com/-D5gVBgdlYZE/AAAAAAAAAAI/AAAAAAAAGEU/FZP046JINaE/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '5 months ago', 'Been going here since it opened. Prices have yet to change with the industry. Other shops will charge you $5 for the exact same bud these guys are trying to charge you $12-$15 a gram. Even grown by \'cannabis nation\'. \nGreat people and location. But that\'s not worth triple the price. Goodbye forever.', 1513641428),
(2566, 579, 'Jared Folsom', 'https://www.google.com/maps/contrib/113036590301894517649/reviews', 'en', 'https://lh4.googleusercontent.com/-e8l88cNiDQQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ATxbdKgC7QRkUk3qq-v8Vk3mXqw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Let me first start off by saying this was my first ever experience heading into a dispensary.  Needless to say I was a little nervous due to my lack of experience and knowledge in the area of cannabis.  the ENTIRE staff here was amazing and warmly welcomed me from the second I walked in.  They liked the fact that I was such a newbie and really took the time and care to walk me through the do\'s and dont\'s of certain items I was interested in.  TJ was absolutely AMAZING and took me under her wing and schooled me on the different effects of THC vs CBD as well as the Sativa vs Indica blends.  She spent 1 on 1 time with me answering all of my, what I assume were annoying \"first timer\" questions.  A HUGE thank you goes out to TJ and the entire staff at Blooming Deals for making this a great experience.  I will certainly be back and I highly recommend this place.', 1523230859),
(2567, 579, 'Todd Law', 'https://www.google.com/maps/contrib/106958154612761935999/reviews', 'en', 'https://lh3.googleusercontent.com/-mGUN4C8THO4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2eaPmi1ca2lfEz24ZsDFC19Hz1gQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '3 months ago', 'Customer service doesn\'t seem concerned for the customer. Cashier also charged me extra for an exit bag much bigger than I needed for my products. Overall, they have a very nice selection, but I will be taking my buisness elsewhere hence forth.', 1517784790),
(2568, 580, 'Jordan Mazariegos', 'https://www.google.com/maps/contrib/105187121201270725634/reviews', 'en', 'https://lh4.googleusercontent.com/-YjR73AoL3-M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1OCtsTXjfLh-jIKkbS3mKAKbckEA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 2, 'in the last week', 'I have been going to this dispensary for a few years now. The bud quality is good but tends to be overpriced compared to other dispensaries with the same product. I tend to stick to flower so I couldn\'t comment much on the other products in the shop. They have some cool glass to look at as well. Being a third generation Bendite, I like all of the local stuff they tend to advertise.\n   The reason I am giving them 2 stars is because of the average nature of the shop and declining quality of service. If I want something cheap, there\'s cheaper. If I want something good, there\'s better. The last few times I have been in as well, there are customers literally leaving the shop due to lack of adequate service. My fiancee and I watched 3 groups of customers behind us walk out just today. 3 potential clients, due to nothing other than lack of motivated and active employees. There were 3 employees working (very slowly) at the time but only 1 helping customers. The others looked to be counting or pricing products in cases, even after acknowledging that customers were in line with eye contact. \n   After 10 minutes on a watch and no service to anyone, we were the 4th group to leave (a 5th group walked in and instantly out as we were driving out of the parking lot). This is no doubt a horrible business strategy as well as there are multiple dispensaries within two blocks of them that are less expensive and more prompt. After a few years, will not be going back due to overpriced product, lack of efficiency and very poor customer service.', 1527631664),
(2569, 580, 'msmethers', 'https://www.google.com/maps/contrib/108391447305386056599/reviews', 'en', 'https://lh6.googleusercontent.com/-gOAbcuYNjiI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1IgP94sUU-ZCbSIldXYq-8_-0hgQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'First time to a brick and mortar dispensary. Couldn\'t have asked for a better experience. Henry (Enrique) was our bud tender for the visit. He was extremely knowledgeable, gave us all the time we needed to browse and ask questions. Spent probably half an hour browsing all the goodies. Got great edibles, flower and concentrates. Price was good compared to what I\'m used to from the delivery services. Will definitely visit again.', 1506972883),
(2570, 580, 'Dinitia McArthy', 'https://www.google.com/maps/contrib/115803392063555134602/reviews', 'en', 'https://lh3.googleusercontent.com/-dD3Q_DhCltk/AAAAAAAAAAI/AAAAAAAAAzY/v9suKT-9Xfc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'This is my go to dispensary in Bend. I\'ve been to several around town but I just don\'t get the same knowledge or treatment that I do at Dr Jolly\'s. They always answer my questions (I usually have many) and are really friendly.', 1527604087),
(2571, 580, 'Maxine Burgess', 'https://www.google.com/maps/contrib/115151419628095577452/reviews', 'en', 'https://lh4.googleusercontent.com/-NFs2zddflhg/AAAAAAAAAAI/AAAAAAAANQ0/t86UgO_w7RI/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 months ago', 'Visit this place any time we\'re in Bend.  Budtender was friendly and knowledgeable and they have great products.  Tried \"terp sauce\".  Spendy, but, very tasty, like nothing you\'ve tasted before, I recommended the vape cartridge.', 1520152242),
(2572, 580, 'N W', 'https://www.google.com/maps/contrib/113095390730614017790/reviews', 'en', 'https://lh5.googleusercontent.com/-CeaHLx1PTeM/AAAAAAAAAAI/AAAAAAAAAAs/Rl-Td3IWQCk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Dr. Jolly\'s is incredible. The dispensary is bright, the staff is friendly, and the environment is welcoming. Have no fear walking into this shop! Make yourself a cup of coffee while the budtenders walk you through the extensive products they provide along with the helpful knowledge they posses. A destination in Bend for all \'canna-sseurs\'!', 1515632311),
(2573, 581, 'Sunny Travis', 'https://www.google.com/maps/contrib/106055928846344613233/reviews', 'en', 'https://lh5.googleusercontent.com/-kMTbSeunCrA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2xprkzRS7Gkcz38DhKFy9BarTIhg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very knowledgeable, friendly, and helpful staff. Lots of product. Sometimes a good product is available  and once it has sold out you don\'t see it again.  As a medical user it is very frustrating to find one that works and not know if it will be available. I found this is not the case at Oregon Coast Cannabis, they seems to always have an old standby or knowledgeable staff that can help me find a product comparable. Thank you OCC.', 1524268922),
(2574, 581, 'Preston Williams', 'https://www.google.com/maps/contrib/104437372341921234481/reviews', 'en', 'https://lh5.googleusercontent.com/-uRPH4yyOANQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0oolEwLiEQelBWtRrYYZvpqgJFCQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'in the last week', 'My favorite pot store in oregon. Amazing friendly staff , great prices wide selection and quality products. This is how buying marijuana should be.', 1527538389),
(2575, 581, 'Jana Infanger', 'https://www.google.com/maps/contrib/101390969179105440654/reviews', 'en', 'https://lh3.googleusercontent.com/-HceP54c9xUk/AAAAAAAAAAI/AAAAAAABEEA/8S40M-ohTG4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'in the last week', 'This is one of the nicest recreational stores I\'ve ever been to. So much selection and a really friendly staff!!', 1527479831),
(2576, 581, 'alyssa menle', 'https://www.google.com/maps/contrib/101385574720293788674/reviews', 'en', 'https://lh6.googleusercontent.com/-XSsRH9CQvuo/AAAAAAAAAAI/AAAAAAAAAHE/beMC_CiGD1k/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'in the last week', 'Very knowledgeable and helpful. Staff was great and the place was very clean and well organized.', 1527745376),
(2577, 581, 'gena burton', 'https://www.google.com/maps/contrib/100392879861538896304/reviews', 'en', 'https://lh6.googleusercontent.com/-QOkGdsyjX1w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0r7lk91JmjcgbEqoG2e0pbtboWrw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'Love going here when I visit the coast. Customer service is on point, bud tenders know their stuff.', 1527364932),
(2578, 582, 'Shawn Miranda', 'https://www.google.com/maps/contrib/106745096131657819812/reviews', 'en', 'https://lh3.googleusercontent.com/-SW9WLuoBsv0/AAAAAAAAAAI/AAAAAAAAAW8/EKPl8I6nKpQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'in the last week', 'Went in a couple of days ago not knowing what to expect. Sarah was super helpful and sold me two wonderful strains. When I\'m in Oregon, I\'m not going anywhere else for my fix.\n\nUpdate : I\'ve now been here 4 times. Staff has always been prompt, friendly and very helpful. Great place all around. :)', 1527721416),
(2579, 582, 'Harley Lynn', 'https://www.google.com/maps/contrib/111739227656236369427/reviews', 'en', 'https://lh3.googleusercontent.com/-0azE8zKQilk/AAAAAAAAAAI/AAAAAAAAFEg/REptkj1inPo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Super nice staff! And they really know what they\'re talking about! Its a clean , inviting atmosphere. They also dont try to over sell! Went to one shop and got not as great flower for the same price as more and better in this shop!', 1527296880),
(2580, 582, 'larissa nakagawa', 'https://www.google.com/maps/contrib/103598941799843632557/reviews', 'en', 'https://lh4.googleusercontent.com/-TwGTksgXJ1Y/AAAAAAAAAAI/AAAAAAAAMto/lqCVq-zDXf0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very friendly! The art is so fun around the office. They have menus available for while you’re waiting which saves quite a bit of time. Very clean and helpful!', 1524535959),
(2581, 582, 'Jason H', 'https://www.google.com/maps/contrib/115498916673576420710/reviews', 'en', 'https://lh6.googleusercontent.com/-Jdi9FIUeGW4/AAAAAAAAAAI/AAAAAAAAAKg/0dVNAvfe5Ec/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Friendly and knowledgeable staff, great prices and selection. If you\'re on a budget, I highly recommend checking out some of the B buds. A very good bargain.', 1521220556),
(2582, 582, 'Tommy Roche', 'https://www.google.com/maps/contrib/115882474977625906874/reviews', 'en', 'https://lh6.googleusercontent.com/-qs_Lk_ziw4g/AAAAAAAAAAI/AAAAAAAAhj0/TFN87Xj9mRE/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'Great selection of top quality herb. Friendly and professional staff make the experience enjoyable from start to finish.', 1526326785),
(2583, 583, 'Hawk Marsden', 'https://www.google.com/maps/contrib/106841911249758623138/reviews', 'en', 'https://lh3.googleusercontent.com/-mooPh3i-7os/AAAAAAAAAAI/AAAAAAAAAFg/YwkJ7URyZCI/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '10 months ago', 'Very disappointed I asked for one particular  product multiple times only to leave with what I did not want. Hence another reason to grow your own, pushing a product that on customers they show no interest in and demeaning another customers opinion is just bad business. Would not recommend to medical connisuers with distinct needs \"YOU WON\'T GET WHAT YOU NEED\" from what I established in the dispensary \"YOU WILL GET WHAT THEY CHOOSE FOR YOU\" . Hence 4 seizures in one day. However I will say the receptionist was outstanding, informative at all times. Happy and helpful. The guy in the back however needs to actually stop talking and learn to listen.', 1500089466),
(2584, 583, 'Randy Haug', 'https://www.google.com/maps/contrib/109361579912610434350/reviews', 'en', 'https://lh4.googleusercontent.com/-kjovirTCFOU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0KRwaIizCTXJwgbB83WUH9hdli8w/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '8 months ago', 'Great service staff very knowledgeable about the products they retail. Never leave dissapointed and they offer oils dabs and hash.', 1505011855),
(2585, 583, 'Cassidy Triplett', 'https://www.google.com/maps/contrib/117449983000722678008/reviews', 'en', 'https://lh5.googleusercontent.com/-upo7Idn5wjk/AAAAAAAAAAI/AAAAAAAAAMI/yy1IqvccJ1E/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I absolutely love this place! Everyone is super friendly and helpful. It\'s beautifully set up, clean and comfortable. They always have a good verify of stuff and in my opinion......the best quality around! I do my best to avoid going anywhere else. Thank you guys for every stellar experience!', 1484719448),
(2586, 583, 'Kevin Jolly', 'https://www.google.com/maps/contrib/110894324509728468318/reviews', 'en', 'https://lh4.googleusercontent.com/-vScSios_M4k/AAAAAAAAAAI/AAAAAAAAvGs/rc3P0-f0zy0/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '12 months ago', 'Beautiful space. Knowledgeable and friendly budtender. Quality product.', 1496556214),
(2587, 583, 'Cindy Wong', 'https://www.google.com/maps/contrib/111058943016424844850/reviews', 'en', 'https://lh6.googleusercontent.com/-gIJx3mv1WHk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3Zj12jfcAHsjofotMBxdZMeGiEvQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'I\'m not sure why there are so many bad reviews. My experience was very different. Very friendly, helpful & not pushy staff!! Convenient location and the home of my new favorite strain.. Guerilla Glue.  The Dundee location didn\'t have it in stock & offered to call their other location to see if they had it. Went above & beyond to help me..I will definitely be back :-)', 1458688026),
(2588, 584, 'Kari Hutchison', 'https://www.google.com/maps/contrib/115864906770483319255/reviews', 'en', 'https://lh4.googleusercontent.com/-Kw3-wScNqe8/AAAAAAAAAAI/AAAAAAAASnI/UvaKzirf4UY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'After being disappointed in the service and pricing at a different local dispensary I stopped in here to check it out. I was greeted promptly by friendly staff as soon as I walked in. I explained what I wanted, a CBD balm, and was given several options. The staff was well informed and very helpful. The pricing was competitive ($10 less than the other place) and even if it hadn\'t been I would have made my purchase here just because the staff was so great. I will definitely be back. Thanks!', 1527137538),
(2589, 584, 'Emma Jean', 'https://www.google.com/maps/contrib/109041097634348899220/reviews', 'en', 'https://lh6.googleusercontent.com/-VO9vjWctNp0/AAAAAAAAAAI/AAAAAAAAHeA/yJwyjdmBqkc/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'Awesome little place. The chick who helped me was so fun and knowledgeable. I described what I wanted in a buzz and she narrowed it down and I am not disappointed with her picks. I\'m glad I made a stop here. Good atmosphere and prices. Tons of souvenirs too. I would definitely recommend this place and I will definitely be back.', 1522008430),
(2590, 584, 'Adam Martin', 'https://www.google.com/maps/contrib/100371609902032484937/reviews', 'en', 'https://lh6.googleusercontent.com/-s09ufkepPyQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq33DBSbylX4jcr1C0lh-_DDgJmesA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Awesome staff and probably the best selection of products in town.  Only issue would be that prices are a little higher on some products but thats normal with any business.  Knowledge of the staff definitely worth the visit!', 1522681259),
(2591, 584, 'Adam Meyer', 'https://www.google.com/maps/contrib/100445379652416009095/reviews', 'en', 'https://lh4.googleusercontent.com/-e6XgmQiPUG0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3xwePqxraG_htn-4qcoNTM6GnEkQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'The guy that helped me was super cool.  Very helpful, nice and knew his products. I only stopped here because I like puns and this one of the best dispensaries I\'ve been to.', 1521597002),
(2592, 584, 'Trisha Franke', 'https://www.google.com/maps/contrib/104132373902376758603/reviews', 'en', 'https://lh5.googleusercontent.com/-hRShhsb9XNw/AAAAAAAAAAI/AAAAAAAAH6g/a7Qxlqy6bP4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Molly was absolutely amazing in helping with my purchase today. Her smile brightened our day; her knowledge about flower and all there product was amazing. There product, prices and service are outstanding. Definitely a place I\'ll be visiting again. Thank you Molly for the great experience today!', 1513541572),
(2593, 585, 'Michelle Burge', 'https://www.google.com/maps/contrib/106479002578425354373/reviews', 'en', 'https://lh5.googleusercontent.com/-sPBzwoPw4pc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0PSKcvy-pf48zpiGVFYsl4aT0w4w/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '3 weeks ago', 'First I would like to say is I have not asked for remedy yet but because i have had Great experiences until now. Can not figure out why the clones i bought, in which i am running 15 hrs light on and 9 hrs asleep/dark when i discovered that every single clone i bought is in flower....i only can figure they must have mother plants and clones under 24 hour light....if this is the case, why was i not informed....VERY FRUSTRATED......Let me add that my seedlings are not budding......I AM SOOOOO PISSED RIGHT NOW  I trusted you fools oh guess i am the fool. You know my husband has been growing in Oregon for 30 years....THIS IS A JOKE, RIGHT!!! HA HA.....I REALLY HOPE I GET MY MONEY BACK!....I am not the only one pissed about your clones....bad for reputation', 1525925934),
(2594, 585, 'Mike Cooper', 'https://www.google.com/maps/contrib/102884938954328776064/reviews', 'en', 'https://lh5.googleusercontent.com/-_-rDDwyA6P0/AAAAAAAAAAI/AAAAAAAAP-0/Rzdim0S0H9k/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'Great prices and knowledgeable staff. There are some great deals on weekends.  These guys always have a great selection of clones.', 1520398611),
(2595, 585, 'Melissa Lillegard', 'https://www.google.com/maps/contrib/115493267076827334267/reviews', 'en', 'https://lh4.googleusercontent.com/-V1gjUevOaHA/AAAAAAAAAAI/AAAAAAAAAA8/x_RrIwslxqM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'This place was perfect. The employees were very polite and very knowledgeable.  They greeted me when I came into their store. Very large selection of clones. Great genetics', 1518258466),
(2596, 585, 'Bryony Thomas Smith', 'https://www.google.com/maps/contrib/100627658721990924848/reviews', 'en', 'https://lh3.googleusercontent.com/-XocTywfIzlM/AAAAAAAAAAI/AAAAAAAAAAA/bBbuXpzPHcY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Best shop ever! Everyone is amazing and super knowledgeable! Love this place! Best papers In town too!', 1519087134),
(2597, 585, 'Kelly Jones', 'https://www.google.com/maps/contrib/106054713548375237709/reviews', 'en', 'https://lh3.googleusercontent.com/-t_7d8_VH6GU/AAAAAAAAAAI/AAAAAAAAExQ/4GnvkBIy5vQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'My doctor recommended finding a good dispensary with knowledge to help me with my medical issues. Progressive Collective has very helpful and friendly bud tenders, who listened and advised me on what would be best for my specific personal needs. \n\nIn addition to being the cleanest and friendliest dispensary I\'ve ever visited (and they are all pretty friendly, I must say), they are by far the most willing to find discounts for me! They have daily specials, and are really interested in helping me get the results I need. \n\nIf you have any questions about ANYthing related to the industry, medical benefits, or recreational suggestions, these are the people to ask. \n\nI love this neighborhood, locally owned and operated business! Can\'t say enough nice things - check them out!', 1507780404),
(2598, 586, 'Merna Chiarletto', 'https://www.google.com/maps/contrib/102267939879952552590/reviews', 'en', 'https://lh6.googleusercontent.com/-X71QluWz70U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1lpyKD2hkV-3l7wS2MyHdSC_3egw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'LOVE THIS PLACE!! Every time I have a question about a strain or what would be best for me if I\'m wanting to get a certain high the staff always knows exactly what to get me. This is the only place I get bud now. I also bought my dab pen from here and they were able to help me out with any questions I had about that as well. I like how they post the prices for a gram on each jar. Very comfortable atmosphere. Had trouble figuring out parking the first time I went.', 1519987685),
(2599, 586, 'Beard Grylls', 'https://www.google.com/maps/contrib/104836086909553366478/reviews', 'en', 'https://lh3.googleusercontent.com/-HgcSl-e9VtQ/AAAAAAAAAAI/AAAAAAAAAIY/9PreWA35TwY/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Great staff and selection. I bought the BG Family Farms bubblegum dabs made through White Label Extracts and I\'m super happy about them. Worth every penny', 1523640495),
(2600, 586, 'Lisa Burris', 'https://www.google.com/maps/contrib/114986740881463817720/reviews', 'en', 'https://lh6.googleusercontent.com/-IG2qRUX-IWI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1lh6PyZeM8wzFYEkOMV5REdAGwVA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'Friendly, knowledgeable staff, good atmosphere, and a fantastic selection.  All the products are on display with menus posted for more detail.  They\'ve got a LOT of strains plus what seemed like sixty different wax/shatter/concentrates.  They have a good variety of prices and occasionally nice deals.  Today they even had about a dozen immature plants, although they don\'t carry those year round like they do seed packets.', 1518337736),
(2601, 586, 'Blake Stucky', 'https://www.google.com/maps/contrib/105543840400654941332/reviews', 'en', 'https://lh5.googleusercontent.com/-Vu09xDP6vxI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq36fN8SEESjLrC2RYy8GKXezGZMMQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '3 weeks ago', 'Staff was inviting and informative especially being an out of towner. They made the buying experience easy with menus and have excellent pricing.', 1525627232),
(2602, 586, 'Eric Suter', 'https://www.google.com/maps/contrib/113169022677160105289/reviews', 'en', 'https://lh5.googleusercontent.com/-nyhnI9_Dn9U/AAAAAAAAAAI/AAAAAAAAAzE/dzRHlugSLpg/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '3 months ago', 'Update 1/17/18 9:30am: I am disappointed with this place. I stopped in to get a pre roll and it was HALF a joint, I’ll post the picture. And to top it off it burned horrible. I will give them one more chance and if I am not satisfied I’ll go else where.\n\n1/10/18 Better than going green dispensary. They don’t care about their customers, if my experience changes at this location I will update my review.\nDefinitely need to repair the parking lot and paint the building.', 1518917972),
(2603, 587, 'Levi Weert', 'https://www.google.com/maps/contrib/115891021642173610959/reviews', 'en', 'https://lh4.googleusercontent.com/-Gj07mgcT2OY/AAAAAAAAAAI/AAAAAAAAAK4/Gzaaw049lH4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Best customer service and vibe. I drive across town and skip many other shops just to go here. Great regular deals.', 1519841588),
(2604, 587, 'Tamir Polk', 'https://www.google.com/maps/contrib/102297685683542157674/reviews', 'en', 'https://lh3.googleusercontent.com/-0pZNyFLe-wE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2appJi7M5WbFjUuaAHH9lJqnjgrA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Fun Atmosphere great deals on Buds daily and 420 Speacials. Good people warm welcoming and easy going. I advice you try it out!!', 1511377857),
(2605, 587, 'slacker legend', 'https://www.google.com/maps/contrib/105202951250655321522/reviews', 'en', 'https://lh3.googleusercontent.com/-eTzCJuj0StE/AAAAAAAAAAI/AAAAAAAASI4/1MBNrF0dlXw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'I was chasing cats outside in the parking lot for an hour before they told me to come in. On 8g of mushrooms. The cop at the door shot lasers out of his eyes to scan my ID and his eyes turned bright green when he hit the buzzer.  The two massive lizards budtenders were amazing.   They pressed the weed buttons on their giant weed machines and through a series of tubes shot me these black containers of the strain of sativa strains, the durbani poison weed.  Very nasty stuff.', 1512338293),
(2606, 587, 'cody whitton', 'https://www.google.com/maps/contrib/106045816503005601357/reviews', 'en', 'https://lh6.googleusercontent.com/-CSoUj99hcB8/AAAAAAAAAAI/AAAAAAAAEbQ/Zouv8KJQlcg/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Butender  very help no rushing you explains all about product.thanks', 1524832535),
(2607, 587, 'Wilson Huynh', 'https://www.google.com/maps/contrib/106983213787475956143/reviews', 'en', 'https://lh4.googleusercontent.com/-UVUdQfw6FLg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2l9UgSnEk8ICAs15e5-YC_X_F6iw/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '6 months ago', 'Not a bad place. I had a friendly clerk that knew what he was talking about. You can just grab gas from the arco nearby and while you\'re waiting grab a gram and be off.', 1510682299),
(2608, 588, 'Cathleen Lamb', 'https://www.google.com/maps/contrib/108162009079915564970/reviews', 'en', 'https://lh4.googleusercontent.com/-Sq1bUzNGuNk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1dz7Rtw2Pem1wuWuuL6Zq7CcdESA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'Friendliest place in town. Experience and personality is in abundance and always a welcome. Don\'t waste your time going anywhere else.', 1527128208),
(2609, 588, 'Marilyn Kenney', 'https://www.google.com/maps/contrib/102854077778080505430/reviews', 'en', 'https://lh5.googleusercontent.com/-9pfKddSf2d0/AAAAAAAAAAI/AAAAAAAAACc/PahbtPNAdXc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Such a great place. Really good selection of goods & friendly customer service. Thank you', 1523994792),
(2610, 588, 'Adam', 'https://www.google.com/maps/contrib/116944813043460811531/reviews', 'en', 'https://lh3.googleusercontent.com/-XnP01QZW1YI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2v1idmP-JP8iDivXsjjtLC6sAh8A/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '3 months ago', 'Great service. Low grade cheap weed was extremely terrible compared to other shops in area that had same price for cheap stuff. Overall good with high strength cbd flower', 1519696625),
(2611, 588, 'Ryan Haynes', 'https://www.google.com/maps/contrib/110448926972180504058/reviews', 'en', 'https://lh3.googleusercontent.com/-WhtFiEgQA24/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1WTZ1GnnkPDQtBBcspPDHIRNrY9g/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, 'a month ago', 'Its nice and quiet with good staff and a decent selection of flower and oils and edibles.', 1523646259),
(2612, 588, 'Sally Bossi', 'https://www.google.com/maps/contrib/101868357310795157670/reviews', 'en', 'https://lh4.googleusercontent.com/-x9FraDeHK64/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq243c1RkvHC5v_RXGyQxh4Mj2NG7w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great product at a good price, very friendly people.', 1523227560),
(2613, 589, 'Monica Farlow', 'https://www.google.com/maps/contrib/103390516461243447276/reviews', 'en', 'https://lh6.googleusercontent.com/-zid_EDB0dZc/AAAAAAAAAAI/AAAAAAAAABY/ck11u06RUSs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I came here on the way to the airport last October when visiting my son at Linfield. I picked up some of their cream for my mom, which worked wonders for her pain. It’s actually the only thing we’ve found that’s worked for her. Now that weeds legal in CA, I’m sure I could find it there but I’m back in McMinnville for my sons graduation, so I’m going to pick up another jar. I just hope they’re open tomorrow, being it’s a holiday, with today being closed!', 1527458541),
(2614, 589, 'Ceeot Neccin', 'https://www.google.com/maps/contrib/104925341737517966933/reviews', 'en', 'https://lh6.googleusercontent.com/-M35GEQIRHxc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1gGzb2uZm2lGi6-PbyyS6bL349CQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Great customer care and support. Very good selection, fair pricing. Will be going back.', 1523905889),
(2615, 589, 'Deborah Dutton', 'https://www.google.com/maps/contrib/115589647518667647095/reviews', 'en', 'https://lh6.googleusercontent.com/-HN7kecgccFQ/AAAAAAAAAAI/AAAAAAAAADg/_RQ3YruhYl8/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 2, '2 months ago', 'I used to love it here but prices changed things got cheaper but quality did too. The dang skanks flirted with my husband right in front of me. The funny thing is he is a skinhead and does not like mixed race girls.....they don\'t care.... it pissed me off but I left laughing because it was so bad it annoyed him. I\'ll never go back. The rso is not good and way more expensive than what they used to sell it for. To be truthful I would go to go oc cannabis in amity. Honest people cool turtles and 12 dollar dab.', 1521375711),
(2616, 589, 'jenna riddle', 'https://www.google.com/maps/contrib/109245030933585705511/reviews', 'en', 'https://lh3.googleusercontent.com/-KmOFhlYhSFA/AAAAAAAAAAI/AAAAAAAAADg/q0jqD6oZBhw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '4 months ago', 'Very nice and relaxing environment adorable fish that follow your finger. Great staff very sweet and always informative best prices in town wondferful products and lots of selection and you always get free candy at the end all around the best experience.', 1517161799),
(2617, 589, 'Dominic Alfaro', 'https://www.google.com/maps/contrib/112139325994611261955/reviews', 'en', 'https://lh3.googleusercontent.com/-cNXWVq3Eblc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2X-9a0raDPwEQQnccc5hMNxTmcKQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I just spoke with a nice lady on the phone was unable to obtain her name, but I would like to say she was very informative and helpful. Her patience and willingness made it a pleasant informative conversation. 5 star customer service!', 1511806980),
(2618, 590, 'Loginn Johnson', 'https://www.google.com/maps/contrib/108685579371460906930/reviews', 'en', 'https://lh6.googleusercontent.com/-MBkFDQLxEr4/AAAAAAAAAAI/AAAAAAAALVQ/tKoz8M6JOMQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'Great place, prices and deals were awesome. It\'s been a while for me and the girl up front was extremely helpful and informative. Would definitely recommend to other first time users or regulars. Huge selection as well.', 1526943167),
(2619, 590, 'Aaron Sarinana', 'https://www.google.com/maps/contrib/102831096499031459444/reviews', 'en', 'https://lh5.googleusercontent.com/-hXkhpd1nFxk/AAAAAAAAAAI/AAAAAAAAAA8/aBAGR3mL9M4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Caleb absolutely is one of the friendliest bud tenders I’ve ever met. I’ve been smoking for a good couple years now and the Center always has something new. And let’s not forget about their deals! I one time was able to get a wonderful sativa for 5 bucks a gram!', 1524185547),
(2620, 590, 'Veronica Castro-Rogers', 'https://www.google.com/maps/contrib/116836689153018903468/reviews', 'en', 'https://lh3.googleusercontent.com/-o4vtxhQX67k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2dyQuu3ArCEKgXgFvRQFUz6d_EwA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I absolutely love this shop, friendly staff, very informative and if you need to be educated they are more than willing to help you out. Great Happy Hours prices, definitely check this place out. Been to many shops here in Bend and definitely will recommend this one.', 1519880539),
(2621, 590, 'rand k', 'https://www.google.com/maps/contrib/114865484196560382758/reviews', 'en', 'https://lh5.googleusercontent.com/-lVtp8jzu-lE/AAAAAAAAAAI/AAAAAAAAAG0/AmvEvRHWD6o/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Simply put: Impressive! Primary selling point for me: HUGE selection. It also helps that it is a beautiful building, total eye candy inside.', 1524446473),
(2622, 590, 'KD C.O.', 'https://www.google.com/maps/contrib/102535178141659633754/reviews', 'en', 'https://lh3.googleusercontent.com/-pMFlLQrETP8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq26gv5rhPWqrh0RC0oLUgb8PRfn1w/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'Want good quality and cheap legal marijuana products? This is the only place in town to come. These guys don\'t seem like the other greedy merchants in Bend and charge much less for the same product that other places offer. Smart decision making on their part. Great helpful staff is also a plus. It seems like the staff is well paid and taken care of and it shows in the service you get. THC rocks!', 1515984743),
(2623, 591, 'Kylie Merritt', 'https://www.google.com/maps/contrib/104249416283677456600/reviews', 'en', 'https://lh6.googleusercontent.com/-qmrvkYNvlXI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0D8FMGxfm-RXo6ZponMXydDQYwBQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'Terrible costumer service as of recently, have been long term costumers buying an oz a week without any problems. Not a pleasant environment as it used to be. No return policy, lack of customer appreciation, more into turning profit. I feel as though this is an impact from new employees and management.', 1525409060),
(2624, 591, 'joshua randolph', 'https://www.google.com/maps/contrib/115009985527255030684/reviews', 'en', 'https://lh6.googleusercontent.com/-b2h6_oybl3c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq16j1j3EiyOf0FoquGc60KGuq2ltg/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '2 weeks ago', 'The front check in person is the only reason i gave 2 stars instead of 1. The customer service  was lacking, not the most friendly crew of employees. The product  was meh and the price was high. I wont be shopping here again.', 1526060028),
(2625, 591, 'Jane Buck', 'https://www.google.com/maps/contrib/108551720656766682700/reviews', 'en', 'https://lh3.googleusercontent.com/-pI8YsBJYU30/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0DJ_40T10AuF2Sk9BCAm_njX0w5w/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'I\'ve yet to finish a cartridge before it leaks and makes a huge mess. It\'s always after the 2 week period to exchange it. I won\'t go there again. It\'s their label on the cartridges. I\'m so tired of the disappointment. Not to forget to mention the financial waste.', 1516490906),
(2626, 591, 'Pete Lacher', 'https://www.google.com/maps/contrib/114308998738056533720/reviews', 'en', 'https://lh3.googleusercontent.com/-HGfsVA8PajM/AAAAAAAAAAI/AAAAAAAAABg/A7-3--kK_Ps/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, '6 months ago', 'This place is notoriously and unreasonably overpriced. I always get a laugh when they email out their \"deals\" which are not deals at all. I\'ve heard more people compliment the wood finishes of the building\'s interior than the quality of product. Correction: I\'ve never heard anyone compliment the quality of the product for the value it\'s offered at.\n\nMy advice for management: pay off the woodworking bills out of your own pocket and quit over taxing the product. The fact that people avoid your location is because the value of your product does not match price people are willing to pay isn\'t helping your status in the community. As many people have said through reviews, there are many more dispensaries with better quality and better pricing within a half a mile in either direction.', 1509722086),
(2627, 591, 'SusieQ Runkle', 'https://www.google.com/maps/contrib/103042812968705732566/reviews', 'en', 'https://lh5.googleusercontent.com/-VphWVvsRwkc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3eW1lg6aDQPdCI9SSp3IQU4idlBw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great customer service, nice display of their products, and good prices.', 1524417683),
(2628, 592, 'John Thomson', 'https://www.google.com/maps/contrib/100161969660516980112/reviews', 'en', 'https://lh5.googleusercontent.com/-pX7uiYS3aQk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2n3cKsC7bSZQ0Fks6yfliSaXo6pQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '4 weeks ago', 'came in around 830 in the morning. Never been here before I wanted to try it out. I’ve been going to the same place for the last 2 1/2 years so I figured why not try this place out I had a friend tell me about it.I show up right away I noticed their selection is very minimal although they do have a clean,  pretty , vibrant place. There was only one person at the counter for almost 10 minutes and then I turn around and look at the door and there’s eight people behind me. I was very frustrated for waiting I’ve never waited that long ever anywhere.then another guy came out and help me there was no menu I had to go based solely on what he said about the weed so it took a lot more time because I didn’t know what I wanted when I got to the counter and this would helped speed things up . The bird price was great same price as the other place I go. Honestly I’ll probably try this place a few more times because it was so nice inside but the first impression and the first time kind of sucked. \n\nSorry guys ', 1525276944),
(2629, 592, 'Jaime Kenney', 'https://www.google.com/maps/contrib/104124276052459789588/reviews', 'en', 'https://lh3.googleusercontent.com/-BRzDmXxpJZw/AAAAAAAAAAI/AAAAAAAAMS0/taX7L0TIPf4/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 4, '2 weeks ago', 'PS- they never have prerolls.        Weekly customer to this shop only for a few months at least. A cartridge literally fell apart when I pulled the cap today. I went to return it within the hour, but misplaced my receipt. Without hesitation they referred to store policy. No exceptions, no offer of even so much as a discount or something. I don\'t know. I understand their perspective, but it was the same staff that sold me the cartridge. They lost a loyal customer. Bummer, I really liked them.', 1526511418),
(2630, 592, 'Ian Sullivan', 'https://www.google.com/maps/contrib/111222125214302689926/reviews', 'en', 'https://lh3.googleusercontent.com/-BRxA-hqcFfM/AAAAAAAAAAI/AAAAAAAAAvw/kVFzxY99tsI/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'this much like every other place in beaverton sucks. if you like waiting in line every time for 20 minutes to find a minimal selection of mediocre flower and overpriced oils this is the place for you. also if you do find something you like stock up because they wont have it again when you go back for it. save your money and go to vancouver where you wont waste your time. ', 1527364748),
(2631, 592, 'Patrick Billera', 'https://www.google.com/maps/contrib/107567282539158193041/reviews', 'en', 'https://lh6.googleusercontent.com/-r_hw7IGE7q8/AAAAAAAAAAI/AAAAAAAAJhU/hSO0HzLxszI/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '6 months ago', 'Just great. My 1st visit. This will be my primary dispensary. Easy parking and location. Friendly staff. Good quality bud and prices. Really like the concepts of \"wake & bake\" special pricing.', 1511993484),
(2632, 592, 'Alex Gomez', 'https://www.google.com/maps/contrib/111191283745104674497/reviews', 'en', 'https://lh6.googleusercontent.com/-fS6Jl78RyJs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3ochoEwsLV4U2iF2_xHA4MNgWxcQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'this place is garbage, waited 20 minutes to get a pre roll joint to be told they don\'t have any. big ass place with not a lot of buds', 1527651596),
(2633, 593, 'rain storm', 'https://www.google.com/maps/contrib/102608798762523499469/reviews', 'en', 'https://lh6.googleusercontent.com/-UfgmWNAF47c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq027BQhzaFZ7OcWf9zCR-HD9kA-iQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Get your medical cards here', 1524797255),
(2634, 593, 'Mario Van Huffel', 'https://www.google.com/maps/contrib/101753047374453261479/reviews', 'en', 'https://lh6.googleusercontent.com/-DiYUzvVRJac/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3l1YG-k3iSQY0ZXdkYgwJ2lpiDHA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Very fast friendly', 1519426547),
(2635, 593, 'Mo Hart', 'https://www.google.com/maps/contrib/104334222498550802487/reviews', 'en', 'https://lh6.googleusercontent.com/-rtVPUmOwu4w/AAAAAAAAAAI/AAAAAAAAAAA/O-ChilxNMDk/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'I was given incorrect information and then was told I had to pay 35$ to \"hold an appointment\". When I later found out that I was given incorrect information I was told my 35$ would not be refunded. A year later I get a phone call from them asking if I would like to renew my card through them. I said no because my money was kept. The girl said \"it was only 35$\". Only 35$ I said? And then she hung up on me. I haven\'t witnessed an industry filled with this many thieving, lying people since I worked at a bank. Wake up people. Stay woke.', 1473187606),
(2636, 593, 'Robin Smith-DeBray', 'https://www.google.com/maps/contrib/100704381813155913578/reviews', 'en', 'https://lh5.googleusercontent.com/-oIljl800p0o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq33cOi4xmnSsGI_8Ui1QEwT0gXhTw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I have gone here since they opened the doors. I have found them to be extremely professional, helpful, accommodating, and friendly. Having worked in the professional realm of a medical practice prior to my illness, I appreciate their thoroughness, and their discrete professional manner.', 1469996297),
(2637, 593, 'oregon pitking', 'https://www.google.com/maps/contrib/101118763054897282519/reviews', 'en', 'https://lh6.googleusercontent.com/-19BoXDBcXKY/AAAAAAAAAAI/AAAAAAAAAUw/MudUBkcCnrI/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 years ago', 'The reason this place is a horrable example of a business is cause they only get doctors in about every other months for about a week or two .so most of there business days are spent sceduleing for when the doctor is avaliable .so if you call they want to schedule you in two or three weeks out . totally unacceptable if ur card is going to expire soon . ', 1457373258),
(2638, 594, 'Daniel Kohn', 'https://www.google.com/maps/contrib/104419964828809241778/reviews', 'en', 'https://lh5.googleusercontent.com/-7Hs86TdUKjU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1bV1PEHxIV_SVnPhkCMuuBE6FAXQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Their level of incompetence is astounding.  They\'ve been unable to get my medical records for a month and keep jerking me around.  It\'s as if it\'s their job to make sure I can\'t get a card.', 1521941106),
(2639, 594, 'sydney', 'https://www.google.com/maps/contrib/110333387841685006826/reviews', 'en', 'https://lh4.googleusercontent.com/-dDDbGTuLd_c/AAAAAAAAAAI/AAAAAAAAAp8/jsxhplkYYqw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Going into getting my Medical Marijuana Card I was REALLY nervous... Then I went to my appointment... The staff first the foremost were AMAZING they made me feel comfortable and welcome even though I was obviously petrified (I also am deeply afraid of doctors appointments in general) and also verified with me that what I was feeling is okay and that the purpose of OMM is to ease those symptoms. 100% would recommend, these guys are the real deal and they are amazing! Thank you!', 1478538765),
(2640, 594, 'Christopher Stevens', 'https://www.google.com/maps/contrib/112667122666807833077/reviews', 'en', 'https://lh3.googleusercontent.com/-V62y0KSyssk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3HRPyljSfcuzdFDbUfIrvwEURhlQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'I believe this place is wonderful the reception was very kind and made me feel welcome. Once I got to speaking with the doctor he has plenty of great information to provide you for obtaining omm and knows his stuff. Looking to get yours too give them a call :)', 1458317906),
(2641, 594, 'Adlee Shirley', 'https://www.google.com/maps/contrib/103181961549478649955/reviews', 'en', 'https://lh3.googleusercontent.com/-X1n7h9npjE8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq28NeZs5EA0ib50vReWgvOC2OBAgA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'its great.', 1459525356),
(2642, 594, 'Michelle Swearingen', 'https://www.google.com/maps/contrib/101133737563018409629/reviews', 'en', 'https://lh5.googleusercontent.com/-6qRcYMMb8UE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq36ohvi9X28Zbv-U71C9MgvX9PMzA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'Very friendly & fast', 1458322155),
(2643, 595, 'Brian Sylvester', 'https://www.google.com/maps/contrib/114608695625138421835/reviews', 'en', 'https://lh6.googleusercontent.com/-v194bQvDWYg/AAAAAAAAAAI/AAAAAAAAaRI/EwviUSKiTPQ/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a month ago', 'Very friendly helpful and knowledgeable staff. Will always try to work with you on any issues that may come up.', 1523481148),
(2644, 595, 'lola Vandupe', 'https://www.google.com/maps/contrib/109588977150179445103/reviews', 'en', 'https://lh4.googleusercontent.com/-DrTePVu2hDY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0nElHZ5qGA9wcQPTVDtgiOJ_5qVw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Very knowledgeable doctor, nice staff', 1527029093),
(2645, 595, 'Tony Comtay', 'https://www.google.com/maps/contrib/103980991602083840543/reviews', 'en', 'https://lh4.googleusercontent.com/-W6R8coBE7ss/AAAAAAAAAAI/AAAAAAAAABg/YR3hjQjZFuI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'I had a great experience, a doctor actually you can talk to and will spend the time to listen. Quality and the best price in town. They follow the rules, so if you get denied---get real', 1498673646),
(2646, 595, 'Angela Fritscher', 'https://www.google.com/maps/contrib/103971157096898591143/reviews', 'en', 'https://lh5.googleusercontent.com/-vsebF9RpORI/AAAAAAAAAAI/AAAAAAAAUso/sw36xYdz6u4/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'Great people to work with!', 1526665834);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(2647, 595, 'Amy Waits', 'https://www.google.com/maps/contrib/116772676332287671141/reviews', 'en', 'https://lh5.googleusercontent.com/-T_5e_ARZiAs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ms_MNKRkjKJBnlODeMb-c7sonlQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'These people were cold and dismissive when I was thoroughly confused by the conflicting systems and suffering in acute distress- denied service because of my \"attitude\" aka DEEP AND PROFOUND frustration over intense, prolonged, and unnecessary suffering brought on by the doctors who I trusted with my life- Go to Mama\'s- they understand... (Response from the owner? Are you? Actually joking?) Did not want medical records transferred?? Just making up random comments? Why would I want to give a bad review? For which purpose? What a horrible attitude towards someone who was only seeking a way to get safe medicine- That owner response only solidifies my original comment 2 years ago- Smug and unprofessional- No compassion whatsoever-', 1495720826),
(2648, 596, 'April Brinkman', 'https://www.google.com/maps/contrib/118089170254091596499/reviews', 'en', 'https://lh3.googleusercontent.com/-ax6WW4wjaWs/AAAAAAAAAAI/AAAAAAAAACc/gJ_SIvCGyOs/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '4 weeks ago', 'Excellent professional service at this joint and some of the city\'s best doctors are here to boot.', 1525284992),
(2649, 596, 'Craig Young', 'https://www.google.com/maps/contrib/108695108798833332969/reviews', 'en', 'https://lh5.googleusercontent.com/-O-XH23tRD18/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1PbW3_asugRbJhdNRX8HO68_KP0g/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 years ago', 'They are very rude, and not business minded! I have gotten my card through them the last 3 years. This year when I wanted to renew, the front desk receptionist tried to make me jump through unnecessary hoops just for an appointment. When I questioned whether their policies changed I was told not to call them again? This is the first time I\'ve called since getting my card renewed last year.. Lol, your loss Aurora clinic! There\'s a ton of doctors who will write my recommendation, as I am one of the few legitimate medical patients you see! And I\'ve seen first hand some hippie get pissed off in the waiting room and get a walk-in appointment.. This place is trash, take my advise and stay away!', 1461961836),
(2650, 596, 'John Hardwick', 'https://www.google.com/maps/contrib/104702671152064208258/reviews', 'en', 'https://lh3.googleusercontent.com/-BIG5G-BNX9Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0lF843Auw_yzEOwd7ZVfkb5mdP0A/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a year ago', 'Great place! Quick and easy! Just have have your paper work ready in and out.', 1467139515),
(2651, 596, 'James Willis', 'https://www.google.com/maps/contrib/100788723758399583047/reviews', 'en', 'https://lh6.googleusercontent.com/-tIPxhkCdVWo/AAAAAAAAAAI/AAAAAAAAADA/PW8PZs-WN-I/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'Competent and friendly. That\'s a powerful combination. The Aurora Clinic\'s staff is thoroughly helpful and professional. There are closer clinics and I called and talked to a few before renewing my OMMP card. It was easy to see that their standards were not up to Aurora\'s. \n\nHow it works ideally - you send your records to Aurora, they review them and determine if you might be eligible, then call you in for a consultation with Doctor Julie. If there is not a condition that probably will qualify you, you are told without spending money If you do have a condition that meets OMMP guidelines, the good doctor calls you in for a meeting to determine if your condition warrants cannabis as medicine. \n', 1433371306),
(2652, 596, 'Rose Hauer', 'https://www.google.com/maps/contrib/116899131593410605333/reviews', 'en', 'https://lh5.googleusercontent.com/-QpjAeGDR3po/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1F41RwVYp8TRxcRSG1a7ocShmW2g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 years ago', 'Everyone is super friendly!  They tell you what to do, step by step, and help you clearly understand the process.  I was in and out in no time and will go back to renew every year.  ', 1422559875),
(2653, 597, 'Sharon nsen', 'https://www.google.com/maps/contrib/105618166346312991939/reviews', 'en', 'https://lh4.googleusercontent.com/-Qxx1iiQj7Pw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1M4dzTGFNFUyhGlBMP8Xbw1ntDXQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Very helpful and friendly.  Did not make me feel dumb when asking medical pot and rubs etc.', 1524851210),
(2654, 597, 'kyle hanson', 'https://www.google.com/maps/contrib/117105311242718796667/reviews', 'en', 'https://lh6.googleusercontent.com/-sYnC48C55MQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3_0sperzJcmN3VdjnQ2rect39SDQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Great budtenders, with an awesome assortment!', 1520891674),
(2655, 597, 'Brittany Frenock', 'https://www.google.com/maps/contrib/102180842737217721824/reviews', 'en', 'https://lh4.googleusercontent.com/-VOCr3q3Ri4o/AAAAAAAAAAI/AAAAAAAAEKw/vpC_jcaZwno/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 years ago', 'I\'ve had many experiences with different dispensaries in the area and I have to say Nature Quest is by far the best. First of all, the staff is amazing! Super friendly and knowledgeable and make you feel right at home and always make a good recommendation when I just can\'t make up my mind. They have a huge variety of concentrates and edibles and quality flower that I haven\'t found anywhere else. Getting my card through them was a breeze! All I had to do was provide them with my information and they did the rest, they even mailed it for me! Nature Quest is and will always be my one stop shop. Don\'t waste your time going anywhere else, after visiting here you wont want to. ', 1441918999),
(2656, 597, 'kenneth liebel', 'https://www.google.com/maps/contrib/112104525859241659358/reviews', 'en', 'https://lh5.googleusercontent.com/-GsJozFoH1Ic/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0209R6mbJMqiYuwY1KZW3rUh_3Gg/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a year ago', 'Experience was very surprising. Staff was very nice and respectful. However their doc...... let\'s just say he is a borderline conspiracy theorist. It is very wise to not let him continue talking after the paperwork is filled out. Unless you like a full blown lecture on political topics with information the makes you question his qualifications as a doctor. However that is my only complaint. Would have rated 5 stars if not for the misinformation and political talk.', 1465660815),
(2657, 597, 'Michelle Demarest', 'https://www.google.com/maps/contrib/104877895068223439321/reviews', 'en', 'https://lh3.googleusercontent.com/-wbbu4YD_aBE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq27iQT0wLOFJCDZZmwEPWSzYJ2akA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'This place is great and the people take care of you. They are my favorite!', 1500154755),
(2658, 598, 'Randy Deyton', 'https://www.google.com/maps/contrib/104760149708766641452/reviews', 'en', 'https://lh4.googleusercontent.com/-vJimw7DQILA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3-w2Uew7rBGE1oZ9B3rkj3NT0bEw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Very pragmatic. You are in the door fast, an average wait time for a Dr appointment. The Dr is obviously busy, which prevents you (the patient) from asking many questions. Otherwise, the staff were vert friendly and helpful with paperwork, as well as product reccomendations. They are busy, so be patient, they are trying to help you. ', 1473790937),
(2659, 598, 'Donna Polotnik', 'https://www.google.com/maps/contrib/111196961684268639289/reviews', 'en', 'https://lh6.googleusercontent.com/-N6laJltKdRc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2qcmMjSgcdSDoI7d74YigqAJ5mlA/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a year ago', 'The Dr. experience was strange, using Skype, but he checked me out pretty thoroughly. Receptionist was wonderful. The nurse that took me back was great, too.', 1466445676),
(2660, 598, 'Jeanne Rowe', 'https://www.google.com/maps/contrib/109081238166963939997/reviews', 'en', 'https://lh3.googleusercontent.com/-CxCJe3Tvu7c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0AvJWRCjmtJFX-V2l_BVcsyMD27Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Good experience however it took 6 to 8 weeks to get my permanent card. They do not extend the date on the temporary letter either.', 1482884268),
(2661, 598, 'Florence Escott', 'https://www.google.com/maps/contrib/117947335114867309162/reviews', 'en', 'https://lh6.googleusercontent.com/-7wfqMk2ykgM/AAAAAAAAAAI/AAAAAAAAAwU/kiIh-1XEVY8/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 3, 'a year ago', 'I wasn\'t pleased to discover only when I arrived for my appointment, that I wasn\'t actually paying for a doctors visit, but a skype call.   I would have liked to know that before making the appointment and paying a non-refundable deposit.  I felt a bit duped.  That being said, the doctor and staff were pleasant, friendly, and seemed efficient, maybe a bit rushed.  I will probably return for my renewal but at least now I know what I\'ll really be getting (skype vs. actual appointment), and that will be something I factor into the price as well.', 1471458461),
(2662, 598, 'David Gilbert', 'https://www.google.com/maps/contrib/106024180887327638763/reviews', 'en', 'https://lh3.googleusercontent.com/-fMrfgNLcf6A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1m6Wy9hOGxNfD266hKAWnvGUiHJA/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '2 years ago', 'Every time I make an \"APPOINTMENT\" I end up waiting for an hour. My disabilities are real and painful so being that they should know this, I shouldn\'t be paying as much as they as for at the office and have to sit and waits for ever, again when I already made an Appointment. I wonder if they know what the word means. If your a walk in you wait. If you make an appointment , the key word here, you should be ready for it. People are nice but service is ridiculous. Poorly put together and all about the money. ', 1445786586),
(2663, 599, 'Tanese Little', 'https://www.google.com/maps/contrib/102238265530388391820/reviews', 'en', 'https://lh5.googleusercontent.com/-kszFfmRsHYs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2HXRz-b30Wt7GBP9VQBkikaeIk-w/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '8 months ago', 'I was here for almost 3 hours waiting while no one was in waiting before me, the black mail receptionist with the facial piercings barely looked up enough from his phone to help me. The doctor sat on his cellphone at his desk for a good 45 minutes before seeing me (probably researching my condition on google. Smh) I would NOT recommend coming here for anything!', 1504904985),
(2664, 599, 'Sky Davini', 'https://www.google.com/maps/contrib/107096622836850394858/reviews', 'en', 'https://lh5.googleusercontent.com/-9Wn7bfxZNTo/AAAAAAAAAAI/AAAAAAAADaw/sN-sMHFBUak/s128-c0x00000000-cc-rp-mo-ba7/photo.jpg', 5, '3 months ago', 'Best place of  service  of medical cannabis around', 1518083529),
(2665, 599, 'Maria Gonzales', 'https://www.google.com/maps/contrib/104184366945777254990/reviews', 'en', 'https://lh4.googleusercontent.com/-4qwzOxQRz5U/AAAAAAAAAAI/AAAAAAAAADY/oEHmrwTpNCU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'I had a great experience getting my card here it was quick and the staff was very professional.', 1498766357),
(2666, 599, 'Cho Sen', 'https://www.google.com/maps/contrib/117332537030000953677/reviews', 'en', 'https://lh6.googleusercontent.com/-BodZkOZ6E64/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3yNcjfX5KSWX5B8h0lmq5PE1u5yg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 years ago', 'Quentin Bernhardson who\'s real name is Quentin Sward stole my identity and forged a ton of papers in my name to use me as an illegal grower. I called the Springfield police department and was told to call this clinic to get information. So I called and got an African American Worker, the only one that works there and told him to please help me, and to remain professional. I tried finding out if my identity was still being stolen and that\'s when the guy started to act like a thug threatening me to come inside the clinic and that he would deal with me. I can\'t believe they have a thug like this working on the phone. What really sucks is had he just been professional I would have got the information I needed but now I\'m pressing charges against Quentin and the police are going to help get this information for me. In the long run it would have been much better had they kept the thug off the phone. This place is shady, they know their clients forge signatures, they know their clients use fake growers. They are fully aware of this. In this day and age in Oregon it\'s not necessary unless you\'re greedy. In the end I\'m getting the help I need and the thug is just that... A thug who eventually won\'t have a job, then again what\'s new.', 1463507469),
(2667, 599, 'John H', 'https://www.google.com/maps/contrib/107481000959943099378/reviews', 'en', 'https://lh4.googleusercontent.com/-9cG4wjMTwe4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2VvDREWfGU_7Z3_rNgQuNmrhHLgw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Great. Helpful, professional, and patient staff. Fast getting me in for an appointment. Doctors have always been thorough about conditions during the appointment.', 1477366670),
(2668, 600, 'holly bridges', 'https://www.google.com/maps/contrib/102006404777758116587/reviews', 'en', 'https://lh4.googleusercontent.com/-nIDcMk9LaUc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3dgJc8ft0kD4vztiuUIqGwazmIEA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Very caring', 1492030176),
(2669, 602, 'Laurel Demuth', 'https://www.google.com/maps/contrib/108386891212165679482/reviews', 'en', 'https://lh3.googleusercontent.com/-qcxgOtNC6ek/AAAAAAAAAAI/AAAAAAAAADI/BsMAqIh-uTU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'I thought the staff was very educated on the laws for the medical program. Very attentive at my appointment', 1506204064),
(2670, 602, 'Anna Johnson', 'https://www.google.com/maps/contrib/108277450078079921310/reviews', 'en', 'https://lh6.googleusercontent.com/-s9JHkfBcCvA/AAAAAAAAAAI/AAAAAAAAOPQ/crCO7w0CAOk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a year ago', 'I have been a patient there for many years & have ALWAYS been so impressed with the staff & providers there.  They truly care about your health & well being.  They have the cheapest prices in all of Oregon too!  Everyone I know goes there & always so happy with their experience.  They have locations all over the state.', 1483732024),
(2671, 602, 'sky high', 'https://www.google.com/maps/contrib/111030520475127703255/reviews', 'en', 'https://lh6.googleusercontent.com/-NNjh9-lmi0Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2GCLydTKnvfEqnNCQn29K9MTvF8w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', 'We send all of our customers to SOAM. Super friendly and always helpful!', 1506204206),
(2672, 602, 'E.L. Bl/Du', 'https://www.google.com/maps/contrib/102867720388719381426/reviews', 'en', 'https://lh5.googleusercontent.com/-TPOdjXBqwCs/AAAAAAAAAAI/AAAAAAAAA-s/UXii_Os-9ZE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, '11 months ago', 'they never said to bring cash, but can use \'their\" ATm (for a fee).  Front desk is unprofessional and disorganized.  Extremely rude (passive aggressive) I had to go get cash (took me 3 mins), and she bumped my appt to a guy who came in 30 mins  AFTER I returned, payed my fee, and had paperwork filled out.  This is the most disorganized and unprofessional establishment posing as a \"clinic\".  Go somewhere else to get your card, they\'ve got a real racket going. (and they know it, so they don\'t try and are very rude)  At least they finally got an MD that actually did an exam, the 1st time in 4 yrs.  None of the other drs there even looked me in the eye, let alone an exam, they don\'t care as long as they get their money.', 1499180225),
(2673, 602, 'In the State of Corruption', 'https://www.google.com/maps/contrib/111014885759556319474/reviews', 'en', 'https://lh4.googleusercontent.com/-CZMcACN6O4c/AAAAAAAAAAI/AAAAAAAAAHg/Zn8aKyDAhaU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I have always found the staff very helpful and courteous. The doctors are amazing and very informative. I have learned so much about my medical needs and how to have them met without having to use medications that are highly addictive and harmful to my liver and kidneys. \nI am giving them all stars as I\'ve never had a problem scheduling appointments, their staff are professional, and the doctors are willing to take the time to answer any questions a person may have,', 1470169985),
(2674, 603, 'Joey Chokran', 'https://www.google.com/maps/contrib/107734771799697777205/reviews', 'en', 'https://lh4.googleusercontent.com/-0fCkbAcMQ2E/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2M8zYI74tP9IBTBxzC9iIsAvLVEQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'There a couple of great things about Dr. Roman’s practice that really helped me with the process, all of which I will highlight in this review.\n\n1. The plethora of information his website/blog and YouTube channel provide. Even before you are a patient, his information is readily available to help you get the process started for yourself. Being well-informed on the process in general makes everything easier.\n\n2. Knowing that he was prescribing in Delaware long before PA even approved medical marijuana shows that he is both knowledgeable and passionate about what he does. It also shows how much he believes in the product itself.\n\n3. Great staff that answered all of my questions regarding medical records required, as well as being extremely friendly while I was pestering them with those questions.\n\n4. Professional atmosphere with an easy-going doctor; this can’t be overstated. Dr. Roman is very friendly and understands the needs of his patients very well, in my experience.\n\nOverall, Nature’s Way is a great place to go if you are considering medical marijuana for yourself or a loved one!', 1524589726),
(2675, 603, 'Ben Ruben', 'https://www.google.com/maps/contrib/102142138638590363854/reviews', 'en', 'https://lh3.googleusercontent.com/-VhVKGQm9uqM/AAAAAAAAAAI/AAAAAAAAAcM/PsTb-ZBogac/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Dr. Roman and his staff were A+ professional from start to finish. He really took the time to understand me as a patient. Very comfortable setting and great location. Highly recommend.', 1526504741),
(2676, 603, 'Andrew Kessler', 'https://www.google.com/maps/contrib/107569714911815915600/reviews', 'en', 'https://lh5.googleusercontent.com/-7LP50c6Kf4M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq070CWl_rSo6vgoQiuuHoE6q5NOTg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Dr. Roman replied to my emails promptly, scheduled an appointment for the same day and was extremely professional.  During my consultation, he reviewed the medications that I was on, along with reviewing the online database to make sure my information was accurate in case I misunderstood something.  Once we were done, he made it clear that I could reach out at any time and he would be of assistance.  He is extremely knowledgeable regarding even the medications he did not prescribe.  I will refer any friends/clients he can help as I found Dr. Roman to be an honest, knowledgeable and caring physician.  He clearly believes in what he is doing and is very dedicated.  If you have one of those 17 conditions, go see Dr. Roman, he can probably help you treat them.', 1519401289),
(2677, 603, 'Pedro Garcia', 'https://www.google.com/maps/contrib/113032975951489673589/reviews', 'en', 'https://lh5.googleusercontent.com/-y-vQP9WKTrw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2yoo7Vxvm_unw1OrB3RlCQx3_uGA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'A daunting task for not just a review, but a mere smug of personal preferences along with a self-taste for equal justice. Dr. Roman\'s staff and facility have set their sights on a target of love. Yes, I said it love the same feeling and sensation which bombarded my chest as I entered Nature\'s Way Medicine located in Philadelphia, PA the city of brotherly love. Please keep in mind that I also suffer from mental illnesses in which I have plenty of experience dancing on the floors of being handicapped. With that said I must say that going forward with the process of obtaining a Pennsylvania Medical Marijuana Card was smooth and adequate from beginning to the end. Thanks to the kind and very knowledgeable soles who work together as a family under the watchful eye of Dr. Roman. I highly recommend Nature\'s Way Medicine to anyone acquiring medicine a natural way.', 1518459216),
(2678, 603, 'Liz DiTeodoro', 'https://www.google.com/maps/contrib/104812676311151968118/reviews', 'en', 'https://lh3.googleusercontent.com/-LlJd0fyuRxg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0vTdxYkZ-0OBiqPhcROk9hff52LA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Now wonder Dr. Roman has to jump State to State. Horrible service. And a creep doctor. I just noticed his ratings are fake. Look at the gap between 5 stars and 1 star. Nobody rated him 4, 3 or 2 Stars? Stop asking people to give you a 5 Star rating like the others are saying. Pathetic', 1520864276),
(2679, 604, 'Dana Wilson', 'https://www.google.com/maps/contrib/117478819957715241945/reviews', 'en', 'https://lh5.googleusercontent.com/-wjerEUdCHUM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1SyVywl553hFm0UjObW2JTSIT9rg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'They are not a Marijuana Medical Dispensary Unit!', 1525117499),
(2680, 605, 'Maddy Cassel', 'https://www.google.com/maps/contrib/110320827622702694635/reviews', 'en', 'https://lh4.googleusercontent.com/-u29PxJOBins/AAAAAAAAAAI/AAAAAAAAAWU/eTqU08SjyZ8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Great Firm to work for!', 1473960940),
(2681, 606, 'Amanda Digregory', 'https://www.google.com/maps/contrib/111388599347818842306/reviews', 'en', 'https://lh3.googleusercontent.com/-CuikNoCDZ3k/AAAAAAAAAAI/AAAAAAAAL4I/Gkb-etad1XQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The team at Compassionate Certification Centers in Pittsburgh laid out so much information for me, that I can\'t wait until my card comes now. Everyone who I came in contact today was pleasant, knowledgeable and are determined to care for their patients. I feel like I\'m finally on a path to relief! \n\nThe entrance is on 5th avenue. I parked in the Oliver garage and walked around. It\'s all the way up on the 15th floor! \n\nThey also have an amazing selection of oils, topical treatments, tinctures and more.', 1524678105),
(2682, 606, 'Kathy Lynn', 'https://www.google.com/maps/contrib/113194666266227116467/reviews', 'en', 'https://lh4.googleusercontent.com/-5wz7I8m68kk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq30VXnIwfqgzA-X8mrqBKdAc_2CtQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Such a great group of people! Very informative they were able to answer all my questions and took the time to explain in detail so I understood the program. Can\'t wait to get my card in the mail!', 1524841905),
(2683, 606, 'Lisa Cook', 'https://www.google.com/maps/contrib/105516171641137909595/reviews', 'en', 'https://lh5.googleusercontent.com/-E66Lf08YufM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2X8Cjc0dMAgw0VVrAZjsJnK4y7Vw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'Made the process very transparent and explained how Medical Marijuana System works. This organization acts as a check and balance to obtain your card. I have  received the Card one week after our meeting and the $50 to the State.', 1525215759),
(2684, 606, 'mike reed', 'https://www.google.com/maps/contrib/114390932160137746716/reviews', 'en', 'https://lh5.googleusercontent.com/-uj2ysCEypm4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0YcKekALvLzvSFeRvDm3AorzsyzA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'The staff was friendly and welcoming. They were very understanding of my pain and how medical marijuana helps relieve it. I highly recommend CCC to anyone looking to get their medical card.', 1527730864),
(2685, 606, 'darian flatley', 'https://www.google.com/maps/contrib/101848703189114712341/reviews', 'en', 'https://lh3.googleusercontent.com/-hgqrLjXBWjI/AAAAAAAAAAI/AAAAAAAAAAA/E5Wjw4KoOlE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Very very good certification center everyone is super friendly and understanding. It feels really good to not be looked at crazy when you say mj is the only thing that helps with your condition. Doctor has very helpful and they wont push you to do anything you are not comfortable with.', 1523640188),
(2686, 607, 'Rachel Blanco', 'https://www.google.com/maps/contrib/114289326706443815828/reviews', 'en', 'https://lh3.googleusercontent.com/-TcVk93qKjmw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq34cLwpodgJmLr1lJ0AF8Qh_5rgUg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'If you\'re driving in from a ways out be prepared for a long day as there is a good chance you might hit traffic and construction.  But it will be worth the effort because the products are fantastic!  The vap cartridge was the best that I\'ve found between here, Colorado and California.  Prices are comparable as well.', 1527210435),
(2687, 607, 'Darren Bonnell', 'https://www.google.com/maps/contrib/103970593395635010450/reviews', 'en', 'https://lh5.googleusercontent.com/-xgZY3Ba-FGY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0jGJUNCQ7RiTkr6fggosWIUrxlSA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'The staff was helpful and the pharmacist answered all my questions. I look forward to continuing my program. Thank You!', 1527015860),
(2688, 607, 'Diane Harris', 'https://www.google.com/maps/contrib/100395659961336046110/reviews', 'en', 'https://lh4.googleusercontent.com/-etl02zuT3k4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq253DdjuwazNGay0lHdFiFSqx2Afg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Great friendly staff. Comfortable lounge. \nDefinitely recommend!', 1526782699),
(2689, 607, 'Josh Lazarus', 'https://www.google.com/maps/contrib/102537022956332744008/reviews', 'en', 'https://lh4.googleusercontent.com/-nO96B6tKd3U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3CpOiGbSCt582xuJblaj5tDDtDyQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'in the last week', 'Very compassionate staff with the best prices and worst hours', 1527283747),
(2690, 607, 'Em O\'Hara', 'https://www.google.com/maps/contrib/103807322032891915686/reviews', 'en', 'https://lh6.googleusercontent.com/-TX8WlnQYLoU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3F60PmP3VNNtaNT1cr5_ilzYVXnQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'Excellent customer service.  Felt at ease.', 1527280662),
(2691, 608, 'Judy Kaminski', 'https://www.google.com/maps/contrib/114797242707292117254/reviews', 'en', 'https://lh4.googleusercontent.com/-5gev4NXR4S8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1AXUmCtXvm3iUAkEgfM3tl1_HakA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Great facility!  Convenient location.  Friendly, knowledgeable and courteous Staff. They are eager to help and answer any questions or concerns you may have. You deserve to live a pain / anxiety free life!  Start low and slow and you’ll be very surprised how great you’ll feel!', 1526742531),
(2692, 608, 'Leah Gerow', 'https://www.google.com/maps/contrib/101363377133708702148/reviews', 'en', 'https://lh5.googleusercontent.com/-iSegS8KU718/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2alA7q3K7B7baoOBvSSzcVVTtu5Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Great place. The staff is awesome. Very very helpful. Still very new and needs more inventory but the place itself and the people from the security guard at the door to the staff inside. Very well educated in what they do.', 1527294716),
(2693, 608, 'Michelle Nuss', 'https://www.google.com/maps/contrib/113718055546842679296/reviews', 'en', 'https://lh4.googleusercontent.com/-F8T6gdtYO4o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3zjA_faSa2qQxD9sAytV_i6R-kOg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Very nice and helpful.  I am hoping to see leaf form pass.  That would help with cost.   Also a Sativa only capsule would be helpful.', 1527605132),
(2694, 608, 'Christine Roberts', 'https://www.google.com/maps/contrib/105928898527829740598/reviews', 'en', 'https://lh3.googleusercontent.com/-fi4nI67tQjM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3pvqHk2YGBTK1nvDcZqNIRIO7WWQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 weeks ago', 'My 1st visit there was amazing they\'re very informative and helpful and it\'s a very secure private', 1525363524),
(2695, 608, 'Ann Marie Brewer', 'https://www.google.com/maps/contrib/110968574197648812075/reviews', 'en', 'https://lh5.googleusercontent.com/-eEL-ZKs1QP8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0SEjebfBJD3b6hBdFfMyBlcVeE8Q/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 4, 'a week ago', 'Every one is very polite and helpful .. nice clean secure facility', 1526899459),
(2696, 609, 'Bonnie Clyde', 'https://www.google.com/maps/contrib/103203975148288840774/reviews', 'en', 'https://lh4.googleusercontent.com/-UKJemJ3lZg8/AAAAAAAAAAI/AAAAAAAAArg/va1qizBO9n8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'First of all I would like to congratulate the owner of Keystone Dispensaries on his success and all the good he is doing for not only the patients but also the community. He deserves every bit of recognition and down right praise for his practice. To all the negativity being given (and no I’m not including the constructive criticism) all I can say is that while your not only discouraging first timers that could really benefit from the health treatment, but your also just looking right past the fact that this dispensary has literally only been open for a couple of months, if that.  So to the owner, staff and everyone who is a part of this dispensaries’ amazing team that makes Keystone Dispensary thrive WELL DONE AND THANK YOU from the bottom of my heart. You deserve so much more recognition and positive feedback that I know will surly poor in as your establishment rockets to the top.\n\nEmily', 1524343049),
(2697, 609, 'Zach Russell', 'https://www.google.com/maps/contrib/106386710197124815635/reviews', 'en', 'https://lh3.googleusercontent.com/-Jtf5rInoyo0/AAAAAAAAAAI/AAAAAAAAHGQ/0V5Ry5UW8J4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This was my first time going to a dispensary and I didn\'t know what to expect. \n\nRight now, there is a lot of confusion with the entire program because there are only a couple of dispensaries in the area and only 2 growers supplying marijuana products. This means that:\n\n1. The shop was crowded\n2. There is a limited selection of products\n\nIt\'s not ideal, but there is absolutely nothing that Keystone Shops can do about this. \n\nThe staff there are very knowledgeable and helpful (even the security guard was friendly and easy going) and they did their best to put people through as quickly as possible.\n\nSince it was my first time I met with a pharmacist to do an evaluation of my medical conditions and recommend what I should use based on what I wanted and what they had in stock. \n\nThe pharmacy technician was extremely patient with me as a new marijuana user and guided me to the right products and showed me how to use the equipment. \n\nI will definitely come back again, and am excited for the South Philly location to open so I don\'t have to travel to Devon anymore :)', 1522791339),
(2698, 609, 'sean norman', 'https://www.google.com/maps/contrib/112826716778304965697/reviews', 'en', 'https://lh6.googleusercontent.com/-wvALTfz63tY/AAAAAAAAAAI/AAAAAAAAAAA/oc13VmnRLlc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'My wife and I stopped in yesterday. It was busy and on the tight side.\nBut it was well managed and moved along well.\n  My wife did not smoke before we went. (She was worried about looking \"high\").\nSo, after a little while of being there she started to have a seizure. I have to say the staff was so professional in dealing with her. They were not just despenery owner\'s they were people with compassion. And did a amazing job helping her.\n  I see a lot of people upset about cost.\nAll I can say is I can not put a price on how compassionate they were in my situation. \nKeystone shop you have gained a lifelong customer. \n  You guys are great. And to let my wife know she will never be judged at your shop means the world to her.\nOn a side note, she used the product she bought there. And her seizure stopped almost immediately and she is well. Thank you\nSean Norman', 1521426334),
(2699, 609, 'Chip Frenette', 'https://www.google.com/maps/contrib/116304334782854691680/reviews', 'en', 'https://lh3.googleusercontent.com/-NaJRAADsjw4/AAAAAAAAAAI/AAAAAAAAAKM/3nVuZtpPgss/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'It\'s a little pricey and I think that will offset when more shops open. Nice people, friendly but lacking in selection last visit. We will see whats up in the future. Quality is definitely solid and it is cool being one of the first shops to open on this historic time for Pennsylvanians.', 1520522107),
(2700, 609, 'Jay Skaliwags', 'https://www.google.com/maps/contrib/113952177597785462743/reviews', 'en', 'https://lh3.googleusercontent.com/-BE7iuSmCC_s/AAAAAAAAAAI/AAAAAAAAAIU/7g2qA9gJ0m0/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 2, 'a month ago', 'Nice shop, friendly knowledgeable staff. Clean and professional. Prices are a bit high and the hours are a bit slim compared to some other shops. My first cartridge that I purchased from Keystone was a Standard Farms product that leaked like crazy and the shop had no answers or offered any replacement or a fix. I wasn’t too happy considering the cartridge was $99 and the place won’t stand behind their products. All they said was that they have heard of a lot of patients having problems with those cartridges. So, until I’m offered a refund of sorts, replacement or something to entice me to come back, I will be taking purchasing medication elsewhere for now.', 1523581771),
(2701, 610, 'MIchael Sanderson', 'https://www.google.com/maps/contrib/112625730963946240644/reviews', 'en', 'https://lh5.googleusercontent.com/-uWsF6nembJ0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq24fBu-txh7DxJQWsnnwvF7hn3_dA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Today was my first appointment at The Green Remedy. I had very little knowledge about medical marijuana before calling to book an appointment, but I heard it would help my pain. The staff was wonderful and the doctor was patient, informative and actually had a great sense of humor. This is a cannabis clinic that I would recommend. If you want your marijuana card, come to these guys.', 1523387965),
(2702, 610, 'Angela Medina', 'https://www.google.com/maps/contrib/114128658310041211151/reviews', 'en', 'https://lh6.googleusercontent.com/-llEfR0vF1XE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Lbp6BoC3WG3t9Bn6Qd_KTfWqTQQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This place is really amazing. Before going in for my first appointment, I spent about 10 mins on the phone with someone and they patiently answered all of my questions. I was not rushed, and the staff was very pleasant. Then I wen in for my appointment and the office was new and very clean. There were tons of cannabis magazines and books available for people to read while they wait to be seen. I was first seen by the nurse, she was extremely friendly. She asked the right questions and I felt like it was more of a conversation than an evaluations. Then the doctor was AMAZING. She was probably the most amazing doctor I have ever seen. She was kind, friendly, compassionate, EVERYTHING you could ask for in a doctor. This is definitely the place to go to for a medical cannabis certification. Good job, ladies!', 1521231088),
(2703, 610, 'John Wilson', 'https://www.google.com/maps/contrib/114278552262420672459/reviews', 'en', 'https://lh4.googleusercontent.com/-KvIMX-u4Tik/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1I2xpN1MSndTmVmd80PrKIRrZ7dg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'The Green Remedy was quick, professional and helped me through the whole process. They worked with me on my paperwork and appointment changes. The staff was super friendly and the doctor was very professional and very pleasant. I would recommend this place to anyone trying to get their medical card.', 1516459847),
(2704, 610, 'Sukanya Chatterjee', 'https://www.google.com/maps/contrib/100082799584591087245/reviews', 'en', 'https://lh5.googleusercontent.com/-KbbUeL83j7w/AAAAAAAAAAI/AAAAAAAAAEA/LVS5VH6l1GY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'I must say,The Green Remedy is one of the best Cannabis clinic Philadelphia has today. The staff there have deep knowledge about Marijuana treatment. I would like to give them 100 out of 100. Good Job Team', 1518543567),
(2705, 610, 'Barbara Adams', 'https://www.google.com/maps/contrib/117681963653782110083/reviews', 'en', 'https://lh5.googleusercontent.com/-5PhSkCdjNns/AAAAAAAAAAI/AAAAAAAAAAc/dNM6ZzdFGZg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'From the moment I stepped in The Green Remedy, it was an awesome experience. I must say that this has to be the best marijuana clinic that Philadelphia has to offer. Greeted with enthusiasm and helped by an extremely professional guy, I was very happy.', 1517971725),
(2706, 611, 'Kyle Trinkaus', 'https://www.google.com/maps/contrib/111130267975704758170/reviews', 'en', 'https://lh5.googleusercontent.com/-plSItcksyZ8/AAAAAAAAAAI/AAAAAAAAAAY/1sDmimtYRG8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great experience with everyone that worked here while I was there. From the moment of entry to leaving you feel welcomed and are helped with everything you need. The prices are also much more reasonable than other dispensaries that are open right now, even though there is expectation for all the prices to drop once there are more growers and shops open.', 1523307238),
(2707, 611, 'alex knittle', 'https://www.google.com/maps/contrib/114442613655417666017/reviews', 'en', 'https://lh5.googleusercontent.com/-XL6V4rtQwP4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3OqTa-tgmQIy2KkfDiLWL2qb2WVQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Nice store, friendly staff. A small, yet good selection of high quality product. Also, if you\'re new to this, the staff was very helpful and informative. Would like for one to open closer to Philadelphia!', 1526514058),
(2708, 611, 'meg van wagner', 'https://www.google.com/maps/contrib/107357866405733568132/reviews', 'en', 'https://lh4.googleusercontent.com/-TjtQUjPQRHU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0tAYOsuVb_ygcu5FbM9P9GPMRvvQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'in the last week', 'This is what was sold to me as budder! BAD BAD product! Budder is supposed to be the consistency of cookie batter not a crumbly powder. When I called the guy told me they get the product sealed. I don’t care how you get it, it’s not what I bought. When the manager called back she told me to call moxie. I didn’t buy it from moxie I bought it here. SHOP ELSEWHERE & SAVE YOURSELF THE AGGRAVATION! VERY POOR CUSTOMER SERVICE!!! DOESN’T EVEN DESERVE 1 STAR!!!', 1527518338),
(2709, 611, 'Carol Ehlers', 'https://www.google.com/maps/contrib/114670939834233669097/reviews', 'en', 'https://lh6.googleusercontent.com/-aNma5q7rc2s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1UzwtCiVqXnxe3jTSkpq2jcI366w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'I was impressed with my first visit and the friendliness of all the staff and knowledge of their products. Especially since I only visited recreational facilities in the past. As PA expands legislation I look forward to a bigger variety of products and my next visit!!', 1526172269),
(2710, 611, 'Nick Custodero', 'https://www.google.com/maps/contrib/116106152856670396504/reviews', 'en', 'https://lh4.googleusercontent.com/-C40Un7p6nZA/AAAAAAAAAAI/AAAAAAAABsc/aaV3urWCMIU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great experience, beautiful facility, super friendly staff. Not the lowest or highest prices around but reasonable enough for now. This will be my go-to spot for sure.', 1523195121),
(2711, 612, 'Kayly Newcomer', 'https://www.google.com/maps/contrib/108486498526099601742/reviews', 'en', 'https://lh6.googleusercontent.com/-Ke_87e0twMM/AAAAAAAAAAI/AAAAAAAAAAA/O7LihJqUwss/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'Ugh. I wrote a long, detailed review, and it seems to have disappeared.\nI will edit this later. The experience was wonderful; the prices were terrific. My favorite new dispensary also happens to be the closest to me, so “YAY!”\nUPDATED w/the important details:\n-easy to find\n-clean, brand new parking lot\n-relaxing \"\'70s rec room\" vibe decor in waiting lounge (warm, inviting)\n-fast service during daytime hours (I didn\'t get to enjoy the waiting room at all lol)\n-friendly, helpful staff through whole process from entry to exit\n-the sales floor has a chic, hip jewelry store vibe\n-WIDE selection (relatively speaking in PA right now)\n-LEAST EXPENSIVE of the three central PA dispensaries', 1527464874),
(2712, 612, 'Kevin Amann', 'https://www.google.com/maps/contrib/101468691224753089960/reviews', 'en', 'https://lh6.googleusercontent.com/-B--SN1qcsK4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3b-xLigRiLNJ72595V9RJCu7C35Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'in the last week', '', 1527550522),
(2713, 612, 'John Doe', 'https://www.google.com/maps/contrib/116002650589506300649/reviews', 'en', 'https://lh4.googleusercontent.com/-ktpkRIEDydQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq16nrRmA4S4pd-0IyPWiwtK1A5E2A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', '', 1527436864),
(2714, 612, 'Ryan Bishara', 'https://www.google.com/maps/contrib/108169561348756378082/reviews', 'en', 'https://lh5.googleusercontent.com/-Ay0O0-m3_QI/AAAAAAAAAAI/AAAAAAAAAbU/yl7fKVYzxJM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', '', 1527039042),
(2715, 612, 'Dijuan Barber', 'https://www.google.com/maps/contrib/116746230769637585802/reviews', 'en', 'https://lh3.googleusercontent.com/-neE9vLp4MeY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0NswPNpKXxBXBy-13UqZ76hps2qQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', '', 1526475799),
(2716, 613, 'Jordan Bailey', 'https://www.google.com/maps/contrib/105257330117324250816/reviews', 'en', 'https://lh6.googleusercontent.com/-pQXmE-4xqEw/AAAAAAAAAAI/AAAAAAAAAEo/ylzn3Vp8w-E/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I can\'t tell you what a pleasant experience I had shopping here. The staff was not only welcoming, but SO knowledgeable an willing to take the time to make sure I was getting the best products for me. I am so impressed by the selection and THE PRICES! I was not expecting such great quality for such a deal. Consider me a new regular!', 1527025977),
(2717, 613, 'Ryan Bishara', 'https://www.google.com/maps/contrib/108169561348756378082/reviews', 'en', 'https://lh5.googleusercontent.com/-Ay0O0-m3_QI/AAAAAAAAAAI/AAAAAAAAAbU/yl7fKVYzxJM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', '', 1527027281),
(2718, 614, 'C Schreck', 'https://www.google.com/maps/contrib/114827380282828434592/reviews', 'en', 'https://lh6.googleusercontent.com/-xGhW4hesAkk/AAAAAAAAAAI/AAAAAAAAACw/yOuVCeNCzyM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The staff was so cool and nice. They were so easy and fun to talk to. I highly recommend this place. The doctor is extremely nice and they actually listen to what you\'re saying. It was just an all around awesome experience. They made it so easy too.', 1522701435),
(2719, 614, 'heresy 23', 'https://www.google.com/maps/contrib/103269981596084749726/reviews', 'en', 'https://lh6.googleusercontent.com/-d_jvS9c0CtY/AAAAAAAAAAI/AAAAAAAAAK4/9S3jaGORewY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Nothing but a positive experience! The facility and staff were of the highest professionalism. Very friendly and they made the process very simple and easy. Don’t let the area and the outside of the building fool you. This is a very professional clinic. Each employee took care in personalizing the experience and I got the impression that they were a step above the greed that you will encounter with other doctors and clinics. They don’t require you to come back in 6 months(unless you need too) like Other facility’s that just care about your money do...they will remain my main provider for the management of my care....', 1523638973),
(2720, 614, 'Ben South', 'https://www.google.com/maps/contrib/103907235997016324404/reviews', 'en', 'https://lh5.googleusercontent.com/-Afraztfj-Q8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3gDC2PUbPIO0mi7njpvsb8u7E-jQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I was a little skeptical at first, being new to medical marijuana, and having lived in illegal states my whole life. The process was completely painless. Great staff. Always returned my phone calls the same day. Dr. was thorough and understanding of my condition. Couldn\'t be happier with my visit', 1523224053),
(2721, 614, 'Bryan Sable', 'https://www.google.com/maps/contrib/102211915903467571921/reviews', 'en', 'https://lh3.googleusercontent.com/-X5JvvPqvmVQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1CuouGsKOTT0XOSn8Q4qCmVTKO9Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Where can I even begin?  My mother has been an ovarian cancer patient for the last 6 years.  We have fought through surgeries, treatments, studies, and we have reached the end of the journey. My mother is currently in Hospice Care, and we have had her on heavy doses of pain killers around the clock.   Due in large part to some major divine intervention, Dr. Metcalfe and Nurse Shelly made a HOUSE CALL to certify my mother so that a caregiver would be able to take her case.  A HOUSE CALL in 2018???  Incredibly kind and compassionate, as my mother is currently bed-ridden.\n\nI have long heard of the incredible benefits of Medicinal Marijuana, but, it was not until this morning that we have witnessed them.  I have administered my mother\'s first dose, and she is resting comfortably, and without need of pain medication to sleep.  Dr. Metcalfe and Nurse Shelley,  I am so thankful for you  and your dedication to making people\'s lives better.', 1519398896),
(2722, 614, 'Steven Irvin', 'https://www.google.com/maps/contrib/112071271677160320092/reviews', 'en', 'https://lh5.googleusercontent.com/-DyqaDuQryME/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0QMo-KwIZiUPCsgKX2MJLhi8xB7Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Very positive experience. Supportive and welcoming environment. Would definitely recommend for anyone interested in trying an alternative treatment.', 1518510037),
(2723, 615, 'Geoff Tapper', 'https://www.google.com/maps/contrib/115489047387944849828/reviews', 'en', 'https://lh4.googleusercontent.com/-9R2X3uY5Sww/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2ZKT48PffvFJeOKv0LgEknUT7W4Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'So far I am not impressed. Filled out the on line form 4 days ago and left a voice mail 2 days ago. So far there has been zero follow up. I get that this is not an emergency, but if you are running a business treat it as such and be responsive to your potential customers. If you are that busy hire some additional help.', 1517583218),
(2724, 615, 'Karen Nana', 'https://www.google.com/maps/contrib/100914555460892658538/reviews', 'en', 'https://lh3.googleusercontent.com/-VQs6kV-n42w/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0fPf3q9GmGuf726kNi3BOFkR41vw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'There so nice to talk to had to wait only 2 weeks thank you for the help n your kind people I spoke to.', 1508517472),
(2725, 615, '1Pull Gardens', 'https://www.google.com/maps/contrib/105941946897040113797/reviews', 'en', 'https://lh4.googleusercontent.com/-n-BvJefHn8o/AAAAAAAAAAI/AAAAAAAAbJo/A78iXL0prCc/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a year ago', 'Got my appointment quickly. Within 7 days they returned my original phonecall and had me in the office for my initial appointment about 3 weeks later. Not that unreasonable considering the demand for MMJ services in the state. Everyday there is a line at the Dept. of Health 20 deep getting their medical cannabis card Daily, why not join the club and get the medicine you need and the quality of life and level of comfort it provides and with staggering noticeable results. Don\'t believe the hype? Millions of Americans and populations worldwide have looked.to Cannabis Sativa for relief from many ails and diseases as well as providing the user a euphoria that cannot be achieved by other means or as safely as marijuana. Please respect the Rhode Island Medical Marijuana Industry in the state and until Prohibition is ended and Marijuana is legal in all states and on all levels of the law then places like B & B Consulting are a godsend to the people who need this medicine daily and would not be able to attain that help without their help. As an ongoing patient and not someone who went to B & B for that one and done licensing program and fee I chose to follow-up with the amazing Doctors on staff here to continue to monitor my progress and treatment and maintain that base contact with them so I always know where I stand regarding this new license and the laws in place. Thank you B&B! - Austin G.', 1485520225);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(2726, 615, 'Nicholas Lazerus', 'https://www.google.com/maps/contrib/110052427047331276656/reviews', 'en', 'https://lh4.googleusercontent.com/-GVq9HCRQy84/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3WzfoyiSXDm0re8-JPfywEDM06zQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 years ago', 'That other review isn\'t about about the right business. \nB & B Consulting is a Rhode Island Medical Marijuana Evaluation Center. They are the place to go to if you feel like Medical Marijuana is the appropriate medicine for you. They are very well organized and the atmosphere gives you a feeling of comfort when you walk in. The Staff at B&B made sure that I was taken care of from the beginning. They answered all of the questions I had and even sat me down 1 on 1 with a counselor after I got approved by the Dr. The counselor is very helpful. He will go over your rights as a caretaker as well as your rights as a patient. If you want to get into medicinal marijuana the right way, this is the way to go!\nI wouldn\'t recommend anyone else! These guys are the Best of the Best and will definitely be able to help you out with whatever you need!', 1374715388),
(2727, 615, 'A Google User', '-', 'en', '-', 5, '2 months ago', 'Good ', 1522194327),
(2728, 616, 'Dianne Costantino', 'https://www.google.com/maps/contrib/106460709477803760874/reviews', 'en', 'https://lh5.googleusercontent.com/-tWBqQaLl2ho/AAAAAAAAAAI/AAAAAAAAaws/UtwSzg4GQ5Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Today was the first time I walk into a compassion center. I decided on Summit because it is close to my house. My experience was very pleasant. The stuff were very helpful. They have a person there whom you can talk to and direct you in the right direction to what your needs are. I would recommend this place it\'s a 5 five for me. \n       Thank you all again for your help.', 1519236116),
(2729, 616, 'Victoria Uustal', 'https://www.google.com/maps/contrib/115075344783586819900/reviews', 'en', 'https://lh4.googleusercontent.com/-ShkC3ZbwY3s/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3uqMB6KbqanOw7X19kNlzOfNPYrw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, 'a month ago', '1/2 of the staff is friendly, knowledgeable and informative- the other 1/2 expect you to know as much as they do and give attitude free with purchase. \n\nThey\'re currently having an issue with vape cartridges breaking and they have decided it\'s not a manufacturing issue, people are purposefully breaking their cartridges, so they aren\'t exchanging or refunding the product. This came out of nowhere - I bought my cartridge on Saturday, it broke last night when I went to use it and when I went into Summit today after work there was a sign up about the cartridges saying no refunds or exchanges effective immediately. \n\nInteresting how there were no signs on Saturday mentioning this might be an issue and suddenly this new rule is being enforced where you can\'t get a replacement for a defective item. When I mentioned that it\'s obviously a manufacturing issue if it\'s a prominent problem where they now have to advertise about it I was told \"it\'s not, I just had a long meeting about it today. If it was a manufacturing issue they would have caught it before it got to the stores. It\'s happened randomly in the past.\" Right, so if it has happened randomly and is suddenly happening frequently enough that you have to advertise checking all cartridges before leaving the store, then it sounds like a manufacturing issue. \n\nNevermind the fact that Summit\'s stance on this is that the consumer is breaking the cartridges. If it\'s that easy to break, 1. Why are you selling it in your store? 2. Then wouldn\'t it seem plausible that the company making them messed up this particular batch? \n\nThe manager didn\'t want to hear it. Need I remind everyone that this is NOT a recreational facility, this is a medicinal compassion center - not subsidized by insurance - so that $40 I spent on Saturday for a medicinal cartridge that subsequently broke on me, is just thrown in the trash. And this facility couldn\'t care less. Instead of being treated with typical customer service I was spoken to like a toddler - \"well it\'s glass, you have to be really careful with it\". \n\nSeriously?! This isn\'t my first cartridge- I\'ve purchased many, traveled with them, accidentally knocked them against my nightstand, and never had an issue. My first cartridge to break, at a time when a lot of other cartridges are breaking, is obviously a manufacturing issue and is instead being treated as the result of cartridges being mishandled by the consumers. Right. Okay. Meanwhile, upon closer inspection of the pieces of this cartridge the glass wasn\'t even cut straight to fit into the screw bottom. That would explain it- defective glass cutting leads to cartridges falling apart. But, hey, what do I know? Good job losing a regular customer.', 1525142055),
(2730, 616, 'Jared Patton', 'https://www.google.com/maps/contrib/103094331180446638181/reviews', 'en', 'https://lh3.googleusercontent.com/-O8CRU0JsLJY/AAAAAAAAAAI/AAAAAAAAE0g/ZtseOwqolv0/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'They flat out stole my money. My father and I got escorted out of the Summit Medical Compassion Center in Warwick by security because THEY stole my money. Went back one day because they had sold me a defective pen and cartridge, and they refused to give me $65 back for a device that helps control my Crohn\'s Diseas and Anxiety. It was broken when they gave it to me and they refuse me a refund because they conveniently have a policy (put in place this week) saying no refunds/exchanges/help/etc. How are you a compassion center if you send people away without their medicine? There are two reasons you would put up such a sign. 1.) Your products are defective, you know it, and have passed this issue onto your customers. 2.)You guys are illegally selling recreational drugs. Never again will I be going there. They treat their customers like garbage and do not want to help them, they want to make money.', 1525768413),
(2731, 616, 'Doug Strac', 'https://www.google.com/maps/contrib/105663149159713034308/reviews', 'en', 'https://lh4.googleusercontent.com/-rSDbiQ-WNE4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1d3miKKbmE5BPzQL456PLKFrywsQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'Second time this has happened, I go there ask for what I want they ring it up and I leave .. get home and things are not in the bag .. called manager and was told that I’d have to “wait like everyone else”. But I had alreadly waited once that day... manager was very rude. Also the bud is trash and overpriced this place is only  good for certain things to begin with.The dude who forgot what I wanted was cool it was an honest mistake but the manger being rude and not accommodating me was enough to make me never go there and spend money again. This place sucks.', 1525371834),
(2732, 616, 'jacob horta', 'https://www.google.com/maps/contrib/104691745400303546612/reviews', 'en', 'https://lh4.googleusercontent.com/-76EBSDN877o/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3AvtM7nm96ApG9Fpfl8jSXyJZQUA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, 'a week ago', 'Way over priced, very small selection, and as of the past few months their quality has plummeted! Always have to stand in a line to wait \"instead of being seated and waiting for your # to be called\" im disabled and this is an inconvenience. I was going to summit twice a week but now i don\'t even bother!', 1526735370),
(2733, 617, 'Eric Johnson', 'https://www.google.com/maps/contrib/113837914785715429285/reviews', 'en', 'https://lh5.googleusercontent.com/-_wY4TvkmG_I/AAAAAAAAAAI/AAAAAAAAApA/Kcnq39iLL24/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Awesome; professional; helpful; and fun staff. The selection is Awesome! Great Prices and surprise deals daily. I am very thankful for the Center’s help and every one making the action happen. All I have to say is great compliments. Some staff members know me by name and some Staff members I know by name and more to learn. Overall 10 stars  Thank you !', 1525748474),
(2734, 617, 'Ronda', 'https://www.google.com/maps/contrib/106560220390149325968/reviews', 'en', 'https://lh3.googleusercontent.com/-SYAICCZJXh4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2pN-5Z6CFnbei2PHf1UyjLyDKI2w/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, 'in the last week', 'Right now I give it 4 stars. I\'ve only been twice, 1st time was ok but I left there still with plenty of questions. I went back today and got Ashley. I can\'t recall the last time I felt so at ease and left with quite a sense of knowledge of the products. I actually felt empowered with enough confidence that I made the right choices. I would love to be able to have Ashley wait on me everytime I walk through the doors but that is a 50/50 chance. She is patient, informative, and makes you feel at ease. She never once distracted from giving me information. .I am very grateful to have had an amazing visit today.', 1527290837),
(2735, 617, 'Michael Harrison', 'https://www.google.com/maps/contrib/107578168502629414594/reviews', 'en', 'https://lh3.googleusercontent.com/-sYWOwpq4maw/AAAAAAAAAAI/AAAAAAAAAD0/c1Aw-2m7hY4/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'in the last week', 'Great place to get what you need! Most of the workers are friendly, and will help and answer questions ...but there are a few who I feel like they have better things to do and cant be bothered to help. \n\nThis is the closest location to me, so I will keep going!', 1527606805),
(2736, 617, 'Tori Graves', 'https://www.google.com/maps/contrib/113593643215949748737/reviews', 'en', 'https://lh6.googleusercontent.com/-lUcBqdPVSR4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3itUyal1m5CDTQ3Tq-7kcuBzuGsA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Been a  everyday customer since past October  never had a problem or bad service. I pull in at 3:58 I understand you close at four. Two gentlemen go in in front of me I go around knocking on door . You would think they would allow me in it is 4:00 ..4:01..4:02.. while the tall male security guard gives me a huge attitude. Tells me if I didn’t lie about pulling up according to him right at 4:00 “ he would of let me in” !?\n\nExcuse me?! I am just out of my job I have absolutely no reason to lie to a security guard. If it was 4:05 I understand I wouldn’t even of tried but 4:01 4:02 while they let 2 people in right in front of me. Completely unprofessional how he spoke to me. Complete attitude! I work with people and customers all day long.  His manager should teach him need some manners or how to speak to people because he definitely doesn’t.  I had enough respect to not even respond to him.  Check your security team!\n\nAlso 2 weeks ago there was a fight going on outside on the ramp and the officer was at the door not even paying attention, had no clue. ', 1521922472),
(2737, 617, 'Joann Labonte', 'https://www.google.com/maps/contrib/111355956263104230473/reviews', 'en', 'https://lh6.googleusercontent.com/-KmvO6FEpC2A/AAAAAAAAAAI/AAAAAAAAEmc/HsbBIW9XKRU/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'My experience was fantastic. The staff are very helpful and knowledgeable. I physically feel better because I received the right medicine I needed I look forward to my next visit.', 1526004220),
(2738, 618, 'A Google User', '-', 'en', '-', 5, 'a month ago', 'Good cool for w-d ', 1524430962),
(2739, 618, 'Paul Haigh', 'https://www.google.com/maps/contrib/114362149135420869062/reviews', 'en', 'https://lh3.googleusercontent.com/-i_ScLrh7LKM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq02EfiTGcEQLZfea1Bt41f0i8u6nw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'No lower back pain in 5 years now ', 1504133936),
(2740, 618, 'Jamie C', 'https://www.google.com/maps/contrib/108271752912117076114/reviews', 'en', 'https://lh4.googleusercontent.com/-n4c51_SbgM8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1nzw-Ipp3U2P6EwfCblMIYdU3A9Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', '', 1516023044),
(2741, 618, 'Read Cline', 'https://www.google.com/maps/contrib/108985328628766703272/reviews', 'en', 'https://lh3.googleusercontent.com/-cNKt5j1S-9w/AAAAAAAAAAI/AAAAAAAAHgc/0Av7U_hzfTk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', '', 1469738525),
(2742, 619, 'That Honda Tech', 'https://www.google.com/maps/contrib/107221195876290034392/reviews', 'en', 'https://lh6.googleusercontent.com/-mI5bt8yWzjY/AAAAAAAAAAI/AAAAAAAAANg/IsE7Zr25PmY/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Be prepared to wait in a long line and not get what you pay for. Every time I go I never look at their online menu because 9 times out of 10 they dont have it when you get there. My business is slowly pacing towards summit. The THC numbers are lower at summit but the quality is better. Greenleaf has 20-26%THC strains everyday all the time, and its not accurate.  a 15.9%(white kush) strain rocks me from summit but a 27.2% chem strain from Greenleaf leaves me disappointed and you will spend more money. \n\nI used to go to Greenleaf weekly. Its now just a waste of time.', 1524403071),
(2743, 619, 'Chris Bruneau', 'https://www.google.com/maps/contrib/104517916570575188185/reviews', 'en', 'https://lh3.googleusercontent.com/-Lg1QHOLS0mo/AAAAAAAAAAI/AAAAAAAADFI/yXD3-CizYv4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Greenleaf Has the BEST ROSIN IN RI HAND DOWN! Although Summit is catching up fast!!!GL Normally has the best strains in RI but a lot of the times they can be very dry which almost ruins the weed in my opinion it’s needs to b dry on the outside and chewy on the inside #PerfectBud', 1525385060),
(2744, 619, 'Alan G', 'https://www.google.com/maps/contrib/105789641533154033241/reviews', 'en', 'https://lh5.googleusercontent.com/-_QByM-opu_U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3pgmk-GazAmOwbHPYclbuYQOe8mQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'The best place in R.I, great people, get anything u want,  they all ways have the best deals then anyone in R.I, and all ways have what u need when u need it, other places only sell so much of what u want, for example if I went to providence to by  28 grams and they never have it or won\'t let u get that much, on the other hand if I go to green leaf I can get as much as I can get, if you\'re buying 14 grams or more go to green leaf, been going there for 3 years and never let me down,, thanks hope I can help,,,,', 1518453268),
(2745, 619, 'Mark', 'https://www.google.com/maps/contrib/118038937070305288075/reviews', 'en', 'https://lh4.googleusercontent.com/-wcYExRODvaE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0J0SbjyghkbgEOBJ8II2NPgO4Kkw/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'Great staff that is knowledgeable and courteous. We always enjoy the drive up here as well.', 1520858102),
(2746, 619, 'Andrea Warhol', 'https://www.google.com/maps/contrib/112462092305645844993/reviews', 'en', 'https://lh5.googleusercontent.com/-fKZYCqf0xEw/AAAAAAAAAAI/AAAAAAAABEA/D3mmUwMrUwk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'The budtenders are so awesome!! I drive from Burrillville to come here...', 1519867474),
(2747, 620, 'James Hurd', 'https://www.google.com/maps/contrib/104506559055763886395/reviews', 'en', 'https://lh6.googleusercontent.com/-hRaiiDgaZZc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2ADxdY91rcxpvekrvr5Pi4H3m5LQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I love that they have a a facility central  to where I live. This facility is super helpful, honest and very welcoming. I was in a car accident some years ago and I am very thankful that the process of obtaining my renewal card is simple and painless. Clean facility, abundant parking available, super affordable, and all around chill experience - usually going to the doctor sucks but this is not the case here This clinic has been my go to for a few years now. Nick even remembered me and was quite helpful. I also love how central it is to both work and home. Both the doctor and the front desk are extremely helpful and I didn\'t have to wait long at all. The doctor also recommended some exercises I could do for my knee and to meditate as well! Where does one ever get that!? I always recommend this clinic to people I know. They even have an option to renew online. Pretty cool', 1523744701),
(2748, 620, 'Crissa Hedding', 'https://www.google.com/maps/contrib/105368673998302815680/reviews', 'en', 'https://lh4.googleusercontent.com/-O7ehAjanmCU/AAAAAAAAAAI/AAAAAAAAACM/D0tLgJ8vmxA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I can\'t say enough about this urgent care facility! Dr. V was wonderful! \n\nWe were in and out quickly, service was fast and efficient. The doctor was understanding and spoke with us in terms we could understand... A breath of fresh air compared to many others we\'ve been to. This place is super clean and the staffed seemed very friendly and compassionate! Simply fantastic! Thank you immensely for the great care.', 1520407720),
(2749, 620, 'M Gild', 'https://www.google.com/maps/contrib/116411160913906919561/reviews', 'en', 'https://lh4.googleusercontent.com/-V-_VkKA2Phk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3NKYkmk8CcLBqJky9uNAX_eb-7gg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Part of a very large urgent care, this place made the entire process quite simple. I had originally asked them if I needed to bring my old records and luckily they said they didn\'t need them because they do their own assessment. The entire process took 30 minutes.. I will definitely get my renewal here as well moving forward', 1523041822),
(2750, 620, 'Hannah Weiner', 'https://www.google.com/maps/contrib/111321484428989290555/reviews', 'en', 'https://lh6.googleusercontent.com/-qwdtTzHvPPM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0OKHt5CTvhm5adWeFKaBmAg8H9JQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I love this place. I\'ve always preferred the holistic way of medicine and because of my pain all of my previous physicians tried to put me on opioids. A few months ago I established a new PCP Dr. Vafidis and after having an appointment I am a qualified cannabis patient. He even. told me the steps needed to submit the approved paperwork to the state etc. I really admire the physicians at this urgent care. I recently moved from Newton, MA and I am so happy I stumbled upon not only a place that cares but an urgent care that has loving primary care doctors too. Thanks for making my day!', 1524501495),
(2751, 620, 'Matthew J. DaCosta', 'https://www.google.com/maps/contrib/118434539705952350684/reviews', 'en', 'https://lh3.googleusercontent.com/-og1HrOvCdP4/AAAAAAAAAAI/AAAAAAAAARs/UuSFEmfbptQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Very clean environment and professional front desk staff. The clinicians are cordial and competent - they truly make every effort to meet your healthcare needs. Would highly recommend this medical facility for both primary and urgent care.', 1522180746),
(2752, 621, '420 420', 'https://www.google.com/maps/contrib/110935784690946567975/reviews', 'en', 'https://lh5.googleusercontent.com/-g0P4TEP-paI/AAAAAAAAAAI/AAAAAAAAAgI/6wMAc92qjn0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'If you have a real medical condition, medical records in hand, there\'s no issue. Making an appt. was easy and painless. I was seen that Thursday and waited maybe 20 min at most to see the doctor. They take credit cards as well. Will be going there to renew. See you in 2 years!!! Thank you', 1478139681),
(2753, 621, 'Suddenly Simple', 'https://www.google.com/maps/contrib/102917760647672851689/reviews', 'en', 'https://lh6.googleusercontent.com/-s2PpGM8arOA/AAAAAAAAAAI/AAAAAAAABfo/-LT8tZD8e0E/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 3, '3 weeks ago', '', 1525910181),
(2754, 621, 'Joe J', 'https://www.google.com/maps/contrib/105325833962467617916/reviews', 'en', 'https://lh6.googleusercontent.com/-pAHa8FRv2BA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3SY0bapqOOl4j8hcrj4zcslJIsWg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 years ago', '', 1457759744),
(2755, 622, 'Beautiful B', 'https://www.google.com/maps/contrib/117463715404301541072/reviews', 'en', 'https://lh3.googleusercontent.com/-zzkXc3t_cLg/AAAAAAAAAAI/AAAAAAAAAXI/H3spNeDFBwE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Nice, professional office atmosphere. I like the woman up front, she was kind, proficient, & right to the point. Dr. Dorn was great as well. We went over a couple key points and touched in other things briefly. He was quick and nonjudgmental.', 1527161537),
(2756, 622, 'Jan Fletcher', 'https://www.google.com/maps/contrib/103170841151162014398/reviews', 'en', 'https://lh3.googleusercontent.com/-Il-xKDLIRqg/AAAAAAAAAAI/AAAAAAAAADg/GvLSfmj0NxE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'My experience with my last appointment was great. It is so peaceful and welcoming. Every time I go I learn something new. I know Dr. Dorn is fighting for my rights and  my health. I am so grateful  he  has changed my world.', 1525537942),
(2757, 622, 'Dana Dixon-Broer', 'https://www.google.com/maps/contrib/100867235943554458568/reviews', 'en', 'https://lh4.googleusercontent.com/-dDnI1sgkQGs/AAAAAAAAAAI/AAAAAAAAAIQ/9xxnAvd_9kM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I deal with a lot of chronic issues. My visits are always informative and non stressful. My doctors listen and are easy to talk to. Very happy with services provided.', 1523747369),
(2758, 622, 'Chris Boat', 'https://www.google.com/maps/contrib/101395642599556100658/reviews', 'en', 'https://lh6.googleusercontent.com/-geL4c02B8hA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2wOFQYI7i1v4ceh7YbvS2TQ8fHWA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Dr. Dorn and staff are friendly, customer service oriented and organized.  I have no complaints.  I have experienced no issues with my prescriptions being timely.  I recently attended my first follow-up appointment and all was as it should be.  Highly recommend this provider.', 1524069945),
(2759, 622, 'Maranda Dooley', 'https://www.google.com/maps/contrib/103071546347339827132/reviews', 'en', 'https://lh3.googleusercontent.com/-8f3Wui4CFYw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq036svd1oSpp-HtQYbVDYBzzVpcLg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I absolutely love Dr.Dorn and his staff. They are very kind and helpful. They spend as much time with you as you need, answer all of your questions and address all of your concerns. They made the process of getting the medication I needed as smooth and quickly as possible. Thank you Dr.Dorn and staff for all of your help!', 1526608422),
(2760, 623, 'B. R.', 'https://www.google.com/maps/contrib/109196522376534521136/reviews', 'en', 'https://lh4.googleusercontent.com/-0r9x4JrnIJo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0djQvGrVMjpiDSuDRhy8KZJJKOrw/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 months ago', 'Truly, I think this a great place with smokin\' deals... if YOU know your stuff.\n\n...and that\'s the problem I have.\n\n   Their Flower is beautiful, but because they never have the same product (continuously stocking different strains--some names never heard of), there never seems to be any knowledge in house to give a true assessment of the wide variety... so, you end up feeling like you got a sales pitch on what the customer \"wants to hear\"...\n\n...also, I do not recommend their oil concentrates (syringe for refillable cartridge)... waaaaay too thick.\n\n   Go in there prepared, and you will be very pleased with the quality/price of their Flower.', 1522284231),
(2761, 623, 'Patrick Robinson', 'https://www.google.com/maps/contrib/112618149650152160393/reviews', 'en', 'https://lh5.googleusercontent.com/-IhCefd2I68E/AAAAAAAAAAI/AAAAAAAAADw/dVFL2YsL1oA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'One of the best shops I have been into. From Denver to Utah I have stopped off at several Rec. stores along I-70 and this one tops my list. The staff is well studied and make you feel like you are in a Med store.', 1514061150),
(2762, 623, 'Callie Day', 'https://www.google.com/maps/contrib/117006486837373175973/reviews', 'en', 'https://lh5.googleusercontent.com/-TW11a8_gVwY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3OHqsJ-FfMtBKq6Jcerw6guN5T9g/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '4 months ago', 'Awesome and friendly staff. Good prices too!! ', 1515823215),
(2763, 623, 'David Gavilanes', 'https://www.google.com/maps/contrib/111192731593929199467/reviews', 'en', 'https://lh4.googleusercontent.com/-uxgRIwvbwlE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0C101KKU9DhfWQkEnEn-KNxyZYPw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'Costumer service was amazing first time in Colorado. we stopped at 4 different shops and this one was the best, definitely recommend.', 1512189913),
(2764, 623, 'Jessie Smith', 'https://www.google.com/maps/contrib/108598115484561130504/reviews', 'en', 'https://lh6.googleusercontent.com/-PkJaKkX45ZE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1lZ0XcZvVr3Cx6ooPATCIAqgH8ag/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '6 months ago', 'Everyone is nice and very helpful. I\'ve never had to wait for assistance and I like that they have the prices right up front unlike the other place in Silt.', 1512020036),
(2765, 624, 'Angie Buchanan', 'https://www.google.com/maps/contrib/118420446434358579250/reviews', 'en', 'https://lh5.googleusercontent.com/-3vTl6htsghA/AAAAAAAAAAI/AAAAAAAAkfA/Nvn9tYFUr38/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 4, 'a week ago', 'Very wonderful staff. The clinicians are caring and very confidential and discrete. Prices a bit steep. They try to guid you to the right mix as well. Very wonderful place to be part of.', 1526674231),
(2766, 624, 'douglas carlin', 'https://www.google.com/maps/contrib/114820544320685314634/reviews', 'en', 'https://lh3.googleusercontent.com/-XPcqkE8WbjY/AAAAAAAAAAI/AAAAAAAAAA8/vcfnKP8XcZk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I really wish all retailers took as much time to train there staff’s as much as this business has. I have been coming as a patient since the beginning . And although like most retailers  has had some staff turnover! ! However I have never had any employee’s complain about anything to me or that I have heard in there Burlington shop! In my old life I was a corporate manager for a couple large retailer\'s! So training executive staff on impacting each unit with as much conviction as yours!!I\'ll be here till my end as I prefer marijuana to my fentanyl and morphine! Thank you and keep up the same standards you thus far have been able too! SINCERELY DOUGLASB CARLIN', 1524949829),
(2767, 624, 'jayson casavant', 'https://www.google.com/maps/contrib/110054803794232931079/reviews', 'en', 'https://lh4.googleusercontent.com/-uigTKYzPWsg/AAAAAAAAAAI/AAAAAAAAB5c/b2nH5gndnUk/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '3 weeks ago', 'The people seemed friendly and knowledgeable but over the last week I have asked two seperate questions via their web site and recieved no response. The website has no menu, nor list of strains, nor pricing. I was told they are working on it. This is not a new business. A working website is expected. I finally made an appointment on line, which took them  two days to be confirmed. In order to make an appointment you need to provide your medical marijuana license and its expiration date. After driving 2 hrs for my appointment I was told that my license expired 3 days ago ( even though it has been renewed by the state) and that I would have to wait until I had the renewed license in hand to purchase product.  OK, I can understand that T\'s need to be crossed and I\'s need to be dotted but my initial visit turned out to be a 4 hr waste of my time. The dispensary should be connected to the states data base and the web site should be capable of delivering pertenant information.', 1525908512),
(2768, 624, 'robert cosgrove', 'https://www.google.com/maps/contrib/114822575435793057991/reviews', 'en', 'https://lh3.googleusercontent.com/-fKdp-U0l4CY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0tFlkaJ0DjwBLYzydC1krC8kW7gw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'They are great people have helped and explained in detail, Im not a customer yet but my wife is, I am looking at switching from narcotics to medical, They have taken the time to explain to me different ways I can get help with my pain, I have ptsd 4 disc in my lower back and 3 in my neck, one at the base of my skull which swells into my brain, I have lived on pain killers for years and last week my perscription was stolen 28 days no meds, cant get them replaced, this has 100% made me decide to switch. I want to thank these guys for taking the time to work with me and explain my options.', 1522846982),
(2769, 624, 'Gi Grape', 'https://www.google.com/maps/contrib/100450929947841929231/reviews', 'en', 'https://lh3.googleusercontent.com/-iJC0iupmkhM/AAAAAAAAAAI/AAAAAAAAAqw/YMRv6En8yLI/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, '2 weeks ago', 'I wish they had a menu on here for what products they have instead of having to go there and get talked into something that doesn\'t work', 1526094055),
(2770, 625, 'Jason Kerson', 'https://www.google.com/maps/contrib/108904630599963724015/reviews', 'en', 'https://lh5.googleusercontent.com/-YHKi5fZbHJA/AAAAAAAAAAI/AAAAAAAArpo/28gfXRiFVGk/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 4, '3 months ago', 'Great product! Very friendly staff. Prices are reasonable. I had given them a 5 star review, but I\'m currently decreasing my rating to 4 stars. The reason for this is the lack of product. They frequently run out of certain products because they are currently unable to meet the demand. This is most likely due to the 150+ new patients they gained in the past few months.', 1519428090),
(2771, 625, 'arlie davidson', 'https://www.google.com/maps/contrib/106224362460757401216/reviews', 'en', 'https://lh5.googleusercontent.com/-MbJHZiZiVYE/AAAAAAAAAAI/AAAAAAAAAF0/BkO0tPPcO0s/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, '4 months ago', 'The people at grassroots dispensary are accommodating and friendly in person. That is if you can get in there. I’ve been a patient there for a year now, and more times than not when I’ve called for appointments I was not able to get in.  They told me they had too many new patients that they needed to accommodate, yet they’re closed on Wednesday and Saturday and Sunday! On top of that the last time I went they only had two flowers to choose from. \n\nI’ve considered switching dispensaries but there is a charge with the Department of Public Safety to do so. I considered growing my own at home, but could not get any help from grassroots dispensary with that as they do not have any seeds or clones available. All in all I’m quite disappointed.   I’ve found Good Grows  Indoor in Rutland Vermont to be very helpful on the phone and in person when it came to every aspect of my Indoor grow.  Hopefully there will be more places to choose from now that it’s legal.', 1516822031),
(2772, 625, 'Bobbie Jo Moulton', 'https://www.google.com/maps/contrib/104567520125938692047/reviews', 'en', 'https://lh6.googleusercontent.com/-WGE5jBpnJeg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1dnjHLkcP1uguygEjORQMxMcsMnw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'I work monday through Friday in Burlington. I chose grassroots because they had saturday hours. Now, not only do they not have saturday hours but the choice of bud is so limited. Sometimes only 3 choices. Im disappointed because for those reasons. Im not negating the fact that the staff is so very nice. Get it together or customers are going to pay the $25 to change where they get their medical marijuana.', 1515889177),
(2773, 625, 'Vicki Vogel', 'https://www.google.com/maps/contrib/114198134034484512787/reviews', 'en', 'https://lh5.googleusercontent.com/-V-rAzaS2cjU/AAAAAAAAAAI/AAAAAAAAGq0/KIlYkQS-MXk/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '5 months ago', 'Very nice ppl.... Kind, caring, helpful, thoughtful and patient.', 1513642297),
(2774, 625, 'Pawz Brown', 'https://www.google.com/maps/contrib/104588858719999588001/reviews', 'en', 'https://lh5.googleusercontent.com/-k5259_Q5xoY/AAAAAAAAAAI/AAAAAAAAE-0/7o0kRqp71t8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'They are here to help lots of people that are in pain or have trouble with other problems', 1522952607),
(2775, 626, 'Adam/HariOm', 'https://www.google.com/maps/contrib/100129548162005687796/reviews', 'en', 'https://lh5.googleusercontent.com/-WXtttiVdKp4/AAAAAAAAAAI/AAAAAAAAARk/ZDBxrDHMyK8/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '2 months ago', 'Staff, atmosphere and selection awesome! Pricing high, but due to elected officials, that’s our lot! Product quality awesome albeit the various products w/carcinogenic dairy ingredients.', 1519999212),
(2776, 626, 'Gads Bee', 'https://www.google.com/maps/contrib/110571334336251832364/reviews', 'en', 'https://lh3.googleusercontent.com/-LhilOhNnsNI/AAAAAAAAAAI/AAAAAAAABWs/h1wa8bBYY1c/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Very well-run, low-key facility. Professional, knowledgeable staff, patients are respected with discretion and dignity.', 1522535022),
(2777, 626, 'G Chesterton', 'https://www.google.com/maps/contrib/104575381636723232200/reviews', 'en', 'https://lh3.googleusercontent.com/-8j7IUYthV5k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq17S-F3ti40N2xFXo_7acE4bi_q3g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'The staff is so friendly and helpful, and the products are good. I used to go to the dispensary in Burlington... now I go to VT Patients Alliance and I\'m happier.', 1510949189),
(2778, 626, 'Edward shattuck', 'https://www.google.com/maps/contrib/113099618563471659357/reviews', 'en', 'https://lh5.googleusercontent.com/-XTrDn08LRIg/AAAAAAAAAAI/AAAAAAAAB3I/CjloL-1VUJw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Great place to get your cannabis', 1526081846),
(2779, 626, 'William Eisner', 'https://www.google.com/maps/contrib/117880239042409175859/reviews', 'en', 'https://lh4.googleusercontent.com/-lmajJesK9TQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2wIjWM3kVFec99PErTWe5obIgJrw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'in the last week', 'Everyone is polite and professional.', 1527288118),
(2780, 627, 'Jacob Reilly', 'https://www.google.com/maps/contrib/117767498857992538650/reviews', 'en', 'https://lh6.googleusercontent.com/-dE4BHlss32k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2gdVp6eZrssZNmDevcq118OE9zPA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '5 months ago', 'I went in about a week ago for some flower asked for the best thay had on had it was snow drop. The worst flower ever. First off it smelt like hay tasted like hay. How can u say thats tje best you got. Let alone the price. 55 bucks for a bag of hay weed im good.  \n\nI dont see why anyone uses this despensery u can find cheeper and better flower down town... despencery half oz like 200. Downtown bratt price 130 and way more flavorful and trycomy..... dont wast time or money on this place it suck.\n\nAnd now i try and get some concentrates from them (wax,rosin,oil) and thay didnt have any... how can u call yourself a despencery and not have enough product...', 1513891564),
(2781, 627, 'milton clark', 'https://www.google.com/maps/contrib/117985883243799199969/reviews', 'en', 'https://lh4.googleusercontent.com/-xREPQpEHzl8/AAAAAAAAAAI/AAAAAAAAG6k/SKl10BI_fgA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '9 months ago', 'I never lost one clone from them really had a good experience there can\'t wait til Monday', 1503086656),
(2782, 627, 'Just Visiting', 'https://www.google.com/maps/contrib/118314577676210267398/reviews', 'en', 'https://lh4.googleusercontent.com/-sAqks5A8xps/AAAAAAAAAAI/AAAAAAAAAFw/_uqRACyNckY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I\'ve been a client from the start and have nothing but good to say about the workers and product. I\'m extremely sensitive to most industrial and agricultural chemicals; SVW and their products have been a Godsend. Knowing where and how it\'s grown has made my life a lot easier and the end result is being much healthier.', 1488829063),
(2783, 627, 'Matthew Swartz', 'https://www.google.com/maps/contrib/118345694707210582816/reviews', 'en', 'https://lh3.googleusercontent.com/-RmTV8cGS59Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3fLlyNI7hPZxB9psViu9qMMYJipQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Knowledgeable staff, decent selection.', 1508965237),
(2784, 627, 'Amanda Alsvig', 'https://www.google.com/maps/contrib/113976413346556562354/reviews', 'en', 'https://lh3.googleusercontent.com/-Blp-IfZ6P1Q/AAAAAAAAAAI/AAAAAAAAACE/A4wYtHSAg-k/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a year ago', 'Awesome people great products and they are very caring!!!! Thank you for making me feel so comfortable and relaxed.', 1490910535),
(2785, 628, 'Joshua Green', 'https://www.google.com/maps/contrib/110306398164396853258/reviews', 'en', 'https://lh3.googleusercontent.com/-BGtCgsTAo6I/AAAAAAAAAAI/AAAAAAAAAEU/STMUFkLpPt8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'Dr. Fasusi treated me so well. He really cared about the pain I was in, and when a treatment didn\'t work he would try another until it got better. got one that would. Very great atmosphere and he went above and beyond thanks a lot Doc!', 1499007644),
(2786, 628, 'Jameka White', 'https://www.google.com/maps/contrib/111569227315837546183/reviews', 'en', 'https://lh4.googleusercontent.com/-MnxLvSMRUMc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Gk-JwUQkAO2nn8BFKBkwsog224g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'DR. FASUSI WAS VERY CARING AND CONCERN ABOUT MY PAIN. STAFF WAS NICE AND SOCIAL.  ONE OF MY FAV DOCTORS!!!', 1501679865),
(2787, 628, 'Sam Ade', 'https://www.google.com/maps/contrib/112503993250028677041/reviews', 'en', 'https://lh5.googleusercontent.com/-XR9NXCV2huk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2aXlwDgitd0TIvEf66aeOY9RVNSA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Great doctor. Took care of myself and my daughter for the past couple months. Your the best doc!', 1488207613),
(2788, 628, 'Larry H', 'https://www.google.com/maps/contrib/105486898646320613227/reviews', 'en', 'https://lh3.googleusercontent.com/-IAuSrSUTF-A/AAAAAAAAAAI/AAAAAAAAAOA/VhigBvzk9sE/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 years ago', 'It\'s probably the most cold and impersonal office you\'ve ever been in.  It\'s all about the money with these guys, both Doctor and Staff included.  The staff doesnt even say hello and when you approach the receptionist desk, the people behind the desk pretend like they dont see you. The nurse that calls you back to take your vitals never even said hello, and when i asked her for a tissue because my nose started running, she told me to ask the receptionist outside.  \n\nDr. Fasusi was just as bad.  I guess the staff takes their queue from their boss because all he asked me for was information he needed for his report.  When i started telling him about other possibly related symptoms I was having, he just told me, \"Go see your PCP...Im a specialist.\"  When he was done filling out his report he simply told me i could exit from the side door and goodbye...never even looked-up.  I would not recommend Dr. Fasusi office to anyone whose looking for a caring doctor with a good bedside manner and a nice staff...you will not get this here!', 1458591696),
(2789, 628, 'Betsy Hockstein', 'https://www.google.com/maps/contrib/112922359724276023543/reviews', 'en', 'https://lh6.googleusercontent.com/-ZvXkiKQ4gQo/AAAAAAAAAAI/AAAAAAAAC8k/SO2kh7dbrbI/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '8 months ago', '', 1504801768),
(2790, 629, 'Collin Keating', 'https://www.google.com/maps/contrib/114259165086196389986/reviews', 'en', 'https://lh4.googleusercontent.com/-tnPrLm0GPDQ/AAAAAAAAAAI/AAAAAAAAArA/YLKQM4x3qwI/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '5 months ago', 'Dr. Frye does like not well informed patients and will reprimand you and your personal life decisions with a condescending tone. She loves to use sweeping generalizations and proclaim them as fact. She told me that I \"was not interested in being educated\" and therefore cancelled our appointment right then and there. I have researched the subject extensively and educated myself. I was not there to be educated, I was there to receive a recommendation for the best medicine for my chronic pain. \n\nIf you do decide to see Dr. Frye, you must bring documentation going back a long time chronicling your condition, a letter from your primary care physician, documentation from the pharmacy of your prescription drugs, and documentation of all the other options you have tried for your condition. \n\nAnd above all else, just sit down, shut up, nod your head, and don\'t ask questions because she will deny you for perceived \"attitude.\" \n\nI would recommend any other doctor in Maryland over Dr. Patricia Frye.', 1513117223),
(2791, 629, 'A L', 'https://www.google.com/maps/contrib/116901737268037509539/reviews', 'en', 'https://lh6.googleusercontent.com/-cS_XriH-7MY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0UqxRMHK4VmikzBkks0V9KfG_SBw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Dr. Frye is knowledgeable, caring, and compassionate. I have been seeing her for two years. She’s a physician who’ll listen to you, accept what works for you, and help you to find a path to wellness.', 1518491960),
(2792, 629, 'Ann Robinson', 'https://www.google.com/maps/contrib/109361035642869181345/reviews', 'en', 'https://lh6.googleusercontent.com/-6A8geiNoVdk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3MIXzAzBJo_cQCalcIo9b_k9L-kw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Dr Frye extremely knowledgeable and professional. Very caring and takes the time to listen to my concerns. Office is very clean and inviting. The assistant Tamika is an added bonus. Always greets me with a smile and she knows the products thats available. Will recommend anyone in need of her care.', 1491508825),
(2793, 629, 'Janet Riessman', 'https://www.google.com/maps/contrib/107549758292880156287/reviews', 'en', 'https://lh5.googleusercontent.com/-zJQVK7TIhe8/AAAAAAAAAAI/AAAAAAAAAFQ/6GjLHu4-Jgg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'If you\'re looking for an M.D. who TRULY understands the intricacies of weed and it\'s medicinal properties (for me, pain management), make an appointment to see Dr. Frye. Lovely office staff and easy, attractive office/location too.', 1483127313),
(2794, 630, 'Sarah White', 'https://www.google.com/maps/contrib/100569980518020225639/reviews', 'en', 'https://lh4.googleusercontent.com/-ZPgwfPuuxMw/AAAAAAAAAAI/AAAAAAAAAAo/2Z1BRX5Efgc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Wonderful store and staff. The staff was very knowledgeable and helpful. They answer every question and address every concern to the best of their ability. You can tell they truly care for their customers. Products are amazing!', 1527032002),
(2795, 630, 'Heather Sprouse', 'https://www.google.com/maps/contrib/110681620268165848753/reviews', 'en', 'https://lh6.googleusercontent.com/-R8hZJ6rNoZs/AAAAAAAAAAI/AAAAAAAACjU/mJgHQ0AAv7A/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'Locally sourced and produced. Helpful, professional staff. High quality products that are about 15% more expensive than national brands sold elsewhere nearby- but the price reflects the quality. \nParking lot is hard to access.', 1524778784),
(2796, 630, 'Lexi Aquino', 'https://www.google.com/maps/contrib/116522135439877450863/reviews', 'en', 'https://lh5.googleusercontent.com/-X9bD2UZLNno/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq36898OEmI6H2BF7gbaIlh4pgTRjg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'Awesome store! The employees are very knowledgeable not only about their products but other products on the market as well. I learned a good bit about CBD products just by asking a few questions. This store has an Instagram page and just opened a second location in Morgantown. Their product are great! I purchased a 500mg tinture and I\'m thoroughly impressed compared to the big name products I purchased previously. I can\'t wait for their online store to open. I drove two hours to support my home state business.', 1521400594),
(2797, 630, 'JCTC Games', 'https://www.google.com/maps/contrib/118072162673833957577/reviews', 'en', 'https://lh6.googleusercontent.com/-1nihls0PID0/AAAAAAAAAAI/AAAAAAAAAA0/Rjci7CESpmQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Less expensive to get the real deal, but still a great place.  Everyone should try it.', 1525625542),
(2798, 630, 'Nicole Morris', 'https://www.google.com/maps/contrib/112111133007384501113/reviews', 'en', 'https://lh4.googleusercontent.com/--rV7BXfm_I4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2C3OK3dzNCn46iv1V02YOa8mpsfg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Staff are very knowledgeable about what they are selling.  Highly recommend this place', 1522605047),
(2799, 632, 'Gabriela Garcia', 'https://www.google.com/maps/contrib/116360756821364000962/reviews', 'en', 'https://lh4.googleusercontent.com/-DLc0loLE9a8/AAAAAAAAAAI/AAAAAAAAABE/OR28f2Qsf2M/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 weeks ago', 'Very smart, nice, and helpful. All you have to do is ask them. ️\nI\'m adding to my review because I keep having wonderful experiences. The last time I went was on 4/20. Tyler really helped me out that day by knowing his stuff. Thank you!', 1525355767),
(2800, 632, 'Jennifer Nowakowski', 'https://www.google.com/maps/contrib/113533836985501608791/reviews', 'en', 'https://lh5.googleusercontent.com/-FPKIMFkDp1Q/AAAAAAAAAAI/AAAAAAAAC5Q/x7Gb6cFZn1g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Love the ladies and gents there, very welcoming and very knowledgeable.  It’s in a great location as well which is always a plus!  Very clean as well', 1523578112),
(2801, 632, 'Brittanie Barker', 'https://www.google.com/maps/contrib/115927310033739378333/reviews', 'en', 'https://lh6.googleusercontent.com/-nk4KIseABpU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0PQhCcyuWuNw8Dq9IqNQ6qhkKmaw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I called MedMar because I had some questions about the laws & some confusion on misinformation I have received in the past. Alicia was able to answer all of my questions & even went on to give me some great advice. I could tell by our phone conversation that she was very educated & willing to help. 10/10, would recommend. ', 1516733085),
(2802, 632, 'Edward Winslow', 'https://www.google.com/maps/contrib/106086083999034662101/reviews', 'en', 'https://lh4.googleusercontent.com/-s6qA51ToWcQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3OUu63739vFl_aG09bBwHIUO082g/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '10 months ago', 'You walk into this large waiting room.  There is a uniformed security guard behind a bullet-proof plexiglass screen.  There is a speaker in the wall. The guard asks what I want.  The speaker\'s volume is so loud it can be heard in the next block.  The question the guard asks strikes me as odd, since it was a facility that dispensed medical marijuana.  Why else would I be there?\n\nNevertheless, I told him that I was referred by a health-care professional.  He tells me to have a seat.  Finally, a women appears in the waiting room with forms.  She tells me to get them filled out.  She either does not have any training, or she simply couldn\'t care less about her customer. She cannot answer any questions. She tells me to call the company\'s president and hands me his card.\n\nI subsequently placed a call to the president and got his voice mail, that advised me to leave a name and number.  His message gave no indication that he was associated with the company or any other business.  Seriously, his message sounded like his last job was a drug dealer-certainly, not a state-regulated business.  Nonetheless, I left a message.  He never returned my call.\n\nWhat a pack of morons.', 1501263606),
(2803, 632, 'Monkey Box', 'https://www.google.com/maps/contrib/112985009181889497366/reviews', 'en', 'https://lh4.googleusercontent.com/--YiQKpv_FY0/AAAAAAAAAAI/AAAAAAABCOk/aeVT9J6U2HY/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '3 months ago', 'It\'s a great place, so friendly and clean!', 1519326278),
(2804, 633, 'Eric Kuehn', 'https://www.google.com/maps/contrib/109347416449155047107/reviews', 'en', 'https://lh4.googleusercontent.com/-q9Tyjdm5_NY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq13-BJVBFO3y60QGd_V_6WyCuXU1Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I don’t even know where to start! This place was amazing from start to finish. The facility was so clean and well organized. They have beautiful displays and everything there was some of the best quality and selection I’ve ever seen. \n\nI also was blown away by the customer service and atmosphere. Josh was the name of the one who helped our party and was AMAZING! He introduced himself immediately and was able to answer any and all of our questions about anything in the store. He also NEVER pressured us to buy or push something on us that we didn’t want and he could sense exactly what we were interested in and what would work for us. I can’t wait to get back to this store again.', 1523234062);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(2805, 633, 'Laurie Moore', 'https://www.google.com/maps/contrib/116664848336803040338/reviews', 'en', 'https://lh6.googleusercontent.com/-d0lvFTJcU-0/AAAAAAAAAAI/AAAAAAAAAYE/tyRVK7ET5aM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Great place! Brought my mother who would never go into a dispensary and she felt very comfortable and interested in the thc muscle rubs. Been helped by lots of wonderful and knowledgeable staff like Jeff F who had lots of great information on every product we asked about. Also Melissa S was very helpful on a different visit. Definitely my number one place for great service and products.', 1527390466),
(2806, 633, 'Moana Lyn', 'https://www.google.com/maps/contrib/112981740537311675017/reviews', 'en', 'https://lh4.googleusercontent.com/-ZKUmvPiqPjk/AAAAAAAAAAI/AAAAAAAAu3Y/P9oLwt37q6M/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Excellent shop. The newest and in my opinion the nicest option in all of Fort Collins. They have very competitive prices, and many times meet or beat everyone else. And this week Deborah helped me out and gave me an awesome perk. She was fun, she knew her flower, and they always offer discounts. They have deals if you call in your order and pick it up at the window to. But if you decide to visit ask for Deborah she is well-versed in flower.\nEnjoy living the dream in the rocky mountain region', 1523549369),
(2807, 633, 'Joe S', 'https://www.google.com/maps/contrib/113614501312011056059/reviews', 'en', 'https://lh6.googleusercontent.com/-Sd9gKc8VLx8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3k5TXVYyl58aQlmiezeGn5ECtDnw/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'in the last week', 'I love this store. Fantastic product! It is so neat and clean, I love shopping here. Upon my last experience though I wanted to share that I was working with a very nice budtender, sadly I do not remember her name, but one of the other female bartenders with short grey hair was extremely rude to her when she was speaking with me while I was looking at wax and I could tell it made her very uncomfortable. I will give this store one more chance but I do not support companies who allow their employees to be treated that way, and it was even in front of a customer! I hope some changes are made in the future so this store can continue to be great.', 1527252697),
(2808, 634, 'Craig Cook', 'https://www.google.com/maps/contrib/104542599953308113089/reviews', 'en', 'https://lh4.googleusercontent.com/-EqAQYdNUiCI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Fk7ckKDqJ7f1Ee9fWyRhxFN-8Mw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'This review I needed to update. Not happy anymore with this place. Spent thousands of dollars over the course of 3 years at this one location I stayed loyal too. Went to use my points and all of a sudden they did away with the point program and instead, only gave me a 10% discount. If anyone remembers what I\'m talking about you know depending on how many points you had you could get a half or ounce for a penny and other sweet deals.\nMy money will be spent right next door at The Green Room from now on. Again, I spent thousands.\n\nBeen using the same shop since they started. Great products, Awesome Staff, decent prices, good variety.', 1521837777),
(2809, 634, 'Jack Oxton', 'https://www.google.com/maps/contrib/112215921351946027417/reviews', 'en', 'https://lh5.googleusercontent.com/-Y2FDfucChg8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2KqugNkXxx1Csne9NUPCPJ-m7Y1w/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Absolutely top notch. Hands down my favorite dispensary! Staff is friendly and knowledgeable, product is consistent and very high quality. I\'m a big fan of the flux concentrates line especially, but everything I\'ve ever picked up from Infinite has been awesome. Loyalty program and online ordering is great also.', 1525206437),
(2810, 634, 'Tammie Harbin', 'https://www.google.com/maps/contrib/103133277164392484325/reviews', 'en', 'https://lh4.googleusercontent.com/-_XZy5UK7TS8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1V7qfOBPz8kFaQoZahf9MLgpxz4A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Great place!! Been shopping here for 2 hrs and they never disappoint me. I suggest you use the call ahead services they offer it’s well worth it!', 1525823560),
(2811, 634, 'Austin Cline', 'https://www.google.com/maps/contrib/100424182279353758086/reviews', 'en', 'https://lh3.googleusercontent.com/-Nlca06jqJFQ/AAAAAAAAAAI/AAAAAAAAABc/aqyAnp_4fqM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'This place has the best staff especially that long hair dude Austin! They always give the best information and are always really friendly. The new strains in flux wax are super delicious. Strawnanna is the sauce!', 1527712525),
(2812, 634, 'Shem Ishler', 'https://www.google.com/maps/contrib/106430099668008247810/reviews', 'en', 'https://lh3.googleusercontent.com/-BbK0eN8Lk3M/AAAAAAAAAAI/AAAAAAAAAFs/DlDZt4ruoBc/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'Great selection.  Great prices.  Nice bud tenders.  The store is very busy.  You’ll know why once you’re there.  Luckily, they have enough staff to handle the traffic in order to get you in and out rather quickly.  I recommend for sure.', 1521741113),
(2813, 635, 'Ed Joseph', 'https://www.google.com/maps/contrib/103152679895605640447/reviews', 'en', 'https://lh3.googleusercontent.com/-FQAHv6xSR50/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2FILl64SCyysKTvGwsIXLbjKo6IQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'This was my first time purchasing legal product! I was anxious yet the staff was amazing. While the prices seem high, the customer service was well worth it. Plus I was given a Veteran discount! Thank you for the amazing customer service!', 1526784473),
(2814, 635, 'Danni Healy', 'https://www.google.com/maps/contrib/100497208830875690584/reviews', 'en', 'https://lh5.googleusercontent.com/-NMqB7Aec9Qs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3K6GQc0ajY1x1-iUunTMBnSIo-zw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'The ambience here is very nice. The staff is very helpful. I love coming in here and getting the help I really need. Their prices are extremely reasonable and they make sure that you’re happy with what you get before you leave as well as answering any of your questions and concerns. Awesome place', 1516222981),
(2815, 635, 'Chad', 'https://www.google.com/maps/contrib/103822710352339501640/reviews', 'en', 'https://lh4.googleusercontent.com/-hfK7sqx73J0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2iMvpdyyX57oCpabZ2H9g5V9ESRA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 months ago', 'Been building loyalty at this place for about 6 months. I am a huge stoner and smoke more than a gram of shatter a day. Their 2 for one special is what got me in. Upper management really has no clue about loyalty and keeping frequent customers happy. They would always be out of their deal and they would do nothing for me even though I\'m there every other day giving them money. The staff is great, but when I shop at small companies like this I expect my loyalty to show and the company to show it back. End of the day they didn\'t care about me being a stable customer and told me to screw off(I spend hundreds weekly). The staff seemed to understand but when management doesn\'t give their staff enough power it doesn\'t matter.', 1519847594),
(2816, 635, 'Tom Topolinski', 'https://www.google.com/maps/contrib/106863548341803417563/reviews', 'en', 'https://lh5.googleusercontent.com/-Gz8wQvyuLbg/AAAAAAAAAAI/AAAAAAAAE80/Cb5vBkH53DY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'First class operation.  You feel like you have a personal concierge tending to your needs.  I like this kind of atmosphere.  It\'s not like Infinite Wellness Center, where you feel like a herded cattle.  Maka is great; look him up!', 1523068545),
(2817, 635, 'Greg Brinkr', 'https://www.google.com/maps/contrib/100064922966668506021/reviews', 'en', 'https://lh5.googleusercontent.com/-3JLSdp-mMHA/AAAAAAAAAAI/AAAAAAAAADQ/L-j6wNIA61I/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '5 months ago', 'I\'ve been a regular for the past couple years and while one of the more expensive dispensaries in town the buds have always been very good. Always have a sale strain or two which are never horrible. I use to think Organic Alt was as good as it gets but there are newer places with more exciting selection and value. The Old Town location has to be the best in town and it\'s usually the go-to for when I have friends in from out of state.  Ask about Old Town Cookies.', 1514698877),
(2818, 636, 'Jen J.', 'https://www.google.com/maps/contrib/109307833519955647845/reviews', 'en', 'https://lh4.googleusercontent.com/-b5EJaylegJs/AAAAAAAAAAI/AAAAAAAABZM/u362UYKduEQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 2, 'in the last week', 'First time here was great. One guy gave me the low down of all the best prices etc. Really great experience. Second time I went in...I got a woman with brown hair, mid to late 20\'s. She was more interested in the beefy guy at the end of the counter then helping me.\nShe was very short with me, only made eye contact with me once to tell me a price. That is not my idea of customer service. Pay attention to the customer in front of you! Quit getting your panties wet over the beefy dude at the end of the counter!!!!', 1527517507),
(2819, 636, 'Shikima Gibbons', 'https://www.google.com/maps/contrib/102765391721706919322/reviews', 'en', 'https://lh4.googleusercontent.com/-vRAGKlUlBqQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Cy3sNM9YMHHn16tJYhrh2iGDEXQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '2 weeks ago', '*UPDATE*  I added a star because the owner responded to my review. I may go in and talk to him/her personally and change my rating. Very cool of him to respond directly. \n\nI rarely shop here and when I do I spend as little as possible. The prices are much higher then other stores and the wait is usually about 15 minutes (not today). \n\nHowever, I have a med card and am a Vet. I pulled out an out of state ID. Even though they have my name, and number, in their system, and they know you must have a CO ID to get a med card, they would not serve me. The first budtender asked me to wait while he checked if he could accept it. I heard their conversation and the first thing he said was “Look when it was issued”. I may be wrong but the expiration date is the only date that should matter if a person if of legal age. After 5 minutes of indecisiveness, the guy sitting behind the window  came and told me he could not take it. He then proceeded to show me a state of CO issued notice of acceptable ID. When I pointed out the paper he was showing me did not say that an out of state was not acceptable, he said “Well we use this for both med and recreational, so..” So I left, and went to another store and they had no issue with my legal ID. Much cheaper, just a bit out of my way but well worth it. \n\nI won’t be returning to this store. I won’t recommend it and I most certainly will not bring visiting family and friends here for such a poor experience. I’m sure I won’t be missed. No biggie.', 1526510692),
(2820, 636, 'Kevin Couch', 'https://www.google.com/maps/contrib/110010667499909455409/reviews', 'en', 'https://lh5.googleusercontent.com/-R2knfgTKof0/AAAAAAAAAAI/AAAAAAAAACw/2PWDSrmqsOQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, 'a month ago', 'This place would be great if there was not always a wait. Unless you come in at some obscure time and get lucky, there is always a minimum 15 minute wait, even if there are only a handful of people in the waiting room. \r\nThe staff is friendly, but they spend way too much time giving long winded explanations about every product, even if you know what you want. They don\'t seem to have any system in place to expedite the service, and in 2 years, don\'t seem to be making any concerted effort to improve the wait times.\r\nOnly come here if you have a half hour to kill at minimum, otherwise, there are dispensaries within a few minutes drive with equal quality of product and no wait times. I can\'t believe after their building remodel that they\'re still struggling with this.', 1525136294),
(2821, 636, 'Harper mccann-phillips', 'https://www.google.com/maps/contrib/116948734539542770610/reviews', 'en', 'https://lh5.googleusercontent.com/-nsH1kv8Vtgk/AAAAAAAAAAI/AAAAAAAAAGA/ndKAc17kJFo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'They are hands down some of the nicest people I have ever meet. I bike 10 miles every weekend, even when I can do some place closer, because of their services and amazing quality of bud. I would highly recommend stopping by and picking up any of their strains!!', 1519750572),
(2822, 636, 'V E G. Bog', 'https://www.google.com/maps/contrib/115496269912162846740/reviews', 'en', 'https://lh6.googleusercontent.com/-Botn1dQP5z4/AAAAAAAAAAI/AAAAAAAALDo/UQDm0cfwcZU/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Very friendly people nice quiet place and yes they do check your ID even if you\'re just sitting there with someone.  You must have an ID and they do accept out-of-state ID. If it\'s for medical you must have a local ID.\nThe cookies are great, but they make you sleep sleep peaceful.', 1526668267),
(2823, 637, 'Lindsey Geneva', 'https://www.google.com/maps/contrib/118171255656245282308/reviews', 'en', 'https://lh4.googleusercontent.com/-W0zCXHSvFAc/AAAAAAAAAAI/AAAAAAAALq0/UnJDv2MrM6A/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 weeks ago', 'I’m used to going into any dispensary and getting a warm welcome also letting know how they work as far as where the prices are in their daily specials not here no hi thank you anything customer service is awful I had to figure out how they separated Sativa and Indica in view the prices that are listed on the wall when I asked for a three tier listing and how much it was he told me well there’s none up there so obviously I can’t sell you any kind of rude  Will not suggest this place to anyone and will not go back', 1525360424),
(2824, 637, 'Dilan Dumbs', 'https://www.google.com/maps/contrib/106158725499093038895/reviews', 'en', 'https://lh3.googleusercontent.com/-gRT5f7S2_VM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1jo1RR-M3_tHD5GzBvnuudZnygpQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Pure trash weed and the prices are absolutely hilarious! How do you stay in business? Sketchy, over-priced, and awful service. Go ANYWHERE else!', 1526971182),
(2825, 637, 'Alexis Contreras', 'https://www.google.com/maps/contrib/101229168713279074273/reviews', 'en', 'https://lh6.googleusercontent.com/-rncTCerGr1M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3RYa25fHOijEEB5ZHfcFL4JB67ug/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'Customer service is terrible. Old guy who works there acts like he has a stick up his ass and can\'t even answer a simple question about the product without acting like some pissed off teenage girl. Products are great but his customer service and attitude sucks. This is our first dispensary we\'ve been to also and he gave us a bad experience. Dont give them your money. They don\'t deserve it.', 1525831239),
(2826, 637, 'Gary Brown', 'https://www.google.com/maps/contrib/103111986842620938670/reviews', 'en', 'https://lh5.googleusercontent.com/-s7yAi5ZBGFo/AAAAAAAAAAI/AAAAAAAAy4k/HURdv354M9M/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'I always found very good strong weed there. Fair prices.', 1523582280),
(2827, 637, 'Greg Brinkr', 'https://www.google.com/maps/contrib/100064922966668506021/reviews', 'en', 'https://lh5.googleusercontent.com/-3JLSdp-mMHA/AAAAAAAAAAI/AAAAAAAAADQ/L-j6wNIA61I/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, '5 months ago', 'I have spent way more money here than I should have over the past few years out of convenience of location, but no more. They have always been overpriced, lacking on selection, bad customer service except for one female employee who I\'m assuming no longer works there. In the last month it is shocking. Blue Dream & Gorilla Glue that legit looked like brick schwag and was filled with popcorn kernel sized SEEDS. Huge glass cases with one pack of cheeba chews. Rock n Robins is a relic of a past time in Fort Collins and they seem to be oblivious to the fact they have competition that is light years better. It would be sad to see it go but the head shop/record store is horribly outdated.', 1514702076),
(2828, 638, 'Cameron Freeman', 'https://www.google.com/maps/contrib/114177157897646916395/reviews', 'en', 'https://lh4.googleusercontent.com/-MNq01ibRyvU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0RgEaW950STYBRS2hBBRS6lkCttQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Went here today with some inexperienced people.  They had some questions and the guy behind the counter had no courtesy to educate to them or help them. Instead he got super defensive and asked them to leave which was not called for. I personally would never come back to this place because of that guy. I would imagine that at times dealing with new and uneducated people in this industry can get frustrating but he could\'ve be more helpful. The people I was with were simply asking some questions about oils and lotions and were wondering if there was anything that was legal to take to a different location. This guy immediately just assumed they were here to break laws and get everyone in trouble. He needed to just chill the heck out and explain and educate. Once this guy stormed away a nice gentlemen was kind enough  to educate them.', 1526782495),
(2829, 638, 'Mikk Graverson', 'https://www.google.com/maps/contrib/113761938674344690455/reviews', 'en', 'https://lh3.googleusercontent.com/-nPErlkMNLHU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0YhRSx2OPhUlhvYY4hWeM5nkLIZQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This has become my home dispensary, since I believe it is the only one west of Shields Street (where I live). Have always had a positive experience with customer service. Flower ill admit can sometimes be hit or miss as far as quality but they usually have a decent number of strains to choose from. So as long as you inspect a few jars before you buy, im confident they will always have a few good ones. My favorite part about this place is I can get in and out of there in 5 minutes and be on my way. They also have an awesome rewards system!', 1523714622),
(2830, 638, 'Deidre Horton', 'https://www.google.com/maps/contrib/103813523281522727825/reviews', 'en', 'https://lh6.googleusercontent.com/-xZG9gXKyLr8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1_4hCxXRUW2RFCluZSQFM5Ar_gzA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '4 months ago', 'AMAZING!!! Very knowledgeable staff. They took time with us and didn\'t make me feel rushed, even though people were behind us. I had a lot of questions and edibles and how the different kinds metabolize in your system.  The man that helped me was able to answer every question I asked. They also have nice specials throughout the week. The price is more than what a person will pay in Denver, but was very reasonable for the Loveland area. I would definitely go back here.  The even have a rewards system.', 1515554315),
(2831, 638, 'Nekko Erickson', 'https://www.google.com/maps/contrib/101971228691006304195/reviews', 'en', 'https://lh5.googleusercontent.com/-PI9NXZpspvY/AAAAAAAAAAI/AAAAAAAAAzM/EP-E1pMDtUQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '4 months ago', 'Mixed feelings here;\n\nThe bud tender crew is a delight to work with. They are always friendly and very easy to talk to and they are well informed in their trade. If you have questions, they have answers.\n\nThe point of contention lies in the great equalizer of trade.\n\nPrice and quality.\n\nThey are more expensive than Solace (though not as expensive as some of the other dispensaries in FoCo), and their bud just isn\'t very strong. \n\nNow, if you use wax or oil, they\'ve got a good selection that\'s pretty decent, but one never found their bud to quite be up to snuff. This isn\'t their fault, this is on the grower of course, but I\'ve found that the Solace grow house usually provides better green for your green, ya dig?', 1515789326),
(2832, 638, 'brandon clark', 'https://www.google.com/maps/contrib/108868607927889143916/reviews', 'en', 'https://lh4.googleusercontent.com/-DvRpI1-3_5Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1OhG5zDueeOb0qaLf0QF8W_T2reQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '2 weeks ago', 'I find quality low for there bottom teir if I feel like spending more the quality will go up but I can drive ten min down the road and get better flower for there low shelf price I\'d pass', 1526501411),
(2833, 639, 'Tera Martin', 'https://www.google.com/maps/contrib/112768080768750935780/reviews', 'en', 'https://lh3.googleusercontent.com/-2-W58jpR9rs/AAAAAAAAAAI/AAAAAAAAASY/D7gdot1aaGU/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Went to Ace\'s Place on 4/20. When I went off my original route specifically to go through Fort Collins on my way to California. I\'m on my way back to Ohio now and I liked it so much that I\'m camping out in Fort Collins tonight to wait for them to open in the morning.  Overall awesome experience! My bud tender was knowledgeable and helped me decide what to get. Everyone there was kind and courteous. If I\'m ever near Colorodo again I will definitely shop here again. I also plan to recommend Ace\'s Place to everyone I know. Thanks!!', 1524554612),
(2834, 639, 'TESL Chewie Guerra', 'https://www.google.com/maps/contrib/115919524923400674850/reviews', 'en', 'https://lh4.googleusercontent.com/-6BGkdI-ldpM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq10YL8dh0_wF4sd8DhtlnMy5mdcdQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Visiting from Texas, these guys follow southern hospitality just like we do. Amazing staff and finding the place seems like an adventure. Definitely will return next time I\'m in Fort Collins.', 1527008987),
(2835, 639, 'Emma Byers', 'https://www.google.com/maps/contrib/102162145215214230893/reviews', 'en', 'https://lh4.googleusercontent.com/-EhGYaZCnhTo/AAAAAAAAAAI/AAAAAAAAAEM/4vYTZEsI-0Y/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Josh was an amazing budtender! Super friendly and knowledgeable! Definitely recommend this shop - always great deals and prices for out-of-staters too! :)', 1526397887),
(2836, 639, 'Brad Bezirium', 'https://www.google.com/maps/contrib/111445722637733330264/reviews', 'en', 'https://lh4.googleusercontent.com/-ZD3Hm58huao/AAAAAAAAAAI/AAAAAAAAAIA/4xr9Z3vzN6I/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'Great customer service and good products. Been a customer for over a month now. I\'m usually buying 2-3 times a week. I have been buying 1g joints for 6$ or 3 for 15$. Bought these at this price many times. Today they tell me that never existed and they have always been 10$ despite me buying 4 .5g joints for 12$ 3 days ago. Very disappointed in how Ace\'s handled this. Would of loved to been a regular customer.', 1517428095),
(2837, 639, 'steven simmons', 'https://www.google.com/maps/contrib/107185839423590516580/reviews', 'en', 'https://lh4.googleusercontent.com/-_1mYPmH3Zms/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2s9ObEg90elVFWRXLUPoLEF09amQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Aces is the best dispensary in Fort Collins! Daily deals everyday on all different products and the CHEAPEST prices around for quality buds. The staff is very helpful, and chill! They will help you find whatever is right or what you\'re looking for, definitely recommended!', 1518196345),
(2838, 640, 'Jennifer Cordova', 'https://www.google.com/maps/contrib/110641095848135144180/reviews', 'en', 'https://lh4.googleusercontent.com/-Gnk_qmXUHpU/AAAAAAAAAAI/AAAAAAAABR8/aNZcVj4FuF4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I went to this shop because I had researched online CBD shops in Albuquerque and this one seemed very reputable. I like how I was also able to view and research what products they sold via their website. When I entered the store I was greeted and welcomed and was given great attention. All my questions were answered. Being that I am new to CBD products the shop personnel explained all of the benefits and features of the different products and helped me choose the best one for me. It has only been 1 day since my purchase and I have  taken the product 3 times. I feel great relief from my nerve pain. I am excited to keep going with my product and reaping the benefits. This is a very knowledgeable place to go for first timers, like myself, and the product so far is top notch. I highly recommend.', 1522183571),
(2839, 640, 'Mia', 'https://www.google.com/maps/contrib/109030060754271318920/reviews', 'en', 'https://lh6.googleusercontent.com/-LCDXXnKA54g/AAAAAAAAAAI/AAAAAAAAKBs/a4WpdJZe7L4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I always get the best help from the staff here. Today Nico helped me and he was friendly, professional and very knowledgeable. Highly recommended .', 1527130941),
(2840, 640, 'Jon Ladd', 'https://www.google.com/maps/contrib/114231349106204110232/reviews', 'en', 'https://lh6.googleusercontent.com/-7g7bUGJE7xs/AAAAAAAAAAI/AAAAAAAABR8/DlDSM17abH0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Over a month ago I received some of the HEKA full spectrum oil and have been purchasing more since!   I have never slept this way before.   Anxieties completely disappear.  I have some acute arthritis from playing guitar.  The inflammation from that goes away everyday as well!   I am from Georgia and have VERY little knowledge of these kind of products, but the team at CBD Boutique has been so helpful in helping me find products that are right for me.   I am a fan for life!', 1517954957),
(2841, 640, 'Omi S', 'https://www.google.com/maps/contrib/113022572619010465123/reviews', 'en', 'https://lh5.googleusercontent.com/-AsNI91kykao/AAAAAAAAAAI/AAAAAAAAZQs/PC_GzxxpTLE/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '8 months ago', 'Very Knowledgeable staff and excellent customer service.  I appreciate being able to come in here for the high quality CBD products and knowledge.  This is a local company that also supports many great organizations, like Grow for Vets and the American Cannabis Nurses Association.  I love supporting this small business!', 1505316299),
(2842, 640, 'Andres Montoya', 'https://www.google.com/maps/contrib/116093265030342125379/reviews', 'en', 'https://lh4.googleusercontent.com/-4IfQSyEtI1c/AAAAAAAAAAI/AAAAAAAAAo4/AQLm81XlQ0g/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '8 months ago', 'Pros: \nA small location, usually one person working, but every trip there is excellent! Very knowledgable staff, plenty of print outs and cards for more information, reasonable prices, and daily sales/specials!\n\nCons: \nThey may often run out of stock for items, but they always have alternative solutions and other options that still meet your needs. \n\nBonus: \nThey even have a loyalty program where you earn discounts with every purchase!', 1505297382),
(2843, 641, 'Omi S', 'https://www.google.com/maps/contrib/113022572619010465123/reviews', 'en', 'https://lh5.googleusercontent.com/-AsNI91kykao/AAAAAAAAAAI/AAAAAAAAZQs/PC_GzxxpTLE/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 4, 'a month ago', 'This place has a relaxing atmosphere and does not focus on high-pressure sales or treat the patients like a \"revolving door\" of revenue.  The budtenders are amazing and can answer a variety of questions besides which products have the highest THC content (which is good, because that\'s not where my focus is). I\'ve had a lot of questions answered that I\'ve been too embarrassed to ask or have asked other dispensaries in the past and felt \"talked down too\".  For patients with fluctuating incomes, the prices cannot be beat, and I can say that some of my recent purchases have a much higher quality than nearby competitors.  Also, because I don\'t really have a \"stash box\" I appreciate the quality of the packaging their product is in (stays fresh).  \nI\'ve only taken one star off on this review because my only feedback is that the place is a bit tiny and can feel cramped while shopping on sale days or Friday\'s because there\'s a lot of customers and feeling cramped can really wig me out sometimes.', 1523463097),
(2844, 641, 'john doe', 'https://www.google.com/maps/contrib/109602177518626783832/reviews', 'en', 'https://lh4.googleusercontent.com/-Y_TcEKKbywo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2nzTgfX9c6k8NapONni4PXgVqimQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 weeks ago', 'Never been to this location been up to 528 and they are awesome best 420 experience ever 250 patients got free gram ,edibles,pipes, and but was the best sales price ever Misti is one cool chick didn\'t have what I wanted in stock and she made up for it in another way better then Everest !!! I will always go to a Natural RX', 1525548649),
(2845, 641, 'Michael Sanchez', 'https://www.google.com/maps/contrib/108208039572609332234/reviews', 'en', 'https://lh3.googleusercontent.com/-RGszixltnqA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3yfdlizJmnggZL15QoiyMopCC7aw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'This is my favorite dispensary of all dispensaries I\'ve been to the prices are always affordable everyday they have some kind of deal. I live on the Westside of abq and its always worth the drive I\'m never disappointed. The staff is always helpful only thing tht could make it better is if they open 1 on the west side', 1525386776),
