(2853, 643, 'Glynda Newton', 'https://www.google.com/maps/contrib/113023140725284905401/reviews', 'en', 'https://lh5.googleusercontent.com/--yOmE2D4xgA/AAAAAAAAAAI/AAAAAAAAAEw/Ijh5j59hVAc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'What a great group of Bud tenders/Staff.  They have helped me so much, always offering the newest info.  Selection is awesome.  All medicines are consistent in quality.   The atmosphere is relaxing and the store is always immaculate.  Thank you all!', 1526318756),
(2854, 643, 'Alex N Devin', 'https://www.google.com/maps/contrib/108473947925235204972/reviews', 'en', 'https://lh4.googleusercontent.com/-YLXOA81yUPc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1lFzzHo18q8OYXNV5PlqNyhg7eCg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I am really proud to be able to get my medicine in such an awesomely and quick manner, when i go in the employees always know what i want and they are always so nice, there is a wide variety of deals and really neat ways to consume your medicine at this location.', 1516129199),
