(2858, 644, 'Linda Jeffery', 'https://www.google.com/maps/contrib/108282410304796946883/reviews', 'en', 'https://lh5.googleusercontent.com/-UFEMQURy55c/AAAAAAAAAAI/AAAAAAAAAEU/Hpme31gr_Is/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I cannot say enough about the company and the level of professionalism. Each location is staffed with knowledgeable and caring staff. The quality and continued consistency of Greenleaf products is why I am a loyal customer and the staff is why I continue to purchase medicine here. Compassion and understanding while providing education and care to our community, great medication, fair prices, outstanding business practices, highly recommend the Greenleaf experience, and they are incredibly fun a nice bonus', 1523301873),
(2859, 644, 'Jeffrey Brink', 'https://www.google.com/maps/contrib/112384573661807671635/reviews', 'en', 'https://lh6.googleusercontent.com/-WUorhZ_XqFU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0hdA0ebX6yCj4JIAZohrxUdA6fCg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'Received an email for supposed 420 specials, was told in store that what I wanted was improperly listed and had been fixed.  So I say OK and purchase the lesser offer.\n\nTwo days later I get the same email with the same offer they refused to honor the first time.  Complete bait and switch.', 1524460211),
