(2862, 644, 'J C', 'https://www.google.com/maps/contrib/111946886002894694746/reviews', 'en', 'https://lh6.googleusercontent.com/-oLQ9OcFDn-Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ErVk0KUUI5AKAY6naMfcsyTOa7Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I like going to this location. The staff is super nice and knowledgeable. Especially josh,Tamara, James, (if philly is ever there I wish she was always there she is incredible) and everyone else on r greanleaf staff is AMAZING I wish I could name them all.  They are very compassionate about the patients and have always helped finding the right medicine and they will even give you a little cash assistance if needed. Great medicine, and great return policy (only had to ever take one thing back in 3 years, and it was very simple and I was given the exact about of medicine I returned, super helpful) I like all the locations too. Thanks for being consistent and compassionate. ', 1510375919),
(2863, 645, 'shane link', 'https://www.google.com/maps/contrib/112982784118069872369/reviews', 'en', 'https://lh3.googleusercontent.com/-bMBylSjit1Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0pTBkJd0cJu03yPNHxU07rrFBgxw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Really great staff and very friendly. Great experience today. Thank you Zia Health.', 1524693977),
