(2865, 645, 'Joshua James', 'https://www.google.com/maps/contrib/117895374942247619339/reviews', 'en', 'https://lh5.googleusercontent.com/-EqCqQlOvCWI/AAAAAAAAAAI/AAAAAAAAEgc/kyutZCTrvJ8/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '10 months ago', 'This place is an amazing spot because I was able to finally get my medical cannabis card. The people there are super nice and helpful. The staff is knowledgeable and will help you get setup with an appointment to get your medical cannabis card. Overall five stars and highly recommend them to anyone looking for there\'s. ', 1500156418),
