(2869, 647, 'Richard OTERO', 'https://www.google.com/maps/contrib/104900587696077115551/reviews', 'en', 'https://lh6.googleusercontent.com/-PExfkM44Wlc/AAAAAAAAAAI/AAAAAAAAAK4/QzNCxtjWOG0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Only been to 2 medical practices for cannabis card and this was by far the best.  Friendly,  caring, and going out of the way to really please the customer.   Practitioners  fee was the most inexpensive in the city and the added bonus of mailing application (by priority mail) for me, that is really top notch.  My future renewals will be with this facility from now on.', 1520017415),
(2870, 647, 'Amy Carrillo', 'https://www.google.com/maps/contrib/106062592480906225541/reviews', 'en', 'https://lh6.googleusercontent.com/-LCDurYoeqCU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2LYFIvmscWl7hk-OlxPZwDKqLkUQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Excellent service!!! A way better experience than the place I went last year! My renewal was quick and easy. I had all my questions answered. The price is the cheapest in town. They even mailed my application! I didn\'t have to take my application to the post office like before so I had more time to get things done in the day. The entire process was taken care of.  I couldn\'t ask for a better experience! Thank you Green View!', 1515129215),
(2871, 647, 'Brooke Gomez', 'https://www.google.com/maps/contrib/109701114050338770393/reviews', 'en', 'https://lh5.googleusercontent.com/-PInmWU_D0Ec/AAAAAAAAAAI/AAAAAAAAC2E/PHLz8MLQHwA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Great experience! I was in and out in just  a couple minutes! I came to renew my card and I was even able to bring my son with me to the appointment.  Everyone here was very welcoming and kind. Great pricing as well! ', 1516828002),
(2872, 647, 'Leroy Montoya', 'https://www.google.com/maps/contrib/107000629761907532062/reviews', 'en', 'https://lh4.googleusercontent.com/-r0sLmFkSzyU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2iP31NwewSxVlSOPqO-gN6CCmFNw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'I went to Greenview to get my card and was very nervous about the process. Monica made it easy and I felt comfortable and at ease talking to her about my past experiences. I highly recommend Monica and Greenview! She even gave me a free lighter! If you want to talk to someone professional and caring, see Monica! I will definitely be back next year!', 1514569239),
(2873, 649, 'Jerilynn Treharn', 'https://www.google.com/maps/contrib/101947445849227073198/reviews', 'en', 'https://lh5.googleusercontent.com/-QD6HASyXyUw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2TZJbHKpkIdOavvHfypwzSk93AWg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'First off it\'s been along time since I have gotten from alb at all because of discomfort in places.. organtica won me over not just in comfortability but in the kindness and care they take in their patients. They have a variety of options and knowledge to boot. Clearly I\'m not one to care much about pricing but their prices are pretty unbeatable for the products they have.. all in all this place is going to be my recommendation for your medications.', 1526509823),
(2874, 649, 'SweetHeart Angiexo', 'https://www.google.com/maps/contrib/109331123455453888916/reviews', 'en', 'https://lh3.googleusercontent.com/-bZKGZ4_nR-w/AAAAAAAAAAI/AAAAAAAAAA8/HoXSLP50lB0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'This place was very helpful and friendly they helped me out all the staff is friendly', 1527715459),
(2875, 649, 'FRANCINE Vigil', 'https://www.google.com/maps/contrib/101829888785445978463/reviews', 'en', 'https://lh5.googleusercontent.com/-Bi2QxqHJxFA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq01byh7zuHFbp0iuDwLa1R2HnFUIg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This was a very welcoming place loved the chick that helped me with my back I’ve been lifting bits of clothes for a non profit all day and the bees wax she gave me has already helped and I just got in the car ', 1520985661),
(2876, 649, 'Denver Broncos', 'https://www.google.com/maps/contrib/115349686603540129313/reviews', 'en', 'https://lh3.googleusercontent.com/-OphlWS4Z_yY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq10h4xRI_ex7rHIzcHeJc4SE-mH8g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Best place for flower and rosin stop by everytime I am in town', 1527722604),
(2877, 649, 'Jesse Lindgren', 'https://www.google.com/maps/contrib/112315102336434341220/reviews', 'en', 'https://lh5.googleusercontent.com/-MKfHrzEj6GQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3S0R-yPupCXA4vzn_BISC7V5-TKA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I love this place the people are great and if you have a problem they try to fix it not like all the othe rude dispencaries', 1522767800),
(2878, 650, 'Marcia Coty', 'https://www.google.com/maps/contrib/100247541537653818991/reviews', 'en', 'https://lh5.googleusercontent.com/-zEUIh-P28gE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1b4_Zg7o_BjC22w-Hxid-GJGkH2w/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'This is a very friendly place.  I thoroughly enjoyed my time there while renewing my license.  Caring, concern AND a sense of humor to match mine.  What more can you ask?', 1527192390),
(2879, 650, 'D_ Whitney', 'https://www.google.com/maps/contrib/108090881664138627247/reviews', 'en', 'https://lh5.googleusercontent.com/-Pi5WIS-Sn78/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0BYJh3SZEvJ561IU4za9JLJsT_-A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'AIM is awesome place to get started on getting your medical card, or if your needing your card renewed they do that too! Great staff and medical professionals that will take care of all aspects needed to obtain your med card! Look no further and give them a call.', 1522342150),
(2880, 650, 'Amber Trujillo', 'https://www.google.com/maps/contrib/108225191695965602083/reviews', 'en', 'https://lh5.googleusercontent.com/-tcJPG7Jr0ak/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0eZ3RbMMmFwgjZRJCplH0ssXJKnA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'No one even answers the phones, how can I schedule  an appointment? Called several times can\'t reach anyone! Very unprofessional ....will definitely take my business else where!!', 1526506303),
(2881, 650, 'Maribeth C', 'https://www.google.com/maps/contrib/109001904978944380610/reviews', 'en', 'https://lh5.googleusercontent.com/-lnXSodwPbxU/AAAAAAAAAAI/AAAAAAAAA3E/RfGl596KLs0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'Staff is attentive and very professional. I\'ve always had quality care from this provider', 1515431322),
(2882, 650, 'Brian B', 'https://www.google.com/maps/contrib/104247270530177644555/reviews', 'en', 'https://lh3.googleusercontent.com/-1LJQcdGvHk0/AAAAAAAAAAI/AAAAAAAAAHQ/oQ6XCjU2Sro/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '6 months ago', 'I have been going to AIM for a few years now. They have always been professional and helpful with any of our concern or questions. Wait time has been almost nonexistent. When you walk out of the office you have a pre-addressed flate rate envelope ready to send, with tracking it cost about $7 at the Post Office.\n\nI will continue to use there services.', 1510779489),
(2883, 651, 'Mike Kalb', 'https://www.google.com/maps/contrib/100684312666824049149/reviews', 'en', 'https://lh4.googleusercontent.com/-fu42yZBbffY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0BjHpMtOxNGqLqDWdak9Vs9f5yfw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'I\'ve called here a few times air status check and some info. Every single time the women who answered my calls were extremely nice. On top of that, my aplucation showed on on March 31st, and called today (april14th) they said my card goes out today. So They seem to be working hard there. Thank you!', 1492203913),
(2884, 651, 'Chaya Harris', 'https://www.google.com/maps/contrib/103519391909299127309/reviews', 'en', 'https://lh4.googleusercontent.com/-7BnhANNiWUo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3YHWPjRLuuaOsRtzGlglz6OiP5wQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'The people here are so nice - always fast, courteous, and helpful.', 1499439252),
(2885, 651, 'Mario Cordova', 'https://www.google.com/maps/contrib/105916554213643870190/reviews', 'en', 'https://lh3.googleusercontent.com/-mCSmeX9VDr8/AAAAAAAAAAI/AAAAAAAAAkk/X21tD6Mnivc/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', 'Always helpful and very nice!', 1491253786),
(2886, 651, 'El Chingón', 'https://www.google.com/maps/contrib/112925633590380168548/reviews', 'en', 'https://lh4.googleusercontent.com/-9y5T9VCgV2Q/AAAAAAAAAAI/AAAAAAAAAAA/VEqTm-WHXt0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '10 months ago', '', 1501088259),
(2887, 651, 'Thomas Sheldon', 'https://www.google.com/maps/contrib/107424893614784831929/reviews', 'en', 'https://lh4.googleusercontent.com/-qYTuuE6C-fY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3ALbPecd-59jlz3dMMLvYGSzmmbw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a year ago', '', 1476741614),
(2888, 652, 'Jackie Lunde', 'https://www.google.com/maps/contrib/109743803551197528096/reviews', 'en', 'https://lh4.googleusercontent.com/-TgUnoyKOpDc/AAAAAAAAAAI/AAAAAAAAJaA/o4L4XPlMQWE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '11 months ago', 'Very friendly staff and know what they are doing.', 1498519837),
(2889, 652, 'Carlos Perez', 'https://www.google.com/maps/contrib/116588471227052011825/reviews', 'en', 'https://lh3.googleusercontent.com/-p9aHNYKTEvo/AAAAAAAAAAI/AAAAAAAAAAk/vGMBgWZ5FC0/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a year ago', 'Love the people that help you!', 1484478428);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(2890, 653, 'jojo Le Boheme Kolar', 'https://www.google.com/maps/contrib/114131766500362117406/reviews', 'en', 'https://lh6.googleusercontent.com/-unES5myfjPk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0x2kZQiKGaZ5olZ2YD5VrD5opa1Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '6 months ago', 'These people should not have access to any type of personal information, financial or medical. Because of how poorly they handled my financial transactions, it concerns me that they have medical files. After threats of collections, I have requested proof of a zero balance after I provided them all the records any respectable business would need. But NMBR, assuming their customers will be as disorganized as they are, go after them again for money that is not owed and make threats and blame their poor bookkeeping on the customer, the bank the card they used...everything but them. I still have not received a straight up answer from these people that they have settled my account!!  So,  if this is the experience you’re looking for, you’re at the right place. Otherwise, keep reading reviews.', 1510932044),
(2891, 653, 'Tagem Bagem', 'https://www.google.com/maps/contrib/103482947998189350698/reviews', 'en', 'https://lh6.googleusercontent.com/-zjLanT-D2u0/AAAAAAAAAAI/AAAAAAAAAFQ/cFXwASd6NT0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Nice people, nice prices', 1524359269),
(2892, 653, 'Kelly Joyner', 'https://www.google.com/maps/contrib/102593087038779713224/reviews', 'en', 'https://lh5.googleusercontent.com/-eDzscrhGO3k/AAAAAAAAAAI/AAAAAAAACuU/EyBNUIJE1FI/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '10 months ago', 'Extremely disorganized, a mess and doesn\'t pay his employees.   Over extended his finances which is why he is a mess over there.  Employees walk out due to many reasons but mostly due to his unethical business practices.***** 7/8/17 one day later you respond that your clients are important and to please contact you?  I have emailed you three times and have left several messages so how about you call me back and put that check in the mail? What about your unpaid ex-employee?   I never in my life worked in such an unprofessional environment that is so shady!', 1499562793),
(2893, 653, 'Tribe 9313', 'https://www.google.com/maps/contrib/106548558951428050543/reviews', 'en', 'https://lh5.googleusercontent.com/-8PswW9HRPK4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq20q_3BGF8692iOWwOTVMmaYt7X9g/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a year ago', 'Like any of these card establishments they are all businesses in it for another type of green!! Was quoted $250 plus 10% off over the phone for father\'s initial apt, They were charged $314.  Situation was later rectified thru credits but somewhat disappointing they pulled this on us. Still 4 stars because they have always been kind and curtious to me and the people who sent me there are solid people. I feel the hand deliver of documents to DOH makes it all worth it tho', 1493548016),
(2894, 653, 'Sacagawea Goold', 'https://www.google.com/maps/contrib/110707516413665026372/reviews', 'en', 'https://lh4.googleusercontent.com/-PVwyZ5DXJH8/AAAAAAAAAAI/AAAAAAAAAO0/pcb2cNltgzU/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'David Valdez IS NOT to be trusted. He is disorganized and unprofessional. His female office manager and another female staff walked off the job recently claiming he was rude, angry and abusive to staff and patients. He violates the confidential HIPAA medical protections of patients.', 1484591961),
(2895, 654, 'Lynda Nolan', 'https://www.google.com/maps/contrib/110497331824946968913/reviews', 'en', 'https://lh4.googleusercontent.com/-wfJemdMzhJE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2vTjux7ECnSxIK-paSrUpMLgrU8g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Going into this I wasn\'t really sure how I was going to feel. So much controversy surrounding this whole subject. From the time I entered the front door I was put to ease. The facility was clean and welcoming. I was treated exactly as any patient should be ...with dignity and compassion. I knew I was making the right choice. I\'m grateful for the very professional treatment I received from the staff. Im sure anyone willing to try this route would be well pleased with their experience at this clinic.', 1523626032),
(2896, 654, 'Layla Stryker', 'https://www.google.com/maps/contrib/107233386218010381604/reviews', 'en', 'https://lh5.googleusercontent.com/-WOyuoLQVIKg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1czR3pz0gGcFXVFidrcIH80nuQJQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'Sasha is my practitioner and she\'s fabulous. I put off my appointment for months thinking it would be one of those TV \'doctors\' you see portrayed in the industry.  I was very very wrong. \n\nJust like any other doctors office, just no exam table! It was surreal sitting with a practitioner, openly discussing which medicine may be best for my conditions-- which Sasha has nailed with her recommendations. \n\nA little more expensive than other places but WAY better service.  Friendly office staff,  attentive, responsive, personable and serious. \n\nAlso parking is free and openly available with an easily accessible entrance and building.  \n\nBonus: The doctor brings her small Puggy dog to the office some days.  He\'s super friendly and fun,  great therapy animal and just a bonus from a regular boring waiting room.', 1523661323),
(2897, 654, 'marianne sinclair', 'https://www.google.com/maps/contrib/103615781817268393102/reviews', 'en', 'https://lh3.googleusercontent.com/-s63yMeVE-pg/AAAAAAAAAAI/AAAAAAAASwY/L9VpfulMp_I/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The staff is very professional. Their appointment times are Timely. More than that they listen to the patient. I do not want to take pharmaceutical drugs. Medical marijuana has helped my arthritis through applying the oil to my affected areas. This was recommended by the medical marijuana Treatment Center physician in Summerfield. I have been seeing them over a year and I will continue to see them. My friends and family are sick of listening to doctors to take more prescriptions. This is a much healthier way to help our bodies deal with pain.  The restrictions on medical marijuana and the dispensaries are ridiculous and need to be lifted by our government. The fact that I must bring cash money to buy the medicine makes me feel like I am doing something wrong. Wake up people.', 1523840187),
(2898, 654, 'Michael Laskowski', 'https://www.google.com/maps/contrib/106080553656133108542/reviews', 'en', 'https://lh5.googleusercontent.com/-1eFC3pdb3wI/AAAAAAAAAAI/AAAAAAAAQb8/O9EJA_X-wEQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I wasn\'t sure what to expect when I went in to my prearranged appointment.  I received professionalism and over the top friendliness unlike anything I have ever seen in Summerfield before. The staff is gracious and takes what ever amount  of time you need to make sure all of your questions are answered. They give you the paperwork that must be sent  to\' Tallahassee and walk you through the appropriate way to complete the application.  Then you simply wait to receive your medical card in the mail.  MMTC has nothing to do with the medical card arrival time so don\'t keep calling them with questions. Have all your questions written down for your interview with MMTC. Bottom line is this facility knows exactly what and how to do things. Even if you don\'t live in Summerfield make the drive, meet some nice people and get your individual needs taken care of...', 1523834944),
(2899, 654, 'Tracy Aitken', 'https://www.google.com/maps/contrib/101817762318853294738/reviews', 'en', 'https://lh3.googleusercontent.com/-LKdRUR1MOnM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1q3Isvfegt5cOSkXGRJM1Qo-_dfA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Clean, beautiful facility, looks professional and all staffers act very professional.  Smart move, since this is an elderly community and they don\'t want to go into a scuzzy smoke shop.  They want to try medical marijuana for pains and conditions of old age, so the medical presentation as clinical and professional puts them at ease.  These guys are fantastic.', 1524054590),
(2900, 655, 'Heather H', 'https://www.google.com/maps/contrib/107760082374955399425/reviews', 'en', 'https://lh4.googleusercontent.com/-H26XVRB7bTE/AAAAAAAAAAI/AAAAAAAAAH8/Z6Jj56AjEOg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'We were recommended by a friend to this clinic.  We were very pleased as Dr Leimbacher is awesome!  He is honest and open and willing to share all the info he can no matter what the outcome of your case.  My husband came to my appointment and Dr. Leimbacher even answered all his questions too.  I\'d recommend this facility to all my friends and family who are interested in finding out more information.', 1525803079),
(2901, 655, 'Mary Melstrom', 'https://www.google.com/maps/contrib/106177621588588693640/reviews', 'en', 'https://lh4.googleusercontent.com/-Q9Mb6lejSZs/AAAAAAAAAAI/AAAAAAAAAAA/Lkoku-eY_Zc/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'a month ago', 'They were very helpful and very nice people to work with. I do feel that I will need a lot of information from the dispensary on what I should get based on my needs. The clinic gets you the card but did not do a lot of education on what to do once you have it.  The system to obtain a medical card is cumbersome. It takes a very long time to get through the system for an actual prescription.', 1523406820),
(2902, 655, 'Jade Thornbrough', 'https://www.google.com/maps/contrib/114462995947947221657/reviews', 'en', 'https://lh3.googleusercontent.com/-rzLqS-TXMao/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3FcrmZky72iRHqU_ZR0GfyfNRUwg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'The receptionist and the doctor were both exceptional but I have to say the receptionist dressed in all black was my favorite she was perceptive and personable and nice!!! Just everything you want in person! Thank you so much MMTC St.Pete!!!!!!', 1525890941),
(2903, 655, 'Connie Watson', 'https://www.google.com/maps/contrib/100757547121891353225/reviews', 'en', 'https://lh4.googleusercontent.com/-D1A0vEXGDJg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3ZKWgYt89v-meTZ31DMuIVKdUQ3g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'My 90-year-old mother got cannabis oil for rheumatoid arthritis and it has worked beautifully.  She no longer takes any prescriptions (Meloxicam, Tramadol) or any NSAIDS and just uses the drops twice a day under her tongue.  Her pain level has improved 100%.  This has been amazing!', 1523495997),
(2904, 655, 'Caleb Sneider', 'https://www.google.com/maps/contrib/100464480321522619310/reviews', 'en', 'https://lh6.googleusercontent.com/-kgexZ5lypHU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0pv-rvjqwyfVGGaowBX9dvas1WTQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 months ago', 'The Dr. and office staff were both rude. Overall, I\'m unhappy with their services. VERY EXPENSIVE! I suggest looking into other places before going to mmtc.', 1516286305),
(2905, 656, 'Claucous Alfaro', 'https://www.google.com/maps/contrib/106103476947669262503/reviews', 'en', 'https://lh5.googleusercontent.com/-zecJl5wZO44/AAAAAAAAAAI/AAAAAAAAALg/1Btuyjvei0k/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', 'I was very pleased with Dr Dorn and the staff. Everyone was so friendly and compassionate. They explained the process very clearly.', 1501123812),
(2906, 656, 'JOSEPH CURRY', 'https://www.google.com/maps/contrib/113855594178182306699/reviews', 'en', 'https://lh5.googleusercontent.com/-ibq_QIkZF3k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2RrwPiDtByD4WYtrKCy55hX-EGrg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', 'Very understanding practioners and staff. Dedicated professional medical clinic.', 1504459695),
(2907, 656, 'Mikki Rivas', 'https://www.google.com/maps/contrib/101659264570210386707/reviews', 'en', 'https://lh3.googleusercontent.com/-t8iU19dXLSs/AAAAAAAAAAI/AAAAAAAABaE/UjBca_yJHvk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', '', 1508534135),
(2908, 656, 'Eternity Health', 'https://www.google.com/maps/contrib/116298224855897590628/reviews', 'en', 'https://lh5.googleusercontent.com/-1_H6cPp20tw/AAAAAAAAAAI/AAAAAAAAAlc/zz76CAeTVs4/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', '', 1502465545),
(2909, 656, 'Cesar Martinez', 'https://www.google.com/maps/contrib/105695070915581320535/reviews', 'en', 'https://lh5.googleusercontent.com/-PWKWsfsvjWE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0iJzw7BIPR0zulQhMh3ADS_042qA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '10 months ago', '', 1501696582),
(2910, 657, 'Anitra Amous', 'https://www.google.com/maps/contrib/116051525382990128186/reviews', 'en', 'https://lh6.googleusercontent.com/-W5RNKNpnR9Y/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2BhVjgQKgtVsVSBOaiZvaP7B6vWQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'They are very knowledgeable & the staff treats u very well. Any questions I need answered, they had no problem trying to get me the answers if they didn\'t all ready know the answer. I trust this Doctor & team with my life..... It is in fact in his & his great staff of other Dr\'s, nurses, & office staff.', 1519874475),
(2911, 657, 'Sarah Williams', 'https://www.google.com/maps/contrib/106711007674600507574/reviews', 'en', 'https://lh4.googleusercontent.com/-Y3jNvGfnGnY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2p0AtvKF4sjsv0R5R7g0Z1XWWmPg/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '4 months ago', 'HORRIBLE SERVICE and over priced! Go to Docmj. They actually care about their patients. They even gave me a discount on my exam.', 1516287619),
(2912, 657, 'KC Stark', 'https://www.google.com/maps/contrib/115944005955462678894/reviews', 'en', 'https://lh5.googleusercontent.com/-KfN-7vcbSW0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2M5fQDhDeFyFLAXfZQnGBeuWFxDA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Tip of the hat, great service. Licensed. Proper and kind.', 1507746408),
(2913, 657, 'Ricky Concepcion', 'https://www.google.com/maps/contrib/101995097496296971609/reviews', 'en', 'https://lh3.googleusercontent.com/-ZqV0x7g6wk0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0FUzftpq31K9zn4iqLibj6a3VZ9A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Great team to work with. Thanks.', 1508180796),
(2914, 657, 'Terri Zimmerman', 'https://www.google.com/maps/contrib/109768255384197974089/reviews', 'en', 'https://lh4.googleusercontent.com/-BACKj2N-N2U/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq25Yy9OCA3-7fZItp86PgDHdKH7og/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '7 months ago', '', 1508185623),
(2915, 658, 'jessica gonzalez', 'https://www.google.com/maps/contrib/112410890805137885509/reviews', 'en', 'https://lh6.googleusercontent.com/-CtjwXMSRaiU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq15j1peEgt3k-OL8QzT5-6hINi17Q/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'The staff has always been helpful, supportive, knowledgeable and friendly. Their competitor does offer a more generous veterans discount of 20 percent off. The quality of the products used have been what a consumer of medicinal products would expect especially considering their is no insurance to offset the financial burdens of purchasing these types of medicines. Plenty of parking and you can preorder to shorten your visit or have your order delivered to you.', 1523902708),
(2916, 658, 'Cathi Rivera', 'https://www.google.com/maps/contrib/108132493014598200221/reviews', 'en', 'https://lh3.googleusercontent.com/-90SZYuVwmuM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq16RDTDC2KFzJE-4NFQUIqHEShCFQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'Absolutely terrible experience. No one will answer the phone so you can check stock. So placed order online received email order was ready. We went to pick up and they didn’t have anything that was ordered. They said the email goes out to everyone that places an order but does not apply to that location. They had none of the things we ordered So that was 2 hours round trip wasted. Today we try calling to confirm stock again no answer so we drive there wait 45 minutes only for them to say they are totally out of stock of almost everything again! I asked about 5 different kinds out off all of them. No idea when they will have a delivery they won’t allow you to pre order. Traditional pharmacy would not be able to get away with being out of stock everyday! My husband had to fill his Percocet prescription today because Trulieve has been out of his medicine for weeks! Staff is friendly but can’t recommend due to lack of inventory.', 1525535769),
(2917, 658, 'Fernando Negron', 'https://www.google.com/maps/contrib/106919409090337000810/reviews', 'en', 'https://lh4.googleusercontent.com/-irkXpa6n6Tk/AAAAAAAAAAI/AAAAAAAABzg/6S1KVkO3QY0/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '3 months ago', 'I love the oral oils, concentrates and tincture. I wish it was legal to buy the whole flower here because I feel we are still getting a processed product, which is inferior to the natural real thing. I would also like to see the website be accurate about what is in stock. I have driven there so many times only to find out they are out of stock. I def prefer them to the other dispensary because they label the strains but I wish their bottles had safety seals on them. I hope to see more variety in the oral category in the future.', 1519225583),
(2918, 658, 'j', 'https://www.google.com/maps/contrib/115601898728769314505/reviews', 'en', 'https://lh5.googleusercontent.com/-eLrrOU7GcVw/AAAAAAAAAAI/AAAAAAAABik/0SrzF-E-r1I/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Overall really wonderful experience. They were very attentive, and knew exactly what I needed for my ailment. The facility was clean and welcoming.\nThey have a fantastic deal for a second time visit. I cannot say enough good about their customer service. Superior cartridges compared to curaleaf and aphria. Their tincture is also really effective, as well as, their nasal spray for seizures . Thank you for offering such wonderful products.', 1521303717),
(2919, 658, 'Theo Karantsalis', 'https://www.google.com/maps/contrib/103335769774234952973/reviews', 'en', 'https://lh5.googleusercontent.com/-gOKcogTMmLI/AAAAAAAAAAI/AAAAAAAABOI/x7BO_8R_cBg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '3 months ago', 'The Trulieve staff are terrific and genuinely helpful. They patiently answered all of my questions about their products and reassured me that they do not use nasty chemicals like butane, acetone or hexane to process their products. The tip jar on the counter deserves to be full!', 1519509196),
(2920, 659, 'Lisa McCorkle', 'https://www.google.com/maps/contrib/114870137358216157948/reviews', 'en', 'https://lh3.googleusercontent.com/-VglUeDZOYjk/AAAAAAAAAAI/AAAAAAAAIl0/L58ZRARdSB0/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 weeks ago', 'I love this place for many reasons. Their products are great, they allow returns for their faulty products which some places don\'t, staff is polite and well trained for patient load, there is VARIETY, they offer discounts for veterans and people with snap although not well advertised, and their store is bright and clean. They stay busy so I have to call sometimes to make sure my products are in stock before pick up so I hope they keep an in house line. You may need a second location to handle patient load! I don\'t go anywhere else but Trulieve because their stuff helps me most', 1526533249),
(2921, 659, 'Aaron barrentine', 'https://www.google.com/maps/contrib/114750765607967622990/reviews', 'en', 'https://lh6.googleusercontent.com/-tcKkB5gsyrM/AAAAAAAAAAI/AAAAAAAABZ8/MKr41hFZi6k/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', '100% best place right now in Florida to get your medical cannabis. Best product, cheapest prices and they\'re coming out with new stuff every day. Also I have never been anywhere with a staff as awesome as trulieve... They are some of the nicest people and are really happy about their jobs. They really know what they\'re doing and help you quickly and are some of the nicest people in the business. Think about it , if you had this job for this company.... would you not be as happy as them all the time. I know I would be!', 1521208323),
(2922, 659, 'Sean p', 'https://www.google.com/maps/contrib/111600634385517491719/reviews', 'en', 'https://lh6.googleusercontent.com/-g1KqQjiQsCc/AAAAAAAAAAI/AAAAAAAAALg/Ue8DeDf_n2s/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'Their products are not unreasonable but they are expensive.  Biggest issue is they continue to claim they are out of products for over two weeks now.  What good is a business that cannot offer you the products you rely on?\nRecently the staff changes have been less pleasant and people are now openly carrying weapons in the lobby before you enter the patient lobby who openly ridiculed customers in front of me during a visit.  \nThe management claimed they were unable to inform me when my medicine was available and a week later I made a phone call to the facility to check in on availability when a employee broke their procedure and informed me when they would have product in.\nPoor management, communication and knowledge.  \nShop other companies in the area before you get settled in on Trulieve.\nThey need a severe awakening to survive in this industry.', 1525883400),
(2923, 659, 'Lynn O\'Meara', 'https://www.google.com/maps/contrib/112249268432635698949/reviews', 'en', 'https://lh5.googleusercontent.com/-mick_KtYCl8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2ptIZ6jlTdT2ETRvveYZWRnyI4Mg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '6 months ago', 'I went into this store yesterday for my first purchases, and the young man and woman could not have been more informative and helpful. I had amassed a couple months worth of product  but had forgotten my atm card. I pulled out my emergency cash, feeling very self conscious and they were so nice. They were able to put together a great sampling within my budget. I am so grateful for their exceptional kindness. Oh, and they described the strains with pinpoint accuracy.', 1511300656),
(2924, 659, 'Michelle Loiry', 'https://www.google.com/maps/contrib/111568666030214889719/reviews', 'en', 'https://lh3.googleusercontent.com/-gbh-hHjDFHY/AAAAAAAAAAI/AAAAAAAABIc/hJAS4XZZw18/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, '3 months ago', 'Great people great dispensary prices compared to the other one they also have delivery service from the call center to the delivery people are super nice and caring! Love you Guys!', 1519855990),
(2925, 660, 'Judy Mills', 'https://www.google.com/maps/contrib/108208122243939458134/reviews', 'en', 'https://lh4.googleusercontent.com/-kpVAtCJngtw/AAAAAAAAAAI/AAAAAAAAAT0/fRxQkZ1TDlg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I was really skeptical at first.....\nBut from the very initial contact  to getting my card, Mike could not have been more helpful!\nPersonable, professional and extremely understanding and kind.....he helped me through  every step of this process.   I would HIGHLY RECOMMEND All Natural Medical if you are seeking a Medical Marijuana  card in the state of Florida!!!', 1521132132),
(2926, 660, 'Kathryn Keyak', 'https://www.google.com/maps/contrib/112863238253852073750/reviews', 'en', 'https://lh4.googleusercontent.com/-JJsj05CBQhU/AAAAAAAAAAI/AAAAAAAAABA/KJZtxPbgIOM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'After years of killing myself with prescription drugs. Medical marijuana has changed my life. Thank you to all the staff at All Natural Medical Solutions marijuana doctors in Florida.', 1525720885),
(2927, 660, 'Jane Gilman', 'https://www.google.com/maps/contrib/107018396107752060461/reviews', 'en', 'https://lh6.googleusercontent.com/-zynfG39I-a0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3KW7phtUTIpcr0QYxcP8Tf3fJNPA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'All natural medical solutions has made this process very easy for me! Mike responds to my emails and messages within minutes and is super helpful. I would highly recommend!:)', 1517439794),
(2928, 660, 'Jim Baker', 'https://www.google.com/maps/contrib/110628243112640371205/reviews', 'en', 'https://lh5.googleusercontent.com/-ofMOhdyw3sM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2wYHA7CDnz77lPfEXU-U-EkjUGag/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Great place to help you get your MMJ card. \nMike was really great to deal with and great communications weather call, text or email. \nThanks Again', 1518045532),
(2929, 660, 'Thomas Pittman', 'https://www.google.com/maps/contrib/105639197169004462920/reviews', 'en', 'https://lh4.googleusercontent.com/-IlMmNKt8L34/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2W2SOgswOoGYEzFluJBbUAMPUcBQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'My appointment time was right on schedule and went very smooth. The Doctor was very knowledgeable in the field of medical marijuana & I needless to say; I am very pleased.', 1519534332),
(2930, 661, 'Anthony DiStefano', 'https://www.google.com/maps/contrib/117023018000301633070/reviews', 'en', 'https://lh5.googleusercontent.com/-9J-AVIHY_c4/AAAAAAAAAAI/AAAAAAAAAAA/jhTf1VbK_7o/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'in the last week', 'These people are the best around in my opinion. Very educated and listen to the patient. The company had evolved from feedback I imagine. The cartridges now being made out of glass and metal... syringes... everything... Customer service has been top notch.', 1527657847),
(2931, 661, 'Jay Schultz', 'https://www.google.com/maps/contrib/114611340458852104584/reviews', 'en', 'https://lh6.googleusercontent.com/-6gjXU-2VdMY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1fPTYoIaWRNQhuD_G-m_-UhwTXQQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This review is from my girlfriend who asked me to post for her regarding her excellent delivery experience earlier today:\n\n\"Ben called in advance and gave an arrival time, not an arrival \'window\'. They then arrived early! and was extremely friendly, just like my experience in the Tampa location. Ben then patiently went over my order and described each item and showed them to me, and answered all questions. All together a FANTASTIC experience\".', 1523901096),
(2932, 661, 'Angelo Anello', 'https://www.google.com/maps/contrib/102269758459842503578/reviews', 'en', 'https://lh5.googleusercontent.com/-Iu9r3WObCi4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0OU5BxFI7IfvjhsKMNMmFlNEUIiw/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'in the last week', 'BEWARE the NEW Rip- Off!   The product labeling is confusing; doses are by trial-and-error. Consistency can vary widely, so that sometimes you take too much, and sometimes you can\'t notice anything.\n\nMy main concern, after trying three dispensaries products, is that everything\'s great when you\'re there, spending cash. Everyone seems to be trained to psychoanalyze and make you feel \'special\'.. warm and fuzzy!\n\nLater, you just can\'t reach them, after many tries, for someone to return calls. Seems they would rather you physically go there than to save fuel with a phone call, for questions. Most seem to be from out of state with years of professional experience.\n\nYou invest in their brands and styles, but don\'t really know what you\'ve buying, until you try to use it. No samples, or refunds. If something isn\'t good, you\'re just out of luck, because you have to buy the large size to find out. The child proof cap leaked and it was all wasted anyway. I\'ve had vape cartridges leak or arrive empty (Surterra), but the prescription limit doesn\'t consider any of that. \'Wellness\'? \'Compassion\'? Who cares?\n\nInstructions require a microscope, and don\'t make sense anyway. A simple diagram would work wonders for a retired engineer! Should we guess? \n\nDespite the marketing, all three have lost my business; for a lifetime. \n\nSeems to be a trend in this new industry; offer some ridiculous deal, get the money, and just disappear!\n\nMedical Marijuana was supposed to made legal in Florida, by an overwhelming referendum last year. Instead of actually doing it, we get hybrids of oils that are ineffective, while paying top dollar just to try it. Very expensive lessons.\n\nIt\'s obvious the will of the people has been circumvented by an unwilling bureaucracy, still reluctant to just let us have marijuana. Which has never harmed anyone.\n\nHysterical \'drug wars\' have.', 1527512183),
(2933, 661, 'Heather Vazquez', 'https://www.google.com/maps/contrib/101936463648062062609/reviews', 'en', 'https://lh6.googleusercontent.com/-za_HD_a4vjo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1YXPLMpOZ7-j8pNvZTTCVt-ut8ew/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'in the last week', 'Inital visit is approximately 30 min wait, parking is crappy... But not THEIR fault.  Very helpful and informative. Cash only', 1527780347),
(2934, 661, 'mia mazumder', 'https://www.google.com/maps/contrib/108594742571748350016/reviews', 'en', 'https://lh4.googleusercontent.com/-T1zrgsbVfCY/AAAAAAAAAAI/AAAAAAAAAL0/8cZLqd85_pI/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '4 weeks ago', 'Trulieve is a great place to get everything you need, with great people to help you. With a lot of the employees also being patients, they have an insight most places can\'t give you. Make sure you don\'t forget getting CBD oil to take orally. If you are living in pain, it makes such a huge difference from taking THC alone.', 1525269189),
(2935, 662, 'Ricky Concepcion', 'https://www.google.com/maps/contrib/101995097496296971609/reviews', 'en', 'https://lh3.googleusercontent.com/-ZqV0x7g6wk0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0FUzftpq31K9zn4iqLibj6a3VZ9A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Great team, love these guys.', 1508180952),
(2936, 662, 'mark hart', 'https://www.google.com/maps/contrib/106055827004047347390/reviews', 'en', 'https://lh4.googleusercontent.com/-Go6LKH68PtQ/AAAAAAAAAAI/AAAAAAAABDU/cjWM18fYYJ8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', '', 1522273761),
