(2939, 662, 'Chance Crescionne', 'https://www.google.com/maps/contrib/100861299723090651179/reviews', 'en', 'https://lh6.googleusercontent.com/-VxcRKNIzX1E/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3IyuFfLreyK9i5bgqu1gxuoum5Ww/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '9 months ago', '', 1502218390),
(2940, 663, 'Ed Stockowski', 'https://www.google.com/maps/contrib/111201209167325783495/reviews', 'en', 'https://lh5.googleusercontent.com/-B8r8KgnOvek/AAAAAAAAAAI/AAAAAAAAAa0/OJbnLo0UWes/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, 'in the last week', 'First time visit.  Relatively  quick considering crowded lobby.  40 minutes start to finish.  Everyone was courteous  and helpful. Give 5 stars as time goes and experience  grows..... Biggest problem I see is the online shopping page never gets updated.  Keeps showing products they  have been out of for weeks....', 1527621055),
(2941, 663, 'Erin Modglin', 'https://www.google.com/maps/contrib/100521288116234823560/reviews', 'en', 'https://lh3.googleusercontent.com/-n38ozPdAQVo/AAAAAAAAAAI/AAAAAAAAAD4/fj2UaOXnC6E/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 months ago', 'Gorgeous atmosphere and very kind and helpful staff. My first time here and I\'ll definitely be back..... UPDATE(over a month after 1st writing review)..... After going to this dispensary along with every other dispensary available in my area I have found Trulieve to be, without a doubt, the BEST. Not only is their product quality and selection better than anyone else\'s but their staff is INCREDIBLE!! Thank you Raven and Ashley (along with everyone else there)for ALWAYS making my visits perfect. Much love and many thanks.', 1521490391),
(2942, 663, 'Yazzi Rain', 'https://www.google.com/maps/contrib/109674539029097262635/reviews', 'en', 'https://lh4.googleusercontent.com/-Gm87TF8V0WU/AAAAAAAAAAI/AAAAAAAAJ7w/YiFUAG0K6Zc/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, '2 weeks ago', 'Very compassionate helpful and understanding. No judgements here. Just help natural help that has been needed in this country for years. No more self-medicating. This stuff is dialed in for every pain we could possibly have. I have actually been able to get off different prescription medications due to medical marijuana', 1526153946),
(2943, 663, 'Ashley Ellen', 'https://www.google.com/maps/contrib/102947454127889337941/reviews', 'en', 'https://lh5.googleusercontent.com/-T0p-fLCMbQs/AAAAAAAAAAI/AAAAAAAAC5o/dFdALFwZMRI/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a month ago', 'They told me 45 minutes wait because Monday is the busiest day. I asked when is a better time, they said a different time of the day on Tuesday would be better. I said I work all day Tuesday, what’s a good time on Wednesday, I’m off on Wednesday. They said, well we probably won’t have much of anything left on Wednesday....sooo thanks for nothing I guess.', 1524506395),
(2944, 663, 'Dave Barry', 'https://www.google.com/maps/contrib/109469333885338756831/reviews', 'en', 'https://lh6.googleusercontent.com/-ifwBo5Q8nGo/AAAAAAAAAAI/AAAAAAAABH8/vY4yxFjY8OA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I had a problem with the battery I purchased and Lou took care of it for me right away. He also gave me everything I needed to take care of any future issues I might have. I would say he provided me excellent customer service and I am very glad that my visit today was so very well taken care of. Great job Lou and thank you trulieve.\n\nDave Barry', 1522111815),
(2945, 664, 'angelica mack', 'https://www.google.com/maps/contrib/102721901720830689824/reviews', 'en', 'https://lh3.googleusercontent.com/-PgFSFAhRQJk/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1FpygcTL8Phc5OvKDDS6RlTQ6-7A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a year ago', '', 1494368926),
