(2948, 667, 'Robert Novatin', 'https://www.google.com/maps/contrib/112117366168801888566/reviews', 'en', 'https://lh3.googleusercontent.com/-F3j4FiGE6iw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2Bq20QJav6k5f8mUNjyd0TpWnWJw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '6 months ago', 'Great staff great caring doctor and not a long wait basically just all around nice clean place and a doctor  who is trying to help thanks guys', 1510790580),
(2949, 667, 'Tom Dangelo', 'https://www.google.com/maps/contrib/116827329986217094819/reviews', 'en', 'https://lh6.googleusercontent.com/-mkwztJwFcms/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0XHALfch3cjdH_aRpE8Vt_jf0t_g/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Being new, I called to find out what to do. Hung up on me, I thought it was an accidental dis- connect. I called back and she was very rude and hung up.\nChoose someone else...', 1521812073),
(2950, 667, 'Alex Malnar', 'https://www.google.com/maps/contrib/117354773717354437489/reviews', 'en', 'https://lh4.googleusercontent.com/-Uh7UxrAZOrA/AAAAAAAAAAI/AAAAAAAAABE/HGsoVwXQ1YI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', '', 1522825850),
(2951, 667, 'Andy S', 'https://www.google.com/maps/contrib/100774864537962878884/reviews', 'en', 'https://lh3.googleusercontent.com/-A4m7klCeQIc/AAAAAAAAAAI/AAAAAAAAAEU/YSXbKgtNS7k/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '8 months ago', '', 1506057847),
(2952, 668, 'Chris R', 'https://www.google.com/maps/contrib/112258326744239327350/reviews', 'en', 'https://lh3.googleusercontent.com/-tKtszEKFTpY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3x5y5otb0WIB_ylfFZUwYP0Yvs5g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Best dispensary in Florida.  I Hope the standards in Florida start improving faster though for those who can\'t move to a better state at the moment. For the sake of our health. Cannabis is the only treatment for me. Immunosuppressive drugs are not what I want in my life. Wish we could grow our own and make the oil ourselves or pay a professional to extract it. It would make it so much easier financially on our families.', 1525865538),
(2953, 668, 'Richard Caputo', 'https://www.google.com/maps/contrib/115935753749792718887/reviews', 'en', 'https://lh3.googleusercontent.com/-CnWHubGEutQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2NiKjubCL9Lf2Gx-R63OC63PbEtQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I put in my oder online at around 11:30am. I got there around 2:30. I was in and out in less than 10 minutes. Nothing was easier. I don\'t know if this is the norm but it was great. Now I am sitting here enjoying my purchase', 1527797085),
(2954, 668, 'Steven Sanders', 'https://www.google.com/maps/contrib/113497706937725768306/reviews', 'en', 'https://lh5.googleusercontent.com/-K131RmaHHSM/AAAAAAAAAAI/AAAAAAAAC70/SUGXg1_FhkY/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 4, 'a month ago', 'Thank you to the new lady with all the cool rings. Appreciate your very obviously care for your patients. \n\nJust a Pleasant Experience Every Time I Go! Officially Only buying from trulieve Quality product every time!\n\nTrulieve is falling behind the staff is great leadership not providing tool to there employees to help them better our experiences.\n\n3 hours waits at the store, broken or defective product. Lack of consistency', 1522898700),
(2955, 668, 'Derek Morin', 'https://www.google.com/maps/contrib/102893578436024982760/reviews', 'en', 'https://lh4.googleusercontent.com/-x1BYcDOqvvQ/AAAAAAAAAAI/AAAAAAAASlk/Mujt-wNVst0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a week ago', 'Great place to get help from. Very knowledgeable very nice and ready and willing to help. Along with the best medicine for all different types of pains. I now go to the new Trulieve location in Vero Beach but I do miss all the nice people at the Edgewater location.', 1526630456),
(2956, 668, 'Silvia Zexto', 'https://www.google.com/maps/contrib/105537647992777573649/reviews', 'en', 'https://lh6.googleusercontent.com/-Vqa4xEijjqc/AAAAAAAAAAI/AAAAAAAAAHU/lZYfBmGttA0/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg', 5, 'a month ago', 'Update. Shakara and Daniel are the best so knowledgeable so helpful so friendly. I have been to the Orlando store and honestly Iibe an hour away so the delivery is worth it to me. Customer service is on point. I choose to go through them Bc they back their products, are friendly, knowledgeable and prompt. It’s a strange transition time and having our medicine still available on the streets or being able to get it from out of state are options too but I choose to use trulieve bc of their outstanding customer service and the quality they put into their products. Also I’ve only used their delivery service so I’m not sure about I store. But their delivery is great and everyone I’ve dealt with over the phone has been knowledgeable and friendly and helpful.', 1523901453),
(2957, 669, 'Bill Rhinehart', 'https://www.google.com/maps/contrib/102331143096849816453/reviews', 'en', 'https://lh6.googleusercontent.com/-ezEMwlLVW84/AAAAAAAAAAI/AAAAAAAAAA0/yHwvfEHq4PU/s128-c0x00000000-cc-rp-mo/photo.jpg', 4, '3 months ago', 'I was very impressed with the professional and knowledgeable staff at St Petersburg office today . And...their products far exceed those from another brand dispensary in the area. And the S provider I haven\'t visited yet. The products far surpass the first ones I purchased , by far! Prices good too. All the employees worked as a Team when issues arose. Thank you  Trulieve for your service today!', 1518743401),
(2958, 669, 'Tara Nissen', 'https://www.google.com/maps/contrib/104945489630674454569/reviews', 'en', 'https://lh4.googleusercontent.com/-hqxexhC75Rg/AAAAAAAAAAI/AAAAAAAAKS4/rGUKzS7FbOY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a week ago', 'My husband is a patient and at first he wasn\'t a fan but now he loves the true flower and the volcano is worth every penny! Also his 2nd choice is the true stick.when it comes to his medicine he profers an Indica or a Hybrid with a high thc low cbd strength  Even though we live in Sarasota he prefers the 4th Street North location in St Pete. If you tried Trulieve and you were not fond of their products I strongly recommend you try them again because out of all 3 companies in bradenton to Tampa area this is my husband\'s favorite. It\'s a little bit of a drive for us over the Skyway but it\'s a beautiful drive and it doesn\'t feel like a long drive at all. The people in St Pete are always friendly and polite and treat my husband with the upmost respect and truly care to help his pain. Only complaint is its pricey and the true flower goes quick! If they could have a little more inventory he would be probably not say to much about the price. The product is top notch!', 1526832521),
(2959, 669, 'Robert Bell', 'https://www.google.com/maps/contrib/115950124414006285927/reviews', 'en', 'https://lh4.googleusercontent.com/-gWXQ2gidrn0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ckhH42CIXQbxgXmJjgp2jcpiYZA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 weeks ago', 'Trulieve has the worst customer service I\'ve seen in any industry. Rude staff. Completely disorganized. Poor quality control on thier products. Nasty security. Dealing with this company is a nightmare. I have no idea how they stay in business.', 1526047475),
(2960, 669, 'Brian Herr', 'https://www.google.com/maps/contrib/105724138187446325617/reviews', 'en', 'https://lh5.googleusercontent.com/-iAQEIXPRxh4/AAAAAAAAAAI/AAAAAAAAAA8/XONShbCiqac/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 2, '2 weeks ago', 'I usually go to clw location but so busy and always out of products. I went to St. Petersburg location because the web site said that the sour diesel vape cups were in all stores \"LIE\" went there no sour diesel in stock. Next time if its not in stock don\'t say it is and waste peoples time.', 1526024564),
(2961, 669, 'Thegreatmutato', 'https://www.google.com/maps/contrib/107461453110282686384/reviews', 'en', 'https://lh4.googleusercontent.com/-dbrNllMh6nw/AAAAAAAAAAI/AAAAAAAAELY/qTMmhPhn3Uc/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '4 weeks ago', 'Inconsistant. I\'ve bought trueclear for a while. They cost 60 dollars. I usually get 1ml of concentrate, i go in today and get the same kind same price. Only now the syringe has no measuring numbers, and contains .15 less:/(i know this because i compared 2 syringes from before, and they lable there packaging meticulously.)\nI called and they tried to clame you get diff amounts based on strength? Its hard to get someone on the phone, and when you do they seem a little deceptive. The numbers on the package don\'t lie though... I guess ill update when i see how they handle this problem. Probably gonna call Bay News 9', 1525301562),
(2962, 670, 'Shelley Rohrbaugh', 'https://www.google.com/maps/contrib/107563263521996330394/reviews', 'en', 'https://lh3.googleusercontent.com/-_fgkSWPZmbI/AAAAAAAAAAI/AAAAAAAACuc/4ZNETliMdBk/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'OMNI MEDICAL SERVICES - Friendly staff, willing and ready to answer any of your questions. Knowledgable doctors that make you feel welcome!', 1508271110),
(2963, 670, 'Ricky Concepcion', 'https://www.google.com/maps/contrib/101995097496296971609/reviews', 'en', 'https://lh3.googleusercontent.com/-ZqV0x7g6wk0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0FUzftpq31K9zn4iqLibj6a3VZ9A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'Love these guys, great team.', 1508182235),
(2964, 670, 'Donovan Cope', 'https://www.google.com/maps/contrib/101215214874046789232/reviews', 'en', 'https://lh4.googleusercontent.com/-PT19M77YbAc/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2k745tDSsNzwdb_c6YydUd1BRpNA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a year ago', 'Excellent fast friendly staff got there early and was seen early', 1494357233),
(2965, 673, 'Om Terr', 'https://www.google.com/maps/contrib/110314519379830800464/reviews', 'en', 'https://lh3.googleusercontent.com/-gfZ4PpFTq1o/AAAAAAAAAAI/AAAAAAAAANc/P38cPWq0Xz8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'a month ago', 'The staff at this location is very trustworthy, friendly, informative, dedicated and their team keeps expanding. The only complaints I have for this location is the very small parking lot and the uncomfortable chairs in the waiting area. Others may complain about arriving to find out that SOME/ALL products are not in stock, this can be avoided by contacting the number provided and directing towards the inventory department. There seems to always be product available at this location, maybe not what you are looking for exactly at times but they are always able to provide relief whether it\'s from one product or another. The amount of relief Trulieve has brought to my life for the past 6 months has been positively life changing, they have never let me down!', 1524345273),
(2966, 673, 'Jorge', 'https://www.google.com/maps/contrib/103246731937050491950/reviews', 'en', 'https://lh6.googleusercontent.com/-z5fUQXh6Nxw/AAAAAAAAAAI/AAAAAAAADac/-H6W0p-X70k/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 1, 'a month ago', 'Hard to believe all the 4 & 5 star reviews. Supply problems continue. There is practically no product to be had in Bradenton today 04/17. Certainly not what I ordered online. As soon as I walked in, there was another customer complaining to the manager about this issue. What\'s the point of offering dozens of products if Trulieve can\'t keep them in stock? Perhaps just two or three strains and higher production. The supply problem is bad, hasn\'t improved and doesn\'t show signs of improving.', 1524058381),
(2967, 673, 'Rob Powell', 'https://www.google.com/maps/contrib/108077587399467921731/reviews', 'en', 'https://lh4.googleusercontent.com/-PVxc8dc8JZ0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3mxx0I6Thli1heL8F0izTJj7uhRg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Today was my first visit to Trulieve in Bradenton, FL…Would like to say the rep servicing me was wonderful and very polite… I went into the store knowing what I wanted beforehand from studying all links I could about the strains are available here in Florida… Also she suggested that I add a middle of the day dosage and after thinking about it I realized it made sense… \n\nI was given both a first time purchaser discount and a disabled veteran discount…\n\nCame home and took a puff and I haven’t felt that good since 2009…Can’t wait to get off the stupid pain killers…', 1519777619),
(2968, 673, 'Ty Crews', 'https://www.google.com/maps/contrib/104775889917626737681/reviews', 'en', 'https://lh3.googleusercontent.com/-ivLgViiup_Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1VQhku8QATOZTTXveV3vzZ5RRroQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 3, 'a month ago', 'Until they can be relied upon to provide consistent inventory, you\'d be best served elsewhere. They have a great product, just not in stock. \nSelling product is simple, provided you have anything worthwhile to sell. \n\nAt time of this review, there are only CBD Syringes at Bradenton.', 1523341218),
(2969, 673, 'Robert Bell', 'https://www.google.com/maps/contrib/115950124414006285927/reviews', 'en', 'https://lh4.googleusercontent.com/-gWXQ2gidrn0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ckhH42CIXQbxgXmJjgp2jcpiYZA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a week ago', 'Awful company. Dealing with thier call center is a nightmare. Rude staff. Completely disorganized. Poor quality control on thier products. Dealing with this company is never easy. I have no idea how they stay in business.', 1526993980),
(2970, 674, 'Richard Cassidy', 'https://www.google.com/maps/contrib/106746145875208314462/reviews', 'en', 'https://lh4.googleusercontent.com/-bk9XNRRve6s/AAAAAAAAAAI/AAAAAAAADF8/OlgpIOG6K1w/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 2, 'in the last week', 'First impressions on 05/30/2018 at 10:20am:\n\n • Loud, very loud, yet bubbly. There was a huddle of folks in the cafe area \"chatting\" away. This felt odd, added to my anxiety, and left me feeling as if I was an outsider to their party happening right beside me.\n\n • Very stylish and elegant wall showcasing their medication line. Great job on the display, folks!\n\n • The newly-hired gentleman who greeted this morning was perfectly upbeat and genuinely nice, kudos!\n\n • Things took a downward turn with the initial consultation. I asked if we could discuss the medication as we looked at the product wall, and she replied, \"we can discuss it here\" looking at pictures. Gratefully the lady beside her suggested we talk at the wall, thank you!\n\nThe whole consult felt rushed leaving the impression that she had more important things to do. (-2)\n\n • Unlike other Florida dispensaries, they do not provide a discount to low-income patients, only students and first responders. (-1)', 1527696157);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(2971, 674, 'Janna Marie', 'https://www.google.com/maps/contrib/113887270588437424147/reviews', 'en', 'https://lh3.googleusercontent.com/-7BSkXKcS_ag/AAAAAAAAAAI/AAAAAAAA2XY/1AFztpK3zHs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Crystal & Austin  were unbelievably professional and helpful. I couldn’t believe how nice and lovely they were. I didn’t meet Austin, he was in the car, but when I spoke with him on the phone he was very polite and made me feel comfortable. Crystal was the one who explained everything to me and she was very enthusiastic,  knowledgeable and sweet.  I highly recommend both of them. They did a phenomenal job. So impressed!', 1526154992),
(2972, 674, 'Jeff McGrath', 'https://www.google.com/maps/contrib/103895250780059458283/reviews', 'en', 'https://lh3.googleusercontent.com/-7izM9xA0e5M/AAAAAAAAAAI/AAAAAAAAARw/LYI9wcAsSVM/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I recently was approved,  and was recommended Surterra by some colleagues. I went in to the store for the first time, not knowing what to expect. I was a little nervous on my first visit, but my nerves were quickly calmed. \nThe employee behind the counter that helped me, Dre, was extremely comforting. She walked me through the procedures, the medicine, and how things work. She guided me to what I needed, and was very compassionate about it.\nI can see why my colleagues suggested Surterra to me, and I now feel that this can be life-altering. \nThank you Dre and the other lovely women Annie and Cynthia for such a great experience.', 1520046039),
(2973, 674, 'Lexy Stevens', 'https://www.google.com/maps/contrib/109828822158614534600/reviews', 'en', 'https://lh4.googleusercontent.com/-cbVy4LOOz40/AAAAAAAAAAI/AAAAAAAADKM/wkBTIJ0l_V0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'I had such an amazing experience. I had my first ever order delivered to me by Crystal and Vaughn (i hope that is correct spelling) and she was so knowledgeable and made me feel super happy and ready to medicate. I would 10/10 recommend Surterra Tampa. I cannot wait to go into the wellness center sometime! The products are very nice. My first day on them went really really good I haven\'t felt this good in years. If you are a first time patient I would really take advantage of the 50$ off 100$ or more of your first order. :) I\'m so happy. Thanks guys!', 1522548748),
(2974, 674, 'Frank Arcuri', 'https://www.google.com/maps/contrib/110887114746332399789/reviews', 'en', 'https://lh3.googleusercontent.com/-9fXhsI0EgMY/AAAAAAAAAAI/AAAAAAAAADQ/5VRQRYCjlM8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I have been to another dispensary in the past, but decided to try Surterra, and I am so glad that I did! The staff in Tampa (Andrea and Kaylee) are well trained and knowledgeable about their product. The professionalism in the staff and their clinical approach make me come back to this dispensary.  Their product is great, too.  I like the idea of the disposable pens, and they are always in stock.  I use their CDB oil and it works fantastic for me- my issues are disappearing and my blood pressure is normal.  Great job Surterra Tampa!', 1525094803),
(2975, 675, 'Eddy Herrera', 'https://www.google.com/maps/contrib/114322864414983127396/reviews', 'en', 'https://lh5.googleusercontent.com/-EBNagRZNNx8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0XHcDwJNPiuWWfIW4itArHDRe6yQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'First time I ever leave a review for a business but Express deserves this 5 star review. Highly recommend! Simple and straight forward; staff is helpful and really break down the process step by step. Wouldn’t consider going anywhere else.', 1525816415),
(2976, 675, 'Yesenia Torres', 'https://www.google.com/maps/contrib/107772326226711193611/reviews', 'en', 'https://lh5.googleusercontent.com/-FrdJ3ry1TCY/AAAAAAAAAAI/AAAAAAAAD88/uw7m5o1omu0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Super easy and convenient. Glad I didn’t go anywhere else. Staff is incredibly attentive and made the process extremely simple. As a single female, sometimes these situations can seem overwhelming; but EXPRESS is simply the best. Highly recommend.', 1525816192),
(2977, 675, 'Brandon Ramos', 'https://www.google.com/maps/contrib/104543160104087241424/reviews', 'en', 'https://lh5.googleusercontent.com/-Bh5lzsWsqsg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Hwej01ARcEaqM8lbNH1PihAe_oA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'What you see is what you get. In my previous attempts at getting a medical marijuana prescription, the cost was advertised to be similar, but that only covered the first visit. I probably saved around $2-300 and the doctors are great. Wouldn’t want to go anywhere else.', 1525362671),
(2978, 675, 'Jeffrey Coppens', 'https://www.google.com/maps/contrib/106381110339626326645/reviews', 'en', 'https://lh4.googleusercontent.com/-7WjbH5f_raM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3rkxnIIXjW5CzRABjplVuiYV2_BQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'Super easy and convenient. Got a phone call back very fast. Very attentive and made the experience easy', 1525360382),
(2979, 675, 'Rob Hernan', 'https://www.google.com/maps/contrib/118102373350514458081/reviews', 'en', 'https://lh4.googleusercontent.com/-YemD0PFJXtg/AAAAAAAAAAI/AAAAAAAADts/VP5GRzs8aEw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'TopNotch! SUPREME! I checked into many Drs before I Finally chose Dr.Lopez. I am a disabled Veteran. I have PTSD, TBI brain trauma, chronic headaches and Pain. Dr. Lopez is without a doubt the BEST! He CARES and took his time helping me during my visit with him. Him and his staff are very well informed on all of the ongoing medical marijuana issues in Florida. Very professional, very Informative and very Understanding. I would highly recommend them to anyone who is struggling!', 1527013370),
(2980, 676, 'Liberty Starr', 'https://www.google.com/maps/contrib/104530046593489005230/reviews', 'en', 'https://lh4.googleusercontent.com/-HHbVH2ZDCZo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3qmSm2uMGE1tLX_cS_FBhCYVgwig/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'From call center, exceptional to delivery I can’t speak highly of Trulieve. Todd and Adrian were very friendly and did what my first couriers did.  I wish I knew their names as each took time with showing my order the packaging even opening the cases so I could see the product I bought.  Their pride for representing Trulieve is apparent and it helps us, the customer feel good about our decisions to choose them as a premium supplier.  \n\nThe product is clean, and effect as desired once you find your right dosing.  I like that I’m in control of that and can find a balance and have my life back.  Trulieve is above and beyond the expectation of its storefront whether in person or online.  These are individuals who work cohesive teamwork and proud to bring you the product to help your life improve.  Mine significant. I hope yours too. Thanks Trulieve.  AMAZING!', 1527715948),
(2981, 676, 'Roberto Ventura', 'https://www.google.com/maps/contrib/113608233287022493303/reviews', 'en', 'https://lh4.googleusercontent.com/-uhXocH7QQN8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0LsYzFxvoYTQfI_Ne_PnCcqr56Rg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Always a magnificent experience every time I go to this dispensary , and there  products are tremendous. Never had a problem with there cartridges or pens. There staff are friendly and eager to help out with anything you don’t understand. And there delivery service is outstanding. I’ve had little complaints since I started going to this dispensary and if I do have an issue there mangers are always happy to help. thank you Trulieve for your fantastic service.', 1527178591),
(2982, 676, 'Patti Miles', 'https://www.google.com/maps/contrib/106543725231515539386/reviews', 'en', 'https://lh4.googleusercontent.com/-AK2yr8ipnXo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3-56i01f_e2_g0ogXdH50cGg2IWg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I was recently approved for Medical Marijuana and Trulieve has become my primary source of pain medicine. Although the Trulieve website is excellent,  it is not a replacement for actually going to a Trulieve dispensary. The people working at Trulieve are friendly and knowledgeable. On my first visit, Braden took the time to answer all my questions about my first purchase. So far I have had great success using Medical Marijuana. I wasn\'t sure when I started the program what to expect, but it seems like things are working out very well. Thank You Trulieve for all your help.', 1527111171),
(2983, 676, 'Franky U', 'https://www.google.com/maps/contrib/108028975900847928745/reviews', 'en', 'https://lh5.googleusercontent.com/-RoolyqVq6Ns/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1B0XaV69XgiTkAbXuEQLg_nVbg_g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I went into your store yesterday 420 and I have to say the band guy was awesome bob Marley live songs, love it and the process was a bit of a wait but everyone was very organized and the check in was smooth. Lots of people but all were polite. The guy with beard in the front kept the line moving smoothly. They had enough products and the prices are great. Will definitely come back. ', 1524331541),
(2984, 676, 'Thomas Sanford', 'https://www.google.com/maps/contrib/105003869872826251503/reviews', 'en', 'https://lh5.googleusercontent.com/-UuP9KL1yKhQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2wahCxx0hQie3PByBJDfm4PQvkdg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'I have a consistently positive experience here. First off, Trulieve has the best quality products available in Florida period and their pricing is very competitive. Ok company promo over. Now for my location  here in Lady Lake, Simply great! The employees are top notch nice, knowledgeable, and compassionate. Quick shout out to some of the guys I usually deal with Brandon, Collin, and Andy. Chris for keeping everyone safe, and Vic for keeping it all organized while being very helpful.', 1526756571),
(2985, 677, 'Craig Macks', 'https://www.google.com/maps/contrib/115956138780191802052/reviews', 'en', 'https://lh6.googleusercontent.com/-2LCp_0Eyt7A/AAAAAAAAAAI/AAAAAAABOWc/hZBTDjPjUr0/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 3, '3 weeks ago', 'I’m giving them three stars only because their inventory is always low or they are out of cartridges. The staff is extremely friendly though. I recommend the tru pod hybrid.', 1525639505),
(2986, 677, 'Ryan Smith', 'https://www.google.com/maps/contrib/101450605780804470109/reviews', 'en', 'https://lh6.googleusercontent.com/-dXopRpFw1WE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq37IeL7wRaAD099GRaQSdyD7eB_Pw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'The staff was very friendly to me, even when they were very busy the longest i waited was around 20 minutes. All their items are strain specific and well packaged and high quality. I believe this is the best place to purchase medical cannabis in the pensacola area.', 1522802853),
(2987, 677, 'Gary Ballard', 'https://www.google.com/maps/contrib/107752943271273993411/reviews', 'en', 'https://lh5.googleusercontent.com/-ZFHJA941Umo/AAAAAAAAAAI/AAAAAAAAAC4/iqbyEEG5dbA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'My experience thus far has been great. Timing and availability of certain items lacking. Live and learn! It will get even better with time I’m sure.', 1521926248),
(2988, 677, 'Tony Loggins', 'https://www.google.com/maps/contrib/109879476944089446515/reviews', 'en', 'https://lh4.googleusercontent.com/-mVjxJ3z80Cw/AAAAAAAAAAI/AAAAAAAABYk/P92eN5khrXE/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '2 weeks ago', 'Liking it so far.. even if exact product is not available, there are plenty of other options.', 1526082996),
(2989, 677, 'Laura Forshee', 'https://www.google.com/maps/contrib/113547945720671994432/reviews', 'en', 'https://lh6.googleusercontent.com/-BKcpord4g3U/AAAAAAAAAAI/AAAAAAAAMDo/9MA9MlkZEQA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'INSIGHTFUL AND HELPFUL HAPPY EMPLOYEES. PROFESSIONAL BUT WELCOMING. NICE INVETORY SELECTION. THE PEARLY GATES ARE DRFINATELY EORTH VISITING!!! I AM A RETURNING SND SATISFIED PATIENT! THANK YOU TRUELIEVE!', 1527210960),
(2990, 678, 'Ben B', 'https://www.google.com/maps/contrib/107482002032141850130/reviews', 'en', 'https://lh3.googleusercontent.com/-PJrFsMuydOE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1ddGv017ttb8tJfw7nN6e_6Aa10Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Couldn\'t Be More Disappointed\n\nWife has severe chronic migraines and finally got certified. Certifying doctor approved her for low dose but said come back in 30 days and if the current recommendation wasn\'t strong enough he\'d increase the prescribed strength.\n\nNight before visiting Trulieve I did my homework by reading through the Trulieve web site for FAQs and product selection.  Wife was in serious pain as we drove all the way across town the next day. Once we arrived we were told they were out of any product/medicine she qualified for AND HADN\'T HAD ANY FOR MONTHS.  When I mentioned that I had checked the web site and that they should update it so patients in pain looking for relief wouldn\'t be put through this I was told the web site doesn\'t get updated with information like that.  I didn\'t waste my time telling them there were several products that were highlighted in red bold letters that stated they were out of stock but ours wasn\'t.\n\nWent to Knox and got what we were looking for.  Pleasant experience... patient, knowledgeable, personable and professional agents.  Prices were excellent, the advice was super and I could tell the agent really cared about my wife\'s condition and THE PEN WAS FREE.\n\nIt\'s easier to keep a customer than find a new one and you only get one chance at a first impression.  I\'m sticking with Knox.', 1521928833),
(2991, 678, 'Mea Foodie', 'https://www.google.com/maps/contrib/101010447310219438679/reviews', 'en', 'https://lh6.googleusercontent.com/-iRSK95oAjv8/AAAAAAAAAAI/AAAAAAAAAYM/jmjOfGQb364/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Wonderful experience at this facility. Staff was extremely knowledgeable and put up with my many questions.  I will be a returning patient. Thank you Truelieve. You have no idea how much this eases my pain. I cried the first day because I had instant relief to my skin sensitivity. First time in 8 to 10 years.\n\nAdding to my post about my visit on Monday, 05/14/2018. Thank you so much Regan for your major help on this day. You are an amazing individual and Trulieve is very lucky to have you. When someone says, I need help here, it is very nice to see someone move quickly without thought for any consequences other than helping someone in need. Big hugs and big thanks to you.', 1526372159),
(2992, 678, 'Cheryl Rose Patterson', 'https://www.google.com/maps/contrib/117252565085894039209/reviews', 'en', 'https://lh5.googleusercontent.com/-g2ZRZGCfvnw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Ld7a3pWi85Qo2acpGRA_9PHUZxA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'My first time at a MM dispensary.  I had Sarah for a helper, she spent about 45 minutes explaining all the products, listening to my medical and pharmacological issues.  It was very educational and helped me make the best decision.  Much less expensive than the prescription medicines I take.', 1525354339),
(2993, 678, 'Angel Burgos', 'https://www.google.com/maps/contrib/110193847613613613833/reviews', 'en', 'https://lh5.googleusercontent.com/-p4mr_5nT28g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3jVENUTrljJNed_yeo2e71OeLG9Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Well I want to say that of the three times that I have been. I have always received an excellent services. In addition to all you employees are responsible for explaining and helping you to what may be your best need.', 1526249610),
(2994, 678, 'Jaki Waggoner', 'https://www.google.com/maps/contrib/101935232163215623440/reviews', 'en', 'https://lh3.googleusercontent.com/-aSAG4jQFmaE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq206w7W5o7no0Rs4VU-RCka0B1XjA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'I went on a Saturday around 3 there was a bunch of people in there but it went very quick the people there I guess I\'ve been there and they brought him right back I was only there 15 minutes and the lady that helped me was very knowledgeable and she even showed me some other things that were equal to the pens I ended up getting the pens but I think next time I go back I\'ll get one of the size that I can put on my back I have dystonia seizures and very bad Tremors and at times my trimmers are so bad that I can\'t even right and the lady there was very knowledgeable on the different types of items that could or would replace the pain I opted for the long pain that doesn\'t have the button because I do shake a lot and I have epilepsy also and they were very knowledgeable and getting me the different stuff that has two or three helpful things in it so far I\'ve only been doing this for 2 months and my seizures have calmed down a lot and the other stuff that goes along with it the migraines I have cut down to only five a month where I was having 15 or more a month and I haven\'t had but one seizure where I was having two or three seizures a week one of my seizures I do keep having but my complex luckily allows us to to smoke the pens as long as were smoking long cigarettes and they allow me to sit at the door and do it so the people there were very helpful and getting me the pens that I needed I gave them a rating of 5 stars because I was in and out within 30 minutes they sat down and explained everything with my wife which is my caretaker and we explained it or my wife explained it to my home health care nurse so that she could remember for me on what pens on what medication that I needed to take at the certain times shred everything down so that both my wife and health care nurse would know what I needed to take at the right time', 1525962770),
(2995, 679, 'robert roundtree', 'https://www.google.com/maps/contrib/100729854245429816696/reviews', 'en', 'https://lh5.googleusercontent.com/-DX3b9lzsmiA/AAAAAAAAAAI/AAAAAAAAAHM/jmdapuErCj0/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Best doctors to see in a Gainesville Florida for your medical marijuana recommendation', 1527186574),
(2996, 679, 'Evermont King', 'https://www.google.com/maps/contrib/116976257336383632451/reviews', 'en', 'https://lh6.googleusercontent.com/-baxNW0gg7R0/AAAAAAAAAAI/AAAAAAAAAC8/o1qLagX1mn8/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Best Dr I know. He takes the time to listen and educate and fully addresses my needs and I always leave the appointment feeling like I\'ve gained additional knowledge about my condition and the best treatment I can get for it. If you want medicinal cannabis Dr Davis provides the most convenient stress free legal path to it. He has an office in Gainesville. These few people claiming he\'s a scammer are liars plain and simple. I don\'t understand how they can drag Dr Davis name through the mud. He\'s a great guy who really cares. He gives public talks on medicinal cannabis and has been a leader and advocate of it in this area for some time now. If you want to know more like the page \"FMD Green\" on facebook and you can get a good idea of who Dr Davis is and see more accurate reviews that give people a chance to give feedback and ask questions. Watch Dr Davis\'s videos of him giving talks etc. You will find that these negative people are mad for unrelated reasons and just trying to cause problems for the sake of causing problems if you look deep enough.', 1512577886),
(2997, 679, 'Sean Jones', 'https://www.google.com/maps/contrib/113444935127302262355/reviews', 'en', 'https://lh5.googleusercontent.com/-ScPYqoadiKA/AAAAAAAAAAI/AAAAAAAAAFU/S2Km39F_SMw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Dr. Davis and his practice were nothing short of excellent.', 1525961979),
(2998, 679, 'Samantha Garneau', 'https://www.google.com/maps/contrib/107217092764778812320/reviews', 'en', 'https://lh6.googleusercontent.com/-0XYVDqS3-6I/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3GWuglQU68PmdlGT60HWyZ3tMb1Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, 'a year ago', 'You can\'t actually go to the clinic. It\'s done online in a video call. No exams. No checking of progress or treatment. How does a doctor have patients and prescribe medicine without monitoring their health? I understand it\'s not necessary, and possibly beneficial, for terminal patients. But, what about everyone else? This place is not interested in actually caring for the patient. They said they will see patients in the clinic when it is required by law. O.o They did not have very much else to say. That was enough information for me to not make an appointment.', 1492547765),
(2999, 679, 'Justin Schreiber', 'https://www.google.com/maps/contrib/112728254351044122828/reviews', 'en', 'https://lh4.googleusercontent.com/-bvlyWqYp8LE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2-JnBiHHIbcAn-hx0zlp06-8kYxw/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '10 months ago', 'Go elsewhere this quack will prescribe you bogus Willy vape pens and will disappear when you try to have your medicine switched. Also this so called doctor is collecting patients money under the guise of a computer software company. I disputed  with my bank and will be receiving a full refund due to fraud. Beware before you give this man your credit card information and don\'t let the office lady woo you claiming to support disabled veterans. The only thing this company supports is stealing from the sick.', 1499473429),
(3000, 680, 'Jeffrey Rothstein', 'https://www.google.com/maps/contrib/109907223576846572482/reviews', 'en', 'https://lh3.googleusercontent.com/-EUI5j_ZSfSc/AAAAAAAAAAI/AAAAAAAAADg/_AzyfAR0hog/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Professional, knowledgeable and an overall amazing experience is the only way to describe my experience at the Hollywood Easy Clinic. After searching for a Dr or clinic that I felt comfortable with, a chance meeting with Kyle led me to Hollywood Easy Clinic. Kyle explained the process, helped with all online applications and was able to intelligently answer all of my questions. The Dr made me feel comfortable and took the time to answer my questions and provide the information that I required. I couldn’t imagine finding another location any cleaner, better or well managed as Hollywood!', 1524076346),
(3001, 680, 'Norman levin', 'https://www.google.com/maps/contrib/116140111198213993161/reviews', 'en', 'https://lh3.googleusercontent.com/-d8DGywqQeJM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2F4k_hVcuJnobipINkzxeh_kfBGw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'This Office was awesome. A great place to obtain a medical marijuana card, the staff and doctor are very nice and helped me through the process with the department of health. Due to my serious medical condition i was prescribed CBD to help with relief to stay away from Painkillers. Medical marijuana card doctors give a wonderful alternative route of all natural medicine! Thank you Hollywood easy clinic!!!', 1527713458),
(3002, 680, 'Amanda Ramirez', 'https://www.google.com/maps/contrib/103353139164613829294/reviews', 'en', 'https://lh6.googleusercontent.com/-VYl4pxtsX5M/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0nkO2RLp06KVA7K6RPhO8hkCTtgw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'It was an overwhelming process researching information for medical marijuana cards. I finally decided it was in my best interest to go to a clinic to learn more. This is when I stumbled across Hollywood Easy Clinic. \nI’m so glad I did! Their staff are knowledgeable and provide outstanding service. Kyle was super helpful in walking me through the process and ensuring all my paperwork was together along the way. I received my medical card in no time! Thank you Kyle and Hollywood Easy Clinic for all your help!!!', 1521492962),
(3003, 680, 'Justin Rotwein', 'https://www.google.com/maps/contrib/114829296180141090291/reviews', 'en', 'https://lh6.googleusercontent.com/-Z__11lDWwrA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2yaLvb-G-YWTwcT5iwPggcCSyg2g/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'This was one of the best experiences I\'ve had in a doctors office. After speaking with Kyle, all my questions were answered and I felt extremely comfortable for my appointment with the Doctor. At the appointment, the doc answered all my in depth questions and because of my symptoms and answers, he prescribed me to medicinal marijuana. Dealing with the state wasn\'t as bad as I thought it would be and I now have access to my medication. Wouldn\'t advise for anyone to go anywhere else!', 1525203442),
(3004, 680, 'Max Pascale', 'https://www.google.com/maps/contrib/109192146354594406898/reviews', 'en', 'https://lh5.googleusercontent.com/-5LFtqQXLofs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1NzmbS6mN3ToUNDHfs7Kko_zjoWA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Amazing experience from start to finish. Kyle was extremely pleasant and Dr. Darcy was as professional and awesome as they come! I did my digging around and research and found this location referenced as the best place in Miami to get a medical marijuana card — it certainly lived up to my expectations. Highly recommended! Thank you Hollywood Easy Clinic', 1521839277),
(3005, 681, 'Theresa Reese', 'https://www.google.com/maps/contrib/107479844058082132373/reviews', 'en', 'https://lh5.googleusercontent.com/-GLKMVs0i23g/AAAAAAAAAAI/AAAAAAAAD6M/6AvvdIRneiw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, 'in the last week', 'Dr. Beasley is a great doctor and here are a few reasons I rated her with 5 stars.  She is competent and compassionate.  I have never felt rushed in her office.  She takes the time to hear your diagnosis, current treatment, and symptoms that are concerning to the patient.  With her extensive training and knowledge of medical cannabis she informs the patient of various methods of administration, dosing information, and the expected results.  She shares information on all of the FL dispensaries available to the patient.  Dr. Beasley also shares information about saving money as some dispensaries have points earned for discounts on future purchases.  Her fees are fair, especially for the level of service provided.  \nWith Dr. Beasley\'s guidance I\'ve been able to cut back on pain medication by 25%.  Unexpected benefits (not supported by research, just my personal experience) my blood pressure has been lowered significantly, enough to stop blood pressure medicine. Additionally, my blood sugar is under control and diabetic meds were stopped.  Note: this has been under close supervision with my physicians.\nLastly, when I\'ve told my doctors that Dr. Beasley is supervising my use of cannabis they know her and say they feel secure in her knowledge, skills, and abilities. I really appreciate her efforts to educate our area physicians about the benefits of cannabis in the treatment of chronic pain. To know my doctors respect her speaks volumes!', 1527721612),
(3006, 681, 'richard copps', 'https://www.google.com/maps/contrib/114153898652170063380/reviews', 'en', 'https://lh3.googleusercontent.com/-ZpBHfixT-qs/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq357zdz2ELGDtaySBGc6kt1x4yNZA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'We are very pleased with Dr Beasley and the whole staff for efficient and professional support.  We are confident that we are getting the best care available through the clinic.  Dr Beasley ‘s staff also were very helpful assisting us with card renewal procedures and paperwork.  We appreciate all they do', 1527721359),
(3007, 681, 'Bianca Justice', 'https://www.google.com/maps/contrib/116054344873359931943/reviews', 'en', 'https://lh6.googleusercontent.com/-J7ABGtqFvs4/AAAAAAAAAAI/AAAAAAAAAAs/33_lvDpPVAg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'The clinic is clean, and I was seen quickly. The doctor is an actual medical doctor and was very professional and educated on the medical benefits of cannabis. She was able to answer all of my questions and I left confident and educated in my decision to use both THC/CBD products. Chemotherapy left me with residual permanent pain, and cannabis has helped me manage the pain and anxiety without toxic prescription drugs damaging my body even more.', 1527798613),
(3008, 681, 'mary cravens', 'https://www.google.com/maps/contrib/101042514741504009797/reviews', 'en', 'https://lh5.googleusercontent.com/-bXv7f1GWv88/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3dFvfP-Q9giKSI1WKFaU4oF3kX0Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I have been very impressed with the courtesy and kindness of all the staff at the clinic!  I received a lot of information and recommendations. I had no experience with marijuana, but I had my fill of 15 +yrs. in pain management and other medical professionals care. I am happy with my decision to reach out.', 1527726521),
(3009, 681, 'Dustin Perry', 'https://www.google.com/maps/contrib/100688907651121199223/reviews', 'en', 'https://lh4.googleusercontent.com/-AS7FQARtE_A/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Bg5cvQyrGOxmCZJjqiflWLQh0MQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'Dr. Beasley is AWESOME! I misread my appointment time and showed up near closing time, but instead of turning me away and making me reschedule, she agreed to see me. I highly recommend her and her amazing staff. ', 1527735142),
(3010, 682, 'Alex Fuge', 'https://www.google.com/maps/contrib/118241323233252903129/reviews', 'en', 'https://lh3.googleusercontent.com/-fr_AV586AUM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1AKuHpSuz66dhqGdUCQe9usHnr7Q/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'This is the most wonderful experience I have ever had in speaking with a practitioner in regard to pain and mental health. No nonsense, asked necessary information of me, as well as informing me properly of the time frames and any information I could have needed. Very clear and concise. Did not feel rushed at all. Amazing experience overall.', 1527698165),
(3011, 682, 'Scott Spradlin', 'https://www.google.com/maps/contrib/106755767762137582268/reviews', 'en', 'https://lh6.googleusercontent.com/-xDg2i4HAxV8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2vpY4MuOWwaZlFGU50EJ-eOrGtCA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'My visit was very nice. What stood out to me is that the doctor took the time to listen to my concerns and explained my options and care. He had genuine concerns and together work out a treatment plan. This I found refreshing he didn\'t just tell me what he thought was best for me and hand me a script he worked with me just like doctor\'s use to do. A rarity in today\'s medicine.', 1527709972),
(3012, 682, 'Cathy Holsclaw', 'https://www.google.com/maps/contrib/100429937002772039027/reviews', 'en', 'https://lh5.googleusercontent.com/-Mo4CEkAai-c/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3YfIk6O53bgDICtuKBr5gigFnvoA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Staff was very nice, informative and made me feel at ease.  So glad I went.  I would suggest to anyone they should go and give them a chance to change your life for the better.', 1526522108),
(3013, 682, 'Mick Shea', 'https://www.google.com/maps/contrib/112327668305446735275/reviews', 'en', 'https://lh5.googleusercontent.com/-LKZg_ir3u-U/AAAAAAAAAAI/AAAAAAAD2cI/jhTuwGjfRd8/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg', 5, 'a month ago', 'I made my appt online at a time convenient for me, they were efficient and courteous when I arrived to help me with the initial paperwork. As soon as I finished the paperwork the doctor met with me, answering all of my questions and clearly explaining the process and setting my expectations for the rest of the process. Overall, a very positive experience.', 1524232360),
(3014, 682, 'Justine Ruggio', 'https://www.google.com/maps/contrib/110364903679927428313/reviews', 'en', 'https://lh4.googleusercontent.com/-fclG9vKHoic/AAAAAAAAAAI/AAAAAAAAAGk/38hhmU0LyMo/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Very friendly staff, they were informative and took me in for my appt on time. The process was quite easy and understandable for someone who has never been treated before.', 1527168108),
(3015, 683, 'Gary Saldo', 'https://www.google.com/maps/contrib/104263204101039754292/reviews', 'en', 'https://lh4.googleusercontent.com/-wJ5f8kWuyMQ/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3o7gU6ex83SmA9dFXDCq2M1Stleg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', '2/28/18 What a great experience at Tetra. The doctor and staff couldn\'t be any more helpful and professional. They explained everything to us. We changed doctors from another company who were horrible and made the switch go easy. The other doctor wanted $50 to release from them witch is illegal, if the doctor and staff did not inform us we would have played them. We recommend them highly. They also have a great sense of humor. Thank you all for your help.', 1519862815),
(3016, 683, 'Eric Scott', 'https://www.google.com/maps/contrib/110766092738330530475/reviews', 'en', 'https://lh5.googleusercontent.com/-S3djOMaxuqE/AAAAAAAAAAI/AAAAAAAABnQ/luEIK8ZdQks/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '2 months ago', 'Update: after posting this negative review, the management called me to tell me they are justified in their exorbitant price since they have to pay for a doctor. Well what doctor needs to earn $100 in 10 minutes with no healing involved whatsoever? I get that they have fixed costs. It’s still too much. Especially when people are getting approved for things like “low appetite.” I could barely eat my Big Mac last night because it was so nasty, so let me go get a medical marijuana card. He also questioned my knowledge of economics and accused me of staying home all day and smoking weed, which may or may not be accurate, but you should never say this to a customer. One day, this scam will die when marijuana is legalized. \n\nThe management replied to review stating that the end result of this is that the patient receives “specially produced medicine.” In Seattle you can buy, directly off the shelf, exactly what they are selling in these so called medical dispensaries, but over there they don’t bother with pretentious labels. No, the entire system truly is a scam to get money into the pockets of clever business tycoons and Rick Scott.  \n—\n\nTook me six months to realize it was kind of a scam. It took about five minutes for the doctor to decide I was eligible for medical. Actually before the doctor even came in the nurse said I seemed eligible. \n\nSix months down the road my prescription expires. They want $99 to renew it. The doctor who barely looked at me and signed me up. \n\nSo you’re asking me to pay you $150, the state $100, and $100 every six months.. to buy weed. Please jump into the nearest lake. \n\nAlso for a month after I signed up they would not answer the phone. Not sure why. Had to call five locations to get someone to pick up.\n\nPlaces like this are just a temporary middle man until recreational is legalized. Making tons of money off of people who want to get high. Meanwhile the dispensaries have extremely limited options, have lines out the door (thanks to literally anyone being accepted into the program), and I NEVER RECEIVED MY CARD. Had to open up my email every time I walked into the dispensary.', 1521688630),
(3017, 683, 'Captain Johnny', 'https://www.google.com/maps/contrib/106353095489844099447/reviews', 'en', 'https://lh6.googleusercontent.com/-7y96bJqDlWU/AAAAAAAAAAI/AAAAAAAAAAc/l8BTi1FUSic/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'I\'m an unlikely patient.  I didn\'t even know about Medical Marijuana.  Was approached by someone that works at Tetra that overheard me complaining about health issues at a restaurant I go to.  I was very nervous about doing this with the stigma and all.  Dr. Scott and Jasenia in particular made me feel at ease and that I had made the right decision.  I want to mention Tom their manager as well who helped me overcome some issues and got me into the clinic. Such a great staff.  Explained in depth and took time with me to make me comfortable.  I was \"certified\" within 3 weeks and able to buy some medication.  The difference it has made already to my health is just unbelievable to me. I absolutely recommend Tetra Health Center and Medical Marijuana.  Don\'t let the stigma scare you away.', 1525270958),
(3018, 683, 'Jared Wiley', 'https://www.google.com/maps/contrib/102401736471628955879/reviews', 'en', 'https://lh3.googleusercontent.com/-n2AniBa4DKw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2n549RBJ66CHKBpGezZdi77L0NkA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I was a bit nervous about going in to Tetra Health Care. I was greeted by Tracy Lee she was proffesional and made the entire experience comfortable. I meet with Dr. Scott he spent Close to 10 minutes with me going over my conditions and what to try and expect. \nMy primary care doctor spends less than two minutes with me no wonder I still have concerns. \nI can say I feel better than I have in years I sleep better I now have energy and have gotten back to exercising things I didn’t expect in the beginning. \nI would highly recommend Tetra Health Centers \nThank you for being the proffesional you are.', 1523894788),
(3019, 683, 'Victoria Rose', 'https://www.google.com/maps/contrib/112560070205153275431/reviews', 'en', 'https://lh6.googleusercontent.com/-ulRHBhO8vmY/AAAAAAAAAAI/AAAAAAAAb2E/9u3TzRfqN4A/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 months ago', 'I had such a positive experience at THC!   All the employees in the office were courteous and efficient. Dr. Scott and the Manager, Tom were so professional and knowledgeable.  I am so grateful to have the option to treat my conditions without taking harmful, and addictive, prescription medication.    \nThank you THC!', 1516903370),
(3020, 684, 'Michael Moore', 'https://www.google.com/maps/contrib/106070153611295580227/reviews', 'en', 'https://lh3.googleusercontent.com/-Rgp8-hddIH4/AAAAAAAAAAI/AAAAAAAAABo/ztzsh422Odw/s128-c0x00000000-cc-rp-mo/photo.jpg', 2, '2 months ago', 'The staff at the Dr office was very helpful. But they didn\'t disclose all their fees and when your already a couple hundred in its a little late to be able to say screw it and go to a more upfront and honest place. They didnt disclose that the prescription was not included in your visit or cost. You have to pay extra to get them to even write the script to go to the pharmacy. Anytime you call you are forwarded to Cali and they don\'t have a clue on what\'s going on in fl so don\'t expect a lot of help there. I mean for the most part the people I felt with in person were great it\'s just when you have to call and try to talk to someone you get people that are not even in the area.', 1521824981),
(3021, 684, 'S Bennett', 'https://www.google.com/maps/contrib/107677533438437504554/reviews', 'en', 'https://lh6.googleusercontent.com/-unUQ1-dZUp4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1qCtLwSLcjsVCcGiYsYSdHvkLemg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Overall a great experience! Longer process than I initially thought (not Orlando420’s fault)! \nThe cost was $200 to get started plus the $75 to the state. Was recently informed it’s an additional $30-70 a month for them to send the prescription to the dispensary. ALSO, you have to pay the $200 every 7 months; not a full year. Other than that everyone I have talked to have been very nice and quick to answer questions. Thanks again!', 1519223242),
(3022, 684, 'Rock Roll', 'https://www.google.com/maps/contrib/116073628952718344842/reviews', 'en', 'https://lh4.googleusercontent.com/-YJTqVtf_Tzc/AAAAAAAAAAI/AAAAAAAAA8o/NmjJ86lCx84/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 weeks ago', 'Mariah is amazing.  The doctor is amazing.  They explain things very clearly and are the best priced option for Florida as far as I\'ve seen.  Very easy to work with.', 1525466634),
(3023, 684, 'Katie', 'https://www.google.com/maps/contrib/117052755700275454448/reviews', 'en', 'https://lh5.googleusercontent.com/-uMCdEkVRCSo/AAAAAAAAAAI/AAAAAAAAACo/lCPg5SIzl68/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 months ago', 'Great customer service and very helpful through any process!  Allie is great and helped me through a really rough transfer.  They are always quick to help and answer any questions I have.  Would definitely recommend to anyone!  They make the process for receiving needed medication as easy as they possibly can.', 1519174272),
(3024, 684, 'Chris Waugh', 'https://www.google.com/maps/contrib/109390363872146267738/reviews', 'en', 'https://lh3.googleusercontent.com/-MmJcWoHsQTE/AAAAAAAAAAI/AAAAAAAAACs/M7bsCDHifZY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'After years of having severe PTSD I was seen by these WONDERFUL people and was able to obtain my med card. Allie is awesome and funny everybody was very friendly and helpful. I can finally be ME again and its all thanks to the Dr n staff! Thank you all so much! Its been Hell, n they\'ve made it Heaven.', 1522962369),
(3025, 685, 'nancy becker', 'https://www.google.com/maps/contrib/110375303524994424225/reviews', 'en', 'https://lh3.googleusercontent.com/-Iu9oRbvj1l8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0Nm2eTHGUD38O_n7apPue01ggXfQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'They are the nicest people to deal with.  So kind and helpful.  A big shout out to David Medina, from Miami office.  David took so much time explaining everything and answering all my questions.  Thank you to all of u for your help and medication that is truly so helpful.  Thanks to Donna at Sunrise office for her help also.  Thanks to all of u for making me feel better.  ', 1527088102),
(3026, 685, 'Celeste Burke', 'https://www.google.com/maps/contrib/109937294592248475876/reviews', 'en', 'https://lh6.googleusercontent.com/-xDOH3khrwNo/AAAAAAAAAAI/AAAAAAAAADw/iySrPWxJqWU/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '3 weeks ago', 'Everyone was so nice and helpful. I was surprised that everyone seemed to know the answers to every question, not just the doctor. The front desk people were very well versed in their services and how the process works. It was so easy and stress free I felt like I was in another dimension. Other services should really take note. I highly recommend them!', 1525456936),
(3027, 685, 'Victoria Rivera', 'https://www.google.com/maps/contrib/116920686175211303492/reviews', 'en', 'https://lh4.googleusercontent.com/-dHTbvY-f5k4/AAAAAAAAAAI/AAAAAAAAOvo/RokCnzkBkuU/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a week ago', 'Fast service, everyone in the office was very nice, they don\'t judge you and the can answer allllll your questions! As soon as we  walked in we were greeted and helped. the wait to see the doctor was not long at all and Dr.Beams was very nice and knowledgeable . he knows his stuff! u feel very comfortable and not judged .. they want to help people!', 1526924299),
(3028, 685, 'Carolynn Castillo', 'https://www.google.com/maps/contrib/104304817356401128789/reviews', 'en', 'https://lh5.googleusercontent.com/-qYl0pN2nqBU/AAAAAAAAAAI/AAAAAAAAAnc/uLdvFjgZSTQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'This was my first experience with medical marijuana. I choose Certified Marijuana Doctors cause of their great reviews. Honestly I was a little nervous cause I didn’t know how the process worked or what to expect.  I couldn’t have picked a better place to get started! The staff was amazing especially Julie she made me feel so comfortable and they made the set up so easy! The doctor was also great he took the time to evaluate my needs. I would definitely recommend this place!', 1521679957),
(3029, 685, 'William Bacon', 'https://www.google.com/maps/contrib/106165493652225080229/reviews', 'en', 'https://lh3.googleusercontent.com/-e1gu3fhafoM/AAAAAAAAAAI/AAAAAAAAD0E/CpbtPRO_MLY/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'Nice staff. Friendly and courteous.  Obtaining certificate and registry profile was simple.  I had a small issue: Julie was eager to help!  We came up with a solution. Couldn’t be happier. Awesome.', 1526671959),
(3030, 686, 'Jillian B', 'https://www.google.com/maps/contrib/115756597273207479732/reviews', 'en', 'https://lh3.googleusercontent.com/-hoM6tvGPHg4/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0csFyZK5Fj7eeHulJVSRbaqURjjg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 weeks ago', 'Amazing Clinic :) Nothing but great patient and customer care service. Everything went smooth. They make it easy for you to apply ,understand the process, and help you with any answers you may have questions about. Nichole (admin), Melissa and Dr.Mitchell are all wonderful , caring, and knowledgeable. Prices are lower then any other place ,clean office and they run the firm efficiently. My husband also went through them with  zero hassle and zero issues on being approved. Definitely Recommend :)', 1526493335),
(3031, 686, 'Anthony Cooper', 'https://www.google.com/maps/contrib/114509956626853142933/reviews', 'en', 'https://lh5.googleusercontent.com/-tWBzHqlUpW0/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1kEPrY2SGwuaUwARLWb46xuOqHUQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'in the last week', 'I stopped by Liberate Physician Centers a couple of days ago and was amazed at how professional the staff were, how clean the office is, and how knowledgeable Melissa was about the products for medical marijuana. Not what I was expecting- a hole in the wall type of establishment with the possibility of shady doctors. They were the EXACT OPPOSITE!!! I will be making sure that they not only get my business, but I will refer everyone that I know!! Go Liberate!!!!', 1527270599),
(3032, 686, 'Stuart B', 'https://www.google.com/maps/contrib/103733366131493658855/reviews', 'en', 'https://lh3.googleusercontent.com/-4tp8wLIUzhA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3JqgXFevExKrtZh75g6zVderBNOA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'a month ago', 'Great clinic! Thank you so much! Very professional and friendly.   Nicole (admin) was great and handled all my questions and kept me informed. Dr Mitchell  was kind and compassionate and spent extra time with me discussing treatment options for my PTSD. Very Veteran friendly, thank you so much!!!!!', 1524756000),
(3033, 686, 'Cameron McIver', 'https://www.google.com/maps/contrib/107026688354252464848/reviews', 'en', 'https://lh6.googleusercontent.com/-tIP9pfaMltA/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3f8zIGQQfP4vEW7Cm_2ISskktFmA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a week ago', 'What a great practice that truly puts their patients first. Not only are they timely, Melissa and her staff demonstrate compassion, care, and empathy for their patients by creating a warm and friendly environment that is always welcoming and comfortable. Thank You Liberate!!!', 1527090648),
(3034, 686, 'Charles Hall', 'https://www.google.com/maps/contrib/111979574559018957216/reviews', 'en', 'https://lh6.googleusercontent.com/-xxwZdonc3ro/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2PvnBA7i17hQHKF32A2-fupOYVBA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, 'in the last week', 'I have been going to another MD for over a year now and although medical marijuana has been a true blessing in my life my treatment by the physician was lacking as well as I was continuously being charged for repeat visits. Liberate on my first visit has not only saved me substantial amounts of money has started me on a regimen to ween off of opiates completely. Anyone seeking help with treatment to kick opioids and all the other narcotics subscribed today call Liberate.', 1527273124),
(3035, 687, 'Angel Torres', 'https://www.google.com/maps/contrib/108486594532381752396/reviews', 'en', 'https://lh6.googleusercontent.com/-3gm0-hMLqa0/AAAAAAAAAAI/AAAAAAAAAVs/x9I-EIYxLOI/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'From my appointment to actually have my MM card approved the process took exactly 30 days.  Within that time this facility provided me with excellent care and most notably from Steve and Brett within the office.\nI have and would recommend this facility to anyone looking for an alternative way to manage their illnesses whatever they may be.\nBe prepared with your medical records, follow the steps they give you, when you are approved make sure they issue you a prescription, which they did for me in a matter of hours and above all be patient. \nUltimately, this is up to FL to approve your application.', 1517962060),
(3036, 687, 'Eric Ortiz', 'https://www.google.com/maps/contrib/107884334201380660666/reviews', 'en', 'https://lh3.googleusercontent.com/-IPQ3EAslnlg/AAAAAAAAAAI/AAAAAAAAdP0/cavHJP3iWnk/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '5 months ago', 'Talked to Steve super nice guy willing to answer all my questions explained the process and the benefits now I’m considering this as a form of treatment. The man had no problem taking his time and really giving all I needed to make my decision if you want great customer service and someone with patients and not feel hard pressed this is the spot to go check out', 1513003477),
(3037, 687, 'Edwin Moses', 'https://www.google.com/maps/contrib/111218657936387306736/reviews', 'en', 'https://lh3.googleusercontent.com/-3F9vzD24cRM/AAAAAAAAAAI/AAAAAAAAABU/uzDy1Lvkz7w/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '6 months ago', 'Good doctor no hassle! Very nice and informative.\nHighly recommend', 1512022090);
INSERT INTO `review` (`id`, `place_id`, `authorName`, `authorUrl`, `language`, `profilePhotoUrl`, `rating`, `relativeTimeDescription`, `text`, `time`) VALUES
(3038, 687, 'Mike Thomspon', 'https://www.google.com/maps/contrib/101010555195958723025/reviews', 'en', 'https://lh6.googleusercontent.com/-CX8xpNTf9bo/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1P8sDLJzc8cTPnWeyl9ne6leYQjQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'I had a good experience, helped me out to getting my state id card', 1512506440),
(3039, 687, 'Kartik Raj Gole', 'https://www.google.com/maps/contrib/103677136588948556557/reviews', 'en', 'https://lh6.googleusercontent.com/-QmknQUOWD0g/AAAAAAAAAAI/AAAAAAAAACM/00iG_vbGvSs/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '5 months ago', 'Good price, everyone was friendly and helpful with all my questions', 1512577173),
(3040, 688, 'C D', 'https://www.google.com/maps/contrib/101220123272732367979/reviews', 'en', 'https://lh4.googleusercontent.com/-1BWihjtNZTI/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1DX9vhc8GMxSQ8LYlamsYJtvVOkg/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '3 weeks ago', 'All was great until I net this grumpy guy behind counter!! My apologies I was a first time visitor but c\'mon, you made me feel like I was so inconveniencing you even down to the hello I had to pry out of You!\n2 thumbs down for grumpy guy!!\nThank you', 1525633703),
(3041, 688, 'LaQuinta Moore', 'https://www.google.com/maps/contrib/109734315614549241642/reviews', 'en', 'https://lh5.googleusercontent.com/-9HTxrFoJtzE/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2YCBq27uqay5UA6k9bOab_0TfnSg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '7 months ago', 'The customer service was phenomenal and the level of care was just amazing. Please stop in. They do accept walk-in.', 1507650397),
(3042, 688, 'brandon james', 'https://www.google.com/maps/contrib/100606413510955179819/reviews', 'en', 'https://lh3.googleusercontent.com/-S0j-uXtfl3g/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0ezyEwaLSlonovtUyvT5ZAq0ZqyQ/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 5, '8 months ago', 'Great help navigating the process in FL. Highly recommend stopping in.', 1506960285),
(3043, 689, 'Niki Nak', 'https://www.google.com/maps/contrib/112380359797937841136/reviews', 'en', 'https://lh3.googleusercontent.com/-421jVgZ94FY/AAAAAAAAAAI/AAAAAAAAAPQ/gVVgQWdUDiw/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '2 months ago', 'Even though I live over an hour away, I decided to try out this office on a whim. I am SO glad I did. Dr Gebhardt was very to the point and insightful, he gave me some great health advice and information. Kristina was SO amazing. I am not a recreational marijuana user, and she was able to educate me extremely well about what she thought would work best for my particular illness and what options I had.. and wow there is a LOT of them. I am so very pleased with both of them, very kind and helpful people. They were very professional, informative, and I left feeling very relieved to finally get another alternative to the pain pills and nerve-blockers I have been taking for my autoimmune disorder. I submitted my application to the state today, and will update on how long it takes the state to send me a card (told it typically takes 4-6 weeks). But yes, I highly recommend them. They are located inside the big chiropractic building. \n\nUPDATE: I got my medical marijuana card 25 days after submitting my application to the state; pretty quick and painless. If you are in chronic pain and looking for another way to manage it besides pills and \'just dealing with it\', PLEASE do yourself a favor and look into medical cannabis. I urge you to look past the stigma and keep an open mind. Using CBD\'s has truly changed my life!', 1521033994),
(3044, 689, 'gordon kleizo', 'https://www.google.com/maps/contrib/107627313908601073114/reviews', 'en', 'https://lh6.googleusercontent.com/-COaMm7zaPX8/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1Fubs5iwE0B3a9EnSlj9Lf2QSfdg/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '3 months ago', 'Worth it, even for the drive from Orlando! Treated my wife with utmost respect and professionalism.', 1518189717),
(3045, 689, 'Nort Ward', 'https://www.google.com/maps/contrib/105577063461602059349/reviews', 'en', 'https://lh6.googleusercontent.com/-YSHX09GFk8Q/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0E4gvYFaT7XQeM8hoVEqrEZtbw3w/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '10 months ago', 'It has been over 2 months since I first started the process after almost $700 I am still waiting for my Medical Marijuana Card', 1501436568),
(3046, 690, 'Angela Macaluso', 'https://www.google.com/maps/contrib/114900073459736621004/reviews', 'en', 'https://lh5.googleusercontent.com/-w2iSnpHh3Fg/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq33C97wWoEHFqY3w2jCbPLl2BTOnw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg', 1, '2 months ago', 'Wort mmj experience in my life. 375 for people to not answer the phone', 1521734139),
(3047, 690, 'Pan Lin', 'https://www.google.com/maps/contrib/105569318980060785733/reviews', 'en', 'https://lh6.googleusercontent.com/-I70m01P7Eqw/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq2-TxFomEqq5TR_wNRnguhNkx4vjQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '7 months ago', 'Take away my STAR!! RENEE never gave the Doc I had meet any of the CASH that I had paid in full. And she insisted I pay her even $100.00 more on last visit. After telling me on the phone before my arrival I owed nothing. I never received a reciept. Renee said oh you don\'t need a reciept here. I am so HAPPY to know Renee is not anywhere around such a caring Doc as I had meet when I went there. I don\'t know who may be the Doc if any in Dayton Beach now, take caution!!! RENEE POCKETS CASH,', 1508633096),
(3048, 690, 'adelle johnson', 'https://www.google.com/maps/contrib/118319966490636260921/reviews', 'en', 'https://lh4.googleusercontent.com/-UFMYLhxtteY/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0LOwxJ5_5oqi7sjaAHcAck_UY2OA/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '6 months ago', 'Please beware of any company that comes in from out of state to offer medical marijuana i.e. Cannamed from California or any companies from Arizona.They take your money and stop paying the doctor and leave. The first doctor is still doing MM evaluations and is helping out those patients who were dumped by cannamed as well as those from another company from Arizona. She is not obligated to pick up the mess cannamed left but since she is an ethical caring physician she has offered to assist these patients even though she was not paid .', 1509707984),
(3049, 690, 'Jonathan Troia', 'https://www.google.com/maps/contrib/109984262764342161688/reviews', 'en', 'https://lh5.googleusercontent.com/-32pl9urkd_E/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3TnD_emfFKk1Zf4FnYpVUoEhwrGQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 1, '7 months ago', 'communication from this company is very unacceptable and very unprofessional. Weeks later I still have not received my full recommendation that I was promised  and I have paid for it  when I first seen CannaMed back in August it has been months now since I have had the correct recommendation that I’m supposed to have.   I am qualified from the state and have my medical cannabis card I am very frustrated I would like my money back so I can be treated by a different physician that will care for my wellbeing.  I will be filing a complaint with the state letting them know exactly what has happened to me with CannaMed and the doctors that have neglected me after I was promised that everything would be made right. My health is my top priority which nobody in this company seems to feel that way. No one should ever go through what I have been through with the doctors they have provided.  It’s Very disturbing  and I am very ashamed to even say that somebody can be treated in such away. Absolutely no compassion And CannaMed dose not want to rectify the situation and make things right.  Me while I was told from the Daytona Beach Cannamed they don’t want to make things right with me I thought I was coming to accompany that  has compassion and caring for patients all I have received is the exact opposite.  Meal while Canna Med in Daytona Beach continues to sign up a new patients  and neglect the existing ones they have  like me and I pointed that out to them and then they blocked me on Facebook...  and I have no other way of getting in touch with anybody because nobody  gets back to me they just neglect me.  I will never recommend anybody to this company please find yourself another company where  the doctors and patients and the company are all on the same page.', 1507799042),
(3050, 690, 'Lakeo Keller', 'https://www.google.com/maps/contrib/105215964936778817265/reviews', 'en', 'https://lh3.googleusercontent.com/-Aa_y4bC4bOU/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq3NPu-RmQfQyDVz4-EUmthCkzxIZQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '11 months ago', 'Great Dr.Hall was very professional and knowledgeable . Renee at the front desk made my visit easy and painless #420 soon\nDaytona location', 1497630072),
(3051, 691, 'lali k', 'https://www.google.com/maps/contrib/104305023902664953710/reviews', 'en', 'https://lh6.googleusercontent.com/-vL5syCTGVpM/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq0dgo2MA-yrJbTGYazywmPQZjL5DA/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, '4 weeks ago', 'I dont normally do reviews, but Dr. Brown is truly an amazing person and doctor. she does amazing work. she cares about her patients and works very closely with her them, seeing to it that everything is fine. she means business. very professional , knowledgeable and soooo kind!!!  it is hard to find good doctors, but Dr. brown respects and honor her profession. I would refer anyone to her.\nONCE AGAIN SHE IS A WONDERFUL DOCTOR. you will not regret it.', 1525363759),
(3052, 691, 'Meredith Hudson-Bourdeau', 'https://www.google.com/maps/contrib/107924508857954936529/reviews', 'en', 'https://lh3.googleusercontent.com/-h4OyeuIU1bc/AAAAAAAAAAI/AAAAAAAAAAw/h-hIJ4pS5JE/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Dr. Brown and her staff are fantastic. They are well educated and very supportive. My quality of life has improved greatly since I began seeing dr. Brown. They take the time to listen to you and find ways to help you feel better.', 1523574539),
(3053, 691, 'Susanne Van Wanzeele', 'https://www.google.com/maps/contrib/103278696893643917474/reviews', 'en', 'https://lh3.googleusercontent.com/-qA6a7VkbBU4/AAAAAAAAAAI/AAAAAAAAHb4/9dmZs0AGyNI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg', 5, '2 months ago', 'The staff is professional and always a delight. Dr Brown is a fantastic doctor. She cares for her patients and is very knowledgeable and helpful. I feel fortunate to have met her. \nI recommend her to my family and friends.', 1521126569),
(3054, 691, 'Daniel Desio', 'https://www.google.com/maps/contrib/107805392284339085769/reviews', 'en', 'https://lh5.googleusercontent.com/-_y3dTLWtb2k/AAAAAAAAAAI/AAAAAAAAAAA/AB6qoq1BP9Jd-j_Yat0RAjwixnZO8ILmJQ/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'Great and friendly staff. Dr Brown is very understanding and will work with you to help your situation.', 1522930250),
(3055, 691, 'Ileen McErlean', 'https://www.google.com/maps/contrib/110842738341172405669/reviews', 'en', 'https://lh4.googleusercontent.com/-PtcoTThIS7U/AAAAAAAAAAI/AAAAAAAAnXs/06kN0RE_8ww/s128-c0x00000000-cc-rp-mo/photo.jpg', 5, 'a month ago', 'I personally want to thank Access Marijuana RX, Being a sufferer of Rheumatoid Arthritis, Fibromyalgia and Neuropathy my pain was significant, They treated me with the utmost care and compassion. Being diagnosed is one thing, but getting the medical marijuana was a blessing, as no other treatment helped...Thank you so much!!', 1522685668);
